(18, 32, 1, NULL, 1, 'A Complete Guide to Programming in C++', 'a-complete-guide-to-programming-in-c', NULL, '0-7637-1817-3', NULL, 'Programming C++', 'This book was written for readers interested in learning the C++ programming language from scratch, and for both novice and advanced C++ programmers wishing to enhance their knowledge of C++. It was our goal from the beginning to design this text with the capabilities of serving dual markets, as a textbook for students and as a holistic reference manual for professionals. The C++ language definition is based on the American National Standards Institute ANSI Standard X3J16. This standard also complies with ISO norm 14882, which was ratified by the International Standardization Organization in 1998. The C++ programming language is thus platform-independent in the main with a majority of C++ compilers providing ANSI support. New elements of the C++ language, such as exception handling and templates, are supported by most of the major compilers. Visit the Jones and Bartlett web site at www.jbpub.com for a listing of compilers available for this text. The chapters in this book are organized', NULL, '5306964.PNG', '9609886.pdf', 1, 2002, 'London', 39, '2019-01-03 16:43:30', '2019-01-03 16:43:30', '203.190.10.206'),
(19, 33, 1, NULL, 1, 'Accelerated C++ Practical Programming by Example', 'accelerated-c-practical-programming-by-example', NULL, '0-201-70353-X', NULL, NULL, 'We assume that you want to learn quickly how to write useful C++ programs. Therefore, we start by explaining the most useful parts of C++. This strategy may seem obvious when we put it that way, but it has the radical implication that we do not begin by teaching C, even though C++ builds on C. Instead, we use high-level data structures from the start, explaining only later the foundations on which those data structures rest. This approach lets you to begin writing idiomatic C++ programs immediately.', NULL, '9811019.PNG', '7481882.pdf', 1, 2000, 'Canada', 39, '2019-01-03 17:20:56', '2019-01-03 17:20:56', '203.190.10.206'),
(20, 36, 1, NULL, 1, 'Advanced C', 'advanced-c', NULL, '0-672-30168-7', NULL, 'Programming C', 'C has become one of the most frequently used computer languages. The first C language was developed by Dennis Ritchie at Bell Laboratories in 1972 and ran on a DEC PDP-11. The ANSI standard for C, which replaced the standard written by Kernighan and Ritchie in 1978, is only a few years old.\r\nCâ€™s structure is similar to PL/I (a popular language used on IBMâ€™s mainframe computers), FORTRAN, Pascal, and BASIC. C is a simple language. It has only a small group of keywords and no support for I/O or advanced math. The power of C comes from its simplicity and its use of a standard library of functions.', NULL, '9914324.PNG', '5011904.pdf', 1, 1992, 'Indiana', 39, '2019-01-03 17:28:13', '2019-01-03 17:28:13', '203.190.10.206'),
