(26, 30, 1, NULL, 1, 'C Programming Language', 'c-programming-language', '2nd.', '978-0131103627', NULL, NULL, 'The authors present the complete guide to ANSI standard C language programming. Written by the developers of C, this new version helps readers keep up with the finalized ANSI standard for C while showing how to take advantage of C\'s rich set of operators, economy of expression, improved control flow, and data structures. The 2/E has been completely rewritten with additional examples and problem sets to clarify the implementation of difficult language constructs. For years, C programmers have let K&R guide them to building well-structured and efficient programs. Now this same help is available to those working with ANSI compilers. Includes detailed coverage of the C language plus the official C language reference manual for at-a-glance help with syntax notation, declarations, ANSI changes, scope rules, and the list goes on and on.', NULL, '3800742.PNG', '8151324.pdf', 1, NULL, NULL, 39, '2019-01-03 22:21:28', '2019-01-03 22:21:28', '203.190.10.206'),
(27, 40, 1, NULL, 1, 'C++ Language Tutorial', 'c-language-tutorial', NULL, NULL, NULL, 'C++ Programming', 'This tutorial is for those people who want to learn programming in C++ and do not necessarily have any previous knowledge of other programming languages. Of course any knowledge of other programming languages or any general computer skill can be useful to better understand this tutorial, although it is not essential.  \r\nIt is also suitable for those who need a little update on the new features the language has acquired from the latest standards.  \r\nIf you are familiar with the C language, you can take the first 3 parts of this tutorial as a review of concepts, since they mainly explain the C part of C++. There are slight differences in the C++ syntax for some C features, so I recommend you its reading anyway.  \r\nThe 4th part describes object-oriented programming.  \r\nThe 5th part mostly describes the new features introduced by ANSI-C++ standard.', NULL, '5459593.PNG', '3642843.pdf', 1, 2008, NULL, 39, '2019-01-05 14:38:57', '2019-01-05 14:38:57', '203.190.10.206'),
