(33, 44, 1, NULL, 1, 'C++ for Mathematicians : an Introduction for Students and Professionals', 'c-for-mathematicians-an-introduction-for-students-and-professionals', NULL, '978-0978-1-58488-584-9', NULL, NULL, 'This book is written for you. This is the book that I wish someone had written for me. This is a book that introduces the C++ language for people who are interested in solving mathematical problems. There is a dizzying selection of books on C++ written for a wide array of audiences. Visit your favorite bookseller and you can ï¬nd C++ books for ï¬nance, numerics,computersecurity,gameprogramming,embeddedcontrollers,graphicaluser interfaces,networkprotocols,dataandï¬lestructures,engineering,scientiï¬ccomputing,digitalsignalprocessing,simulation,neuralnets,artists,virtualmachinedesign, graphics, computational physics, cellular automata, cryptography, Web agents, business, aerospace and ï¬‚ight simulation, music and MIDI instruments, mobile phones, language translation, computer-aided design, speech recognition, database development, computer architecture, photographic imaging, fuzzy logic, hardware control, rigid body kinematics, real programmers, andâ€”of courseâ€”for dummies. We assume that none o', NULL, '7980772.PNG', '7775865.pdf', 1, 2006, 'New York', 39, '2019-01-05 20:56:17', '2019-01-05 20:56:17', '203.190.11.115'),
(34, 43, 1, NULL, 1, 'C++ from the Ground Up', 'c-from-the-ground-up', '3rd.', '0-07-222897-0', NULL, 'C++', 'This book teaches you how to program in C++ â€” the most powerful computer language\r\nin use today. No previous programming experience is required. The book starts with\r\nthe basics, covers the fundamentals, moves on to the core of the language, and\r\nconcludes with its more advanced features. By the time you finish, you will be an\r\naccomplished C++ programmer.', NULL, '8378437.PNG', NULL, 1, 2003, 'New York,', 39, '2019-01-06 15:49:56', '2019-01-06 15:49:56', '203.190.10.206'),
(35, 45, 1, NULL, 1, 'C++ In Action', 'c-in-action', NULL, NULL, NULL, NULL, 'During the first four month of 1994 I was presented with a wonderful opportunity. My old University in Wroclaw, Poland, invited me to give two courses for the students of Computer Physics. The choice of topics was left entirely to my discretion. I knew exactly what I wanted to teach...', NULL, NULL, NULL, 1, 2003, 'New York,', 39, '2019-01-06 15:59:07', '2019-01-06 15:59:07', '203.190.10.206'),
(36, 46, 1, NULL, 1, 'C++ Network Programming : mastering Complexity with ACE and Patterns', 'c-network-programming-mastering-complexity-with-ace-and-patterns', NULL, NULL, NULL, NULL, 'As networks, devices, and systems continue to evolve, software engineers face the unique challenge of creating reliable distributed applications within frequently changing environments. C++ Network Programming, Volume 1, provides practical solutions for developing and optimizing complex distributed systems using the ADAPTIVE Communication Environment (ACE), a revolutionary open-source framework that runs on dozens of hardware platforms and operating systems', NULL, '5561930.jpg', '7926085.pdf', 1, 2001, NULL, 39, '2019-01-06 16:12:12', '2019-01-06 16:12:12', '203.190.10.206'),
(37, 47, 1, NULL, 1, 'C++ Data Structure', 'c-data-structure', '3rd.', '0-7637-0481-4', NULL, 'c++', 'The focus of this book is on abstract data types as viewed from three different perspectives : their specification , their application , and their implementation.', NULL, '1639689.PNG', '5037261.pdf', 1, 2003, 'London', 39, '2019-01-06 16:20:17', '2019-01-06 16:20:17', '203.190.10.206'),
(38, 48, 1, NULL, 1, 'C++ Primer Plus', 'c-primer-plus', '5th', '0-672-32697-3', NULL, 'C++', 'Learning C++ is an adventure of discovery, particularly because the language accommodates several programming paradigms, including object-oriented programming, generic programming, and the traditional procedural programming. C++ was a moving target as the language added new features, but now, with the ISO/ANSI C++ Standard, Second Edition (2003), in place, the language has stabilized. Contemporary compilers support most or all of the features mandated by the standard, and programmers have had time to get used to applying these features. The fifth edition of this book, C++ Primer Plus, reflects the ISO/ANSI standard and describes this matured version of C++.', NULL, '5829841.PNG', '7247840.pdf', 1, 2005, 'Indiana', 39, '2019-01-06 16:25:10', '2019-01-06 16:25:10', '203.190.10.206'),
