(44, 53, 1, NULL, 1, 'Exceptional C++: 47 Engineering Puzzles, Programming Problems, and Solutions', 'exceptional-c-47-engineering-puzzles-programming-problems-and-solutions', NULL, '978-0201615623', NULL, 'C++: 47 Engineering Puzzles, Programming Problems, and Solutions', 'The puzzles and problems in Exceptional C++ not only entertain, they will help you hone your skills to become the sharpest C++ programmer you can be. Many of these problems are culled from the famous Guru of the Week feature of the Internet newsgroup comp.lang.c++, moderated, expanded and updated to conform to the official ISO/ANSI C++ Standard.\r\nTry your skills against the C++ masters and come away with the insight and experience to create more efficient, effective, robust, and portable C++ code', NULL, '7378123.jpg', '3609391.pdf', 1, 1999, 'USA', 39, '2019-01-06 17:16:21', '2019-01-06 17:16:21', '203.190.10.206'),
