(47, 30, 1, NULL, 1, 'Ivor Hortonâ€™s Beginning Visual C++', 'ivor-hortons-beginning-visual-c', NULL, '978-0-7645-7197-8', NULL, NULL, 'Welcome to Beginning Visual C++ 2005. With this book you can become an effective C++ programmer. The latest development system from Microsoft, Visual Studio 2005, supports two distinct but closely related flavors of the C++ language; it fully supports the original ISO/ANSI standard C++, and you also get support for a new version of C++ called C++/CLI that was developed by Microsoft but is now an ECMAstandard.', NULL, '8231754.JPG', '8641269.pdf', 1, 2005, 'USA', 39, '2019-01-06 18:02:13', '2019-01-06 18:02:13', '203.190.10.206'),
(48, 43, 1, NULL, 8, 'Learn to Program with C++', 'learn-to-program-with-c', NULL, '10.1036/0072230401', NULL, NULL, 'A few years ago I had the occasion to talk to a very successful author whose beginner-level book I was using to teach introductory programming at my university. He asked me how I was making out using his book in my class ,andItoldhimthatthestudentsinmyclasswithnopriorprogrammingexperience were having a hard time with it. He told me that didnâ€™t surprise himâ€”and furthermore, he didnâ€™t offer any apologies for or seem upset by it. This was my first inkling that in the world of computer books, many books claim to be aimed at the beginner market, but often itâ€™s a lukewarm effort. Most beginner-level books are aimed at the reader or learner who already has some programming experience under their belts.', NULL, '3456545.JPG', '9703730.pdf', 1, 2003, 'New York', 39, '2019-01-06 18:07:46', '2019-01-06 18:07:46', '203.190.10.206'),
(49, 49, 1, NULL, 1, 'Modeling Derivatives  in C++', 'modeling-derivatives-in-c', NULL, '0-471-65464-7', NULL, NULL, 'Derivative modeling is at the heart of quantitative research and development on Wall Street. Practitioners (i.e., Wall Street trading desk quants) and academics alike spend much research, money, and time developing efï¬cient models for pricing, hedging, and trading equity and ï¬xed income derivatives. Many of these models involve complicated algorithms and numerical methods that require lots of computational power. For instance, the HJM lattice for pricing ï¬xed income derivatives often requires coding a nonrecombining bushy tree that cannot be easily traversed and grows exponential in time and memory.', NULL, '6544079.JPG', '3005971.pdf', 1, 2005, 'USA', 39, '2019-01-06 18:16:32', '2019-01-06 18:16:32', '203.190.10.206'),
(50, 56, 1, NULL, 1, 'Modern C++ Design: Generic Programming and Design Pattern Applied', 'modern-c-design-generic-programming-and-design-pattern-applied', NULL, '978-0201704310', NULL, NULL, 'In Modern C++ Design , Andrei Alexandrescu opens new vistas for C++ programmers. Displaying extraordinary creativity and programming virtuosity, Alexandrescu offers a cutting-edge approach to design that unites design patterns, generic programming, and C++, enabling programmers to achieve expressive, flexible, and highly reusable code.', 'https://images-na.ssl-images-amazon.com/images/I/71XmotAbKBL._SX401_BO1,204,203,200_.jpg', NULL, '8314478.pdf', 1, 2001, 'USA', 39, '2019-01-06 18:21:13', '2019-01-06 18:21:13', '203.190.10.206'),
(51, 57, 1, NULL, 1, 'Numerical Recipes in C :  The Art of Scientific Computing', 'numerical-recipes-in-c-the-art-of-scientific-computing', '2nd.', '0-521-43108-5', NULL, NULL, 'The product of a unique collaboration among four leading scientists in academic research and industry, Numerical Recipes is a complete text and reference book on scientific computing. In a self-contained manner it proceeds from mathematical and theoretical considerations to actual practical computer routines. With over 100 new routines bringing the total to well over 300, plus upgraded versions of the original routines, the new edition remains the most practical, comprehensive handbook of scientific computing available today.', NULL, '6071922.jpg', '5017864.pdf', 1, 1992, 'New York', 39, '2019-01-06 19:09:53', '2019-01-06 19:10:51', '203.190.10.206'),
(52, 58, 1, NULL, 1, 'Practical C Programming', 'practical-c-programming', '3rd.', '1-56592-306-5', NULL, NULL, 'This new edition of \"Practical C Programming\" teaches users not only the mechanics or \r\nprogramming, but also how to create programs that are easy to read, maintain, and \r\ndebug. It features more extensive examples and an introduction to graphical \r\ndevelopment environments. Programs conform to ANSI C', NULL, '9050263.JPG', '4524570.pdf', 1, 1997, 'USA', 39, '2019-01-06 19:42:03', '2019-01-06 19:42:03', '203.190.10.206'),
(53, 59, 1, NULL, 1, 'Game Programming All in One', 'game-programming-all-in-one', NULL, '1-931841-23-3', NULL, NULL, NULL, NULL, '1674505.JPG', '9282544.pdf', 1, 2002, 'USA', 39, '2019-01-06 19:49:45', '2019-01-06 19:49:45', '203.190.10.206'),
(54, 30, 1, NULL, 1, 'Professional C++', 'professional-c', NULL, '0-7645-7484-1', NULL, 'c++', 'For many years, C++ has served as the de facto language for writing fast, powerful, and enterprise-class object-oriented programs. As popular as C++ has become, the language is surprisingly difficult to grasp in full. There are simple, but powerful, techniques that professional C++ programmers use that donâ€™t show up in traditional texts, and there are useful parts of C++ that remain a mystery even to experienced C++ programmers.', NULL, NULL, NULL, 1, 2005, 'Canada', 39, '2019-01-07 14:53:56', '2019-01-07 14:53:56', '203.190.10.206'),
(55, 60, 1, NULL, 1, 'Programming Embedded System', 'programming-embedded-system', '1st.', '1-56592-354-5', NULL, 'Programming Embedded C++', 'Embedded software is in almost every electronic device in use today. There is software hidden away inside our watches, VCRs, cellular phones, and even a few toasters. The military uses embedded software to guide missiles and detect enemy aircraft. And communication satellites, deep-space probes, and many medical instruments would\'ve been nearly impossible to create without it.', NULL, '3126114.JPG', '3377857.pdf', 1, 1999, 'USA', 39, '2019-01-07 14:59:14', '2019-01-07 14:59:14', '203.190.10.206'),
(56, 48, 1, NULL, 1, 'SAMS Teach Yourself in 21 Days', 'sams-teach-yourself-in-21-days', '5th', '0-672-32711-2', NULL, NULL, 'This book is designed to help you teach yourself how to program with C++. No one can learn a serious programming language in just three weeks, but each of the lessons in this book has been designed so that you can read the entire lesson in just a few hours on a single day.\r\nIn just 21 days, youâ€™ll learn about such fundamentals as managing input and output, loops and arrays, object-oriented programming, templates, and creating C++ applicationsâ€”all in well-structured and easy-to-follow lessons. Lessons provide sample listingsâ€”complete with sample output and an analysis of the codeâ€”to illustrate the topics of the day.\r\nTo help you become more proficient, each lesson ends with a set of common questions and answers, a quiz, and exercises. You can check your progress by examining the quiz and exercise answers provided in Appendix D, â€œAnswers.â€', NULL, NULL, NULL, 1, 2005, 'USA', 39, '2019-01-07 15:03:34', '2019-01-07 15:03:34', '203.190.10.206'),
(57, 61, 1, NULL, 1, 'The C+ + Programming Language', 'the-c-programming-language', '3rd.', '0-201-88954-4', NULL, NULL, NULL, NULL, '8324864.JPG', '7876146.pdf', 1, 1997, 'USA', 39, '2019-01-07 15:09:44', '2019-01-07 15:09:44', '203.190.10.206'),
(58, 62, 1, NULL, 1, 'The Elements of C++ Style', 'the-elements-of-c-style', NULL, '978-0-511-18532-8', NULL, NULL, 'As commercial developers of software components, we always strive to have good, consistent style through out our code. Since source code is usually included in our ï¬nal products, our users often study our code to learn not just how the components work, but also how to write good software.', NULL, '1531972.JPG', '1797475.pdf', 1, 2004, 'New York', 39, '2019-01-07 15:16:02', '2019-01-07 15:16:02', '203.190.10.206'),
(59, 43, 1, NULL, 1, 'SCHAUMâ€™S OUTLINE  OF  THEORY AND PROBLEMS of PROGRAMMING WITH c++', 'schaums-outline-of-theory-and-problems-of-programming-with-c', NULL, 'o-07-030837-3', NULL, 'c++', 'Like all Schaumâ€™s Outline Series books, this is intended to be used primarily for self study, preferably in conjunction with a regular course in C++ Programming. The book covers nearly all aspects of ANSI/IS0 Standard C++. It includes over 200 examples and solved problems. The author firmly believes that programming is best learned by practice, following a well-constructed collection of examples with complete explanations. This book is designed to provide that support.', NULL, NULL, NULL, 1, 1996, 'New York', 39, '2019-01-07 15:21:53', '2019-01-07 15:21:53', '203.190.10.206'),
(60, 52, 1, NULL, 1, 'Thinking in C++', 'thinking-in-c', '2nd.', '978-0139798092', NULL, NULL, 'c++ Programming', NULL, '4786592.jpg', '6654332.pdf', 1, 2000, 'USA', 39, '2019-01-07 15:26:09', '2019-01-07 15:26:09', '203.190.10.206'),
(61, 52, 1, NULL, 1, 'Thinking in C++, Vol. 1: Introduction to Standard C++', 'thinking-in-c-vol-1-introduction-to-standard-c', '2nd.', '978-0139798092', NULL, 'Programming C++', 'Wonderful book â€¦ Great stuff! Andrew Schulman, Doctor Dobbs Journal An absolute, unqualified must. One of the most-used, most trusted books on my shelf.â€ TUG Lines This is stuff a programmer can really use. IEEE Computer A refreshing departure. PJ Plauger, Embedded Systems Programming magazine â€¦Eckel succeeds â€¦ itâ€™s so readable. Unix World Should definitely be your first buy. C Gazette A fantastic reference for C++! Michael Brandt, Senior Analyst/Programmer, Sydney, Australia', NULL, '5234038.jpg', '8914867.pdf', 1, 2000, '1999', 39, '2019-01-07 15:30:54', '2019-01-07 15:30:54', '203.190.10.206'),
(62, 36, 1, NULL, 1, 'Tricks of the Windows Game Programming Gurus : Fundamentals of 2D and 3D Game Programming', 'tricks-of-the-windows-game-programming-gurus-fundamentals-of-2d-and-3d-game-programming', NULL, '0-672-31361-8', NULL, 'Windows Game Programming', NULL, NULL, '6869481.JPG', '7833896.pdf', 1, 1999, 'USA', 39, '2019-01-07 15:36:57', '2019-01-07 15:36:57', '203.190.10.206'),
