(64, 43, 1, NULL, 1, 'Cmos Digital Integrated Circuits', 'cmos-digital-integrated-circuits', '2nd.', '0-07-246053-9', NULL, 'CMOS Integrated Circuits', 'Complementary metal oxide semiconductor (CMOS) digital integrated circuits are the enabling technology for the modern information age. Because of their intrinsic features in low-power consumption, large noise margins, and ease of design, CMOS integrated circuits have been widely used to develop random access memory (RAM) chips, microprocessor chips, digital signal processor (DSP) chips, and application- specific integrated circuit (ASIC) chips. The popular use of CMOS circuits will grow with the increasing demands for low-power, low-noise integrated electronic systems in the development of portable computers, personal digital assistants (PDAs), portable phones, and multimedia agents.', NULL, '2677821.JPG', '4125478.pdf', 1, 2003, 'London', 39, '2019-01-07 15:58:53', '2019-01-07 15:58:53', '203.190.10.206'),
(65, 63, 1, NULL, 1, 'Analog Design for CMOS VLSI System', 'analog-design-for-cmos-vlsi-system', NULL, '0-306-47952-4', NULL, NULL, NULL, NULL, '1232862.JPG', '6767510.pdf', 1, 2003, 'London', 39, '2019-01-07 16:04:59', '2019-01-07 16:04:59', '203.190.10.206'),
(66, 43, 1, NULL, 8, 'Basics of CMOS Cell Design', 'basics-of-cmos-cell-design', NULL, '10.1036/0071488391', NULL, NULL, NULL, NULL, '3174110.JPG', '3748836.pdf', 1, 2007, 'London', 39, '2019-01-07 16:08:44', '2019-01-07 16:08:44', '203.190.10.206'),
(67, 64, 1, NULL, 1, 'Radio Frequency Integrated Circuit Design', 'radio-frequency-integrated-circuit-design', NULL, '1-58053-502-x', NULL, NULL, 'Radio frequency integrated circuit (RFIC) design is an exciting area for research or product development. Technologies are constantly being improved, and as they are, circuits formerly implemented as discrete solutions can now be integratedontoasinglechip.Inadditiontowidelyusedapplicationssuchascordless phones and cell phones, new applications continue to emerge. Examples of new products requiring RFICs are wireless local-area networks (WLAN), keyless entry for cars, wireless toll collection, Global Positioning System (GPS) navigation, remote tags, asset tracking, remote sensing, and tuners in cable modems. Thus, the market is expanding, and with each new application there are unique challenges for the designers to overcome. As a result, the field of RFIC design should have an abundance of products to keep designers entertained for years to come.', NULL, '9519319.jpg', '3222640.pdf', 1, 2003, 'London', 39, '2019-01-07 16:47:39', '2019-01-07 16:47:39', '203.190.11.115'),
(68, 49, 1, NULL, 1, 'Object-Oriented Project Management with UML', 'object-oriented-project-management-with-uml', NULL, '0471253030', NULL, NULL, 'This book is a practical guide to modern software development. It grew out of a course I regularly teach at TASC, which itself began as happenstance. I had been asked to appraise an online course on managing object-oriented development. I hated it. It was a rehash of the old, discredited waterfall methods of software development. They replaced the design and code steps plus some object jargon. When I expressed this opinion, TASC management threw down the gauntlet, essentially saying, â€œIf you are so smart, then you teach the course.â€', NULL, '2536072.PNG', '7872786.pdf', 1, 1998, 'USA', 39, '2019-01-07 16:57:00', '2019-01-07 16:57:00', '203.190.11.117'),
(69, 65, 1, NULL, 1, 'An Introduction  to Neural Networks', 'an-introduction-to-neural-networks', '8th', NULL, NULL, 'Nural Networks', 'This manuscript attempts to provide the reader with an insight in articial neural networks. Back in 1990, the absence of any state-of-the-art textbook forced us into writing our own. However, in the meantime a number of worthwhile textbooks have been published which can be used for background and in-depth information. We are a ware of the fact that, at times, this manuscript may pro ve to be too thorough or not thorough enough for a complete understanding of the material; therefore, further reading material can be found in some excellent text books such as (Hertz, Krogh, & Palmer, 1991; Ritter, Martinetz, & Schulten, 1990; Kohonen, 1995; Anderson & Rosenfeld, 1988; DARPA, 1988; McClelland & Rumelhart, 1986; Rumelhart & McClelland, 1986).', NULL, '3518552.PNG', '5398921.pdf', 1, 1996, 'Amsterdam', 39, '2019-01-07 17:05:00', '2019-01-07 17:05:00', '203.190.11.115'),
(70, 66, 1, NULL, 1, 'Microprocessors : Including Programming Experiments', 'microprocessors-including-programming-experiments', NULL, '0-87119-105-9', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1985, 'USA', 39, '2019-01-07 17:12:49', '2019-01-07 17:12:49', '203.190.11.117'),
(71, 67, 1, NULL, 1, 'CMOS Analog Circuit Design', 'cmos-analog-circuit-design', NULL, '978-0199765072', NULL, 'CMOS', 'Respected authors Phil Allen and Doug Holberg bring you the third edition of their popular textbook, CMOS Analog Circuit Design. Working from the forefront of CMOS technology, Phil and Doug have combined their expertise as engineers and academics to present a cutting-edge and effective overview of the principles and techniques for designing circuits. Their two main goals are', NULL, '4773436.png', '9622272.pdf', 1, 1995, 'USA', 39, '2019-01-07 17:27:06', '2019-01-07 17:27:06', '203.190.11.115'),
(72, 67, 1, NULL, 1, 'Atomic Physics', 'atomic-physics', NULL, '0 19 850695 3', NULL, 'Atomic Physics', 'This book is primarily intended to accompany an undergraduate course in atomic physics. It covers the core material and a selection of more advanced topics that illustrate current research in this ï¬eld. The ï¬rst six chapters describe the basic principles of atomic structure, starting in Chapter 1 with a review of the classical ideas. Inevitably the discussion of the structure of hydrogen and helium in these early chapters has considerable overlap with introductory quantum mechanics courses, but an understanding of these simple systems provides the basis for the treatment of more complex atoms in later chapters. Chapter 7 on the interaction of radiation with atoms marks the transition between the earlier chapters on structure and the second half of the book which covers laser spectroscopy, laser cooling, Boseâ€“Einstein condensation of dilute atomic vapours, matter-wave interferometry and ion trapping.', NULL, '8057720.PNG', '2281879.pdf', 1, 2005, 'New York', 39, '2019-01-07 17:42:19', '2019-01-07 17:42:19', '203.190.11.117'),
(73, 68, 1, NULL, 1, 'CMOS Integrated Switching Power Converters : A Structured Design Approach', 'cmos-integrated-switching-power-converters-a-structured-design-approach', NULL, '978-1-4419-8842-3', NULL, 'CMOS  Power Converter', 'In spite of being the author of this work, it is necessary that, at this point, I mention and remember all those people that, in any way, have helped me along the way that has lead me to obtain the work that you have in your hands. In ï¬rst place and for his more direct and evident implication, it is necessary that I express my gratitude to Eduard AlarcÃ³n for a magniï¬cent direction and an excellent scientiï¬c guide, especially during the ï¬rst years that I have devoted to elaborating this thesis. Among his multiple qualities, I would like to highlight his high level vision towards where it is necessary to direct the tasks of research, and also his cordial, human and next treatment.', NULL, '5982924.PNG', '3205181.pdf', 1, 2011, 'New York', 39, '2019-01-07 17:51:29', '2019-01-07 17:51:29', '203.190.11.117'),
(74, 69, 1, NULL, 1, 'Programming Microcontrollers in C', 'programming-microcontrollers-in-c', 'Second Edition', '1-878707-57-4', NULL, 'Programming, Programming in C', 'Programming is a contact sport. Programming theory is interesting, but you must sit at a keyboard and write code to become a\r\nprogrammer. The aim of this introductory section is to give you a\r\nbrief glimpse of C so that you can quickly write simple programs.\r\nLater sections will revisit many of the concepts outlined here and\r\nprovide a more in-depth look at what you are doing. For now, letâ€™s\r\nstart writing code.', NULL, '8304540.gif', '3958933.pdf', 1, 2001, 'United States of America', 39, '2019-01-07 18:33:39', '2019-01-07 18:33:39', '203.190.11.115'),
(75, 70, 1, NULL, 1, 'Vector Calculus', 'vector-calculus', NULL, NULL, NULL, 'Calculus', 'This book covers calculus in two and three variables. It is suitable for a one-semester course,\r\nnormally known as â€œVector Calculusâ€, â€œMultivariable Calculusâ€, or simply â€œCalculus IIIâ€.\r\nThe prerequisites are the standard courses in single-variable calculus (a.k.a. Calculus I and\r\nII).\r\nI have tried to be somewhat rigorous about proving results. But while it is important for\r\nstudents to see full-blown proofs - since that is how mathematics works - too much rigor and\r\nemphasis on proofs can impede the flow of learning for the vast majority of the audience at\r\nthis level. If I were to rate the level of rigor in the book on a scale of 1 to 10, with 1 being\r\ncompletely informal and 10 being completely rigorous, I would rate it as a 5.', NULL, '5507796.PNG', '1253620.pdf', 1, 2008, 'California', 39, '2019-01-07 19:03:54', '2019-01-07 19:03:54', '203.190.11.117'),
(76, 71, 1, NULL, 1, 'Computer Programming Concepts and Visual Basic', 'computer-programming-concepts-and-visual-basic', '4th ed.', '0â€“536â€“60446â€“0', NULL, 'Programming, Visual Basic', 'The information, illustrations, and/or software contained in this book, and regarding the abovementioned programs, are provided â€œAs Is,â€ without warranty of any kind, express or implied,\r\nincluding without limitation any warranty concerning the accuracy, adequacy, or completeness\r\nof such information. Neither the publisher, the authors, nor the copyright holders shall be responsible for any claims attributable to errors, omissions, or other inaccuracies contained in\r\nthis book. Nor shall they be liable for direct, indirect, special, incidental, or consequential damages arising out of the use of such information or material.', NULL, '1768256.PNG', '3073024.pdf', 1, 1999, 'United States of America', 39, '2019-01-07 19:59:15', '2019-01-07 19:59:15', '203.190.11.117'),
(77, 72, 1, NULL, 1, 'Feature Extraction and Image Processing', 'feature-extraction-and-image-processing', NULL, '0 7506 5078 8', NULL, 'extraction Image Processing', 'We will no doubt be asked many times: why on earth write a new book on computer vision? Fair question: there are already many good books on computer vision already out in the bookshops, as you will find referenced later, so why add to them? Part of the answer is that any textbook is a snapshot of material that exists prior to it. Computer vision, the art of processing images stored within a computer, has seen a considerable amount of research by highly qualified people and the volume of research would appear to have increased in recent years. That means a lot of new techniques have been developed, and many of the more recent approaches have yet to migrate to textbooks.', NULL, '5876608.jpg', '2841616.pdf', 1, 2002, 'Great Britain', 39, '2019-01-07 20:33:45', '2019-01-07 20:33:45', '203.190.11.117'),
(78, 73, 1, NULL, 1, 'Atomic Physics', 'atomic-physics-07381557', NULL, NULL, NULL, 'Atomic Physics', NULL, NULL, '9036486.jpg', '6791863.pdf', 1, 1997, 'London', 39, '2019-01-07 20:38:57', '2019-01-07 20:38:57', '203.190.11.115'),
(79, 10, 12, NULL, 2, 'MathematicalMorphology and ItsApplication to SignalandImageProcessing : Lecture Notes in Computer Science', 'mathematicalmorphology-and-itsapplication-to-signalandimageprocessing-lecture-notes-in-computer-science', NULL, '0302-9743', '9th International Symposium, ISMM 2009', 'Mathematical Morphology Signal & Image Processing', 'The 9th ISMM conference covered a very diverse collection of papers, bound together by the central themes of mathematical morphology, namely, the treatment of images in terms of set and lattice theory. Notwithstanding this central theme, this ISMM showed increasing interaction with other ï¬elds of image and signal processing, and several hybrid methods were presented, which combine the strengths of traditional morphological methods with those of, for example, linear ï¬ltering. This trend is particularly strong in the emerging ï¬eld of adaptive morphological ï¬ltering, where the local shape of structuring elements is determined by non-morphological techniques. This builds on previous developments of PDE-based methods in morphology and amoebas. In segmentation we see similar advancements, in the development of morphological active contours.', NULL, '9973937.PNG', '5174343.pdf', 1, 2009, 'Netherlands', 39, '2019-01-07 20:52:43', '2019-01-07 20:52:43', '203.190.11.117'),
(80, 12, 1, NULL, 1, 'Biomedical Imaging', 'biomedical-imaging', NULL, '0-8493-1810-6', NULL, NULL, 'Principles and Applications in Engineers Series', NULL, '9134341.png', '2132289.pdf', 1, 2003, 'New York', 39, '2019-01-07 21:38:44', '2019-01-07 21:38:44', '203.190.11.115'),
(81, 49, 1, NULL, 1, 'VLSI Fabrication Principles: Silicon and Gallium Arsenide,', 'vlsi-fabrication-principles-silicon-and-gallium-arsenide', '2nd. ed.', '0471580058', NULL, 'Fabrication', 'This book discusses the basic principles underlying the fabrication of semiconductor device integrate circuits, Its emphasis is on processes that are especially useful for very large scale integration (VLSI) schemes:however, many processes used for discrete devices and medium -density integrated circuits have also been  included, since they are the precursors of VLIS technology.', NULL, '3028865.jpg', '5556179.pdf', 1, 1994, 'USA', 46, '2019-01-07 22:14:00', '2019-01-07 22:14:00', '203.190.11.115'),
(82, 49, 1, NULL, 1, 'FUNDAMENTALS OF DISTRIBUTED OBJECT SYSTEMS The CORBA Perspective', 'fundamentals-of-distributed-object-systems-the-corba-perspective', NULL, '0-471-20064-6', NULL, 'DISTRIBUTED OBJECT SYSTEMS, CORBA', 'CORBA, the acronym for the Common Object Request Broker Architecture, is the\r\nresult of a standardization consortium, called OMG (Object Management Group),\r\ninvolving more than six hundred international software companies. OMG aims to\r\nproduce and set up an architecture and a set of standards for open distributed systems\r\nenabling invulnerability across different hardware and software vendor platforms.', NULL, '2656852.jpg', '3443689.pdf', 1, 2001, 'United States of America', 46, '2019-01-08 15:38:01', '2019-01-08 15:38:01', '203.190.11.115'),
(83, 49, 1, NULL, 1, 'W-CDMA MOBILE COMMUNICATIONS SYSTEM', 'w-cdma-mobile-communications-system', NULL, '0-470-84761-1', NULL, 'MOBILE COMMUNICATIONS', 'The remarkable progress in information technology (IT) since the late 1990s continues to\r\nfacilitate faster communications, broadband access and lower communication costs in the\r\ninformation and communications sector. Consequently, communications has penetrated\r\nnot only the business scene but also every aspect in personal life, to the extent of dramatically changing peopleâ€™s lifestyles. The widespread use of the Internet, which appeared\r\nin the 1990s, is also contributing to the advent of a wide range of multimedia services\r\nthat undermine the barriers of time and place.', NULL, '3108387.jpg', '1122484.pdf', 1, 2002, 'Japan', 46, '2019-01-08 16:00:26', '2019-01-08 16:00:26', '203.190.11.115');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(84, 60, 1, NULL, 1, '802.11 Security', '80211-security', NULL, '0-596-00290-4', NULL, NULL, 'From the early days of wireless communication, the ability to transmit news, thoughts, and feelings without wires has revolutionized our daily lives. The radio broadcasts of the 1920s brought instant news and entertainment to households all over the world. The adoption of television in the 1950s added a visual aspect to the experience. CB radio made a big impact in the 1970s, allowing individuals within a limited distance to talk with each other while on the road. In the 1980s, cellular phones and pagers allowed people to be connected to their home or office no matter where they were. Now at the start of the 21st century, low-cost, high-speed wireless data networking has become a reality. Anyone can go to his or her local computer store and easily purchase wireless networking equipment that can transmit packetbased data at millions of bits per second.', NULL, '4923907.JPG', '4489662.pdf', 1, 2002, '.', 39, '2019-01-08 16:14:24', '2019-01-08 16:14:24', '203.190.10.206'),
(85, 74, 1, NULL, 1, 'W-CDMA and cdma2000 for 3G Mobile Networks', 'w-cdma-and-cdma2000-for-3g-mobile-networks', NULL, '0471580058', NULL, '3G Mobile Networks', 'At the time we were working on third-generation (3G) wireless systems at Lucent Technologies, we realized that there were not many\r\nbooks available on this topic. ITU-R had defined four 3G systems,\r\nand published a set of standards in 1999. In most cases, our only\r\nsources of information were these standards, which were necessarily\r\nquite elaborate and were not available as a single document. The\r\npurpose of this book is to fill that void and provide a comprehensive\r\ndescription of 3G systems.', NULL, NULL, NULL, 1, 2002, 'New York', 46, '2019-01-08 16:15:32', '2019-01-08 16:15:32', '203.190.11.118'),
(86, 75, 1, NULL, 1, '802.11 Wireless LAN Fundamentals', '80211-wireless-lan-fundamentals', NULL, '1-58705-077-3', NULL, NULL, 'Master the basics in designing, building, and managing a Cisco Aironet WLAN.\r\nMaster the basics of Wireless LANs with this concise design and deployment guide\r\nUnderstand implementation issues for a variety of environments including vertical, SOHO, and enterprise networks\r\nLearn design and troubleshooting advice from real-world case studies\r\n802.11 Wireless LAN Fundamentals gives networking engineers and IT professionals the knowledge they need to design, deploy, manage, and troubleshoot their own wireless local-area networks (WLANs). Starting with an overview of the technology and architecture of WLANs, the book goes on to explain services and advanced features that such applications can provide. Most importantly, it provides practical design guidance and deployment recommendations.', NULL, '3264093.jpg', '5624414.pdf', 1, 2003, 'USA', 39, '2019-01-08 16:29:57', '2019-01-08 16:29:57', '203.190.10.206'),
(87, 76, 1, NULL, 1, 'Embedded System Design Using 8031 Micro-controllers', 'embedded-system-design-using-8031-micro-controllers', NULL, NULL, NULL, NULL, 'We are living in the embedded world. You are surrounded with many embedded products and your daily life largely depends on the proper functioning of these gadgets. Television radio CD player of your living rooms, washing machine or microwave Oven in kitchen, Card readers, Access Controllers, Palm devices of your work space enable you to do many of your tasks very effectively.', NULL, '7008050.JPG', '4383259.pdf', 1, 2002, 'India', 39, '2019-01-08 16:41:43', '2019-01-08 16:41:43', '203.190.10.206'),
(88, 39, 1, NULL, 1, 'The 8051 Microcontroller and Embedded Systems: Using Assembly and C', 'the-8051-microcontroller-and-embedded-systems-using-assembly-and-c', NULL, NULL, NULL, NULL, 'Numbering and coding systems, Digital primer, Inside the computer', NULL, '9193024.JPG', '8044812.pdf', 1, 2018, 'Taiwan', 39, '2019-01-08 16:51:24', '2019-01-08 16:51:24', '203.190.10.206'),
(89, 10, 1, NULL, 1, 'Springer Handbooks of Atomic, Molecular, and Optical Physics', 'springer-handbooks-of-atomic-molecular-and-optical-physics', NULL, '0-387-26308-X', NULL, NULL, NULL, NULL, NULL, NULL, 1, 2006, 'Canada', 39, '2019-01-08 16:55:36', '2019-01-08 16:55:36', '203.190.10.206'),
(90, 64, 1, NULL, 1, 'TDD-CDMA for Wireless Communications', 'tdd-cdma-for-wireless-communications', NULL, '1-58053-371-X', NULL, NULL, 'This is a graduate-level book on the time  division duplex(TDD)mode of code division multiple access (CDMA) technology for mobile communications. Its purpose is to familiarize the reader with the specific technologies related to the TDD mode of CDMA communications. In the TDD mode, transmission and reception to and from a user are carried out in the same frequency band, with transmission/reception switching at specific time slots. The TDD mode, as opposed to the more widely known and used frequency division duplex mode,has been used in non-CDMA mobile communications systems such as DECT and PHS. It has now become an integral part of the wide band CDMA (WCDMA) standards.', NULL, '7230024.JPG', '2152407.pdf', 1, 2003, 'London', 39, '2019-01-08 17:03:43', '2019-01-08 17:03:43', '203.190.10.206'),
(91, 49, 1, NULL, 1, 'Wideband TDD WCDMA for the Unpaired Spectrum', 'wideband-tdd-wcdma-for-the-unpaired-spectrum', NULL, '0-470-86104-5', NULL, 'WCDMA', 'This book is an outgrowth of the pioneering development work done by InterDigital Communication Corporation in 3rd Generation TDD WCDMA Technology. Many engineers\r\nand managers were involved in this development, which spanned a wide range of technology areas, including system architecture, radio interface, radio modem design, radio\r\nresource management and hardware/software implementation. In addition, TDD WCDMA\r\ntechnology had many direct and indirect contributors across the globe in the context of\r\nthe development of the 3GPP TDD WCDMA Standard.', NULL, '6015348.PNG', '1313329.pdf', 1, 2004, 'England', 46, '2019-01-08 17:20:49', '2019-01-08 17:20:49', '203.190.11.115'),
(92, 49, 1, NULL, 1, 'Data Networks, IP and the Internet: Protocols, Design and Operation', 'data-networks-ip-and-the-internet-protocols-design-and-operation', NULL, '0-470-84856-1', NULL, 'Data Networks, Design and Operation', 'The business world relies increasingly upon data communications, and modern data networks\r\nare based mainly on the Internet or at least on the IP (Internet Protocol). But despite these\r\nfacts, many people remain baffled by IP and multiprotocol data networks. How do all the\r\nprotocols fit together? How do I build a network? And what sort of problems should I expect?\r\nThis book is intended for experienced network designers and practitioners, as well as for\r\nthe networking newcomer and student alike: it is intended to provide an explanation of the\r\ncomplex jargon of networking: putting the plethora of â€˜protocolsâ€™ into context and providing\r\na quick and easy handbook for continuing reference.', NULL, '9333078.jpg', '1727296.pdf', 1, 2003, 'England', 46, '2019-01-08 17:27:46', '2019-01-08 17:27:46', '203.190.11.117'),
(93, 49, 1, NULL, 1, 'DIGITAL IMAGE PROCESSING: PIKS Inside', 'digital-image-processing-piks-inside', '3rd. ed.', '0-471-22132-5', NULL, 'IMAGE PROCESSING', 'In January 1978, I began the preface to the first edition of Digital Image Processing\r\nwith the following statement:\r\nThe field of image processing has grown considerably during the past decade\r\nwith the increased utilization of imagery in myriad applications coupled with\r\nimprovements in the size, speed, and cost effectiveness of digital computers and\r\nrelated signal processing technologies. Image processing has found a significant role\r\nin scientific, industrial, space, and government applications', NULL, '6518483.jpg', '3017567.pdf', 1, 2001, 'New York', 46, '2019-01-08 17:44:26', '2019-01-08 17:44:26', '203.190.11.117'),
(95, 72, 1, NULL, 1, 'Engineering Mathematics', 'engineering-mathematics', '4th', '0 7506 5776 6', NULL, 'Engineering Mathematics', 'In Engineering Mathematics 4th Edition, theory is introduced in each chapter by a simple outline of essential deï¬nitions, formulae, laws and procedures. The theory is kept to a minimum, for problem solving is extensively used to establish and exemplify the theory. It is intended that readers will gain real understanding through seeing problems solved and then through solving similar problems themselves.', NULL, '9335973.JPG', '3817618.pdf', 1, 2003, 'New York', 39, '2019-01-08 18:29:55', '2019-01-08 18:29:55', '203.190.10.206'),
(96, 64, 1, NULL, 1, 'Interference Analysis and Reduction for Wireless Systems', 'interference-analysis-and-reduction-for-wireless-systems', NULL, '1-58053-316-7', NULL, 'Wireless System', 'The subject of interference in communications systems is as old as communications itself. Agamemnon, the King of Mycenes, who captured Troy more\r\nthan 800 miles away, to get back his niece, the beautiful Eleni, and wanted\r\nto notify his wife Clytaemistra about this happy event, used the most sophisticated communication techniques of that time to achieve his purpose. From\r\nthat time until today, people have been aware of the importance of interference and the effect it can have on communications. Agamemnon used light\r\nsources at the peaks of mountainsâ€”by the motions of these sources, the\r\ninformation was coded and transmitted from mountain to mountain to\r\narrive at Mycenes the same day.', NULL, '7929907.JPG', '5766549.pdf', 1, 2003, 'London', 39, '2019-01-08 18:59:17', '2019-01-08 18:59:17', '203.190.10.206'),
(97, 77, 1, NULL, 1, 'TechnologyTrendsinWireless Communications', 'technologytrendsinwireless-communications', NULL, '1-58053-352-3', NULL, 'Wireless Communication', 'The use of mobile devices now surpasses that of traditional computers: wireless users will hence soon be demanding the same rich multimedia services on their mobile devices that they have on their desktop personal computers. In addition, new services will be added, especially related with their mobile needs, such as location-based information services.', NULL, '6633262.JPG', '5220611.pdf', 1, 2003, 'London', 39, '2019-01-08 19:03:05', '2019-01-08 19:03:05', '203.190.10.206'),
(98, 52, 1, NULL, 1, 'Strategic Human Resource Management', 'strategic-human-resource-management', '2nd', '0â€“536â€“72690â€“6', NULL, NULL, 'The conceptual framework for this text begins with an investment perspective for guiding managerial strategic decisions regarding human resources. Human resource management practitioners and management scholars have long advocated that human resources should be viewed from an investment perspective. Current practices in many organizations indicate that employees are viewed as valuable investments.', NULL, '5120797.PNG', '6474566.pdf', 1, 2003, 'USA', 34, '2019-01-08 19:21:38', '2019-01-08 19:21:38', '203.190.11.117'),
(99, 49, 1, NULL, 1, 'COMPUTATIONAL INTELLIGENCE AND FEATURE SELECTION Rough and Fuzzy Approaches', 'computational-intelligence-and-feature-selection-rough-and-fuzzy-approaches', '1st ed.', '978-0-470-22975-0', NULL, 'INTELLIGENCE', 'The main purpose of this book is to provide both the background and fundamental\r\nideas behind feature selection and computational intelligence with an emphasis\r\non those techniques based on rough and fuzzy sets, including their hybridizations.\r\nFor those readers with little familiarity with set theory, fuzzy set theory, rough\r\nset theory, or fuzzy-rough set theory, an introduction to these topics is provided.\r\nFeature selection (FS) refers to the problem of selecting those attributes that are\r\nmost predictive of a given problem, which is encountered in many areas such\r\nas machine learning, pattern recognition, systems control, and signal processing.\r\nFS intends to preserve the meaning of selected attributes; this forms a sharp\r\ncontrast with those approaches that reduce problem complexity by transforming\r\nthe representational forms of the attributes', NULL, '2161204.jpg', '3880184.pdf', 1, 2008, 'New Jersey', 46, '2019-01-08 19:28:51', '2019-01-08 19:28:51', '203.190.11.117'),
(100, 64, 1, NULL, 1, 'Location Management and Routing in Mobile Wireless Networks', 'location-management-and-routing-in-mobile-wireless-networks', NULL, '1-58053-355-8', NULL, 'Location Management, Mobile Wireless,', 'This book aims at presenting, in a canonical form, the work done by us in the field of routing in mobile wireless networks. Most of the material contained herein has previously been presented at international conferences or has been accepted for publication in journals', NULL, '6861775.JPG', '6381925.pdf', 1, 2003, 'London', 39, '2019-01-08 19:49:04', '2019-01-08 19:49:04', '203.190.10.206'),
(101, 49, 1, NULL, 1, 'A First Lab in Circuit and Electronics', 'a-first-lab-in-circuit-and-electronics', NULL, NULL, NULL, 'Circus and Electronics', 'This is a book for a lab a course meant to accompany, or follow, any first course in circuit analysis and / or electronics. It has been written for today\'s students, who as is by now widely recognized are very different from students of years past, when most of the traditional teaching approaches were developed.', NULL, '/tmp/phpt4WV5u', '9686118.pdf', 1, 1995, 'New York', 39, '2019-01-08 20:29:01', '2019-01-08 20:31:21', '203.190.10.206'),
(102, 78, 1, NULL, 1, 'INFORMATION RESOURCE GUIDE Computer, Internet and Network Systems Security', 'information-resource-guide-computer-internet-and-network-systems-security', NULL, NULL, NULL, 'Internet, Network,  Security Systems', 'This manual is an effort to assist law enforcement agencies and other\r\ncomputer crime investigators by providing a resource guide compiled\r\nfrom the vast pool of information on the Internet. This manual is not\r\nintended to replace any formal training or education. This manual should\r\nbe used as a supplemental guide to reference too. It was not my\r\nintention to compile this manual to provide a specific solution for\r\ninvestigators. This was intended to provide a general overview, which\r\nwould assist in helping to developing a solution. This solution does not\r\nhave to be hardware or software based. Today policy-based protection\r\ncan also be incorporated into hardware and software systems.', NULL, '8433991.PNG', '6812793.pdf', 1, 1994, 'Canada', 46, '2019-01-08 20:53:20', '2019-01-08 20:53:20', '203.190.11.117'),
(103, 49, 1, NULL, 1, 'Concurrent and Distributed Computing in Java', 'concurrent-and-distributed-computing-in-java', NULL, 'N 0-471 -43230-X', NULL, 'Parallel processing (Electronic computers),\r\nprocessing, Java (Computer program language).', 'This book is designed for a senior undergraduate-level course or an introductory\r\ngraduate-level course on concurrent and distributed computing. This book grew\r\nout of my dissatisfaction with books on distributed systems (including books authored by me) that included pseudocode for distributed algorithms. There were two\r\nproblems with pseudocode. First, pseudocode had many assumptions hidden in it\r\nmaking it more succinct but only at the expense of precision. Second, translating\r\npseudocode into actual code requires effort and time, resulting in students never actually running the algorithm. Seeing the code run lends an extra level of confidence\r\nin oneâ€™s understanding of the algorithms.', NULL, '3943541.PNG', '7116800.pdf', 1, 2004, 'United States of America', 46, '2019-01-08 21:09:18', '2019-01-08 21:09:18', '203.190.11.115'),
(104, 79, 1, NULL, 1, 'C Programming for Microcontrollers  Featuring ATMELâ€™s AVR Butterfly and the Free WinAVR Compiler', 'c-programming-for-microcontrollers-featuring-atmels-avr-butterfly-and-the-free-winavr-compiler', NULL, '0-9766822-0-6', NULL, 'Programming. Micro-controllers,', 'The information, computer programs, schematic diagrams, documentation, and other material in this book are provided â€œas\r\nis,â€ without warranty of any kind, expressed or implied, including without limitation any warranty concerning the\r\naccuracy, adequacy or completeness of the material or the results obtained from the material or implied warranties.\r\nIncluding, but not limited to, the implied warranties of merchantability and fitness for a particular purpose are disclaimed.', NULL, NULL, NULL, 1, 2005, 'Timbercrest Trail Knoxville, USA', 46, '2019-01-08 21:24:21', '2019-01-08 21:24:21', '203.190.11.115'),
(105, 12, 1, NULL, 1, 'Intelligent Control Systems  Using Soft Computing Methodologies', 'intelligent-control-systems-using-soft-computing-methodologies', NULL, '0-8493-1875-0', NULL, 'Intelligent control systems, Data processing, Soft computing', 'Since the early 1960s, artificial intelligence (AI) has found its way into\r\nindustrial applications âˆ’ mostly in the area of expert knowledge-based decision\r\nmaking for the design and monitoring of industrial products or processes. That\r\nfact has been enhanced with advances in computer technology and the advent\r\nof personal computers, and many applications of intelligence have been\r\nrealized. With the invention of fuzzy chips in the1980s, fuzzy logic received a\r\nhigh boost in industry, especially in Japan. In this country, neural networks and\r\nevolutionary computations were also receiving unprecedented attention in both\r\nacademia and industry. As a result of these events, Ã¬soft computingÃ® was born.', NULL, '3197507.PNG', '7373782.pdf', 1, 2001, 'United States of America', 46, '2019-01-08 21:45:20', '2019-01-08 21:45:20', '203.190.11.117'),
(106, 80, 1, NULL, 1, 'Advanced Engineering Mathematics', 'advanced-engineering-mathematics', NULL, '0-8493-7854-0', NULL, 'Mathematics', 'This book grew out of a two semester course to sophomore and junior engineering majors at the U.S. naval academy. These students had just completed three semester of traditional calculus and a fourth semester of ordinary differential equation.', NULL, '8291218.JPG', '3442285.pdf', 1, 1998, 'London', 39, '2019-01-08 21:54:24', '2019-01-08 21:54:24', '203.190.10.206'),
(107, 12, 1, NULL, 1, 'The Communications Facility Design HANDBOOK', 'the-communications-facility-design-handbook', NULL, '0-8493-0908-5', NULL, 'Communications, Design', 'From the earliest days of electronics, the concepts of system design have evolved and\r\nengineering practices have been developed. Signal parameters, connector and cable\r\nspecifications, and equipment-mounting dimensions have all been standardized.\r\nMost of the equipment and hardware used to assemble systems today are available\r\nfrom a number of manufacturers; end-users do not have to custom-build their components. These advances have helped to significantly reduce the engineering design\r\ntime required for a given project. Many systems of advanced design with superior\r\nperformance and improved operating efficiency have resulted. Veteran engineers and\r\ntechnical managers are familiar with these practices and standards. However, this is\r\nnot necessarily the case for less experienced engineers or new engineers who are just\r\nentering the electronics industry.', NULL, '3224678.jpg', '2339808.pdf', 1, 2000, 'New York', 46, '2019-01-08 21:56:23', '2019-01-08 21:56:23', '203.190.11.117'),
(108, 81, 1, NULL, 1, 'DATA AND COMPUTER COMMUNICATIONS', 'data-and-computer-communications', '8th ed.', '0-13-243310-9', NULL, 'Data Communications, Wide Area Networks, Local Area Networks, Internet and Transport Protocols, Internet Applications', 'This book attempts to provide a unified overview of the broad field of data and computer communications. The organization of the book reflects an attempt to break this massive subject\r\ninto comprehensible parts and to build, piece by piece, a survey of the state of the art.The book\r\nemphasizes basic principles and topics of fundamental importance concerning the technology\r\nand architecture of this field and provides a detailed discussion of leading-edge topics.\r\nThe following basic themes serve to unify the discussion:', NULL, '5998243.PNG', '6828310.pdf', 1, 2007, 'New Jersey', 46, '2019-01-08 22:02:43', '2019-01-08 22:02:43', '203.190.11.115'),
(109, 12, 1, NULL, 1, 'Analog BiCMOS Design', 'analog-bicmos-design', NULL, '0-8493-0247-1', NULL, 'BiCMOS', 'This book presents practical methods and pitfalls encountered in the design of biCMOS integrated circuits. It is intended as a reference for design engineers and as a text for an introductory course on analog integrated circuit design for engineering seniors and graduate students. A broad range of topics are covered with the intent of giving new designers the tools to complete a design project. Most of the topics have been simpliï¬ed so they can be understood by students who have had a course in electronics.', NULL, '7257441.JPG', '7408781.pdf', 1, 2000, 'USA', 39, '2019-01-08 22:04:33', '2019-01-08 22:04:33', '203.190.10.206'),
(110, 10, 1, NULL, 1, 'Semiconductor Device Physics and Design', 'semiconductor-device-physics-and-design', NULL, '978-1-4020-6481-4', NULL, 'PHYSICS, DESIGN', 'It would not be an exaggeration to say that semiconductor devices have transformed human\r\nlife. From computers to communications to internet and video games these devices and the\r\ntechnologies they have enabled have expanded human experience in a way that is unique in\r\nhistory. Semiconductor devices have exploited materials, physics and imaginative applications to\r\nspawn new lifestyles. Of course for the device engineer, in spite of the advances, the challenges\r\nof reaching higher frequency, lower power consumption, higher power generation etc. provide\r\nnever ending excitement. Device performances are driven by new materials, scaling, and new\r\ndevice concepts such as bandstructure and polarization engineering.', NULL, '5140821.jpg', '5877439.pdf', 1, 2008, 'Netherlands.', 46, '2019-01-09 15:01:44', '2019-01-09 15:01:44', '203.190.11.118'),
(111, 82, 1, NULL, 1, 'Designing Analog Chips', 'designing-analog-chips', NULL, NULL, NULL, 'Analog Chips', '\"Everything is going digital\".  Cell phones, television, video disks, hearing aids, motor controls, audio amplifiers, toys, printers, what have you. Analog design is obsolete, or will be shortly.  Or so most people think.  Imminent death has been predicted for analog since the advent of the PC.  But it is still here; in fact, analog ICs have been growing at almost exactly the same rate as digital ones.  A digital video disk player has more analog content than the (analog) VCR ever did.  The explanation is rather simple: the world is fundamentally analog.  Hearing is analog. Vision, taste, touch, smell, analog all.  So is lifting and walking.  Generators, motors, loud-speakers, microphones, solenoids, batteries, antennas, lamps, LEDs, laser diodes, sensors are fundamentally analog components.', NULL, '8545723.JPG', '2573669.pdf', 1, 2005, 'USA', 39, '2019-01-09 15:02:32', '2019-01-09 15:02:32', '203.190.10.206'),
(112, 72, 1, NULL, 1, 'Analog Interfacing to Embedded Microprocessors', 'analog-interfacing-to-embedded-microprocessors', NULL, '0-7506-7339-7', NULL, 'Analog Interfaces Embedded Micro Processors', 'There often seems to be a division between the analog and digital worlds. Digital designers usually do not like to delve into analog, and analog designers tend to avoid the digital realm. The two groups often do not even use the same buzzwords. Even though microprocessors have become increasingly faster and more capable, the real world remains analog in nature. The digital designers who attempt to control or measure the real world must somehow connect this analog environment to their digital machines. There are books about analog design and books about microprocessor design. This book attempts to get at the problems encountered in connecting the two together.', NULL, '7912905.JPG', '3477628.pdf', 1, 2001, 'New Delhi', 39, '2019-01-09 15:13:54', '2019-01-09 15:13:54', '203.190.10.206'),
(113, 39, 1, NULL, 1, 'Digital Image Processing: Instructorzs Manual', 'digital-image-processing', '2nd ed.', '8177581686', NULL, 'Processing, Image', 'This manual contains detailed solutions to all problems in Digital Image Processing, 2nd\r\nEdition. We also include a suggested set of guidelines for using the book, and discuss\r\nthe use of computer projects designed to promote a deeper understanding of the subject\r\nmatter. The notation used throughout this manual corresponds to the notation used in\r\nthe text.\r\nThe decision of what material to cover in a course rests with the instructor, and it depends on the purpose of the course and the background of the students. We have found\r\nthat the course outlines suggested here can be covered comfortably in the time frames\r\nindicated when the course is being taught in an electrical engineering or computer science curriculum', NULL, '/tmp/phpXQBRXy', '5346739.pdf', 1, 2002, 'New Jersey', 46, '2019-01-09 15:15:37', '2019-01-09 15:22:07', '203.190.11.118'),
(114, 83, 1, NULL, 1, 'Analog Communication Theory : A Text for EE501', 'analog-communication-theory-a-text-for-ee501', NULL, NULL, NULL, 'Analog Communication EE501', NULL, NULL, '2652101.JPG', '2432830.pdf', 1, 2001, 'USA', 39, '2019-01-09 15:27:53', '2019-01-09 15:27:53', '203.190.10.206'),
(115, 84, 1, NULL, 1, 'Analysis and Design of Integrated Circuitâ€“ Antenna Modules', 'analysis-and-design-of-integrated-circuit-antenna-modules', NULL, '0-471-21667-4', NULL, 'Integrated Circuit Antenna Modules', 'The latest breakthrough in the continuing miniaturization of electronic systems is made possible by the integration of circuit functions and radiating elements into single modules. In a typical system implementation, electronic circuits and antenna subsystems are often provided by different equipment vendors. Traditionally, electronic circuits and antenna systems have been designed by different groups of designers using different types of design tools, working independently on either side of a well-deï¬ned interface, very often with very little interaction. This approach leads to separately packaged circuit and antenna subsystems, connected by appropriate cables or wave guides.', NULL, '8899671.jpg', '8250139.pdf', 1, 2000, 'New York', 39, '2019-01-09 15:34:52', '2019-01-09 15:34:52', '203.190.10.206'),
(116, 72, 1, NULL, 1, 'PC Troubleshooting Pocket Book', 'pc-troubleshooting-pocket-book', '2nd.', '0750659882', NULL, 'PC  Troubleshooting', 'Sooner or later, most PC users find themselves confronted with hard- ware or software failure or the need to upgrade or optimize a system for some new application. Newnes PC Troubleshooting Pocket Book pro- vides a concise and compact reference which describes in a clear and straightforward manner the principles and practice of fault finding and upgrading PCs', NULL, '5745878.JPG', '3777367.pdf', 1, 2003, 'New York', 39, '2019-01-09 15:46:16', '2019-01-09 15:46:16', '203.190.10.206'),
(117, 69, 1, NULL, 1, 'Embedded Controller Hardware Design', 'embedded-controller-hardware-design', NULL, '1-878707-52-3', NULL, 'Embedded Controller Hardware Design', 'During the early years of microprocessors, there were few engineers with education and experience in the applications of microprocessor technology. Now that microprocessors and microcontrollers have become pervasive in so many devices, the ability to use them has become almost a requirement for many technical people. \r\nToday the microprocessor and the microcontroller have become two of the most powerful tools available to the scientist and engineer. Microcontrollers have been embedded in so many products that it is easy to overlook the fact that they greatly outnumber personal computers. Millions of PCs are shipped each year, but billions of microcontrollers ship annually.', NULL, '3255938.jpg', '8280627.pdf', 1, 2001, 'USA', 39, '2019-01-09 16:11:20', '2019-01-09 16:11:20', '203.190.10.206'),
(118, 85, 1, NULL, 1, 'The Art and Science of Java', 'the-art-and-science-of-java', NULL, NULL, NULL, NULL, 'This text is an early draft for a general introductory textbook in computer scienceâ€”a Java-based version of my 1995 textbook The Art and Science of C.  My hope is that I can use much of the existing material in writing the new book, although quite a bit of the material and overall organization have to change.  At this point, the material is still in a preliminary form, and the feedback I get from those of you who are taking this course will almost certainly lead to some changes before the book is published.\r\nOne of the central features of the text is that it incorporates the work of the Association of Computing Machineryâ€™s  Java Task Force, which was convened in 2004 with the following charter.', NULL, '7601046.JPG', '5911672.pdf', 1, 2006, 'USA', 39, '2019-01-09 16:15:04', '2019-01-09 16:15:04', '203.190.10.206'),
(119, 86, 1, NULL, 1, 'The AVR Micro Controller and Embedded System : Using Assembly Language', 'the-avr-micro-controller-and-embedded-system-using-assembly-language', NULL, '978-0-800331-9', NULL, NULL, 'Products using micro processors generally fall into two categories. The first category  uses high performance micro processors such as the Pentium in applications where system performance is is critical. We have an entire book dedicated to this topic.', NULL, '8145795.JPG', '6376316.pdf', 1, 2001, 'New York', 39, '2019-01-09 16:22:59', '2019-01-09 16:22:59', '203.190.10.206'),
(120, 87, 1, NULL, 1, 'Matlab:  a Practical Introduction to Programming and Problem Solving', 'matlab-a-practical-introduction-to-programming-and-problem-solving', NULL, '978-0-75-068762-1', NULL, NULL, 'The purpose of this book is to teach basic programming concepts and skills needed for basic problem solving, all using MATLABÂ® as the vehicle. MATLAB is a powerful software package that has built-in functions to accomplish a diverse range of tasks, from mathematical operations to three-dimensional imaging. Additionally, MATLAB has a complete set of programming constructs that allows users to customize programs to their own specifications.', NULL, '4057890.JPG', '6161551.pdf', 1, 2009, 'Boston', 39, '2019-01-09 16:26:58', '2019-01-09 16:26:58', '203.190.10.206'),
(121, 72, 1, NULL, 1, 'Analog Interfacing to Embedded Microprocessors : Real World Design', 'analog-interfacing-to-embedded-microprocessors-real-world-design', '3rd.', '0-7506-75349', NULL, 'Embedded Microprocessors', 'Imagine this scene: You get into your car and turn the key on. You take a 3.5â€ floppy disk from the glove compartment, insert it into a slot in the dashboard, and drum your fingers on the steering wheel until the operating system prompt appears on the dashboard liquid crystal display (LCD). Using the cursor keys on the center console, you select the program for the electronic ignition, then turn the key and start the engine. On the way to work you want to listen to some music, so you insert the program compact disc (CD) into the player, wait for the green light to flash indicating that the digital signal processor (DSP) in the player is ready, then put in your music CD.', NULL, '1172143.JPG', '7104158.pdf', 1, 2002, 'New York', 39, '2019-01-09 17:31:45', '2019-01-09 17:31:45', '203.190.10.206'),
(122, 88, 1, NULL, 1, 'BASIC for PIC Micro-controllers', 'basic-for-pic-micro-controllers', NULL, NULL, NULL, 'Micro-controllers', 'In order to simplify things and crash some prejudices, I will allow myself to give you some advice before reading this book. \r\n \r\nYou should start reading it from the chapter that interests you the most, in order you find suitable. As the time goes by, read the parts you may need at that exact moment. \r\n \r\nIf something starts functioning without you knowing exactly how, it shouldn\'t bother you too much. Anyway, it is better that your program works than that it doesn\'t. \r\n \r\nAlways stick to the practical side of life. It is much better for the program to be finished on time, to be reliable and, of course, to be paid for it as well as possible. In other words, it doesn\'t matter if the exact manner in which the electrons move within the PN junctions your microcontroller is composed of escapes your knowledge. You are not supposed to know the whole history of electronics in order to assure the income for you or your family.', NULL, '1214377.JPG', '8714993.pdf', 1, 2001, 'USA', 39, '2019-01-09 17:49:58', '2019-01-09 17:49:58', '203.190.10.206'),
(123, 52, 1, NULL, 1, 'Digital Image Processing', 'digital-image-processing-09501241', '2nd ed.', '0-201-18075-8', NULL, 'Digital Imaging, Digital Techniques.', 'This edition is the most comprehensive revision of Digital Image Processing\r\nsince the book first appeared in 1977.As the 1977 and 1987 editions by Gonzalez\r\nand Wintz, and the 1992 edition by Gonzalez and Woods, the present edition was\r\nprepared with students and instructors in mind.Thus, the principal objectives of\r\nthe book continue to be to provide an introduction to basic concepts and\r\nmethodologies for digital image processing, and to develop a foundation that can\r\nbe used as the basis for further study and research in this field.To achieve these\r\nobjectives, we again focused on material that we believe is fundamental and\r\nhas a scope of application that is not limited to the solution of specialized problems.', NULL, '6092566.jpg', '5167278.pdf', 1, 2001, 'New Jersey', 46, '2019-01-09 17:50:41', '2019-01-09 17:50:41', '203.190.11.115'),
(124, 89, 1, NULL, 1, 'The C+ + Programming Language', 'the-c-programming-language-09531224', '3rd.', '0-201-88954-4', NULL, NULL, 'C++ is a general purpose programming language designed to make programming more enjoyable for the serious programmer. Except for minor details, C++ is a superset of the C programming language. In addition to the facilities provided by C, C++ provides flexible and efficient facilities for defining new types. A programmer can partition an application into manageable pieces by defining new types that closely match the concepts of the application. This technique for program construction is often called data abstraction. Objects of some user-defined types contain type information. Such objects can be used conveniently and safely in contexts in which their type cannot be determined at compile time. Programs using objects of such types are often called object based. When used well, these techniques result in shorter, easier to understand, and easier to maintain programs.', NULL, '3409152.JPG', '1731983.pdf', 1, 1997, 'USA', 39, '2019-01-09 17:53:24', '2019-01-09 17:53:24', '203.190.10.206'),
(125, 90, 1, NULL, 1, 'Bluetooth David Kammer Gordon McNutt Brian Senese Jennifer Bray Technical Editor The Short Range Interconnect Solution Application Developerâ€™s Guide', 'bluetooth-david-kammer-gordon-mcnutt-brian-senese-jennifer-bray-technical-editor-the-short-range-interconnect-solution-application-developers-guide', NULL, '1-928994-42-3', NULL, 'Bluetooth', 'What This Book Will Teach You Simply put,this book will teach you what Bluetooth technology is all about,and how to write Bluetooth applications for several popular operating systems.This is a technical book,and it assumes that the reader has a solid background in application development and has a reasonable understanding of the issues involved in creating communications applications.The book is roughly divided into three sections: Bluetooth technology in general,Bluetooth applications on various operating systems,and a Bluetooth usage case study.The ï¬‚ow of the book is designed to introduce things to you in the most helpful orderâ€”ï¬rst,supplementing your general knowledge with information about ideas and situations unique to Bluetooth,then showing you how these situations are handled in various operating systems,and ï¬nally by stimulating your imagination from looking at several real-world scenarios in which Bluetooth might be used.', NULL, '2348492.JPG', '6170340.pdf', 1, 2002, 'USA', 39, '2019-01-09 17:57:57', '2019-01-09 17:57:57', '203.190.10.206'),
(126, 91, 1, NULL, 1, 'Digital Signal Processing System-Level Design Using Lab VIEW', 'digital-signal-processing-system-level-design-using-lab-view', NULL, '0-7506-7914-X', NULL, 'Design, Lab View, Digital Signal Processing System', 'in this book by providing two chapters which are dedicated solely to algorithm\r\nimplementation on the TI family of TMS320C6000 DSP processors.\r\nIt is envisioned that this alternative graphical programming approach to designing\r\ndigital signal processing systems will allow more students to get exposed to the field\r\nof DSP. In addition, the book is written in such a way that it can be used as a self study guide by DSP engineers who wish to become familiar with Lab VIEW and use it\r\nto design and analyze DSP systems.', NULL, '2708842.PNG', '5026018.pdf', 1, 2005, 'UK', 46, '2019-01-09 17:59:40', '2019-01-09 17:59:40', '203.190.11.115'),
(127, 92, 1, NULL, 1, 'Code Warrior C C++, and Assembly Language Reference', 'code-warrior-c-c-and-assembly-language-reference', NULL, NULL, NULL, 'C++, Assembly Language', 'This manual describe how the metronomes C and C++ compilers implement the C and C++ standards and its in Line assembler.', NULL, '3856210.JPG', '7847303.pdf', 1, 1993, 'USA', 39, '2019-01-09 18:07:06', '2019-01-09 18:07:06', '203.190.10.206'),
(128, 93, 1, NULL, 1, 'Calculus', 'calculus', NULL, NULL, NULL, NULL, NULL, NULL, '8718465.JPG', '6494612.pdf', 1, 2018, 'USA', 39, '2019-01-09 18:19:21', '2019-01-09 18:19:21', '203.190.10.206'),
(129, 94, 1, NULL, 1, 'Calculus : Early Transcendental', 'calculus-early-transcendental', '6th ed.', '978-0-495-01166-8', NULL, 'Calculus', 'The art of teaching, Mark Van Doren said, is the art of assisting discovery. I have tried to write a book that assists students in discovering calculusâ€”both for its practical power and its surprising beauty. In this edition, as in the ï¬rst ï¬ve editions, I aim to convey to the student a sense of the utility of calculus and develop technical competence, but I also strive to give some appreciation for the intrinsic beauty of the subject. Newton undoubtedly experienced a sense of triumph when he made his great discoveries. I want students to share some of that excitement.', NULL, '7428549.jpg', NULL, 1, 2008, 'USA', 39, '2019-01-09 18:28:49', '2019-01-09 18:28:49', '203.190.10.206'),
(130, 91, 1, NULL, 1, 'Closed Circuit Television', 'closed-circuit-television', '2nd.', '0 7506 5728 6', NULL, 'Circuit Television', NULL, NULL, '7961674.JPG', '4680669.pdf', 1, 2004, 'New York', 39, '2019-01-09 18:36:32', '2019-01-09 18:36:32', '203.190.10.206'),
(131, 95, 1, NULL, 1, 'CMOS Analog Circuit Design (The Oxford Series in Electrical and Computer Engineering)', 'cmos-analog-circuit-design-the-oxford-series-in-electrical-and-computer-engineering', NULL, '978-0199765072', NULL, 'CMOS', 'Respected authors Phil Allen and Doug Holberg bring you the third edition of their popular textbook, CMOS Analog Circuit Design. Working from the forefront of CMOS technology, Phil and Doug have combined their expertise as engineers and academics to present a cutting-edge and effective overview of the principles and techniques for designing circuits.', NULL, NULL, NULL, 1, 2011, 'USA', 39, '2019-01-10 15:56:02', '2019-01-10 15:56:02', '203.190.10.206'),
(132, 96, 1, NULL, 1, 'CMOS Electronics : How it Works, How it fails', 'cmos-electronics-how-it-works-how-it-fails', NULL, '0-471-47669-2', NULL, 'CMOS', 'If you find the mysterious and varieties of integrated circuit failures challenging, then this book is for you. It is also for you if you work in integrated circuits industry but admit to knowing little about the electronics itself or the important electronics for failure.', NULL, '5399856.JPG', '4853500.pdf', 1, 2004, 'Canada', 39, '2019-01-10 16:17:55', '2019-01-10 16:17:55', '203.190.10.206'),
(133, 97, 1, NULL, 1, 'CMOS IC Layout: Concepts, Methodologies, and Tools', 'cmos-ic-layout-concepts-methodologies-and-tools', NULL, '978-0750671941', NULL, 'CMOS', 'This book includes basic methodologies, review of basic electrical rules and how they apply, design rules, IC planning, detailed checklists for design review, specific layout design flows, specialized block design, interconnect design, and also additional information on design limitations due to production requirements. \r\n*Practical, hands-on approach to CMOS layout theory and design\r\n*Offers engineers and technicians the training materials they need to stay current in circuit design technology.\r\n*Covers manufacturing processes and their effect on layout and design decisions', NULL, '5733294.jpg', '1969016.pdf', 1, 1999, 'New Delhi', 39, '2019-01-10 16:23:36', '2019-01-10 16:23:36', '203.190.10.206'),
(134, 98, 1, NULL, 1, 'CMOS Integrated Analogue to Digital and CMOS Integrated Analogue Converters', 'cmos-integrated-analogue-to-digital-and-cmos-integrated-analogue-converters', NULL, NULL, NULL, 'CMOS Integrated Analogue, CMOS Integrated Analogue', 'This book provide the link between the analog world of transducers and the digital world of signal processing, computing and other digital data collection for data processing system.', NULL, '7078466.JPG', '5452191.pdf', 1, 2003, 'Boston', 39, '2019-01-10 16:37:28', '2019-01-10 16:37:28', '203.190.10.206'),
(135, 99, 1, NULL, 1, 'CMOS Memory Circuits', 'cmos-memory-circuits', NULL, '0-7923-7950-0', NULL, 'CMOS', 'Staggering are both the quantity and the variety of complementary metal oxide semiconductor CMOS memories. CMOS memories are traded as mass products word, and are diversified to satisfy nearly all practical requirement in operational speed, power and packing density characteristics of CMOS memories neither personal computing, nor space exploration, nor superior defense-system, nor many other feats of human ingenuity could be accomplished.', NULL, '5837164.JPG', '5313361.pdf', 1, 2000, 'USA', 39, '2019-01-10 17:36:08', '2019-01-10 17:36:08', '203.190.10.206'),
(136, 100, 1, NULL, 1, 'CMOS PLL Synthesizers: Analysis and Design', 'cmos-pll-synthesizers-analysis-and-design', NULL, '0-387-23669-4', NULL, 'CMOS', 'Thanks to the advance of semiconductor and communication technology, the wireless communication market has been booming in the last two decades. It evolved from simple pagers to emerging third-generation (3G) cellular phones. In the meanwhile, broadband communication market has also gained a rapid growth. As the market always demands highperformance and low-cost products, circuit designers are seeking highintegration communication devices in cheap CMOS technology.', NULL, '6005685.JPG', '2751512.pdf', 1, 2005, 'USA', 39, '2019-01-10 17:42:21', '2019-01-10 17:42:21', '203.190.10.206'),
(137, 101, 1, NULL, 1, 'CMOS Circuit Design, Layout, and Simulation', 'cmos-circuit-design-layout-and-simulation', '3rd.', '978-0-470-88132-3', NULL, 'CMOS', 'CMOS (complementary metal oxide semiconductor) technology continues to be the dominant technology for fabricating integrated circuits (ICs or chips). This dominance will likely continue for the next 25 years and perhaps even longer. Why? CMOS technology is reliable, manufacturable, low power, low cost, and, perhaps most importantly, scalable. The fact that silicon integrated circuit technology is scalable was observed and described in 1965 by Intel founder Gordon Moore. His observations are now referred to as Moore\'s law and state that the number of devices on a chip will double every 18 to 24 months. While originally not specific to CMOS, Moore\'s law has been fulfilled over the years by scaling down the feature size in CMOS technology. Whereas the gate lengths of early CMOS transistors were in the micrometer range (long-channel devices) the feature sizes of current CMOS devices are in the nanometer range (short-channel devices).', NULL, '5309277.JPG', '1366826.pdf', 1, 1964, 'Canada', 39, '2019-01-10 17:50:23', '2019-01-10 17:50:23', '203.190.10.206'),
(138, 102, 1, NULL, 1, 'Design of Analog CMOS Integrated Circuits', 'design-of-analog-cmos-integrated-circuits', NULL, '0-07-238032-2', NULL, 'CMOS, Integrated Circuits', 'This books deals with the analysis and design of analog CMOS integrated circuits emphasizing fundamentals as well as new paradigms that students and practicing engineers need to muster in today industry.', NULL, '5297954.jpg', '6917618.pdf', 1, 2001, 'USA', 39, '2019-01-10 18:37:00', '2019-01-10 18:37:00', '203.190.10.206'),
(139, 103, 1, NULL, 1, 'CMOS Logic Circuit Design', 'cmos-logic-circuit-design', NULL, '0-306-47529-4', NULL, NULL, 'This book is based on the earlier Kluwer title Circuit Design for CMOS/VLSI\r\nwhich was published in 1992. At that time, CMOS was just entering the mainstream as a technique for high-speed, high-density logic circuits. Although the\r\ntechnology had been invented in the 1960â€™s, it was still necessary to include Section 1.1 entitled Why CMOS? to justify a book on the subject. Since that time,\r\nCMOS has matured and taken its place as the primary technology for VLSI and\r\nULSI digital circuits. It therefore seemed appropriate to update the book and generate a second edition', NULL, '5815080.JPG', '9033441.pdf', 1, 2002, 'New York', 39, '2019-01-10 20:17:02', '2019-01-10 20:17:02', '203.190.10.206'),
(140, 43, 1, NULL, 1, 'Design of Analog CMOS Integrated Circuits', 'design-of-analog-cmos-integrated-circuits-12541112', NULL, '0-07-118815-0', NULL, 'CMOS, integrated circuit', 'This book deals with the analysis and design of analog CMOS integrated circuits emphasis fundamentals as well as new paradigms  that students and practicing engineers need to muster in today\'s industry.', NULL, '6682566.JPG', '2440748.pdf', 1, 2001, 'New York', 39, '2019-01-12 16:54:12', '2019-01-12 16:54:12', '203.190.10.206'),
(141, 43, 1, NULL, 1, 'Design with Operational Amplifiers and Analog Integrated Circuits', 'design-with-operational-amplifiers-and-analog-integrated-circuits', '3rd.', '0-07-232084-2', NULL, 'Amplifiers, Analog Integrated circuits', 'The goal of this book is the illustration of general analog principles and design methodologies using practical devices and applications.', NULL, '7910210.jpg', '5378031.pdf', 1, 2002, 'New York', 39, '2019-01-12 17:40:59', '2019-01-12 17:40:59', '203.190.10.206'),
(142, 104, 1, NULL, 1, 'The Design of Cmos Radio-Frequency Integrated Circuits', 'the-design-of-cmos-radio-frequency-integrated-circuits', '2nd.', '978-0521613897', NULL, 'CMOS, Integrated Circuits', 'This expanded and thoroughly revised edition of Thomas H. Lee\'s acclaimed guide to the design of gigahertz RF integrated circuits features a completely new chapter on the principles of wireless systems. The chapters on low-noise amplifiers, oscillators and phase noise have been significantly expanded as well. The chapter on architectures now contains several examples of complete chip designs that bring together all the various theoretical and practical elements involved in producing a prototype chip.', NULL, '6624425.jpg', '7449429.pdf', 1, 2006, 'New York', 39, '2019-01-12 17:55:35', '2019-01-12 17:55:35', '203.190.10.206'),
(143, 105, 1, NULL, 1, 'Digital System Design Using UHDL', 'digital-system-design-using-uhdl', NULL, '0-534-95099-X', NULL, 'Digital System, VHDL', 'This book is intended for a senior level course in digital system design.This book covers both basic principles of digital system design and the use of a hardware description language, VHDL, in the design process.', NULL, '3418739.JPG', '8391104.pdf', 1, 1998, 'Canada', 39, '2019-01-12 18:22:53', '2019-01-12 18:22:53', '203.190.10.206'),
(144, 61, 1, NULL, 1, 'CMOS VLSI Design A Circuits and Systems Perspective', 'cmos-vlsi-design-a-circuits-and-systems-perspective', 'Fourth Edition', '10: 0-321-54774-8', NULL, 'VLSI Design,  Circuits and Systems, CMOS', 'MOSIS and IBM kindly provided permission to use nanometer SPICE models for\r\nmany examples. Nathaniel Pinckney spent a summer revising the laboratory exercises and\r\nupdating simulations. Jaeha Kim contributed new sections on phase-locked loops and\r\nhigh-speed I/O for Chapter 13. David would like to thank Bharadwaj Amrutur of the\r\nIndian Institute of Science and Braden Phillips of the University of Adelaide for hosting\r\nhim during two productive summers of writing', NULL, NULL, NULL, 1, 2011, 'New York', 47, '2019-01-12 18:39:07', '2019-01-12 18:39:07', '203.190.11.115'),
(145, 62, 1, NULL, 1, 'Digital Integrated Circuit Design From VLSI Architectures to CMOS Fabrication', 'digital-integrated-circuit-design-from-vlsi-architectures-to-cmos-fabrication', NULL, '978-0-511-45537-7', NULL, 'VLSI, CMOS Fabrication', 'Designing integrated electronics has become a multidisciplinary enterprise that involves solving problems from ï¬elds as disparate as â€¢ Hardware architecture â€¢ Software engineering â€¢ Marketing and investment â€¢ Solid-state physics â€¢ Systems engineering â€¢ Circuit design â€¢ Discrete mathematics â€¢ Electronic design automation â€¢ Layout design â€¢ Hardware test equipment and measurement techniques', NULL, '5133869.JPG', '9203404.pdf', 1, 2008, 'New York', 39, '2019-01-12 19:05:06', '2019-01-12 19:05:06', '203.190.10.206'),
(146, 101, 1, NULL, 1, 'Digital System Testing and Testable Design', 'digital-system-testing-and-testable-design', NULL, '0-7803-1062-4', NULL, 'Digital System Testing', 'This book provides a comprehensive and detailed treatment of digital system testing and testable design. These subject are increasingly important, as the coast of testing  is becoming the major component of the manufacturing coast of a new product.', NULL, '1785384.JPG', '1597274.pdf', 1, 1990, 'New York', 39, '2019-01-12 20:01:23', '2019-01-12 20:01:23', '203.190.10.206');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(147, 106, 1, NULL, 1, 'Essentials of Electronic Testing for Digital Memory and Mixed Signal VLSI Circuits', 'essentials-of-electronic-testing-for-digital-memory-and-mixed-signal-vlsi-circuits', NULL, '0-306-47040-3', NULL, 'VLSI, Mixed Signal, VLSI Circuits', 'We have written this textbook for an undergraduate â€œfoundationsâ€ course on electronic testing. Obviously, it is too voluminous for a one-semester course and a teacher will have to select from the topics. We did not restrict such freedom because the selection may depend upon the individual expertise and interests. Besides, there is merit in having a larger book that will retain its usefulness for the owner even after the completion of the course.', NULL, '1354255.JPG', '7194486.pdf', 1, 2002, 'London', 39, '2019-01-12 20:13:33', '2019-01-12 20:13:33', '203.190.10.206'),
(148, 62, 1, NULL, 1, 'Fundamentals of High Frequency CMOS Analog Integrated Circuits', 'fundamentals-of-high-frequency-cmos-analog-integrated-circuits', NULL, '978-0-511-53976-3', NULL, 'CMOS, Integreted Circuits', 'The knowledge developed for the vacuum-tube circuits easily adapted to the transistors with some modiï¬cations related to the differences of the input and output resistances of the devices. In the meantime, the upper limit of the frequency increased to about 100 MHz for FM radio and to hundreds of MHz for UHF-TV. The values of the inductors used in these circuits correspondingly decreased to hundreds to tens of nano-henries. But these inductors were still wound, high-Q discrete components.', NULL, '5245258.JPG', '3313750.pdf', 1, 2009, 'London', 39, '2019-01-12 20:19:11', '2019-01-12 20:19:11', '203.190.10.206'),
(149, 49, 1, NULL, 1, 'Low-Voltage CMOS VLSI Circuits', 'low-voltage-cmos-vlsi-circuits', NULL, '0-471-32105-2', NULL, 'CMOS, VLSI Circuits', 'CMOS VLSI Technology has been progressing quickly for decades. As a result, informationoriented digital computer systems based on CMOS VLSI are changing our daily life at an unprecedented pace. Currently, CMOS VLSI is still advancing at a remarkable rate. In the future, VLSI digital chips having multi-billion transistors based on deep-submicron CMOS technology using low power supply voltages will be utilized to integrate low-power, high-speed, high-capacity information-oriented digital computer systems. For deep-submicron CMOS technology using a low power supply voltage, the techniques required for designing low-voltage VLSI CMOS circuits are challenging. Processing technology and devices have direct impacts on the circuit designs for lowvoltage CMOS VLSI systems.', NULL, '6404965.JPG', '8829417.pdf', 1, 1999, 'Canada', 39, '2019-01-12 20:25:29', '2019-01-12 20:25:29', '203.190.10.206'),
(150, 49, 1, NULL, 1, 'Low-Voltage SOI CMOS VLSI Devices and Circuits', 'low-voltage-soi-cmos-vlsi-devices-and-circuits', NULL, '0-471-41777-7', NULL, 'SOI, CMOS, VLSI', 'Silicon-on-Insulator (SOI) CMOS technology is becoming another mainstream technology for VLSI. Owing to its inherited characteristics, SOI CMOS technology is especially capable of providing deep-submicron VLSI devices for next-generation highspeed, low-power, system applications using a low-power supply voltage. Thanks to progresses in processing technology, SOI CMOS technology has been used to implement multi-giga-bit DRAM, 1 GHz microprocessors, and other high-speed low-power computer-related VLSI circuits. Owing to much smaller parasitic capacitances, SOI CMOS devices have also been used to integrate high-speed low-power networkrelated telecommunication VLSI circuits.', NULL, '2562859.JPG', '8432674.pdf', 1, 2001, 'Canada', 39, '2019-01-12 20:31:52', '2019-01-12 20:31:52', '203.190.10.206'),
(151, 30, 1, NULL, 1, 'Fundamentals of Microelectronics', 'fundamentals-of-microelectronics', '1st.', '978-0471478461', NULL, 'Microelectronics', 'Designed to build a strong foundation in both design and analysis of electronic circuits, Razavi teaches conceptual understanding and mastery of the material by using modern examples to motivate and prepare students for advanced courses and their careers. Razavi\'s unique problem-solving framework enables students to deconstruct complex problems into components that they are familiar with which builds the confidence and intuitive skills needed for success.', NULL, '2861512.jpg', '5794796.pdf', 1, 2008, 'USA', 39, '2019-01-12 20:51:48', '2019-01-12 20:51:48', '203.190.10.206'),
(152, 57, 1, NULL, 1, 'Fundamentals of Modern VLSI Devices', 'fundamentals-of-modern-vlsi-devices', '2nd.', '978-1107635715', NULL, 'VLSI', 'Learn the basic properties and designs of modern VLSI devices, as well as the factors affecting performance, with this thoroughly updated second edition. The first edition has been widely adopted as a standard textbook in microelectronics in many major US universities and worldwide. The internationally renowned authors highlight the intricate interdependencies and subtle trade-offs between various practically important device parameters, and provide an in-depth discussion of device scaling and scaling limits of CMOS and bipolar devices. Equations and parameters provided are checked continuously against the reality of silicon data, making the book equally useful in practical transistor design and in the classroom. Every chapter has been updated to include the latest developments, such as MOSFET scale length theory, high-field transport model and SiGe-base bipolar devices.', NULL, '3614098.jpg', '5187407.pdf', 1, 2009, 'New York', 39, '2019-01-12 20:56:39', '2019-01-12 20:56:39', '203.190.10.206'),
(153, 107, 1, NULL, 1, 'Mosfet Modeling for VLSI Simulation : Theory and Practical', 'mosfet-modeling-for-vlsi-simulation-theory-and-practical', NULL, '978-981-256-862-5', NULL, 'MOSFET, VLSI Simulation', 'The book deals with the MOS Field Effect transistor (MOSFET) models that are derived from basic semiconductor theory. Various models are developed ranging from simple to more sophisticated models that take into account new physical effects observed in submicron devices used in today\'s MOS VLSI technology. The assumptions used to arrive at the models are emphasized so that the accuracy of the model in describing the device characteristics are clearly understood. Due to the importance of designing reliable circuits, device reliability models have also been covered. Under- standing these models is essential when designing circuits for state of the art MOS IC\'s.', NULL, '3724658.JPG', '3985138.pdf', 1, 2007, 'USA', 39, '2019-01-12 21:04:03', '2019-01-12 21:04:03', '203.190.10.206'),
(154, 108, 1, NULL, 1, 'Nano-CMOS Circuit and Physical Design', 'nano-cmos-circuit-and-physical-design', NULL, '0-471-46610-7', NULL, 'Nano-CMOS Circuit and Physical Design', 'The book is organized into three parts. In the first part we provide detailed description of the deep semicron process to help designers understand the issues associated with them and to provide more insight into the limitations brought about by dimensional scaling. In the second part we provide an overview of the impact of process scaling on circuit design and physical implementation. In the final part we cover issues concerning manufacture-ability and yield and provide guidance to ensure that a part is manufacture-able and meets the yield and performance targets.', NULL, '5571156.jpg', '5791865.pdf', 1, 2008, 'Canada', 39, '2019-01-13 14:52:47', '2019-01-13 14:52:47', '203.190.10.206'),
(155, 109, 1, NULL, 1, 'Nanometer CMOS ICs From basics to ASICs', 'nanometer-cmos-ics-from-basics-to-asics', '1st', '978-1-4020-8332-7', NULL, 'CMOS ICs', 'An integrated circuit (IC) is a piece ofsemiconductor material, on which a number of electronic components are interconnected. These interconnected \'chip\' components implement a specific function. The semiconductor material is usually silicon but alternatives include gallium arsenide. ICs are essential in most modern electronic products. Thefirst IC was created by Jack Kilby in 1959. Photographs of this device and the inventor are shown in figure 3. Figure 1illustrates the subsequent progress in IC complexity. This figure shows the numbers of components for advanced ICs and the year in which these ICs were first presented. This doubling in complexity every two years was predicted by Moore (Intel 1964), who\'s law is still valid today for the number of logic transistors on a chip. However, due to reaching the limits ofscaling, the complexity doubling of certain memories now happens at a three-year cycle.', NULL, '8384008.JPG', '5016184.pdf', 1, 2008, 'New York', 39, '2019-01-13 16:11:42', '2019-01-13 16:11:42', '203.190.10.206'),
(156, 37, 1, NULL, 1, 'CMOS VLSI Design A Circuits and System Perspective', 'cmos-vlsi-design-a-circuits-and-system-perspective', NULL, '978-0-321-54774-3', NULL, 'CMOS VLSI', 'This edition has been heavily revised to reï¬‚ect the rapid changes in integrated circuit design over the past six years. While the basic principles are largely the same, power consumption and variability have become primary factors for chip design. The book has been reorganized to emphasize the key factors: delay, power, interconnect, and robustness. Other chapters have been reordered to reï¬‚ect the order in which we teach the material.', NULL, '7342360.JPG', '3430870.pdf', 1, 2011, 'New York', 39, '2019-01-13 17:20:28', '2019-01-13 17:20:28', '203.190.10.206'),
(157, 102, 1, NULL, 1, 'Concepts of Modern Physics (SIE)', 'concepts-of-modern-physics-sie', '6th ed.', '978-9351341857', NULL, 'Modern Physics', 'Please Read Notes: Brand New, International Softcover Edition, Printed in black and white pages, minor self wear on the cover or pages, Sale restriction may be printed on the book, but Book name, contents, and author are exactly same as Hardcover Edition. Fast delivery through DHL/FedEx express.', NULL, '6489206.jpg', '1922288.pdf', 1, 2017, 'New York', 39, '2019-01-13 17:27:22', '2019-01-13 17:27:22', '203.190.10.206'),
(158, 107, 1, NULL, 1, 'Introduction to Nuclear and Particle Physics', 'introduction-to-nuclear-and-particle-physics', '2nd.', '981-238-744-7', NULL, 'Nuclear and Particle Physics', 'This book is based on a one-semester course on Nuclear and Particle Physics that we have taught to undergraduate juniors and seniors at the University of Rochester. Naturally, the previous experience and background of our students determined to a large extent the level at which we presented the material. This ranged from a very qualitative and hand-waving exposition to one class that consisted of a mix of about six engineering and math majors, to relatively formal and quantitative developments for classes that were composed of about ten to fifteen well-prepared physics majors. It will not come as a great surprise that, independent of the degree of sophistication of our students, they were invariably fascinated by the subject matter, which provided great wonderment and stimulation to them. In class, we strove to stress the general underlying ideas of nuclear and particle physics, and we hope that in transforming our lecture notes into this more formal text, we have not committed the com', NULL, '1883455.JPG', '5265224.pdf', 1, 2003, 'London', 39, '2019-01-13 17:32:51', '2019-01-13 17:32:51', '203.190.10.206'),
(159, 44, 1, NULL, 1, 'Food Biotechnology', 'food-biotechnology', '2nd', '978-0-8247-5329-0', NULL, 'Food Technology, Food Biotech', 'Thus, with these critical issues in mind, Food Biotechnology, 2nd Edition, has been assembled with the hope of being an authoritative, comprehensive, conceptually sound, and highly informative compilation of recent advances in various important areas of food biotechnology. The topics herein deal with bioconversion of food raw materials to processed products, improvement of food quality, food safety, designing of ingredients for functional foods, biochemical advances in traditional fermentation, and, most importantly, they provide an international perspective to the whole field. Biotechnology has become an important tool in recent years, and several scientists across the world are investigating advanced and novel biological, cellular, molecular, and biochemical strategies for improving food production and processing, for enhancing food safety and quality, and for improving from organoleptic to functional aspects of food and food ingredients for better human health.', NULL, '2001988.PNG', '1711659.pdf', 1, 2006, 'New York', 34, '2019-01-13 18:18:31', '2019-01-13 18:18:31', '203.190.11.118'),
(160, 12, 1, NULL, 1, 'Biotechnology in Functional Food and Nutraceuticals', 'biotechnology-in-functional-food-and-nutraceuticals', NULL, '978-1-4200-8712-3', NULL, 'Food Technology', 'Biotechnology has been used thousands of years ago in the manufacturing of food products. The most ancient form of biotechnology, fermentation, involved the use of microorganisms such as yeasts for the production of wine, vinegar, and bread. Dairy products such as yogurt and cheese were  produced by lactic acid bacteria and molds. Although these techniques are still used, the cultures that were used in ancient times have been modifi ed to provide high-quality products with increased yield. Modern food biotechnology has evolved into a billion-dollar industry, with the promise of producing foods that provide functions beyond the basic nutrients they contain. These functional foods or nutraceuticals have become increasingly important to consumers who are interested in the health benefi ts of functional foods in the prevention of illness and chronic conditions. Biotechnology is a collection of biology-based technologies used mainly in agriculture, food s cience, and medicine. Agricultural', NULL, '7019136.PNG', '6579427.pdf', 1, 2010, 'New York', 34, '2019-01-13 20:46:48', '2019-01-13 20:46:48', '203.190.11.118'),
(162, 12, 1, NULL, 1, 'Food Science and Food Biotechnology', 'food-science-and-food-biotechnology-13051649', NULL, '1-56676-892-6', NULL, 'Food--Biotechnology.', 'This book presents a meaningful and up-to-date review of how food science and biotechnology are interacting and covers important aspects of both subjects as well as their interface. Distinguished scientists from key institutions have contributed chapters that provide deep analysis of their particular subjects and at the same time place each topic within the context of this interface. The premise of this book is that an effective discussion on these subjects (food science, biotechnology) requires an effective coupling to convey in a comprehensive manner the state-of-the-art for the fundamentals and applications of both areas. The book is mainly directed to academics, undergraduate and postgraduate students (including research students) in food science and technology, biotechnology, and bioengineering, who will ï¬nd a selection of topics ranging from the molecular basis of food preservation and biotechnology to industrial applications. Professionals working in food and biotechnology resea', NULL, '2009769.PNG', '5349873.pdf', 1, 2003, 'New York', 34, '2019-01-13 21:05:49', '2019-01-13 21:05:49', '203.190.11.118'),
(163, 110, 1, NULL, 1, 'Advanced Dairy Science and Technology', 'advanced-dairy-science-and-technology', '1st', '978-140-5136-181', NULL, 'Dairy Science', 'The dairy industry is the largest sector of the food-supply chain, in that not only does it supply retailers with numerous ready-to-eat products like liquid milk, butter and cheese, but also it provides ingredients, e.g. milk powders and condensed milk, to a variety of food processors. It is also an industry that relies for success on a unique blend of â€˜craft and scienceâ€™, with the balance changing in relation to the product. A dairy supplying retail milk, for example, will heat-treat the milk within limits set down by microbiologists to ensure that the milk is free from vegetative pathogens, but while a cheese plant may well use pasteurized milk as the base material, the flavour of the finished cheese is largely dependent on the intuitive skills of the cheesemaker. Nevertheless, every company dealing with milk and milk products has to be', NULL, '6956024.PNG', '2401910.pdf', 1, 2008, 'Oxford', 34, '2019-01-13 22:13:51', '2019-01-13 22:13:51', '203.190.11.117'),
(164, 111, 1, NULL, 1, 'Basic Physics of Nuclear Medicine', 'basic-physics-of-nuclear-medicine', NULL, NULL, NULL, NULL, 'You will have encountered much of what we will cover here in your high school physics. We are going to review this material again below so as to set the context for subsequent chapters. This chapter will also provide you with an opportunity to check your understanding of this topic.', NULL, '7960538.JPG', '7424389.pdf', 1, 2004, NULL, 39, '2019-01-14 14:20:17', '2019-01-14 14:20:17', '203.190.10.206'),
(165, 12, 1, NULL, 1, 'Chemical Finishing of Textiles', 'chemical-finishing-of-textiles', NULL, '0-8493-2825-X', NULL, 'Textile Finishing', 'It is anticipated that this book on the chemical finishing of textiles will appeal particularly to finishing plant management, process engineers, technologists, qualified practitioners and foremen; representatives and co-workers of the textile chemical industry, textile research and testing institutes, quality inspectors, textile machinery makers; chemist colourists, clothing manufacturers, textile designers, dry cleaners, buyers, sales personnel, wholesalers and last but not least students, lecturers and teaching staff of textile chemistry and finishing as well as of related subjects. The presentation of this compact description of all important types of chemical finishing might be especially useful for advanced undergraduates. This book stresses fundamentals rather than specific recipe and procedure proposals, which are often provided by the finish producers. The interplay between chemical structures and the effects of finishing products is a central concern of this book.', NULL, '5443879.PNG', '9315899.pdf', 1, 2004, 'United States of America', 34, '2019-01-14 14:53:12', '2019-01-14 15:16:05', '203.190.11.115'),
(166, 112, 1, NULL, 1, 'Antennas for Information Super Sky-ways : An Exposition on Outdoor and Indoor Wireless Antennas', 'antennas-for-information-super-sky-ways-an-exposition-on-outdoor-and-indoor-wireless-antennas', NULL, '0863802672', NULL, 'Antennas, Wireless Antennas, Sky-ways,', 'The primary goal of this book, as stated above, is to cast the salient aspects of\r\nwireless communication antenna technology in the real-world perspectives.\r\nGenerally speaking, there are three types of books on the subject matter of\r\nantennas: The first category refers to classical books on EM radiating systems\r\nwritten over the last several decades (but their contents revised and updated to\r\ninclude the changing trends and evolving new concepts). Such books address the\r\nglobal prospects of antenna systems and comprehensively project various antenna\r\ntypes against their suitable applications to radio/TV, radar, navigational aids and traditional point-to-point communication systems.', NULL, '3581075.PNG', '8060465.pdf', 1, 2003, 'England', 47, '2019-01-14 15:54:27', '2019-01-14 15:54:27', '203.190.11.117'),
(167, 113, 1, NULL, 1, 'Applied Mathematical Methods in Theoretical Physics', 'applied-mathematical-methods-in-theoretical-physics', NULL, '978- 3-527-40534-3', NULL, 'Mathematics,  Physics, Applied Math', 'The instructor can cover Chapters 1 through 9 in one semester or two quarters with a\r\nchoice of the topic of his or her own taste from Chapter 10.\r\nI would like to express many heart-felt thanks to Professor Hung Cheng at MIT, who\r\nappointed me as his teaching assistant for the course when I was a graduate student in the\r\nDepartment of Mathematics at MIT, for his permission to publish this book under my single\r\nauthorship and also for his criticism and constant encouragement without which this book\r\nwould not have materialized', 'https://images-na.ssl-images-amazon.com/images/I/41tCXGo0RML._SX313_BO1,204,203,200_.jpg', '/tmp/phpwz8AKq', '8597702.pdf', 1, 2005, 'Weinheim', 34, '2019-01-14 16:20:53', '2019-01-14 19:41:50', '203.190.11.117'),
(168, 84, 1, NULL, 1, 'Mobile Fading Channels', 'mobile-fading-channels', NULL, '047149549 2', NULL, 'MATLAB-programs, Modern Methods for Modelling of Networks, Modellierung, Analyse und Simulationâ€ published by Vieweg & Sohn, Braunschweig/Wiesbaden, Germany.', 'This book results from my teaching and research activities at the Technical University\r\nof Hamburg-Harburg (TUHH), Germany. It is based on my German book\r\nâ€œMobilfunkkanÂ¨ale â€” Modellierung, Analyse und Simulationâ€ published by Vieweg &\r\nSohn, Braunschweig/Wiesbaden, Germany, in 1999. The German version served as a\r\ntext for the lecture Modern Methods for Modelling of Networks, which I gave at the\r\nTUHH from 1996 to 2000 for students in electrical engineering at masters level.', NULL, NULL, NULL, 1, 2002, 'England', 49, '2019-01-14 16:25:44', '2019-01-14 16:29:57', '203.190.11.117'),
(169, 114, 1, NULL, 1, 'Alternating currents a text-book for students of engineering', 'alternating-currents-a-text-book-for-students-of-engineering', NULL, NULL, NULL, 'Engineering Laboratory, Cambridge, vectors, supplemented, symbolic treatment.', 'The number of text-books dealing with the present subject is already so large that a few words are necessary to explain the reason for an addition to that number. For some years the author has been engaged in lecturing on electrical matters to the students of Engineering at the Engineering Laboratory, Cambridge, and he has experienced a difficulty in recommending to the men a suitable book on this subject. In the course of study for the Mechanical Sciences Tripos the subject of Electrical Engineering is but one of several, and consequently a student has not the time to devote to a proper study of the larger books already available either in English or German, and the smaller books scarcely cover the ground with which the course deals.', NULL, '7491402.jpg', '9766028.pdf', 1, 1906, 'New York', 49, '2019-01-14 16:45:22', '2019-01-14 16:45:22', '203.190.11.117'),
(170, 115, 1, NULL, 1, 'APPLIED NONLINEAR DYNAMICS', 'applied-nonlinear-dynamics', NULL, '978-0-47 1-59348-5', NULL, 'Nonlinear, Experimental Methods, Dynamics', 'We are of the opinion that the books on nonlinear dynamics published thus far have a strong bias toward analytical methods, or experimental methods, or numerical methods. As these methods are complementary to each other, a person being taught nonlinear dynamics\r\nshould be provided with a flavor of all the different methods. This is\r\none of the intentions in writing this book. Another intention was to\r\ninclude some of the recent developments in the area of control of nonlinear dynamics of systems. In Chapter 1, we introduce dynamical systems.', 'https://images-na.ssl-images-amazon.com/images/I/41Jt0rAoirL._SX352_BO1,204,203,200_.jpg', '4697358.PNG', '4929167.pdf', 1, 2004, 'Weinheim', 47, '2019-01-14 16:56:23', '2019-01-14 16:56:23', '203.190.11.117'),
(171, 52, 1, NULL, 1, 'Applied Nonlinear Control', 'applied-nonlinear-control', NULL, 'D-13-DHDfiTa-S', NULL, 'Nonlinear,  Phase Plane,', 'This book, based on a course developed at MIT, is intended as a textbook for\r\nsenior and graduate students, and as a self-study book for practicing engineers. Its\r\nobjective is to present the fundamental results of modern nonlinear control while\r\nkeeping the mathematical complexity to a minimum, and to demonstrate their use and\r\nimplications in the design of practical nonlinear control systems. Although a major\r\nmotivation of this book is to detail the many recent developments in nonlinear control,\r\nclassical techniques such as phase plane analysis and the describing function method\r\nare also treated, because of their continued practical importance.', 'https://images-na.ssl-images-amazon.com/images/I/41SN4W7Z69L._SX337_BO1,204,203,200_.jpg', '9727435.PNG', '6518344.pdf', 1, 1991, 'New Jersey', 47, '2019-01-14 17:17:14', '2019-01-14 17:17:14', '203.190.11.115'),
(172, 116, 1, NULL, 1, 'A foundation of digital communication', 'a-foundation-of-digital-communication', NULL, '1107177324', NULL, 'Engineering, Computer', 'Fully updated for the second edition, this intuitive yet mathematically rigorous text derives the key results of digital communication from first principles. It includes new chapters on the radar problem and intersymbol interference channels, a more geometric derivation of optimal detection in white Gaussian noise, and over 500 homework problems.', NULL, '6529638.jpg', '5072699.pdf', 1, 2009, 'Switzerland', 46, '2019-01-14 17:19:39', '2019-01-14 17:19:39', '203.190.11.115'),
(173, 12, 1, NULL, 1, 'VLSI TECHNOLOGY', 'vlsi-technology', NULL, '0-8493-1738-X', NULL, 'Technology, VLSI,', 'The book stresses fundamental theory behind professional applications. In order to do so, the text is\r\nreinforced with frequent examples. Extensive development of theory and details of proofs have been\r\nomitted. The reader is assumed to have a certain degree of sophistication and experience. However, brief\r\nreviews of theories, principles, and mathematics of some subject areas are given.\r\nThe compilation of this book would not have been possible without the dedication and efforts of\r\nKrishna Shenai and Stephen I. Long, and, most of all, the contributing authors.', NULL, '2351248.PNG', '1320307.pdf', 1, 2003, 'New York', 47, '2019-01-14 17:29:03', '2019-01-14 17:29:03', '203.190.11.115'),
(174, 117, 1, NULL, 1, 'Digital signal processing using MATLAB and Wavelets', 'digital-signal-processing-using-matlab-and-wavelets', NULL, '0-9778582-0-0', NULL, 'Signal processing, Digital techniques, Mathematics,  MAT LAB, Wavelets, Mathematics', 'Digital signal processing is an important and growing field. There have been\r\nmany books written in this area, however, I was motivated to write this manuscript\r\nbecause none of the existing books address the needs of the computer scientist. This\r\nwork attempts to fill this void, and to bridge the disciplines from which this field\r\noriginates: mathematics, electrical engineering, physics, and engineering mechanics.\r\nHerein, it is hoped that the reader will find sensible explanations of DSP concepts,\r\nalong with the analytical tools on which DSP is based.', NULL, '4296714.PNG', '5460795.pdf', 1, 2007, 'USA', 46, '2019-01-14 17:31:22', '2019-01-14 17:31:22', '203.190.11.115'),
(175, 118, 1, NULL, 1, 'AN INTRODUCTION TO VLSI PHYSICAL DESIGN', 'an-introduction-to-vlsi-physical-design', NULL, '0-07-057194-5', NULL, 'Physics, Physical design', '.\r\nThis book assumes that the readers have a basic understanding of computer\r\ndata representation and manipulation (i .e ., data structures), computer algorithms,\r\nand computer organization . An introductory course in algorithm design and a first\r\ncourse in logic design can serve as student prerequisites for a course using this\r\nbook.', 'https://www.amazon.com/Advances-Computational-Fluid-Structure-Interaction-Simulation/dp/3319408259', NULL, '6366785.pdf', 1, 1996, 'New York', 47, '2019-01-14 17:49:29', '2019-01-14 17:49:29', '203.190.11.118'),
(176, 119, 1, NULL, 1, 'Elements of the Differential, and Integral Calculus', 'elements-of-the-differential-and-integral-calculus', '(Revised: Edition)', '1331981832', NULL, 'Calculus, Differential, and Integral', 'The author has tried to write a textbook that is thoroughly modern and teachable and the capacity and needs Of the student pursuing a first course in \'the Calculus have been kept constantly in mind. The book contains more material than is necessary for the usual course of one hundred lessons given in our colleges and engineering schools; but this gives teachers an Opportunity to choose such subjects as best suit the needs of their classes. It is believed that the volume con tains all topics from which a selection naturally would be made in preparing students either for elementary work in applied science or for more advanced work in pure mathematics.', NULL, '1171251.jpg', '4023729.pdf', 1, 2018, 'New York', 46, '2019-01-14 17:49:53', '2019-01-14 17:49:53', '203.190.11.115'),
(177, 121, 1, NULL, 1, 'Newnes Interfacing Companion:', 'newnes-interfacing-companion', '1st ed.', '0 750 65720 0', NULL, 'Computers, Transducers, Instrumentation and Signal Processing', 'The overall aim of this book is to present transducer devices,\r\ncomputer interfacing and instrumentation electronics in a succinct\r\nand memorable fashion. The book combines physics, computer\r\nscience and electrical engineering in a science/engineering context.\r\nStarting from the transfer of physical phenomena to electrical signals,\r\nthe book presents a comprehensive treatment of computer interfacing\r\nand finishes with signal conditioning, data analysis and digital\r\nfiltering. The book covers a wide scope but contains sufficient detail\r\nto allow a practical application of the theory. Detailed explanations\r\nare given,', NULL, '1380788.jpg', '5047750.pdf', 1, 2002, 'Australia', 46, '2019-01-14 18:01:52', '2019-01-14 18:01:52', '203.190.11.118'),
(178, 10, 1, NULL, 1, 'VLSI-Design of Non-Volatile Memories', 'vlsi-design-of-non-volatile-memories', NULL, '3-540-20198-X', NULL, 'VLSI-Design, Volatile, Non-Volatile, Memories,', 'The design of integrated circuits today remains an essential discipline in support of technological progress, and the authors of this book have taken a giant step\r\nforward in the development of a practice-oriented treatise for design engineers\r\nwho are interested in the practical, industry-driven world of integrated circuit design.', NULL, '3931061.PNG', '5810388.pdf', 1, 2005, 'Italy', 47, '2019-01-14 18:03:35', '2019-01-14 18:03:35', '203.190.11.118'),
(179, 122, 1, NULL, 1, 'Fortran 95', 'fortran-95', '1st ed.', '1-85728-367-8', NULL, 'Fortran language, Programs and programming', 'This is a revised, expanded, and updated version of the original book Fortran 90 which appeared when\r\nFortran 90 was first launched as an international standard programming language some five years ago. This\r\nbook conforms to the proposed new Fortran 95 standard, but the new features are clearly marked as such so\r\nthat the book can be used without difficulty by those who are continuing to use Fortran 90. It is designed to\r\nbe useful both as a textbook for those new to programming and also as a fully up-to-date reference book for\r\nmore experienced computer users.\r\nFortran 95 includes a chapter on High Performance Fortran, the major extension to the language enabling\r\nprograms to be written to exploit multiple-processor computers to the full. In addition there is an appendix\r\ngiving details of the module ISO_VARYING_STRINGS, the now-standard extension of the Fortran\r\nlanguage to handle variable-length character strings.', NULL, '9425869.PNG', '4514710.pdf', 1, 2005, 'USA', 46, '2019-01-14 18:12:56', '2019-01-14 18:12:56', '203.190.11.118'),
(180, 43, 1, NULL, 1, 'Fortran 90 Handbook Complete ANSI / ISO Reference', 'fortran-90-handbook-complete-ansi-iso-reference', NULL, '0-07-000406-4', NULL, 'Fortran, 90 Handbook, definitive and comprehensive', 'The Fortran 90 Handbook is a definitive and comprehensive guide to Fortran 90\r\nand its use. Fortran 90, the latest standard version of Fortran, has many\r\nexcellent new features that will assist the programmer in writing efficient,\r\nportable, and maintainable programs. The Fortran 90 Handbook is an informal\r\ndescription of Fortran 90, developed to provide not only a readable\r\nexplanation of features, but also some rationale for the inclusion of features\r\nand their use. In addition, â€œmodelsâ€ give the reader better insight as to why\r\nthings are done as they are in the language.', NULL, '9644283.jpg', '2451703.pdf', 1, 2002, 'USA', 46, '2019-01-14 18:20:25', '2019-01-14 18:20:25', '203.190.11.117'),
(181, 43, 1, NULL, 1, 'Fortran 90 Handbook Complete ANSI / ISO Reference', 'fortran-90-handbook-complete-ansi-iso-reference-14211315', NULL, '0-07-000406-4', NULL, 'Fortran, 90 Handbook, definitive and comprehensive', 'The Fortran 90 Handbook is a definitive and comprehensive guide to Fortran 90\r\nand its use. Fortran 90, the latest standard version of Fortran, has many\r\nexcellent new features that will assist the programmer in writing efficient,\r\nportable, and maintainable programs. The Fortran 90 Handbook is an informal\r\ndescription of Fortran 90, developed to provide not only a readable\r\nexplanation of features, but also some rationale for the inclusion of features\r\nand their use. In addition, â€œmodelsâ€ give the reader better insight as to why\r\nthings are done as they are in the language.', NULL, '3794722.jpg', '3208022.pdf', 1, 2002, 'USA', 46, '2019-01-14 18:21:15', '2019-01-14 18:21:15', '203.190.11.117'),
(182, 61, 1, NULL, 1, 'Principles of CMOS VLSI Design', 'principles-of-cmos-vlsi-design', NULL, '0-201-08222-5', NULL, 'CMOS, VLSI Design,', 'The material in this book is divided into several parts.The first part deals with CMOS circuit design and CMOS processing technology.The second part deals with design issue and sub-system design', 'https://images-na.ssl-images-amazon.com/images/I/41xYMcLyivL._SX349_BO1,204,203,200_.jpg', '9817390.PNG', '6164995.pdf', 1, 1985, 'Singapore', 47, '2019-01-14 18:29:52', '2019-01-14 18:29:52', '203.190.11.115'),
(183, 12, 1, NULL, 1, 'Wind and solar power systems', 'wind-and-solar-power-systems', '1st ed.', '0-8493-1605-7 (alk. paper)', NULL, 'Solar, Power Systems', 'Wind and solar energy are pollution-free sources of abundant power. With renewable power generation expected to become more and more profitable with open access to transmission lines and rapid growth around the world, the design, operation, and control of alternative energy resources becomes an essential field of study.', 'https://images-na.ssl-images-amazon.com/images/I/41kPi0wnY5L._SX314_BO1,204,203,200_.jpg', '/tmp/phpMabgaq', NULL, 1, 1999, 'New York', 40, '2019-01-14 18:42:48', '2019-01-14 18:47:13', '203.190.11.117'),
(184, 57, 1, NULL, 1, 'Fourier and Laplace Transforms', 'fourier-and-laplace-transforms', NULL, '978-0-511-67312-2', NULL, 'Signals, systems, Transforms', 'This book arose from the development of a course on Fourier and Laplace\r\ntransforms for the Open University of the Netherlands. Originally it was the\r\nintention to get a suitable course by revising part of the book Analysis and\r\nnumerical analysis, part 3 in the series Mathematics for higher education\r\nby R. van Asselt et al. (in Dutch). However, the revision turned out to be so\r\nthorough that in fact a completely new book was created. We are grateful\r\nthat Educaboek was willing to publish the original Dutch edition of the book\r\nbesides the existing series.', NULL, '1868864.PNG', '2667782.pdf', 1, 2003, 'UK', 46, '2019-01-14 19:13:08', '2019-01-14 19:13:08', '203.190.11.115'),
(185, 123, 1, NULL, 1, 'CMO S DIGITAL INTE GRATE D CI RCUITS', 'cmo-s-digital-inte-grate-d-ci-rcuits', 'Second edition', 'G-07-246053-9', NULL, 'DIGITAL CIRCUITS, CMOS CIRCUITS, CIRCUITS,', 'This book, CMOS Digital Integrated Circuits: Analysis and Design, is primarily\r\nintended as a comprehensive textbook at the senior level and first-year graduate level, as\r\nwell as a reference for practicing engineers in the areas of integrated circuit design, digital\r\ndesign, and VLSI. Recognizing that the area of digital integrated circuit design is\r\nevolving at an increasingly faster pace, we have made every.possible effort to present upto-date materials on all subjects covered. This book contains sixteen chapters; and we\r\nrecognize that it would not be possible to cover rigorously all of this material in one\r\nsemester. Thus, we would propose the following based on our teaching experience: At\r\nthe undergraduate level, coverage of the first ten chapters would constitute sufficient\r\nmaterial for a one-semester course on CMOS digital integrated circuits.', NULL, '9896317.PNG', '1703964.pdf', 1, 2003, 'Bangkok', 47, '2019-01-14 19:20:13', '2019-01-14 19:20:13', '203.190.11.115'),
(186, 124, 1, NULL, 1, 'VLSI TEST PRINCIPLES AND ARCHITECTURES', 'vlsi-test-principles-and-architectures', 'Second edition', '13: 978-0-12-370597-6', NULL, 'ARCHITECTURES, VLSI TEST,', 'This textbook is being made available with this goal in mind. It is a fundamental\r\nyet comprehensive guide to new DFT methods that will show readers how to design\r\na testable and quality product, drive down test cost, improve product quality and\r\nyield, and speed up time-to-market and time-to-volume. Intended users of the book\r\ninclude undergraduates, engineers and engineering managers who have the need to know; it is not simply for graduate students and researchers.', NULL, '6964481.PNG', '5723983.pdf', 1, 2006, 'NEW YORK', 47, '2019-01-14 19:30:38', '2019-01-14 19:30:38', '203.190.11.118'),
(187, 99, 1, NULL, 1, 'RF CMOS Power Amplifiers : Theory, Design and Implementation', 'rf-cmos-power-amplifiers-theory-design-and-implementation', NULL, '0-306-47320-8', NULL, 'RF CMOS, Power Amplifiers,  CMOS Design and Implementation', 'The key to integration, and reduction in costs is the correct choice of the implementation technology. CMOS technology has played an important role in\r\nproviding higher functionality and complexity at low costs.The performance of\r\npower amplifiers is a crucial issue for the overall performance of the transceiver\'s\r\nchain. Until now, power amplifiers for wireless applications have been produced almost exclusively in GaAS technologies, with few exceptions in LDMOS, Si BJT, and SiGe HBT. Sub-micron CMOS processes are now considered for power amplifier design due to the higher yield, and the lower costs it', NULL, '1516837.PNG', '1586268.pdf', 1, 2002, 'New York', 47, '2019-01-14 19:44:38', '2019-01-14 19:44:38', '203.190.11.118'),
(188, 125, 1, NULL, 1, 'DSP integrated circuits', 'dsp-integrated-circuits', '1st ed.', '0127345302', NULL, 'Circuits, CMOS technology, optimization, integrated circuit', 'DSP Integrated Circuits establishes the essential interface between theory of digital signal processing algorithms and their implementation in full-custom CMOS technology. With an emphasis on techniques for co-design of DSP algorithms and hardware in order to achieve high performance in terms of throughput, low power consumption, and design effort, this book provides the professional engineer, researcher, and student with a firm foundation in the theoretical as well as the practical aspects of designing high performance DSP integrated circuits.', NULL, '1484704.jpg', '4574954.pdf', 1, 1999, 'New York', 40, '2019-01-14 19:50:45', '2019-01-14 19:50:45', '203.190.11.115'),
(189, 126, 1, NULL, 1, 'Structural Concrete: Theory and Design', 'structural-concrete-theory-and-design', '6th', '978-1-118-76781-8', NULL, 'Structural Theory and Structural Design', 'The main objective of a course on structural concrete design is to develop, in the engineering student, the ability to analyze and design a reinforced concrete member subjected to different types of forces in a simple and logical manner using the basic principles of statistics and some empirical formulas based on experimental results. Once the analysis and design procedure is fully understood, its application to different types of structures becomes simple and direct, provided that the student has a good background in structural Concrete structures are widely used in the United States and almost all over the world. The progress in the design concept has increased in the last few decades, emphasizing safety, serviceability, and economy.', NULL, '5299842.PNG', '1437696.pdf', 1, 2015, 'New York', 34, '2019-01-14 19:53:49', '2019-01-14 19:53:49', '203.190.11.115'),
(190, 81, 1, NULL, 1, 'Consumer Behavior Buying, Having, and Being', 'consumer-behavior-buying-having-and-being', '10th', '978-0-273-76731-2', NULL, 'Consumer Behaviour', 'As this book\'s subtitle suggests, my vision of consumer behavior goes well beyond studying the act of buyingâ€”having and being are just as important, if not more so. Consumer behavior is more than buying things; it also embraces the study of how having (or not having) things affects our lives and how our possessions influence the way we feel about ourselves and about each otherâ€”our state of being. I developed the wheel of consumer behavior that appears at the beginning of text sections to underscore the complexâ€”and often inseparableâ€”interrelationships between the individual consumer and his or her social realities. In addition to understanding why people buy things, we also try to appreciate how products, services, and consumption activities contribute to the broader social world we experience. Whether we shop, cook, clean, play basketball, hang out at the beach, or even look at ourselves in the mirror, the marketing system touches our lives.', NULL, '9255756.PNG', '5600724.pdf', 1, 2013, 'New York', 34, '2019-01-14 20:02:03', '2019-01-14 20:02:03', '203.190.11.115'),
(191, 127, 1, NULL, 1, 'Alternating Current Engineering Practically Treated', 'alternating-current-engineering-practically-treated', '3rd ed.', NULL, NULL, 'Modern alternating apparatus, Alternating current engineering', 'The directing for many years in practical engineering of graduates from technical colleges of this and other countries, and also young men starting in the electrical business without complete technical training, has impressed upon my mind the necessity for a general treatise on alternating current engineering presented in a practical and compact way$ without complex methods of explanation, and free from any matters not bearing directly on purely\r\nengineering work.', NULL, '5352466.jpg', '2044643.pdf', 1, 1907, 'London', 49, '2019-01-14 20:28:49', '2019-01-14 20:28:49', '203.190.11.115'),
(192, 71, 1, NULL, 1, 'Principles of Marketing', 'principles-of-marketing', '16th', '978-1-292-09249-2', NULL, 'Marketing', 'wards: the Distinguished Marketing Educator of the Year Award and the William L. Wilkie â€œMarketing for a Better Worldâ€ Award, both given by the American Marketing Association; the Philip Kotler Award for Excellence in Health Care Marketing presented by the Academy for Health Care Services Marketing; and the Sheth Foundation Medal for Exceptional Contribution to Marketing Scholarship and Practice. His numerous other major honors include the Sales and Marketing Executives International Marketing Educator of the Year Award;', NULL, '7687706.PNG', '6177570.pdf', 1, 2016, 'New York', 34, '2019-01-14 20:37:10', '2019-01-14 20:37:10', '203.190.11.117'),
(193, 12, 1, NULL, 1, 'Advanced Multi-Quadrant Operation DC/DC Converters', 'advanced-multi-quadrant-operation-dcdc-converters', NULL, '0-8493-7239-9', NULL, 'Multi-quadrant DC/DC', 'DC/DC converters are systematically sorted into 6 generations. We introduce the DC/DC converters of the second to fourth generations in this book. The purpose of this book is to provide multi-quadrant operation DC/DC\r\nconverters that are both concise and useful for engineering students and\r\npracticing professionals. It is well organized in 200 pages and 100 diagrams\r\nto introduce more than 50 topologies of the multi-quadrant DC/DC converters. All topologies are novel approaches and new contributions to modern power electronics. They are sorted into three generations:\r\n1. Second generation (multiple-quadrant) converters\r\n2. Third generation (switched component) converters\r\n3. Fourth generation (soft-switching) converters', NULL, '6730565.jpg', NULL, 1, 2006, 'New York', 49, '2019-01-14 20:40:55', '2019-01-14 20:40:55', '203.190.11.115'),
(194, 49, 1, NULL, 1, 'A study guide to accompany FUNDAMENTALS OF PHYSICS', 'a-study-guide-to-accompany-fundamentals-of-physics', '8th ed.', '978- 047t-779s6-8', NULL, 'PHYSICS', 'Oach generation has its unique needs and aspirations. When Charles Wiley first\r\nopened his small printing shop in lower Manhattan in 1807, it was a generation\r\nof boundless potential searching for an identity. fuid we were there, helping to\r\ndefine a new American literary tradition. Over half a century later, in the midst\r\nof the Second lndustrial Revolution, it was a generation focused on building the\r\nfuture. Once again, we were there, supplying the critical scientific, technical, and\r\nengineering knowledge that helped frame the world. Throughout the 20th\r\nCennuy, and into the new millennium, nations began to reach out beyond their\r\nown borders and a new international community was born. Wiley was there,\r\nexpanding its operations around the world to enable a global exchange of ideas,\r\nopinions, and know-how.', NULL, '3071290.PNG', '2316158.pdf', 1, 2008, 'New York', 46, '2019-01-14 20:52:39', '2019-01-14 20:52:39', '203.190.11.115'),
(195, 74, 1, NULL, 1, 'Photovoltaics and Architecture', 'photovoltaics-and-architecture', NULL, '0-203-16582-9', NULL, 'Photovoltaics, Architechture', 'Randall Thomas has done an important service to the design community by assembling this primer on basic photovoltaic (PV) concepts, practice, and ï¬eld examples for the UK and northern Europe. The treatment is clear, wellorganised, and practical.\r\nFurther opportunities can yield economics even better than the authors describe. Exceptionally close attention to efï¬cient use of electricity costs far less than producing it, especially by PVs. The publications of Rocky Mountain Instituteâ€™s Green Development Services (www.rmi.org) describe how highly integrated design, starting at the preconception stage, can often make highly energy-efï¬cient buildings cost less to construct, due largely to making costly mechanical systems smaller or eliminating them altogether.', NULL, '1403177.PNG', '1486018.pdf', 1, 2001, 'New York', 34, '2019-01-14 20:55:06', '2019-01-14 20:55:06', '203.190.11.115'),
(196, 128, 1, NULL, 1, 'Condition Monitoring of Rotating Electrical Machines', 'condition-monitoring-of-rotating-electrical-machines', '2nd ed.', '9780863417399', NULL, 'Engineering processes, Electrical machinery, Inspection techniques.', 'Condition monitoring of engineering plant has increased in importance as more\r\nengineering processes become automated and the manpower needed to operate and supervise plant is reduced. However, electrical machinery has traditionally been thought of as reliable and requiring little attention, except at infrequent intervals when the plant is shut down for inspection. Indeed the traditional application of fastacting protective relays to electrical machines has rather reduced the attention that operators pay to the equipment.', NULL, '2915292.jpg', '3217494.pdf', 1, 2008, 'London', 49, '2019-01-14 20:57:29', '2019-01-14 20:57:29', '203.190.11.117'),
(197, 129, 1, NULL, 1, 'POWER-CONSTRAINED TESTING OF VLSI CIRCUITS', 'power-constrained-testing-of-vlsi-circuits', NULL, '0-306-48731-4', NULL, 'POWER, POWER-CONSTRAINED, VLSI CIRCUITS', 'Multi-billion transistor chips will be manufactured by the end of this decade,\r\nand new design and test methodologies will be emerging to cope with the product complexity. Power dissipation has already become a major design concern\r\nand it is turning into a key challenge for the deep submicron digital integrated\r\ncircuits. Power dissipation concerns cover a large spectrum of products ranging\r\nfrom high performance computing to wireless communication. The continuous\r\ngrowth in power requirements is driven by the ever increasing chip complexity.\r\nWhile smaller devices operate at lower voltages, the currents grow to drive the\r\nlarge number of transistors on a complex circuit and consequently the power\r\ndissipation increases.', NULL, '4434279.PNG', '9685475.pdf', 1, 2004, 'New York', 47, '2019-01-14 21:05:04', '2019-01-14 21:05:04', '203.190.11.115'),
(198, 49, 1, NULL, 1, 'Fuzzy Systems Engineering: Toward Human-Centric Computing', 'fuzzy-systems-engineering-toward-human-centric-computing', NULL, '978-0-471-78857-7', NULL, 'Toward Human, Centric ComputingDigital communities,  Granular computing', 'Over 40 years have already passed since the inception of fuzzy sets. During this\r\nperiod we have witnessed a truly impressive wealth of theoretical developments and\r\nconceptual pursuits, emergence of novel methodologies, algorithmic environments,\r\nand a variety of applications. Contemporary technologies in the areas such as\r\ninformation storage and retrieval, web search, image processing and understanding,\r\ncontrol, pattern recognition, bioinformatics and computational biology, e-markets,\r\nautonomous navigation, and guidance have benefited considerably from the developments in fuzzy sets. What becomes equally important is that we have accumulated a\r\nbody of knowledge, developed sound design practices, and gained a comprehensive\r\ninsight into the role of the technology of fuzzy sets in system design and analysis', NULL, '/tmp/php75WoyB', '4767205.pdf', 1, 2007, 'New York', 46, '2019-01-14 21:22:43', '2019-01-14 21:24:06', '203.190.11.115');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(199, 130, 1, NULL, 1, 'The Art of Designing Embedded Systems', 'the-art-of-designing-embedded-systems', NULL, 'N 0-7506-9869-1', NULL, 'Designing, Embedded,  Art', 'I\'d like to thank Pam Chester, my editor at Butterworth-Heinemann.\r\nfor her patience and good humor through the birthing of this book. And\r\nthanks to Joe Beitzinger for his valuable comments on the initial form of\r\nthe book.\r\nFinally, thanks to the many developers I\'ve worked with over the\r\nyears, and the many more who have corresponded.', NULL, '4525187.PNG', '2210697.pdf', 1, 2002, 'New York', 46, '2019-01-14 21:31:01', '2019-01-14 21:31:01', '203.190.11.118'),
(200, 74, 1, NULL, 1, 'FUNDAMENTALS OF DIGITAL LOGIC WITH VERILOG DESIGN', 'fundamentals-of-digital-logic-with-verilog-design', NULL, '0-07-282315-1', NULL, 'DIGITAL LOGIC,VERILOG DESIGN', 'This book is intended for an introductory course in digital logic design,which is a basic course in most electrical and computer engineering programs.A successful designer of digital logic circuits needs a good understanding of basic concepts and a firm grasp of computer-aided design tools.', NULL, '8951575.JPG', '1536177.pdf', 1, 2002, 'New York', 48, '2019-01-14 21:31:15', '2019-01-14 21:31:15', '203.190.10.204'),
(201, 49, 1, NULL, 1, 'Digital Signal Processing', 'digital-signal-processing', NULL, '0-471-29546-9', NULL, 'Digital Signal , Signal Processing', 'How dificult it is to design artificial devices that can perform as well.After decades of research, devices that can understand unconstrained human speech are still extremely primitive, and even speech synthesis is still to be considered a nontrivial problem.', NULL, '4069187.JPG', '1199359.pdf', 1, 2000, 'New York', 48, '2019-01-14 21:49:19', '2019-01-14 21:49:19', '203.190.10.204'),
(202, 49, 1, NULL, 1, 'HANDBOOK OF APPLIED ALGORITHMS: SOLVING SCIENTIFIC, ENGINEERING AND PRACTICAL PROBLEMS', 'handbook-of-applied-algorithms-solving-scientific-engineering-and-practical-problems', NULL, '978-0-470-04492-6', NULL, 'ALGORITHMS, SOLVING, SCIENTIFIC, ENGINEERING, PRACTICAL, PROBLEMS', 'Although vast activity exists, especially recent, the editors did not find any book\r\nthat treats applied algorithms in a comprehensive manner. The editors discovered a\r\nnumber of graduate courses in computer science programs with titles such as â€œDesign\r\nand Analysis of Algorithms, â€œCombinatorial Algorithmsâ€ â€œEvolutionary Algorithmsâ€\r\nand â€œDiscrete Mathematics.â€ However, when glancing through the course contents,\r\nit appears that they were detached from the real-world applications. On the contrary,\r\nrecently some graduate courses such as â€œAlgorithms in Bioinformaticsâ€ emerged,\r\nwhich treat one specific application area for algorithms. Other graduate courses heavily use algorithms but do not mention them anywhere explicitly. Examples are courses\r\non computer vision, wireless networks, sensor networks, data mining, swarm intelligence, and so on.', NULL, '4541846.PNG', '8611138.pdf', 1, 2008, 'New York', 46, '2019-01-14 21:49:35', '2019-01-14 21:49:35', '203.190.11.115'),
(203, 12, 1, NULL, 1, 'The Mechanical Engineering Handbook Series', 'the-mechanical-engineering-handbook-series', 'Series Editor', '0-8493-0866-6', NULL, 'Mechanical, Engineering, Handbooks, Manuals', 'The purpose of the second edition of the CRC Handbook of Mechanical Engineering is to continue\r\nproviding practicing engineers in industry, government, and academia with up-to-date information on\r\nthe most important topics of modern mechanical engineering. The book covers traditional topics such\r\nas thermodynamics, solid and fluid mechanics, heat and mass transfer, materials, controls, energy conversion, manufacturing and design, robotics, environmental engineering, economics and project management, patent law, and transportation. These topics were covered in the first edition, but they have\r\nbeen updated, new references have been added, and efforts have been made to provide information on\r\ncomputer technology related to the topics at the end of each chapter.', NULL, '7635881.jpg', '4558903.pdf', 1, 2005, 'New York', 46, '2019-01-14 22:12:29', '2019-01-14 22:12:29', '203.190.11.117'),
(204, 74, 1, NULL, 1, 'Digital signal processing: a computer based approach', 'digital-signal-processing-a-computer-based-approach', '2nd ed.', NULL, NULL, 'Software development, Practicing engineer etc.', 'The field of digital signal signal processing has seep explosive growth during the past three decades as phenomenal advances both in research and application have been made.', NULL, NULL, NULL, 1, 1965, 'California', 49, '2019-01-14 22:13:27', '2019-01-14 22:13:27', '203.190.11.117'),
(205, 12, 1, NULL, 1, 'Handbook  of  Lasers', 'handbook-of-lasers', NULL, NULL, NULL, 'Lasers, Handbook', 'Lasers continue to be an amazingly robust field of activity, one of continually expanding\r\nscientific and technological frontiers. Thus today we have lasing without inversion, quantum\r\ncascade lasers, lasing in strongly scattering media, lasing in biomaterials, lasing in photonic\r\ncrystals, a single atom laser, speculation about black hole lasers, femtosecond-duration laser\r\npulses only a few cycles long, lasers with subhertz linewidths, semiconductor lasers with\r\npredicted operating lifetimes of more than 100 years, peak powers in the petawatt regime and\r\nplanned megajoule pulse lasers, sizes ranging from semiconductor lasers with dimensions of\r\na few microns diameter and a few hundred atoms thick to huge glass lasers with hundreds of\r\nbeams for inertial confinement fusion research, lasers costing from less than one dollar to\r\nmore than one billion dollars, and a multibillion dollar per year market.', NULL, '7619039.PNG', '5311046.pdf', 1, 2001, 'New York', 46, '2019-01-14 22:20:17', '2019-01-14 22:20:17', '203.190.11.115'),
(206, 110, 1, NULL, 1, 'Steel Designs\' Manual', 'steel-designs-manual', '6th', '13: 978-1-4051-8940-8', NULL, 'Steel Design', 'A complete restructuring of the book was undertaken for the fifth edition, with\r\nmore material on overall design and a new section on construction. The analytical\r\nmaterial was condensed because it is now widely available elsewhere, but all the\r\ndesign data were retained in order to maintain the practical usefulness of the book\r\nas a day-to-day design manual. Allowable stress design concepts were replaced by\r\nlimit state design encompassing BS 5950 for buildings and BS 5400 for bridges.\r\n\r\nDesign examples are to the more appropriate of these two codes for each particu-\r\nlar application.', NULL, '2011821.JPG', '1266365.pdf', 1, 2003, 'USA', 48, '2019-01-14 22:21:53', '2019-01-14 22:21:53', '203.190.10.204'),
(207, 91, 1, NULL, 1, 'Electric motors and drives: fundamentals, types and applications', 'electric-motors-and-drives-fundamentals-types-and-applications', '3rd ed.', '978-0-7506-4718-2 0-7506-4718-3', NULL, 'Electric Motors,', 'Electric Motors and Drives is intended for non-specialist users of electric motors and drives, filling the gap between theory-based academic textbooks and the more prosaic \'handbooks\', which provide useful detail but little opportunity for the development of real insight and understanding. The book explores all of the widely-used modern types of motor and drive, including conventional and brushless D.C., induction motors and servo drives, providing readers with the knowledge to select the right technology for a given job.', NULL, '3280565.jpg', '5746308.pdf', 1, 2006, 'New York', 40, '2019-01-14 22:24:40', '2019-01-14 22:27:35', '203.190.11.115'),
(208, 91, 1, NULL, 1, 'Higher Engineering Mathematics', 'higher-engineering-mathematics', '6th ed.', '978-1-85-617767-2', NULL, 'Mathematics, Engineering, Higher', 'This sixth edition of â€˜Higher Engineering Mathematicsâ€™ covers essential mathematical material suitable\r\nfor students studying Degrees, Foundation Degrees,\r\nHigher National Certificate and Diploma courses in\r\nEngineering disciplines.\r\nIn this edition the material has been ordered into the\r\nfollowing twelve convenient categories: number and\r\nalgebra, geometry and trigonometry, graphs, complex\r\nnumbers, matrices and determinants, vector geometry,\r\ndifferential calculus, integral calculus, differential equations, statistics and probability, Laplace transforms and\r\nFourier series. New material has been added on logarithms and exponential functions, binary, octal and\r\nhexadecimal, vectors and methods of adding alternating waveforms.', NULL, '2436065.PNG', '2063660.pdf', 1, 2010, 'New York', 46, '2019-01-14 22:27:35', '2019-01-14 22:27:35', '203.190.11.117'),
(209, 131, 1, NULL, 1, 'Testing of electro-magnetic machinery and other apparatus, Volume I', 'testing-of-electro-magnetic-machinery-and-other-apparatus-volume-i', NULL, NULL, NULL, 'electromagnetic, machinery', NULL, NULL, '4149530.jpg', '3116022.pdf', 1, 1909, 'London', 40, '2019-01-14 22:47:13', '2019-01-14 22:47:13', '203.190.11.115'),
(210, 10, 1, NULL, 1, 'An introduction to Laplace transforms and Fourier series.', 'an-introduction-to-laplace-transforms-and-fourier-series', NULL, '1852330155', NULL, 'Laplace, transformation, Fourier', 'This book has been primarily written for the student of mathematics who is in\r\nthe second year or the early part of the third year of an undergraduate course.\r\nIt will also be very useful for students of engineering and the physical sciences\r\nfor whom Laplace Transforms continue to be an extremely useful tool. The\r\nbook demands no more than an elementary knowledge of calculus and linear\r\nalgebra of the type found in many first year mathematics modules for applied\r\nsubjects. For mathematics majors and specialists, it is not the mathematics\r\nthat will be challenging but the applications to the real world', NULL, NULL, '3819782.pdf', 1, 2003, 'New York', 46, '2019-01-14 22:57:28', '2019-01-14 22:57:28', '203.190.11.115'),
(211, 132, 1, NULL, 1, 'Alternating currents, a text-book for students of engineering', 'alternating-currents-a-text-book-for-students-of-engineering-14141851', NULL, NULL, NULL, NULL, NULL, NULL, '7663892.jpg', '9302588.pdf', 1, 1906, 'New York', 40, '2019-01-14 23:14:51', '2019-01-14 23:14:51', '203.190.11.115'),
(212, 133, 1, NULL, 1, 'Data Conversion Handbook', 'data-conversion-handbook', NULL, '0-7506-7841-0', NULL, 'Data Conversion', 'This book is written for the practicing design engineer who must routinely use data converters and related support circuitry. We have therefore included many practical design suggestions. Much of the material has been takenâ€”and updated where necessaryâ€”from previous popular Analog Devicesâ€™ seminar books. Most of the tutorial sections have undergone several revisions over the years to ensure their accuracy and clarity. Various highly experienced members of the Analog Devicesâ€™ technical staff have contributed to the material, and they are recognized at the beginning of each major section in the book.', NULL, '6671480.JPG', '1838526.pdf', 1, 2005, 'London', 39, '2019-01-14 23:25:27', '2019-01-14 23:25:27', '203.190.10.206'),
(213, 134, 1, NULL, 1, 'Field and Wave Electromagnetic', 'field-and-wave-electromagnetic', NULL, '0-201-01239-1', NULL, NULL, 'The many books on introductory electromagnetic can be roughly decided into two main groups. The first group take the traditional development : starting with the experimental laws, generalizing them in steps, and finally synthesizing them in the form of Maxwell\'s equations. This is an inductive approach. The second group takes the axiomatic development : starting with Maxwell\'s equations, identifying each with the appropriate experimental laws, and specializing the general equations to static and time varying situations for analysis.', NULL, '5400893.JPG', '2406209.pdf', 1, 1983, 'London', 39, '2019-01-14 23:39:51', '2019-01-14 23:39:51', '203.190.10.206'),
(214, 136, 1, NULL, 1, 'Lessons In Electric Circuits, Volume I â€“ DC', 'lessons-in-electric-circuits-volume-i-dc', '5th ed.', NULL, NULL, 'Electric Circuit, DC', 'Electric Circuit, DC', NULL, '1491794.JPG', '5411965.pdf', 1, 2006, 'USA', 39, '2019-01-14 23:44:09', '2019-01-14 23:44:09', '203.190.10.206'),
(215, 10, 1, NULL, 1, 'Decision-Making in Engineering Design : Theory and Practice', 'decision-making-in-engineering-design-theory-and-practice', NULL, '9781846280009', NULL, 'Decision Making in Engineering Decision', 'This book is a sequel to The Practice of Machine Design, and The Practice of Machine Design, Book 3 â€“ Learning from Failure. It deals with what happens inside the human mind during such activities as design and production, and how we reach decisions.  Unlike other regular machine design textbooks or handbooks that describe how to accomplish good designs, the present volume explains what the designer thinks when making design decisions. A design starts with a vague concept and gradually takes shapes as it proceeds, and during this process the mind extracts elements and makes selections and decisions, the results expressed in sketches, drawings, or sentences. This book aims at exposing the reader to the processes of element extraction, selection, and decision-making through real-life examples.', NULL, '7514106.JPG', '3081666.pdf', 1, 2006, 'Japan', 39, '2019-01-14 23:49:09', '2019-01-14 23:49:09', '203.190.10.206'),
(216, 72, 1, NULL, 1, 'Statistics and Probability for Engineering Applications', 'statistics-and-probability-for-engineering-applications', '1st. ed.', NULL, NULL, 'Engineer, Statistics, Probability', 'This book has been written to meet the needs of two different groups of readers. On one hand, it is suitable for practicing engineers in industry who need a better understanding or a practical review of probability and statistics. On the other hand, this book is eminently suitable as a textbook on statistics and probability for engineering students.', NULL, '5084474.jpg', '3002188.pdf', 1, 2003, 'New York', 39, '2019-01-14 23:55:05', '2019-01-14 23:55:05', '203.190.10.206'),
(217, 72, 1, NULL, 1, 'Basic AC Circuits', 'basic-ac-circuits', '2nd ed.', '0-7506-7173-4', NULL, NULL, 'Basic AC Circuits, Second Edition is a step-by-step approach to AC circuit technology for the beginning student, hobbyist, technician, or engineer. The book is built into a series of self-paced, individualized learning goals covering electronics concepts, terms and the mathematics required to fully understand AC circuit problems--simple or complex.', NULL, '9981455.jpg', '5218052.pdf', 1, 2000, 'New Delhi', 40, '2019-01-14 23:57:20', '2019-01-14 23:57:20', '203.190.11.117'),
(218, 138, 1, NULL, 1, 'Fiber Optic Data Communication : Technological Trends and Advances', 'fiber-optic-data-communication-technological-trends-and-advances', NULL, '978-0750676182', NULL, 'Fiber Optic Data Communication,', 'This book arose during the process of revising the second edition of the Handbook of Fiber Optic Data Communication, when it became apparent that one book wasnâ€™t enough to contain all of the technology develop- ments in wavelength multiplexing, optically clustered servers, small form factor transceivers and connectors, and other emerging technologies. As a result, we decided to split off the four chapters on futures from the original handbook, combine them with many new chapters, and form this book, which can serve as either a companion to the original book or a stand-alone reference volume.', NULL, '2462450.JPG', '6580238.pdf', 1, 2002, 'New York', 39, '2019-01-15 00:05:17', '2019-01-15 00:05:17', '203.190.10.206'),
(219, 141, 1, NULL, 1, 'Nuclear Power: Technical and Institutional Options for the Future', 'nuclear-power-technical-and-institutional-options-for-the-future', NULL, '0-309-59507-X', NULL, NULL, 'The construction of nuclear power plants in the United States is stopping, as regulators, reactor manufacturers, and operators sort out a host of technical and institutional problems.\r\nThis volume summarizes the status of nuclear power, analyzes the obstacles to resumption of construction of nuclear plants, and describes and evaluates the technological alternatives for safer, more economical reactors. Topics covered include', NULL, '5862670.jpg', '6127742.pdf', 1, 1992, 'Washington', 40, '2019-01-15 00:08:25', '2019-01-15 00:11:11', '203.190.11.117'),
(220, 140, 1, NULL, 1, 'Handbook of Fiber Optic Data Communication', 'handbook-of-fiber-optic-data-communication', '2nd.', NULL, NULL, NULL, 'Fiber Optic, Data Communication', NULL, '8244551.JPG', '1636076.pdf', 1, 2002, 'New York', 39, '2019-01-15 00:10:22', '2019-01-15 00:10:22', '203.190.10.206'),
(221, 142, 1, NULL, 1, 'Quantum Mechanics for Electrical Engineers', 'quantum-mechanics-for-electrical-engineers', '1st ed.', '978-0-470-87409-7', NULL, NULL, 'The main topic of this book is quantum mechanics, as the title indicates. It specifically targets those topics within quantum mechanics that are needed to understand modern semiconductor theory. It begins with the motivation for quantum mechanics and why classical physics fails when dealing with very small particles and small dimensions. Two key features make this book different from others on quantum mechanics, even those usually intended for engineers:', NULL, '8950946.jpg', '9314364.pdf', 1, 2012, 'Canada', 40, '2019-01-15 00:23:12', '2019-01-15 00:23:12', '203.190.11.117'),
(222, 12, 1, NULL, 1, 'DEKKER Encyclopedia of Nanoscience and Nanotechnology', 'dekker-encyclopedia-of-nanoscience-and-nanotechnology', '2nd. ed.', '978â€‘0â€‘8493â€‘9639â€‘7', NULL, 'Nano Science, Nano Technology', 'An Encyclopedia of Nano Science and Nano Technology.', NULL, '7854055.JPG', '5468569.pdf', 1, 2009, 'U.S.A.', 39, '2019-01-15 00:27:53', '2019-01-15 00:27:53', '203.190.10.206'),
(223, 143, 1, NULL, 1, 'Design Criteria for Law Distortion in Feedback OPAMP Circuits', 'design-criteria-for-law-distortion-in-feedback-opamp-circuits', NULL, '0-306-48013-1', NULL, NULL, NULL, NULL, '4539734.JPG', '3692324.pdf', 1, 2003, 'New York', 39, '2019-01-15 00:37:50', '2019-01-15 00:37:50', '203.190.10.206'),
(224, 95, 1, NULL, 1, 'MICROELECTRONIC CIRCUITS', 'microelectronic-circuits', '5th Edition', '0-19-514252-7', NULL, 'MICROELECTRONIC, CIRCUITS', 'Microelectronic Circuits, fifth edition, is intended as a text for the core courses in electronic circuits taught to majors in electrical and compute r engineering. It should also prove useful to engineers and other professionals wishing to update their knowledge through self-study. As was the case with the first four editions, the objective of this book is to develop in the\r\nreader the ability to analyze and design electronic circuits, both analog and digital, discrete and integrated. While the application of integrated circuits is covered, emphasis is placed on transistor circuit design. This is done because of our belief that even if the majority of those studying the book were not to pursue a career in IC design, knowledge of what is inside the IC package would enable intelligent and innovative application of such chips. Furthermore, with the advances in VLSI technology and design methodology, IC design itself is becoming accessible to an increasing number of engineers.', NULL, '9628389.jpg', '9392664.pdf', 1, 2004, 'New York', 50, '2019-01-15 00:56:31', '2019-01-15 00:56:31', '203.190.11.117'),
(225, 118, 1, NULL, 1, 'COMPLETE DIGITAL DESIGN', 'complete-digital-design', NULL, '0-07-143347-3', NULL, 'Complete, Digital Design, Design', 'Digital systems are created to perform data processing and control tasks. What distinguishes one\r\nsystem from another is an architecture tailored to efficiently execute the tasks for which it was designed. A desktop computer and an automobileâ€™s engine controller have markedly different attributes\r\ndictated by their unique requirements. Despite these differences, they share many fundamental\r\nbuilding blocks and concepts. Fundamental to digital system design is the ability to choose from and\r\napply a wide range of technologies and methods to develop a suitable system architecture. Digital\r\nelectronics is a field of great breadth, with interdependent topics that can prove challenging for individuals who lack previous hands-on experience in the field.', NULL, '1354740.PNG', '1471319.pdf', 1, 2003, 'New York', 50, '2019-01-15 01:07:59', '2019-01-15 01:07:59', '203.190.11.117'),
(226, 101, 1, NULL, 1, 'Design Through Verilog HDL', 'design-through-verilog-hdl', NULL, '0-471-44148-1', NULL, 'Verlog HDL', 'Verilog has rapidly become a widely accepted language for VLSI design. The language is well-structured and defined to cater to the steady increase in the size of ICs to be designed without sacrificing the advantages associated with design at the \"grass roots\" level. A designer aspiring to master the language in its versatility should become familiar with the various constructs in it, practice their use in real applications, and use them in combinations to be successful. Describing a design using Verilog is only half the story: Writing Test benches, testing a design for all its desired functions, and identifying the faults and removing them remain equally challenging tasks. This book is an attempt to address these issues effectively. The constructs in Verilog are discussed through apt illustrative examples. Equal importance is given to design description and test benches. The examples have been tested with popular and commonly used simulation packages and the results reproduced. In many', NULL, '3835953.JPG', '6904932.pdf', 1, 2004, 'Canada', 39, '2019-01-15 01:10:01', '2019-01-15 01:10:01', '203.190.10.206'),
(227, 49, 1, NULL, 1, 'MOBILE FADING CHANNELS', 'mobile-fading-channels-14132031', 'First Edition', '0471 49549 2', NULL, 'Mobile,  Fading Channel', 'The book mainly is addressed to engineers, computer scientists, and physicists, who\r\nwork in the industry or in research institutes in the wireless communications field and\r\ntherefore have a professional interest in subjects dealing with mobile fading channels.\r\nIn addition to that, it is also suitable for scientists working on present problems of\r\nstochastic and deterministic channel modelling. Last, but not least, this book also is\r\naddressed to master students of electrical engineering who are specialising in mobile\r\nradio communications.', NULL, '5245738.PNG', '2198331.pdf', 1, 2002, 'England', 50, '2019-01-15 01:13:31', '2019-01-15 01:13:31', '203.190.11.117'),
(228, 103, 1, NULL, 1, 'REUSE METHODOLOGY MANUAL', 'reuse-methodology-manual', 'THIRD EDITION', '0-306-47640-1', NULL, 'REUSE,  METHODOLOGY MANUAL', 'The world of chip design has changed significantly since the second edition was published three years ago. In that time, silicon technology has gone through two generations, multi-million gate chips have gone from fringe to mainstream, and SoC has gone from the exotic to commonplace.In addition to the change in content, we have made one major editorial change. We\r\nhave dramatically reduced the number of references to specific tools. Over the brief life of this book, we have found that tool names, tool vendors, and tool capabilities change so quickly that specific references quickly become out of date. Instead, we have focused on design and language issues, referencing the generic capabilities of current tools as appropriate.', NULL, '6854616.PNG', '5236626.pdf', 1, 2002, 'New York', 50, '2019-01-15 01:18:20', '2019-01-15 01:18:20', '203.190.11.117'),
(229, 144, 1, NULL, 1, 'Design of Linear RF Outphasing Power Ampliï¬ers', 'design-of-linear-rf-outphasing-power-ampliers', NULL, '2003', NULL, NULL, 'The wireless communications revolution has been driven by a conï¬‚uence of technological advances, including improvements in communications theory, very large-scale integration (VLSI) technology, and radio frequency (RF) microelectronics. The microwave power ampliï¬er represents one of the major factors in the low-cost and low-power implementation of these systems, since they are required to deliver tens of watt sof power(in the case of a base station) with exacting standards of linearity and direct current (dc) power efï¬ciency. The microwave power ampliï¬er in the handset must deliverâ€”at mostâ€”a few watts of power but dissipate very little dc power and sell for only a few dollars in large quantities. Clearly, these requirements represent an enormous challenge for the design and implementation of the power ampliï¬er circuit.', NULL, '1706178.JPG', '3157269.pdf', 1, 2003, 'London', 39, '2019-01-15 01:18:43', '2019-01-15 01:18:43', '203.190.10.206'),
(230, 145, 1, NULL, 1, 'Protective Relaying for Power Generation Systems', 'protective-relaying-for-power-generation-systems', '1st ed.', '0-8247-0700-1 978-0-8247-0700-2', NULL, NULL, 'Power outages have considerable social and economic impacts, and effective protection schemes are crucial to avoiding them. While most textbooks focus on the transmission and distribution aspects of protective relays, Protective Relaying for Power Generation Systems is the first to focus on protection of motors and generators from a power generation perspective.', NULL, '7081228.jpg', '2021148.pdf', 1, 2006, 'New York', 40, '2019-01-15 01:21:44', '2019-01-15 01:21:44', '203.190.11.117'),
(231, 43, 1, NULL, 1, 'Schaum\'s Outline of Theory and Problems of Digital Signal Processing', 'schaums-outline-of-theory-and-problems-of-digital-signal-processing', NULL, '0â€“07â€“027389â€“8', NULL, 'Schaum\'s,  Digital, Signal Processing', 'Digital signal processing (DSP) is concerned with the representation of signals in digital form, and with the processing of these signals and the information that they carry. Although DSP, as we know it today, began to flourish in the 1960\'s, some of the important and powerful processing techniques that are in use today may be traced back to numerical algorithms that were proposed and studied centuries ago. Since the early 1970\'s, when the first DSP chips were introduced, the field of digital signal processing has evolved dramatically. With a tremendously rapid increase in the speed of DSP processors, along with a corresponding increase in their sophistication and computational power, digital signal processing has become an integral part of many commercial products and applications, and is becoming a commonplace term.', NULL, '7701688.PNG', '2245612.pdf', 1, 1999, 'New York', 50, '2019-01-15 01:22:09', '2019-01-15 01:22:09', '203.190.11.117'),
(232, 43, 1, NULL, 1, 'SCHAUM\'S OUTLINES OF Theory and Problems of Signals and Systems', 'schaums-outlines-of-theory-and-problems-of-signals-and-systems', NULL, '0-07-030641-9', NULL, 'SCHAUM\'S, Signals, Signals and Systems', 'The concepts and theory of signals and systems are needed in almost all electrical engineering fields and in many other engineering and scientific disciplines as well. They form the foundation for further studies in areas such as communication, signal processing, and control systems.\r\nThis book is intended to be used as a supplement to all textbooks on signals and systems or for self study. It may also be used as a textbook in its own right. Each topic is introduced in a chapter with numerous solved problems. The solved problems constitute an integral part of the text.', NULL, '1449522.PNG', '7340892.pdf', 1, 1995, 'New York', 50, '2019-01-15 01:25:19', '2019-01-15 01:25:19', '203.190.11.117'),
(233, 10, 1, NULL, 1, 'Mechatronics Dynamics of Electromechanical and Piezoelectric Systems', 'mechatronics-dynamics-of-electromechanical-and-piezoelectric-systems', NULL, '13 978-1-4020-4696-4', NULL, 'Mechatronics, Mechatronics Dynamics, Electromechanical, Piezoelectric Systems', 'This book is intended for mechanical engineers (researchers and graduate students) who wish to get some training in electro mechanical and\r\npiezoelectric transducers, and improve their understanding of the subtle interplay between mechanical response and electrical boundary conditions, and vice versa. In so doing, we follow the famous advice given by\r\nProf. Joseph Henry to Alexander Graham Bell, who had consulted him\r\nin connection with his telephone experiments in 1875, and lamented over\r\nhis lack of the electrical knowledge needed to overcome his mechanical\r\ndifficulties. Henry simply replied: â€œGet itâ€. The beauty of the Hamilton Lagrange formulation is that, once the appropriate energy and coenergy\r\nfunctions are used, all the electromagnetic forces (electrostatic, Lorentz,\r\nreluctance forces,...) and the multi-physics constitutive equations are automatically accounted for.', NULL, '2779744.jpg', '2199293.pdf', 1, 2006, 'Netherland', 50, '2019-01-15 01:30:14', '2019-01-15 01:30:14', '203.190.11.117'),
(234, 146, 1, NULL, 1, 'Developments in Speech Synthesis', 'developments-in-speech-synthesis', NULL, '0-470-85538-X', NULL, 'Speech Synthesis', 'In this book we aim to introduce and discuss some current developments in speech synthesis, particularly at the higher level, which focus on some speciï¬c issues. We shall see how these issues have arisen and look at possible ways in which they might be dealt with. One of our objectives will be to suggest that a more uniï¬ed approach to synthesis than we have at the present time may result in overall improvement to synthesis systems.', NULL, '4023358.JPG', '1552455.pdf', 1, 2005, 'England', 39, '2019-01-15 01:32:52', '2019-01-15 01:32:52', '203.190.10.206'),
(235, 12, 1, NULL, 1, 'Hard Disk Drive Mechatronics and Control', 'hard-disk-drive-mechatronics-and-control', NULL, '13: 978â€‘0â€‘8493â€‘7253â€‘7', NULL, 'Hard Disk, Mechatronics,  Mechatronics and Control', 'Magnetic information storage systems plays a very important role in this era of\r\ndigital information. All computer literate people of the world use these system\r\nto save billions of bytes of digital information and to access them as and when\r\nrequired; both of these services are available at the touch of our fingertips.\r\nMagnetic hard disk drives constitute the lions share of these storage systems.', NULL, '3291992.PNG', '4650132.pdf', 1, 2007, 'New York', 50, '2019-01-15 01:36:11', '2019-01-15 01:36:11', '203.190.11.117'),
(236, 112, 1, NULL, 1, 'Electronic & Electrical Engineering Research Studies', 'electronic-electrical-engineering-research-studies', NULL, '0 86380 263 X', NULL, 'Electronic & Electrical', 'The field of wireless communications has been undergoing a revolutionary growth in the last decade. This is attributed to the invention of portable mobile phones some 15 years ago. The success of the second-generation (2G) cellular communication services motivates the development of wideband third-generation (3G) cellular phones and other wireless products and services, including wireless local area networks, home RF, Bluetooth, wireless local loops, local multi-point distributed networks (LMDS), to name a few. The crucial component of a wireless network or device is the antenna. Very soon, our cities will be flooded with antennas of different kinds and shapes. On the other hand, for safety and portability reasons, low power, multi-functional and multi-band wireless devices are highly preferable. All these stringent requirements demand the development of highly efficient, low-profile and small-size antennas that can be made embedded into wireless products.', NULL, '4386787.JPG', '2046676.pdf', 1, 2003, 'England', 39, '2019-01-15 01:37:52', '2019-01-15 01:37:52', '203.190.10.206'),
(237, 125, 1, NULL, 1, 'COMPUTATIONAL  ELECTROMAGNETISM', 'computational-electromagnetism', 'First Edition', '13: 978-0121187101', NULL, 'COMPUTATIONAL,  ELECTROMAGNETISM', 'Computational electromagnetism begins where electromagnetic theory\r\nstops, and stops where engineering takes over. Its purpose is not to establish\r\nMaxwell equations, and other essential physical theories, but to use them\r\nin mathematical modelling, with concrete problems in view.\r\nModelling is this activity by which questions about a physical\r\nsituation are translated into a mathematical problemâ€”an equation, if\r\nthis word is understood is a general enough senseâ€”that will be solved, in\r\norder to answer these questions. â€œSolvingâ€, nowadays, means using a\r\ncomputer, in most cases. The equations one aims at, therefore, can very\r\nwell be huge systems of linear equations (solved as part of some iterative\r\nprocess, in nonlinear situations, or in the simulation of transient\r\nphenomena).', NULL, '1399964.PNG', '3629820.pdf', 1, 1997, 'New York', 50, '2019-01-15 01:42:03', '2019-01-15 01:42:03', '203.190.11.117'),
(238, 147, 1, NULL, 1, 'Alternating Current Engineering: Practically Treated', 'alternating-current-engineering-practically-treated-14432034', '3rd ed.', NULL, NULL, NULL, 'This scarce antiquarian book is a facsimile reprint of the original. Due to its age, it may contain imperfections such as marks, notations, marginalia and flawed pages. Because we believe this work is culturally important, we have made it available as part of our commitment for protecting, preserving, and promoting the world\'s literature in affordable, high quality, modern editions that are true to the original work.', NULL, '8602661.jpg', '8609675.pdf', 1, 1907, 'New York', 40, '2019-01-15 01:43:34', '2019-01-15 01:43:34', '203.190.11.117'),
(239, 148, 1, NULL, 1, 'Introduction to the Finite Element Method in Electromagnetics', 'introduction-to-the-finite-element-method-in-electromagnetics', 'First Edition', '13: 978-1598290462', NULL, 'Boundary-value problems (BVPs), Finite element method (FEM),\r\nGalerkin approach, Higher order elements, Linear elements,\r\nNumerical methods, Shape/interpolation functions, Weak formulation', 'This series lecture is an introduction to the finite element method with applications in electromagnetics. The finite element method is a numerical method that is used to solve boundary-value problems characterized by a partial differential equation and a set of boundary conditions. The geometrical domain of a boundary-value problem is discretized using sub-domain elements, called the finite elements, and the differential equation is applied to a single element after it is brought to a â€œweakâ€ integro-differential form. A set of shape functions is used to represent the primary unknown variable in the element domain. A set of linear equations is obtained for each element in the discretized domain. A global matrix system is formed after the assembly of all elements.', NULL, '9562978.PNG', '6241160.pdf', 1, 2006, 'United States of America', 50, '2019-01-15 01:47:02', '2019-01-15 01:47:02', '203.190.11.117'),
(240, 149, 1, NULL, 1, 'Basic Electromagnetism and Materials', 'basic-electromagnetism-and-materials', NULL, '13: 978-0387-30284-3', NULL, 'Basic Electromagnetism, Materials', 'This volume deals with the course work and problems that are common to basic electromagnetism teaching at the second- and third-year university level. The subjects covered will be of use to students who will go on to study the physical sciences, including materials science, chemistry, electronics and applied electronics, automated technologies, and engineering.', NULL, '3997159.jpg', '7810221.pdf', 1, 2007, 'New York', 50, '2019-01-15 01:51:11', '2019-01-15 01:51:11', '203.190.11.117'),
(241, 10, 1, NULL, 1, 'Determinants and Their Applications in Mathematical Physics', 'determinants-and-their-applications-in-mathematical-physics', NULL, '0-387-98558-1', NULL, NULL, 'The last treatise on the theory of determinants, by T. Muir, revised and enlarged by W.H. Metzler, was published by Dover Publications Inc. in 1960. It is an unabridged and corrected republication of the edition originally published by Longman, Green and Co. in 1933 and contains a preface by Metzler dated 1928. The Table of Contents of this treatise is given in Appendix 13. A small number of other books devoted entirely to determinants have been published in English, but they contain little if anything of importance that was not known to Muir and Metzler. A few have appeared in German and Japanese. In contrast, the shelves of every mathematics library groan under the weight of books on linear algebra, some of which contain short chapters on determinants but usually only on those aspects of the subject which are applicable to the chapters on matrices. There appears to be tacit agreement among authorities on linear algebra that determinant theory is important only as a branch of matrix t', NULL, '9927130.JPG', '4857792.pdf', 1, 1999, 'New York', 39, '2019-01-15 02:15:17', '2019-01-15 02:15:17', '203.190.10.206'),
(242, 67, 1, NULL, 1, 'Computer Exercises Manual: Device Parameters in SPICE : A Supplement to Understanding Semiconductor Devices', 'computer-exercises-manual-device-parameters-in-spice-a-supplement-to-understanding-semiconductor-devices', NULL, NULL, NULL, 'Computer Exercise', 'SPICE simulator is widely used for computer-aided design of electronic circuits. It enables a variety of very useful analyzes, like frequency response, DC sweep, transient analysis, etc. However, the precision of these analyzes ultimately depends on how well the mathematical models of the semiconductor devices match the real device characteristics. There is a number of device parameters, described in the textbook, whose values should be properly set so that the needed precision of the simulations is achieved. Obviously, there is a need to clearly understand the meaning, and in particular the eÂ®ects of the most important device parameters. While almost any SPICE manual and many circuit books list the device parameters, they do not explain them; it is assumed that the students and engineers know these parameters. This manual describes computer exercises that illustrate the eÂ®ects and the meaning of the device parameters. The exercises are based on circuit simulations1 involving the basic', NULL, '1264097.JPG', '1771355.pdf', 1, 2000, 'New York', 39, '2019-01-15 02:18:59', '2019-01-15 02:18:59', '203.190.10.206'),
(243, 74, 1, NULL, 1, 'Deferential Equations  : SCHAUMâ€™S Easy Outlines', 'deferential-equations-schaums-easy-outlines', '2nd.', '0-07-142846-1', NULL, 'Equations', 'Based on Schaumâ€™s Outline of Theory and Problems of Differential Equations', NULL, '3019784.JPG', '1523643.pdf', 1, 2003, 'New York', 39, '2019-01-15 02:24:07', '2019-01-15 02:24:07', '203.190.10.206'),
(244, 62, 1, NULL, 1, 'Differential Equations : Linear, Nonlinear, Ordinary, Partial', 'differential-equations-linear-nonlinear-ordinary-partial', NULL, '978-0-511007831-6', NULL, 'Equations', 'In this textbook, we steer a course between these two extremes, starting at the\r\nlevel of preparedness of a typical, but well-motivated, second year undergraduate\r\nat a British university. As such, the book begins in an unsophisticated style with\r\nthe clear objective of obtaining quantitative results for a particular linear ordinary differential equation. The text is, however, written in a progressive manner,\r\nwith the aim of developing a deeper understanding of ordinary and partial differential equations, including conditions for the existence and uniqueness of solutions,\r\nsolutions by group theoretical and asymptotic methods, the basic ideas of control theory, and nonlinear systems, including bifurcation theory and chaos.', NULL, '8084591.JPG', '6605499.pdf', 1, 2003, 'New York', 39, '2019-01-15 02:33:55', '2019-01-15 02:33:55', '203.190.10.206'),
(245, 67, 1, NULL, 1, 'Modern Digital and Analog Communication System', 'modern-digital-and-analog-communication-system', '3rd.', NULL, NULL, 'Digital and Analog Communication', 'This book examines communication by electrical signals. In the past, messages have been carried by runners. carrier pigeons, drum beats, and torches. These schemes were adequate for the distances and \"data rates\" of the age. In most pans of the world, these modes of communication have been superseded by electrical communication systems: which can transmit signals over much longer distances (even to distant planets and galaxies) and at the speed of light. Electrical communication is reliable and economical, communication technology is alleviating the energy crisis by trading information processing for a more rational use of energy resources. Some examples: Important discussions now mostly communicated face to face in meetings or conferences. often requiring travel. are increasingly using -tekconfening.\" Similarly, teleshopping and telebanting will provide services by electronic communication, and newspapers may be replaced by electronic news services.', NULL, '2476120.JPG', '6873242.pdf', 1, 1998, 'Athens', 39, '2019-01-15 02:39:50', '2019-01-15 02:39:50', '203.190.10.206'),
(246, 91, 1, NULL, 1, 'Maintenence Fundamentals', 'maintenence-fundamentals', '2nd', '0-75067798-8', NULL, 'Maintenance , Fundamentals', 'The developments of microprocessor or computer-based instrumentation that can be used to\r\nmonitor the operating condition of plant equipment, machinery, and systems\r\nhave provided the means to manage the maintenance operation. They have\r\nprovided the means to reduce or eliminate unnecessary repairs, prevent catastrophic machine failures, and reduce the negative impact of the maintenance\r\noperation on the profitability of manufacturing and production plants.', NULL, '4616469.JPG', '2180607.pdf', 1, 2004, 'Amsterdam', 48, '2019-01-15 14:40:24', '2019-01-15 14:40:24', '203.190.10.204'),
(247, 49, 1, NULL, 1, 'Materials Science and Engineering an Introduction', 'materials-science-and-engineering-an-introduction', '8th', '978-0-470-41997-7', NULL, 'Materials Science , Science and Engineering', NULL, NULL, '1193238.JPG', '1911145.pdf', 1, 2010, 'USA', 48, '2019-01-15 14:59:26', '2019-01-15 14:59:26', '203.190.10.204'),
(248, 150, 1, NULL, 1, 'Computer-Aided Design of Electrical Machines', 'computer-aided-design-of-electrical-machines', NULL, '9788178001463', NULL, 'Higher Efficiency, Lower weight for given KVA output (Kg/KVA), Lower Temperature-Rise, Lower Cost, Any other parameter like higher PF for induction motor, higher reactance etc.', 'A design problem has to be fonnulated considering the various constraints, processes, availability of materials, quality aspects. cost aspects etc. Constraints can be from technical, cost or availability aspects. Technical constraints can be from calculation methods, available process systems, skilled labour, manufacturing facilities, machinery, or tools etc. Sometimes transport facilities to site also pose problems. If suitable quality . materials are not available indigenously they may have to be imported, which effects cost and delivery time.', NULL, '7754721.jpg', '8721150.pdf', 1, 2008, 'Hyderabad', 49, '2019-01-15 15:10:00', '2019-01-15 15:10:00', '203.190.11.115'),
(249, 91, 1, NULL, 1, 'OP Amps For Everyone', 'op-amps-for-everyone', '3rd', '978-1-85617-505-0', NULL, 'OP Amps, Amps', 'its subsidiaries (TI) reserve the right to make\r\ncorrections, modifications, enhancements, improvements, and other changes to its\r\nproducts and services at any time and to discontinue any product or service without\r\nnotice. Customers should obtain the latest relevant information before placing orders\r\nand should verify that such information is current and complete', NULL, '5440893.JPG', '1258036.pdf', 1, 2009, 'UK', 48, '2019-01-15 15:28:09', '2019-01-15 15:28:09', '203.190.10.204'),
(250, 64, 1, NULL, 1, 'Practical  Analog and Digital Filter Design', 'practical-analog-and-digital-filter-design', NULL, '978-1580539159', NULL, 'Practical Analog  Digital Filter Design', 'This hands-on resource helps professionals master the most common analog and digital filter design and implementation methods. In practical terms, the book explains all the important derivations, so practioners can apply them directly to their own filter design problems.', NULL, '9211277.JPG', '9142517.pdf', 1, 2004, 'U.S.A.', 39, '2019-01-15 15:33:14', '2019-01-15 15:33:14', '203.190.10.206'),
(251, 49, 1, NULL, 1, 'WIRELESS COMMUNICATIONS', 'wireless-communications', 'Second Edition', '978-0-470-74187-0', NULL, 'WIRELESS, COMMUNICATIONS', 'These extensions are important for students (as well as researchers) to learn â€œup-to-dateâ€ skills, Most of the additional material might be best suited for a graduate course on advanced wireless concepts and techniques. However, the material on LTE (or WiMAX) is also well suited as an\r\nexample for standardized systems in a more elementary course (replacing, e.g., discussions of GSM or WCDMA systems). As for the first edition, presentation slides and a solutions manual are available for instructors\r\nthat adopt the textbook for their course. This material can also be obtained from the publisher or from a new website, wides.usc.edu/teaching/textbook. This site will also contain important resources for all readers of the book, including an â€œerrata list,â€ updates, additional references, and similar material.', NULL, '3603772.PNG', '4812712.pdf', 1, 2011, 'United Kingdom', 50, '2019-01-15 15:39:07', '2019-01-15 15:39:07', '203.190.11.115'),
(252, 30, 1, NULL, 1, 'Digital Audio Broadcasting: Principles and Applications of DAB, DAB + and DMB', 'digital-audio-broadcasting-principles-and-applications-of-dab-dab-and-dmb', '3rd. ed.', '0471858943', NULL, NULL, 'Digital Audio Broadcasting revised with the latest standards and updates of all new developments \r\nThe new digital broadcast system family is very different from existing conventional broadcast systems. It is standardised in a large number of documents (from ITU-R, ISO/IEC, ETSI, EBU, and others) which are often difficult to read. This book offers a comprehensive and fully updated overview of Digital Audio Broadcasting (DAB, DAB+) and Digital Multimedia Broadcasting (DMB), and related services and applications. Furthermore, the authors continue to build upon the topics of the previous editions, including audio coding, data services, receiver techniques, frequencies, and many others. There are several new sections in the book, which would be otherwise difficult to locate from various sources.', NULL, '3603733.jpg', '9031429.pdf', 1, 2001, 'New York', 39, '2019-01-15 15:40:22', '2019-01-15 15:40:22', '203.190.10.206'),
(253, 44, 1, NULL, 1, 'SENSORS AND ACTUATORS IN MECHATRONICS Design and Applications', 'sensors-and-actuators-in-mechatronics-design-and-applications', NULL, '13: 978-0-8493-9013-5', NULL, 'SENSORS, ACTUATORS,  MECHATRONICS', 'This book will be valuable to all those whose interests and job responsibilities are related to mechatronic systems and, in particular, magnetic sensors and electromechanical actuators. The intention of this book is to bring readers closer to the state of the art, to help them\r\nunderstand device functions and features, and to provide design guidance to meet specific, and sometimes extreme, industrial requirements. The focus on electromagnetic and electromechanical devices is natural because they are based on my inventions. I share my unique experiences as a design and manufacturing engineer, a researcher, and an inventor to help explain my way of thinking, which led to the development and successful industrial implementation of hundreds of millions of sensors and actuators in modern industrial mechatronic systems.', NULL, '8519061.PNG', '1703340.pdf', 1, 2007, 'New York', 50, '2019-01-15 15:43:35', '2019-01-15 15:43:35', '203.190.11.115'),
(254, 49, 1, NULL, 1, 'Digital Communication over Fading Channels : A Uniï¬ed Approach to Performance Analysis', 'digital-communication-over-fading-channels-a-unied-approach-to-performance-analysis', NULL, '0-471-20069-7', NULL, 'Digital Communication Fading Channel', 'In dealing with application of the MGF-based approach, the coverage in this book is extremely broad, in that coherent, differentially coherent, partially coherent and noncoherent communication systems are all handled, as well as a large variety of fading channel models typical of communication links of practical interest. Both single- and multichannel reception are discussed, and in the case of the latter, a large variety of diversity types are considered. For each combination of communication (modulation/detection) type, channel fading model, and diversity type, the average bit error rate (BER) and/or symbol error rate (SER) of the system is obtained and represented by an expression that is in a form that can readily be evaluated.2 All cases considered correspond to real practical channels, and in many instances the BER and SER expressions obtained can be evaluated numerically on a hand-held calculator.', NULL, '9071694.JPG', '5051793.pdf', 1, 2000, 'New York', 39, '2019-01-15 15:43:45', '2019-01-15 15:43:45', '203.190.10.206');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(255, 128, 1, NULL, 1, 'Wind Power Integration Connection and system operational aspects', 'wind-power-integration-connection-and-system-operational-aspects', NULL, '978-0-86341-449-7', NULL, 'Wind, Wind Power, Integration, Connection', 'The impetus for the book is the rapid growth of wind power and the implications of this for future power system planning, operation and control. This would have been a considerable challenge for the vertically integrated power companies pre-1990. It has become an even greater challenge in todayâ€™s liberalised electricity market conditions. The aim of the book is to examine the main problems of wind power integration on a significant scale. The authors then draw on their knowledge and expertise to help guide the reader through a number of solutions based on current research and on operational experience of wind power integration to date.', NULL, '3028663.PNG', '2447737.pdf', 1, 2007, 'London', 50, '2019-01-15 15:48:58', '2019-01-15 15:48:58', '203.190.11.115'),
(256, 151, 1, NULL, 1, 'Nanotechnology Molecular Speculations on Global Abundance', 'nanotechnology-molecular-speculations-on-global-abundance', NULL, '0-262-53137-2', NULL, 'Nanotechnology, Molecular, Speculation, Global Abundance', 'We grasp the world at many levels and with a variety of instruments.\r\nToday, nanotechnology invites our species to grasp the world at an\r\nunprecedented level of granularity. The nascent sciences of molecular manipulation suggest that worlds of previously unimaginable\r\nmaterial abundance are within our reach. For good or for ill, we\r\nstand at the threshold of a molecular dawn. How we conceive and\r\ncreate the instruments of nanotechnology will determine the quality\r\nand character of our lives in the next century and beyond.\r\nNanotechnology poses a difficult question: What will we human\r\nprimates do when some of us learn to manipulate matter as finely as\r\nthe DNA and RNA molecules that encode our own material structure? This book speculates on the outcome of this surprising and yet\r\nseemingly inevitable technological revolution.', NULL, '7040455.PNG', '8082446.pdf', 1, 1996, 'New York', 50, '2019-01-15 15:57:52', '2019-01-15 15:57:52', '203.190.11.117'),
(257, 152, 1, NULL, 1, 'FUEL CELLS Modeling, Control, and Applications', 'fuel-cells-modeling-control-and-applications', NULL, '978-1-4200-7161-0', NULL, 'FUEL, CELLS, CELLS Modeling', 'This book should be of interest to faculty, students, consultants, manufacturers, researchers, and designers in the fi eld of renewable energy, as it provides a detailed discussion on fuel cell modeling, analysis, and nonlinear control with simulation examples and test results. We assume its readers\r\nalready have a fundamental knowledge of control theory and fuel cell chemical reactions.\r\nIt presents a comprehensive description of modeling and control of PEM\r\nfuel cells, depicting typical approaches and achievements in the modeling\r\nand control design strategies of PEM fuel cells. Both linear and nonlinear\r\nmodels and control designs are included.', NULL, '7074890.PNG', '9642371.pdf', 1, 2010, 'New York', 50, '2019-01-15 16:01:35', '2019-01-15 16:01:35', '203.190.11.115'),
(258, 153, 1, NULL, 1, 'Material Science', 'material-science', NULL, '978-81-224-2656-4', NULL, 'Material , Science', NULL, NULL, '1223809.JPG', '1160506.pdf', 1, 2009, 'New Delhi', 48, '2019-01-15 16:02:09', '2019-01-15 16:02:09', '203.190.10.204'),
(259, 10, 1, NULL, 1, 'Springer Handbook of Nanotechnology', 'springer-handbook-of-nanotechnology', NULL, '3-540-01218-4', NULL, 'Springer, Handbook, Nanotechnology', 'The handbook integrates knowledge from the fabrication, mechanics, materials science and reliability points of view. This book is intended for three types of readers: graduate students of nanotechnology, researchers in academia and industry who are active or intend to become active in this field, and practicing engineers and scientists who have encountered a problem and hope to solve it as expeditiously as possible. The handbook should serve as an excellent text for one or two semester graduate courses in nanotechnology in mechanical engineering, materials science, applied physics, or applied chemistry.', NULL, '4065552.PNG', '9271720.pdf', 1, 2004, 'New York', 50, '2019-01-15 16:07:47', '2019-01-15 16:07:47', '203.190.11.117'),
(260, 154, 1, NULL, 1, 'Mechanics and Strength of Materials', 'mechanics-and-strength-of-materials', NULL, '978-3-540-25131-6', NULL, 'Mechanics Materials', 'The first English edition of this book corresponds to the third Portuguese\r\nedition. Since the translation has been done by the author, a complete review\r\nof the text has been carried out simultaneously. As a result, small improvements have been made, especially by explaining the introductory parts of some\r\nChapters and sections in more detail.\r\nThe Portuguese academic environment has distinguished this book, since\r\nits first edition, with an excellent level of acceptance. In fact, only a small\r\nfraction of the copies published has been absorbed by the school for which it\r\nwas originally designed â€“ the Department of Civil Engineering of the University of Coimbra. This fact justifies the continuous effort made by the author to\r\nimprove and complement its contents, and, indeed, requires it of him. Thus,\r\nthe 423 pages of the first Portuguese edition have now grown to 478 in the\r\npresent version.', NULL, '9705206.jpg', '3435282.pdf', 1, 2006, 'New York', 52, '2019-01-15 16:08:38', '2019-01-15 16:08:38', '203.190.11.115'),
(261, 128, 1, NULL, 1, 'The Control Techniques Drives and Controls Handbook', 'the-control-techniques-drives-and-controls-handbook', 'Second edition', '978-1-84919-101-2', NULL, 'Techniques Drives, Control, Handbook', 'With the rapid developments in the last 20 years in the area of industrial automation, it can be argued that the variable-speed drive has changed beyond all recognition. The functionality of a modern drive is now so diverse that its ability to rotate a motor is sometimes forgotten. Indeed, some customers buy drives not to control a motor but to utilise the powerfull auxiliary functionality that is built in. This is, however, unusual, and the drive remains a key component of the boom in all aspects of automation. Drives are also critical components in relation to energy saving. For over 30 years the case for energy saving through the use of variable-speed drives has been made by drive companies, and at last it seems that industry is moving quickly to adopting the technology. Consider the facts: 55 â€“ 65 per cent of\r\nall electrical energy is used by electric motors.', NULL, '9450935.PNG', '6907121.pdf', 1, 2009, 'London', 50, '2019-01-15 16:12:43', '2019-01-15 16:12:43', '203.190.11.115'),
(262, 39, 1, NULL, 1, 'Digital Control System Analysis & Design', 'digital-control-system-analysis-design', '3rd.', '0-13-309832-X', NULL, 'Digital Control System Analysis', 'This book is intended to be used primarily as a text for a first course in discrete control systems and/or a first course in digital filters, at either the senior or first-year graduate level. Furthermore, the text is suitable for self-study by the practicing engineer. This book is based on material taught at both Auburn University and North Carolina State University, and in intensive short courses taught in both the United States and Europe. The practicing engineers who attended these short courses have influenced both the content and the direction of this book, resulting in more emphasis placed on the practical aspects of designing and implementing digital control systems. Also, the introduction of the microprocessor has greatly influenced the material of the book, with Chapter 13 devoted exclusively to microcomputer implementations.', NULL, '5777421.JPG', '1296521.pdf', 1, 1995, 'New Jersey', 39, '2019-01-15 16:16:42', '2019-01-15 16:16:42', '203.190.10.206'),
(263, 155, 1, NULL, 1, 'Bo ThidÃ© ELECTROMAGNETIC FIELD THEORY', 'bo-thide-electromagnetic-field-theory', NULL, '978-0486477732', NULL, 'ELECTROMAGNETIC, FIELD THEORY, Bo ThidÃ©', 'Intended primarily as a textbook for physics students at the advanced undergraduate or beginning graduate level, I hope the book may be useful for research workers too. It provides a thorough treatment of the theory of electrodynamics, mainly from a classical field theoretical point of view, and includes such things as electrostatics and magnetostatics and their unification into electrodynamics, the electromagnetic potentials, gauge transformations, covariant formulation of classical electrodynamics, force, momentum and energy of the electromagnetic field, radiation and scattering phenomena, electromagnetic waves and their propagation in vacuum and in media, and covariant Lagrangian/Hamiltonian field theoretical methods for electromagnetic fields, particles and interactions.', NULL, '5172263.PNG', '9577675.pdf', 1, 2000, 'Sweden', 50, '2019-01-15 16:23:58', '2019-01-15 16:23:58', '203.190.11.115'),
(264, 156, 1, NULL, 1, 'Digital Control Systems : Design,Identification and Implementation', 'digital-control-systems-designidentification-and-implementation', NULL, '1-84628-056-7', NULL, 'Digital Control System', 'The aim of this book is to give the necessary knowledge for the comprehension and implementation of digital techniques for system identification and control design. These techniques are applicable to various types of process. The book has been written taking into account the needs of the designer and the user of such systems. Theoretical developments that are not directly relevant to the design have been omitted. The book also takes into account the availability of dedicated control software. A number of useful routines have been developed and they can be freely downloaded from the book website. Details concerning effective implementation and on-site optimization of the control systems designed have been provided.', NULL, '6895024.JPG', '2769253.pdf', 1, 2006, 'London', 39, '2019-01-15 16:29:56', '2019-01-15 16:29:56', '203.190.10.206'),
(265, 152, 1, NULL, 1, 'The Industrial Electronics Handbook Control and MechatronIcs', 'the-industrial-electronics-handbook-control-and-mechatronics', 'Second edition', '978-1-4398-0287-8', NULL, 'Industrial Electronics, Handbook, Control and MechatronIcs', 'The field of industrial electronics covers a plethora of problems that must be solved in industrial practice. Electronic systems control many processes that begin with the control of relatively simple devices like electric motors, through more complicated devices such as robots, to the control of entire fabrication processes. An industrial electronics engineer deals with many physical phenomena as well as the sensors that are used to measure them. Thus, the knowledge required by this type of engineer is not only traditional electronics but also specialized electronics, for example, that required for high-power applications.', NULL, '5668005.PNG', '7458535.pdf', 1, 2011, 'New York', 50, '2019-01-15 16:30:42', '2019-01-15 16:30:42', '203.190.11.115'),
(266, 157, 1, NULL, 1, 'Strength of Materials', 'strength-of-materials', NULL, '978-1-61728-584-4', NULL, 'Strength Materials', 'The strength of a material refers to the material\'s ability to withstand an applied stress\r\nwithout failure. The applied stress may be tensile, compressive, or shear. A material\'s strength\r\nis dependent on its microstructure. The engineering processes to which a material is subjected\r\ncan alter this microstructure. This book provides a variety of material strength research\r\nincluding an extensive overview on the state of the art ceramic composite material BIOLOX\r\ndelta which, since 2001, has successfully implanted more than 500,000 artificial hip joints.\r\nDue to the unique strength and toughness of this material, the risk of fracture has been\r\nsubstantially reduced when compared to conventional ceramic materials. Several different\r\naspects of ionomer research from a physical property standpoint is discussed as well,\r\nincluding the history and current trends in ionomer research and a discussion on the\r\nimmediate needs in this field.', NULL, '8185436.JPG', '7361946.pdf', 1, 2009, 'New York', 52, '2019-01-15 16:51:27', '2019-01-15 16:51:27', '203.190.11.118'),
(267, 39, 1, NULL, 1, 'Java: An Introduction to Problem Solving & Programming', 'java-an-introduction-to-problem-solving-programming', '6th ed.', '0-132-16270-9', NULL, 'Programming, Java', 'Welcome to the sixth edition of Java: An Introduction to Problem Solving &\r\nProgramming. This book is designed for a first course in programming and\r\ncomputer science. It covers programming techniques, as well as the basics of\r\nthe Java programming language. It is suitable for courses as short as one quarter or as long as a full academic year. No previous programming experience is\r\nrequired, nor is any mathematics, other than a little high school algebra. The\r\nbook can also be used for a course designed to teach Java to students who have\r\nalready had another programming course, in which case the first few chapters\r\ncan be assigned as outside reading.', NULL, '3371271.PNG', '3210039.pdf', 1, 2009, 'New York', 46, '2019-01-15 17:22:15', '2019-01-15 17:22:15', '203.190.11.117'),
(268, 39, 1, NULL, 1, 'Introduction to Computing and Programming with Java: A Multimedia Approach', 'introduction-to-computing-and-programming-with-java-a-multimedia-approach', NULL, '0131496980', NULL, 'Java, Computing, Programming', 'This book is intended to introduce computing, including programming, to\r\nstudents with no prior programming experience. One of the lessons from the research on computing education is that one doesnâ€™t just â€œlearn to program.â€ One\r\nlearns to program something [4, 17]. How motivating that something is can make\r\nthe difference between learning to program or not [6]. Some people are interested\r\nin learning programming just for programmingâ€™s sakeâ€”but thatâ€™s not most people.\r\nUnfortunately, most introductory programming books are written as if students have a burning desire to learn to program. They emphasize programming\r\nconcepts and give little thought to making the problems that are being solved interesting and relevant. They introduce new concepts without showing why the\r\nstudents should want to know about them', NULL, '6197450.jpg', '5943773.pdf', 1, 2005, 'New Jersey', 46, '2019-01-15 17:28:17', '2019-01-15 17:28:17', '203.190.11.117'),
(269, 158, 1, NULL, 1, 'Electrical Properties Of Materials', 'electrical-properties-of-materials', '7th', '0 19 9267936', NULL, 'Electrical Property', 'Benefited from comments received from students and\r\nlecturers. We are grateful to Professor Tung Hsu of the National Tsinghua University who\r\ncalled our attention to a mistake that has been there since the first edition. Our thanks are\r\ndue to Richard Syms who not only introduced us to a subject we knew little about but also\r\nprovided us with a draft version of the sections on MEMS and on its application in optical\r\nswitching', NULL, '5755516.JPG', '4980779.pdf', 1, 2004, 'New York', 48, '2019-01-15 17:37:38', '2019-01-15 17:37:38', '203.190.10.204'),
(270, 125, 1, NULL, 1, 'Introduction to Micro controllers: Architecture, Programming, and Interfacing of the Motorola 68CH12', 'introduction-to-micro-controllers-architecture-programming-and-interfacing-of-the-motorola-68ch12', NULL, '0-12-451831-1', NULL, 'Architecture, Programming,  Interfacing', 'Programming is an essential engineering skill. To almost any engineer, it is as important as circuit design to an electrical engineer, as statistics to a civil engineer, and as heat transfer to a chemical engineer.', NULL, '7919124.PNG', '1714184.pdf', 1, 1999, 'UK', 46, '2019-01-15 17:46:35', '2019-01-15 17:46:35', '203.190.11.117'),
(271, 125, 1, NULL, 1, 'Single and Multi Chip:  Micro controllers interfacing  for the Motorola 68CH12', 'single-and-multi-chip-micro-controllers-interfacing-for-the-motorola-68ch12', NULL, '0-12-451830-3', NULL, 'Multi, Chip,Micro, Controllers,  Interfacing', 'By 1980, The Microcomputer and changed so many aspects of engineering that the cliche microcomputer revolution echoed from almost every other magazine article and learned paper in the field.', NULL, '9226345.PNG', '6733755.pdf', 1, 1999, 'New York', 46, '2019-01-15 18:04:02', '2019-01-15 18:04:02', '203.190.11.118'),
(272, 159, 1, NULL, 1, 'A Textbook of Electrical Technology in S.I. Units, Vol. 1: Basic Electrical Engineering', 'a-textbook-of-electrical-technology-in-si-units-vol-1-basic-electrical-engineering', NULL, NULL, NULL, 'Electric Current and Ohm\'s Law, DC Network Theorems, Work, Power and Energy, Capacitance, A.C. Network Analysis, A.C. Bridges.', 'Suppose that in a conductor, the number of free electrons available per m3 of the conductor material is n and let their axial drift velocity be v metres/second. In time dt, distance travelled would be v x dt. If A.is area of cross-section of the conductor, then the volume is vAdt and the number of electrons contained in this volume is vA dt. Obviously, all these electrons will cross the conductor\r\ncross-section in time dt. If e is the charge of each electron, then total charge which crosses the section in time dt is dq =nAev dt.', NULL, '9935331.jpg', '7635546.pdf', 1, 1999, 'New Delhi', 49, '2019-01-15 18:04:44', '2019-01-15 18:04:44', '203.190.11.118'),
(273, 39, 1, NULL, 1, 'The 8051 Microcontroller and Embedded Systems Using Assembly and C', 'the-8051-microcontroller-and-embedded-systems-using-assembly-and-c-15141311', '2nd ed.', NULL, NULL, 'Assembly, Micro controller, Embedded, Systems, C', 'To represent a binary number as its equivalent hexadecimal number', NULL, '8968877.PNG', '8882773.pdf', 1, 2001, 'New York', 46, '2019-01-15 18:14:11', '2019-01-15 18:14:11', '203.190.11.118'),
(274, 39, 1, NULL, 1, 'The 8051 Microcontroller and Embedded Systems Using Assembly and C', 'the-8051-microcontroller-and-embedded-systems-using-assembly-and-c-15151312', '2nd ed.', NULL, NULL, 'Assembly, Micro controller, Embedded, Systems, C', 'To represent a binary number as its equivalent hexadecimal number', NULL, '8405124.PNG', '8622162.pdf', 1, 2001, 'New York', 46, '2019-01-15 18:15:12', '2019-01-15 18:15:12', '203.190.11.115'),
(275, 49, 1, NULL, 1, 'Microcontroller Based Applied Digital Control', 'microcontroller-based-applied-digital-control', NULL, '0-470-86335-8', NULL, 'Process, Control, Data, Processing, Digital, Systems, Microprocessors.', 'Computers now form an integral part of most real-time control systems. With the advent of the\r\nmicroprocessors and microcontrollers in the last few decades the use of computers in control\r\napplications has been ever growing. Microcontrollers are single-chip computers which can be\r\nused to control real-time systems. Such controllers are also referred to as embedded real-time\r\ncomputers. These devices are low-cost, single-chip and easy to program. Microcontrollers have\r\ntraditionally been programmed using the assembly language of the target processor.', NULL, '1699798.jpg', '4978716.pdf', 1, 2006, 'New York', 46, '2019-01-15 18:23:59', '2019-01-15 18:23:59', '203.190.11.117'),
(276, 10, 1, NULL, 1, 'Abstract Harmonic Analysis of Continuous Wavelet Transforms', 'abstract-harmonic-analysis-of-continuous-wavelet-transforms', NULL, '3540242597', NULL, 'Regular Representation, Selfadjoint Convolution Idempotents and Support Properties,', 'This volume discusses a construction situated at the intersection of two different mathematical fields: Abstract harmonic analysis, understood as the theory of group representations and their decomposition into irreducibles on the one hand, and wavelet (and related) transforms on the other. In a sense the volume reexamines one of the roots of wavelet analysis: The paper [60] by Grossmann, Morlet and Paul may be considered as one of the initial sources of wavelet theory, yet it deals with a unitary representation of the affine group, citing results on discrete series representations of nonunimodular groups due to Duflo and Moore. It was also observed in [60] that the discrete series setting provided a unified approach to wavelet as well as other related transforms, such as the windowed Fourier transform.', NULL, '4369387.jpg', '2927297.pdf', 1, 2005, 'New York', 49, '2019-01-15 18:32:46', '2019-01-15 18:32:46', '203.190.11.117'),
(277, 160, 1, NULL, 1, 'The Microcontroller Idea Book Circuits, Programs, & Applications  featuring the 8052-BASIC Microcontroller', 'the-microcontroller-idea-book-circuits-programs-applications-featuring-the-8052-basic-microcontroller', NULL, '0-9650819-0-7', NULL, 'Microcontroller, Idea, Book, Circuits, Programs', 'This book is a hands-on guide to designing, building, and testing microcontroller-based\r\ndevices. Microcontrollers, or single-chip computers, are ideal for projects that require\r\ncomputer intelligence, but donâ€™t need the overhead of a complete personal computer with\r\ndisk drives, keyboard, and full-screen display', NULL, '6219064.jpg', '1548256.pdf', 1, 1997, 'USA', 46, '2019-01-15 18:39:08', '2019-01-15 18:39:08', '203.190.11.118'),
(278, 161, 1, NULL, 1, 'Fundamentals of Telecommunications', 'fundamentals-of-telecommunications', NULL, '0-471-22416-2', NULL, 'Telecommunication, Transporting Electrical Signals, Signals Convey Intelligence', 'This book is an entry-level text on the technology of telecommunications. It has been crafted with the newcomer in mind. The eighteen chapters of text have been prepared for high-school graduates who understand algebra, logarithms, and basic electrical principles such as Ohmâ€™s law. However, many users require support in these areas so Appendices A and B review the essentials of electricity and mathematics through logarithms. This material was placed in the appendices so as not to distract from the main theme: the technology of telecommunication systems. Another topic that many in the industry find difficult is the use of decibels and derived units. Appendix C provides the reader with a basic understanding of decibels and their applications. The only mathematics necessary is an  nderstanding of the powers of ten.', NULL, '9685564.jpg', '3003624.pdf', 1, 1991, 'New York', 51, '2019-01-15 18:57:50', '2019-01-15 18:57:50', '203.190.11.115'),
(279, 163, 1, NULL, 1, 'Fundamentals of Electrical Engineering', 'fundamentals-of-electrical-engineering', NULL, NULL, NULL, 'Electrical Engineering,', 'From its beginnings in the late nineteenth century, electrical engineering has lossomed from focusing on electrical circuits for power, telegraphy and telephony to focusing on a much broader range of disciplines. However, the underlying themes are relevant today: Power creation and transmission and information have been the underlying themes of electrical engineering for a century and a half. This course concentrates on the latter theme: the representation, manipulation, transmission, and reception of information by electrical means. This course describes what information is, how engineers quantify information, and how electrical signals represent information.', NULL, '/tmp/phpWctwSq', '7344645.pdf', 1, 2013, 'U.S.A', 51, '2019-01-15 19:23:53', '2019-01-15 19:25:37', '203.190.11.115'),
(280, 43, 1, NULL, 8, 'Managerial Leadership', 'managerial-leadership', NULL, '10.1036/0071395016', NULL, 'Leadership', 'I remember talking in 1995 with Bob Staton, CEO of Colonial Life\r\n& Accident Insurance Company, a division of UNUM, about the\r\nlack of leadership throughout the company. Colonial was one of\r\nthe few large, homegrown companies in Columbia, South Carolina,\r\nwhen it was acquired by UNUM, the Maine-based disability insurance company. At first, there was little evidence of the takeover, as\r\nUNUM kept its distance from the folks at Colonial. But as\r\ninevitably happens, eventually the parent company became more\r\nand more engaged with the day-to-day activities of its acquisition\r\nâ€”particularly when the return on the investment began to erode.', NULL, '9189020.JPG', '5913414.pdf', 1, 2002, 'New York', 52, '2019-01-15 19:29:24', '2019-01-15 19:29:24', '203.190.11.115'),
(281, 69, 1, NULL, 1, 'Digital Frequency Synthesis Demystified : DDS and Fractional-N PLLs', 'digital-frequency-synthesis-demystified-dds-and-fractional-n-plls', NULL, '1-878707-47-7', NULL, 'Digital Frequency Synthesis Demystified', 'This bookâ€”the latest volume in our popular Demystified series of technical referencesâ€”is an updated version of an earlier text, Digital Tec hniques in Frequency Synthesis, published by McGraw- Hill. In addition to the updated text, a CDROM has been added that contains an assortment of design tools, including an informative new reference in pdf format from Analog Devices called A Tec hnical Tutorial on Digital Signal Synthesis. The CDROM also in c ludes a fully searchable pdf file of the entire book contents. For a full list of the CDROM contents, see Chapter 10.', NULL, '7374306.JPG', '1499003.pdf', 1, 1999, 'U.S.A.', 39, '2019-01-15 19:44:57', '2019-01-15 19:44:57', '203.190.10.206'),
(282, 164, 1, NULL, 1, 'Digital Interfaces and Bus Systems for Communications : Practical Fundamentals', 'digital-interfaces-and-bus-systems-for-communications-practical-fundamentals', NULL, NULL, NULL, 'Digital Interface, Bus System, Communications', 'Digital communication confronts us every day in modern process engineering: - it is used for configuring and setting the parameters for microprocessor instruments - serial bus systems, with minimum wiring requirements. are able to acquire a large amount of de-centralized information and distribute it to tho process equipment. Intelligent field and automati-on devices can communicate directly with one another via o digital bus. This book is intended as a step-by-step introduction to the subject of digital communications, for practical engineers and those new to this field. The emphasis is on clarifying generalized topics, as well as including some JUMO-specific applications. In this revised edition, the material on bus systems has been extensively updated. The method of operation of bus systems for which JUMO has field devices available is explained in a practical man-ner.', NULL, '8913409.JPG', '5415372.pdf', 1, 2001, 'New York', 39, '2019-01-15 19:57:45', '2019-01-15 19:57:45', '203.190.10.206'),
(283, 165, 1, NULL, 1, 'Digital Logic and Microprocessor Design With VHDL', 'digital-logic-and-microprocessor-design-with-vhdl', NULL, '0-534-46593-5', NULL, NULL, NULL, NULL, '4897653.JPG', '9822572.pdf', 1, 2004, 'U.S.A.', 39, '2019-01-15 20:03:20', '2019-01-15 20:03:20', '203.190.10.206'),
(284, 86, 1, NULL, 1, 'Discrete Time Signal Processing', 'discrete-time-signal-processing', NULL, '978-0131988422', NULL, NULL, NULL, NULL, '7141697.jpg', '7712521.pdf', 1, 1999, 'New Jersey', 39, '2019-01-15 20:43:51', '2019-01-15 20:43:51', '203.190.10.206'),
(285, 10, 1, NULL, 1, 'Digital Signal Processing  : An Experimental Approach', 'digital-signal-processing-an-experimental-approach', NULL, '9781848001183', NULL, NULL, 'The ï¬eld known as digital signal processing (DSP) has its roots in the 1940s and 1950s, and got started in earnest in the 1960s [10]. As DSP deals with how computers can be used to process signals, it should come as no surprise that the ï¬eldâ€™s growth parallels the growth in the use of the computer. The modern development of the Fast Fourier Transform in 1965 gave the ï¬eld a great push forward. Since the 1960s, the ï¬eld has grown by leaps and bounds. In this book, the reader is introduced to the theory and practice of digital signal processing. Much time is spent acquainting the reader with the mathematics and the insights necessary to master this subject. The mathematics is presented as precisely as possible; the text, however, is meant to be accessible to a third- or fourth-year student in an engineering program.', NULL, '1643844.JPG', '4911620.pdf', 1, 2008, 'London', 39, '2019-01-15 21:13:02', '2019-01-15 21:13:02', '203.190.10.206'),
(286, 72, 1, NULL, 1, 'Digital Signal Processing System-Level Design Using LabVIEW', 'digital-signal-processing-system-level-design-using-labview', NULL, '0-7506-7914-X', NULL, 'Digital Signal Processing System', 'For many years, I have been teaching DSP (Digital Signal Processing) lab courses using various TI (Texas Instruments) DSP platforms. One question I have been getting from students in a consistent way is, â€œDo we have to know C to take DSP lab courses?â€ Until last year, my response was, â€œYes, C is a prerequisite for taking DSP lab courses.â€ However, last year for the ï¬rst time, I provided a different response by saying, â€œThough preferred, it is not required to know C to take DSP lab courses.â€ This change in my response came about because I started using LabVIEW to teach students how to design and analyze DSP systems in our DSP courses. The widely available graphical programming environments such as LabVIEW  have now reached the level of maturity that allow students and engineers to design and analyze DSP systems with ease and in a relatively shorter time as compared to C and MATLAB. I have observed that many students taking DSP lab courses, in particular at the undergraduate level, often', NULL, '1464433.JPG', '7038010.pdf', 1, 2005, 'New York', 39, '2019-01-15 21:19:44', '2019-01-15 21:19:44', '203.190.10.206'),
(287, 166, 1, NULL, 1, 'Digital Signal Processing', 'digital-signal-processing-15301623', NULL, '9788184314243', NULL, NULL, 'This book presents fundamental Digital Signal Processing techniques. The range of applications of Digital Signal Processing is vast. The Digital Signal Processing systems con be implemented on general purpose processors like PC or Digital Signal Processors. The Digital Signal Processing basically involves processing of discrete samples of data. Because of the availability of high speed computers, Digital Signal Processing (DSP) operations like filtering, convolution, correlation, FFT etc. con be implemented fast. The DSP processors are available. These processors are designed for fast implementations of DSP operations. Many real time applications use OSP processor bused systems.', NULL, '8734540.JPG', '6595532.pdf', 1, 1995, 'India', 39, '2019-01-15 21:30:23', '2019-01-15 21:30:23', '203.190.10.206'),
(288, 167, 1, NULL, 1, 'Fundamentals of Electrical Engineering', 'fundamentals-of-electrical-engineering-15101716', NULL, NULL, NULL, 'Electrical Engineering', 'From its beginnings in the late nineteenth century, electrical engineering has\r\nblossomed from its focus on electrical circuits for power, telegraphy and telephony to a much broader range of disciplines. Still, the underlying themes are\r\nrelevant today: Power creation and transmission and information have run through\r\nelectrical engineeringâ€™s century and a half life. This book concentrates on the latter\r\ntheme: the representation, manipulation, transmission, and reception of information by electrical means. This book describes what information is, how engineers\r\nquantify information, and how electrical signals represent information', NULL, '6563766.JPG', '6915480.pdf', 1, 1999, 'U.S.A', 51, '2019-01-15 22:10:16', '2019-01-15 22:10:16', '203.190.11.117'),
(289, 168, 1, NULL, 1, 'Mathematical Methods for Physicists: A concise introduction', 'mathematical-methods-for-physicists-a-concise-introduction', NULL, '0 521 65227 8', NULL, 'Mathmatical Methods,Physicists,Concise Introduction', 'Each chapter contains a number of physics examples to illustrate the mathematical techniques just developed and to show their relevance to physics. They\r\nsupplement or amplify the material in the text, and are arranged in the order in\r\nwhich the material is covered in the chapter. No eÃ¿ort has been made to trace the\r\norigins of the homework problems and examples in the book. A solution manual\r\nfor instructors is available from the publishers upon adoption.', NULL, '5128859.JPG', '2516497.pdf', 1, 2003, 'New York', 48, '2019-01-15 22:29:25', '2019-01-15 22:29:25', '203.190.11.115'),
(290, 169, 1, NULL, 1, 'Fundamental Numerical  Methods and Data Analysis', 'fundamental-numerical-methods-and-data-analysis', NULL, NULL, NULL, 'Numerical  Methods, Data Analysis', 'The origins of this book can be found years ago when I was a doctoral candidate working on my thesis and finding that I needed numerical tools that I should have\r\nbeen taught years before. In the intervening decades, little has changed except for the worse. All fields of science have undergone an information explosion while the computer revolution has steadily and irrevocability been changing our lives. Although the crystal ball of the future is at best \"seen through a glass darkly\", most would eclare that the advent of the digital electronic computer will change civilization to an extent not seen since the coming of the steam engine.', NULL, '8570599.JPG', '5593866.pdf', 1, 2003, NULL, 51, '2019-01-15 22:31:57', '2019-01-15 22:31:57', '203.190.11.117'),
(291, 170, 1, NULL, 1, 'Microsoft Visual Basic 2010', 'microsoft-visual-basic-2010', NULL, 'X16-88509', NULL, 'Visual, Basic, Microsoft', 'Microsoft Visual Basic 2010 is an important upgrade and enhancement of the popular Visual\r\nBasic programming language and compiler, a technology that enjoys an installed base of\r\nmillions of programmers worldwide. Visual Basic 2010 is not a stand-alone product but\r\na key component of Microsoft Visual Studio 2010â€”a comprehensive development system\r\nthat allows you to create powerful applications for Windows, the Web, handheld devices,\r\nand a host of other environments', NULL, '9587415.PNG', '1158632.pdf', 1, 2010, 'USA', 46, '2019-01-15 22:33:41', '2019-01-15 22:33:41', '203.190.11.117'),
(292, 171, 1, NULL, 1, 'Electric motors, their action, control and application', 'electric-motors-their-action-control-and-application', '2nd ed.', NULL, NULL, 'electric motor, dynamo-electric, mechanical power.', 'An electric motor is a machine which converts electrical power\r\ninto mechanical power. In function, therefore, it is the exact\r\nconverse of the dynamo-electric generator.', NULL, '1582076.jpg', '8796335.pdf', 1, 1914, 'New York', 40, '2019-01-15 22:34:24', '2019-01-15 22:34:24', '203.190.11.115'),
(293, 74, 1, NULL, 1, 'Electric Motors and Control Systems', 'electric-motors-and-control-systems', '1st ed.', '978-0-07-352182-4  0-07-352182-5', NULL, 'Electrical, control systems', 'This book has been written for a course of study that will introduce the reader to a broad range of motor types and control systems. It provides an overview of electric motor operation, selection, installation, control and maintenance. Every effort has been made in this first edition text to present the most up-to-date information which reflects the current needs of the industry.', NULL, '3048896.jpg', '1331645.pdf', 1, 2010, 'New York', 40, '2019-01-15 22:49:35', '2019-01-15 22:49:35', '203.190.11.115'),
(294, 12, 1, NULL, 1, 'Arc welding control', 'arc-welding-control', NULL, '0-8493-1772-X', NULL, 'Welding control, Arc welding.', 'With the economic development in his country, the author has devoted\r\nmuch of his time to research into welding automation. The train of thought\r\nin this particular field can be divided into two specific types. The first is to\r\nuse modern science to analyse the welding process through quantitative methods. The second is to develop and perfect welding automation\r\nthrough the application of modern technology. These two fields of research\r\nboth complement and promote one another. The focus of this research is\r\nto grasp and solve the key individual problems of automation and then to\r\ntry to synthesis results so they can be implemented. In this monograph\r\nthe theory and developments made by the author are systematically\r\ndescribed.', NULL, '7179614.jpg', '9254894.pdf', 1, 2003, 'North America', 47, '2019-01-15 22:57:15', '2019-01-15 22:57:15', '203.190.11.115'),
(295, 10, 1, NULL, 1, 'Fundamentals of Electrical Drives', 'fundamentals-of-electrical-drives', NULL, '978-1-4020-5504-1', NULL, 'SIMPLE ELECTRO-MAGNETIC CIRCUITS, . DIRECT CURRENT MACHINES', 'Within one academic lifetime the electric drive has progressed from the three machine, DC drive called a Ward-Leonard system to todayâ€™s sophisticated AC drives utilizing PWM inverter power electronics and field orientation or direct torque control. Over roughly this same period machine theory progressed from the classical, one machine at a time approach, through the generalized or unified approach emphasizing similarities between machine types. This unified theory also utilized much more sophisticated mathematical tools to obtain models applicable to transients as well as steady-state. This enabled theoretical modeling of a host of important machine problems but almost always required computer solutions as opposed to more general analytic solutions and often left one with a feeling of detachment from the physical reality of inrush currents, the whine of spinning rotors and the smell of over-warm electrical insulation.', NULL, '7293664.jpg', '1186313.pdf', 1, 2007, NULL, 51, '2019-01-15 23:08:10', '2019-01-15 23:08:10', '203.190.11.115'),
(296, 172, 1, NULL, 1, 'Transmission Line Reference Book 345 Kv and Above', 'transmission-line-reference-book-345-kv-and-above', '2nd ed.', NULL, NULL, 'EHV-UHV, Conductors, Corona, Audible Noise, Elecric Fields', NULL, NULL, '7070786.jpg', '5068826.pdf', 1, 1987, 'New York', 40, '2019-01-15 23:15:13', '2019-01-15 23:15:13', '203.190.11.115'),
(297, 84, 1, NULL, 1, 'Fundamentals of Global Positioning System Receivers A Software Approach', 'fundamentals-of-global-positioning-system-receivers-a-software-approach', NULL, '0-471-38154-3', NULL, 'Earth-Centered, Satellite Constellation.', 'The purpose of this book is to present detailed fundamental information on a global positioning system (GPS) receiver. Although GPS receivers are popularly used in every-day life, their operation principles cannot be easily found in one book. Most other types of receivers process the input signals to obtain the necessary information easily, such as in amplitude modulation (AM) and frequency modulation (FM) radios. In a GPS receiver the signal is processed to obtain the required information, which in turn is used to calculate the user position. Therefore, at least two areas of discipline, receiver technology and navigation scheme, are employed in a GPS receiver. This book covers both areas.', NULL, '2454427.JPG', '8549787.pdf', 1, 2000, 'New York', 51, '2019-01-15 23:16:57', '2019-01-15 23:16:57', '203.190.11.115'),
(298, 173, 1, NULL, 1, 'Fundamentals of Instrumentation and Measurement', 'fundamentals-of-instrumentation-and-measurement', NULL, '978-1-905209-39-2', NULL, 'Instrumentation, Measurement', 'Instrumentation comprises scientific activities and technologies that are related\r\nto measurement. It is a link between physical, chemical and biological phenomena\r\nand their perception by humans. Constantly evolving, instrumentation changes how\r\nwe live and plays a major role in industrial and life sciences; it is also indispensable\r\nto the fundamental sciences. In order to be credible, all new theories must undergo a\r\nseries of experimental validations, of which instrumentation is the cornerstone', NULL, '7675606.JPG', '7181714.pdf', 1, 2000, 'France', 51, '2019-01-15 23:27:42', '2019-01-15 23:27:42', '203.190.11.115'),
(299, 174, 1, NULL, 1, 'FUNDAMENTALS OF LIGHT SOURCES AND LASERS', 'fundamentals-of-light-sources-and-lasers', NULL, '0-471-47660-9', NULL, 'Lasing Processes, Quantum Mechanics, Atomic Emission.', 'The field of photonics is enormously broad, covering everything from light sources\r\nto geometric and wave optics to fiber optics. Laser and light source technology is a\r\nsubset of photonics whose importance is often underestimated. This book focuses on these technologies with a good degree of depth, without attempting to be overly\r\nbroad and all-inclusive of various photonics concepts. For example, fiber optics is\r\nlargely omitted in this book except when relevant, such as when fiber amplifiers\r\nare examined. Readers should find this book a refreshing mix of theory and practical examples, with enough mathematical detail to explain concepts and enable prediction of the behavior of devices (e.g., laser gain and loss) without the use of overwhelmingly complex calculus. Where possible, a graphical approach has been taken to explain concepts such as modelocking (in Chapter 7) which would otherwise require many pages of calculus to develop.', NULL, '1305319.jpg', '3381214.pdf', 1, 2004, 'New Jersey', 51, '2019-01-15 23:37:02', '2019-01-15 23:37:02', '203.190.11.115'),
(300, 175, 1, NULL, 1, 'Power Distribution Planning Reference Book', 'power-distribution-planning-reference-book', '2nd ed.', '0-8247-4875-1', NULL, 'electric utilities, Power, Planning', 'Providing more than twice the content of the original edition, this new edition is the premier source on the selection, development, and provision of safe, high-quality, and cost-effective electric utility distribution systems, and it promises vast improvements in system reliability and layout by spanning every aspect of system planning including load forecasting, scheduling, performance, and economics.', NULL, '8319384.jpg', '1920586.pdf', 1, 2004, 'New York', 40, '2019-01-16 00:20:58', '2019-01-16 00:20:58', '203.190.11.115'),
(301, 152, 1, NULL, 1, 'Handbook of Electric Motors', 'handbook-of-electric-motors', '2nd ed.', '10:0-8247-4105-6 (Hardcover) 13:978-0-8247-4105-1', NULL, NULL, 'Presenting current issues in electric motor design, installation, application, and performance, this second edition serves as the most authoritative and reliable guide to electric motor utilization and assessment in the commercial and industrial sectors.', NULL, '2863259.jpg', '4420001.pdf', 1, 2004, 'New York', 40, '2019-01-16 00:35:10', '2019-01-16 00:35:10', '203.190.11.115'),
(302, 72, 1, NULL, 1, 'Practical Electric Motor Handbook', 'practical-electric-motor-handbook', '1st ed.', '0750636382', NULL, NULL, 'Experienced product designers are increasingly expected to be adept at incorporating a range of components into their designs. Students and experimenters too need to look beyond basic circuits and devices to achieve adequate design solutions. For those experienced in engineering design, this is the guide to electric motors.', NULL, '9382558.jpg', '2973574.pdf', 1, 1997, 'New Delhi', 40, '2019-01-16 00:47:28', '2019-01-16 00:47:28', '203.190.11.115'),
(303, 128, 1, NULL, 1, 'Nuclear Power', 'nuclear-power', NULL, '0 86341 668 3 978-0-86341-668-2', NULL, NULL, 'This title is the first of four \'new-look\' books in the Power and Energy series that are aimed at industry professionals rather than academics. Nuclear Power explains in detail how nuclear power works, its costs, its benefits as part of the electricity supply system, and also examines its record.', NULL, '9169182.jpg', '6730778.pdf', 1, 2007, 'London', 40, '2019-01-16 00:55:46', '2019-01-16 00:55:46', '203.190.11.115'),
(304, 49, 1, NULL, 1, 'Fundamentals of semiconductor manufacturing and process control', 'fundamentals-of-semiconductor-manufacturing-and-process-control', NULL, '978-0-471-78406-7', NULL, 'Semiconductor Manufacturing, Process Monitoring', 'G. S. May would like to acknowledge the support of the Steve W. Chaddick School Chair in Electrical and Computer Engineering at the Georgia Institute of Technology, which provided the environment that enabled the completion of this book. C. J. Spanos would like to acknowledge the contributions of the Berkeley students who, over the years, helped shape the material presented in this book.', NULL, '7990834.JPG', '8447116.pdf', 1, 2006, 'New Jersey', 51, '2019-01-16 00:59:23', '2019-01-16 00:59:23', '203.190.11.115'),
(305, 152, 1, NULL, 1, 'Noise of Polyphase Electric Motors', 'noise-of-polyphase-electric-motors', '1st ed.', '10: 0-8247-2381-3 13: 978-0-8247-2381-1', NULL, NULL, 'Controlling the level of noise in electrical motors is critical to overall system performance. However, predicting noise of an electrical motor is more difficult and less accurate than for other characteristics such as torque-speed. Recent advances have produced powerful computational methods for noise prediction, and Noise of Polyphase Electric Motors is the first book to collect these advances in a single source.', NULL, '1453812.jpg', '7399669.pdf', 1, 2006, 'New York', 40, '2019-01-16 01:11:17', '2019-01-16 01:11:17', '203.190.11.115'),
(306, 74, 1, NULL, 1, 'Fundamentals of Industrial Instrumentation and Process Control', 'fundamentals-of-industrial-instrumentation-and-process-control', NULL, '0-07-146693-2', NULL, 'AC Electricity,  Temperature and Heat.', 'Instrumentation and process control can be traced back many millennia. Some\r\nof the early examples are the process of making fire and instruments using the\r\nsun and stars, such as Stonehenge. The evolution of instrumentation and process\r\ncontrol has undergone several industrial revolutions leading to the complexities of modern day microprocessor-controlled processing. Todayâ€™s technological\r\nevolution has made it possible to measure parameters deemed impossible only\r\na few years ago. Improvements in accuracy, tighter control, and waste reduction have also been achieved.', NULL, '9014280.JPG', '5296241.pdf', 1, 2005, 'New York', 51, '2019-01-16 01:11:24', '2019-01-16 01:11:24', '203.190.11.115'),
(307, 49, 1, NULL, 1, 'Fuzzy control systems design and analysis', 'fuzzy-control-systems-design-and-analysis', NULL, '0-471-32324-1', NULL, 'FUZZY OBSERVER DESIGN, ROBUST FUZZY CONTROL', 'The authors cannot acknowledge all the friends and colleagues with whom they have discussed the subject area of this research monograph or from whom they have received invaluable encouragement. Nevertheless, it is our great pleasure to express our thanks to those who have been directly involved in various aspects of the research leading to this book. First, the authors wish to express their hearty gratitude to their advisors Michio Sugeno, Tokyo Institute of Technology, and Eyad Abed, University of Maryland, College Park, for directing the research interest of the authors to the general area of systems and controls. The authors are especially appreciative of the discussions they had with Michio Sugeno at different stages of their research on the subject area of this book. His remarks, suggestions, and encouragement have always been very valuable.', NULL, '7650845.jpg', '8576090.pdf', 1, 2001, 'New York', 51, '2019-01-16 01:21:30', '2019-01-16 01:21:30', '203.190.11.115'),
(308, 12, 1, NULL, 1, 'Linear Synchronous Motors: Transportation And Automation Systems', 'linear-synchronous-motors-transportation-and-automation-systems', '1st ed.', '0849318599', NULL, 'Synchronous, Linear, Transportation, Automation Systems', NULL, NULL, '5836853.jpg', '8731205.pdf', 1, 2000, 'New York', 40, '2019-01-16 01:28:28', '2019-01-16 01:28:28', '203.190.11.115'),
(309, 176, 1, NULL, 1, 'Smart Power Generation', 'smart-power-generation', NULL, '978-951-692-846-6', NULL, 'Power Generation, electricity', 'I have always been fascinated by electricity. It is a form of energy that can\r\nbe used in so many ways: light, heat and motion but equally bits and bytes,\r\nTFTâ€™s, LEDâ€™s and other marvels of modern electronics. Electricity has\r\ngiven us the freedom to use power when we want, where we want, and in\r\nthe form we want.', NULL, '7283496.jpg', '1438481.pdf', 1, 2006, 'New York', 40, '2019-01-16 01:42:18', '2019-01-16 01:42:18', '203.190.11.115'),
(310, 12, 1, NULL, 1, 'Advances in Fingerprint Technology', 'advances-in-fingerprint-technology', '2nd ed.', '0849309239', NULL, 'Mummies,Finger Imprints on Artifacts in Antiquity (circa 3000 B.C.),Grauballe Man (A.D. 400),Philosophical Transactions (1684),De Externo Tactus Organo (1686),William of Orange (1690),Thomas Bewick (1753â€“1828),Concerning the External Physiological Ex', 'The first edition of this book was published as a volume in the Elsevier Series in Forensic and Police Science. Elsevierâ€™s book business has since been acquired by CRC Press LLC and CRC has supported and extended their forensic science program. We thank CRC for the opportunity to revise\r\nAdvances in Fingerprint Technology to this second edition. Fingerprints is an area in which there have been many new and exciting developments in the past two decades or so, although advances in DNA typing have tended to dominate both the forensic science literature and popular information about advances in forensic sciences. Particularly in the realm of methods for developing latent prints, but also in the growth of imaging and AFIS technologies, fingerprint science has seen extraordinary breakthroughs because creative applications of principles derived from physics and organic chemistry have been applied to it.', NULL, '2530269.JPG', '7875154.pdf', 1, 2001, 'New York', 49, '2019-01-16 14:29:20', '2019-01-16 14:29:20', '203.190.11.115'),
(311, 136, 1, NULL, 1, 'Lessons In Electric Circuits, Volume IV â€“ Digital', 'lessons-in-electric-circuits-volume-iv-digital', '4th ed.', NULL, NULL, 'Electric Circuits', NULL, NULL, '2201692.JPG', '7349898.pdf', 1, 2013, 'New York', 39, '2019-01-16 14:37:12', '2019-01-16 14:37:12', '203.190.10.206');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(312, 63, 1, NULL, 1, 'Digitally Assisted Pipeline ADCs : Theory and Implementation', 'digitally-assisted-pipeline-adcs-theory-and-implementation', NULL, '1-4020-7840-4', NULL, 'Digitally Assisted Pipeline ADCs', 'The continued reduction of integrated circuit feature sizes and commensurate improvements in device performance are fueling the progress to higher functionality and new application areas. For example, over the last 15 years, the performance of microprocessors has increased 1000 times. Analog circuit performance has also improved, albeit at a slower pace. For example, over the same period the speed/resolution figure-of-merit of analog-to-digital converters improved by only a factor 10. Of the many reasons for this disparity between analog and digital circuit performance advances, accuracy requirements stand out as a critical constraint in most analog circuits while being virtually absent in digital designs. Thermal noise, linearity, and matching are distinctly analog circuit problems and require design tradeoffs that invariably lower achievable performance. For example, linearity requirements are usually met with highgain feedback loops. Unfortunately, this solution also lowers circuit', NULL, '9578404.JPG', '1289314.pdf', 1, 2004, 'USA', 39, '2019-01-16 14:44:53', '2019-01-16 14:44:53', '203.190.10.206'),
(313, 177, 1, NULL, 1, 'Digital Signal and Image Processing using MATLAB', 'digital-signal-and-image-processing-using-matlab', NULL, '978-1-905209-13-2', NULL, NULL, 'A practical approach through simulation', NULL, '9642150.JPG', '2783432.pdf', 1, 2006, 'UK', 39, '2019-01-16 14:50:54', '2019-01-16 14:50:54', '203.190.10.206'),
(314, 178, 1, NULL, 1, 'Digital Signal Processing : Principles, Algorithms, and Applications', 'digital-signal-processing-principles-algorithms-and-applications', NULL, '0-13-394338-9', NULL, NULL, NULL, NULL, '3874347.JPG', '1554665.pdf', 1, 1996, 'USA', 39, '2019-01-16 14:57:15', '2019-01-16 14:57:15', '203.190.10.206'),
(315, 86, 1, NULL, 1, 'Discrete and Computational Mathematics : An Applied Introduction', 'discrete-and-computational-mathematics-an-applied-introduction', '4th ed.', '0-201-72634-3', NULL, NULL, 'The major purpose of this new edition is to continue to provide an introductory servery in both discrete and combinational mathematics.', NULL, '9302527.JPG', '3694340.pdf', 1, 2004, 'New York', 39, '2019-01-16 15:06:09', '2019-01-16 15:06:09', '203.190.10.206'),
(316, 43, 1, NULL, 1, 'Discrete Mathematics and Its Applications', 'discrete-mathematics-and-its-applications', '6th ed.', '978-0-07-288008', NULL, NULL, NULL, NULL, '3579107.JPG', '8406893.pdf', 1, 2007, 'USA', 39, '2019-01-16 15:10:00', '2019-01-16 15:10:00', '203.190.10.206'),
(317, 108, 1, NULL, 1, 'Analysis of Electric Machinery and Drive Systems', 'analysis-of-electric-machinery-and-drive-systems', '2nd ed.', '047114326x', NULL, 'Basic Principles for Electric Machine Analysis, Direct-Current Machines, Reference-Frame, Theory Symmetrical Induction Machines, Synchronous Machines', 'The first edition of this book was written by Paul C. Krause and published in 1986 by McGraw-Hill. Eight years later the same book was republished by IEEE Press with Oleg Wasynczuk and Scott D. Sudhoff added as co-authors. The focus of the first edition was the analysis of electric machines using reference frame theory, wherein the concept of the arbitrary reference frame was emphasized. Not only has this approach been embraced by the vast majority of electric machine analysts, it has also become the approach used in the analysis of electric drive systems. The use of reference-frame theory to analyze the complete drive system (machine, converter, and control) was not emphasized in the first edition. The goal of this edition is to fill this void and thereby meet the need of engineers whose job it is to analyze and design the complete drive system. For this reason the words \"and Drive Systems\" have been added to the title.', NULL, '5260333.JPG', '4226391.pdf', 1, 2002, 'New York', 49, '2019-01-16 15:14:40', '2019-01-16 15:14:40', '203.190.11.117'),
(318, 102, 1, NULL, 1, 'Discrete Mathematics and Its Applications', 'discrete-mathematics-and-its-applications-16191047', '7th ed.', '978-0-07-338309-5', NULL, 'Discrete Mathematics', 'In writing this book, I was guided by my long-standing experience and interest in teaching discrete mathematics. For the student, my purpose was to present material in a precise, readable manner, with the concepts and techniques of discrete mathematics clearly presented and demonstrated. My goal was to show the relevance and practicality of discrete mathematics to students, who are often skeptical. I wanted to give students studying computer science all of the mathematical foundations they need for their future studies. I wanted to give mathematics students an understanding of important mathematical concepts together with a sense of why these concepts are important for applications. And most importantly, I wanted to accomplish these goals without watering down the material.', NULL, '9518810.JPG', '3333702.pdf', 1, 2007, 'New York', 39, '2019-01-16 15:19:47', '2019-01-16 15:19:47', '203.190.10.206'),
(319, 52, 1, NULL, 1, 'Modern Control System', 'modern-control-system', NULL, '0-13-227029-3', NULL, NULL, 'In each chapter, there are five problem types: â€¢ Exercises â–  Problems â€¢ Advanced Problems â€¢ Design Problems/Continuous Design Problem â–  Computer Problems hi total, there are over 850 problems. The abundance of problems of in-creasing complexity gives students confidence in their problem-solving ability as they work their way from the exercises to the design and computer-bawd problems.', NULL, '8229380.jpg', '1673383.pdf', 1, 2008, 'New Jersey', 39, '2019-01-16 15:32:49', '2019-01-16 15:32:49', '203.190.10.206'),
(320, 179, 1, NULL, 1, 'Antenna Arraying Techniques in the Deep Space Network', 'antenna-arraying-techniques-in-the-deep-space-network', NULL, NULL, NULL, 'Benefits of Arraying, Background of Arraying in the Deep Space Network, Arraying Concepts, Overview of Arraying Techniques, Arraying Techniques.', 'This monograph provides an introduction to the development and use of\r\nantenna arraying in the Deep Space Network (DSN). It is intended to serve as a starting point for anyone wishing to gain an understanding of the techniques\r\nthat have been analyzed and implemented. A complete discussion of the general subject of arraying has not been provided. Only those parts relevant to what has been used in the DSN have been included.', NULL, '3285982.JPG', '5530960.pdf', 1, 2003, 'USA', 49, '2019-01-16 15:33:00', '2019-01-16 15:33:00', '203.190.11.115'),
(321, 81, 1, NULL, 1, 'Modern Control Systems', 'modern-control-systems', '11th ed.', '978-0-13-201710-2', NULL, 'Control System', 'The Mars Exploration Rover (MER-A), also known as Spirit, was launched on a Delta II rocket, in June 2003 to Mars, the Red Planet. Spirit entered the Martian atmosphere seven months later in January, 2004. When the spacecraft entered the Martian atmosphere it was traveling 19,300 kilometers per hour. For about four minutes in the upper atmosphere, the spacecraft aeroshell decelerated the vehicle to a velocity of 1,600 kilometers per hour. Then a parachute was deployed to slow the spacecraft to about 300 kilometers per hour. At an altitude of about 100 meters. retrorockets slowed the descent and airbags were inflated to cushion the shock of landing. The Spirit struck the Martian ground at around 50 km/hr and bounced and rolled until it stopped near the target point in the Gusev Crater. The target landing site was chosen because it looks like a crater lakebed. The Spirit mobile rover has reached interesting places in the Gusev Crater to perform in-situ tests to help scientists answer man', NULL, '6112988.JPG', '1255852.pdf', 1, 2008, 'Singapore', 39, '2019-01-16 15:37:51', '2019-01-16 15:37:51', '203.190.10.206'),
(322, 101, 1, NULL, 1, 'DRAM Circuit Design : Fundamental and High Speed Topics', 'dram-circuit-design-fundamental-and-high-speed-topics', NULL, '978-470-18475-2', NULL, 'DRAM', 'The goal of DRAM Circuit Design : Fundamental and High Speed Topics is to bridge the gap between the introduction to memory design available in most CMOS circuit text and the advance articles on DRAM design that are available in technical journal and symposium digests.', NULL, '4160111.JPG', '9158652.pdf', 1, 2008, 'Canada', 39, '2019-01-16 15:48:20', '2019-01-16 15:48:20', '203.190.10.206'),
(323, 91, 1, NULL, 1, 'Elasticity : Theory, Applications and Numerics', 'elasticity-theory-applications-and-numerics', NULL, '0-12-605811-3', NULL, 'Elasticity', 'This text is an outgrowth of lecture notes that I have used in teaching a two-course sequence in theory of elasticity. Part I of the text is designed primarily for the ï¬rst course, normally taken by beginning graduate students from a variety of engineering disciplines. The purpose of the ï¬rst course is to introduce students to theory and formulation and to present solutions to some basic problems. In this fashion students see how and why the more fundamental elasticity model of deformation should replace elementary strength of materials analysis. The ï¬rst course also provides the foundation for more advanced study in related areas of solid mechanics. More advanced material included in Part II has normally been used for a second course taken by second- and third-year students. However, certain portions of the second part could be easily integrated into the ï¬rst course.', NULL, '1847534.JPG', '7612895.pdf', 1, 2005, 'New York', 39, '2019-01-16 16:15:53', '2019-01-16 16:15:53', '203.190.10.206'),
(324, 67, 1, NULL, 1, 'Electrical Properties Of Materials', 'electrical-properties-of-materials-16321112', '7th ed.', '0 19 9267936', NULL, NULL, 'We have taken the opportunity of a new edition to include some subjects which reached maturity in the last 5 years, like organic semiconductors and artificial materials. Other additions are mainly in the device field. We have added microelectromechanical systems (MEMS), integrated circuits growing in the third dimension, expanded considerably nanoelectronics heralding the advent of radically new devices still at the laboratory stage like nanotube transistors, single electron transistors, and organic transistors. We added quantum wires, quantum dots, and the quantum cascade laser to the section on semiconductor lasers, introduced a new set of magnetic devices, whose operation is based on electron spin, under the heading of spintronics, added a new ferroelectric random access memory to the dielectric chapter and described a very fast new memory in the superconductivity chapter.', NULL, '/tmp/phpkpV0m1', '3629360.pdf', 1, 2004, 'USA', 39, '2019-01-16 16:32:12', '2019-01-16 17:01:47', '203.190.10.206'),
(325, 180, 1, NULL, 1, 'Feedback Systems : An Introduction for Scientists and Engineers', 'feedback-systems-an-introduction-for-scientists-and-engineers', NULL, NULL, NULL, 'Feedback System', 'This book provides an introduction to the basic principles and tools for the design and analysis of feedback systems. It is intended to serve a diverse audience of scientists and engineers who are interested in understanding and utilizing feedback in physical, biological, information and social systems. We have attempted to keep the mathematical prerequisites to a minimum while being careful not to sacriï¬ce rigor in the process. We have also attempted to make use of examples from a variety of disciplines, illustrating the generality of many of the tools while at the same time showing how they can be applied in speciï¬c application domains.', NULL, '1690941.jpg', '2672054.pdf', 1, 2008, 'United Kingdom', 39, '2019-01-16 17:08:56', '2019-01-16 17:08:56', '203.190.10.206'),
(326, 150, 1, NULL, 1, 'Electronic Circuit Analysis', 'electronic-circuit-analysis', 'Second Edition', '81-7800-166-7', NULL, 'Circuit Analysis', 'Since publishing first edition of this book three years back, there are few additions in the\r\nsubject and also as a result of receiving some feedback, it has become imperative to bring\r\nanother edition to cover the lapses and bring the text mor:e useful to students.\r\nIn the second edition, I have reorganised the chapters and also added few subchapters\r\nlike High Frequency Amplifiers, Stability Considerations, UPS and SMPS in the respective\r\nchapters.', NULL, '6025171.JPG', '1382126.pdf', 1, 2008, 'Hyderabad', 52, '2019-01-16 17:12:42', '2019-01-16 17:12:42', '203.190.11.117'),
(327, 181, 1, NULL, 1, 'Fiber-Optic Communication Systems', 'fiber-optic-communication-systems', '3rd ed.', '0-471-22114-7', NULL, 'Fiber-Optic Communication', 'The primary role of this book is as a graduate-level textbook in the ï¬eld of optical communications. An attempt is made to include as much recent material as possible so that students are exposed to the recent advances in this exciting ï¬eld. The book can also serve as a reference text for researchers already engaged in or wishing to enter the ï¬eld of optical ï¬ber communications. The reference list at the end of each chapter is more elaborate than what is common for a typical textbook. The listing of recent research papers should be useful for researchers using this book as a reference. At the same time, students can beneï¬t from it if they are assigned problems requiring reading of the original research papers. A set of problems is included at the end of each chapter to help both the teacher and the student. Although written primarily for graduate students, the book can also be used for an undergraduate course at the senior level with an appropriate selection of topics.', NULL, '1699737.jpg', '8880555.PDF', 1, 2002, 'New York', 39, '2019-01-16 17:14:56', '2019-01-16 17:14:56', '203.190.10.206'),
(328, 175, 1, NULL, 1, 'Fiber Optic Sensor', 'fiber-optic-sensor', NULL, '0-8247-0732-X', NULL, 'Fiber Optic Sensor', 'In the past two decades, the ï¬ber optic sensor has developed from the experimental stage to practical applications. For instance, distributed ï¬ber optic sensors have been installed in dams and bridges to monitor the performance of these facilities. With the rapid advent of optical networks, the cost of ï¬ber optic sensors has substantially dropped because of the commercially viable key components in ï¬ber optic communications such as light sources and photo detectors. We anticipate that ï¬ber optic sensors will become a widespread application in sensing technology', NULL, '8416004.jpg', '8924426.pdf', 1, 2002, 'New York', 39, '2019-01-16 17:25:05', '2019-01-16 17:25:05', '203.190.10.206'),
(329, 67, 1, NULL, 1, 'Electronic Properties of Materials', 'electronic-properties-of-materials', '7th', '0199267936', NULL, 'Electronic Properties', 'We have taken the opportunity of a new edition to include some subjects which reached\r\nmaturity in the last 5 years, like organic semiconductors and artificial materials. Other\r\nadditions are mainly in the device field. We have added microelectromechanical systems\r\n(MEMS), integrated circuits growing in the third dimension, expanded considerably\r\nnanoelectronics heralding the advent of radically new devices still at the laboratory stage\r\nlike nanotube transistors, single electron transistors, and organic transistors. We added\r\nquantum wires, quantum dots, and the quantum cascade laser to the section on\r\nsemiconductor lasers, introduced a new set of magnetic devices, whose operation is\r\nbased on electron spin, under the heading of spintronics, added a new ferroelectric\r\nrandom access memory to the dielectric chapter and described a very fast new memory\r\nin the superconductivity chapter.', NULL, NULL, '8899886.pdf', 1, 2004, 'New York', 52, '2019-01-16 17:53:44', '2019-01-16 17:53:44', '203.190.11.117'),
(330, 30, 1, NULL, 1, 'Fiber to the Home : The New Empowerment', 'fiber-to-the-home-the-new-empowerment', NULL, '978-0-471-74247-0', NULL, 'Fiber', 'This book is about the latter of these enduring options; actually about one rapidly evolving aspect of the latter, ï¬ber to the home. When we speak of â€œï¬ber to the homeâ€ (FTTH), we mean to include also ï¬ber to the userâ€™s premises (FTTP) and ï¬ber to the business (FTTB)â€”any situation where the optical path in the ï¬ber runs all the way to individual end-user premises. This might be a single residence, single multidwelling unit (MDU), or a single business establishment, and the ï¬ber path might enter the building or terminate elsewhere on the premises. What is not included in FTTH is any situation where electronics are interposed along the path from central â€œhead endâ€ to userâ€™s premises. In other words, we deal here with OOO situations, not OEOâ€”with a form of â€œall optical networkâ€ (O for optical, E for electronic).', NULL, '9771111.JPG', '5203599.pdf', 1, 2006, 'New York', 39, '2019-01-16 18:01:15', '2019-01-16 18:01:15', '203.190.10.206'),
(331, 57, 1, NULL, 1, 'Mathematical Methods for Physics and Engineering', 'mathematical-methods-for-physics-and-engineering', '2rd', '978-0521679718', NULL, 'Mathmatical Method, physics', 'It is normal practice when starting the mathematical investigation of a physical\r\nproblem to assign an algebraic symbol to the quantity whose value is sought, either\r\nnumerically or as an explicit algebraic expression. For the sake of definiteness, in\r\nthis chapter we will use x to denote this quantity most of the time. Subsequent\r\nsteps in the analysis involve applying a combination of known laws, consistency\r\nconditions and (possibly) given constraints to derive one or more equations\r\nsatisfied by x.', NULL, '7656851.JPG', '1282569.pdf', 1, 2002, 'London', 48, '2019-01-16 18:10:53', '2019-01-16 18:10:53', '203.190.11.115'),
(332, 49, 1, NULL, 1, 'Electric Power Principles: Sources, Conversion, Distribution and Use', 'electric-power-principles-sources-conversion-distribution-and-use', '1st ed.', '978-0-470-68636-2 (cloth)', NULL, NULL, 'This innovative approach to the fundamentals of electric power provides the most rigorous, comprehensive and modern treatment available. To impart a thorough grounding in electric power systems, it begins with an informative discussion on per-unit normalizations, symmetrical components and iterative load flow calculations.', NULL, '5500007.jpg', '5198510.pdf', 1, 2010, 'New York', 40, '2019-01-16 18:20:23', '2019-01-16 18:20:23', '203.190.11.115'),
(333, 49, 1, NULL, 1, 'Financial Engineering Principles : A Unified Theory of Financial Products Analysis and Valuation', 'financial-engineering-principles-a-unified-theory-of-financial-products-analysis-and-valuation', NULL, '0-471463582', NULL, 'Financial Engineering Principles, Products', 'Here my goal is to introduce a unifying theory among the various fac-tors that make up the world of finance. The three fundamental factors to this unified theory are products, cash flows, and credit. With a solid ground-ing in these first principles, we will show how any financial security can be better understood by financial professionals, students, or individual investors who desire to go beyond more bask financial concepts. After having spent years teaching about the financial markets, I continue to find it disheartening that some students feel that global markets are far more disparate than they are similar and shy away from thinking in a more eclectic and encompassing way about the world. There are many common elements across markets, and the potential insights to risk and reward that can be gained from a more unified approach are simply tremendous.', NULL, '7600967.JPG', '7045281.pdf', 1, 2004, 'New Jersey', 39, '2019-01-16 18:25:59', '2019-01-16 18:25:59', '203.190.10.206'),
(334, 74, 1, NULL, 1, 'Schaum\'s OutIine of Thory and Problems : Numerical Analysis', 'schaums-outiine-of-thory-and-problems-numerical-analysis', '2nd.', '0-07-055221-5', NULL, 'Numerical Analysis', 'The main goal of numerical analysis remains what it has always been, to find approximate solutions to complex problems using only the simplest operations of arithmetic. In short, it is a business of solving hard problems by doing lots of easy steps. Rather clearly, this means finding procedures by which computers can do the solving for us. The problems come from a variety of mathematical origins, particularly algebra and analysis, the boundaries being at times somewhat indistinct. Much background theory is borrowed from such fields by the numerical analyst, and some must be included in an introductory text for clarity. It is also true that our subject returns more than raw numbers across the boundaries. Numerical method has made important contributions to algebraic and analytic theory.', NULL, '3101665.JPG', '7938273.pdf', 1, 1998, 'New York', 39, '2019-01-16 18:30:51', '2019-01-16 18:30:51', '203.190.10.206'),
