(336, 185, 1, NULL, 1, 'Manual on mathematical models in isotope hydrogeology', 'manual-on-mathematical-models-in-isotope-hydrogeology', NULL, NULL, NULL, 'Mathematical Models , Isotope Hydrogeology', 'The tritium content of down gradient water is below detection and the\r\ncontent in recharge water is low The lack of tritium in the down gradient well is\r\nimportant hydrologic information because it indicates that no \"young1\r\n water is\r\nmixing m the down gradient well Calculation of a mixing ratio is the only mass\r\nbalance parameter that tritium would be useful for in this situation Given the lack\r\nof evidence for mixing, tritium was ignored for inclusion m NETPATH modelling\r\nThe stable isotopic composition.', NULL, '/tmp/phpzEnwr3', '5900613.pdf', 1, 1996, 'Austria', 48, '2019-01-16 18:44:19', '2019-01-16 20:18:10', '203.190.11.115'),
(337, 10, 1, NULL, 1, 'Applied Mathematics for Restructured Electric Power Systems: Optimization, Control, and Computational Intelligence', 'applied-mathematics-for-restructured-electric-power-systems-optimization-control-and-computational-intelligence', '1st ed.', '0-387-23470-5 e-ISBN 0-387-23471-3', NULL, 'Optimization, applied mathematics , intelligence', 'Applied Mathematics for Restructured Electric Power Systems: Optimization, Control, and Computational Intelligence consists of chapters based on work presented at a National Science Foundation workshop organized in November 2003.', NULL, '9061328.jpg', '9760831.pdf', 1, 2005, 'Washington', 40, '2019-01-16 18:53:15', '2019-01-16 18:53:15', '203.190.11.117'),
