(339, 10, 1, NULL, 1, 'Geometric Algebra and its Application to Mathematical Physics', 'geometric-algebra-and-its-application-to-mathematical-physics', NULL, NULL, NULL, 'Geometric Algebra, Mathematical Physics.', 'This dissertation is the result of work carried out in the Department of Applied Mathematics and Theoretical Physics between October  and October Sections of the dissertation have appeared in a series of collaborative papers Except where explicit reference is made to the work of others	 the work contained in this dissertation is my own.', NULL, '2911427.JPG', '6187133.pdf', 1, 1994, 'U.K.', 51, '2019-01-16 19:26:59', '2019-01-16 19:26:59', '203.190.11.115'),
(340, 12, 1, NULL, 1, 'Handbook of antennas in wireless communications', 'handbook-of-antennas-in-wireless-communications', NULL, '0-8493-0124-6', NULL, 'wireless communications, Antenna.', 'I authored a two-part article for the Proceeding of the Institute of Electrical and Electronics Engineers (IEEE) on the application of antenna arrays to mobile communications in 1997. It provided the current state of antenna array research and described how an array of antennas may be used to help meet the ever-growing demand of increased channel capacity for wireless mobile communications services. The amount and the kind of feedback I received on the subject, particularly from graduate students and practicing engineers, indicated to me that there is a need for a more comprehensive source of this material than a journal article.', NULL, '2262866.jpg', '5762267.pdf', 1, 2002, 'New York', 51, '2019-01-16 19:46:30', '2019-01-16 19:46:30', '203.190.11.117'),
(341, 30, 1, NULL, 1, 'Design of Rotating Electrical Machines', 'design-of-rotating-electrical-machines', '1st ed.', '978-0-470-69516-6 (cloth)', NULL, NULL, 'In one complete volume, this essential reference presents an in-depth overview of the theoretical principles and techniques of electrical machine design. This book enables you to design rotating electrical machines with its detailed step-by-step approach to machine design and thorough treatment of all existing and emerging technologies in this field.', NULL, '9229899.jpg', '2852906.pdf', 1, 2008, 'New York', 40, '2019-01-16 19:59:18', '2019-01-16 19:59:18', '203.190.11.115'),
(342, 184, 1, NULL, 1, 'FACTS: Controllers in Power Transmission and Distribution', 'facts-controllers-in-power-transmission-and-distribution', '1st ed.', '978-81-224-2541-3', NULL, NULL, 'The emerging technology of Flexible AC Transmission System (FACTS) enables planning and operation of power systems at minimum costs, without compromising security. This is based on modern high power electronic systems that provide fast controllability to ensure \'flexible\' operation under changing system conditions.', NULL, '6154114.jpg', '4539751.pdf', 1, 2007, 'New Delhi', 40, '2019-01-16 20:12:05', '2019-01-16 20:12:05', '203.190.11.117'),
