(344, 72, 1, NULL, 1, 'Industrial Power Engineering and Applications Handbook', 'industrial-power-engineering-and-applications-handbook', NULL, '0 7506 7351 6', NULL, NULL, 'This book will tremendous useful for fresh graduate/post graduate Electrical engineering pass out students who are searching for job & Working professional. This book will be very handy book for clearing interview of fresh engineer & will be useful for day to day work for experienced professionals', NULL, '8556652.jpg', '8079475.pdf', 1, 2001, 'New Delhi', 40, '2019-01-16 20:38:47', '2019-01-16 20:38:47', '203.190.11.115'),
(345, 186, 1, NULL, 1, 'Mathematical Tools for Physics', 'mathematical-tools-for-physics', NULL, '978-0486482125', NULL, 'Mathematical Tools , Physics', 'When you address these questions to every problem you ever solve, you do several things. First, youâ€™ll find\r\nyour own mistakes before someone else does. Second, you acquire an intuition about how the equations ought\r\nto behave and how the world that they describe ought to behave. Third, It makes all your later efforts easier\r\nbecause you will then have some clue about why the equations work the way they do. It reifies algebra.', NULL, '6504083.JPG', '5715963.pdf', 1, 2003, 'USA', 48, '2019-01-16 20:39:11', '2019-01-16 20:39:11', '203.190.11.117'),
(346, 187, 1, NULL, 1, 'Mathematical Methods in Quantum Mechanics', 'mathematical-methods-in-quantum-mechanics', NULL, '978-1470417048', NULL, 'Mathematical Methods , Quantum Mechanics', 'Some previous experience with Hilbert spaces and bounded\r\nlinear operators which should be covered in any basic course on functional\r\nanalysis. However, while this assumption is reasonable for mathematics\r\nstudents, it might not always be for physics students. For this reason there\r\nis a preliminary chapter reviewing all necessary results (including proofs).\r\nIn addition, there is an appendix (again with proofs) providing all necessary\r\nresults from measure theory.', NULL, '9689360.JPG', '4211020.pdf', 1, 2006, 'Austria', 48, '2019-01-16 20:49:53', '2019-01-16 20:49:53', '203.190.11.117'),
(347, 72, 1, NULL, 1, 'Practical Power System Protection', 'practical-power-system-protection', '1st ed.', '0 7506 6397 9', NULL, NULL, 'Plant operators, electricians, field technicians and engineers will gain a practical understanding of the role and workings of power system protection systems from this work. An understanding of power systems and their optimized management will increase plant efficiency and performance as well as increasing safety levels.', NULL, '4877488.jpg', '1671609.pdf', 1, 2004, 'New Delhi', 40, '2019-01-16 20:55:03', '2019-01-16 20:55:03', '203.190.11.117'),
(348, 188, 1, NULL, 1, 'Nanotubes and Nanowires', 'nanotubes-and-nanowires', NULL, '0-85404-832-4', NULL, 'Nanotubes, Nanowires', 'While nanotubes of several inorganic materials, many of which possess layered\r\nstructures, have been synthesized and characterized, the literature on inorganic\r\nnanowires is much more extensive. Every conceivable inorganic material seems to have been prepared in nanowire form. Properties and possible applications of these inorganic one-dimensional materials have been investigated to some extent, but there seems to be ample scope for study.', NULL, '1155438.jpg', '7421550.pdf', 1, 2005, 'UK', 50, '2019-01-16 21:04:01', '2019-01-16 21:04:01', '203.190.11.123'),
(349, 49, 1, NULL, 1, 'Fiber-optic communication systems', 'fiber-optic-communication-systems-16041627', '4th ed.', NULL, NULL, 'Lightwave Systems , Optical Fibers .', 'Since the publication of the first edition of this book in 1992, the state of the art of fiber-optic communication systems has advanced dramatically despite the relatively short period of only 18 years between the first and fourth editions. The highest capacity of commercial fiber-optic links available in 1992 was only 2.5 Gb/s. A mere 4 years later, with the advent of  avelength-division multiplexing (WDM), systems with the total capacity of 40 Gb/s became available commercially. By 2001, the capacity of commercial WDM systems exceeded 1.6 Tb/s. At the same time, the capacity of transoceanic lightwave systems installed worldwide exploded. A global network covering 250,000 km with a capacity of 2.56 Tb/s (64 WDM channels at 10 Gb/s over 4 fiber pairs) was planned in 2001 and became operational by 2004 (currently operated by VSNL, an Indian telecommunication company). Although the pace slowed down after 2001 for a few years with the bursting of the so-called \"telecom bubble,\" progress', NULL, '9875419.jpg', '7957471.pdf', 1, 2010, 'New Jersey', 51, '2019-01-16 21:04:27', '2019-01-16 21:04:27', '203.190.11.115'),
(350, 189, 1, NULL, 1, 'ELECTROMAGNETIC FIELD THEORY Exercises', 'electromagnetic-field-theory-exercises', NULL, NULL, NULL, 'ELECTROMAGNETIC,  THEORY, Exercises', 'Thisis a companion volume to the book Electromagnetic Field Theory by Bo ThidÃ©. The problems and their solutions were created by the co-authors who all have taught this course or its predecessor. It should be noted that this is a preliminary draft version but it is being corrected and expanded with time.', NULL, '7690059.jpg', '7287249.pdf', 1, 1998, 'Sweden', 50, '2019-01-16 21:11:45', '2019-01-16 21:12:46', '203.190.11.123'),
(351, 49, 1, NULL, 1, 'Fiber-Optic Communication Systems', 'fiber-optic-communication-systems-16131650', '3rd ed.', '0-471-21571-6', NULL, 'Optical Fibers, Optical Amplifiers.', 'Since the publication of the first edition of this book in 1992, the state of the art of fiber-optic communication systems has advanced dramatically despite the relatively short period of only 10 years between the first and third editions. For example, the highest capacity of commercial fiber-optic links available in 1992 was only 2.5 Gb/s. A mere 4 years later, the wavelength-division-multiplexed (WDM) systems with the total capacity of 40 Gb/s became available commercially. By 2001, the capacity of commercial WDM systems exceeded 1.6 Tb/s, and the prospect of lightwave systems operating at 3.2 Tb/s or more were in sight. During the last 2 years, the capacity of transoceanic lightwave systems installed worldwide has exploded. Moreover, several other undersea networks were in the construction phase in December 2001. A global network covering 250,000 km with a capacity of 2.56 Tb/s (64 WDM channels at 10 Gb/s over 4 fiber pairs) is scheduled to be operational in 2002. Several conference', NULL, '9943870.jpg', '7916987.pdf', 1, 2002, 'New York', 51, '2019-01-16 21:13:51', '2019-01-16 21:13:51', '203.190.11.115'),
(352, 72, 1, NULL, 1, 'Electrical Engineer\'s Reference Book', 'electrical-engineers-reference-book', '16th ed.', '0 7506 46373', NULL, NULL, 'For ease of use, this edition has been divided into the following subject sections: general principles; materials and processes; control, power electronics and drives; environment; power generation; transmission and distribution; power systems; sectors of electricity use.', NULL, '8715417.jpg', '1207926.pdf', 1, 2003, 'New York', 40, '2019-01-16 21:15:23', '2019-01-16 21:15:23', '203.190.11.117'),
(353, 190, 1, NULL, 1, 'Mathematics For Engineerings And Scientists', 'mathematics-for-engineerings-and-scientists', NULL, '978â€‘1â€‘58488â€‘502â€‘3', NULL, 'Mathematics ,', 'The material in the first part of the reference book can be roughly categorized into the\r\nfollowing three groups according to meaning:\r\n1. The main text containing a concise, coherent survey of the most important definitions,\r\nformulas, equations, methods, and theorems.\r\n2. Numerous specific examples clarifying the essence of the topics and methods for\r\nsolving problems and equations.\r\n3. Discussion of additional issues of interest, given in the form of remarks in small\r\nprint.', NULL, '4802951.JPG', '3873948.pdf', 1, 2007, 'New York', 48, '2019-01-16 21:15:41', '2019-01-16 21:15:41', '203.190.11.117'),
(354, 49, 1, NULL, 1, 'Introduction to Nanotecnology', 'introduction-to-nanotecnology', NULL, '0-471-07935-9', NULL, 'Nano, Nanotecnology', 'This self-confessed introduction provides technical administrators and managers with a broad, practical overview of the subject and gives researchers working in different areas an appreciation of developments in nanotechnology outside their own fields of expertise.', NULL, '3646986.jpg', '1631239.pdf', 1, 2003, 'New Jersey', 50, '2019-01-16 21:21:04', '2019-01-16 21:21:04', '203.190.11.123'),
(355, 10, 1, NULL, 1, 'Nanoscience Nanotechnologies and Nanophysics', 'nanoscience-nanotechnologies-and-nanophysics', NULL, '10 3-540-28616-0', NULL, 'Nanoscience, Nanotechnologies, Nanophysics', 'This book is an overview of the fundamentals and applications of nanosciences\r\nand nanotechnologies, focusing mainly on nanophysics. Our aim as editors is\r\nto use a pedagogical approach in the readersâ€™ own language in order to provide\r\na grounding in all the major theoretical and experimental aspects of this new\r\ngeneration of science for students preparing a Masters or a PhD, researchers\r\nand university professors', NULL, '8877256.jpg', '4952461.pdf', 1, 2004, 'New York', 50, '2019-01-16 21:24:13', '2019-01-16 21:24:13', '203.190.11.123'),
(356, 12, 1, NULL, 1, 'Mechatronic Systems Devices, Design, Control, Operation and Monitoring', 'mechatronic-systems-devices-design-control-operation-and-monitoring', NULL, '13: 978-0-8493-0775-1', NULL, 'Mechatronic, Mechatronic Systems, Design, Control, Operation, Monitoring', 'In the book, equal emphasis is given to theory and practical application. The chapters are grouped into those covering mechatronic devices and applications, linking and communication within and outside a mechatronic systems, control of mechatronic systems, design of mechatronic devices and systems, and monitoring and fault diagnosis of mechatronic systems. Analytical formulations, numerical methods, design approaches, control techniques, and commercial tools are presented and illustrated using examples and case studies. Practical implementations, field applications, and experimentation are described and\r\ndemonstrated.', NULL, '8519959.JPG', '5648723.pdf', 1, 2008, 'New York', 50, '2019-01-16 21:28:07', '2019-01-16 21:28:07', '203.190.11.123'),
(357, 49, 1, NULL, 1, 'Introduction to Electromagnetic Compatibility', 'introduction-to-electromagnetic-compatibility', 'Second Edition', '13: 978-0-471-75500-5', NULL, 'Electromagnetic, Compatibility', 'The subject of EMC is rapidly becoming as important a subdiscipline of electrical engineering (EE) as other more traditional subjects such as electric circuit analysis and electronics. One of the first such courses in EMC that was introduced into an EE undergraduate curriculum was organized in the early 1980s at the University of Kentucky by the author. It was taught as a senior technical elective and continues to be taught as an elective course there and at the authorâ€™s present institution, Mercer University. The subject is rapidly increasing in importance, due in part to the increasing use and speeds of digital electronics in todayâ€™s modern world.', NULL, '6917422.JPG', '3625814.pdf', 1, 2006, 'New Jersey', 50, '2019-01-16 21:32:49', '2019-01-16 21:32:49', '203.190.11.123'),
(358, 191, 1, NULL, 1, 'Gravity gauge theories and geometric algebr', 'gravity-gauge-theories-and-geometric-algebr', NULL, NULL, NULL, 'Geometric Algebr', 'A new gauge theory of gravity is presented The theory is constructed in a\r\nat background spacetime and employs gauge elds to ensure that all \r\n elations between physical quantities are independent of the position and orientation of the matter elds In this manner all properties of the background spacetime are removed from physics and what remains are a set of intrinsic relations between physical elds For a wide range of phenomena including all present experimental tests the theory reproduces the predictions of general relativity Dierences do emerge however through the rst order nature of the equations and the global properties of the gauge elds and through the relationship with quantum theory The properties of the gravitational gauge elds are derived from both classical and quantum viewpoints Field equations are then derived from an action principle and consistency with the minimal coupling procedure selects an action which is unique up to the possible inclusion of a cosmological', NULL, '9573169.JPG', '1499883.pdf', 1, 1998, 'U.K.', 51, '2019-01-16 21:33:23', '2019-01-16 21:33:23', '203.190.11.117'),
(359, 49, 1, NULL, 1, 'Grounding and shielding circuits and interference', 'grounding-and-shielding-circuits-and-interference', '5th ed.', '978-0-470-09772-4', NULL, 'Voltage and Capacitance, Analog Circuits', 'The fi rst edition of Grounding and Shielding was published in 1967. The fourth\r\nedition was published in 1997. It is hard to imagine that another decade has\r\npassed and that I would be writing on the same subject for a fi fth time. This\r\nfi fth edition is a total rewrite because I wanted to present ideas in a different\r\norder and also to present new insight that was gained through teaching seminars and consulting. For example, I wanted to add material on printed circuit board design, a subject that was only touched upon in the fourth edition.\r\nI also left out material that was no longer relevant.', NULL, '8886337.JPG', '6358630.pdf', 1, 2007, 'New Jersey', 51, '2019-01-16 21:37:09', '2019-01-16 21:37:09', '203.190.11.117'),
(360, 72, 1, NULL, 1, 'Electrical Engineer\'s Reference Book', 'electrical-engineers-reference-book-16371651', '14th ed.', '0408004320', NULL, NULL, 'For ease of use, this edition has been divided into the following subject sections: general principles; materials and processes; control, power electronics and drives; environment; power generation; transmission and distribution; power systems; sectors of electricity use.', NULL, '4638938.jpg', '7494537.pdf', 1, 1985, 'New York', 40, '2019-01-16 21:37:51', '2019-01-16 21:37:51', '203.190.11.117'),
(361, 139, 1, NULL, 1, 'Nuclear Power Technical and Institutional Options for the Future', 'nuclear-power-technical-and-institutional-options-for-the-future-16381651', NULL, '0-309-04395-6', NULL, 'Nuclear, Nuclear Power,Institutional, Options', 'The [Senate Committee on Appropriations] believes that nuclear fission\r\nremains an important option for meeting our electric energy requirements and\r\nmaintaining a balanced national energy policy. The Committee continues to\r\nstrongly support the need for a responsive nuclear fission program, but finds\r\nthe current civilian nuclear power reactor program to be a deficient aggregate\r\nof numerous reactor types and conceptual variations being developed without\r\nthe guidance of well-defined strategic objectives. The Committee finds further\r\nthat the future development and institutionalization of nuclear power\r\ndevelopment should be rethought, newly defined, and directed to be responsive\r\nto current and projected conditions.', NULL, '1990512.jpg', '5655399.pdf', 1, 1992, 'United States of America', 50, '2019-01-16 21:38:51', '2019-01-16 21:38:51', '203.190.11.123'),
(362, 72, 1, NULL, 1, 'Mathematics for Electrical Engineering and Computing', 'mathematics-for-electrical-engineering-and-computing', NULL, '0 7506 5855 X', NULL, 'Electrical Engineering , Computing', 'Developments in the fields of engineering, particularly the extensive use of computers and microprocessors, have changed the necessary subject emphasis within mathematics.This has meant incorporating areas such as boolean algebra, graph and language theory, and logic into the content. A particular area of interest is digital signal processing.', NULL, '9298913.JPG', '9302876.pdf', 1, 1988, 'New York', 48, '2019-01-16 21:39:09', '2019-01-16 21:39:09', '203.190.11.115'),
(363, 10, 1, NULL, 1, 'Control of Interactive Robotic Interfaces', 'control-of-interactive-robotic-interfaces', NULL, '10 3-540-49712-9', NULL, 'Control, Interactive, Robotic, Interfaces', 'This monograph deals with energy based control of interactive robotic interfaces. The port-Hamiltonian framework is exploited both for modeling and controlling interactive robotic interfaces. The book provides an energy oriented analysis and control synthesis of interactive robotic interfaces, from a single robot to multi-robot systems for interacting with real and virtual, possibly unstructured, environments.', NULL, '6992906.jpg', '2346212.pdf', 1, 2007, 'Germany', 50, '2019-01-16 21:44:33', '2019-01-16 21:44:33', '203.190.11.123'),
(364, 192, 1, NULL, 1, 'THE ELECTROMAGNETIC ORIGIN OF QUANTUM THEORY AND LIGHT', 'the-electromagnetic-origin-of-quantum-theory-and-light', 'Second Edition', '981-238-925-3', NULL, 'ELECTROMAGNETIC, QUANTUM, THEORY AND LIGHT', 'We find that all the above play integral and essential roles in atomic\r\nstability and energy exchanges. Together they form a complete electromagnetic field solution of quantum mechanical exchanges of electromagnetic\r\nenergy without the separate axioms of the historic interpretation', NULL, '6621747.JPG', '4791857.pdf', 1, 2005, 'New Jersey', 50, '2019-01-16 21:48:46', '2019-01-16 21:48:46', '203.190.11.123'),
(365, 193, 1, NULL, 1, 'Thermal Power Plant Simulation and Control', 'thermal-power-plant-simulation-and-control', NULL, '0 85296 419 6', NULL, 'Thermal,  Power Plant, Simulation,', 'The level of the book makes it suitable for engineers working in the power generation industry who wish to gain an appreciation of the advances which have taken place in this field within the research community. It should also provide a very useful overview for new and experienced researchers working in this area. A number of the contributions to this book arise from work carried out at, or in collaboration with, universities and research institutions, while others benefit from the experience of practitioners in the industry. A natural consequence of this is that a mixture of viewpoints is offered, with a contrast between the use of academic and industrial terminology', NULL, '8563538.JPG', '5422599.pdf', 1, 2003, 'London', 50, '2019-01-16 21:52:15', '2019-01-16 21:52:15', '203.190.11.123'),
(366, 192, 1, NULL, 1, 'Advanced Mechatronics Monitoring and Control of Spatially Distributed Systems', 'advanced-mechatronics-monitoring-and-control-of-spatially-distributed-systems', NULL, '13 978-981-277-181-0', NULL, 'Mechatronics, Monitoring, Advanced Mechatronics, Distributed', 'Mechatronics is an engineering field that refers to mixed systems tight\r\nintegration. Currently, this integration can be viewed as based on digital\r\ncomputer monitoring and control, but it cannot be denied that integration\r\ncan be based on any other signal processing system and any form of raw\r\npower that can be modulated and transferred to the mixed system in\r\naccordance to the output of this digital signal processor.', NULL, '6555726.JPG', '1312496.pdf', 1, 2009, 'New Jersey', 50, '2019-01-16 21:55:11', '2019-01-16 21:55:11', '203.190.11.123'),
(367, 194, 1, NULL, 1, 'Introduction to Mechatronics and Measurement Systems', 'introduction-to-mechatronics-and-measurement-systems', 'Fourth Edition', '978-0-07-338023-0', NULL, 'Mechatronics, Introduction, Measurement', 'This book is designed to serve as a text for (1) a modern instrumentation and\r\nmeasurements course, (2) a hybrid electrical and mechanical engineering course replacing traditional circuits and instrumentation courses, (3) a stand-alone mechatronics course, or (4) the first course in a mechatronics sequence. The second option, the hybrid course, provides an opportunity to reduce the number of credit hours in a typical mechanical engineering curriculum. Options 3 and 4 could involve the development of new interdisciplinary courses and curricula.', NULL, '7355654.JPG', '4780183.pdf', 1, 2007, 'New York', 50, '2019-01-16 21:58:43', '2019-01-16 21:58:43', '203.190.11.123'),
(368, 12, 1, NULL, 1, 'Electronics and Circuit Ananlysis Using Matlab', 'electronics-and-circuit-ananlysis-using-matlab', NULL, '0-8493-1176-4', NULL, 'CIRCUIT ANALYSIS , Electronics', 'This book contains information obtained from authentic and highly regarded sources.\r\nReprinted material is quoted with permission, and sources are indicated. A wide variety of\r\nreferences are listed. Reasonable efforts have been made to publish reliable data and\r\ninformation, but the author and the publisher cannot assume responsibility for the validity\r\nof all materials or for the consequences of their use.', NULL, '7961182.JPG', '7559547.pdf', 1, 1999, 'New York', 48, '2019-01-16 22:02:06', '2019-01-16 22:02:06', '203.190.11.115'),
(369, 195, 1, NULL, 1, 'Introduction to nanotechnology', 'introduction-to-nanotechnology', NULL, NULL, NULL, 'Introduction, nanotechnology', 'In the spring 2002 MIC launched a new fourth semester course at the Technical University of Denmark (course no. 33320, 10 ECTS) to provide a general and broad introduction to the multi-disciplinary field of nanotechnology. The number of students attending the course has grown steadily from 24 in 2002, to 35 the following year and now more than 50 in 2004. Based on the feed-back from the students I have changed part of the course and expanded the lecture notes', NULL, '5790753.jpg', '6653071.pdf', 1, 2004, 'Denmark', 50, '2019-01-16 22:06:26', '2019-01-16 22:06:26', '203.190.11.123'),
(370, 61, 1, NULL, 1, 'Field and Wave Electromagnetics', 'field-and-wave-electromagnetics', 'Second Edition', '978-0201128192', NULL, 'Field, Wave, Electromagnetics', 'Back Cover Field and Wave Electromagnetics, Second Edition features many examples of practical applications to give students an excellent physical -- as well as mathematical -- understanding of important concepts. These include applications drawn from important new areas of technology such as optical fibers, radome design, satellite communication, and microstrip lines. There is also added coverage of several new topics, including Hall effect, radar equation and scattering cross section, transients in transmission lines, waveguides and circular cavity resonators, wave propagation in the ionosphere, and helical antennas. New exercises, new problems, and many worked-out examples make this complex material more accessible to students.', NULL, '9560214.JPG', '2951204.pdf', 1, 1983, 'London', 50, '2019-01-16 22:11:22', '2019-01-16 22:11:22', '203.190.11.123'),
(371, 196, 1, NULL, 1, 'GSM and Personal Communications Handbook', 'gsm-and-personal-communications-handbook', NULL, '0-89006-957-3', NULL, 'GSM Service, Communications Handbook .', 'The most comprehensive reference available on GSM applications and services, this new title is intended to build on the basic technical information in the authors\' original bestseller, An Introduction to GSM (Artech House, 1995). The book provides a close-up look at this hot technology, offers in-depth discussions of the features and services available through GSM, and includes new and more in-depth coverage of applications and implementations of the GSM standard. It also explains how GSM has succeeded in becoming the major digital wireless standard - and addresses both past and future standardization, regulation, and development issues.', NULL, '1594163.jpg', '6065237.pdf', 1, 1998, 'Boston', 51, '2019-01-16 22:15:07', '2019-01-16 22:15:07', '203.190.11.117');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(372, 12, 1, NULL, 1, 'Mechatronics : An Integrated Approach', 'mechatronics-an-integrated-approach', NULL, '0-8493-1274-4', NULL, 'Mechatronics,Integrated, Approach', 'This is an introductory book on the subject of Mechatronics. It will serve as both a textbook and a reference book for engineering students and practicing professionals. Mechatronics concerns synergistic and concurrent use of mechanics, electronics, computer engineering, and intelligent control systems in modeling, analyzing, designing, developing, and implementing smart electromechanical products. As the modern machinery and electromechanical devices are typically being controlled using analog and digital electronics and computers, the technologies of mechanical engineering in such a system can no longer be isolated from those of electronic and computer engineering.', NULL, '2011242.JPG', '9104985.pdf', 1, 2006, 'New York', 50, '2019-01-16 22:16:39', '2019-01-16 22:16:39', '203.190.11.123'),
(373, 49, 1, NULL, 1, 'Flexible Power Transmission: The HVDC Options', 'flexible-power-transmission-the-hvdc-options', NULL, '978-0-470-05688-2', NULL, 'Power Transmission, HVDC Options, Flexible Transmission', 'The new power semiconductors have also, in the past decade, changed the attitude towards\r\nHVDC transmission, and a variety of converter configurations have been developed to take\r\nadvantage of the higher control ability and switching frequencies of the new devices.\r\nAlthough the main market for HVDC is still thyristor based, a transistor-based technology\r\nhas recently been developed, and is already being used throughout the world. The new HVDC\r\ntechnology can provide most of the enhancements of the individual FACTS controllers,\r\ni.e. permit large stable power transfers, deliver or absorb the required reactive power to\r\nmaintain the specified voltages at the interconnected buses, contain fast emergency controls\r\nto avoid large fault current levels, be designed (if required) to control sub-synchronous\r\nresonances, etc.', NULL, '6439442.JPG', '5128756.pdf', 1, 2007, 'England', 47, '2019-01-16 22:19:32', '2019-01-16 22:19:32', '203.190.11.117'),
(374, 10, 1, NULL, 1, 'Cells and Robots Modeling and Control of Large-Size Agent Populations', 'cells-and-robots-modeling-and-control-of-large-size-agent-populations', NULL, '10 3-540-71981-4', NULL, 'Cells, Robots, Control, Modeling', 'In â€Cells and Robotsâ€ we are presenting a theoretical framework in which both biological cell populations and large-size mobile robot teams can be modeled and analyzed. We assume that behavior of individual agents can be described by hybrid automata and we try to come up with mathematical objects appropriate for the description of the population state and its evolution. This makes our effort to study multi-agent systems different from computational models attempting to model individual agents in detail. The significance of our modeling framework for real agent populations is similar to the significance of thermodynamic laws for ideal gases in Physics of real gases.', NULL, '3577752.jpg', '3485935.pdf', 1, 2007, 'Germany', 50, '2019-01-16 22:22:04', '2019-01-16 22:22:04', '203.190.11.123'),
(375, 196, 1, NULL, 1, 'GSM Networks: Protocols, Terminology and Implementation', 'gsm-networks-protocols-terminology-and-implementation', NULL, '0890064717', NULL, 'GSM Networks, Terminology.', 'This text offers a comprehensive treatment of the entire GSM network and the signalling methods of its terrestrial interfaces. It introduces all the interfaces between the GSM subsystems, starting with the Abis- and Air-Interface and continuing on to VLRs, HLRs and MSCs within the NSS. The reader learns about the various signalling standards or methods used in GSM, including TCAP and MAP, and how to apply this knowledge when working with GSM networks.', NULL, '1298091.jpg', '3045841.PDF', 1, 1998, 'Boston', 51, '2019-01-16 22:24:42', '2019-01-16 22:24:42', '203.190.11.117'),
(376, 197, 1, NULL, 1, 'Engineering and Food for the 21st Century', 'engineering-and-food-for-the-21st-century', NULL, '1-56676-963-9', NULL, 'Food Engineering', 'Food engineering is becoming a well established profession all around the world, and this book is probably the best example of the vastness, depth, and relevance of this profession. It includes the work of the most prestigious world experts in food engineering, covering key topics ranging from physical properties of foods, thermal and nonthermal processing, and key unit operations in food processing to the education (past and present) of the profession and environmental issues. All the chapters included in this book are based on invited presentation to the Eighth International Conference on Engineering and Food (ICEF-8) held in Puebla, Mexico, during the month of April 2000. Signiï¬cant additions were made by the authors to all the original presentation to be sure each topic was covered in a comprehensive manner and properly updated for this book released in 2002.', NULL, '7484293.JPG', '3983713.pdf', 1, 2002, 'New York', 39, '2019-01-16 22:33:49', '2019-01-16 22:33:49', '203.190.10.206'),
(377, 30, 1, NULL, 1, 'GSM Switching, Services and Protocols', 'gsm-switching-services-and-protocols', '2nd ed.', '978-0471499039', NULL, 'GSM Switching,', 'Since the publication of the first edition the number of GSM subscribers has exploeded and it is now deployed in more than 140 countries worldwide. Revised and updated GSM Switching, Services and Protocols now features the abundant new services and applications that GSM can provide. By focusing on the fundamentals of the mobile radio systems, it provides an excellent introductory insight to the whole area of GSM cellular radio. By providing an easy-to-follow instructive text, this second edition will have insight appeal to telecommunication engineers, researchers, adn developers. The highly graphical approach and numerous illustrations will also make it an indispensable reference for senior undergraduates and postgraduates in electrical and computer engineering', NULL, '6892361.jpg', '5059869.pdf', 1, 2001, 'New York', 51, '2019-01-16 22:36:01', '2019-01-16 22:36:01', '203.190.11.117'),
(378, 12, 1, NULL, 1, 'Automation for Food Engineering : Food Quality Quantification and Process Control', 'automation-for-food-engineering-food-quality-quantification-and-process-control', NULL, '0-8493-2230-8', NULL, 'Food Automation Engineering', 'The book describes the concepts, methods, and theories of data acquisi-tion, data analysis, modeling, classification and prediction, and control as they pertain to food quality quantization and process control. The book emphasizes the applications of advanced methods, such as wavelet analysis and artificial neural networks, to automated food quality evaluation and process control and introduces novel system prototypes such as machine vision, elastography, and the electronic nose for food quality measurement, analysis, and prediction. This book also provides examples to explain real-world applications. Although we expect readers to have a certain level of mathematical back-ground, we have simplified this requirement as much as possible to limit the difficulties for all readers from undergraduate students, researchers, and engi-neers to management personnel. We hope that the readers will benefit from this work.', NULL, '5246927.JPG', '2243879.pdf', 1, 2001, 'London', 39, '2019-01-16 22:39:17', '2019-01-16 22:39:17', '203.190.10.206'),
(379, 64, 1, NULL, 1, 'Practical Analog and Digital Filter Design', 'practical-analog-and-digital-filter-design-16521726', NULL, '978-1580539159', NULL, 'Digital Filter, Analog Filter, Filter Design, Practical Filter Design.', 'This book was intentionally written to be different from other filter design books\r\nin two important ways. First, the most common analog and digital filter design and\r\nimplementation methods are covered in a no-nonsense manner. All important\r\nderivations and descriptions are provided to allow the reader to apply them\r\ndirectly to his or her own filter design problem. Over forty examples are provided\r\nto help illustrate the fundamentals of filter design. Not only are the details of\r\nanalog active and digital IIR and FIR filter design presented in an organized and\r\ndirect manner, but implementation issues are discussed to alert the reader to\r\npotential pitfalls. An added feature to this text is the discussion of fast Fourier\r\ntransforms and how they can be used in filtering applications.', NULL, '8735086.JPG', '8254585.pdf', 1, 2004, 'U.S.A.', 47, '2019-01-16 22:52:26', '2019-01-16 22:52:26', '203.190.11.115'),
(380, 198, 1, NULL, 1, 'The Scientist and Engineer\'s guide to Digital Signal Processing', 'the-scientist-and-engineers-guide-to-digital-signal-processing', NULL, '978-0966017632', NULL, 'Digital Signal Processing', 'Clear and concise explanations of practical DSP techniques. Written for \r\ncientists and engineers needing the power of DSP, but not the abstract theory and detailed mathematics.', NULL, '5083023.jpg', '6237300.pdf', 1, 1997, NULL, 51, '2019-01-16 22:53:33', '2019-01-16 22:53:33', '203.190.11.117'),
(381, 95, 1, NULL, 1, 'Introduction to Electrical Engineering', 'introduction-to-electrical-engineering', NULL, '0-19-513604-7 (cloth)', NULL, NULL, NULL, NULL, '9664511.jpg', '1307712.pdf', 1, 2001, 'New York', 40, '2019-01-16 22:57:21', '2019-01-16 22:57:21', '203.190.11.117'),
(382, 12, 1, NULL, 1, 'AC Power System Handbook', 'ac-power-system-handbook', '2nd ed.', '978-0849374142', NULL, 'AC Power', 'Disturbances on the ac power line are what headaches are made of. Outages, surges, sags, transients: They all combine to create an environment that can damage or destroy sensitive load equipment. They can take your system down and leave you with a complicated and expensive repair job.', NULL, '7382349.jpg', '9055641.pdf', 1, 1998, 'New York', 51, '2019-01-16 22:58:18', '2019-01-16 22:58:18', '203.190.11.115'),
(383, 124, 1, NULL, 1, 'Asic and FPGA Verification: A guide to component modeling', 'asic-and-fpga-verification-a-guide-to-component-modeling', '1st', '0-12-510581-9', NULL, 'Asic Verification, FPGA Verification', 'At this time VITAL was in its final development and a coworker, Russ Vreeland,\r\nconvinced me to look at it. I had already tried Verilog and found it did not work\r\nwell at the board level. Although the show-stopper problems were tool related, such\r\nas netlisting, and have since been fixed, other problems remain with the language\r\nitself. These include (but are not limited to) a lack of library support and the inability to read the strength of a signal.', NULL, '1957230.JPG', '8084085.pdf', 1, 2005, 'New York', 47, '2019-01-16 23:05:15', '2019-01-16 23:05:15', '203.190.11.117'),
(384, 12, 1, NULL, 1, 'AC Power Systems Handbook', 'ac-power-systems-handbook', '3rd ed.', '0-8493-4034-9', NULL, 'Grounding Tower Elements, Transient-Suppression Devices, Motor-Generator Set,  Power Electronics.', 'Disturbances on the ac power line are what headaches are made of. Outages, surges, sags, transients: they combine to create an environment that can damage or destroy sensitive load equipment. They can take\r\nyour system down and leave you with a complicated and expensive repair job. Ensuring that the equipment at your facility receives clean ac power has always been important. But now, with computers integrated into a wide variety of electronic products, the question of ac power quality is more critical than ever. The computer-based systems prevalent today can garble or lose data because of power-supply disturbances or interruptions. And if the operational problems are not enough, there is the usually difficult task of equipment troubleshooting and repair that follows a utility system fault.', NULL, '3244906.JPG', '7933881.pdf', 1, 2007, 'New York', 51, '2019-01-16 23:05:27', '2019-01-16 23:05:27', '203.190.11.117'),
(385, 199, 1, NULL, 1, 'Experiments with Alternate Currents of High Potential and High Frequency: A Lecture Delivered Before the Institution of Electrical Engineers, London.', 'experiments-with-alternate-currents-of-high-potential-and-high-frequency-a-lecture-delivered-before-the-institution-of-electrical-engineers-london', NULL, '1589639936', NULL, NULL, NULL, NULL, '6408619.jpg', '2129745.pdf', 1, 2002, 'New York', 40, '2019-01-16 23:08:53', '2019-01-16 23:08:53', '203.190.11.115'),
(386, 91, 1, NULL, 1, 'Microscope Image Processing', 'microscope-image-processing', '1st ed.', '978-0-12-372578-3', NULL, 'microscopy, algorithms, autofocusing', 'Digital image processing, an integral part of microscopy, is increasingly important to the fields of medicine and scientific research. This book provides a unique one-stop reference on the theory, technique, and applications of this technology.', NULL, '2270839.jpg', '7930011.pdf', 1, 2008, 'New York', 40, '2019-01-16 23:22:08', '2019-01-16 23:22:08', '203.190.11.115'),
(387, 200, 1, NULL, 1, 'Audel Electrical Course for Apprentices and Journeymen', 'audel-electrical-course-for-apprentices-and-journeymen', '4th ed.', '0-764-54200-1', NULL, 'Electrical, Apprentices, Journeymen.', 'An apprentice electrician prepares to become a journeyman typically during a four-year period. These four years include 2000\r\nhours per year of on-the-job training, or a total of 8000 hours.\r\nDuring off-hours an apprentice studies electrical theory, methods,\r\nequipments, and the NEC.', NULL, '5104972.JPG', '2960577.pdf', 1, 2004, 'Canada', 47, '2019-01-16 23:29:30', '2019-01-16 23:29:30', '203.190.11.117'),
(388, 12, 1, NULL, 1, 'Air pollution control technology handbook', 'air-pollution-control-technology-handbook', NULL, '0-8493-9588-7', NULL, 'Air pollution', 'This book is written to serve as a reference handbook for the practicing engineer or scientist who needs to prepare the basic process engineering and cost estimation required for the design of an air pollution control system. The user of this book should have a fundamental understanding of the factors resulting in air pollution and a general knowledge of the techniques used for air pollution control.', NULL, '6337529.JPG', '2303446.pdf', 1, 2002, 'New York', 51, '2019-01-16 23:38:59', '2019-01-16 23:38:59', '203.190.11.117'),
(389, 43, 1, NULL, 1, 'Antenna Engineering Handbook', 'antenna-engineering-handbook', '3rd ed.', '978-0070323810', NULL, 'Antenna Engineering', 'Features vital data on all the primary antenna types and includes in-depth coverage of the design techniques and operating principles involved. The scope is broad from arrays of discrete elements to conformal and low-profile arrays, from methods of polarization synthesis to microwave propagation, and from dipoles and monopoles to impedance matching and broadbanding. The first edition, published in 1961, was edited by Henry Jasik. Annotation copyright Book News, Inc. Portland', NULL, '3006580.JPG', '2784169.pdf', 1, 1993, 'New York', 51, '2019-01-16 23:43:30', '2019-01-16 23:43:30', '203.190.11.117'),
(390, 52, 1, NULL, 1, 'Electric Motor Drives: Modeling, Analysis, and Control', 'electric-motor-drives-modeling-analysis-and-control', '1st ed.', '0130910147', NULL, NULL, NULL, NULL, '9778713.jpg', '9058525.pdf', 1, 2001, 'New York', 40, '2019-01-16 23:51:48', '2019-01-16 23:51:48', '203.190.11.117'),
(391, 125, 1, NULL, 1, 'Automated Fingerprint Identification Systems (AFIS)', 'automated-fingerprint-identification-systems-afis', '1st ed.', '0-12-418351-4', NULL, 'Fingerprint Identification Systems, Automated Identification Systems', 'This book provides information as to the critical and continual need for properly trained individuals as well as an understanding of the direct and indirect costs associated with maintaining these systems. An understanding of the entire system and what it means will prove invaluable. Why are there missed identifications? Why are identifications made on one database that are not made on another database? Key terms and issues are included, and well as suggestions for improving the overall number of identifications. The book will go beyond process and also discuss issues such as interoperability, management strategies for large databases, contract development, lights out verification and several other issues which impact automated identifications.', NULL, '1195646.JPG', '5699964.pdf', 1, 2005, 'New York', 47, '2019-01-16 23:51:53', '2019-01-16 23:51:53', '203.190.11.117'),
(392, 30, 1, NULL, 1, 'Control Methods for Electrical Machines', 'control-methods-for-electrical-machines', '1st ed.', '978-1-84821-093-6', NULL, NULL, 'The type of control system used for electrical machines depends on the use (nature of the load, operating states, etc.) to which the machine will be put. The precise type of use determines the control laws which apply. Mechanics are also very important because they affect performance.', NULL, '7125235.jpg', '3428722.pdf', 1, 2009, 'New York', 40, '2019-01-17 00:05:51', '2019-01-17 00:05:51', '203.190.11.117'),
(393, 12, 1, NULL, 1, 'Circuits, Signals, and Speech and Image Processing (The Electrical Engineering Handbook)', 'circuits-signals-and-speech-and-image-processing-the-electrical-engineering-handbook', '3rd ed.', '0-8493-7337-9 (Hardcover) 978-0-8493-7337-4', NULL, NULL, 'In two editions spanning more than a decade, The Electrical Engineering Handbook stands as the definitive reference to the multidisciplinary field of electrical engineering. Our knowledge continues to grow, and so does the Handbook. For the third edition, it has expanded into a set of six books carefully focused on a specialized area or field of study.', NULL, '9887241.jpg', '1816799.pdf', 1, 2006, 'New York', 40, '2019-01-17 00:27:59', '2019-01-17 00:27:59', '203.190.11.117'),
(394, 49, 1, NULL, 1, 'Control of Electric Machine Drive Systems', 'control-of-electric-machine-drive-systems', '1st ed.', '978-0-470-59079-9 (hardback)', NULL, NULL, 'A unique approach to sensorless control and regulator design of electric drives\r\nBased on the author\'s vast industry experience and collaborative works with other industries, Control of Electric Machine Drive Systems is packed with tested, implemented, and verified ideas that engineers can apply to everyday problems in the field.', NULL, '6104047.jpg', '3711997.pdf', 1, 2011, 'Canada', 40, '2019-01-17 00:40:16', '2019-01-17 00:40:16', '203.190.11.117'),
(395, 201, 1, NULL, 1, 'Electric Motor Control', 'electric-motor-control', '9th ed.', '978-1-4354-8575-4 1-4354-8575-0', NULL, NULL, 'With a highly practical approach, ELECTRIC MOTOR CONTROL, 9E provides a useful and effective tool for anyone who will install, monitor, and/or maintain motor controls. The book begins by introducing the simplest of equipment and then builds upon this knowledge, step-by-step, enabling readers to learn how to draw and interpret motor control schematic diagrams.', NULL, '1742980.jpg', '2649908.pdf', 1, 2010, 'New York', 40, '2019-01-17 00:47:41', '2019-01-17 00:47:41', '203.190.11.117'),
(396, 95, 1, NULL, 1, 'Brushless Permanent-Magnet and Reluctance Motor Drives', 'brushless-permanent-magnet-and-reluctance-motor-drives', NULL, '0-19-859369-4', NULL, NULL, 'More than a century after Faraday, there remains in the field of motors and drives enormous scope for innovation. This presentation of the theory of brushless d.c. drives will help engineers to appreciate the potential of such motors and apply them more widely, taking advantage of remarkable and recent developments in permanent-magnet materials, power semiconductors, electronic control, and motor design (including CAD).', NULL, '7055787.jpg', '7233221.pdf', 1, 1989, 'New York', 40, '2019-01-17 01:02:16', '2019-01-17 01:02:16', '203.190.11.117'),
(397, 130, 1, NULL, 1, 'Automotive Computer Controlled Systems Diagnostic tools and techniques', 'automotive-computer-controlled-systems-diagnostic-tools-and-techniques', '1st ed.', '07506 50893', NULL, 'Automotive, Computer Systems, Controlled Systems, tools and techniques', 'The text concentrates on areas of technology that are common to a range\r\nof systems. For example, air flow meters are a common feature on most petrol\r\nengines and they are of two types: volumetric flow (the flap), and mass flow such\r\nas the hot wire and the hot film. The outputs from these sensors are broadly similar\r\nand they can be measured accurately with the type of equipment that is described.\r\nMost exhaust gas oxygen sensors are of the zirconia type and the output signals,\r\non almost all vehicles to which they are fitted, will be broadly identical.', NULL, '1149216.jpg', '6342658.pdf', 1, 2001, 'New Delhi', 47, '2019-01-17 01:10:40', '2019-01-17 01:10:40', '203.190.11.117'),
(398, 95, 1, NULL, 1, 'Stepping Motors and Their Microprocessor Controls', 'stepping-motors-and-their-microprocessor-controls', NULL, '0198593260', NULL, NULL, 'Stepping motors are used wherever repeated stop-start or intermittent motions are encountered. Found in a diverse range of machines such as clocks, typewriters, automatic draughting machines, numerically controlled machine tools, and computer peripherals, stepping motors offer easy compatibility with digital equipment and ease of control.', NULL, '8570428.jpg', '7566842.pdf', 1, 1984, 'New York', 40, '2019-01-17 01:24:53', '2019-01-17 01:24:53', '203.190.11.117'),
(399, 202, 1, NULL, 1, 'ASM Handbook', 'asm-handbook', NULL, '978-0871703897', NULL, NULL, 'This book is ASM\'s standard reference on the mechanical characteristics and testing of metals, plastics, ceramics, and composites. Understand the basics of mechanical behavior with in-depth coverage on testing methods for those materials. Comparative mechanical properties and the mechanical characteristics of metals, plastics, and ceramics are included throughout for general reference. Updated references to ISO, ASTM, DIN, EN, JIS and other standards are also included.', NULL, '5778597.JPG', '1648723.pdf', 1, 2000, NULL, 51, '2019-01-17 01:37:49', '2019-01-17 01:37:49', '203.190.11.117'),
(400, 49, 1, NULL, 1, 'Understanding Microwaves', 'understanding-microwaves', NULL, '978-0471745334', NULL, 'Microwaves', 'A complete and accessible introduction to the important field of  icrotechnology. Avoiding complex mathematics, it covers all the pertinent microwave terminology, devices, systems and subsystems in order to facilitate an understanding of how everything fits together to create communications, navigation and radar equipment. Packed with illustrations as well as extensive exercises and answers.', NULL, '7835938.JPG', '5457299.pdf', 1, 1993, 'New York', 51, '2019-01-17 01:54:14', '2019-01-17 01:54:14', '203.190.11.117'),
(401, 203, 1, NULL, 1, 'Nanotechnology: Molecular Speculations on Global Abundance', 'nanotechnology-molecular-speculations-on-global-abundance-16022154', NULL, '0-262-53137-2', NULL, 'Nanotechnology, Global Abundance.', 'Although inspired by a technical subject, this book is designed\r\nto be accessible to nontechnical readers. In the first chapter, I introduce the rudiments of molecular engineering and offer a brief genealogy of the field. I also provide a survey of several active areas of\r\nresearch. The remaining chapters present, with precision but without sustained mathematics, some of the potential power inherent in nanotechnology.The book\'s first section focuses on applications that work, for the most part, inside living bodies.', NULL, '3403317.jpg', '3971151.pdf', 1, 1996, NULL, 47, '2019-01-17 02:02:54', '2019-01-17 02:02:54', '203.190.11.117'),
(402, 204, 1, NULL, 1, 'Microelectronic Device And Circuits', 'microelectronic-device-and-circuits', '2006 electronic ed.', '0-07-021496-4', NULL, 'Mechanical Devices and Circuits', 'Today we know that the earth is round and we know how big it is, but how often do we use the round-earth model in daily life? For most of what we do, a flat- earth model is perfectly adequate and much easier to work with. Mathematically, we recognize that the flat-earth model is a linear approximation to the round-earth model, valid for motion in our immediate vicinity. In circuit jargon, we would call it a small-signal, or incremental, linear equivalent model for the earth. There are many different models for the earth, ranging from a flat slab to an infinitesimal point, and each has utility in the right situation. One of the important things to learn about modeling is how to trade off complexity and accuracy, and how to choose the appropriate model for the task at hand.', NULL, '4720492.png', '4376136.pdf', 1, 2006, 'New York', 39, '2019-01-17 15:07:38', '2019-01-17 15:07:38', '203.190.10.206'),
(403, 205, 1, NULL, 1, 'In Praise of Foundations of Analog and Digital Electronic Circuits', 'in-praise-of-foundations-of-analog-and-digital-electronic-circuits', NULL, '1-55860-735-8', NULL, 'Digital Electronic Circuits', 'This book is designed to serve as a first course in an electrical engineering or an electrical engineering and computer science curriculum, providing students at the sophomore level a transition from the world of physics to the world of electronicsandcomputation.Thebookattemptstosatisfytwogoals:Combine circuits and electronics into a single, unified treatment, and establish a strong connection with the contemporary worlds of both digital and analog systems. These goals arise from the observation that the approach to introducing electrical engineering through a course in traditional circuit analysis is fast becoming obsolete. Our world has gone digital. A large fraction of the student population in electrical engineering is destined for industry or graduate study in digital electronics or computer systems. Even those students who remain in core electrical engineering are heavily influenced by the digital domain.', NULL, '2608332.JPG', '7754125.pdf', 1, 2005, 'New York', 39, '2019-01-17 15:12:13', '2019-01-17 15:12:13', '203.190.10.206'),
(404, 10, 1, NULL, 1, 'Fourier Analysis and Its Application', 'fourier-analysis-and-its-application', NULL, '0-387-00836-5', NULL, 'Fourier', 'The classical theory of Fourier series and integrals, as well as Laplace transforms, is of great importance for physical and technical applications, and its mathematical beauty makes it an interesting study for pure mathematicians as well. I have taught courses on these subjects for decades to civil engineering students,and also mathematics majors,and the present volume can be regarded as my collected experiences from this work. There is, of course, an unsurpassable book on Fourier analysis, the treatise by Katznelson from 1970. That book is, however, aimed at mathematically very mature students and can hardly be used in engineering courses. On the other end of the scale, there are a number of more-or-less cook book styled books, where the emphasis is almost entirely on applications. I have felt the need for an alternative in between these extremes: a text for the ambitious and interested student, who on the other hand does not aspire to become an expert in the ï¬eld.', NULL, '2749288.JPG', '6267733.pdf', 1, 2003, 'New York', 39, '2019-01-17 15:16:21', '2019-01-17 15:16:21', '203.190.10.206'),
(405, 96, 1, NULL, 1, 'Antenna Theory Analysis and Design', 'antenna-theory-analysis-and-design', '3rd ed.', '047166782X', NULL, 'Antennas, Parameters of Antennas, Radiation Integrals and Auxiliary Potential Functions,  Loop Antennas, Arrays: Linear, Planar, and Circular, Broadband Dipoles and MatchingT echniques.', 'The third editionof Antenna Theory is designed to meet the needs of electrical engineering and physics students at the senior undergraduate and beginning graduate levels, and those of practicing engineers. The text presumes that the students have knowledge of basic undergraduate electromagnetic theory, including Maxwellâ€™s equations and the wave equation, introductory physics, and differential and integral calculus. Mathematical techniques required for understanding some advanced topics in the later chapters are incorporated in the individual chapters or are included as appendices.', NULL, '4689742.JPG', '7310585.pdf', 1, 2005, 'Canada', 49, '2019-01-17 15:58:36', '2019-01-17 15:58:36', '203.190.11.115'),
(406, 39, 1, NULL, 1, 'Electric Circuits', 'electric-circuits', '9th', '13: 978-0-13-611499-4', NULL, 'Electric Circuits', 'The ninth edition of Electric Circuits represents a planned revision designed to incrementally improve this introductory circuits text used by more than 700,000 students worldwide during the past 28 years. While the book has evolved over the years to meet the changing learning styles of students, the fundamental goals of the text remain unchanged.These goals are: To build an understanding of concepts and ideas explicitly in terms of previous learning. Students arc constantly challenged by the need to layer new concepts on top of previous concepts they may still be struggling to master.This text provides an important focus on helping students understand how new concepts are related to and rely upon concepts previously presented. To emphasize the relationship between conceptual understanding and problem-solving approaches.', NULL, '9292371.JPG', '5921761.pdf', 1, 2011, 'New York', 52, '2019-01-17 16:11:28', '2019-01-17 16:11:28', '203.190.11.115'),
(407, 206, 1, NULL, 1, 'Bebop To The Boolean Booqie', 'bebop-to-the-boolean-booqie', '2nd', '0-7506-7543-8', NULL, 'Boolean Booqie', 'Bebop to the Boolean Boogie provides a wide-ranging but comprehensive\r\nintroduction to the electronics arena, roaming through the fundamental\r\nconcepts, and rampaging through electronic components and the processes\r\nused to create them. As a bonus, nuggets of trivia are included with which\r\nyou can amaze your family and friends; for example, Greenland Eskimos have\r\na base twenty number system because they count using both fingers and toes.', NULL, '1935510.JPG', '4983712.pdf', 1, 2003, 'New York', 48, '2019-01-17 16:13:12', '2019-01-17 16:13:12', '203.190.11.115'),
(408, 49, 1, NULL, 1, 'Antenna Design for Mobile Devices', 'antenna-design-for-mobile-devices', '1st ed.', '9780470824467', NULL, 'Antenna Matching, Matching with Lumped Elements, External Antenna, Internal Antenna,  Antenna Measurement.', 'I started my career as an antenna engineer in the mobile phone industry during the\r\nearly 2000s. Despite over 10 years of researching electromagnetic topics, I felt that I\r\nlacked a lot of important aspects of a good antenna engineer, and there was no book\r\navailable to provide all the necessary information. It took me several years to collect\r\nbits and pieces by learning from different sources. Since then, I have worked on both\r\nsides of the antenna business, as a vendor when I was with Amphenol Inc.; and then\r\nas a client when I was with Nokia Inc. and Apple Inc. My job also changed back and\r\nforth between antenna engineer and engineering manager. The experience gave me\r\nan opportunity to view antenna design from various angles.', NULL, '2851786.jpg', '3522975.pdf', 1, 2011, 'India', 49, '2019-01-17 16:15:59', '2019-01-17 16:15:59', '203.190.11.117'),
(409, 207, 1, NULL, 1, 'Electric Circuits Fundamentals', 'electric-circuits-fundamentals', NULL, '0-03-072307-8', NULL, 'Electric Circuits', 'This book is designed to save as a text for the first course or course sequence in circuits in an electrical engineering curriculum. The prereqâ€¢ uisites or corequisites are basic physics and cal-culus. Special topics such as differential equations and complex algebra are treated in the text as they wise. It can be used in a two-semester or a three-quarter course sequence. or in a single-semester course. The goal of the book is twofold: (a) to teach the foundations of electric deaths and (b) to develop a thinking style and a problem-solving methodology based on physical Insight. This approach is designed to benefit students not only in the rest of the curriculum, but also in the rapidly changing technology that they will face after graduation', NULL, '6511146.JPG', '5896213.pdf', 1, 1995, 'New York', 52, '2019-01-17 16:27:04', '2019-01-17 16:27:04', '203.190.11.115'),
(410, 74, 1, NULL, 1, 'Antenna engineering handbook', 'antenna-engineering-handbook-17281152', '4th ed.', NULL, NULL, 'Equivalence Principles, Hertzian and Fitzgerald Elementary Radiators, Electromagnetic Circuits, Source Distributions.', 'Antennas are key components of any wireless communication system.1,2 They are the\r\ndevices that allow for the transfer of a signal (in a wired system) to waves that, in turn,\r\npropagate through space and can be received by another antenna. The receiving antenna is responsible for the reciprocal process, i.e., that of turning an electromagnetic wave into a signal or voltage at its terminals that can subsequently be processed by the receiver. The receiving and transmitting functionalities of the antenna structure itself are fully characterized by Maxwellâ€™s equations and are fairly well understood.3 The dipole antenna (a straight wire, fed at the center by a two-wire transmission line) was the first antenna ever used and is also one of the best understood.1', NULL, '4786608.jpg', '4824300.pdf', 1, 2007, 'New York', 49, '2019-01-17 16:28:52', '2019-01-17 16:28:52', '203.190.11.117'),
(411, 208, 1, NULL, 1, 'Signal Processing Toolbox : use with MatLab', 'signal-processing-toolbox-use-with-matlab', NULL, NULL, NULL, 'Computation , Visualization , Programming', 'how to begin using MATLAB and the Signal Processing\r\nToolbox for your signal processing applications. It assumes a basic knowledge\r\nand understanding of signals and systems, including such topics as filter and\r\nlinear system theory and basic Fourier analysis.', NULL, '7677987.JPG', '3684097.pdf', 1, 1999, 'USA', 48, '2019-01-17 16:30:38', '2019-01-17 16:30:38', '203.190.11.117'),
(412, 209, 1, NULL, 1, 'Matrix Quantum Mechanics and Two-dimensional String Theory in Non-trivial Backgrounds', 'matrix-quantum-mechanics-and-two-dimensional-string-theory-in-non-trivial-backgrounds', NULL, NULL, NULL, 'Quantum Mechanics , Two-dimensional', 'Try to develop the matrix model description of 2D string theory in nontrivial backgrounds. Our research covers several possibilities to deform the initial simple\r\ntarget space. In particular, we analyze winding and tachyon perturbations.', NULL, '3752488.JPG', '4096980.pdf', 1, 2003, 'France', 48, '2019-01-17 16:44:00', '2019-01-17 16:44:00', '203.190.11.115'),
(413, 74, 1, NULL, 1, 'Broadband Crash Course', 'broadband-crash-course', NULL, '0-07-141476-2', NULL, 'BROADBAND CRASH , CRASH COURSE', 'Telecommunications has evolved into a highly complex\r\nseries of networks with names like Local Area Networks\r\n(LANs), Wide Area Networks (WANs), wireline, wireless, inband, out-of-band, narrowband, wideband, 2G, 3G, 4G, MultiFrequency, SS7, CCS7, and SS6, among others. However, the\r\nvarious network forms can be classified as either baseband or\r\nbroadband network types.', NULL, '4524737.JPG', '9708349.pdf', 1, 2002, 'New York', 48, '2019-01-17 17:01:17', '2019-01-17 17:02:08', '203.190.11.115'),
(414, 74, 1, NULL, 1, 'Deploying Optical Networking Components', 'deploying-optical-networking-components', NULL, '0-07-141469-X', NULL, 'Optical Networking , Networking', 'Focus on the various components of an optical\r\ntransmission system and how those components are used to support\r\nboth effective and efficient transmission via light. Because it is reasonable\r\nto expect readers to have both a diverse background and more than likely\r\ndifferent networking requirements.', NULL, '2253122.JPG', '1738780.pdf', 1, 2001, 'New York', 48, '2019-01-17 17:12:27', '2019-01-17 17:12:27', '203.190.11.115'),
(415, 210, 1, NULL, 1, 'Lecture Notes for EE 261 The Fourier Transform and its Applications', 'lecture-notes-for-ee-261-the-fourier-transform-and-its-applications', NULL, '978-1505614497', NULL, 'Fourier Transform, Fourier Applications', 'Lecture Notes for EE 261 The Fourier Transform and its Applications By Prof. Brad Osgood', NULL, '5003166.jpg', '9510856.pdf', 1, 2014, 'USA', 39, '2019-01-17 17:18:30', '2019-01-17 17:18:30', '203.190.10.206'),
(416, 211, 1, NULL, 1, 'Antennas for Information Super Skyways: An Exposition on Outdoor and Indoor Wireless Antennas', 'antennas-for-information-super-skyways-an-exposition-on-outdoor-and-indoor-wireless-antennas', NULL, '0863802672', NULL, 'Untied by Wires, Wireless Networks, Cellular Telephony, Mobile Systems, Wireless Communication.', 'As the world marches along the information superhighway ahead into the first\r\ndecade of the new century, the progress and pace of evolving telecommunications\r\nare seen incomprehensibly fast both in the wireline and wireless sectors. Specific\r\nto the panoramic realm of wireless telecommunications and networking (as\r\nconceived now and projected as future interests or â€œnext-generationsâ€) exists a\r\ngamut of standards. These include multiple applications of electrical\r\ncommunication technology spanning across voice, video, and data transmissions in\r\nan integrated fashion.', NULL, '4361331.jpg', '2406202.pdf', 1, 2003, 'England', 49, '2019-01-17 17:36:55', '2019-01-17 17:36:55', '203.190.11.115'),
(417, 62, 1, NULL, 1, 'Fourier and Laplace Transforms', 'fourier-and-laplace-transforms-17371228', NULL, '978-0-511-67312-2', NULL, 'Fourier, Laplace, Transforms', 'This book arose from the development of a course on Fourier and Laplace transformsfortheOpenUniversityoftheNetherlands.Originallyitwasthe intention to get a suitable course by revising part of the book Analysis and numerical analysis, part 3 in the series Mathematics for higher education by R. van Asselt et al. (in Dutch). However, the revision turned out to be so thorough that in fact a completely new book was created. We are grateful that Educaboek was willing to publish  the original Dutch edition of the book besides the existing series.', NULL, '7773968.JPG', '1316229.pdf', 1, 2003, 'USA', 39, '2019-01-17 17:37:28', '2019-01-17 17:37:28', '203.190.10.206'),
(418, 212, 1, NULL, 1, 'Fourier Series and Wavelets', 'fourier-series-and-wavelets', NULL, NULL, NULL, 'Fourier, Wavelets', NULL, NULL, '5629993.JPG', '3741447.pdf', 1, 1999, 'Peris', 39, '2019-01-17 17:49:24', '2019-01-17 17:49:24', '203.190.10.206'),
(419, 213, 1, NULL, 1, 'Antennas', 'antennas', '2nd ed.', '0070354227', NULL, 'Antenna Concepts, Point Source, Antenna and its Impedance.', 'Although there has been an explosion in antenna technology in the years since Antennas was published, the basic principles and theory remain unchanged My aim in this new edition is to blend a central core of basics from the first edition with a representative selection of important new developments and advances resulting in a much enlarged, updated book. It is appropriate that it is appearing just 100 years from the date on which the first antennas were invented by Hein-rich Hertz to whom, along with Guglielmo Marconi, this new edition is dedi-cated.', NULL, '6285569.jpg', '2037788.pdf', 1, 1997, 'New Delhi', 49, '2019-01-17 17:51:27', '2019-01-17 17:51:27', '203.190.11.115'),
(420, 214, 1, NULL, 1, 'Mechanics Of Materials', 'mechanics-of-materials', '6th', '0-13-191345-X', NULL, 'Mechanics , Materials', 'How to solve materials things using mechanically.', NULL, '2920105.JPG', '5263719.pdf', 1, 2005, 'new jersey', 48, '2019-01-17 17:52:59', '2019-01-17 17:52:59', '203.190.11.115'),
(421, 49, 1, NULL, 1, 'Antennas Theory and Practice', 'antennas-theory-and-practice', NULL, NULL, NULL, 'Radio communication, Maxwell\'s equations, Waves, Radiation, Directive radiation, Wave propagation.', 'This book is about antennas: about the physical principles underlying their behavior, the theory needed in sound antenna design and in planning meaningful experiments, the applications of theory to antennas in various frequency ranges. We have written it primarily for students and practitioners of radio engineering. But no specialized engineering background is required for understanding it, and the book should be intelligible to students of applied mathematics and physics and to mathematical consultants in industry. For them this book will illustrate the type of problems of interest to radio engineers, the nature of solutions sought by them, the ways in which applicable mathematics is actually put to work by practical men.', NULL, '1597485.jpg', '1250314.pdf', 1, 1952, 'New York', 49, '2019-01-17 18:10:31', '2019-01-17 18:10:31', '203.190.11.117'),
(422, 215, 1, NULL, 1, 'Mechanics Of Materials', 'mechanics-of-materials-17161352', NULL, '978-0073398235', NULL, 'Mechanics', 'This module outlines the basic mechanics of elastic response â€” a physical phenomenon that\r\nmaterials often (but do not always) exhibit. An elastic material is one that deforms immediately\r\nupon loading, maintains a constant deformation as long as the load is held constant, and returns\r\nimmediately to its original undeformed shape when the load is removed. This module will also\r\nintroduce two essential concepts in Mechanics of Materials: stress and strain.', NULL, '1794517.JPG', '5823450.pdf', 1, 2000, 'Cambridge', 48, '2019-01-17 18:16:52', '2019-01-17 18:16:52', '203.190.11.115'),
(423, 49, 1, NULL, 1, 'The Application of Programmable DSPs in Mobile Communications', 'the-application-of-programmable-dsps-in-mobile-communications', NULL, '0471486434', NULL, 'History of DSP Based Architectures in Second Generation Cellular Handsets, Role of Programmable DSPs in Dual Mode (2G and 3G) Handsets, Programmable DSPs for 3G Base Station Modems, Programmable DSPs in Antenna Array Processing.', 'This book is about two technologies that have had, and will increasingly have, a significant impact on the way we all live, learn and play: personal wireless communications and signal processing. When it comes to both markets, history has shown that reality has often surprised the most optimistic forecasters. We draw on the experience of experts from MIT, Berkeley, UCLA, Worcester Polytechnic Institute, INRIA, Authentec, Radioscape, Geovector and Texas Instruments, to give a description of some of the important building blocks and implementation choices that\r\ncombine both technologies, in the past and in the future. We highlight different perspectives, especially regarding implementation issues, in the processing of speech, audio, video, future multimedia and location-based services as well as mobile commerce and security aspects.', NULL, '5628023.jpg', '8617471.pdf', 1, 2002, 'New York', 49, '2019-01-17 18:33:24', '2019-01-17 18:33:24', '203.190.11.115'),
(424, 49, 1, NULL, 1, 'The Application of Programmable DSPs in Mobile Communications', 'the-application-of-programmable-dsps-in-mobile-communications-17351323', NULL, '0471486434', NULL, 'History of DSP Based Architectures in Second Generation Cellular Handsets, Role of Programmable DSPs in Dual Mode (2G and 3G) Handsets, Programmable DSPs for 3G Base Station Modems, Programmable DSPs in Antenna Array Processing.', 'This book is about two technologies that have had, and will increasingly have, a significant impact on the way we all live, learn and play: personal wireless communications and signal processing. When it comes to both markets, history has shown that reality has often surprised the most optimistic forecasters. We draw on the experience of experts from MIT, Berkeley, UCLA, Worcester Polytechnic Institute, INRIA, Authentec, Radioscape, Geovector and Texas Instruments, to give a description of some of the important building blocks and implementation choices that combine both technologies, in the past and in the future.', NULL, '4592087.jpg', '7875830.pdf', 1, 2002, 'New York', 49, '2019-01-17 18:35:23', '2019-01-17 18:35:23', '203.190.11.115'),
(425, 64, 1, NULL, 1, 'Understanding Cellular Radio', 'understanding-cellular-radio', NULL, '0-89006-994-8', NULL, 'Wireless Communications, Network Management', 'As I have increasingly moved away from the world of research and into\r\nthat of management and business, it has become apparent to me that there\r\nare many people from a nontechnical background who need to understand cellular systems in more detail in order to be able to perform their job, be it analyzing financial investments, running call centers, or marketing cellular services. The problem is that cellular and wireless local loop systems have become increasingly complex over the years and understanding these systems is becoming difficult even for engineers. Indeed, I doubt whether there is anyone in the world who can really claim to understand fully all the parts of the Global System for Mobile Communications', NULL, '9276512.jpg', '3942213.pdf', 1, 1998, 'London', 51, '2019-01-17 18:44:48', '2019-01-17 18:44:48', '203.190.11.117'),
(426, 216, 1, NULL, 1, 'Dictionary Of Engineering', 'dictionary-of-engineering', '2nd', '0-07-141050-3', NULL, 'Engineering ,', 'Alphabetized on a letter-by-letter basis; word spacing,\r\nhyphen, comma, solidus, and apostrophe in a term are ignored in the sequencing. For example, an ordering of terms.he basic format for a defining entry provides the term in boldface,\r\nthe field is small capitals, and the single definition in lightface.', NULL, '3935005.JPG', '5497405.pdf', 1, 2003, 'New York', 48, '2019-01-17 18:54:27', '2019-01-17 18:54:27', '203.190.11.117'),
(427, 10, 1, NULL, 1, 'Electromagnetic Theory for Microwaves and Optoelectronics', 'electromagnetic-theory-for-microwaves-and-optoelectronics', '2nd', '978-3-540-74295-', NULL, 'Microwaves and Optoelectronics', 'The purpose of this book is to give a unified formulation and analysis of\r\nthe electromagnetic problems in microwave and light-wave technologies and\r\nother wave systems. The book should enable readers to reach the position\r\nof being able to read the modern literature and to engage in theoretical\r\nresearch in electromagnetic theory without much difficulty. In this book, the\r\nbehavior and the characteristics of a large variety of electromagnetic waves,\r\nwhich relate to the problems in various different technological domains, are\r\nformulated. The purpose is to give the reader a wide scope of knowledge,\r\nrather than merely to confine them in a narrow domain of a specific field\r\nof research. The authors believe that the scope is just as important as the\r\ndepth of knowledge in training a creative scientist', NULL, '7051821.JPG', '5566427.pdf', 1, 2008, 'New York', 52, '2019-01-17 19:02:26', '2019-01-17 19:02:26', '203.190.11.115'),
(428, 217, 1, NULL, 1, 'Power transformers', 'power-transformers', '2nd ed.', NULL, NULL, 'Rating', 'The IEC (International Electrotechnical Commission) is a worldwide \r\n organization for standardization comprising all national electrotechnical committees (IEC National Committees). The object of the IEC is to promote\r\ninternational co-operation on all questions concerning standardization in the electrical and electronic fields. To this end and in addition to other activities, the IEC publishes International Standards. Their preparation is entrusted to technical committees; any IEC National Committee interested in the subject dealt with may participate in this preparatory work. International, governmental and non-governmental organizations liaising with the IEC also participate in this preparation. The IEC collaborates closely with the International Organization for Standardization (ISO) in accordance with conditions determined by agreement between the two organizations.', NULL, '9496618.JPG', '5399223.pdf', 1, 2000, 'Switzerland', 51, '2019-01-17 19:06:59', '2019-01-17 19:06:59', '203.190.11.117'),
(429, 103, 1, NULL, 1, 'Electronic Structure and Magneto-Optical Properties of Solids', 'electronic-structure-and-magneto-optical-properties-of-solids', NULL, '1-4020-1906-8', NULL, 'Optical Properties of Solids', 'The first ab initio calculation of MO properties was made by Callaway with\r\nco-workers in the middle of the 1970s [19, 20]. They calculated the absorption\r\nparts of the conductivity tensor elements Ïƒxx and Ïƒxy for pure Fe and Ni and\r\nobtained rather good agreement with experiment. The main problem afterward\r\nwas the evaluation of the complicated formulas involving MO matrix elements\r\nusing electronic states of the real FM system. With the tremendous increases\r\nin computational power and the concomitant progress in electronic structure\r\nmethods the calculation of such matrix elements became possible, if not routine. Subsequently many earlier, simplified calculations have been shown to\r\nbe inadequate,', NULL, '3102411.JPG', '1877489.pdf', 1, 2004, 'New York', 52, '2019-01-17 19:25:31', '2019-01-17 19:25:31', '203.190.11.117'),
(430, 175, 1, NULL, 1, 'Methods For Solving Inverse Problems In Mathematical Physics', 'methods-for-solving-inverse-problems-in-mathematical-physics', NULL, '0-8247-1987-5', NULL, 'Mathematical Physics', 'The influence of inverse problems of recovering mathematical physics\r\nequations, in which supplementary conditions help assign either the values\r\nof solutions for fixed values of some or other arguments or the values of certain functionals of a solution, began to spread to more and more branches\r\nas they gradually took on an important place in applied problems arising\r\nin \"real-life\" situations.', NULL, '6878096.JPG', '8632759.pdf', 1, 2000, 'New York', 48, '2019-01-17 19:39:57', '2019-01-17 19:39:57', '203.190.11.115');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(431, 218, 1, NULL, 1, 'High Performance Control', 'high-performance-control', NULL, '978-0817640040', NULL, 'Performance Control', 'The engineering objective of high performance control using the tools of optimal control theory, robust control theory, and adaptive control theory is more achieve able now than ever before, and the need has never been greater. Of course, when we use the term high performance control we are thinking of achieving this in the real world with all its complexity, uncertainty and variability. Since we do not expect to always achieve our desires, a more complete title for this book could be \"Towards High Performance Control\".', NULL, '3801065.jpg', '6697570.PDF', 1, 1997, 'Australia', 51, '2019-01-17 19:41:44', '2019-01-17 19:41:44', '203.190.11.117'),
(432, 219, 1, NULL, 1, 'HF Filter Design and Computer Simulation', 'hf-filter-design-and-computer-simulation', NULL, '1884932258', NULL, 'HF Filter Design, Computer Simulation', 'A book for engineers who design and build filters of all types, including lumped element, coaxial, helical, dielectric resonator, stripline and microstrip types. A thorough review of classic and modern filter design techniques, containing extensive practical design information of passband characteristics, topologies and transformations, component effects and matching. An excellent text for the design and construction of microstrip filters.', NULL, '1337755.jpg', '5299862.pdf', 1, 1994, 'U.S.A', 51, '2019-01-17 19:46:05', '2019-01-17 19:46:05', '203.190.11.115'),
(433, 49, 1, NULL, 1, 'The Mobile Radio Propagation Channel', 'the-mobile-radio-propagation-channel', '2nd ed.', '047198857X', NULL, 'Mobile Radio,', 'Thoroughly revised and updated, this second edition offers a fundamental and comprehensive treatment of how mobile systems operate in a variety of scenarios. This unrivalled approach concentrates on the properties of the radio channel, a vital and central feature that places fundamental limitations on the performance of radio systems. Bringing the reader completely up-to-date, this book:', NULL, '9589330.jpg', '8899631.pdf', 1, 2000, 'New York', 51, '2019-01-17 19:57:47', '2019-01-17 19:57:47', '203.190.11.115'),
(434, 194, 1, NULL, 1, 'Civil Engineering Formulas', 'civil-engineering-formulas', NULL, '0-07-135612-3', NULL, 'Civil Engineering', 'Where a formula may come from a regulatory code,or where a code exists for the particular work being\r\ndone, be certain to check the latest edition of the applicable code to see that the given formula agrees with the\r\ncode formula. If it does not agree, be certain to use the latest code formula available. Remember, as a design\r\nengineer you are responsible for the structures you plan, design, and build.', NULL, '2579809.JPG', '1755577.pdf', 1, 2002, 'New York', 48, '2019-01-17 20:15:57', '2019-01-17 20:15:57', '203.190.11.115'),
(435, 49, 1, NULL, 1, 'Applied Optimal Designs', 'applied-optimal-designs', NULL, '0470856971', NULL, 'Optimal Design in Educational Testing, Optimal On-line Calibration of Testlets, Designing Optimal Two-stage Epidemiological Studies, Response-Driven Designs in Drug Development, Optimal Design of Blocked Experiments in\r\nIndustry.', 'Formal job testing of individuals goes back more than 3000 years, while formal\r\nwritten tests in education go back some 500 years. Although the earliest paper on\r\noptimal design in statistics appeared at about the same time as multiple choice tests\r\nappeared, at the beginning of the twentieth century, optimal design theory was first\r\napplied to issues arising in standardized testing 40 years ago.', NULL, '3192438.jpg', '8429731.pdf', 1, 2005, 'England', 49, '2019-01-17 20:19:31', '2019-01-17 20:19:31', '203.190.11.117'),
(436, 220, 1, NULL, 1, 'Microelectronics Circuits', 'microelectronics-circuits', '2nd', '978-0-495-66772-8', NULL, 'circuits', 'The pedagogical approach of the first edition has been enhanced and augmented in this edition. Mathematical derivations are kept to a minimum by using approximate circuit models of operational amplifiers,\r\ntransistors, and diodes. The significance of these approximations is established by computer-aided analysis using PSpice. Important circuits are analyzed in worked-out examples in order to introduce the basic\r\ntechniques and emphasize the effects of parameter variations. At the end of each chapter, review questions\r\nand problems test studentsâ€™ learning of the concepts developed.', NULL, '/tmp/phpzERg4Y', '6049421.pdf', 1, 2011, 'USA', 48, '2019-01-17 20:30:14', '2019-01-17 21:10:56', '203.190.11.115'),
(437, 150, 1, NULL, 1, 'Computer-Aided Design of Electrical Machines', 'computer-aided-design-of-electrical-machines-17321524', NULL, '978-81-7800-146-3', NULL, NULL, 'A design problem has to be fonnulated considering the various constraints, processes,\r\navailability of materials, quality aspects. cost aspects etc. Constraints can be from\r\ntechnical, cost or availability aspects. Technical constraints can be from calculation\r\nmethods, available process systems, skilled labour, manufacturing facilities, machinery,\r\nor tools etc.', NULL, '5171811.jpg', '2405607.pdf', 1, 2008, 'New York', 40, '2019-01-17 20:32:24', '2019-01-17 20:32:24', '203.190.11.115'),
(438, 221, 1, NULL, 1, 'Microcontroller Theory And Applications With The PIC18F', 'microcontroller-theory-and-applications-with-the-pic18f', '1st', '978-0470-94769-2', NULL, 'Microcontroller', 'Adequate coverage of I/O and interfacing using C is included.Since C language programming is prerequisite for this course on microcontrollers ,coverage of I/O and interfacing using C would suffice. A basic coverage of assembly\r\nlanguage programming using a typical microcontroller such as the PIC18F is provided.', NULL, '6722992.JPG', '9703625.pdf', 1, 2011, 'new jersey', 48, '2019-01-17 20:37:55', '2019-01-17 20:37:55', '203.190.11.115'),
(439, 44, 1, NULL, 1, 'Applied Optimal Control Optimization, Estimation, and Control', 'applied-optimal-control-optimization-estimation-and-control', NULL, '100891162283', NULL, 'Parameter optimization problems , Problems without constraints Problems with equality constraints; necessary conditions for a stationary point, Problems with equality constraints; sufficient conditions for a local minimum, Neighborin', 'This text is intended for use at the senior-graduate level for uni-versity courses on the analysis and design of dynamic systems and for independent study by engineers and applied mathematicians. An elementary knowledge of mechanics and ordinary differential equations is presumed. Some acquaintance with matrix algebra and the properties of linear systems is desirable, but the required fa-miliarity can be obtained by studying the two appendices. The book grew out of a set of lecture notes for a Harvard University summer school program on optimization of dynamic systems given in 1963. These notes were rewritten and extended for graduate courses given at Harvard from 1963 to 1968 and at M.I.T. in 1966.', NULL, '9054075.jpg', '3582239.pdf', 1, 1975, 'New York', 49, '2019-01-17 20:39:09', '2019-01-17 20:39:09', '203.190.11.117'),
(440, 49, 1, NULL, 1, 'Applied Optimal Designs', 'applied-optimal-designs-17481549', NULL, '0470856971', NULL, 'Optimal Design in Educational Testing, Optimal On-line Calibration of Testlets, Empirical Relevance of Optimal Designs for the Measurement of Preferences, Designing Optimal Two-stage Epidemiological Studies, Response-Driven Designs in Drug Developmen', 'Formal job testing of individuals goes back more than 3000 years, while formal\r\nwritten tests in education go back some 500 years. Although the earliest paper on\r\noptimal design in statistics appeared at about the same time as multiple choice tests\r\nappeared, at the beginning of the twentieth century, optimal design theory was first\r\napplied to issues arising in standardized testing 40 years ago.', NULL, '5754018.jpg', '7318318.pdf', 1, 2005, 'New York', 49, '2019-01-17 20:48:49', '2019-01-17 20:48:49', '203.190.11.115'),
(441, 12, 1, NULL, 1, 'Measurement, Instrumentation, and Sensors Handbook', 'measurement-instrumentation-and-sensors-handbook', NULL, '084932145X', NULL, 'Measurement, Instrumentation, and Sensors Handbook', 'This new edition of the bestselling Measurement, Instrumentation, and Sensors Handbook brings together all aspects of the design and implementation of measurement, instrumentation, and sensors. Reflecting the current state of the art, it describes the use of instruments and techniques for performing practical measurements in engineering, physics, chemistry, and the life sciences; explains sensors and the associated hardware and software; and discusses processing systems, automatic data acquisition, reduction and analysis, operation characteristics,', NULL, '1486908.jpg', '1522399.pdf', 1, 1999, 'U.K.', 51, '2019-01-17 21:04:40', '2019-01-17 21:04:40', '203.190.11.117'),
(442, 49, 1, NULL, 1, 'Mobile telecommunications protocols for data networks', 'mobile-telecommunications-protocols-for-data-networks', NULL, '978-0470850565', NULL, 'Mobile Telecommunications, Data Networks', 'Mobile users are demanding fast and efficient ubiquitous connectivity porting data applications. This connectivity has to be provided by various different networks and protocols which guarantee that mobile networks function efficiently, performing routing and handoff for mobile users.', NULL, '5518758.jpg', '9071293.pdf', 1, 2003, 'West Sussex', 51, '2019-01-17 21:12:39', '2019-01-17 21:12:39', '203.190.11.115'),
(443, 222, 1, NULL, 1, 'Automated Fingerprint Identification Systems (AFIS)', 'automated-fingerprint-identification-systems-afis-17131635', NULL, '0124183514', NULL, 'History Of Automated Fingerprint Identification System, Fingerprints Are Unique\r\nAfis Summaryâ€”How The System Works, From Print To Identification, Current Issues\r\nBuying An Afis System: The Basic Documents Needed', 'There is a world in which every crime is solved in 60 minutes, DNA matches\r\nare made â€œWhile U Wait,â€ and staff work on only one case at a time. But it is a\r\nfantasy land, an imaginary land; it is not the real world. This book is about the\r\nreal world of biometric identification technology. It is a fascinating topic. This\r\ntechnology can confirm the identity of an individual in a split second; it can\r\nalso reach back in time to place a suspect at the scene of a crime that occurred\r\nyears ago.', NULL, '8945343.jpg', '9721827.pdf', 1, 2005, 'New York', 49, '2019-01-17 21:13:35', '2019-01-17 21:13:35', '203.190.11.115'),
(444, 152, 1, NULL, 1, 'Electric Relays: Principles and Applications', 'electric-relays-principles-and-applications', '1st ed.', '0-8493-4188-4 (Hardcover)', NULL, NULL, 'Electric relays pervade the electronics that dominate our world. They exist in many forms, fulfill many roles, and each have their own behavioral nuances and peculiarities. To date, there exists no comprehensive reference surveying the broad spectrum of electric relays, save one-Electric Relays', NULL, '7919993.jpg', '6810999.pdf', 1, 2006, 'New York', 40, '2019-01-17 21:14:59', '2019-01-17 21:14:59', '203.190.11.117'),
(445, 64, 1, NULL, 1, 'Lumped Elements for RF and Microwave Circuits', 'lumped-elements-for-rf-and-microwave-circuits', NULL, '1-58053-309-4', NULL, 'Wire Inductors, Monolithic Capacitors, Via Holes.', 'During the last decade, stimulated by unprecedented growth in the wireless\r\ncommunication application, outstanding progress has been made in the development of low-cost solutions for front-end RF and microwave systems. Lumped elements such as inductors, capacitors, and resistors have played a vital role in the development of such low-cost circuits. Numerous articles on the subject of lumped elements are scattered in a wide array of technical journals and conference proceedings; however, no comprehensive text dedicated to this topic exists. There is an urgent need for a book on this subject to fill the void.', NULL, '3513816.JPG', '2006809.pdf', 1, 2003, 'London', 51, '2019-01-17 21:18:43', '2019-01-17 21:18:43', '203.190.11.115'),
(446, 74, 1, NULL, 1, 'Handbook of Small Electric Motors', 'handbook-of-small-electric-motors', '1st ed.', '0-07-072332-X.', NULL, NULL, 'Get up to speed on the latest design and manufacturing tools and techniques with this expert guide from leaders of the motor industry. A superb source of innovative, productivity, and profit-increasing solutions, HANDBOOK OF SMALL ELECTRIC MOTORS gives you more help with selection, calculation, assembly methods, and on-the-spot data than you can find anywhere else.', NULL, '1756847.jpg', '3292246.pdf', 1, 2003, 'New York', 40, '2019-01-17 21:25:31', '2019-01-17 21:25:31', '203.190.11.115'),
(447, 95, 1, NULL, 1, 'Microelectronic Circuits', 'microelectronic-circuits-17261645', '5th', '0-19-514252-7', NULL, 'Microelectronic , Circuits', 'To understand the physical operation of the diode, and indeed of\r\nthe MOSFE T and the BJT, a concise but substantial introduction to semiconductors and the\r\ninjunctio n is provided. This material is placed near the end of the chapter (Section 3.7) so that\r\npart or all of it can be skipped by those who have already had a course in physical electronics.', NULL, '4871470.JPG', '3017020.pdf', 1, 2004, 'New York', 48, '2019-01-17 21:26:45', '2019-01-17 21:26:45', '203.190.11.117'),
(448, 30, 1, NULL, 1, 'Multi-Carrier and Spread Spectrum Systems', 'multi-carrier-and-spread-spectrum-systems', NULL, '0-470-84899-5', NULL, 'MC-CDMA,  MC-DS-CDMA, Hybrid Multiple Access Schemes', 'This book discusses multi-carrier modulation and spread spectrum techniques, recognized as the most promising candidate modulation methods for the 4th generation (4G) of mobile communications systems. The authors of this book were the first to propose MCCDMA for the next generation of mobile communications, and are still continuing their\r\ncontribution towards beyond 3G. Considering the requirements of 4G systems, multicarrier and spread spectrum systems appear to be the most suitable as they provide higher flexibility, higher transmission rates and frequency usage efficiency. This is the first book on these methods, providing the reader with the fundamentals of the technologies involved\r\nand the related applications.', NULL, '7812380.JPG', '4565391.pdf', 1, 2003, 'West Sussex', 51, '2019-01-17 21:27:07', '2019-01-17 21:27:07', '203.190.11.115'),
(449, 30, 1, NULL, 1, 'An Introduction to Parametric Digital Filters and Oscillators', 'an-introduction-to-parametric-digital-filters-and-oscillators', NULL, '0-470-85104-X', NULL, 'Digital Parametric Oscillators', 'Digital signal processing (DSP) does not require any special advertisements. Since the 1960s, it has become one of the most intensive fields of study in electronics-related science, and since the 1980s, owing to the extensive progress in integrated circuits technology, it has been an inseparable part of modern electronic systems. However, among the numerous DSP publications on algorithms, approaches, technical solutions, and so on, there is apparently no book on library shelves that is dedicated to linear non-adaptive time-variant digital filters. The lack of such a book is a deterrent to developing much broader engineering applications of these systems.', NULL, '3720190.JPG', '7935368.pdf', 1, 2003, 'West Sussex', 51, '2019-01-17 21:34:08', '2019-01-17 21:34:08', '203.190.11.117'),
(450, 49, 1, NULL, 1, 'Power System Protection', 'power-system-protection', '1st ed.', '0-7803-3427-2', NULL, NULL, 'In a world of huge, interconnected networks that can be completely blacked out by disturbances, POWER SYSTEM PROTECTION offers you an improved understanding of the requirements necessary for prompt and accurate corrective action.', NULL, '4756369.jpg', '3079272.pdf', 1, 1999, 'Canada', 40, '2019-01-17 21:35:12', '2019-01-17 21:35:12', '203.190.11.117'),
(451, 223, 1, NULL, 1, 'Fundamentals Of Collection Development And Management', 'fundamentals-of-collection-development-and-management', '2nd', '978-0-8389-0972-0', NULL, 'Fundamentals , Development And Management', 'This book is intended for those with little experience in collection development and managementâ€”students preparing to enter the field of librarianship\r\nand experienced librarians with new or expanded responsibilities. I hope that the\r\ncombination of history, theory, current thinking, and practical advice also will\r\nbe of interest to seasoned selectors, who may value a work that aims to present a\r\ncontemporary perspective on important issues.', NULL, '8860795.JPG', '5985582.pdf', 1, 2009, 'Chicago', 48, '2019-01-17 21:42:31', '2019-01-17 21:42:31', '203.190.11.117'),
(452, 125, 1, NULL, 1, 'Neural Systems for Control', 'neural-systems-for-control', NULL, '978-0471086314', NULL, 'Neural Systems', 'Control problems offer an industrially important application and a guide to understanding control systems for those working in Neural Networks. Neural Systems for Control represents the most up-to-date developments in the rapidly growing aplication area of neural networks and focuses on research in natural and artifical neural systems directly applicable to control or making use of modern control theory. The book covers such important new developments in control systems such as intelligent sensors in semiconductor wafer manufacturing; the relation between muscles', NULL, '5374902.jpg', '6554818.pdf', 1, 1997, 'U.S.A', 51, '2019-01-17 21:55:25', '2019-01-17 21:55:25', '203.190.11.117'),
(453, 12, 1, NULL, 1, 'Power Systems (The Electric Power Engineering Handbook)', 'power-systems-the-electric-power-engineering-handbook', '2nd ed.', '0-8493-9288-8 (Hardcover)', NULL, NULL, 'In many engineering situations, it is useful to scale or normalize quantities. This is commonly done in\r\npower system analysis, and the standard method used is referred to as the per-unit system. Historically,\r\nthis was done to simplify numerical calculations that were made by hand. Although this advantage has\r\nbeen eliminated by using the computer, other advantages remain', NULL, '8407312.jpg', '1500834.pdf', 1, 2006, 'New York', 40, '2019-01-17 21:59:17', '2019-01-17 21:59:17', '203.190.11.115'),
(454, 95, 1, NULL, 1, 'Microelectronic Circuits', 'microelectronic-circuits-17001758', '5th', '978-0195142518', NULL, 'Circuits , Microelectronic', 'Three-terminal devices are far more useful than two-terminal ones, such as the diodes\r\nstudied in Chapter 3, because they can be used in a multitude of applications, ranging from\r\nsignal amplification to the design of digital logic and memory circuits. The basic principle\r\ninvolved is the use of the voltage between two terminals to control the current flowing in the\r\nthird terminal.', NULL, '5862212.JPG', '4013113.pdf', 1, 2003, 'USA', 48, '2019-01-17 22:00:58', '2019-01-17 22:00:58', '203.190.11.117'),
(455, 64, 1, NULL, 1, 'Introduction to RF Equipment and System Design', 'introduction-to-rf-equipment-and-system-design', NULL, '1-58053-665-4', NULL, 'Antennas and Associated Hardware, RF Measuring Instrumentation.', 'Every year, tens of thousands of young engineers and university graduates enter the fascinating professional field of radio frequency (RF) design. Most of them have a reasonable understanding of applied mathematics and physics, circuit theory, electromagnetism, and electronics as well as computers and programming. Despite the comprehensive courses and overwhelming educational literature, however, many of these talented young people have to face the crude practical project environment of systems and equipment without much prior knowledge of, or tutorials about, how and why things are done the way they are done. I was once in that situation.', NULL, '/tmp/php63Kt1l', '4406784.pdf', 1, 2004, 'London', 51, '2019-01-17 22:02:29', '2019-01-17 22:03:19', '203.190.11.117'),
(456, 12, 1, NULL, 1, 'AC Power Systems Handbook', 'ac-power-systems-handbook-17061717', '3rd ed.', '0-8493-4034-9 (Hardcover)', NULL, NULL, 'Sooner or later, power system protection is going to cost money. How much is entirely up to you. Setting up a safe and effective AC power system from the very beginning can help avoid costly downtime and repairs, provide backup power during system outages, and minimize workplace accidents. For the past 15 years, Jerry Whitaker\'s AC Power Systems Handbook has supplied industry professionals with a comprehensive, practical guide to the key elements of AC power for commercial and industrial systems.', NULL, '3220121.jpg', '9030894.pdf', 1, 2007, 'New York', 40, '2019-01-17 22:06:17', '2019-01-17 22:06:17', '203.190.11.115'),
(457, 224, 1, NULL, 1, 'IP Network Design Guide', 'ip-network-design-guide', NULL, '978-0738413365', NULL, 'IP Routing and Design, Remote Access.', 'This redbook identifies some of the basic design aspects of IP networks and\r\nexplains how to deal with them when implementing new IP networks or\r\nredesigning existing IP networks. This project focuses on internetwork and\r\ntransport layer issues such as address and name management, routing, network management, security, load balancing and performance, design impacts of the underlying networking hardware, remote access, quality of service, and platform-specific issues. Application design aspects, such as e-mail, gateways, Web integration, etc., are discussed briefly where they influence the design of an IP network.', NULL, '5780920.JPG', '3836492.pdf', 1, 1999, 'U.S.A', 51, '2019-01-17 22:14:54', '2019-01-17 22:14:54', '203.190.11.118'),
(458, 91, 1, NULL, 1, 'The Electrical Engineering Handbook', 'the-electrical-engineering-handbook', '1st ed.', '0-12-170960-4', NULL, NULL, 'The Electrical Engineer\'s Handbook is an invaluable reference source for all practicing electrical engineers and students. Encompassing 79 chapters, this book is intended to enlighten and refresh knowledge of the practicing engineer or to help educate engineering students. This text will most likely be the engineerâ€™s first choice in looking for a solution; extensive, complete references to other sources are provided throughout.', NULL, '2648929.jpg', '9983012.pdf', 1, 2004, 'London', 40, '2019-01-17 22:19:42', '2019-01-17 22:19:42', '203.190.11.118'),
(459, 225, 1, NULL, 1, 'Microwave Engineering Using Microwave Circuits', 'microwave-engineering-using-microwave-circuits', NULL, '0724809155', NULL, 'Microwave Engineering', 'This book presents a grounding in microstrip circuits and seeks to develop reader\'s knowledge from basic transmission theory to microwave sub-systems. Simple proofs are provided while maintaining an emphasis on the physical point of view. Worked examples, data and design curves, end-of-chapter problems and selected references are included throughout.', NULL, '1403351.jpg', '1733679.pdf', 1, 1990, 'New York', 51, '2019-01-17 22:23:58', '2019-01-17 22:23:58', '203.190.11.118'),
(460, 72, 1, NULL, 1, 'Power Electronic Control in Electrical System', 'power-electronic-control-in-electrical-system', NULL, '0750651261', NULL, NULL, NULL, NULL, '5471719.jpg', '9504460.pdf', 1, 2002, 'New Delhi', 40, '2019-01-17 22:34:52', '2019-01-17 22:34:52', '203.190.11.118'),
(461, 12, 1, NULL, 1, 'Networks and Devices Using Planar Transmission Lines', 'networks-and-devices-using-planar-transmission-lines', NULL, '978-0849318351', NULL, 'Networks, Devices Using Planar Transmission Lines', 'This book has one objective: to join in one text all the practical information and physical principles that permit a planar transmission line device to work properly. The eight appendices have been written with the aim of helping the reader review the theoretical concepts in the 11 chapters. This book is intended for microwave engineers studying the design of microwave and radio frequency planar transmission line passive devices in industry, as well as for students in microwave and RF disciplines. More than 500 up-to-date references make this book a collection of the most recent studies on planar transmission line  evices, a characteristic that also makes this book attractive to researchers.', NULL, '5408950.jpg', '1285773.pdf', 1, 2000, 'U.S.A', 51, '2019-01-17 22:35:04', '2019-01-17 22:35:04', '203.190.11.118'),
(462, 12, 1, NULL, 1, 'Advanced Signal Processing Handbook: Theory and Implementation for Radar, Sonar, and Medical Imaging Real Time Systems', 'advanced-signal-processing-handbook-theory-and-implementation-for-radar-sonar-and-medical-imaging-real-time-systems', '1st ed.', '0-8493-3691-0', NULL, NULL, 'Advances in digital signal processing algorithms and computer technology have combined to produce real-time systems with capabilities far beyond those of just few years ago. Nonlinear, adaptive methods for signal processing have emerged to provide better array gain performance, however, they lack the robustness of conventional algorithms.', NULL, '4877395.jpg', '9991761.pdf', 1, 2000, 'New York', 40, '2019-01-18 00:00:36', '2019-01-18 00:00:36', '203.190.11.118'),
(463, 125, 1, NULL, 1, 'Multiresolution Signal Decomposition: Transforms, Subbands, and Wavelets', 'multiresolution-signal-decomposition-transforms-subbands-and-wavelets', '2nd ed.', '0-12-047141-8', NULL, NULL, 'The uniqueness of this book is that it covers such important aspects of modern signal processing as block transforms from subband filter banks and wavelet transforms from a common unifying standpoint, thus demonstrating the commonality among these decomposition techniques.', NULL, '8710118.jpg', '8940996.pdf', 1, 2001, 'New York', 40, '2019-01-18 00:12:39', '2019-01-18 00:12:39', '203.190.11.118'),
(464, 220, 1, NULL, 1, 'Alternating Current Fundamentals', 'alternating-current-fundamentals', '8th ed.', '978-1-111-12527-1 1-111-12527-9', NULL, NULL, 'ALTERNATING CURRENT FUNDAMENTALS, 8E, an industrial standard for over thirty years, has been updated to provide readers with the most current information available on the essentials of alternating current. The topics in this book are arranged to build readers\' knowledge, progressing from basic principles such as the differences between peak, rms, and average values to more complex coverage of circuits containing resistance, inductance, and capacitance.', NULL, '9492884.jpg', '3359468.pdf', 1, 2011, 'New York', 40, '2019-01-18 00:23:23', '2019-01-18 00:23:23', '203.190.11.118'),
(465, 226, 1, NULL, 1, 'Electrical and Electronics Engineering', 'electrical-and-electronics-engineering', '1st ed.', '9788184316971', NULL, 'Electrical, Electronics.', 'In practice, the electrical circuits may consist of one or more sources of energy and number of energy  and number of electrical parameters, connected in different ways. The different electrical parameters or elements are resistors, capacitors and inductors.', NULL, '6532051.JPG', '7982456.pdf', 1, 2009, NULL, 47, '2019-01-18 00:35:38', '2019-01-18 00:35:38', '203.190.11.118'),
