(468, 49, 1, NULL, 1, 'Mobile ad hoc networking', 'mobile-ad-hoc-networking', NULL, '0-471-37313-3', NULL, 'Mobile, Hoc networking', 'Whereas todayâ€™s expensive wireless infrastructure depends on centrally deployed hub-andspoke networks, mobile ad hoc networks consist of devices that are autonomously selforganizing in networks. In ad hoc networks, the devices themselves are the network, and this allows seamless communication, at low cost, in a self-organized fashion and with easy\r\ndeployment. The large degree of freedom and the self-organizing  apabilities make mobile ad hoc networks completely different from any other networking solution. For the first time, users have the opportunity to create their own network, which can be deployed easily and cheaply. However, a price for all those features is paid in terms of complex technology solutions, which are needed at all layers and also across several layers.', NULL, '7512506.JPG', '3497437.pdf', 1, 2004, 'New Jersey', 51, '2019-01-18 01:04:48', '2019-01-18 01:04:48', '203.190.11.118'),
(469, 227, 1, NULL, 1, 'Bandwidth-Efficient Digital Modulation with Application to Deep-Space Communications', 'bandwidth-efficient-digital-modulation-with-application-to-deep-space-communications', '1st ed.', '978-0471445364', NULL, 'Modulation, Bandwidth, Deep-Space Communications,', 'An important look at bandwidth-efficient modulations with applications to today\'s Space program\r\nBased on research and results obtained at the California Institute of Technology\'s Jet Propulsion Laboratory, this timely book defines, describes, and then delineates the performance (power and bandwidth) of digital communication systems that incorporate a wide variety of bandwidth-efficient modulations appropriate for the design and implementation of space communications systems.', NULL, '6671162.JPG', '2195360.pdf', 1, 2003, NULL, 47, '2019-01-18 01:13:01', '2019-01-18 01:13:01', '203.190.11.118'),
(470, 91, 1, NULL, 1, 'Analog and Digital Circuits for Electronic Control System Applications: Using the TI MSP430 Microcontroller', 'analog-and-digital-circuits-for-electronic-control-system-applications-using-the-ti-msp430-microcontroller', NULL, '0-7506-7810-0', NULL, NULL, 'Todayâ€™s control system designers face an ever-increasing â€œneed for speedÂ” and accuracy in their system measurements and computations. New design approaches using microcontrollers and DSP are emerging, and designers must understand these new approaches, the tools available, and how best to apply them.', NULL, '7434503.jpg', '7799487.pdf', 1, 2005, 'New York', 40, '2019-01-18 01:24:04', '2019-01-18 01:24:04', '203.190.11.118'),
(471, 118, 1, NULL, 1, 'Basic Electrical Engineering', 'basic-electrical-engineering', NULL, '978-0-07-014100-1', NULL, 'Electrical, Basic Electrical.', 'The book is meant to be used by students who have just passed 10+2, who lack the knowledge of higher mathematics. It uses derivatives at some places and integrals scantly. Simple algebra, vector algebra, complex number algebra and matrices are extensively used with detailed explanations.', NULL, '2082037.JPG', '3155561.pdf', 1, 2009, 'New Delhi', 47, '2019-01-18 01:31:47', '2019-01-18 01:31:47', '203.190.11.118'),
(472, 49, 1, NULL, 1, 'Antenna Theory: Analysis and Design', 'antenna-theory-analysis-and-design-17332004', '2nd ed.', '0471592684', NULL, NULL, 'The Latest Resource for the Study of Antenna Theory! In a discipline that has experienced vast technological changes, this text offers the most recent look at all the necessary topics. Highlights include:\r\n* New coverage of microstrip antennas provides information essential to a wide variety of practical designs of rectangular and circular patches, including computer programs.', NULL, '7771596.jpg', '2858064.pdf', 1, 1982, 'New Delhi', 40, '2019-01-18 01:33:04', '2019-01-18 01:33:04', '203.190.11.118'),
(473, 64, 1, NULL, 1, 'Introduction to 3G Mobile Communications', 'introduction-to-3g-mobile-communications', '2nd ed.', '1-58053-507-0', NULL, 'Principles of CDMA, WCDMA Air Interface', 'The third generation (3G) mobile communication system is the next big thing\r\nin the world of mobile telecommunications. The first generation included\r\nanalog mobile phones [e.g., Total Access Communications Systems\r\n(TACS), Nordic Mobile Telephone (NMT), and Advanced Mobile Phone\r\nService (AMPS)], and the second generation (2G) included digital mobile\r\nphones [e.g., global system for mobile communications (GSM), personal\r\ndigital cellular (PDC), and digital AMPS (D-AMPS)]. The 3G will bring\r\ndigital multimedia handsets with high data transmission rates, capable of\r\nproviding much more than basic voice calls.', NULL, '8243890.JPG', '8037422.pdf', 1, 2003, 'London', 51, '2019-01-18 01:35:49', '2019-01-18 01:35:49', '203.190.11.118'),
(474, 228, 1, NULL, 1, 'Basic Electronic Components & Hardware-1', 'basic-electronic-components-hardware-1', '1st ed.', NULL, NULL, 'Basic Electronic, Components, Hardware.', 'This book has substantial amount of new material that has been added to reflect change in technology and curricula. This book helps where you need it, offering useful and practical suggestions. Each chapter is short in length, so that the student is not burdened by the amount of material presented.', NULL, '4978008.JPG', '2587666.pdf', 1, 1999, 'New Delhi', 47, '2019-01-18 01:56:53', '2019-01-18 01:56:53', '203.190.11.118'),
(475, 170, 1, NULL, 1, 'Microsoft Visual Basic 2010', 'microsoft-visual-basic-2010-19200939', NULL, NULL, NULL, 'Visual, Basic, Microsoft', 'Microsoft Visual Basic 2010 is an important upgrade and enhancement of the popular Visual\r\nBasic programming language and compiler, a technology that enjoys an installed base of\r\nmillions of programmers worldwide. Visual Basic 2010 is not a stand-alone product but\r\na key component of Microsoft Visual Studio 2010â€”a comprehensive development system\r\nthat allows you to create powerful applications for Windows, the Web, handheld devices,\r\nand a host of other environments. Whether you purchase one of the commercial editions of\r\nVisual Studio 2010 (described later in this Introduction) or you download Visual Basic 2010\r\nExpress for a free test-drive of the software, you are in for an exciting experience.', NULL, '2630878.PNG', '3610610.pdf', 1, 2010, 'New York', 46, '2019-01-19 14:20:39', '2019-01-19 14:20:39', '203.190.11.118'),
(476, 229, 1, NULL, 1, 'An Introduction to: Mixed -Signal I C Test and Measurement', 'an-introduction-to-mixed-signal-i-c-test-and-measurement', NULL, '0-19-514016-8', NULL, 'Integrated, circuits,Testing, Mixed, signal, circuits,Testing,', 'Integrated circuits incorporating both digital and analog functions have become increasingly\r\nprevalent in the semiconductor industry. Complex digital circuits are now commonly combined\r\nwith analog circuits as part of the continuing drive toward higher levels of electronic system\r\nintegration. For example, complex microprocessors are frequently combined with highperformance analog and mixed-signal circuits to form so-called \"system-on-a-chip\" devices. An\r\nexample of this is a single chip modem combining a digital signal processor with precision\r\nanalog-to-digital and digital-to-analog functions on a single silicon die. Such devices offer the\r\nsemiconductor customer significant savings in manufacturing costs due to the resulting reduction\r\nof chip-to-chip interconnections.', NULL, '6673493.PNG', '6140445.pdf', 1, 2001, 'New York', 46, '2019-01-19 14:30:11', '2019-01-19 14:30:11', '203.190.11.118'),
(477, 49, 1, NULL, 1, 'Applied Statistics and Probability for Engineers', 'applied-statistics-and-probability-for-engineers', '5th ed.', '978-0-470-05304-1', NULL, 'Statistics, Probability, Engineers', 'This is an introductory textbook for a first course in applied statistics and probability for undergraduate\r\nstudents in engineering and the physical or chemical sciences. These individuals play a significant role in\r\ndesigning and developing new products and manufacturing systems and processes, and they also improve\r\nexisting systems. Statistical methods are an important tool in these activities because they provide the engineer with both descriptive and analytical methods for dealing with the variability in observed data.\r\nAlthough many of the methods we present are fundamental to statistical analysis in other disciplines, such\r\nas business and management, the life sciences, and the social sciences, we have elected to focus on an\r\nengineering-oriented audience.', NULL, '1368117.PNG', '7999153.pdf', 1, 2011, 'New York', 46, '2019-01-19 14:36:09', '2019-01-19 14:36:09', '203.190.11.118'),
(478, 84, 1, NULL, 1, 'NONVOLATILE MEMORY TECHNOLOGIES WITH EMPHASIS ON FLASH: A Comprehensive Guide to Understanding and Using NVM Devices', 'nonvolatile-memory-technologies-with-emphasis-on-flash-a-comprehensive-guide-to-understanding-and-using-nvm-devices', NULL, '978-0471-77002-2', NULL, 'TECHNOLOGIES, EMPHASIS, MEMORY,  FLASH:', 'Nonvolatile Memory Technologies with Emphasis on Flash (NMT) was written to\r\nprovide a detailed view of the integrated circuit main - line technologies that are\r\ncurrently in mass production. It also gives an introduction to technologies that have\r\nless manufacturing exposure, and it presents a description of various possible alternative technologies that may emerge in the future. All variations of Flash technology\r\nare treated. This includes Flash memory chips, Flash embedded in logic, binary cell\r\nFlash, and multilevel cell Flash. The scope of treatment includes basic device structures and physics, principles of operation, related process technologies, circuit design,\r\noverall design trade - offs, reliability, and applications.', NULL, '9319250.PNG', '1649806.pdf', 1, 2008, 'New York', 46, '2019-01-19 15:43:22', '2019-01-19 15:43:22', '203.190.11.115'),
(479, 72, 1, NULL, 1, 'Programmable Controllers An engineerâ€™s guide', 'programmable-controllers-an-engineers-guide', '3rd ed.', '0 7506 5757 X', NULL, 'Controllers, Programmable,  engineerâ€™s', 'All industrial processes need some form of control system if they are to\r\nrun safely and economically. In recent years a specialist control computer,\r\ncalled a programmable controller, has evolved and revolutionized control\r\nengineering by combining computing power and immense flexibility at\r\na reasonable price.\r\nThis book is concerned with the application and use of programmable\r\ncontrollers. It is not an instructional book in programming, and is certainly\r\nnot a comparative guide to the various makes of machine on the market.', NULL, '1917459.jpg', '4658732.pdf', 1, 2003, 'New York', 46, '2019-01-19 15:57:46', '2019-01-19 15:57:46', '203.190.11.115'),
(480, 230, 1, NULL, 1, 'Programming Pearls,', 'programming-pearls', '2nd ed.', '0-201-65788-0.', NULL, 'Programming, Pearls,', 'This book is a collection of essays about a glamorous aspect of\r\nsoftware: programming pearls whose origins lie beyond solid\r\nengineering, in the realm of insight and creativity. This book\r\nprovides a guide for both students and experienced\r\nprogrammers about how to design and create programs, and\r\nhow to think about programming.\r\nThe book is full of small case studies, real examples, and interesting exercises for learning about how to program.\r\nThis web page contains samples from the whole work for you to investigate. For teachers, the links below lead to\r\nsome of the central material suitable for classroom use.', NULL, '5486862.PNG', '9160328.pdf', 1, 2000, 'USA', 46, '2019-01-19 16:31:15', '2019-01-19 16:31:15', '203.190.11.118'),
(481, 43, 1, NULL, 1, 'Schaumâ€™s outline of theory and problems of programming with C', 'schaums-outline-of-theory-and-problems-of-programming-with-c-19371104', '2nd ed.', '0-07-024035-3', NULL, 'programming Theory, problems, C', 'C has continued to increase in popularity since the publication of the first edition of this book in 1990.\r\nMost newer compilers provide numerous extensions to the 1989 ANSI standard, as well as a full-feature\r\ngraphical programming environment including a debugger, a project manager, and extensive on-line help.\r\nMoreover, interest in C has not been diminished by the emergence of C++, since the features found in this\r\nnewer programming language require a solid background in C.', NULL, '7882087.PNG', '5273378.pdf', 1, 1996, 'USA', 46, '2019-01-19 16:37:04', '2019-01-19 16:37:04', '203.190.11.118'),
(482, 231, 1, NULL, 1, 'Bandwidth-Efficient Digital Modulation with Application to Deep-Space Communications', 'bandwidth-efficient-digital-modulation-with-application-to-deep-space-communications-19021246', NULL, NULL, NULL, 'Constant Envelope Modulations, Constant Envelope, Quadriphase-Shift-Keying, Power Spectral Density Considerations, Nonideal Transmitters, Continuous Phase Modulation, IJF-QPSK and SQORC, FQPSK.', 'Traditional modulation methods adopted by space agencies for transmitting telecommand and telemetry data have incorporated subcarriers as a simple means of separating different data types as well ensuring no overlap between the radio frequency (RF) carrier and the modulated dataâ€™s frequency spectra. Unfortunately, subcarrier modulation suffers from a number of disadvantages, namely, greater spacecraft complexity, additional losses in the modulation/ demodulation process, and most important, at least from the standpoint of this monograph, a large, occupied bandwidth. One effort to mitigate the latter was to replace the more traditional square-wave subcarriers with sine-wave carriers, but this was not considered to be an acceptable solution for all space-exploration missions.', NULL, '3217854.jpg', '5218878.pdf', 1, 2001, 'New York', 49, '2019-01-19 17:02:46', '2019-01-19 17:02:46', '203.190.11.118'),
(483, 232, 1, NULL, 1, 'Basic electronic components & Hardware-1', 'basic-electronic-components-hardware-1-19171219', '1st ed.', NULL, NULL, 'Conducting materials, resistance, fuses, circuit analysis, cells & batteries.', 'The primary objective d this book is to serve as a text in Basic Electronic Components and Hardware Courses (Specialty for TEM Course) for Electronics students. Our approach is to stress the fundamental concepts of Bask Electronic Components. We hope to convey both the substance and flavor of the subject The breadth and depth of treatment also makes this volume a valuable adjunct to continuing education of practicing technicians, engineers and computer engineers.', NULL, '2078724.JPG', '8640902.pdf', 1, 1999, 'New Delhi', 49, '2019-01-19 17:17:19', '2019-01-19 17:17:19', '203.190.11.118'),
