(486, 49, 1, NULL, 1, 'Radio Frequency Circuit Design', 'radio-frequency-circuit-design', NULL, '0-471-35052-4', NULL, 'Circuit, Design, Radio, Frequency', 'The cellular telephone has become a symbol for the rapid change in the communications business. Within this plastic container reside the talents of engineers\r\nworking in the areas of efficient power supplies, digital circuit design, analog\r\ncircuit design, semiconductor device design, antennas, linear systems, digital\r\nsignal processing, packaging, and materials science. All these talents are carefully\r\ncoordinated at a cost that allows a wide cross section of the worldâ€™s population to\r\nhave available instant communication.', NULL, '3804555.jpg', '6783005.pdf', 1, 2001, 'New York', 46, '2019-01-19 17:34:56', '2019-01-19 17:34:56', '203.190.11.117'),
(487, 49, 1, NULL, 1, 'Microprocessor Theory and Applications with 68000/68020 and Pentium', 'microprocessor-theory-and-applications-with-6800068020-and-pentium', NULL, 'N 978-0-470-3803 1-4', NULL, 'Applications, Microprocessor,  Theory', 'Microprocessors play an important role in the design of digital systems. They are found in\r\na wide range of applications, such as process control and communication systems.\r\nThis book is written to present the fundamental concepts of assembly language\r\nprogramming and system design concepts associated with typical microprocessors, such as\r\nthe Motorola 68000/68020 and Intel Pentium. The 68000 is a 16-bit microprocessor that\r\ncontinues to be popular. Since the 68000 uses linear memory and contains 32-bit generalpurpose registers, it is an excellent educational tool for acquiring an understanding of both\r\nhardware and software aspects of typical microprocessors.', NULL, '7592928.PNG', '6890605.pdf', 1, 2008, 'New York', 46, '2019-01-19 17:41:31', '2019-01-19 17:41:31', '203.190.11.117'),
(488, 43, 1, NULL, 1, 'Design of Integrated Circuits for Optical communications', 'design-of-integrated-circuits-for-optical-communications', NULL, '007282589', NULL, 'Integrated, Design,  Circuits, Optical, communications', 'The increasing demand for high-speed transport of data has revitalized optical commu-nications, leading to extensive work on high-speed device and circuit design. This book has been written to address the need for a tutorial text dealing with the analysis and de-sign of integrated circuits (ICs) for optical communication systems and will prove useful to both graduate students and practicing engineers. The book assumes a solid understand-ing of analog design, e.g., at the level of Design of Analog CMOS Integrated Circuits by B. Razavi or Analysis and Design of Analog Integrated Circuits by P. Gray, P. Hurst, S. Lewis, and R. Meyer.', NULL, '1899768.PNG', '3430367.pdf', 1, 2003, 'New York', 46, '2019-01-19 18:01:40', '2019-01-19 18:01:40', '203.190.11.117'),
(489, 72, 1, NULL, 1, 'Newnes Guide to Digital TV', 'newnes-guide-to-digital-tv', '2nd ed.', '0750657219', NULL, 'Digital television, Conditional access, Physiology of the eye, Film and television, NTSC and PAL colour systems, SPDIF or IEC958 type 2 interface, AES/EBU or IEC958 type 1 interface.', 'In the four years or so since I started work on the first edition of this book, digital television has changed from being a reality to a common place. My own family is proof of this. Whether the children are watching a wide choice of programmes via digital cable in Paris or, more recently, a similar choice carried by digital satellite in the UK, they have come to expect the benefits that digital television brings; more channels, better quality, interactivity etc. In addition to this ubiquity, there have been some real technical developments too. The inclusion of a hard drive within the settop box, speculated on in the first edition, has now become a reality with the personal video recorder or PVR permitting the tapeless time-shifting of programmes and true video-on-demand (VOD) movie channels.', NULL, '8294500.JPG', '6948821.pdf', 1, 2003, 'New York', 49, '2019-01-19 18:05:56', '2019-01-19 18:05:56', '203.190.11.117'),
(490, 43, 1, NULL, 1, 'Design of Analog CMOS Integrated Circuits', 'design-of-analog-cmos-integrated-circuits-19111341', NULL, '0072380322', NULL, 'Integrated, Circuits, Design, Analog, CMOS', 'In the past two decades. CMOS technology has rapidly embraced the field of analog inte-grated circuits, providing low-cost. high-performance solutions and rising to dominate the market. While silicon bipolar and Ill-V devices still find niche applications, only CMOS processes have emerged as a viable choice for the integration of today\'s complex mixed-signal systems. With channel lengths projected to scale down to 0.03 it m. CMOS technology will continue to serve circuit design for probably another two decades.', NULL, '6680628.PNG', '9110813.pdf', 1, 2001, 'New York', 46, '2019-01-19 18:11:41', '2019-01-19 18:11:41', '203.190.11.115'),
(491, 39, 1, NULL, 1, 'Re Microelectronics', 're-microelectronics', NULL, '0138875715', NULL, 'Microelectronics', 'The annual worldwide sales of cellular phones has exceeded $2.5B. With 4.5 mil-lion customers, home satellite networks comprise a $2.5B industry. The global positioning system is expected to become a $5B market by the year 2000. In Europe, the sales of equipment and services for mobile communications will reach $30B by 1998. The statistics are overwhelming.', NULL, '2259147.PNG', '8392497.pdf', 1, 1998, 'New Jersey', 46, '2019-01-19 18:19:49', '2019-01-19 18:19:49', '203.190.11.115');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(492, 43, 1, NULL, 1, 'Semiconductor Physics And Devices: Basic Principles', 'semiconductor-physics-and-devices-basic-principles', '3rd ed.', '0-07-232107-5', NULL, 'Devices, Basic, Physics, Principles', 'The purpose of the third edition of this book is to provide a basis for understanding\r\nthe characteristics, operation, and limitations of semiconductor devices. In order to\r\ngain this understanding, it is essential to have a thorough knowledge of the physics of\r\nthe semiconductor material. The goal of this book is to bring together quantum mechanics, the quantum theory of solids, semiconductor material physics. and semiconductor device physics. All of these components are vital to the understanding of both\r\nthe operation of present day devices and any future development in the field.', NULL, '6708544.jpg', '8980576.pdf', 1, 2003, 'New York', 46, '2019-01-19 18:39:49', '2019-01-19 18:39:49', '203.190.11.118'),
(493, 126, 1, NULL, 1, 'Flexible Power Transmission: The HVDC Options', 'flexible-power-transmission-the-hvdc-options-19571417', '1st ed.', '978-0-470-05688-2 (cloth)', NULL, 'semiconductors, self-commutating, HVDC technology', 'The development of power semiconductors with greater ratings and improved characteristics has meant that the power industry has become more willing to develop new converter configurations. These new configurations take advantage of the higher controllability and switching frequencies of the new devices.', NULL, '9059408.jpg', '6530264.pdf', 1, 2007, 'England', 40, '2019-01-19 19:57:17', '2019-01-19 19:57:17', '203.190.11.115'),
(494, 91, 1, NULL, 1, 'ASIC and FPGA Verification: A Guide to Component Modeling', 'asic-and-fpga-verification-a-guide-to-component-modeling-19081503', '1st ed.', '0-12-510581-9', NULL, NULL, 'Richard Munden demonstrates how to create and use simulation models for verifying ASIC and FPGA designs and board-level designs that use off-the-shelf digital components. Based on the VHDL/VITAL standard, these models include timing constraints and propagation delays that are required for accurate verification of todayâ€™s digital designs.', NULL, '7782601.jpg', '6378880.pdf', 1, 2005, 'London', 40, '2019-01-19 20:08:03', '2019-01-19 20:08:03', '203.190.11.115'),
(495, 49, 1, NULL, 1, 'Audel Electrical Course for Apprentices and Journeymen', 'audel-electrical-course-for-apprentices-and-journeymen-19151531', '4th ed.', '0-764-54200-1', NULL, NULL, 'As you advance from student to apprentice to journeyman status, you log a lot of study hours. Make the most of those hours with this fully updated, sharply focused self-study course. It contains everything you need to know about electrical theory and applications, clearly defined and logically organized, with illustrations for clarity and review questions at the end of each chapter to help you test your knowledge.', NULL, '6973058.jpg', '8567032.pdf', 1, 2004, 'Canada', 40, '2019-01-19 20:15:31', '2019-01-19 20:15:31', '203.190.11.118'),
(496, 49, 1, NULL, 1, 'SENSOR NETWORK OPERATIONS', 'sensor-network-operations', NULL, '0-471-71976-5', NULL, 'NETWORK, SENSOR , OPERATIONS', 'In recent years, interest in sensor networks has evolved from a subject solely of research\r\nto one of deployed systems. As new applications have arisen that use sensor networks, the\r\ndemands on these networks have grown. One of the main challenges with these networks is\r\nhow to manage missions from application requirements to network operation. By their nature, most sensor networks are mission specific. They therefore place specific requirements\r\non network systems that in turn dictate the use of certain algorithms.', NULL, '2010631.PNG', '9302328.pdf', 1, 2006, 'Canada', 46, '2019-01-19 20:44:00', '2019-01-19 20:44:00', '203.190.11.118'),
(497, 232, 1, NULL, 1, 'Basic Electronic Components & Hardware-II', 'basic-electronic-components-hardware-ii', '1st ed.', NULL, NULL, 'Electronic, Hardware, Electronic Components.', 'The book has substantial amount of new material that has been added to reflect changes in technology  and curricula. These book helps where you need it, offering useful and practical suggestion. The chapter one deals with number systems.', NULL, '4433450.JPG', '3372030.pdf', 1, 1999, 'New Delhi', 47, '2019-01-19 20:57:42', '2019-01-19 20:57:42', '203.190.11.115'),
(498, 10, 1, NULL, 1, 'Basic Probability Theory with Applications', 'basic-probability-theory-with-applications', NULL, '978-0387749945', NULL, 'Probability of Theory, Basic Probability, Theory with Applications.', 'The main intended audience for this book is undergraduate students in pure and applied sciences, especially those in engineering. Chapters 2 to 4 cover the probability theory they generally need in their training. Although the treatment of the subject is surely su?cient for non-mathematicians, I intentionally avoided getting too much into detail. For instance, topics such as mixed type random variables and the Dirac delta function are only brie?y mentioned. Courses on probability theory are often considered di?cult. However, after having taught this subject for many years, I have come to the conclusion that one of the biggest problems that the students face when they try to learn probability theory, particularly nowadays, is their de?ciencies in basic di?erential and integral calculus. Integration by parts, for example, is often already forgotten by the students when they take a course on probability.', NULL, '5912081.JPG', '4451825.pdf', 1, 2009, 'New York', 47, '2019-01-19 21:08:29', '2019-01-19 21:08:29', '203.190.11.115'),
(499, 235, 1, NULL, 1, 'Basic TV Technology: Digital and Analog', 'basic-tv-technology-digital-and-analog', '4th ed.', '978-0240807171', NULL, 'TV, Technology, Digital, Analog, TV Technology.', 'Basic TV Technology is the essential basic guide to the fundamentals underlying all television and video systems, written for students and nontechnical professionals. You don\'t need to have a math or science background in order to understand this explanation of how the principal pieces of equipment work, what their functions are, and how they are integrated to form a complex video system. An understanding of this material will be necessary for you to succeed in the real world, where one person often has to perform many different roles and functions within a production. Armed with some basic technical background information, you\'ll be more effective at figuring out new applications and at problem-solving.', NULL, '4149854.JPG', '3556154.pdf', 1, 2005, 'New York', 47, '2019-01-19 21:14:56', '2019-01-19 21:14:56', '203.190.11.118'),
(500, 226, 1, NULL, 1, 'Basic Electrical Engineering', 'basic-electrical-engineering-19301649', '2nd ed.', '9788184316940', NULL, 'Electrical, Engineering, Basic Electrical Engineering.', 'The study of electrical engineering involves the analysis of the energy transfer from one form to another or from one point to another. So before beginning the actual study of electrical engineering, it is necessary to discuss the fundamental ideas about the basic elements of an electrical engineering like electromotive force,current, resistance etc.', NULL, '4244521.JPG', '9981506.pdf', 1, 2009, 'India', 47, '2019-01-19 21:30:49', '2019-01-19 21:30:49', '203.190.11.115'),
(501, 72, 1, NULL, 1, 'Bebop to the Boolean Boogie: An Unconventional Guide to Electronics', 'bebop-to-the-boolean-boogie-an-unconventional-guide-to-electronics', '2nd ed.', '978-0750675437', NULL, 'Boolean, Bebop, Unconventional, Electronics', 'If you want to be reminded of the joy of electronics, take a look at Clive Max field\'s book Bebop to the Boolean Boogie. Lives up to its title as a useful and entertaining technical guide well-suited for students, technical writers, technicians, and sales and marketing people.Electronic Design. Writing a book like this one takes audacity! Max field writes lucidly on a variety of complex topics without \'writing down\' to his audience.', NULL, '6960608.JPG', '4961586.pdf', 1, 2003, 'New York', 47, '2019-01-19 21:48:27', '2019-01-19 21:48:27', '203.190.11.115'),
(502, 72, 1, NULL, 1, 'Understanding Telephone Electronics', 'understanding-telephone-electronics', '4th ed.', '978-0750671750', NULL, 'Telephone, Electronics.', 'Throughout its history, Understanding Telephone Electronics has been, by far, one of the most popular books on telecommunication electronics in the trade, electronic distribution, and educational markets because of its very simple, direct approach to the technology. In keeping with the distinguished tradition of its predecessors, Understanding Telephone Electronics, Fourth Edition covers conventional telephone fundamentals, including both analog and modern digital communication techniques, and provides basic information on the functions of each telephone system component, how electronic circuits generate dial tones, and how the latest digital transmission techniques work.', NULL, '6634071.JPG', '8248111.pdf', 1, 2001, 'New Delhi', 47, '2019-01-19 21:57:03', '2019-01-19 21:57:03', '203.190.11.115'),
(503, 64, 1, NULL, 1, 'Multicarrier Techniques for 4G Mobile Communications', 'multicarrier-techniques-for-4g-mobile-communications', NULL, '1-58053-482-1', NULL, 'Coded OFDM Scheme, Combination of OFDM and CDMA', 'At recent major international conferences on wireless communications,\r\nthere have been several sessions on beyond third generation (3G) or fourth\r\ngeneration (4G) mobile communications systems, where odulation/demodulation and multiplexing/multiple access schemes related to multicarrier techniques have drawn a lot of attention. We often met at the conference venues and realized that no book covered the basics of multicarrier techniques to recent applications aiming at the 4G systems. Therefore, we decided to write a book on multicarrier techniques for 4G mobile communications systems.', NULL, '1690413.JPG', '4195804.pdf', 1, 2003, 'London', 51, '2019-01-19 23:15:51', '2019-01-19 23:15:51', '203.190.11.118'),
(504, 49, 1, NULL, 1, 'Nonlinear Microwave Circuit Design', 'nonlinear-microwave-circuit-design', NULL, '0-470-84701-8', NULL, 'Nonlinear Measurements, Nonlinear Models', 'Nonlinear microwave circuits is a field still open to investigation; however, many basic concepts and design guidelines are already well established. Many researchers and design engineers have contributed in the past decades to the development of a solid knowledge that forms the basis of the current powerful capabilities of microwave engineers.', NULL, '4501278.JPG', '6658583.pdf', 1, 2004, 'West Sussex', 51, '2019-01-19 23:36:45', '2019-01-19 23:36:45', '203.190.11.118'),
(505, 64, 1, NULL, 1, 'Nonlinear Microwave and RF Circuits', 'nonlinear-microwave-and-rf-circuits', '2nd ed.', '1-58053-484-8', NULL, 'Nonlinear Microwave, RF Circuits.', 'Back in the days when I had a lot more energy and a lot less sense, I wrote\r\nthe first edition of this book. I had just finished writing Microwave Mixers,\r\nand friends kept asking me, â€œWell, are you going to write another one?â€\r\nSales of Mixers were brisk, and the feedback from readers was\r\nencouraging, so it was easy to answer, â€œSure, why not?â€ After a year of\r\npainful labor, Nonlinear Microwave Circuits was born.', NULL, '2548966.JPG', '1552068.pdf', 1, 2003, 'London', 51, '2019-01-19 23:40:46', '2019-01-19 23:40:46', '203.190.11.118'),
(506, 49, 1, NULL, 1, 'Modeling and control of Electric machines high-performance', 'modeling-and-control-of-electric-machines-high-performance', NULL, '0-47 1 -68449-X', NULL, 'Electric machines, Rotating Magnetic.', 'This book is intended to be an exposition of the modeling and control of\r\nelectric machines, specifically, the direct current (DC) machine and the\r\nalternating current (AC) machines consisting of the induction motor, the\r\npermanent magnet (PM) synchronous motor, and the brushless DC motor.\r\nThe particular emphasis here is on techniques used for high-performance\r\napplications, that is, applications that require both rapid and precise control of position, speed, and/or torque. T', NULL, '4455671.JPG', '4899875.pdf', 1, 2005, 'New York', 51, '2019-01-19 23:53:05', '2019-01-19 23:53:05', '203.190.11.118'),
(507, 10, 1, NULL, 1, 'Microwave Resonators and Filters for Wireless Communication: Theory, Design and Application', 'microwave-resonators-and-filters-for-wireless-communication-theory-design-and-application', NULL, '978-3540675358', NULL, 'Microwave Resonators, Filters for Wireless Communication.', 'This book describes the basic theory of microwave resonators and filters, and practical design methods for wireless communication equipment. The microwave resonators and filters described provide a basis for building more compact, lighter-weight mobile communication equipment with longer operating times.', NULL, '9301806.JPG', '4162292.pdf', 1, 2001, 'New York', 51, '2019-01-20 01:33:17', '2019-01-20 01:33:17', '203.190.11.115'),
(508, 74, 1, NULL, 1, 'Microelectronics Devices And Circuits', 'microelectronics-devices-and-circuits', NULL, '0-07-021496-4', NULL, 'Microelectronics Devices  , Circuits', 'The terminal current-voltage\r\nrelationship of a real resistor that you might get from a stockroom or buy at an\r\nelectronics store may be represented, or modeled, by an â€œidealâ€ resistor for which\r\nVRRâ€˜ = iRR, where vRR~ is the voltage difference between the two terminals of the\r\nresistor, iR is the current into the positive reference terminal (and out the negative\r\nterminal), and R is the resistance of the resistor, in units of ohms.', NULL, '4482839.JPG', '4766466.pdf', 1, 2006, 'USA', 48, '2019-01-20 15:20:03', '2019-01-20 15:20:03', '203.190.11.115'),
(509, 236, 1, NULL, 1, 'Bluetooth Application Developer\'s Guide', 'bluetooth-application-developers-guide', '1st ed.', '978-1928994428', NULL, 'Bluetooth, Bluetooth Application.', 'Bluetooth is the most exciting development in wireless computing this decade! Bluetooth enabled devices can include everything from network servers, laptop computers and PDAs, to stereos and home security systems. Most Bluetooth products to hit the market in 2001 will be PC cards for laptop computers and access points, which allow up to seven Bluetooth devices to connect to a network. Reports indicate that by the end of 2003 there will be over 2 billion Bluetooth-enabled devices.', NULL, '3913754.jpg', '8755702.pdf', 1, 2001, 'United States of America', 47, '2019-01-20 15:51:42', '2019-01-20 15:51:42', '203.190.11.115'),
(510, 95, 1, NULL, 1, 'The Science and Engineering of Microelectronic Fabrication', 'the-science-and-engineering-of-microelectronic-fabrication', '2nd', '978-0195136050', NULL, 'Microelectronic Fabrication , Fabrication', 'The electronics industry has grown rapidly in the pact four decades. This growth has been driven by a revolution in microelectronics. In the early 1960s. putting more than one transistor on a piece of scmi-ccoductor was considered cutting edge. Integrated circuits (lCs) containing tens of devices were unheard of. Digital computers were large, slow, and extremely costly. Bell Labs, which had invented the transis-tor a decade earlier, rejected the concept of ICs. They reasoned that in order to achieve a working circuit an of the devices must work. \'Therefore, to have a 50% probability of functionality for a 20 transistor cir-CUit the probability of device functionality must be (Or â€¢â€¢â€¢ 0.066. or 906%. Thds was considered to be ridiculously optimistic at the time yet today integrated circuits we built with billions of tnenistors.', NULL, '3714897.JPG', '1863330.pdf', 1, 2001, 'New York', 48, '2019-01-20 15:51:46', '2019-01-20 15:51:46', '203.190.11.115'),
(511, 200, 1, NULL, 1, 'Broadband Bible', 'broadband-bible', NULL, '0764577433', NULL, 'Internet Access, Broadband Technology, Emerging Broadband Service Options, Broadband Hookup, Multitenant Broadband Hookup, Troubleshooting, Webcams, Pros and Cons: Choosing Your Best Broadband Option.', 'Speed kills boredom on the Web. Broadband makes Web sites that were dull yesterday snap and dance today. Now that every person in the United States and Canada has at least one option for broadband service, thereâ€™s no reason you canâ€™t enjoy a Web more interactive (and intelligent) than any TV show on the market. Connecting your home or small business to a broadband service provider costs less today than ever. The tools you need are easily available, often as close as a Comp USA or Target or even Radio Shack. Why waste time waiting on the Web? Why not whip through the Web, grab what you want, and get on with your life?', NULL, '7566960.JPG', '8548059.pdf', 1, 2004, 'Canada', 49, '2019-01-20 15:54:48', '2019-01-20 15:54:48', '203.190.11.115'),
(512, 95, 1, NULL, 1, 'Microelectronic Circuits', 'microelectronic-circuits-20021140', '5th', '0-19-514252-7', NULL, 'Circuits , Microelectronic', 'The chip shown is an inside view of a mass-produced surface-micromachined gyroscope system, integrated on a 3mm by 3mm die, and using a standard 3-m 2-V BiCMOS process suited for the harsh automotive environment. This first single-chip gyroscopic sensor, in which micro-mechanical and electronic\r\ncomponents are intimately entwined on the same chip, provides unprecedented performance through the use of a\r\ncollection of precision-directed techniques, including emphasis on differential operation (both mechanically and\r\nelectronically) bolstered by trimmable thin-film resistive components.', NULL, '2123198.JPG', '2913432.pdf', 1, 2004, 'New York', 48, '2019-01-20 16:02:40', '2019-01-20 16:02:40', '203.190.11.118'),
(513, 97, 1, NULL, 1, 'Radio and Electronics Cookbook', 'radio-and-electronics-cookbook', '1st ed.', '07506 52144', NULL, 'Experiments with the NE555 timer, the Radio Society, straightforward, Radio and Electronics Cookbook, satisfaction. Beware, electronic construction, A grid dip oscillator.', 'Although we are surrounded by sophisticated computerised gadgets these days, there is still a fascination in putting together a few resistors, capacitors and the odd transistor to make a simple electronic circuit. It is really surprising how a handful of components can perform a useful function, and the satisfaction of having built it yourself is incalcuable. This book aims to provide a wide variety of radio and electronic projects, from something that will take a few minutes to a more ambitious weekendâ€™s worth. Various construction techniques are described, the simplest requiring no more than a small screwdriver, the most complex involving printed circuit boards.', NULL, '2651398.gif', '7151044.pdf', 1, 2001, 'New Delhi', 49, '2019-01-20 16:09:19', '2019-01-20 16:09:19', '203.190.11.115'),
(514, 30, 1, NULL, 1, 'Fundamentals of Microelectronics', 'fundamentals-of-microelectronics-20131139', NULL, '978-0470072929', NULL, 'Microelectronics , Fundamentals', 'The general area of electronics began about a century ago and proved instrumental in the radio\r\nand radar communications used during the two world wars. Early systems incorporated â€œvacuum\r\ntubes,â€ amplifying devices that operated with the flow of electrons between plates in a vacuum\r\nchamber. However, the finite lifetime and the large size of vacuum tubes motivated researchers\r\nto seek an electronic device with better properties.', NULL, '6989215.JPG', '2766690.pdf', 1, 2007, 'USA', 48, '2019-01-20 16:13:39', '2019-01-20 16:13:39', '203.190.11.118'),
(515, 196, 1, NULL, 1, 'Bluetooth Security', 'bluetooth-security', NULL, '1-58053-504-6', NULL, 'Bluetooth, Security.', 'Bluetooth technology is becoming a popular way to furnish short-range wireless inter connectivity as an alternative to existing wire applications or as an enabling technology for new ones. With the number of Bluetooth-equipped consumer and industry devices rapidly increasing, it stands on the threshold of global deployment. This first of its kind book, from expert authors actively contributing to the evolution of Bluetooth, provides an overview and detailed description of all the security functions and features of this technology\'s latest core release.', NULL, '3954059.JPG', '5612162.pdf', 1, 2004, 'London', 47, '2019-01-20 16:15:11', '2019-01-20 16:15:11', '203.190.11.118'),
(516, 237, 1, NULL, 1, 'Step By Step : Build Exactly The Skills You Need : Learn At The Pace You Want', 'step-by-step-build-exactly-the-skills-you-need-learn-at-the-pace-you-want', NULL, '978-0-7356-6939-0', NULL, 'Step  , Build Skill', 'When you create a Microsoft Excel 2013 workbook, the program presents a blank workbook that contains one worksheet. You can add or delete worksheets, hide worksheets within the workbook without deleting them, and change the order of your worksheets within the workbook. You can also copy a worksheet to another workbook or move the\r\nworksheet without leaving a copy of the worksheet in the first workbook. If you and your colleagues work with a large number of documents, you can define property values to make your workbooks easier to find when you and your colleagues attempt to locate them by searching in File Explorer or by using Windows 8 Search.', NULL, '5684081.JPG', '3935653.pdf', 1, 2013, 'California', 48, '2019-01-20 16:22:57', '2019-01-20 16:22:57', '203.190.11.115'),
(517, 238, 1, NULL, 1, 'Elementary Linear Algebra', 'elementary-linear-algebra', '6th', '13: 978-0-547-00481-5', NULL, 'Linear Algebra', 'The order and coverage of topics were chosen for maximum efficiency, effectiveness,\r\nand balance. For example, in Chapter 4 we present the main ideas of vector spaces and\r\nbases, beginning with a brief look leading into the vector space concept as a natural extension of these familiar examples. This material is often the most difficult for students, but\r\nour approach to linear independence, span, basis, and dimension is carefully explained and\r\nillustrated by examples. The eigenvalue problem is developed in detail in Chapter 7, but we\r\nlay an intuitive foundation for students earlier in Section 1.2, Section 3.1, and Chapter 4.\r\nAdditional online Chapters 8, 9, and 10 cover complex vector spaces, linear programming, and numerical methods. They can be found on the student website for this text at\r\ncollege.hmco.com/pic/larsonELA6e.\r\nPlease read on to learn more about the features of the Sixth Edition.\r\nWe hope you enjoy this new edition of Elementary Linear Algebra.', NULL, '7549400.JPG', '3323001.pdf', 1, 2009, 'New York', 52, '2019-01-20 16:25:24', '2019-01-20 16:25:24', '203.190.11.118'),
(518, 74, 1, NULL, 1, 'Microelectronic Circuit Design', 'microelectronic-circuit-design', '4th', '978-0-07-338045-2', NULL, 'Circuit Design , Microelectronic', 'The computer is used as a tool throughout the text. The authors firmly believe that this means more than just the use\r\nof the SPICE circuit analysis program. In todayâ€™s computing environment, it is often appropriate to use the computer\r\nto explore a complex design space rather than to try to reduce a complicated set of equations to some manageable\r\nanalytic form. Examples of the process of setting up equations for iterative evaluation by computer through the use\r\nof spreadsheets, MATLAB, and/or standard high-level language programs are illustrated in several places in the text.', NULL, '7213341.JPG', '8032381.pdf', 1, 2008, 'New York', 48, '2019-01-20 16:30:41', '2019-01-20 16:30:41', '203.190.11.118'),
(519, 86, 1, NULL, 1, 'Introduction to Electricity', 'introduction-to-electricity', '1st ed.', '978-0135040874', NULL, 'Electricity', 'Introduction to Electricity  is written from a time tested approach and provides exceptionally clear explanations and descriptions, step-by-step examples, practical applications, and comprehensive coverage of essentials to provide students with a solid, accessible foundation.', NULL, NULL, '8991997.pdf', 1, 2013, NULL, 47, '2019-01-20 16:31:24', '2019-01-20 16:31:24', '203.190.11.115'),
(520, 10, 1, NULL, 1, 'Elements For Physics', 'elements-for-physics', NULL, '13 978-3-540-25302-0', NULL, 'Elements   Physics', 'The meaning of the term physical â€˜quantityâ€™ is generally well understood\r\n(everyone understands what it is meant by â€œthe frequency of a periodic\r\nphenomenonâ€, or â€œthe resistance of an electric wireâ€). It is clear that behind a set of quantities like temperature âˆ’ inverse temperature âˆ’ logarithmic\r\ntemperature, there is a qualitative notion: the â€˜coldâˆ’hotâ€™ quality. Over this\r\none-dimensional quality space, we may choose different â€˜coordinatesâ€™: the\r\ntemperature, the inverse temperature, etc. Other quality spaces are multidimensional. For instance, to represent the properties of an ideal elastic\r\nmedium we need 21 coefficients, that can be the 21 components of the elastic\r\nstiffness tensor cijk`\r\n, or the 21 components of the elastic compliance tensor\r\n(inverse of the stiffness tensor), or the proper elements (six eigenvalues and\r\n15 angles) of any of the two tensors, etc. Again, we are selecting coordinates\r\nover a 21-dimensional quality space.', NULL, '7504552.JPG', '8047699.pdf', 1, 2006, 'New York', 52, '2019-01-20 16:40:41', '2019-01-20 16:40:41', '203.190.11.115'),
(521, 139, 1, NULL, 1, 'Broadband Bringing Home the Bits', 'broadband-bringing-home-the-bits', '1st ed.', '978-0309082730', NULL, 'Broadband, Home, Bits', 'Broadband communication expands our opportunities for entertainment, e-commerce and work at home, health care, education, and even e-government. It can make the Internet more useful to more people. But it all hinges on higher capacity in the first mile or last mile that connects the user to the larger communications network. That connection is often adequate for large organizations such as universities or corporations, but enhanced connections to homes are needed to reap the full social and economic promise.', NULL, '2754065.jpg', '5946798.pdf', 1, 2002, 'America', 47, '2019-01-20 16:46:04', '2019-01-20 16:46:04', '203.190.11.118'),
(522, 239, 1, NULL, 1, 'Milimeter-Wave Integrated Circuits', 'milimeter-wave-integrated-circuits', NULL, '0-387-23666-X', NULL, 'Integrated Circuits , Milimeter-Wave', 'The design and implementation of millimetre-wave (mm-wave) integrated circuits using MMIC technology are explored in this work. To make possible the widespread use of MMIC technology for mm-wave applications, high performance MMIC mm-wave transceivers must be shown to be viable for high-volume production. Low noise amplifiers (LNAs), mixers and frequency multipliers, circuit functions critical to the development of a mm-wave transceiver, are studied in this work.', NULL, '1204225.JPG', '6736428.pdf', 1, 2005, 'USA', 48, '2019-01-20 16:46:11', '2019-01-20 16:46:11', '203.190.11.118'),
(524, 241, 1, NULL, 1, 'Mixed-Signal And DSP Design Techniques', 'mixed-signal-and-dsp-design-techniques-20041214', NULL, '0-916550-23-0', NULL, 'Design Techniques , Mixed-Signal', 'Dealing with the processing of real-world signals using both analog and digital techniques. Before starting, however, let\'s look at a few key concepts and definitions required to lay the groundwork for things to come. analog signals are generally limited to electrical variables, their rates of change, and their associated energy or power levels. Sensors\r\nare used to convert other physical quantities (temperature, pressure, etc.) to electrical signals. The entire subject of signal conditioning deals with preparing real-world signals for processing.', NULL, '5160301.JPG', '4875601.pdf', 1, 2000, 'USA', 48, '2019-01-20 17:04:14', '2019-01-20 17:04:14', '203.190.11.115'),
(525, 200, 1, NULL, 1, 'Broadband Bible', 'broadband-bible-20111224', 'Desktop Edition', 'B011DBY4Y2', NULL, 'Broadband, Bible.', 'Explore the Internet in ways you couldnâ€™t before. Download videos and\r\nmusic that you never considered in the past because of their file sizes. Finally,\r\nturn your computer into something more fun than an automated Solitaire game.\r\nDo all this easily, inexpensively, and without needing to cut a hole in your wall\r\nfor wires or worry about security. Follow the directions in here, and you will\r\nconnect effortlessly, protect your data in a variety of ways, and stop wondering\r\nif your computer was working for you or against you. With broadband access\r\nand the information in here, you computer will become your transport to more\r\ninformation and entertainment than ever before.', NULL, '1958056.JPG', '6821504.pdf', 1, 2004, 'India', 47, '2019-01-20 17:11:24', '2019-01-20 17:11:24', '203.190.11.118'),
(526, 242, 1, NULL, 1, 'Modern Control Theory', 'modern-control-theory', NULL, '978-3-540-23951-2', NULL, 'Modern Control , Control theory', 'The modern control theory is a discipline dealing with formal foundations of the analysis and design of computer control and management systems. Its basic scope contains problems and methods of control algorithms design, where the control algorithms are understood as formal prescriptions (formulas, procedures, programs) for the determination of control decisions, which may be executed by technical devices able to the information processing and decision making.', NULL, '1560938.JPG', '7678315.pdf', 1, 2002, 'Germany', 48, '2019-01-20 17:14:40', '2019-01-20 17:14:40', '203.190.11.118'),
(527, 196, 1, NULL, 1, 'Broadband Microwave Amplifiers', 'broadband-microwave-amplifiers', NULL, '978-1580538923', NULL, 'Broadband, Microwave, Amplifiers.', 'Broadband microwave amplifiers are essential components for boosting signals in a wide range of technology, from telecommunications equipment to radar and electronic warfare systems. This book provides professionals with a complete understanding of state-of-the art and cutting-edge techniques for designing and fabricating broadband amplifiers. It covers the entire design life cycle, detailing each stage in a practical, hands-on manner. The book explains measurement, modeling, and testing methods so engineers can optimize designs to achieve maximum signal amplification. Filled with case studies, this book thoroughly explores the application of broadband microwave amplifiers in optical communications, satellite communications, wireless local area networks, electronic warfare, base station equipment, and phased array radar.', NULL, '7257340.JPG', '3948006.pdf', 1, 2004, 'London', 47, '2019-01-20 17:24:02', '2019-01-20 17:24:02', '203.190.11.118'),
(528, 243, 1, NULL, 1, 'CAD of Microstrip Antennas for Wireless Application', 'cad-of-microstrip-antennas-for-wireless-application', NULL, NULL, NULL, 'Comparison to Measured Results, Rectangular Patch Radiation Patterns Quarterwave Short-Circuited Patch, Circularly Polarized Element Design.', 'Until the early 1990s, RF and microwave technologies were primarily used for military applications. Often these applications demanded state-of-the-art performance along with the ability to operate in virtually any imaginable environment. Since the beginning of the current decade, there has been a rapid shift away from military toward commercial systems. An explosion of new commercial products utilizing wireless technology has come onto the scene. Typically, commercial products are developed under significantly different circumstances than military systems. Cost is usually paramount; the product must be easy to use; product size and aesthetics are often important; and in many cases, performance does not need to be optimum. The fast pace of most commercial markets demands a change from the lengthy design cycle required to develop high-performance military systems to very short product development times.', NULL, '3203674.jpg', '8153084.pdf', 1, 1990, 'New Delhi', 49, '2019-01-20 17:26:33', '2019-01-20 17:26:33', '203.190.11.117'),
(529, 244, 1, NULL, 1, 'Modern Control System', 'modern-international-edition', '7th', '0-13-20L710- 2', NULL, 'Control System , Modern', 'The classical methods of control engineering are thoroughly covered: Laplace trans forms and transfer functions; root locus design; Routhâ€”Hurwitz stability analysis frequency response methods, including Bode, Nyquist, and Nichols; steady-stay en-or for standard test signals; secondâ€¢order system approximations; and phase am gain margin and bandwidth. In addition, coverage of the state variable method significant. Fundamental notions of controllability and observability for state van able models are discussed. Full state feedback design with Ackermann\'s formula fo pole placement is presented, along with a discussion on the limitations of state vari able feedback. Observers are introduced as a means to provide state estimates whet the complete state is not measured.', NULL, '2206623.JPG', '8663225.pdf', 1, 2008, 'London', 48, '2019-01-20 17:28:57', '2019-01-20 17:30:21', '203.190.11.117'),
(530, 49, 1, NULL, 1, 'Broadband Power-line Communications Networks', 'broadband-power-line-communications-networks', '1st ed.', '978-0470857410', NULL, 'Broadband, Power-line, Networks.', 'Broadband Power-line Communications: Network Design covers the applications of broadband PLC systems in low-voltage supply networks, a promising candidate for the realization of cost effective solutions for â€œlast mileâ€ communications networks. There are many activities surrounding the development and application of PLC technology in the access area, particularly because of strong interest of new network providers after the deregulation of telecommunications market. Nowadays, there are no existing standards for broadband PLC networks, which use a frequency range up to 30 MHz.', NULL, '7866667.JPG', '6840686.pdf', 1, 2004, 'England', 47, '2019-01-20 17:40:09', '2019-01-20 17:40:09', '203.190.11.118'),
(531, 96, 1, NULL, 1, 'Modern Receiver Front-Ends : Systems,Circuits,and Integration', 'modern-receiver-front-ends-systemscircuitsand-integration', NULL, '0-471-22591-6', NULL, 'Front-Ends , Modern Receiver', 'Any communication system, in the simplest form, consists of a transmitter, a signal\r\npath, and a receiver. The performance of such systems depends heavily on each of\r\nthe building blocks and the impact of the given communication link on the signal.\r\nAlthough the impact of the path is fixed by the frequency of the RF signal and the\r\nproperties of the physical medium in which the signal propagates, the behavior of\r\nthe transmitter and receiver can be flexible.', NULL, '3366330.JPG', '8769516.pdf', 1, 2004, 'new jersey', 48, '2019-01-20 17:43:40', '2019-01-20 17:43:40', '203.190.11.118'),
(532, 245, 1, NULL, 1, 'Fundamentals of Digital Logic with VHDL Design', 'fundamentals-of-digital-logic-with-vhdl-design', '3rd ed.', '978-0077221430', NULL, 'VHDL, Digital Logic, VHDL Design.', 'Fundamentals of Digital Logic with VHDL Design teaches the basic design techniques for logic circuits. The text provides a clear and easily understandable discussion of logic circuit design without the use of unnecessary formalism. It emphasizes the synthesis of circuits and explains how circuits are implemented in real chips. Fundamental concepts are illustrated by using small examples, which are easy to understand. Then, a modular approach is used to show how larger circuits are designed.', NULL, '8402380.jpg', '9450555.pdf', 1, 2008, 'New York', 47, '2019-01-20 17:55:34', '2019-01-20 17:55:34', '203.190.11.115'),
(533, 57, 1, NULL, 1, 'Modern Signal Processing', 'modern-signal-processing', '2nd', '0 521 82706X', NULL, 'Signal Processing , Modern Signal', 'Digital signal processing are unsolved analog signal processing problems.For instance, digital signals for communication or sensing must map into an analog format for transmission through a physical layer. In this layer\r\nwe meet a canonical example of analog signal processing: the electrical engineerâ€™s impedance matching problem. Impedance matching is the design of analog signal processing circuits to minimize loss and distortion as the signal moves from its source into the propagation medium.', NULL, '8551957.JPG', '6051821.pdf', 1, 2004, 'USA', 48, '2019-01-20 17:58:01', '2019-01-20 17:58:01', '203.190.11.115'),
(534, 246, 1, NULL, 1, 'Modern Differential Geometry for Physicists', 'modern-differential-geometry-for-physicists', '2nd', '981-02-3562-3', NULL, 'Differential Geometry , Physicists', 'A physics student is likely to first encounter the subject of differential geometry in a course on general relativity, where spacetime is represented mathematically by a four-dimensional differentiable manifold. However, this is far from being the only use of differential geometry in physics. For example, the Hamiltonian and Lagrangian approaches to classical mechanics are best described in this way; and the use of differential geometry in quantum field theory has increased steadily in recent decades-for example, in canonical quantum gravity, superstring theory, the non-linear a-model, topological quantum field theory, and Yang-Mills theory.', NULL, '1509160.JPG', '6302789.pdf', 1, 2001, 'Singapore', 48, '2019-01-20 18:06:52', '2019-01-20 18:06:52', '203.190.11.118'),
(535, 72, 1, NULL, 1, 'Fiber Optic Cabling', 'fiber-optic-cabling', '2nd ed.', '0 7506 5013 3', NULL, 'Fiber Optic', 'In 2000, world production of optical fiber grew to 105 million kilometres, itself a 300% growth over the second half of the last decade.\r\nOptical fiber has become the undisputed medium of choice for long-haul\r\ntelecommunications systems and is even delivered direct to many larger\r\nbusinesses. Trials are under way in Scandinavia and America to put fiber\r\ninto the home to judge the true economics of the competing broadband\r\ntechnologies that will inevitably be delivered to every household', NULL, '9200774.JPG', '4446174.pdf', 1, 2002, 'OXFORD', 52, '2019-01-20 18:19:00', '2019-01-20 18:19:00', '203.190.11.115'),
(536, 247, 1, NULL, 1, 'Modern Quantum Mechanics', 'modern-quantum-mechanics', NULL, '0-201-53929-2', NULL, 'Quantum Mechanics , Mechanics', 'We must now work out the effect of the magnetic field on the silver atoms. For our purpose the following oversimplified model of the silver atom suffices. The silver atom is made up of a nucleus and 47 electrons. where 46 out of the 47 electrons can be visualized as forming a spherically symmetrical electron cloud with no net angular momentum. If we ignore the nuclear spin, which is irrelevant to our discussion, we see that the atom as a whole does have an angular momentum, which is due solely to the spinâ€”intrinsic as opposed to orbitalâ€”angular momentum of the single 47th electron.', NULL, '3154930.JPG', '5027567.pdf', 1, 1994, 'New York', 48, '2019-01-20 18:19:06', '2019-01-20 18:19:06', '203.190.11.115'),
(537, 248, 1, NULL, 1, 'Modern Physical Metallurgy and Materials Engineering', 'modern-physical-metallurgy-and-materials-engineering', '6th', '0 7506 4564 4', NULL, 'Physical Metallurgy , Materials Engineering', 'In everyday life we encounter a remarkable range of engineering materials: metals, plastics and ceramics are some of the generic terms that we use to describe them. The size of the artefact may be extremely small, as in the silicon microchip, or large, as in the welded steel plate construction of a suspension bridge. We acknowledge that these diverse materials are quite literally the stuff of our civilization and have a determining effect upon its character.', NULL, '5625007.JPG', '5754905.pdf', 1, 1999, 'Boston', 48, '2019-01-20 18:28:44', '2019-01-20 18:28:44', '203.190.11.117'),
(538, 74, 1, NULL, 1, 'Building Financial Models', 'building-financial-models', '1st ed.', '978-0071402101', NULL, 'Financial, Models,', 'Financial modeling is essential for determining a company\'s current value and projecting its future performance, yet few books explain how to build models for accurately interpreting financial statements. Building Financial Models is the first book to correct this oversight, unveiling a step-by-step process for creating a core model and then customizing it for companies in virtually any industry. Covering every aspect of building a financial model, it provides a broad understanding of the actual mechanics of models, as well as their foundation accounting and finance concepts.', NULL, '3747379.JPG', '3833719.pdf', 1, 2003, 'United State', 47, '2019-01-20 18:28:52', '2019-01-20 18:28:52', '203.190.11.115'),
(539, 249, 1, NULL, 1, 'Building Secure Wireless Networks with 802.11', 'building-secure-wireless-networks-with-80211', '1st ed.', '978-0471237150', NULL, 'Building Secure, Wireless, Wireless Networks', 'Provides a step-by-step approach for planning and implementing a wireless LAN based on 802.11 Wireless Fidelity (Wi-Fi) technology. Authors are Wi-Fi security experts who are able to address the firestorm of concerns about security for 802. 11b networks. Offers a clear perspective of interchangeability with related wireless standards like 802. 11a, Home RF, and Bluetooth. Explains how to achieve the same performance as a wired Ethernet connection and deliver flexibility and high speed.', NULL, '5760427.jpg', '7169735.pdf', 1, 2003, NULL, 47, '2019-01-20 18:57:16', '2019-01-20 18:57:16', '203.190.11.118'),
(540, 64, 1, NULL, 1, 'CAD of Microstrip Antennas for Wireless Applications', 'cad-of-microstrip-antennas-for-wireless-applications', 'Har/Dskt edition', '978-0890065624', NULL, 'CAD, of Microstrip, Wireless, Applications.', 'Aimed at the nonspecialist, explains the operation of microstrip antennas and supplies the tools necessary for engineers who want to develop such antennas for various applications. Some theory is presented, but mainly for the physical insight necessary for successful design. Most of the design tools are given in the form of computer programs (contained on the included disk), each program covering either a particular antenna or some aspect of it. Annotation c. by Book News, Inc., Portland, Or.', NULL, '2909303.JPG', '6078326.pdf', 1, 1996, NULL, 47, '2019-01-20 19:07:21', '2019-01-20 19:07:21', '203.190.11.118'),
(541, 250, 1, NULL, 1, 'Carbon Materials and Nanotechnology', 'carbon-materials-and-nanotechnology', '1st ed.', '978-3527318032', NULL, 'Carbon, Materials, Nanotechnology.', 'This textbook is intended as an overview on developments concerning carbon\r\nthat caused, within the last 20 years, a virtually explosive expansion of research on\r\nnew carbon materials. Starting from the discovery of fullness, a whole new field\r\nof research opened up between chemistry, physics, and materials science, which\r\nexclusively deals with this single, but fascinating element, its properties, and\r\napplications.', NULL, '5711595.jpg', '7262864.pdf', 1, 2010, 'Germany', 47, '2019-01-20 19:15:14', '2019-01-20 19:15:14', '203.190.11.115'),
(542, 10, 1, NULL, 1, 'Microwave Resonators and Filters for Wireless Communication: Theory, Design and Application', 'microwave-resonators-and-filters-for-wireless-communication-theory-design-and-application-20311450', NULL, '3540675353', NULL, 'Microwave Resonators,                                                                                \r\nFilters for Wireless Communication', 'This book describes the basic theory of microwave resonators and filters, and practical design methods for wireless communication equipment. The microwave resonators and filters described provide a basis for building more compact, lighter-weight mobile communication equipment with longer operating times.', NULL, '6945105.JPG', '9561329.pdf', 1, 2001, 'New York', 51, '2019-01-20 19:31:50', '2019-01-20 19:31:50', '203.190.11.115'),
(543, 77, 1, NULL, 1, 'Microwaves and Wireless Simplified', 'microwaves-and-wireless-simplified', '2nd ed.', '1-58053-943-2', NULL, 'Microwaves, Wireless Simplified', 'Every technical book that is written has a definite lifetime. This is true if it is a\r\nhighly theoretical book or a book such as this one, which simplifies a highly\r\ntechnical field. This is why you see first editions, second editions, and so on.\r\nThere is nothing wrong with this arrangement and it actually is a natural progression since it keeps the reader up-to-date with the most recent advances in a particular field.', NULL, '4647949.JPG', '2604719.pdf', 1, 2005, 'Boston', 51, '2019-01-20 19:36:12', '2019-01-20 19:36:12', '203.190.11.115'),
(544, 12, 1, NULL, 1, 'The Avionics Handbook', 'the-avionics-handbook', '1st ed.', '0-8493-8348-X (alk. paper)', NULL, NULL, 'Avionics provide crews and passengers with an array of capabilities. Cockpit crews can operate with fewer pilots, greater efficiency, and immediate critical information. Passengers can enjoy the ultimate in inflight entertainment: live television and audio broadcasts and access to the Internet and e-mail.', NULL, '3676959.jpg', '8969346.pdf', 1, 2000, 'New York', 40, '2019-01-20 19:44:11', '2019-01-20 19:44:11', '203.190.11.117'),
(545, 251, 1, NULL, 1, 'Nanostructured Materials', 'nanostructured-materials', NULL, '0-8155-1451-4', NULL, 'Materials , Nanostructured', 'Nanostructure science and technology has become an identifiable, if very broad and multidisciplinary, field of research and emerging applications in recent years. It is one of the most visible and growing research areas in materials science in its broadest sense. Nanostructured materials include atomic clusters, layered (lamellar) films, filamentary structures, and bulk nanostructured materials.', NULL, '3617912.JPG', '4917200.pdf', 1, 2002, 'USA', 48, '2019-01-20 19:45:07', '2019-01-20 19:45:07', '203.190.11.118'),
(546, 12, 1, NULL, 1, 'Carbons for Electrochemical Energy Storage and Conversion Systems', 'carbons-for-electrochemical-energy-storage-and-conversion-systems', '1st ed.', '978-1420053074', NULL, 'Carbons, Electrochemical, Energy, Storage, Conversion.', 'As carbons are widely used in energy storage and conversion systems, there is a rapidly growing need for an updated book that describes their physical, chemical, and electrochemical properties. Edited by those responsible for initiating the most progressive conference on Carbon for Energy Storage and Environment Protection (CESEP), this book undoubtedly fills this need.', NULL, '7649116.jpg', '5902636.pdf', 1, 2009, 'U.S.A.', 47, '2019-01-20 19:52:51', '2019-01-20 19:52:51', '203.190.11.115'),
(547, 125, 1, NULL, 1, 'Handbook of Medical Imaging: Processing and Analysis Management', 'handbook-of-medical-imaging-processing-and-analysis-management', '1st ed.', '0120777908', NULL, NULL, 'In recent years, the remarkable advances in medical imaging instruments have increased their use considerably for diagnostics as well as planning and follow-up of treatment. Emerging from the fields of radiology, medical physics and engineering, medical imaging no longer simply deals with the technology and interpretation of radiographic images. The limitless possibilities presented by computer science and technology', NULL, '2495157.jpg', '7460745.pdf', 1, 2000, 'New York', 40, '2019-01-20 19:54:30', '2019-01-20 19:54:30', '203.190.11.117'),
(548, 252, 1, NULL, 1, 'Basic Elements of Queuing Theory : Application to the Modelling of Computer Systems', 'basic-elements-of-queuing-theory-application-to-the-modelling-of-computer-systems', NULL, '978-3-662-11657-9', NULL, 'Basic Elements , Queuing Theory', 'We consider an infinite stream of packets that arrive at a gateway of a communication network, seeking admittance in the network. For the sake of simplicity we assume that the packets may only arrive in the intervals of time (n, n + 1) for all n â‰¥ 0 (i.e., we assume that packets do not arrive at times n = 0, 1, 2, . . .). Upon arrival, a packet enters a buffer of infinite dimension. Let An âˆˆ {0, 1} be the number of packets arriving in the interval of time (n, n + 1). We assume that for each n, An follows a Bernoulli r.v. with parameter a, 0 < a < 1.', NULL, '4215446.JPG', '9239356.pdf', 1, 1998, 'France', 48, '2019-01-20 20:00:38', '2019-01-20 20:00:38', '203.190.11.117'),
(549, 175, 1, NULL, 1, 'Handbook of Engineering Electromagnetics', 'handbook-of-engineering-electromagnetics', '1st ed.', '0-8247-5628-2', NULL, NULL, 'Engineers do not have the time to wade through rigorously theoretical books when trying to solve a problem. Beginners lack the expertise required to understand highly specialized treatments of individual topics. This is especially problematic for a field as broad as electromagnetics, which propagates into many diverse engineering fields. The time has come to find a middle ground.', NULL, '9783145.jpg', '7320992.pdf', 1, 2004, 'New York', 40, '2019-01-20 20:01:30', '2019-01-20 20:01:30', '203.190.11.118'),
(550, 49, 1, NULL, 1, 'Introduction to RF Propagation', 'introduction-to-rf-propagation', NULL, '978-0-471-65596-1', NULL, 'RF Propagation,', 'This book provides readers with a solid understanding of the concepts involved in the propagation of electromagnetic waves and of the commonly used modeling techniques. While many books cover RF propagation, most are geared to cellular telephone systems and, therefore, are limited in scope. This title is comprehensive-it treats the growing number of wireless applications that range well beyond the mobile telecommunications industry, including radar and satellite communications', NULL, '8412877.JPG', '4393018.pdf', 1, 2005, 'New Jersey', 51, '2019-01-20 20:08:09', '2019-01-20 20:08:09', '203.190.11.115');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(551, 49, 1, NULL, 1, 'Next Generation Mobile Systems 3G and Beyond', 'next-generation-mobile-systems-3g-and-beyond', NULL, '978-0-470-09151-7', NULL, 'Wireless LAN Evolution, IP Mobility.', 'The growth of the Internet, which I have been involved in, and the growth of mobile telephone services, which NTT DoCoMo has been a leader in, have been peculiarly interlinked and at the same time separate. The Internet is a lab experiment that broke free, and finds itself in a world of its own contriving, which it often does not understand. The mobile telephone world was developed for commercial purposes, and is in many respects the son of its father, the wired telephone system. Each seeks to bring innovative services to its users.', NULL, '5679490.JPG', '2315214.pdf', 1, 2005, 'West Sussex', 51, '2019-01-20 20:12:19', '2019-01-20 20:12:19', '203.190.11.118'),
(552, 253, 1, NULL, 1, 'Observers in Control Systems A Practical Guide', 'observers-in-control-systems-a-practical-guide', NULL, '0-12-237472-X', NULL, 'Frequency Domain,  Luenberger Observer.', 'Observers are digital algorithms that combine sensor outputs with knowledge of the system to provide results superior to traditional structures, which rely wholly on sensors. Observers have been used in selected industries for years, but most books explain them with complex mathematics. Observers in Control Systems uses intuitive discussion, software experiments, and supporting analysis to explain the advantages and disadvantages of observers. If you are working in controls and want to improve your control systems, observers could be the technology you need and this book will give you a clear, thorough explanation of how they work and how to use them.', NULL, '2847324.jpg', '1355233.pdf', 1, 2002, 'New York', 51, '2019-01-20 20:17:21', '2019-01-20 20:17:21', '203.190.11.117'),
(553, 254, 1, NULL, 1, 'Multivariable Control Systems : An Engineering Approch', 'multivariable-control-systems-an-engineering-approch', NULL, '1852337389', NULL, 'Control Systems , Multivariable', 'The topics of control engineering and signal processing continue to flourish and develop. In common with general scientific investigation, new ideas, concepts and interpretations emerge quite spontaneously and these arc then discussed. used. discarded or subsumed into the prevailing subject paradigm. Sometimes these innovative concepts coalesce into a new sub-discipline within the broad subject tapestry of control and signal processing. This preliminary battle between old and new usually takes place at conferences. through the Internet and in the journals of the discipline. After a little more maturity has been acquired by the new concepts then archival publication as a scientific or engineering monograph may occur.', NULL, '6871122.JPG', '7056525.pdf', 1, 2004, 'London', 48, '2019-01-20 20:19:24', '2019-01-20 20:19:24', '203.190.11.117'),
(554, 128, 1, NULL, 1, 'Electrical Steels for Rotating Machines', 'electrical-steels-for-rotating-machines', NULL, '0852969805 978-0852969809', NULL, NULL, 'Electrical steels are used to form the ferromagnetic cores of motors, generators and transformers. This book provides an insight for the electrical design engineer into what properties may be expected from electrical steels and how these properties may best be exploited in machine design.', NULL, '8371889.jpg', '9158229.pdf', 1, 2002, 'London', 40, '2019-01-20 20:25:29', '2019-01-20 20:25:29', '203.190.11.118'),
(555, 255, 1, NULL, 1, 'Nanotechnology for Electronic Materials and Devices', 'nanotechnology-for-electronic-materials-and-devices', NULL, '978-0387-23349 -9', NULL, 'Electronic Materials , Nanotechnology', 'The very dynamic stage of science and technology related to the advanced and future electronics and photonics creates a growing gap between the large number of rapid publications and nanotechnology highlights in media on one side and fundamental understanding of underlying phenomena and an adequate evaluation of scientific discoveries and technological innovations on the other side. Writing a tutorial book on fundamentals of science and technology for electronics at this time is almost the same level of challenge as writing a history book during a revolution.', NULL, '3400979.JPG', '5503629.pdf', 1, 2007, 'New York', 48, '2019-01-20 20:28:25', '2019-01-20 20:28:25', '203.190.11.115'),
(556, 230, 1, NULL, 1, 'CMOS VLSI Design : A Circuits and Systems Perspective', 'cmos-vlsi-design-a-circuits-and-systems-perspective-20391540', '4th', '978-0-321-54774-3', NULL, 'Design  , Circuits  Systems', 'This incredible growth has come from steady miniaturization of transistors and improvements in manufacturing processes. Most other fields of engineering involve trade-offs between performance, power, and price. However, as transistors become smaller, they also become faster, dissipate less power, and are cheaper to manufacture. This synergy has not only revolutionized electronics, but also society at large.', NULL, '4445499.JPG', '9777239.pdf', 1, 2011, 'New York', 48, '2019-01-20 20:39:40', '2019-01-20 20:39:40', '203.190.11.118'),
(557, 196, 1, NULL, 1, 'Bluetooth Security', 'bluetooth-security-20401526', NULL, '1-58053-504-6', NULL, NULL, 'Bluetooth technology is becoming a popular way to furnish short-range wireless interconnectivity as an alternative to existing wire applications or as an enabling technology for new ones. With the number of Bluetooth-equipped consumer and industry devices rapidly increasing, it stands on the threshold of global deployment.', NULL, '7425560.jpg', '1478254.pdf', 1, 2004, 'Canada', 40, '2019-01-20 20:40:26', '2019-01-20 20:40:26', '203.190.11.115'),
(558, 72, 1, NULL, 1, 'Antenna Toolkit', 'antenna-toolkit', '2nd ed.', '075064947X', NULL, 'Radio signals, Antenna, Wire, connection, grounds, Doublets, dipoles, Hertzian antennas.', 'If you are interested in amateur radio, short-wave listening, scanner monitoring, or any other radio hobby, then you will probably need to know a few things about radio antennas. This book is intended for the radio enthusiast whether ham operator, listening hobbyist, or radio science observer who wants to build and use antennas for their particular requirements and location. All of the antennas in this book can be made from wire, even though it is possible to use other materials if you desire.', NULL, '2845550.jpg', '9177236.pdf', 1, 2001, 'New Delhi', 49, '2019-01-20 20:44:01', '2019-01-20 20:44:01', '203.190.11.118'),
(559, 256, 1, NULL, 1, 'Bluetooth Application Developer\'s Guide', 'bluetooth-application-developers-guide-20591532', NULL, '1-928994-42-3', NULL, NULL, 'Bluetooth is the most exciting development in wireless computing this decade! Bluetooth enabled devices can include everything from network servers, laptop computers and PDAs, to stereos and home security systems. Most Bluetooth products to hit the market in 2001 will be PC cards for laptop computers and access points, which allow up to seven Bluetooth devices to connect to a network. Reports indicate that by the end of 2003 there will be over 2 billion Bluetooth-enabled devices.', NULL, '9783499.jpg', '6770184.pdf', 1, 2002, 'USA', 40, '2019-01-20 20:59:32', '2019-01-20 20:59:32', '203.190.11.115'),
(560, 64, 1, NULL, 1, 'CDMA Mobile Radio Design', 'cdma-mobile-radio-design', NULL, 'l580530591', NULL, 'Network Architecture, Cellular Wireless Communications, CDMA, MCU, DSP, MCU, Digital Demodulator.', 'Wireless communications is growing at a phenomenal rate. From 1991 to 1999, the number of subscribers increased from about 25 million to over 250 million. Incredibly, over the next seven years, the number. of subscribers is expected to quadruple, to over 1 billion. That growth rate is faster than that of any other consumer electronics product and is similar to that of the Internet.', NULL, '3563193.gif', '2900071.pdf', 1, 2000, 'London', 49, '2019-01-20 21:01:18', '2019-01-20 21:01:18', '203.190.11.115'),
(561, 12, 1, NULL, 1, 'The Induction Machines Design Handbook', 'the-induction-machines-design-handbook', '2nd ed.', '978-1-4200-6668-5 (Hardback)', NULL, NULL, 'Developments in power electronics and digital control have made the rugged, low-cost, high-performance induction machine the popular choice of electric generator/motor in many industries. As the induction machine proves to be an efficient power solution for the flexible, distributed systems of the near future, the dynamic worldwide market continues to grow.', NULL, '5861305.jpg', '4101099.pdf', 1, 2010, 'New York', 40, '2019-01-20 21:11:40', '2019-01-20 21:11:40', '203.190.11.117'),
(562, 257, 1, NULL, 1, 'MODELING AND ANALYSIS OF TELECOMMUNICATIONS NETWORKS', 'modeling-and-analysis-of-telecommunications-networks', NULL, '0-471-34845-7', NULL, 'computer science, Telecommunications,', 'The insinuation of telecommunications into the daily fabric of our lives has been arguably the most important and surprising development of the last 25 years. Before this revolution, telephone service and its place in our lives had been largely stable for more than a generation. The growth was, so to speak, lateral, as the global reach of telecommunications extended and more people got telephone service. The distinction between oversea and domestic calls blurred with the advances in switching and transmission, undersea cable, and communication satellites. Traffic on the network remained overwhelmingly voice, largely in analog format with\r\nfacsimile (Fax) beginning to make inroads. A relatively small amount of data traffic was carried by modems operating at rates up to 9600 bits per second over voice connections. Multiplexing of signals was rudimentaryâ€”most connections were point-to-point business applications.', 'https://images-na.ssl-images-amazon.com/images/I/41h%2BbKwGXSL._SX313_BO1,204,203,200_.jpg', NULL, '4902440.pdf', 1, 2004, 'New Jersey', 51, '2019-01-20 21:18:15', '2019-01-20 21:18:15', '203.190.11.117'),
(563, 244, 1, NULL, 1, 'CMOS VLSI Design : A Circuits and Systems Perspective', 'cmos-vlsi-design-a-circuits-and-systems-perspective-20191626', '3rd', '9780321269775', NULL, 'Design  , Systems Perspective', 'By the point ,MOS transistor as voltage_controlled switches . How to build logic gates of transistor and how transistor fabricuted a layout that specific how transistor should be placed and counted together.', NULL, '1561973.JPG', '6911154.pdf', 1, 2004, 'USA', 48, '2019-01-20 21:19:26', '2019-01-20 21:19:26', '203.190.11.117'),
(564, 103, 1, NULL, 1, 'HVDC and FACTS Controllers: Applications of Static Converters in Power Systems', 'hvdc-and-facts-controllers-applications-of-static-converters-in-power-systems', NULL, '1-4020-7891-9 1-4020-7890-0', NULL, NULL, 'HVDC and FACTS Controllers: Applications of Static Converters in Power Systems focuses on the technical advances and developments that have taken place in the past ten years or so in the fields of High Voltage DC transmission and Flexible AC transmission systems. These advances (in HVDC transmission and FACTS) have added a new dimension to power transmission capabilities.', NULL, '1387129.jpg', '9532572.pdf', 1, 2004, 'London', 40, '2019-01-20 21:19:55', '2019-01-20 21:19:55', '203.190.11.117'),
(565, 125, 1, NULL, 1, 'Handbook of Image and Video Processing', 'handbook-of-image-and-video-processing', NULL, '0-12-119790-5', NULL, NULL, 'The Handbook of Image and Video Processing contains a comprehensive and highly accessible presentation of all essential mathematics, techniques, and algorithms for every type of image and video processing used by scientists and engineers. The timely volume will provide both the novice and the seasoned practitioner with the necessary information and skills to be able to develop algorithms and applications for multimedia, digital imaging, digital video, telecommunications, and World Wide Web industries.', NULL, '8114550.jpg', '7835003.pdf', 1, 2000, 'London', 40, '2019-01-20 21:31:14', '2019-01-20 21:31:14', '203.190.11.115'),
(566, 103, 1, NULL, 1, 'New Developments in Quantum Field Theory', 'new-developments-in-quantum-field-theory', NULL, '0-306-47075-6', NULL, 'Quantum  Theory, Developments', 'The free relativistic particle provides us with the simplest example of â€œquantum\r\ngeometryâ€. The action of a free relativistic particle is just the length of its world line* in\r\nRd. The classical path between two space-time points x and y is just the straight line.\r\nThe system is quantized by summing over all paths Pxy from x to y with the Boltzmann\r\nweight determined by the classical action, which is simply the length L(Pxy ) of the path.\r\nWe write for the relativistic two-point function.', NULL, '9902447.JPG', '5854405.pdf', 1, 2002, 'New York', 48, '2019-01-20 21:35:38', '2019-01-20 21:35:38', '203.190.11.115'),
(567, 258, 1, NULL, 1, 'Newtonian Physics : Benjamin Crowell', 'newtonian-physics-benjamin-crowell', '2.3', '0-9704670-1-X', NULL, 'Newtonian  , Physics', 'The movement to reform physics texts is steaming ahead, but despite excellent books such as Hewittâ€™s Conceptual Physics for nonscience majors and Knightâ€™s Physics: A Contemporary Perspective for students who know calculus, there has been a gap in physics books for life-science majors who havenâ€™t learned calculus or are learning it concurrently with physics. This book is meant to fill that gap.', NULL, '8155897.JPG', '1450047.pdf', 1, 2005, 'California', 48, '2019-01-20 21:44:46', '2019-01-20 21:44:46', '203.190.11.117'),
(568, 49, 1, NULL, 1, 'JPEG2000 Standard for Image Compression Concepts, Algorithms and VLSI Architectures', 'jpeg2000-standard-for-image-compression-concepts-algorithms-and-vlsi-architectures', NULL, '0-471-48422-9', NULL, 'Arithmetic Coding, Algorithms,', 'The growing demand for interactive multimedia technologies, in various application domains in this era of wireless and Internet communication, necessitated a number of desirable properties to be included in image and video compression algorithms. Accordingly, current and future generation image compression algorithms should not only demonstrate state-of-the-art performance, it should also provide desirable functionalities such as progressive transmission in terms of image fidelity as well as resolution, scalability, region-of-interest coding, random access, error resilience, handling large-size images of different types, etc.', NULL, '2907193.JPG', '4148466.pdf', 1, 2005, 'New Jersey', 51, '2019-01-20 21:49:26', '2019-01-20 21:49:26', '203.190.11.117'),
(569, 259, 1, NULL, 1, 'Newnes Data Communications Pocket Book', 'newnes-data-communications-pocket-book', '4th', '0 7506 52977', NULL, 'Data Communications , Newnes', 'Data communications continues to expand due to the increased use of multi-media computers and through the use of the Internet and company-wide Intranets. The amount of data traffic carried over public telecommunication networks now exceeds that of voice traffic. Data communications links range from a simple low-speed modem operating over a pair of copper wires, through to complex packet switched networks operating over an optical fibre.', NULL, '5968687.JPG', '1272129.pdf', 1, 2002, 'London', 48, '2019-01-20 21:55:24', '2019-01-20 21:55:24', '203.190.8.116'),
(570, 12, 1, NULL, 1, 'Linear Synchronous Motors: Transportation and Automation Systems', 'linear-synchronous-motors-transportation-and-automation-systems-20021731', NULL, '0849318599', NULL, 'Materials and Construction, Motion Control.', 'Contrary to some opinions, electric motors are decidedly not part of an old-fashioned area of research. They are, in fact, the most popular machines of everyday life, and the number of types increase almost every year. Advances in materials engineering, power electronics, and control strategies along with energy and reliability demands continue to stimulate the development of exciting new technologies and applications. Ranking high among the most exciting of these technologies are linear synchronous motors (LSMs).', NULL, '3720457.jpg', '8363611.pdf', 1, 2000, 'New York', 51, '2019-01-20 22:02:31', '2019-01-20 22:02:31', '203.190.11.115'),
(571, 72, 1, NULL, 1, 'Newnes Radio and RF Engineering Pocket Book', 'newnes-radio-and-rf-engineering-pocket-book', '3rd', '978-0080974484', NULL, 'Newnes Radio , RF Engineering', 'A starting point for considering the propagation of radio- or light waves is the isotropic radiator, an imaginary point source radiating equally in all directions in free space. Such a radiator placed at the center of a sphere illuminates equally the complete surface of the sphere. As the surface area of a sphere is given by 4Ï€ r2 where r is the radius of\r\nthe sphere, the brilliance of illumination at any point on the surface varies inversely with the distance from the radiator. In radio terms, the power density at distance from the source.', NULL, '9098023.JPG', '8588969.pdf', 1, 2012, 'New York', 48, '2019-01-20 22:02:59', '2019-01-20 22:02:59', '203.190.11.118'),
(572, 260, 1, NULL, 1, 'High-Order Accurate Methods For Maxwell Equations', 'high-order-accurate-methods-for-maxwell-equations', NULL, NULL, NULL, 'Boundary conditions, Parallelization Strategy.', 'Maxwell equations represent the unification of electric and magnetic fields predicting electromagnetic phenomena. Some uses include scattering, wave guides, antennas and radiation. In recent years these applications have expanded to include modularization of digital electronic circuits, wireless communication, land mine detection, design of microwave integrated circuits and nonlinear optical devices.', NULL, NULL, NULL, 1, 2002, 'Northwest Tel Aviv', 51, '2019-01-20 22:13:37', '2019-01-20 22:13:37', '203.190.11.117'),
(573, 10, 1, NULL, 1, 'Topology and Geometry in Physics', 'topology-and-geometry-in-physics', NULL, '3-540-23125-0', NULL, 'Topology, Geometry in Physics', 'The concepts and methods of topology and geometry are an indispensable part of theoretical physics today. They have led to a deeper understanding of many crucial aspects in condensed matter physics, cosmology, gravity, and particle physics. Moreover, several intriguing connections between only apparently disconnected phenomena have been revealed based on these mathematical tools. Topological and geometrical considerations will continue to play a central role in theoretical physics. We have high hopes and expect new insights ranging from an understanding of high-temperature superconductivity up to future progress in the construction of quantum gravity', NULL, '/tmp/phpMChz57', '6560530.pdf', 1, 2005, 'New York', 51, '2019-01-20 22:18:13', '2019-01-20 22:36:02', '203.190.11.118'),
(574, 107, 1, NULL, 1, 'Modern Differential Geometry for Physicists', 'modern-differential-geometry-for-physicists-20271718', '2nd ed.', '981-02-3562-3', NULL, 'Modern Differential Geometry, Vector Fields .', 'This book is based on lecture notes for the introductory course on\r\nmodern, coordinate-free differential geometry which is taken by our\r\nfirst-year theoretical physics PhD students, or by students attending\r\nthe one-year MSc course â€œFundamental Fields and Forcesâ€ at Imperial\r\nCollege.', NULL, '4348363.JPG', '9017031.pdf', 1, 1999, 'New Jersey', 51, '2019-01-20 22:27:18', '2019-01-20 22:27:18', '203.190.11.117'),
(575, 125, 1, NULL, 1, 'Practical Switching Power Supply Design', 'practical-switching-power-supply-design', '1st ed.', '0-12-137030-5 (alk. paper)', NULL, NULL, 'Take the \"black magic\" out of switching power supplies with Practical Switching Power Supply Design! This is a comprehensive \"hands-on\" guide to the theory behind, and design of, PWM and resonant switching supplies. You\'ll find information on switching supply operation and selecting an appropriate topology for your application. There\'s extensive coverage of buck, boost, flyback, push-pull, half bridge, and full bridge regulator circuits. Special attention is given to semiconductors used in switching supplies', NULL, '1292769.jpg', '6867591.pdf', 1, 1990, 'New York', 40, '2019-01-20 23:04:11', '2019-01-20 23:04:11', '203.190.11.118'),
(576, 72, 1, NULL, 1, 'Power Supply Cookbook', 'power-supply-cookbook', '2nd ed.', '0-7506-7329-X', NULL, NULL, 'Power Supply Cookbook, Second Edition provides an easy-to-follow, step-by-step design framework for a wide variety of power supplies. With this book, anyone with a basic knowledge of electronics can create a very complicated power supply design in less than one day. With the common industry design approaches presented in each section, this unique book allows the reader to design linear, switching, and quasi-resonant switching power supplies in an organized fashion', NULL, '8979414.jpg', '9573642.pdf', 1, 2001, 'New Delhi', 40, '2019-01-20 23:15:44', '2019-01-20 23:15:44', '203.190.11.115'),
(577, 43, 1, NULL, 1, 'Brushless Permanent-Magnet Motor Design', 'brushless-permanent-magnet-motor-design', NULL, '0-07-026025-7 (alk. paper)', NULL, NULL, 'Hanselman begins with the fundamental concepts of generic motor operation and design. Based on these fundamental concepts, he identifies and explains terminology, describes how the fundamental concepts both influence and limit motor design and performance, and discusses brushless DC and synchronous motor design for both cylindrical (radial) and pancake (axial) topologies. Annotation copyright Book News', NULL, '4334843.jpg', '1764325.pdf', 1, 1994, 'New York', 40, '2019-01-20 23:20:26', '2019-01-20 23:20:26', '203.190.11.118'),
(578, 261, 1, NULL, 1, 'Laser Light Dynamics, Volume II', 'laser-light-dynamics-volume-ii', NULL, '978-0444860217', NULL, 'Laser Light', 'This volume deals with laser physics emphasizing laser theory from a physical point of view. It takes into account most recent developments focussing on the dynamics. Proceeding from simple to more difficult questions, the book treats, among other topics: typical experimental laser systems, intensities of laser light in single and multimode lasers, mode competition, hole-burning, Q-switched lasers, relaxation-oscillations, frequency shifts, population pulsations, mode-locking, ultrashort pulses, self-pulsing, laser light chaos, instability hierarchies, laser gyro, optical bistability, optical transistor, two-photon laser, laser line width, Hanbury-Brown-Twiss experiment, intensity correlations, photon statistics, quantum classical correspondence, laser phase-transition analogy, the laser as a synergetic system.', NULL, '3391330.jpg', '3804512.pdf', 1, 1986, 'New York', 51, '2019-01-20 23:20:31', '2019-01-20 23:20:31', '203.190.11.115'),
(579, 12, 1, NULL, 1, 'Handbook  of  Lasers', 'handbook-of-lasers-20241853', NULL, NULL, NULL, 'Lasers,  MASERS.', 'Lasers continue to be an amazingly robust field of activity, one of continually expanding scientific and technological frontiers. Thus today we have lasing without inversion, quantum cascade lasers, lasing in strongly scattering media, lasing in biomaterials, lasing in photonic crystals, a single atom laser, speculation about black hole lasers, femtosecond-duration laser pulses only a few cycles long, lasers with subhertz linewidths, semiconductor lasers with\r\npredicted operating lifetimes of more than 100 years, peak powers in the petawatt regime and planned megajoule pulse lasers, sizes ranging from semiconductor lasers with dimensions of a few microns diameter and a few hundred atoms thick to huge glass lasers with hundreds of beams for inertial confinement fusion research, lasers costing from less than one dollar to\r\nmore than one billion dollars, and a multibillion dollar per year market.', NULL, '2540098.JPG', '5550998.pdf', 1, 2001, 'California', 51, '2019-01-20 23:24:53', '2019-01-20 23:24:53', '203.190.11.118'),
(580, 49, 1, NULL, 1, 'Electromechanical Energy Devices', 'electromechanical-energy-devices', '1st ed.', '0-471-57217-9 (alk. PaPer)', NULL, NULL, 'As the curriculums of electrical engineering programs became over crowded, many schools began combining electromechanical energy conversion and power systems analysis courses. There were no books to fit this trend, and using two books was uneconomical and confusing. Today, almost 15 % of the Universities in the US and the Canada require a combined course.', NULL, '1165110.jpg', '3124620.pdf', 1, 1994, 'Canada', 40, '2019-01-20 23:32:53', '2019-01-20 23:32:53', '203.190.11.115'),
(581, 43, 1, NULL, 1, 'Instructorâ€™s Manual to accompany Chapman Electric Machinery Fundamentals', 'instructors-manual-to-accompany-chapman-electric-machinery-fundamentals', '4th ed.', NULL, NULL, NULL, 'This Instructorâ€™s Manual is intended to accompany the fourth edition of Electric Machinery Fundamentals. To\r\nmake this manual easier to use, it has been made self-contained. Both the original problem statement and the\r\nproblem solution are given for each problem in the book. This structure should make it easier to copy pages from\r\nthe manual for posting after problems have been assigned.', NULL, '5109330.jpg', '5902809.pdf', 1, 2004, 'New York', 40, '2019-01-20 23:54:30', '2019-01-20 23:54:30', '203.190.11.118'),
(582, 244, 1, NULL, 1, 'Electric Machines: Theory, Operation, Applications, Adjustment, and Control', 'electric-machines-theory-operation-applications-adjustment-and-control', '2nd ed.', '9788131708026', NULL, NULL, 'Intended for courses in electrical machinery in which engineering practice is emphasized, this text provides coverage of AC and DC machines and stresses industry requirements and the NEMA standards of professional engineers. Traditional theories and concepts of mechanical force are also discussed.', NULL, '2386734.jpg', '7510238.pdf', 1, 2002, 'New Delhi', 40, '2019-01-21 00:04:25', '2019-01-21 00:04:25', '203.190.11.115'),
(583, 43, 1, NULL, 1, 'Circuit Analysis: Theory & Practice', 'circuit-analysis-theory-practice', '2nd ed.', NULL, NULL, NULL, 'n electrical circuit is a system of interconnected components such as resistors,\r\ncapacitors, inductors, voltage sources, and so on. The electrical behavior\r\nof these components is described by a few basic experimental laws. These\r\nlaws and the principles, concepts, mathematical relationships, and methods of\r\nanalysis that have evolved from them are known as circuit theory.', NULL, '2396148.jpg', '4657306.pdf', 1, 1999, 'New York', 40, '2019-01-21 00:12:24', '2019-01-21 00:12:24', '203.190.11.118'),
(584, 107, 1, NULL, 1, 'The Mathematical Beauty of Physics: A Memorial Volume for Claude Itzykson', 'the-mathematical-beauty-of-physics-a-memorial-volume-for-claude-itzykson', NULL, '9810228074', NULL, 'Physics, Mathematics.', NULL, NULL, '5909468.gif', '2771318.pdf', 1, 1997, 'New Jersey', 51, '2019-01-21 00:20:21', '2019-01-21 00:20:21', '203.190.11.118'),
(585, 186, 1, NULL, 1, 'Mathematical Tools for Physics', 'mathematical-tools-for-physics-20241942', NULL, '978-0486482125', NULL, 'Mathematical Tools', 'Having the right answer doesn\'t guarantee understanding. This book helps physics students learn to take an informed and intuitive approach to solving problems. It assists undergraduates in developing their skills and provides them with grounding in important mathematical methods.\r\nStarting with a review of basic mathematics, the author presents a thorough analysis of infinite series, complex algebra, differential equations, and Fourier series. Succeeding chapters explore vector spaces, operators and matrices, multivariable and vector calculus, partial differential equations, numerical and complex analysis, and tensors. Additional topics include complex variables, Fourier analysis, the calculus of variations, and densities and distributions. An excellent math reference guide, this volume is also a helpful companion for physics students as they work through their assignments.', NULL, '3358028.jpg', '2399922.pdf', 1, 2003, NULL, 51, '2019-01-21 00:24:42', '2019-01-21 00:24:42', '203.190.11.118'),
(586, 262, 1, NULL, 1, 'Homological Methods In Equations Of Mathematical Physics1', 'homological-methods-in-equations-of-mathematical-physics1', NULL, NULL, NULL, 'Homological Methods, Mathematical Physics', 'Mentioning (co)homology theory in the context of differential equations\r\nwould sound a bit ridiculous some 30â€“40 years ago: what could be in common between the essentially analytical, dealing with functional spaces theory of partial differential equations (PDE) and rather abstract and algebraic\r\ncohomologies?', NULL, '1972293.JPG', '3314146.pdf', 1, 1998, 'Russia', 51, '2019-01-21 00:33:40', '2019-01-21 00:33:40', '203.190.11.118'),
(587, 210, 1, NULL, 1, 'Introduction to Groups, Invariants and Particles', 'introduction-to-groups-invariants-and-particles', NULL, '978-1499273366', NULL, NULL, 'Group Theory, with its emphasis on Lie Groups and their application to the study of symmetries of the fundamental constituents of matter is introduced at a level suitable for Seniors and advanced Juniors majoring in the Physical Sciences. The book has its origin in a one-semester course that Professor Firk taught at Yale University for more than ten years. It is not generally appreciated by Physicists that continuous transformation groups (Lie Groups) originated in the Theory of Differential Equations. The infinitesimal generators of Lie Groups therefore have forms that involve differential operators and their commutators, and these operators and their algebraic properties have found, and continue to find, a natural place in the development of Quantum Physics', NULL, '5999927.jpg', '8236595.pdf', 1, 2000, 'U.S.A', 51, '2019-01-21 00:39:55', '2019-01-21 00:39:55', '203.190.11.118'),
(588, 244, 1, NULL, 1, 'Principles of Electric Circuits: Conventional Current Version', 'principles-of-electric-circuits-conventional-current-version', '8th ed.', '0132383519', NULL, NULL, 'This text provides an exceptionally clear introduction to DC/AC circuits supported by superior exercises, examples, and illustrations and an emphasis on troubleshooting and applications. Throughout the text\'s coverage, the use of mathematics is limited to only those concepts that are needed for understanding. Floyd\'s acclaimed troubleshooting emphasis provides students with the problem solving experience they need to step out of the classroom and into a job!', NULL, '4687982.jpg', '1879164.pdf', 1, 2007, 'New Delhi', 40, '2019-01-21 00:50:47', '2019-01-21 00:50:47', '203.190.11.118'),
(589, 44, 1, NULL, 1, 'Passive, Active, and Digital Filters', 'passive-active-and-digital-filters', '3rd ed.', '978-1-4200-5885-7 (Hardcover)', NULL, NULL, 'Upon its initial publication, The Circuits and Filters Handbook broke new ground. It quickly became the resource for comprehensive coverage of issues and practical information that can be put to immediate use. Not content to rest on his laurels, in addition to updating the second edition, editor Wai-Kai Chen divided it into tightly-focused texts that made the information easily accessible and digestible. These texts have been revised, updated, and expanded so that they continue to provide solid coverage of standard practices and enlightened perspectives on new and emerging techniques.', NULL, '8332500.jpg', '2820937.pdf', 1, 2009, 'New York', 40, '2019-01-21 00:57:42', '2019-01-21 00:57:42', '203.190.11.115'),
(590, 12, 1, NULL, 1, 'The Communications Handbook', 'the-communications-handbook', '2nd ed.', '0-8493-0967-0', NULL, NULL, 'For more than six years, The Communications Handbook stood as the definitive, one-stop reference for the entire field. With new chapters and extensive revisions that reflect recent technological advances, the second edition is now poised to take its place on the desks of engineers, researchers, and students around the world. From fundamental theory to state-of-the-art applications, The Communications Handbook covers more areas of specialty with greater depth that any other handbook available', NULL, '6469675.jpg', '9894584.pdf', 1, 2002, 'London', 40, '2019-01-21 01:13:45', '2019-01-21 01:13:45', '203.190.11.115'),
(591, 152, 1, NULL, 1, 'Control Automation of electrical Power Distribution System', 'control-automation-of-electrical-power-distribution-system', '1st ed.', '0824726316( Hardcover)', NULL, NULL, 'Implementing the automation of electric distribution networks, from simple remote control to the application of software-based decision tools, requires many considerations, such as assessing costs, selecting the control infrastructure type and automation level, deciding on the ambition level, and justifying the solution through a business case. Control and Automation of Electric Power Distribution Systems addresses all of these issues to aid you in resolving automation problems and improving the management of your distribution network.', NULL, '8844041.jpg', '3469109.pdf', 1, 2007, 'New York', 40, '2019-01-21 01:27:45', '2019-01-21 01:27:45', '203.190.11.115'),
(592, 263, 1, NULL, 1, 'Mathematical Methods for Physicists', 'mathematical-methods-for-physicists', NULL, '0 521 65544 7', NULL, 'Mathematical, Physicists.', 'This book evolved from a set of lecture notes for a course on `Introduction to\r\nMathematical Physics\', that I have given at California State University, Stanislaus (CSUS) for many years. Physics majors at CSUS take introductory mathematical physics before the physics core courses, so that they may acquire the expected level of mathematical competency for the core course. It is assumed that the student has an adequate preparation in general physics and a good understanding of the mathematical manipulations of calculus. For the student who is in need of a review of calculus, however, Appendix 1 and Appendix 2 are included.', NULL, '8324260.JPG', '4470782.pdf', 1, 2002, 'New York', 51, '2019-01-21 01:53:46', '2019-01-21 01:53:46', '203.190.11.115'),
(593, 64, 1, NULL, 1, 'CDMA RF System Engineering', 'cdma-rf-system-engineering', NULL, '0-89006-991-3', NULL, 'DS-SS in Mobile Communication, Radio Propagation, Digital RF Communication, Code Division Multiple Access, Link Structure, Call Processing, CDMA Traffic Engineering.', 'The wireless communications industry has been undergoing tremendous changes in the last few years. With the auction of personal communication services (PCS) licenses in the United States, most incumbent service providers found themselves competing with not just one, but several other service providers who offered comparable services at competitive prices. At the same time,\r\nthe wireless subscriber base has been increasing as well, with some projecting the total number of worldwide wireless subscribers reaching over 360 million by year 2000.', NULL, '4647759.gif', '9940134.pdf', 1, 1998, 'London', 49, '2019-01-21 14:47:06', '2019-01-21 14:47:06', '203.190.11.118'),
(594, 64, 1, NULL, 1, 'CDMA Systems Capacity Engineering', 'cdma-systems-capacity-engineering', NULL, '1-58053-812-6', NULL, 'CDMA Systems, Single Cell CDMA Capacity, CDMA Cellular Systems, Traffic Activity on System Capacity, Capacity Under the Delay Constraint, Hybrid FDMA/CDMA, Numerical Results.', 'Technology must be sustainable in the sense of efficiency, not only to satisfy quality requirements, but to obtain the same objectives with the minimum resources. Quality satisfaction has been an interesting issue to engineers as an objective of target technology, and technologies are continually evolving to optimize and fulfill the required qualities. The satisfaction objectives of quality can be quantitatively modeled in many cases. There had been continuous improvement of the satisfaction level on the modeled spaces, because the modeled problem is rather concrete and resolvable analytically within the artificially configured world.', NULL, '6670097.jpg', '1969098.pdf', 1, 2005, 'London', 49, '2019-01-21 14:54:34', '2019-01-21 14:54:34', '203.190.11.115'),
(595, 49, 1, NULL, 1, 'Theory of code division multiple access communication', 'theory-of-code-division-multiple-access-communication', NULL, '0-471-45712-4', NULL, 'Cellular Mobile Radio Communication, Spread Spectrum Communication Systems, Spread Spectrum Signals in AWGN Channels, Signal Generation, CDMA Cellular Networks.', 'The objective of this book is to provide an introduction to code division multipleaccess (CDMA) communications. Our motivation for emphasizing CDMA communication is a result of the technological developments that have occurred during the past decade. We are currently witnessing an explosive growth in wireless communication and cellular mobile radio systems, which are based on different multiple-access techniques. We anticipate that, in the near future, we will see a replacement of the current time- and frequency division methods in wireless\r\ncommunication and mobile radio by CDMA.', NULL, '6859425.gif', '1372022.pdf', 1, 2004, 'Canada', 49, '2019-01-21 15:05:04', '2019-01-21 15:05:04', '203.190.11.118'),
(596, 86, 1, NULL, 1, 'Electronic Circuits', 'electronic-circuits', '9th', '978-0136114994', NULL, 'Electronic , Circuits', 'Designed for use in a one or two-semester Introductory Circuit Analysis or Circuit Theory Course taught in Electrical to build an understanding of concepts and ideas explicitly in terms of previous learning To emphasize the relationship between conceptual understanding and problem solving approaches To provide students with a strong foundation of engineering practices.', NULL, '1667036.JPG', '3544692.PDF', 1, 2010, 'USA', 48, '2019-01-21 15:58:59', '2019-01-21 15:58:59', '203.190.11.117'),
(597, 220, 1, NULL, 1, 'MECHATRONICS SYSTEM DESIGN', 'mechatronics-system-design', 'SECOND EDITION', '978-1-4390-6199-2', NULL, 'MECHATRONICS, SYSTEM, DESIGN', 'In this book, we have used both MKS and CGS units. USCS units or FPS units used in the US Edition of the book have been converted to SI units throughout the text and problems. However, in case of data sourced from handbooks, government standards, and product manuals, it is not only\r\nextremely difficult to convert all values to SI, it also encroaches upon the intellectual property of the source. Some data in figures, tables, and references, therefore, remains in FPS units. For readers unfamiliar with the relationship between the FPS and the SI systems, a conversion table has been\r\nprovided inside the front cover', NULL, '9713945.JPG', '3995163.pdf', 1, 2010, 'Australia', 50, '2019-01-21 16:11:29', '2019-01-21 16:11:29', '203.190.11.117'),
(598, 264, 1, NULL, 1, 'Nonlinear Control Systems', 'nonlinear-control-systems', '3rd', '3-540-19916-0', NULL, 'Control Systems , Nonlinear', 'Invariant dis-tributions. a fundamental tool in the analysis of the internal structure of nonlinear systems. With the aid of this concept. it is shown that a non-linear system locally exhibits decompositions into -reachablrilunrenchable\" parts and/or -obsenable/mtobservable- parts. similar to those introduced by Kalman for linear systems. Chapter 2 explains to what extent global decompositions may exist. corresponding to a partition of the whole stare space into -haver dimensional\". teachability and/or indistinguishability sub. sets. Chapter 3 describes various -formats\" in which the input-output map of a nonlinear system may be represented.', NULL, '9065209.JPG', '1510846.pdf', 1, 1989, 'New York', 48, '2019-01-21 16:14:33', '2019-01-21 16:14:33', '203.190.11.115'),
(599, 175, 1, NULL, 1, 'MECHATRONICS IN ENGINEERING DESIGN AND PRODUCT DEVELOPMENT', 'mechatronics-in-engineering-design-and-product-development', '1st ed.', '978-0824702267', NULL, 'MECHATRONICS, ENGINEERING, PRODUCT, DEVELOPMENT', 'This work presents a systematic and comprehensive overview to the theory and applications of mechatronic processes, emphasizing the adaptation and incorporation of this important tool in fulfilling desired performance and quality requirements. The authors address the core technologies needed for the design and development of the mechatronic product, cover design approaches, discuss related mechatronic product design aspects, and detail mechatronic product application examples.', NULL, '1906917.JPG', '4422224.pdf', 1, 1999, 'New York', 50, '2019-01-21 16:23:29', '2019-01-21 16:23:29', '203.190.11.117'),
(600, 96, 1, NULL, 1, 'Noise In Receiving Systems', 'noise-in-receiving-systems', NULL, '978-0471892359', NULL, 'Receiving Systems , Noise', 'Now that we have seen what some of the ultimate limitations of commuruca-non channels arc, we should back off somewhat and take a <103C1 look at the entire range of electrical noise. intrinsic or otherwise. This is not only instruc-tive, but will place the principal object of study in this took- thermal HOW In proper perspective Future 2.1 shows a claimficauon of various types of noise commonly encountered. Obviously. this classification is neither albtnclusive nor the only one possible III Depending on the emphasis and the interests of the coda. the same material could be arranged in many different ways.', NULL, '8551295.JPG', '3164197.pdf', 1, 1984, 'New York', 48, '2019-01-21 16:25:35', '2019-01-21 16:25:35', '203.190.11.115'),
(601, 265, 1, NULL, 1, 'Control and Information Sciences', 'control-and-information-sciences', NULL, '0-38?-15595-3', NULL, 'Information Sciences , Sciences', 'Differential geometry has proven to be as successful to the study of nonlinear systems as Laplace transform and complex functions theory were in the \'50s to the study of single-input single-output linear systems and linear algebra in the \'60s to the study of multi-variable linear systems. Typical \"synthesis\" problems like disturbance isolation, non-interaction, shaping of the input-output response via feedback, can be dealt with relative ease, with tools that are well within the reach of a (mathematically oriented) control engineer.', NULL, '1688842.JPG', '4434429.pdf', 1, 1985, 'New York', 48, '2019-01-21 16:37:17', '2019-01-21 16:37:17', '203.190.11.115'),
(602, 125, 1, NULL, 1, 'Engineering Digital Design', 'engineering-digital-design', '2nd ed.', '0-12-691295-5', NULL, 'Digital Design', 'Both the basics and background fundamentals are presented in this text. But it goes well\r\nbeyond the basics to provide significant intermediate-to-advanced coverage of digital design\r\nmaterial, some of which is covered by no other text. In fact, this text attempts to provide\r\ncourse coverage at both the first and second levels â€” an ambitious undertaking. The aim\r\nis to provide the reader with the tools necessary for the successful design of relatively\r\ncomplex digital systems from first principles. In doing so, a firm foundation is laid for the\r\nuse of CAD methods that are necessary to the design of large systems. In a related sense,', NULL, '4462959.JPG', '3779300.pdf', 1, 2000, 'New York', 52, '2019-01-21 16:38:21', '2019-01-21 16:38:21', '203.190.11.115'),
(603, 266, 1, NULL, 1, 'Fundamentals of Power Semiconductor Device', 'fundamentals-of-power-semiconductor-device', NULL, '978-0-387-47313-0', NULL, 'Power Device, Semi Conductor', 'Today the semiconductor business exceeds $200 billion with about 10% of the\r\nrevenue derived from power semiconductor devices and smart power integrated\r\ncircuits. Power semiconductor devices are recognized as a key component for all\r\npower electronic systems. It is estimated that at least 50% of the electricity used in\r\nthe world is controlled by power devices. With the widespread use of electronics in\r\nthe consumer, industrial, medical, and transportation sectors, power devices have a\r\nmajor impact on the economy because they determine the cost and efficiency of\r\nsystems. After the initial replacement of vacuum tubes by solid-state devices in\r\nthe 1950s, semiconductor power devices have taken a dominant role with silicon\r\nserving as the base material. These developments have been referred to as the\r\nSecond Electronic Revolution.', NULL, '1992743.PNG', '3806782.pdf', 1, 2008, 'U.S.A', 39, '2019-01-21 16:43:56', '2019-01-21 16:43:56', '203.190.11.54'),
(604, 62, 1, NULL, 1, 'Fundamentals of Quantum Mechanics : For Solid State Electronics and Optics', 'fundamentals-of-quantum-mechanics-for-solid-state-electronics-and-optics', NULL, '978-0-511-12595-9', NULL, 'Quantum Mechanics', 'There are many excellent introductory text books on quantum mechanics for\r\nstudents majoring in physics or chemistry that emphasize atomic and nuclear physics\r\nfor the former and molecular and chemical physics for the latter. Often, the approach\r\nis to begin from a historic perspective, recounting some of the experimental observations\r\nthat could not be explained on the basis of the principles of classical mechanics\r\nand electrodynamics, followed by descriptions of various early attempts at developing\r\na set of new principles that could explain these â€˜anomalies.â€™ It is a good way to show\r\nthe students the historical thinking that led to the discovery and formulation of the\r\nbasic principles of quantum mechanics.', NULL, '9354138.PNG', '4613278.pdf', 1, 2005, 'New York', 39, '2019-01-21 16:54:26', '2019-01-21 16:54:26', '203.190.11.54'),
(605, 267, 1, NULL, 1, 'Numerical Methods', 'numerical-methods', NULL, '978-81-224-2978-7', NULL, 'Numerical  , Methods', 'To introduce students from a variety of discipline and backgrounds to the vast of problems that are amerable to numerical solution.The emphasis is placed on application rather than pure theory,which ,although kept to a minimum and presented in a mostly heuristic and intuitive manner.This is deemed sufficient for the student to fully understand the working, efficiency and shortcoming or failing of each technique.', NULL, '4585018.JPG', '8632646.pdf', 1, 2010, 'Bangalore', 48, '2019-01-21 16:55:58', '2019-01-21 16:55:58', '203.190.11.115'),
(606, 49, 1, NULL, 1, 'Cellular Mobile Radio Systems Designing Systems for Capacity Optimization', 'cellular-mobile-radio-systems-designing-systems-for-capacity-optimization', NULL, '0471956414', NULL, 'Special efficiency in land mobile system, Modulation Techniques, Multiple Access Techniques.', 'The idea of the book was born during the time when the second generation cellular system was looming on the horizon. At that time, the world was divided into three distinct camps as far as looking for a standard: Europe, North America and Japan. It was obvious at the outset that Europe was in favour of a Pan-European Second Generation Cellular System with one standard across Europe, benefiting from the successful Nordic experience. North America with different systems as a continuation of the deregulation of the telecommunications industry; And Japan with a standard which may or may not agree with the North American second generation cellular system. One thing was far from obvious: what would the new cellular system look like?', NULL, '3857542.gif', '4359378.pdf', 1, 1997, 'New York', 49, '2019-01-21 16:56:25', '2019-01-21 16:56:25', '203.190.11.118'),
(607, 30, 1, NULL, 1, 'Fundamentals of Liquid Crystal Devices', 'fundamentals-of-liquid-crystal-devices', NULL, '978-0-470-01542-1', NULL, 'Liquid crystal , Crystal Device', 'The book is organized in such a way that the first few chapters cover the basics of liquid crystals\r\nand the necessary techniques to study and design liquid crystal devices. The later chapters cover the\r\nprinciples, design, operation, and performance of liquid crystal devices. Because of limited space, we\r\ncannot cover every aspect of liquid crystal chemistry and physics and all liquid crystal devices, but we\r\nhope this book can introduce readers to liquid crystals and provide them with the basic knowledge and\r\ntechniques for their careers in liquid crystals.', NULL, '4389492.PNG', '2735559.pdf', 1, 2006, 'England', 39, '2019-01-21 16:59:08', '2019-01-21 16:59:08', '203.190.11.54'),
(608, 245, 1, NULL, 1, 'Electronic Circuit Analysis and Design', 'electronic-circuit-analysis-and-design', '2nd ed.', '978-0072409574', NULL, 'Electronic, Circuit, Analysis, Design', 'Electronic Circuit Analysis and Design introduces students to the concepts of microelectronic circuits and devices. This book can be used in the electronic circuits or microelectronics course taught at the junior level at every engineering school. The text takes a traditional approach to electronic circuits, covering important semiconductor devices and their applications; analog electronics, including operational amplifiers and integrated circuits; and digital circuits. Throughout the book, the processes of design and computer-aided analysis are emphasized in balance with the coverage of the fundamentals and hand analysis.', NULL, '7237140.JPG', '7240489.pdf', 1, 2000, 'New York', 50, '2019-01-21 17:09:22', '2019-01-21 17:09:22', '203.190.11.117'),
(609, 268, 1, NULL, 1, 'Electric Machinery Fundamentals', 'electric-machinery-fundamentals', '4th ed.', NULL, NULL, 'MACHINERY, TRANSFORMERS, POWER ELECTRONICS, MOTORS, DC MOTORS AND GENERATORS,', 'This Instructorâ€™s Manual is intended to accompany the fourth edition of Electric Machinery Fundamentals. To make this manual easier to use, it has been made self-contained. Both the original problem statement and the problem solution are given for each problem in the book. This structure should make it easier to copy pages from the manual for posting after problems have been assigned.', NULL, '3261371.gif', '5382755.pdf', 1, 2004, 'Australia', 49, '2019-01-21 17:09:43', '2019-01-21 17:09:43', '203.190.11.115');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(610, 128, 1, NULL, 1, 'Advances in High Voltage Engineering', 'advances-in-high-voltage-engineering', NULL, '978-0-85296-158-2', NULL, 'Advances, High Voltage, Engineering', 'There have been a number of key advances in materials. Polymeric insulators\r\nare still under major trials for transmission voltages but have become widely used\r\nin overhead lines at distribution levels. Cable insulation has moved from paper systems to various polymer-based materials. SF6 has taken over as an efficient and\r\nreliable insulation medium in high-voltage switchgear, and gas-insulated substations\r\nare now frequently the preferred option for new substations especially in urban areas.\r\nAll of these changes have not been direct substitutions; they have each required\r\na reconsideration of equipment configuration, and new installation and operational\r\ntechniques.', NULL, '4951821.JPG', '1485939.pdf', 1, 2007, 'London', 50, '2019-01-21 17:14:48', '2019-01-21 17:14:48', '203.190.11.118'),
(611, 269, 1, NULL, 1, 'Numerical Analysis : SCHAUM\'S Outine of Theory and Problems', 'numerical-analysis-schaums-outine-of-theory-and-problems', NULL, '0-07-055221-5', NULL, 'Numerical Analysis', 'The main goal of numerical analysis remains what it has always been, to find\r\napproximate solutions to complex problems using only the simplest operations of\r\narithmetic. In short, it is a business of solving hard problems by doing lots of easy\r\nsteps. Rather clearly, this means finding procedures by which computers can do\r\nthe solving for us. The problems come from a variety of mathematical origins,\r\nparticularly algebra and analysis, the boundaries being at times somewhat\r\nindistinct. Much background theory is borrowed from such fields by the numerical\r\nanalyst, and some must be included in an introductory text for clarity. It is also\r\ntrue that our subject returns more than raw numbers across the boundaries.\r\nNumerical method has made important contributions to algebraic and analytic\r\ntheory.', NULL, '2816000.PNG', '6591374.pdf', 1, 1988, 'New York', 39, '2019-01-21 17:15:14', '2019-01-21 17:15:14', '203.190.11.54'),
(612, 52, 1, NULL, 1, 'Communication Systems Engineering', 'communication-systems-engineering', '2nd ed.', '0130617938', NULL, 'Electrical Communication System, Communication Channels, Double-Sideband Suppressed, Angle Modulation, Digital Transmission on Fading Multipath Channels, The GSM System.', NULL, NULL, '4722831.gif', '8465841.pdf', 1, 2002, 'New Jersey', 49, '2019-01-21 17:18:52', '2019-01-21 17:18:52', '203.190.11.118'),
(613, 270, 1, NULL, 1, 'Nonliner Physics With Mathematica For Scientists and Engineerings', 'nonliner-physics-with-mathematica-for-scientists-and-engineerings', NULL, '3-7643-4223-4', NULL, 'Physics  , Engineering', 'No prior knowledge of Mathematica or programming is assumed, the reader being gently introduced to Mathematics as an auxiliary tool as the concepts of nonlinear science are developed. Just as the Maple version was not intended to tenth you everything you would like to know about programming in Maple. this text will not begin to cover the vast number of commands and options that arc available in Mathematics. The CD-ROM provided with this book gives a wide variety of illustrative nonlinear examples solved with Mathematica, the command structures being introduced on a need to know basis. In addition, nu-merous annotated examples are sprinkled throughout the text and also placed on the CD. An accompanying set of experimental activities keyed to the theory developed.', NULL, '6217532.JPG', '2336588.pdf', 1, 2001, 'Boston', 48, '2019-01-21 17:21:12', '2019-01-21 17:21:12', '203.190.11.117'),
(614, 271, 1, NULL, 1, 'ENGINES OF CREATION 2.0 The Coming Era of Nanotechnology', 'engines-of-creation-20-the-coming-era-of-nanotechnology', '20th edi.', '978-0385199735', NULL, 'ENGINES, CREATION.Coming Era, Nanotechnology', 'This brilliant work heralds the new age of nanotechnology, which will give us thorough and inexpensive control of the structure of matter.  Drexler examines the enormous implications of these developments for medicine, the economy, and the environment, and makes astounding yet well-founded projections for the future.', NULL, '3132432.JPG', '5320553.pdf', 1, 2006, 'America', 50, '2019-01-21 17:27:49', '2019-01-21 17:27:49', '203.190.11.118'),
(615, 272, 1, NULL, 1, 'Quantum Mechanics', 'quantum-mechanics', NULL, NULL, NULL, 'Quantum  , Mechanics', 'makes a strong effort to introduce Lorentzâ€“invariant field equations systematically, rather than relying mainly on a heuristic amalgam of Classical Special Relativity and Quantum Mechanics. The notes are in a stage of continuing development, various sections, e.g., on the semi-classical approximation, on the Hilbert space structure of Quantum Mechanics, on scattering theory, on perturbation theory, on Stochastic Quantum Mechanics, and on the group theory of elementary particles will be added as well as the existing sections expanded.', NULL, '5736743.JPG', '7961085.pdf', 1, 2000, 'USA', 48, '2019-01-21 17:30:19', '2019-01-21 17:30:19', '203.190.11.118'),
(616, 273, 1, NULL, 1, 'Mechatronic Systems, Simulation, Modelling and Control', 'mechatronic-systems-simulation-modelling-and-control', NULL, '978-953-307-041-4', NULL, 'Mechatronic Systems, Simulation, Modelling, Control', 'Mechatronics, the synergistic blend of mechanics, electronics, and computer science, has evolved over the past twenty-five years, leading to a novel stage of engineering design. By integrating the best design practices with the most advanced technologies, mechatronics aims at realizing high quality products, guaranteeing, at the same time, a substantial reduction of time and costs of manufacturing. Mechatronic systems are manifold, and range from machine components, motion generators, and power producing machines to more complex devices, such as robotic systems and transportation vehicles. With its 15 chapters, which collect contributions from many researchers worldwide, this book provides an excellent survey of recent work in modelling and control of electromechanical components, and mechatronic machines and vehicles.', NULL, '2567250.JPG', '4341838.pdf', 1, 2010, 'Croatia', 50, '2019-01-21 17:33:35', '2019-01-21 17:33:35', '203.190.11.118'),
(617, 274, 1, NULL, 1, 'Communication Networks', 'communication-networks', NULL, NULL, NULL, 'Network Components, Network Layer, Physical Layer, Data Link Layer, Broadband ISDN and ATM, ATM Adaptation Layer.', 'This book is concerned with post-computer communication networks and two of its important streams: data communication and telecommunication. Data communication refers to the communication between digital computers, facilitated by computer networks. Telecommunication refers to the primarily human-to-human communication facilitated by the global telephone system. The differences between these two streams are mainly due to historical reasons. Telecommunication is increasingly relying on digital computer technology, and data communication is relying more than ever on telecommunication networks. The two streams are rapidly converging.', NULL, '5164949.gif', '2101841.pdf', 1, 2005, 'New Delhi', 49, '2019-01-21 17:35:16', '2019-01-21 17:35:16', '203.190.11.118'),
(618, 12, 1, NULL, 1, 'Electromagnetics', 'electromagnetics', NULL, '0-8493-1397-X', NULL, 'Electromagnetics', 'This book is intended as a text for a first-year graduate sequence in engineering electromagnetics. Ideally such a sequence provides a transition period during which a student can solidify his or her understanding of fundamental concepts before proceeding to specialized areas of research.\r\nThe assumed background of the reader is limited to standard undergraduate topics in physics and mathematics. Worthy of explicit mention are complex arithmetic, vector analysis, ordinary differential equations, and certain topics normally covered in a â€œsignals and systemsâ€ course', NULL, '2565848.JPG', '2795897.pdf', 1, 2001, 'New York', 50, '2019-01-21 17:41:38', '2019-01-21 17:41:38', '203.190.11.118'),
(619, 275, 1, NULL, 1, 'Nuclear Energy : Technology From Hell', 'nuclear-energy-technology-from-hell', NULL, '978-9350021811', NULL, 'Nuclear  , Energy', 'This would be a quantum leap from the present scenario. As of March 31, 2010, the total installed power generation capacity in the country was 159.4 GW, of which the contribution of nuclear power â€“ more than sixty years after the atomic energy program was established and forty years after the first nuclear reactor started feeding electricity to the grid in the country â€“ was just 4.56 GW,v or 2.86% of the total. Thus, the projected capacity in 2050 would represent an increase by a factor of over a hundred.', NULL, '7184016.JPG', '2952505.pdf', 1, 2012, 'USA', 48, '2019-01-21 17:42:59', '2019-01-21 17:42:59', '203.190.11.118'),
(620, 49, 1, NULL, 1, 'Compact and Broadband Microstrip Antennas', 'compact-and-broadband-microstrip-antennas', NULL, '0-471-22111-2', NULL, 'Microstrip Antennas, Broadband Microstrip Antennas, Compact Dual-Frequency and Dual-Polarized Microstrip Antennas, Broadband and Dual-Band Circularly Polarized Microstrip Antennas.', 'In order to meet the miniaturization requirements of portable communication equipment,\r\nresearchers have given much attention recently to compact microstrip antennas. Many related compact designs with broadband dual-frequency operation, dualpolarized radiation, circularly polarized radiation, and enhanced antenna gain have been reported. Many significant advances in improving the inherent narrow operating bandwidth of microstrip antennas have been published in the open literature since 1997.', NULL, '9327518.gif', '3134292.pdf', 1, 2002, 'New York', 49, '2019-01-21 17:45:08', '2019-01-21 17:45:08', '203.190.11.117'),
(621, 135, 1, NULL, 1, 'ALTERNATING ELECTRIC CURRENTS', 'alternating-electric-currents', NULL, NULL, NULL, 'ALTERNATING, ELECTRIC, CURRENTS', 'The subject of alternating- electric cur- rents is, to-day, perhaps, the most prominent in the electrical engineering field. Although when profoundly treated, the subject is so extremely technical as not only to necessitate the use of advanced mathematics but also to require, on the part of the student, considerable knowledge of electricity, yet the authors feel confident that a considerable portion of the subject can readily be understood by the general public. They therefore offer this volume, with the belief that since the commercial applications of alternating currents are rapidly becoming so important, it is no longer a question of willingness, but of necessity, on the part of the general public, to become familiar with the outlines of this branch of electro-technics.', NULL, '9404358.JPG', '2273395.pdf', 1, 1985, 'New York', 50, '2019-01-21 17:49:51', '2019-01-21 17:49:51', '203.190.11.118'),
(622, 10, 1, NULL, 1, 'Drive Solutions Mechatronics for Production and Logistics', 'drive-solutions-mechatronics-for-production-and-logistics', NULL, '978-3-540-76704-6', NULL, 'Drive, Solutions, Mechatronics, Production, Logistics', 'This book wants to fill a gap. There are many reference books covering\r\nelectric motors and drive control systems , but to date there is nothing describing the use of electronically controlled drives in production and logistics systems. Equivalent technical literature exists only for machine tools. The basis of this book is the extensive application knowledge of Lenze. Its genesis dates back to 2003, when we began to classify the vast number of applications that are implemented with our products. Until then we regarded each application as an individual case that required a customised solution. But this did not allow for an industrial approach to the engineering process.', NULL, '7579194.JPG', '3641819.pdf', 1, 2008, 'Germany', 50, '2019-01-21 17:55:02', '2019-01-21 17:55:02', '203.190.11.118'),
(623, 52, 1, NULL, 1, 'Nonlinear Systems', 'nonlinear-systems', '3rd', '0-13-067389-7', NULL, 'Nonlinear , Systems', 'To make the book (especially the early chapters) more accessible to first-year graduate students. As an example of the changes made toward that end, note the change in Chapter 3: All the material on mathematical background, the contraction mapping theorem, and the proof of the existence and uniqueness theorem have been moved to the Appendix. Several parts of the books have been rewritten to improve readability. To reorganize the book in such a way that makes it easier to structure nonlin-ear systems or control courses around it. In the new organization, the book has four parts, as shown in the flow chart. A course on nonlinear systems anal-ysis will cover material from Parts 1, 2, and 3, while a course on nonlinear control will cover material from Parts 1, 2, and 4.', NULL, '/tmp/phpD6GRJv', '2873594.pdf', 1, 2002, 'new jersey', 48, '2019-01-21 17:59:07', '2019-01-30 15:09:35', '203.190.11.115'),
(624, 145, 1, NULL, 1, 'Engineering Electromagnetics Applications', 'engineering-electromagnetics-applications', NULL, '13: 978-0-8493-7363-3', NULL, 'Electromagnetics Applications', 'Engineering Electromagnetics: Applications should serve as a bridge between standard textbooks in electromagnetic theory and specialized references such as a handbook on wireless antenna\r\ndesign. While textbooks are comprehensive in terms of the theoretical development of the subject\r\nmatter, they are usually deficient in the application of that theory to practical applications. Specialized\r\nhandbooks on the other hand often provide detailed lists of formulas, tables, and graphs, but do not\r\nprovide the insight needed to appreciate the underlying physical concepts. This application-oriented\r\nvolume will permit a practicing engineer/scientist to:\r\nâ€¢ Review the necessary electromagnetic theory in the context of the application he/she is\r\ninterested in.\r\nâ€¢ Gain an appreciation for the key electromagnetic terms and parameters.\r\nâ€¢ Learn how to apply the theory to formulate engineering problems.\r\nâ€¢ Obtain guidance to the specialized literature for additional details', NULL, '6067122.JPG', '3038245.pdf', 1, 2006, 'New York', 52, '2019-01-21 18:04:01', '2019-01-21 18:04:01', '203.190.11.117'),
(625, 117, 1, NULL, 1, 'Computer-Based Numerical & Statistical Techniques', 'computer-based-numerical-statistical-techniques', NULL, '978-0-9778582-5-5', NULL, 'Statistical Techniques , Numerical', 'The aim of numerical analysis is, therefore, to provide constructive methods for obtaining answers to such problems in a numerical form. With the advent of high speed computers and increasing demand for numerical solutions to various problems, numerical techniques have become indispensable tools in the hands of engineers and scientists.Methods of numerical analysis are used to approximate the problem satisfactorily so that an approximate solution, amenable to precise analysis, within a desired degree of accuracy is obtained.To attain a desired degree of accuracy, insight into the process and resulting error is essential.', NULL, '4680232.JPG', '4026914.pdf', 1, 2007, 'New Delhi', 48, '2019-01-21 18:16:06', '2019-01-21 18:16:06', '203.190.11.117'),
(626, 12, 1, NULL, 1, 'Engineering Maintenance', 'engineering-maintenance', NULL, '1-58716-142-7', NULL, 'Engineering Maintenance', 'This century will usher in a broader need for equipment managementâ€”a cradle-tograve strategy to preserve equipment functions, avoid the consequences of failure, and\r\nensure the productive capacity of equipment. This cannot be achieved by simply following the traditional approach to maintenance effectivelyâ€”human error in maintenance,\r\nquality and safety in maintenance, software maintenance, reliability-centered maintenance, maintenance costing, reliability, and maintainability also must be considered.\r\nToday, a large number of books are available on maintenance, but to the best of\r\nmy knowledge, none covers all the areas listed above. Material on such topics is\r\navailable either in technical articles or in specialized books, but not in a single\r\nvolume. In order to perform the maintenance function effectively, knowledge of\r\nthese topics is essential, but maintenance professionals find it difficult to obtain such\r\ninformation in a single maintenance text.', NULL, NULL, '9853669.pdf', 1, 2002, 'New York', 52, '2019-01-21 18:23:07', '2019-01-21 18:23:07', '203.190.11.118'),
(627, 95, 1, NULL, 1, 'Theory Of Numbers', 'theory-of-numbers', '4th', '0 19 853310 7', NULL, 'Numbers , Theory', 'There is a variation in which the player who takes the last match loses. The theory is the same SO long as a heap remains containing more than one match; thus (2,2) and (1,2,3) are still winning positions. We leave it to the reader to think out for himself the small variations in tactics at the end of the game.', NULL, '8460014.JPG', '7587924.pdf', 1, 1960, 'London', 48, '2019-01-21 18:28:16', '2019-01-21 18:28:16', '203.190.11.115'),
(628, 276, 1, NULL, 1, 'Advanced Number Theory', 'advanced-number-theory', NULL, '0-486-64023-X', NULL, 'Number Theory , Number', 'Of the systematic solvability in a finite number of steps. Yet it was not until 1800 that Gauss gave in his famous Disquisitiones Arithmeticae the solution that still remains a mode1 of perfection. Now a very intimate connection developed between Gaussâ€™s solution and quadratic reciprocity, making unique factorization (in the linear case) and\r\nquadratic reciprocity (in the quadratic case) parallel tools. Finally, about 1896, Hilbert achieved the reorganization of the quadratic theory, making full use of this coincidence and thus completing the picture.', NULL, '6030824.JPG', '2704919.pdf', 1, 1962, 'New York', 48, '2019-01-21 18:36:55', '2019-01-21 18:36:55', '203.190.11.115'),
(629, 277, 1, NULL, 1, 'Nuclear Reactor Theory', 'nuclear-reactor-theory', NULL, NULL, NULL, 'Nuclear , Reactor Theory', 'nuclear reactors and how nuclear energy is extracted from reactors. Here, nuclear energy means the energy released in nuclear fission. This occurs because of the absorption of neutrons by fissile material.Neutrons are released by nuclear fission, and since the number of neutrons released is sufficiently greater than 1, a chain reaction of nuclear fission can be established. This allows, in turn, for energy to be extracted from the process. The amount of extracted energy can be adjusted by controlling the number of neutrons. The higher the power density is raised, the greater the\r\neconomic efficiency of the reactor.', NULL, '3134805.JPG', '2496048.pdf', 1, 2007, 'Tokyo', 48, '2019-01-21 18:49:47', '2019-01-21 18:49:47', '203.190.8.118'),
(630, 278, 1, NULL, 1, 'Mechatronics for Safety, Security and Dependability in a New Era', 'mechatronics-for-safety-security-and-dependability-in-a-new-era', NULL, '978-0-08044-963-0', NULL, 'Mechatronics, Safety, Security, Dependability, Era', 'The word â€œmechatronicsâ€ was initially defined as integrated engineering in mechanics\r\nand electronics. However, the meaning of this word gradually changed to be taken\r\nwidely as â€œintellectualization of machines and systems with information technology,â€\r\nthese days. Namely, machines and systems, which control their motion autonomously\r\nand appropriately based on external information, generate a common technology of\r\nmechatronics. According to this definition, the automation of an industrial factory line,\r\nsuch as a machining line, assembly line, or strip mill line, is based on the mechatronics\r\ntechnology. Control systems for train operation and intelligent transportation systems (ITS) for automobiles are also realized by mechatronics technology. It is thus evident that\r\nmechatronics has allowed us to achieve high productivity and has enriched our daily life\r\nby improving the performance of machines and systems.', NULL, '6239641.JPG', '1982989.pdf', 1, 2007, 'New York', 50, '2019-01-21 18:55:43', '2019-01-21 18:55:43', '203.190.10.206'),
(631, 10, 1, NULL, 1, 'Mechatronic Systems Analysis, Design and Implementation', 'mechatronic-systems-analysis-design-and-implementation', NULL, '978-3-642-22323-5', NULL, 'Mechatronic, Systems, Analysis, Design, Implementation', 'In the mechanical part, the engineer must follow a rigorous procedure to design\r\nthe mechatronic system. He must build the mechanical part of the system and choose\r\nthe appropriate sensors and actuators that have to be used in the functioning of\r\nthe mechatronic system. At this phase we must think about the place where the\r\nelectronic circuit will be integrated.\r\nIn the electronics part, the engineer must design the electronic circuit around microcontrollers that will assure the functioning of the mechatronics systems. It covers\r\nthe integration of the required electronics components such as resistors, capacitors,\r\nintegrated circuits, sensors and the chosen microcontrollers. The required regulated\r\nvoltage for the different components is also part of this step.', NULL, '9949599.JPG', '5642760.pdf', 1, 2011, 'German', 50, '2019-01-21 18:58:52', '2019-01-21 18:58:52', '203.190.10.206'),
(632, 279, 1, NULL, 1, 'Tunable Lasers HANDBOOK', 'tunable-lasers-handbook', NULL, '0-12-222695-X', NULL, 'Tunable Lasers,', 'Many laser applications depend on the ability of a particular laser to be frequency tunable. Among the many different types of frequency tunable lasers are: dye lasers, excimer lasers, and semiconductor lasers. Thisbook gives active researchers and engineers the practical information they need to choose an appropriate tunable laser for their particular applications.', NULL, '5410116.JPG', '5931845.pdf', 1, 1995, 'New York', 51, '2019-01-21 18:59:48', '2019-01-21 18:59:48', '203.190.8.116'),
(633, 74, 1, NULL, 1, 'The Fourier Transform & Its Applications', 'the-fourier-transform-its-applications', '3rd ed.', '978-0071160438', NULL, 'Fourier Transform.', NULL, NULL, '7541128.jpg', '9811989.pdf', 1, 2000, 'New York', 51, '2019-01-21 19:34:27', '2019-01-21 19:34:27', '203.190.8.116'),
(634, 280, 1, NULL, 1, 'ADVANCED DC/DC CONVERTERS', 'advanced-dcdc-converters', '1st edi.', '0-8493-1956-0', NULL, 'ADVANCED, DC, CONVERTERS', 'The purpose of this book is to provide up-to-date information on advanced DC/DC converters that is both concise and useful for engineering students and practicing professionals. It is well organized in 748 pages with 320 diagrams to introduce more than 100 topologies of the advanced DC/DC converters originally developed by the authors. EMI/EMC reduction and various DC voltage sources are also illustrated in this book. All prototypes represent novel approaches and great contributions to modern power engineering. Power engineering is the method used to supply electrical energy from a source to its users. It is of vital importance to industry. It is likely that the air we breathe and water we drink are taken for granted until they are not there. Energy conversion technique is the main focus of power engineering.', NULL, '7611217.JPG', '1942014.pdf', 1, 2004, 'New York', 50, '2019-01-21 19:58:01', '2019-01-21 19:58:01', '203.190.10.206'),
(635, 10, 1, NULL, 1, 'Mechatronics and Intelligent Systems for Off-road Vehicles', 'mechatronics-and-intelligent-systems-for-off-road-vehicles', '1st edi.', '978-1-84996-467-8', NULL, 'Mechatronics, Intelligent, Systems, Off-road Vehicles', 'Rapid developments in electronics over the past two decades have induced a move from purely mechanical vehicles to mechatronics design. Recent advances in computing, sensors, and information technology are pushing mobile equipment design to incorporate higher levels of automation under the novel concept of intelligent vehicles. Mechatronics and Intelligent Systems for Off-road Vehicles introduces this concept, and provides an overview of recent applications and future approaches within this field. Several case studies present real examples of vehicles designed to navigate in off-road environments typically encountered by agriculture, forestry, and construction machines. The examples analyzed describe and illustrate key features for agricultural robotics, such as automatic steering, safeguarding, mapping, and precision agriculture applications. The eight chapters include numerous figures, each designed to improve the readerâ€™s comprehension of subjects such as: â€¢ automatic steering syste', NULL, '8970352.JPG', '6858279.pdf', 1, 2010, 'London', 50, '2019-01-21 20:01:32', '2019-01-21 20:01:32', '203.190.10.206'),
(636, 57, 1, NULL, 1, 'Numerical Methods in Engineering with MATLAB', 'numerical-methods-in-engineering-with-matlab', NULL, '978-0-511-12811-0', NULL, 'Numerical Methods , Engineering', 'MATLAB is a high-level computer language for scientific computing and data visualization built around an interactive programming environment.Itis becoming the premiere platform for scientific computing at educational institutions and research establishments. The great advantage of an interactive system is that programs can be tested and debugged quickly, allowing the userto concentrate more on the principles behind the program and less on programming itself. Since there is no need to compile, link and execute after each correction, MATLAB programs can be developed in much shorter time than equivalent FORTRAN or C programs. On the negative side, MATLAB does not produce stand-alone applicationsâ€”the programs can be run only on computers that have MATLAB installed.', NULL, '3414277.JPG', '7531350.pdf', 1, 2005, 'New York', 48, '2019-01-21 20:02:31', '2019-01-21 20:02:31', '203.190.8.116'),
(637, 49, 1, NULL, 1, 'Nanotechnology', 'nanotechnology', '1st', '978-3527317233', NULL, 'Nano, Nanotechnology', 'The comprehensive index to an authoritative reference set. Principles and fundamentals as well as techniques collated in an easy-to-follow guide. With supplementary material to complement the Nanotechnology reference series.', NULL, '9634418.jpg', '7600614.pdf', 1, 2009, 'New York', 50, '2019-01-21 20:07:14', '2019-01-21 20:07:14', '203.190.10.206'),
(638, 44, 1, NULL, 1, 'Introduction to Nuclear Power', 'introduction-to-nuclear-power', '2nd.', '1-56032-454-6', NULL, 'Nuclear, Power, Introduction', 'This Second Edition has been several years in the making. My life-long friend\r\nand colleague John Collier died from pancreatic cancer on November 18, 1995.\r\nThis Second Edition must sadly but proudly serve as a memorial to John and to\r\nhis intense and firm conviction of the need for nuclear power for the future\r\nwell-being of the human race on this planet. John Collier\'s transparent honesty\r\nand humanity provided the best possible witness to the sincerity of this conviction. I, too, strongly believe in the ultimate necessity for nuclear power; there\r\nwill be temporary situations where this need is not so obvious (for instance, the\r\ncurrent availability of an excess of natural gas in the United Kingdom), but the\r\nlong-term situation is clear. It is thus vital to continue research and development\r\nin the area and to maintain an adequate technology base.', NULL, '3981187.JPG', '7697441.pdf', 1, 2000, 'New York', 50, '2019-01-21 20:11:28', '2019-01-21 20:11:28', '203.190.10.206'),
(639, 281, 1, NULL, 1, 'INTELLIGENT MECHATRONICS', 'intelligent-mechatronics', '1st', '978-953-307-300-2', NULL, 'INTELLIGENT, MECHATRONICS', 'Mechatronics is defi ned as the fi eld of study involving the analysis, design, synthesis,\r\nand selection of systems that combine electronic and mechanical components with\r\nmodern controls and microprocessors. Mechatronics is an engineering fi eld that refers\r\nto mixed systemsâ€™ tight integration. Currently, this integration can be viewed as based\r\non digital computer monitoring and control, but it cannot be denied that integration\r\ncan be based on any other signal processing system and any form of raw power that\r\ncan be modulated and transferred to the mixed system in accordance with the output\r\nof the digital signal processor. Mechatronics refers to monitoring, control and integration not only of lumped parameters systems, but also of distributed parameters systems. This interdisciplinary approach is valuable to students because virtually every\r\nnewly designed engineering product is a Mechatronic system.', NULL, '4559147.JPG', '2143472.pdf', 1, 2011, 'Croatia', 50, '2019-01-21 20:15:40', '2019-01-21 20:15:40', '203.190.10.206'),
(640, 282, 1, NULL, 1, 'Introduction to Numerical Methods and Matlab Programming for Engineers', 'introduction-to-numerical-methods-and-matlab-programming-for-engineers', '3rd', NULL, NULL, 'Numerical Methods , Matlab Programming', 'Numerical Methods using MATLAB, 3rd edition is an extensive reference offering hundreds of useful and important numerical algorithms that can be implemented into MATLAB for a graphical interpretation to help researchers analyze a particular outcome. Many worked examples are given together with exercises and solutions to illustrate how numerical methods can be used to study problems which have applications in the bio-sciences, chaos, optimization, engineering and science across the board. Numerical Methods using MATLAB, 3e, is an extensive reference offering hundreds of useful and important.', NULL, '8196646.JPG', '1989882.pdf', 1, 2011, 'USA', 48, '2019-01-21 20:19:46', '2019-01-21 20:19:46', '203.190.8.118'),
(641, 283, 1, NULL, 1, 'CNC Robotics Build Your Own Workshop Bot', 'cnc-robotics-build-your-own-workshop-bot', '1st', '0-07-141828-8', NULL, 'CNC, Robotics', 'CNC Robotics gives you step-by-step, illustrated directions for designing, constructing, and testing a fully functional CNC robot that saves you 80 percent of the price of an off-the-shelf botâ€•and that can be customized to suit your purposes exactly, because you designed it. Written by an accomplished workshop bot designer/builder, this book gives you:\r\n* Start-to-finish illustrated instructions\r\n* Guidance on installing easy-to-understand Windows software for controlling your bot\r\n* Plenty of time-saving tips, tricks, and pictorial help along the way\r\n* Scaling and customizing instructions for building just the robot that you want\r\n* Sources for easily obtained parts\r\n* A complete course in workshop bot design and construction, perfect for courses or industry', NULL, '5078218.JPG', '8448204.pdf', 1, 2003, 'New York', 50, '2019-01-21 20:20:03', '2019-01-21 20:20:03', '203.190.10.206'),
(642, 49, 1, NULL, 1, 'Mechatronic Systems Modelling and Simulation with HDLs', 'mechatronic-systems-modelling-and-simulation-with-hdls', '1st', '0-470-84979-7', NULL, 'Mechatronic,  Systems, Modelling, Simulation, HDLs', 'Most of this work came into being during my employment at the Chair for Electron\r\nDevices and Circuits in the Electronics Engineering department of the GerhardMercator University, Duisburg. Section 7.5 covers material that I have worked on\r\nfor my current employer, Infineon Technologies.\r\nAt this point I would like to express my gratitude for the support that I received\r\nfrom many sides. My special thanks go to Prof. Dr. G. Zimmer, in whose department I was able to work continuously for many years on the subject of this book,\r\nand who helped me in many ways in the process. Moreover, I would like to thank\r\nProf. Dr. M. Glesner for his support of the work', NULL, '8275047.JPG', '1143424.pdf', 1, 2003, 'England', 50, '2019-01-21 20:22:29', '2019-01-21 20:22:29', '203.190.10.206'),
(643, 284, 1, NULL, 1, 'Mechatronics Principles and Applications', 'mechatronics-principles-and-applications', '1st', '0 7506 6379 0', NULL, 'Mechatronics, Principles, Applications', 'Mechatronics is defined as the synergistic combination of precision mechanical, electronic, control, and systems engineering, in the design of products and\r\nmanufacturing processes. It relates to the design of systems, devices and products\r\naimed at achieving an optimal balance between basic mechanical structure and\r\nits overall control. Mechatronics responds to industryâ€™s increasing demand for\r\nengineers who are able to work across the boundaries of narrow engineering\r\ndisciplines to identify and use the proper combination of technologies for optimum\r\nsolutions to todayâ€™s increasingly challenging engineering problems. Understanding\r\nthe synergy between disciplines makes students of engineering better communicators who are able to work in cross-disciplines and lead design teams which may\r\nconsist of specialist engineers as well as generalists.', NULL, '1272372.JPG', '8783928.pdf', 1, 2005, 'New York', 50, '2019-01-21 20:24:45', '2019-01-21 20:24:45', '203.190.10.206'),
(644, 285, 1, NULL, 1, 'Dielectrics in Electric Fields', 'dielectrics-in-electric-fields', '1st', '0-8247-0864-4', NULL, 'Dielectrics, Electric, Fields', 'Materials that do not normally conduct electricity and have the ability to store\r\nelectrical charge are known as dielectrics. The behavior of dielectrics in electric fields\r\ncontinues to be an area of study that has fascinated physicists, chemists, material\r\nscientists, electrical engineers, and, more recently biologists. Ideas that explain aspects of dielectric behavior in high voltage electrical cables are also applicable to the insulating\r\nbarrier in metal oxide semiconductors or interlayer insulation of integrated circuits.\r\nMicrowave drying of milk, dielectric properties of agricultural products such as flour and\r\nvegetable oils to determine their moisture content, and the study of curing of cement etc.,\r\nare some nontraditional applications of dielectric studies that show potential promise.\r\nDeeper insight into the interaction between electric fields and molecules has resulted in\r\nmany new applications.', NULL, '9874077.JPG', '5724921.pdf', 1, 2003, 'New York', 50, '2019-01-21 20:27:29', '2019-01-21 20:27:29', '203.190.10.206'),
(645, 10, 1, NULL, 1, 'Maintenance of Process Instrumentation in Nuclear Power Plants', 'maintenance-of-process-instrumentation-in-nuclear-power-plants', '1st', '978-3-540-33703-4', NULL, 'Maintenance, Process, Instrumentation, Nuclear Power, Plants', 'This book is written for the instrumentation and control engineers, technicians, and\r\nmanagers in nuclear power plants. It focuses on process temperature and pressure\r\nsensors and the verification of these sensorsâ€™ calibration and response time. It also\r\nprovides examples of typical problems and solutions with temperature and pressure\r\nmeasurements in nuclear power plants.', NULL, '9730851.JPG', '3674259.pdf', 1, 2006, 'Germany', 50, '2019-01-21 20:30:11', '2019-01-21 20:30:11', '203.190.10.206'),
(646, 10, 1, NULL, 1, 'Modeling and Computations in Electromagnetics A Volume Dedicated to Jean-Claude NÃ©dÃ©lec', 'modeling-and-computations-in-electromagnetics-a-volume-dedicated-to-jean-claude-nedelec', '1st', '978-3-540-73777-3', NULL, 'Modeling, Computations. Electromagnetics', 'Modeling and computations in electromagnetics is quite novel and growing\r\ndiscipline, expanding as a result of the steadily increasing demand for designing electrical devices, modeling electromagnetic materials, and simulating\r\nelectromagnetic fields in nanoscale structures.\r\nThe aim of this volume is to bring together prominent worldwide experts\r\nto review state-of-the-art developments and future trends of modeling and\r\ncomputations in electromagnetics. This volume is devoted to merging the expertise of scientists working on this active discipline, and to raise interest for\r\nchallenging issues. The most significant advances in computational techniques\r\ndeveloped in the very last years and several challenging technological applications such as those related to communications, to biomedical devices, and to\r\nmagnetic storage design are presented in this volume.', NULL, '2420312.JPG', '9150224.pdf', 1, 2000, 'New York', 50, '2019-01-21 20:33:43', '2019-01-21 20:33:43', '203.190.10.206'),
(647, 286, 1, NULL, 1, 'Electromagnetic Field Theory', 'electromagnetic-field-theory', '1st', '978-0486477732', NULL, 'Electromagnetic, Field, Theory', 'The current book is an outgrowth of the lecture notes that I prepared for the four-credit\r\ncourse Electrodynamics that was introduced in the Uppsala University curriculum in\r\n1992, to become the five-credit course Classical Electrodynamics in 1997. To some\r\nextent, parts of these notes were based on lecture notes prepared, in Swedish, by\r\nBENGT LUNDBORG who created, developed and taught the earlier, two-credit course\r\nElectromagnetic Radiation at our faculty.\r\nIntended primarily as a textbook for physics students at the advanced undergraduate or beginning graduate level, it is hoped that the present book may be useful for\r\nresearch workers too.', NULL, '7981198.jpg', '8600419.pdf', 1, 2003, 'Sweden', 50, '2019-01-21 20:37:17', '2019-01-21 20:37:17', '203.190.10.206'),
(648, 74, 1, NULL, 1, 'Numerical Methods for Engineers and Scientists', 'numerical-methods-for-engineers-and-scientists', '2nd', '0-8247-0443-6', NULL, 'Numerical Methods , Scientists', 'With infinite precision arithmetic, ill-conditioning is not a problem. However, with finite precision arithmetic, round-off errors effectively change the elements of A and b slightly, and if the system is ill-conditioned, large changes (i.e., errors) can occur in the solution. Assuming that scaled pivoting has been performed, the only possible remedy to\r\nill-conditioning is to use higher precision arithmetic.There are several ways to check a matrix A for ill-conditioning. If the magnitude ofthe determinant of the matrix is small, the matrix may be ill-conditioned.', NULL, '/tmp/phpfq6RBt', '9343626.pdf', 1, 2001, 'New York', 48, '2019-01-21 20:39:22', '2019-01-21 20:41:10', '203.190.10.213'),
(649, 49, 1, NULL, 1, 'Electromagnetic Propagation in Multi-Mode Random Media', 'electromagnetic-propagation-in-multi-mode-random-media', '1st', '0-471-20070-0', NULL, 'Electromagnetic, Propagation, Multi-Mode, Media', 'Reflecting the growing importance of multi-mode transmission media in communications, radar, sensors, remote sensing, and many other industrial applications, this work presents analytic methods for calculating the transmission statistics of microwave and optical components with random imperfections.\r\n\r\nThe emphasis here is on multi-mode waveguides, optical fibers, and directional couplers-described by the coupled line equations with random parameters-as well as multi-layer optical coatings used as windows, mirrors, or filters. The author clearly explains how to calculate the transmission statistics of these devices in terms of their coupling or optical thickness statistics, in both the time and frequency domains. This unique resource for engineers and researchers involved in the design of multi-mode transmission media:\r\n* Focuses on matrix techniques and the various types of problems to which they can be applied\r\n* Incorporates many new results developed by the author', NULL, '2050811.JPG', '6792500.pdf', 1, 1999, 'New York', 50, '2019-01-21 20:44:18', '2019-01-21 20:44:18', '203.190.10.206'),
(650, 288, 1, NULL, 1, 'Numerical Methods Using Matlab', 'numerical-methods-using-matlab', '3rd', '978-0132700429', NULL, 'Numerical Methods , Matlab', 'How the mathematics of calculus and linear algebra are implemented in computer algorithms. It develops a deep understanding of why numerical methods work and exactly what their limitations are.', NULL, '6255949.JPG', '7425858.pdf', 1, 1998, 'USA', 48, '2019-01-21 20:55:34', '2019-01-21 20:55:34', '203.190.10.213'),
(651, 289, 1, NULL, 1, 'Manual on mathematical models in isotope hydrogeology', 'manual-on-mathematical-models-in-isotope-hydrogeology-21031640', NULL, NULL, NULL, 'Mathematical models, Hydrogeology.', 'Methodologies based on the use of naturally occurring isotopes are, at present, an integral part of studies being undertaken for water resources assessment and management. Applications of isotope methods aim at providing an improved understanding of the overall hydrological system as well as estimating physical parameters of the system related to flow\r\ndynamics. Quantitative evaluations based on the temporal and/or spatial distribution of different isotopic species in hydrological systems require conceptual mathematical formulations. Different types of model can be employed depending on the nature of the hydrological system under investigation, the amount and type of data available, and the required accuracy of the parameter to be estimated.', NULL, '3305004.JPG', '6688930.pdf', 1, 1996, 'Austria', 51, '2019-01-21 21:03:40', '2019-01-21 21:03:40', '203.190.11.115'),
(652, 290, 1, NULL, 1, 'FISMA Certification & Accreditation Handbook', 'fisma-certification-accreditation-handbook', NULL, '978-1-59749-116-7', NULL, 'FISMA Certification, Accreditation Handbook', 'When I was the Security Staff Director of the Federal Deposit Insurance\r\nCorporation (FDIC), the Federal Information Security Management Act of\r\n2002 (FISMA) was not yet in existence; however, the Government Information\r\nSecurity Reform Act (GISRA) was. Since GISRA was signed into law on\r\nOctober 30, 2000, U.S. federal agencies have been paying far more attention to information security than they did previously', NULL, '2374500.JPG', '4123973.pdf', 1, 2007, 'U.S.A', 51, '2019-01-21 21:10:26', '2019-01-21 21:10:26', '203.190.11.115'),
(653, 291, 1, NULL, 1, 'Numerical Methods : Faires & Burden', 'numerical-methods-faires-burden', '3rd', '978-0534407612', NULL, 'Numerical Methods , Numerical', 'The traditional Numerical Analysis course emphasizes both the approximation methods and the mathematical analysis that produces them. A Numerical Methods course is more concerned with the choice and application of techniques to solve problems in engineering and the physical sciences than with the derivation of the methods. The books used in the Numerical Methods courses differ widely in both intent and content. Sometimes a book written for Numerical Analysis is adapted for a Numerical Methods course by deleting the more theoretical topics and derivations. The advantage of this approach is that the leading Numerical Analysis books are mature; they have been through a number of editions, and they have a wealth of proven examples and exercises', NULL, '2934018.JPG', '2494061.pdf', 1, 2002, 'USA', 48, '2019-01-21 21:12:56', '2019-01-21 21:12:56', '203.190.10.213'),
(654, 130, 1, NULL, 1, 'CCTV Surveillance: Video Practices and Technology', 'cctv-surveillance-video-practices-and-technology', '2nd ed.', '978-0750677684', NULL, 'CCTV Surveillance, CCTV, Video Practices, Technology.', 'This revision of the classic book on CCTV technology, CCTV Surveillance, provides a comprehensive examination of CCTV, covering the applications of various systems, how to design and install a system, and how to choose the right hardware. Taking into account the ever-changing advances in technology using digital techniques and the Internet, CCTV Surveillance, Second Edition, is completely updated with the recent advancements in digital cameras and digital recorders, remote monitoring via the Internet, and CCTV integration with other security systems.', NULL, '9365696.JPG', '3682369.pdf', 1, 2006, 'New York', 47, '2019-01-21 21:14:51', '2019-01-21 21:14:51', '203.190.10.206'),
(655, 10, 1, NULL, 1, 'Transient Analysis of Electric Power Circuits Handbook', 'transient-analysis-of-electric-power-circuits-handbook', NULL, '978-0-387-28799-7', NULL, 'Transient Analysis, Electric Power Circuits.', 'Every now and then, a good book comes along and quite rightfully makes itself a distinguished place amongthe existing books of the electric power engineering literature. This book by Professor Arieh Shenkman is one of them. Today, there are many excellent textbooks dealing with topics in power systems. Some of them are considered to be classics. However, many of them do not particularly address, nor concentrate on, topics dealing with transient analysis of electrical power systems.', NULL, '1846411.jpg', '8281472.pdf', 1, 2005, 'Netherlands', 51, '2019-01-21 21:18:32', '2019-01-21 21:18:32', '203.190.11.117'),
(656, 49, 1, NULL, 1, 'TESTING FOR EMC COMPLIANCE Approaches and Techniques', 'testing-for-emc-compliance-approaches-and-techniques', NULL, '0-471-43308-X', NULL, 'Troubleshooting Techniques, Radiated Testing.', 'Testing for EMC Compliance: Approaches and Techniques is another book in a series by author Mark I. Montrose and first-time co-author Edward M. Nakauchi. The reason for this book lies in the fact that the topic of electromagnetic compatibility (EMC) and regulatory compliance, currently in the public domain, misses a particular combined aspect of EMCâ€”how to perform both emission and immunity tests efficiently and what does one do â€œif â€ the product is already designed, manufactured, and then fails EMC tests.', NULL, '4403207.JPG', '1236392.pdf', 1, 2004, 'Canada', 51, '2019-01-21 21:23:55', '2019-01-21 21:23:55', '203.190.11.118'),
(657, 74, 1, NULL, 1, 'Numerical Methods for Engineering', 'numerical-methods-for-engineering', '6th', '978â€“0â€“07â€“340106â€“5', NULL, 'Numerical Methods , Numerical', 'Solutions were derived for some problems using analytical, or exact, methods. These solutions were often useful and provided excellent insight into the behavior of some systems. However, analytical solutions can be derived for only a limited class of problems. These include those that can be approximated with linear models and those that have simple geometry and low dimensional. Consequently, analytical solutions are of limited practical value because most real problems are nonlinear and involve complex shapes and processes.', NULL, '1872729.JPG', '2232532.pdf', 1, 2010, 'New York', 48, '2019-01-21 21:24:51', '2019-01-21 21:24:51', '203.190.10.213'),
(658, 292, 1, NULL, 1, 'Building design and construction handbook', 'building-design-and-construction-handbook', '6th ed.', '0-07-041999-X', NULL, 'Protection against Hazards, Building Materials', 'A where-would-you-be-without-it handbook covering every single important step in building design and construction, now updated to include key changes in design and construction practices. Surveys materials, structures, soil mechanics and foundations, building types, hardware, insulation, acoustics, plumbing, and more--all the material that will help architects, engineers, contractors, and others work better, faster, and smarter. Includes new design specifications; the latest developments in seismic and wind design criteria; new building systems and material; updated building codes throughout; NFPA requirements; and new wood material and codes', NULL, '8108623.JPG', '7390765.pdf', 1, 2001, 'New York', 51, '2019-01-21 21:32:56', '2019-01-21 21:32:56', '203.190.11.115'),
(659, 12, 1, NULL, 1, 'Numerical Techniques in Electromagnetics', 'numerical-techniques-in-electromagnetics', '2nd', '978-0849342325', NULL, 'Numerical Techniques , Electromagnetics', 'The need for numerical solution of electromagnetic problems is best expressed in the words of Paris and Hurd: \"Most problems that can be solved formally (analyti-cally) have been solved.\"\' Until the 1940s, most EM problems were solved using the classical methods of separation of variables and integral equation solutions. Besides the fact that a high degree of ingenuity, experience, and effort were required to apply those methods, only a narrow range of practical problems could be investigated due to the complex geometries defining the problems.', NULL, '7450608.JPG', '6528744.pdf', 1, 2001, 'New York', 48, '2019-01-21 21:47:14', '2019-01-21 21:47:14', '203.190.10.213'),
(660, 293, 1, NULL, 1, 'Numerical Analysis', 'numerical-analysis', '3rd', '978-1-934404-04-1', NULL, 'Numerical , Analysis', 'Numerical analysis is the branch of mathematics that is used to find approximations to difficult problems such as finding the roots of nonâˆ’linear equations, integration involving complex expressions and solving differential equations for which analytical solutions do not exist. It is applied to a wide variety of disciplines such as business, all fields of engineering, computer science, education, geology, meteorology, and others.', NULL, '2926742.JPG', '3572699.pdf', 1, 2007, 'USA', 48, '2019-01-21 21:56:02', '2019-01-21 21:56:02', '203.190.10.213'),
(661, 174, 1, NULL, 1, 'Numercal Solution Ordinary Differential Equations', 'numercal-solution-ordinary-differential-equations', NULL, NULL, NULL, 'Numercal Solution , Differential Equations', 'Numerical methods vary in their behavior, and the many different types of differential equation problems affect the performance of numerical methods in a variety of ways. An excellent book for â€œreal worldâ€ examples of solving differential equations is that of Shampine, Gladwell, and Thompson. The authors would like to thank Olaf Hansen, California State University at San Marcos, for his comments on reading an early version of the book. We also express\r\nour appreciation to John Wiley Publishers.', NULL, '1642179.JPG', '6969832.pdf', 1, 2009, 'new jersey', 48, '2019-01-21 22:08:58', '2019-01-21 22:08:58', '203.190.10.213');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(662, 49, 1, NULL, 1, 'Modeling and High Performance Control of Electric Machines', 'modeling-and-high-performance-control-of-electric-machines', '1st ed.', '0-47 1 -68449-X (cloth)', NULL, NULL, 'Modeling and High Performance Control of Electric Machines introduces you to both the modeling and control of electric machines. The direct current (DC) machine and the alternating current (AC) machines (induction, PM synchronous, and BLDC) are all covered in detail. The author emphasizes control techniques used for high-performance applications, specifically ones that require both rapid and precise control of position, speed, or torque. You\'ll discover how to derive mathematical models of the machines', NULL, '5926176.jpg', '8867524.pdf', 1, 2005, 'New York', 40, '2019-01-21 23:48:26', '2019-01-21 23:48:26', '203.190.11.118'),
(663, 12, 1, NULL, 1, 'Handbook of Electric Motors', 'handbook-of-electric-motors-21071951', '2nd ed.', '978-0824741051', NULL, 'Electric Motors', 'Presenting current issues in electric motor design, installation, application, and performance, this second edition serves as the most authoritative and reliable guide to electric motor utilization and assessment in the commercial and industrial sectors. Covering topics ranging from motor energy and efficiency to computer-aided design and equipment selection, this reference assists professionals in all aspects of electric motor maintenance, repair, and optimization. It has been expanded by more than 40 percent to explore the most influential technologies in the field including electronic controls, superconducting generators, recent analytical tools, new computing capabilities, and special purpose motors.', NULL, '2557859.jpg', '4027175.pdf', 1, 2004, 'New York', 51, '2019-01-22 00:07:51', '2019-01-22 00:07:51', '203.190.11.118'),
(664, 74, 1, NULL, 1, 'Handbook of Electrical Design Details', 'handbook-of-electrical-design-details', '2nd ed.', '978-0071377515', NULL, 'Electrical Design, Wire, Cable, and Circuit Components', 'Handbook of electrical design covers power generation, distribution, lighting, wiring, motors, and project planning. Supplemented by new topics: CAD for preparing electrical drawings and estimates, electrical surge protection, and 400 new illustrations. Previous edition: c1997. DLC: Electric engineering--Specifications--Handbooks, manuals, etc.', NULL, '1481029.JPG', '9993742.pdf', 1, 2003, 'U.S.A', 51, '2019-01-22 00:12:33', '2019-01-22 00:12:33', '203.190.11.115'),
(665, 294, 1, NULL, 1, 'Engineering Electronics', 'engineering-electronics', NULL, NULL, NULL, 'Engineering Electronics', 'A textbook for use in a beginning course in electronics for electrical engineering students.', NULL, '9089343.jpg', '5907970.pdf', 1, 1953, 'New York', 51, '2019-01-22 00:17:12', '2019-01-22 00:17:12', '203.190.11.115'),
(666, 12, 1, NULL, 1, 'Harmonics  and Power Systems', 'harmonics-and-power-systems', NULL, '978-0849330162', NULL, 'Harmonics, Power Systems', 'Harmonics have always been a problem with industrial loads, but now more and more consumer and commercial power loads are cropping up as sources of harmonic currents. Approaching the problem from both utility and end-user perspectives, Harmonics and Power Systems addresses the most relevant aspects in the generation and propagation of harmonic currents in electrical networks.', NULL, '5476722.jpg', '5767518.pdf', 1, 2006, 'New York', 51, '2019-01-22 00:23:15', '2019-01-22 00:23:15', '203.190.11.118'),
(667, 43, 1, NULL, 1, 'Engineering Electromagnetics', 'engineering-electromagnetics', '6th ed.', '978-0072304244', NULL, 'Electromagnetics', NULL, NULL, '1484491.jpg', '5465921.pdf', 1, 2000, 'New York', 51, '2019-01-22 00:29:06', '2019-01-22 00:29:06', '203.190.11.115'),
(668, 295, 1, NULL, 1, 'Henri Poincare and Relativity Theory', 'henri-poincare-and-relativity-theory', NULL, '978-5020339644', NULL, 'Henri Poincare, Relativity', NULL, NULL, '1868114.jpg', '3455766.pdf', 1, 2005, NULL, 51, '2019-01-22 00:32:31', '2019-01-22 00:32:31', '203.190.11.115'),
(669, 72, 1, NULL, 1, 'Practical Radio-Frequency Handbook', 'practical-radio-frequency-handbook', '3rd ed.', '0 7506 5369 8', NULL, 'Radio-Frequency', 'The Practical Radio-Frequency Handbook aims to live up to its title, as a useful vademecum and companion for all who wish to extend their familiarity with RF technology. It is hoped that it will prove of use to practising electronic engineers who wish to move into the RF design area, or who have recently done so, and to engineers, technicians, amateur radio enthusiasts, electronics hobbyists and all with an interest in electronics applied to radio frequency communications. From this, you will see that it is not intended\r\nto be a textbook in any shape or form. Nothing would have been easier than to fill it up with lengthy derivations of formulae, but readers requiring to find these should look elsewhere. Where required, formulae will be found simply stated: they are there to be used, not derived.', NULL, '6773335.jpg', '9835628.pdf', 1, 2002, 'Boston', 51, '2019-01-22 00:37:32', '2019-01-22 00:37:32', '203.190.11.118'),
(670, 43, 1, NULL, 1, 'High Voltage Engineering', 'high-voltage-engineering', '2nd ed.', '0-07-462286-2', NULL, 'Voltage, Engineering', 'A textbook for a one-semester course in the final undergraduate or first graduate year, touching on the whole range of topics necessary to design and develop high-voltage power generation and transmission systems. Among them are insulating materials and their applications, the breakdown of insulating materials, generating and measuring high voltages and currents, overvoltage phenomena, and testing techniques and equipment. The second edition adds several new topics and updates others; the date of the first is not noted. Annotation c. by Book News, Inc., Portland, Or.', NULL, '6136003.gif', '3070841.pdf', 1, 1995, 'New York', 51, '2019-01-22 00:59:42', '2019-01-22 00:59:42', '203.190.11.118'),
(671, 296, 1, NULL, 1, 'High Voltage Engineering', 'high-voltage-engineering-21092016', NULL, NULL, NULL, 'Voltage, Engineering', 'This book has arisen out of the need to include many of the major aspects of\r\nhigh voltage engineering in a single volume. The book is intended primarily as\r\na basic text book in high voltage engineering at the Final Year level of a four\r\nyear undergraduate course specialising in Electrical Engineering, with\r\nemphasis on heavy current engineering. It is also expected to be of immense\r\nvalue to practising electrical engineers, especially to those in the electricity\r\nsupply industry.', NULL, '7617131.JPG', '9168009.pdf', 1, 2001, NULL, 51, '2019-01-22 01:09:16', '2019-01-22 01:09:16', '203.190.11.118'),
(672, 297, 1, NULL, 2, 'RF and Microwave Wireless Systems', 'rf-and-microwave-wireless-systems', '1st ed.', '978-0471351993', NULL, 'RF, Microwave, Wireless.', 'This book provides scientists and engineers with clear, thorough, up-to-date explanations of all aspects of RF and microwave wireless systems, including general hardware components, system parameters, and architectures. Renowned authority Kai Chang covers both communication and radar/sensor systems and extends the discussion to other intriguing topics, from global positioning systems (GPS) to smart highways and smart automobiles. With an emphasis on basic operating principles, Dr. Chang reviews waves and transmission lines, examines modulation and demodulation and multiple-access techniques, and helps bridge the gap between RF/microwave engineering and communication system design. Ample practical examples of components and system configurations and nearly 300 illustrations and photographs complete this timely and indispensable resource.', NULL, '6196037.jpg', '8544970.pdf', 1, 2000, 'New York', 47, '2019-01-22 01:26:03', '2019-01-22 01:27:02', '203.190.11.118'),
(673, 72, 1, NULL, 1, 'High Voltage Engineering', 'high-voltage-engineering-21292049', '2nd ed.', '0 7506 3634 3', NULL, 'Voltage, Engineering', 'Power transfer for large systems depends on high system voltages. The basics of high voltage laboratory techniques and phenomena, together with the principles governing the design of high voltage insulation, are covered in this book for students, utility engineers, designers and operators of high voltage equipment.', NULL, '4845141.jpg', '5915133.pdf', 1, 2000, 'Boston', 51, '2019-01-22 01:29:49', '2019-01-22 01:29:49', '203.190.11.118'),
(674, 72, 1, NULL, 1, 'RF and Microwave Radiation Safety Handbook', 'rf-and-microwave-radiation-safety-handbook', '2nd ed.', '978-0750643559', NULL, 'RF, Microwave, Radiation, Handbook.', 'The second edition takes into account a wide range of technical and legislative changes, and has been revised in line with the latest EU and international standards. Issues raised by increasing levels of microwave pollution from mobile phones and other sources are also confronted.', NULL, '7259239.jpg', '4119495.pdf', 1, 2001, NULL, 47, '2019-01-22 01:34:26', '2019-01-22 01:34:26', '203.190.11.115'),
(675, 12, 1, NULL, 1, 'Renewable Energy Systems: Advanced Conversion Technologies and Applications', 'renewable-energy-systems-advanced-conversion-technologies-and-applications', '1st ed.', '978-1439891094', NULL, 'Renewable, Energy, Conversion, Technologies, Applications.', 'Energy conversion techniques are key in power electronics and even more so in renewable energy source systems, which require a large number of converters. Renewable Energy Systems: Advanced Conversion Technologies and Applications describes advanced conversion technologies and provides design examples of converters and inverters for renewable energy systemsâ€•including wind turbine and solar panel energy systems.', NULL, '6883570.JPG', '4852566.pdf', 1, 2012, 'New York', 47, '2019-01-22 01:45:06', '2019-01-22 01:45:06', '203.190.11.115'),
(676, 10, 1, NULL, 1, 'Energy Efficiency and Renewable Energy Through Nanotechnology', 'energy-efficiency-and-renewable-energy-through-nanotechnology', '2011th Edition', '978-0857296375', NULL, 'Energy, Efficiency, Renewable Energy, Nanotechnology.', 'Reflecting the rapid growth of nanotechnology research and the potential impact of the growing energy crisis, Energy Efficiency and Renewable Energy Through Nanotechnology provides comprehensive coverage of cutting-edge research in the energy-related fields of nanoscience and nanotechnology, which aim to improve energy efficiency and the generation of renewable energy.', NULL, '4042499.jpg', '5881755.pdf', 1, 2011, 'New York', 47, '2019-01-22 01:52:55', '2019-01-22 01:52:55', '203.190.11.115'),
(677, 49, 1, NULL, 1, 'Real-Time Digital Signal Processing: Fundamentals, Implementations and Applications', 'real-time-digital-signal-processing-fundamentals-implementations-and-applications', '3rd Edition', '978-1118414323', NULL, 'Real-Time, Digital Signal, Fundamentals, Applications.', 'Real-Time Digital Signal Processing introduces fundamental digital signal processing (DSP) principles and will be updated to include the latest DSP applications, introduce new software development tools and adjust the software design process to reflect the latest advances in the field. In the 3rd edition of the book, the key aspect of hands-on experiments will be enhanced to make the DSP principles more interesting and directly interact with the real-world applications. All of the programs will be carefully updated using the most recent version of software development tools and the new TMS320VC5505 zeds USB Stick for real-time experiments. Due to its lower cost and portability, the new software and hardware tools are now widely used in university labs and in commercial industrial companies to replace the older and more expensive generation.', NULL, '9538462.jpg', '1180622.pdf', 1, 2013, 'New York', 47, '2019-01-22 02:01:25', '2019-01-22 02:01:25', '203.190.11.115'),
(678, 12, 1, NULL, 1, 'OPTO-MECHATRONIC SYSTEMS HANDBOOK Techniques and Applications', 'opto-mechatronic-systems-handbook-techniques-and-applications', '1st ed.', '0-8493-1162-4', NULL, 'OPTO, MECHATRONIC, SYSTEM, HANDBOOK', 'The past two decades have witnessed an unrelenting technological evolution that has produced advancements in devices, machines, processes, and systems by enhancing their performance and creating new value and function. Mechatronic technology, integrated by mechanical, electronic, and computer technologies, has certainly played an important role in this evolution. In recent years optical technology has been increasingly incorporated, and at an accelerated rate, into mechatronic systems, and vice versa. This may be attributable to the fact that optically integrated technology provides solutions to complex problems by achieving a desirable function or performance that mechatronic technology alone cannot solve. As a result, mechatronic or optical products, machines, and systems have further evolved toward a state of precision, reduced size, and greater intelligence and autonomy.', NULL, '7996067.JPG', '1647591.pdf', 1, 2003, 'New York', 50, '2019-01-22 14:39:21', '2019-01-22 14:39:21', '203.190.11.118'),
(679, 74, 1, NULL, 1, 'Numerical Methods for Engineering', 'numerical-methods-for-engineering-22400953', '6th', '978â€“0â€“07â€“340106â€“5', NULL, 'Numerical Methods , Numerical', 'To provide insight into numerical methods, we have organized the text into parts and present unifying information through the Motivation, Mathematical background, Orientation and Epilogue elements.Every chapter contains new and revised homework problems. Eighty percent of the problems are new or revised. Challenging problems drawn from all\r\nengineering disciplines are included in the text.', NULL, '3944516.JPG', '7362372.pdf', 1, 2010, 'Boston', 48, '2019-01-22 14:40:53', '2019-01-22 14:40:53', '203.190.10.204'),
(680, 44, 1, NULL, 1, 'OPTOMECHATRONICS Fusion of Optical and Mechatronic Engineering', 'optomechatronics-fusion-of-optical-and-mechatronic-engineering', '1st ed.', '978-0-8493-1969-3', NULL, 'OPTO, MECHATRONICS, Fusion, Optical, Mechatronic', 'The goal of this book is for it to enable the reader to learn how the multiple\r\ntechnologies can be integrated to create new and added value and function\r\nfor the engineering systems under consideration. To facilitate this objective,\r\nthe material brings together the fundamentals and underlying concepts of\r\nthis optomechatronic field into one text. The book therefore presents the\r\nbasic elements of the engineering fields ingredient to optomechatronics,\r\nwhile putting emphasis on the integrated approach.', NULL, '4446558.JPG', '2164428.pdf', 1, 2006, 'New York', 50, '2019-01-22 14:44:11', '2019-01-22 14:44:11', '203.190.11.115'),
(681, 128, 1, NULL, 1, 'Nuclear Power', 'nuclear-power-22500922', '1st ed.', '978-0-86341-668-2', NULL, 'Nuclear, Power', 'This book provides a concise but rigorous appraisal about the future of nuclear power and the presumed nuclear renaissance. It does so by assessing the technical, economic, environmental, political, and social risks related to all aspects of the nuclear fuel cycle, from uranium mills and mines to nuclear reactors and spent fuel storage facilities. In each case, the book argues that the costs of nuclear power significantly outweigh its benefits. It concludes by calling for investments in renewable energy and energy efficiency as a better path towards an affordable, secure, and socially acceptable future.', NULL, '3079837.JPG', '4047212.pdf', 1, 2007, 'London', 50, '2019-01-22 14:50:22', '2019-01-22 14:50:22', '203.190.11.118'),
(682, 10, 1, NULL, 1, 'Classical Mechanics Applied Mechanics and Mechatronics', 'classical-mechanics-applied-mechanics-and-mechatronics', '1st ed.', '978-1-4614-3977-6', NULL, 'Classical, Mechanics, Mechatronics', 'This is the third and final volume of a triad of books devoted to classical mechanics; it uses the theoretical background presented in Classical Mechanics: Kinematics and Statics and Classical Mechanics: Dynamics. It is focused on presenting a unique approach, rooted in classical mechanics, to studying mechanical and electromagnetic processes occurring in applied mechanics and mechatronics. In contrast to the majority of books devoted to applied mechanics, this volume places particular emphasis on theory, modeling, and analysis and control of gyroscopic devices, including military applications. This book provides practicing mechanical/mechatronic engineers and designers, researchers, and graduate and postgraduate students with a knowledge of mechanics focused directly on advanced\r\napplications.', NULL, '3173418.JPG', '4085358.pdf', 1, 2012, 'London', 50, '2019-01-22 14:53:43', '2019-01-22 14:53:43', '203.190.11.118'),
(683, 103, 1, NULL, 1, 'REAL-TIME SYSTEMS IN MECHATRONIC APPLICATIONS', 'real-time-systems-in-mechatronic-applications', '1st ed.', '978-0792381594', NULL, 'REAL, TIME, SYSTEMS, MECHATRONIC, APPLICATIONS', 'Real-Time Systems in Mechatronic Applications brings together in one place important contributions and up-to-date research results in this fast moving area. \r\nReal-Time Systems in Mechatronic Applications serves as an excellent reference, providing insight into some of the most challenging research issues in the field.', NULL, '9691335.JPG', '6826412.pdf', 1, 1998, 'London', 50, '2019-01-22 14:57:51', '2019-01-22 14:57:51', '203.190.11.118'),
(684, 210, 1, NULL, 1, 'Classical Electromagnetism', 'classical-electromagnetism', '1st ed.', '978-1530325917', NULL, 'The main topic of this course is Maxwellâ€™s equations. These are a set of eight\r\nfirst order partial differential equations which constitute a complete description\r\nof electric and magnetic phenomena.', 'Classical Electromagnetism', NULL, '8245285.JPG', '4669457.pdf', 1, 2016, 'New York', 50, '2019-01-22 15:05:47', '2019-01-22 15:05:47', '203.190.11.117'),
(685, 10, 1, NULL, 1, 'Mechatronics and Machine Vision in Practice', 'mechatronics-and-machine-vision-in-practice', '1st ed.', '978-3-540-74026-1', NULL, 'Mechatronics, Machine, Vision, Practice', 'Mechatronics education has been a constant source of interest to nearly all engineering conferences, and the first chapter in this book is dedicated to this most important subject.\r\nThe first paper discusses a very original idea from one of the more innovative\r\npioneers of mechatronics education. This looks at the movement and control of\r\na six legged omni-directional mobile robot, and determines how it can be programmed to perform the movements needed for a Viennese waltz.', NULL, '1450982.JPG', '5677958.pdf', 1, 2008, 'New York', 50, '2019-01-22 15:09:55', '2019-01-22 15:09:55', '203.190.11.115'),
(686, 49, 1, NULL, 1, 'Essentials of Mechatronics', 'essentials-of-mechatronics', '1st ed.', '978-0-471-72341-7', NULL, 'Essentials, Mechatronics', 'There are many defi nitions of mechatronics, but most involve the concept of\r\nblending mechanisms, electronics, sensors, and control strategies into a design, knitted together with software. With an abundant wealth of topics to choose from, authors of mechatronics textbooks are tempted to bundle them all into a massive compendium. This book seeks to throw out all but the essentials; although perhaps in hanging onto the baby, some bathwater will still remain.', NULL, '1239517.jpg', '3382340.pdf', 1, 2006, 'Canada', 50, '2019-01-22 15:13:35', '2019-01-22 15:13:35', '203.190.11.117'),
(687, 298, 1, NULL, 1, 'LINEAR CONTROL SYSTEM ANALYSIS AND DESIGN WITH MATLAE', 'linear-control-system-analysis-and-design-with-matlae', '5th Edition', '0-8247-4038-6', NULL, 'LINEAR, CONTROL, ANALYSIS, DESIGN, MATLAE', 'This edition has been enhanced as a solid undergraduate and first-year\r\ngraduate text; it emphasizes applying control theory fundamentals to both analog and sampled-data single-input single-output (SISO) feedback control systems. At the same time, the coverage of digital control systems is greatly\r\nexpanded. Extensive reference is made to computer-aided design (CAD)\r\npackages to simplify the design process. The result is a comprehensive presentation of control theory and designone that has been thoroughly classtested, ensuring its value for classroom and self-study use.', NULL, '8791673.JPG', '6431191.pdf', 1, 2003, 'New York', 50, '2019-01-22 15:20:48', '2019-01-22 15:20:48', '203.190.11.117'),
(688, 10, 1, NULL, 1, 'Fundamentals of Robotic Mechanical Systems Theory, Methods, and Algorithms', 'fundamentals-of-robotic-mechanical-systems-theory-methods-and-algorithms', '3rd ed.', '978-0-387-29412-4', NULL, 'Fundamentals, Robotic, Mechanical, Systems', 'The broad area of robotic mechanical systems continues developing at an impressive pace. The Third Edition of Fundamentals of Robotic Mechanical Systems does not claim to give a comprehensive account of developments up-to-date. The book still aims at establishing the fundamentals of a multidiscipline that is nowadays more active than it was in 2002, the year of publication of the Second Edition. In doing this, however, I have tried to give an account of current trends and to include references to a representative sample of developments up to 2005. An invaluable source on the state of the art is the International Conference on Robotics and Automation (ICRA), one of the best attended and most respectable conferences on the subject.', NULL, '6469914.JPG', '6302404.pdf', 1, 2007, 'New York', 50, '2019-01-22 15:24:31', '2019-01-22 15:24:31', '203.190.11.118'),
(689, 299, 1, NULL, 1, 'Analog Integrated Circuits : Power Management, Signal Conditioning and ASSP Devices : On semiconductor', 'analog-integrated-circuits-power-management-signal-conditioning-and-assp-devices-on-semiconductor', NULL, NULL, NULL, 'Analog , Circuits', 'The MC78M00/MC78M00A Series positive voltage regulators are identical to the popular MC7800 Series devices, except that they are specified for only half the output current. Like the MC7800 devices, the MC78M00 threeâ€“terminal regulators are intended for local, onâ€“card voltage regulation. Internal current limiting, thermal shutdown circuitry and safeâ€“area compensation for the internal pass transistor combine to make these devices remarkably rugged under most operating conditions. Maximum output current, with adequate heatsinking is 500 mA.', NULL, '5310896.JPG', '9514915.pdf', 1, 2002, 'USA', 48, '2019-01-22 15:26:08', '2019-01-22 15:26:08', '203.190.10.204'),
(690, 10, 1, NULL, 1, 'Informatics in Control, Automation and Robotics I', 'informatics-in-control-automation-and-robotics-i', '1st ed.', '978-1-4020-4136-5', NULL, 'Informatics, Control, Automation, Robotics', 'The present book includes a set of selected papers from the first â€œInternational Conference on Informatics in Control Automation and Roboticsâ€ (ICINCO 2004), held in SetÃºbal, Portugal, from 25 to 28 August 2004. Although ICINCO 2004 received 311 paper submissions, from 51 different countries in all continents, only 115 where accepted as full papers. From those, only 29 were selected for inclusion in this book, based on the classifications provided by the Program Committee. The selected papers also reflect the interdisciplinary nature of the conference. The diversity of topics is an importante feature of this conference, enabling an overall perception of several important scientific and technological trends.\r\nThese high quality standards will be maintained and reinforced at ICINCO 2005, to be held in Barcelona, Spain, and in future editions of this conference.', NULL, '8726771.JPG', '8564843.pdf', 1, 2006, 'New York', 50, '2019-01-22 15:28:28', '2019-01-22 15:28:28', '203.190.11.117'),
(691, 91, 1, NULL, 1, 'NANOTECHNOLOGY FOR MICROELECTRONICS AND OPTOELECTRONICS', 'nanotechnology-for-microelectronics-and-optoelectronics', '1st ed.', '978 0080 445533', NULL, 'NANOTECHNOLOGY,  MICROELECTRONICS, OPTOELECTRONICS', 'The aim of this book is to outline the basic physical concepts and device applications related to nanoscience and nanotechnology in semiconductor materials. As illustrated in the book, when the dimensions of a solid are reduced to the size of the characteristic lengths of electrons in the material (de Broglie wavelength, coherence length, localization length, etc.), new physical properties due to quantum effects become apparent.\r\nThese novel properties are manifested in various ways: quantum conductance oscillations, quantum Hall effects, resonant tunnelling, single-electron transport, etc. They can be observed in properly built nanostructures, such as semiconductor heterojunctions, quantum wells, superlattices, etc. which are described in detail in the text.', NULL, '5658012.JPG', '7126936.pdf', 1, 2006, 'U.S.A', 50, '2019-01-22 15:32:54', '2019-01-22 15:32:54', '203.190.11.115'),
(692, 57, 1, NULL, 1, 'Numerical Methods in Engineering with Python', 'numerical-methods-in-engineering-with-python', NULL, '978-0-511-12810-3', NULL, 'Numerical Methods , Engineering', 'This book attempts to conform to the views outlined above. Each numerical method is explained in detail and its shortcomings are pointed out. The examples that follow individual topics fall into two categories: hand computations that illustrate the inner workings of the-method and small programs that show how the computer coders utilized in solving a problem. Problems that require programming are marked with.The material consists of the usual topics covered in an engineering course on numerical methods: solution of equations, interpolation and data fitting, numerical differentiation and integration, solution of ordinary differential equations and eigenvalue problems.', NULL, '8452805.JPG', '8110657.pdf', 1, 2005, 'New York', 48, '2019-01-22 15:33:31', '2019-01-22 15:33:31', '203.190.10.204'),
(693, 49, 1, NULL, 1, 'Emerging Actuator Technologies A Micromechatronic Approach', 'emerging-actuator-technologies-a-micromechatronic-approach', '1st ed.', '0-470-09197-5', NULL, 'Emerging, Actuator, Technologies', 'The purpose of this book is to provide an introductory view, with a clear mechatronic focus, of the various different new actuator technologies (piezoelectric, shape memory, electroactive polymer, magnetostrictive and electro- and magnetorheological actuators). It is intended as a reference for mechanical, electrical, electronic and control engineers designing novel actuator systems. The book highlights the concurrent need of all these disciplines for a sound application-oriented approach to the development of new actuators. As such, it covers the principles of actuation, the governing equations, the mechatronic design of actuators and control strategies, their analysis in terms of performance and their behavior upon scaling, and\r\nit analyzes the application domains for each technology.', NULL, '6413957.JPG', '4437749.pdf', 1, 2006, 'England', 50, '2019-01-22 15:36:04', '2019-01-22 15:36:04', '203.190.11.117'),
(694, 49, 1, NULL, 1, 'INTRODUCTION TO FACTS CONTROLLERS', 'introduction-to-facts-controllers', '1st ed.', '978-0-470-47875-2', NULL, 'INTRODUCTION, FACTS, CONTROLLERS', 'Both authors have been involved in exploring flexible AC transmission systems (FACTS) controllers since the early 1990s. Kalyan Sen developed VSC-based FACTS models while working at Westinghouse. He has written an award-winning technical committee paper on the modeling of UPFC in the IEEE Transactions on Power Delivery. Mey Ling Sen explored an alternate approach to VSC-based FACTS controllers that is cost effective for most utility applications. This effort led to the concept of the Sen transformer (ST). She has modeled all kinds of FACTS controllers in great detail.', NULL, '9429769.JPG', '2960237.pdf', 1, 2009, 'Canada', 50, '2019-01-22 15:39:12', '2019-01-22 15:39:12', '203.190.11.118'),
(695, 174, 1, NULL, 1, 'Operation Maintenance of Large Turbo-Generators', 'operation-maintenance-of-large-turbo-generators', NULL, '0-471-61447-5', NULL, 'Operation Maintenance , Turbo-Generators', 'It is not uncommon for a large utility to have units of disparate size, origin, and vintage in its fleet of generators. Among its dozens of generators, there might be some from the 1950s or 1960s and some with their original asphalt or\r\nthermoplastic winding. These, and later units, may be running with and without magnetic retaining rings. Some with thermoplastic wingdings of all sortsâ€”with or without asbestos, hydrogen-cooled, air-cooled, split stator wingdings, self-excited, different types of externally excited, steam-driven or combustion-driven, and the list goes on and on.', NULL, '1729359.JPG', '6343180.pdf', 1, 2004, 'New York', 48, '2019-01-22 15:40:34', '2019-01-22 15:40:34', '203.190.10.204'),
(696, 72, 1, NULL, 1, 'Industrial Power Engineering and Applications Handbook', 'industrial-power-engineering-and-applications-handbook-22421031', '1st ed.', '0 7506 7351 6', NULL, 'Industrial, Power, Applications, Handbook', 'The author has had a long association with the machines described in this book. The book is the result of this experience and the overwhelming help and support extended to him by his colleagues, friends and business associates over the last twelve years. The purpose of this book is to share the experience of the author with those in the field. It is an attempt to make these subjects simple and interesting. The book should provide an easy approach to answer the problems an engineer or engineering student may face when handling these machines.', NULL, '4630934.JPG', '9480583.pdf', 1, 2001, 'Boston', 50, '2019-01-22 15:42:31', '2019-01-22 15:42:31', '203.190.11.115'),
(697, 10, 1, NULL, 1, 'Electromagnetic Theory for Microwaves and Optoelectronics', 'electromagnetic-theory-for-microwaves-and-optoelectronics-22451007', '2nd ed.', '978-3-540-74295-1', NULL, 'Electromagnetic, Theory, Microwaves, Optoelectronics', 'It has been nine years since the first English edition of this monograph was\r\npublished in 1998. During these years, the second Chinese edition and a new\r\nedition in traditional Chinese characters were published in Beijing, 2001 and\r\nTaipei, 2004, respectively.\r\nCompared with the first edition, this second English edition is different\r\nin rearranged and revised chapters and sections, improved explanations and\r\nnew contents. Some misprints, errors and inadequacies are also remedied.', NULL, '1625570.JPG', '3331974.pdf', 1, 2008, 'New York', 50, '2019-01-22 15:45:07', '2019-01-22 15:45:07', '203.190.11.115'),
(698, 300, 1, NULL, 1, 'Modern Control Engineering', 'modern-control-engineering', '3rd', '0-13-227307-1', NULL, 'Control Engineering , Modern Control', 'The book the basic concepts involved are emphasized and highly mathematical arguments are carefully avoided in the presentation of the materials. Mathematical proofs are provided when they contribute to the understanding of the subjects presented. All the material has been organized toward a gradual development of control theory.', NULL, '4082844.JPG', '5889255.pdf', 1, 1997, 'new jersey', 48, '2019-01-22 15:47:58', '2019-01-22 15:47:58', '203.190.10.204'),
(699, 10, 1, NULL, 1, 'Mechatronic Systems Design Methods, Models, Concepts', 'mechatronic-systems-design-methods-models-concepts', '1st ed.', '978-3-642-17530-5', NULL, 'Mechatronic, Systems, Design', 'This is the translated English edition of the book â€œSystementwurf mechatronischer Systemeâ€ published by Springer in January 2010. For the\r\nmotivation, background and concept of presentation, the obliging reader is\r\nreferred to the preface of the German edition, which follows.\r\nAlready in the course of preparing the German book and studying the\r\nvast literature in this subject area, I recognized that there still exists some\r\nroom on the international mechatronics stage for the material presented in\r\nthis monograph. Moreover, the many positive comments of colleagues and\r\nstudents on the German edition encouraged me to think of starting a second round with an English edition.', NULL, '7693132.JPG', '5767425.pdf', 1, 2012, 'New York', 50, '2019-01-22 15:48:06', '2019-01-22 15:48:06', '203.190.11.118'),
(700, 250, 1, NULL, 1, 'Technetium Chemistry and Radiopharmaceutical Applications', 'technetium-chemistry-and-radiopharmaceutical-applications', '1st ed.', '3-521-29490-1', NULL, 'Technetium, Chemistry, Radiopharmaceutical', 'The artificial radioelement of atomic number 43. technetium. is frequently considered to be a curiosity in inorganic chemistry. However, more than five decades ago, when sufficient quantities of the long-lived nuclide â€œâ€œâ€™lâ€™c with a half-life of 2.13. LOâ€™ a became available, investigations of its chemistry and physics soon confirmed technetium to be a true second-row transition element. filling the gap in the periodic system between manganese and rhenium. Technetium received much attention in fundanieutal inorganic chemistry studies at research institutions and universities. At present, the enormous number of technetium compounds, that have been isolated and charactcrized. documents the extensive research performed in technetium chemistry.', NULL, '3455611.JPG', '1705764.pdf', 1, 2000, 'New York', 50, '2019-01-22 15:51:08', '2019-01-22 15:51:08', '203.190.11.115'),
(701, 12, 1, NULL, 1, 'The Finite Difference Time Domain Method For Electromagnetics', 'the-finite-difference-time-domain-method-for-electromagnetics', '1st ed.', '0-8493-8657-8', NULL, 'Finite, Difference, Time, Domain, Electromagnetics', 'he Finite-Difference Time-domain (FDTD) method allows you to compute electromagnetic interaction for complex problem geometries with ease. The simplicity of the approach coupled with its far-reaching usefulness, create the powerful, popular method presented in The Finite Difference Time Domain Method for Electromagnetics. This volume offers timeless applications and formulations you can use to treat virtually any material type and geometry.\r\nThe Finite Difference Time Domain Method for Electromagnetics explores the mathematical foundations of FDTD, including stability, outer radiation boundary conditions, and different coordinate systems. It covers derivations of FDTD for use with PEC, metal, lossy dielectrics, gyrotropic materials, and anisotropic materials. A number of applications are completely worked out with numerous figures to illustrate the results.', NULL, '6684309.JPG', '9898228.pdf', 1, 1993, 'New York', 50, '2019-01-22 15:58:04', '2019-01-22 15:58:04', '203.190.11.118'),
(702, 74, 1, NULL, 1, 'Optical Switching and Networking Handbook', 'optical-switching-and-networking-handbook', NULL, '0-07-137356-X', NULL, 'Optical Switching , Networking', 'The demystification process of the technologies. This optical networking book is being branded as part of a continuing series of books that are geared toward a specific market niche. The Voice and Data Communications Handbook, the Broadband Telecommunications Handbook, and the forthcoming Broadband Wireless Handbook will all be a part of a series. These will aid you in understanding the technologies without the techno-geek jargon that is so common in our industry. Unfortunately, we are a part of a communications industry that has a very difficult time communicating ideas.', NULL, '3283521.JPG', '6279815.pdf', 1, 2001, 'New York', 48, '2019-01-22 15:59:28', '2019-01-22 15:59:28', '203.190.10.204'),
(703, 10, 1, NULL, 1, 'POWER PLANT ENGINEERING', 'power-plant-engineering', '1st ed.', '0-412-06401-4', NULL, 'POWER, PLANT, ENGINEERING', 'Blaise Pascal, scientist, mathematician, and physicist, once noted that the last thing we discover in writing a book is to know what to put at the beginning. I do not have that problem with this book, for I believe it is a book of such quality that the beginning must be an acknowledgment of the tremendous effort expended by many, many talented people. In a manner of speaking, it has taken Black & Veatch nearly 80 years to prepare this book. It has required that length of time, not because of the magnitude of the task, but rather because we have drawn on the knowledge and experience acquired over the full history of the firm to accumulate, test, and apply the information compiled here. In one sense, the book has been authored by literally thousands of engineers, architects, technicians, scientists, and others who have contributed to the success of Black & Veatch.', NULL, '8139003.JPG', '3680943.pdf', 1, 1996, 'New York', 50, '2019-01-22 16:03:46', '2019-01-22 16:03:46', '203.190.8.118'),
(704, 301, 1, NULL, 1, 'Nanotechnology Applications and Markets', 'nanotechnology-applications-and-markets', '1st ed.', '978-1-59693-006-3', NULL, 'Nanotechnology, Applications, Markets', 'Nanotechnology is, broadly speaking, an emerging technology that enables\r\nengineers to design and build new materials and products at the molecular level. The impact of nanotechnology is already being felt in the form of new computer memories that provide rapid access to stored data, that can hold more of this data than the minidrives used in iPODs and do not need any external power source to retain the data. It is being felt in the form of prototypes for photovoltaic cells that can literally be sprayed onto buildings or computers to provide cheap power sources. And it is being felt in the form of â€œnanoengineeredâ€ gels that speed the recovery of damaged nerve cells.', NULL, '8586096.jpg', '3193865.pdf', 1, 2006, 'London', 50, '2019-01-22 16:06:37', '2019-01-22 16:06:37', '203.190.8.118'),
(705, 302, 1, NULL, 1, 'Understanding Electro-Mechanical Engineering An Introduction to Mechatronics', 'understanding-electro-mechanical-engineering-an-introduction-to-mechatronics', '1st ed.', '0Â·7803Â·1031Â·4', NULL, 'Understanding, Electro-Mechanical, Introduction', 'A rocket streaks across the sky, guided by electro-mechanical gyroscopes\r\nand accelerometers. A cardiologist diagnoses a patient, helped by an electro-mechanical electro-cardiograph. A scientist explores a law of nature\r\non a computer, its data stored on electro-mechanical tape and disk memories. And the cardiologist and the scientist eat breakfasts prepared with electro-mechanical toasters. In the real world, mechanical engineering and electrical engineering are inextricably entwined. Every electrical device is a mechanical device designed for its electrical properties and manufactured in a factory of mechanical machines; many mechanical devices are partly electrical and most are made by machines that are electrically powered and electrically controlled.', NULL, '1810707.JPG', '8888883.pdf', 1, 1996, 'New York', 50, '2019-01-22 16:11:54', '2019-01-22 16:11:54', '203.190.8.116'),
(706, 52, 1, NULL, 1, 'CAPACITORS, MAGNETIC CIRCUITS, AND TRANSFORMERS', 'capacitors-magnetic-circuits-and-transformers', '1st ed.', NULL, NULL, 'CAPACITORS, MAGNETIC, CIRCUITS,  TRANSFORMERS', 'This book has hardback covers.Ex-library,With usual stamps and markings,In poor condition, suitable as a reading copy.No dust jacket.', NULL, '7689409.jpg', '1446736.pdf', 1, 1964, 'NEW JARCY', 50, '2019-01-22 16:18:28', '2019-01-22 16:18:28', '203.190.8.118'),
(707, 74, 1, NULL, 1, 'Basic Optics and Optical System Specifications', 'basic-optics-and-optical-system-specifications', NULL, NULL, NULL, 'Optical System , Optics', 'The purpose of virtually all image-forming optical systems is to resolve a specified minimum-sized object over a desired field of view. The field of view is expressed as the spatial or angular extent in object space, and the minimum-sized object is the smallest resolution element which is required to identify or otherwise understand the image. The word â€œspatialâ€ as used here simply refers to the linear extent of the field of view in the plane of the object. The field of view can be expressed as an angle or alternatively as a lateral size at a specified distance. For example, the field of view might be expressed as 10  10Â°, or alternatively as 350  350 m at a distance of 2 km, both of which mean the same thing', NULL, '1172100.JPG', '1363251.pdf', 1, 2004, 'USA', 48, '2019-01-22 16:27:08', '2019-01-22 16:27:08', '203.190.10.204'),
(708, 91, 1, NULL, 1, 'Optical Networks : A Practical Perspective', 'optical-networks-a-practical-perspective', '3rd', '978-0-12-374092-2', NULL, 'Optical , Networks', 'The book can be the basis for a graduate course in an electrical engineering curriculum. Alternatively, a graduate course in a computer science department might emphasize network architectures and control and management, by focusing on Part II, and skim over the technology portions of the book in Part I. Likewise, a course on optical transmission in an electrical engineering department might instead focus on Part I and omit the remaining chapters. Each chapter is accompanied by a number of problems, and instructors may obtain a solution manual by contacting the publisher.', NULL, '4168387.JPG', '4556207.pdf', 1, 2010, 'New York', 48, '2019-01-22 16:50:47', '2019-01-22 16:50:47', '203.190.10.204'),
(709, 280, 1, NULL, 1, 'Optimal Control Systems', 'optimal-control-systems', NULL, '0-8493-0892-5', NULL, 'Control Systems , Optimal', 'This book contains information obtained from authentic and highly regarded sources. Reprinted material\r\nis quoted with permission, and sources are indicated. A wide variety of references are listed. Reasonable\r\nefforts have been made to publish reliable data and information, but the author and the publisher cannot\r\nassume responsibility for the validity of all materials or for the consequences of their use.', NULL, '8886496.JPG', '7888011.pdf', 1, 2003, 'New York', 48, '2019-01-22 16:58:01', '2019-01-22 16:58:01', '203.190.10.204'),
(710, 303, 1, NULL, 1, 'Optimal Control : Linear Quadratic Methods', 'optimal-control-linear-quadratic-methods', NULL, '0-13-638651-2', NULL, 'Optimal , Linear', 'linear systems are very heavily emphasized, and the discussion of some results deemed fundamental in the general theory of optimal control has been kept to the barest minimum, thereby allowing emphasis on those particular optimal control results having application to linear systems. It may therefore seem strange to present a book on optimal control which does not expound in detail the Pontryagin Minimum Principle, but it is nonetheless consistent with the general aims of the book.', NULL, '1750531.JPG', '6165052.PDF', 1, 1989, 'USA', 48, '2019-01-22 17:07:10', '2019-01-22 17:07:10', '203.190.10.204'),
(711, 225, 1, NULL, 1, 'Optimal Filtering', 'optimal-filtering', NULL, '0-13-638122-7', NULL, 'Optimal , Filtering', 'the reader is the concentration on discrete-time filtering. Recent technological developments as well as the easier path offered students and instructors are the two reasons for this course of action. Much of the material of the book has been with us in one form or another for ten to fifteen years, although again, much is relatively recent. This recent work has given new perspectives on the earlier material; for example, the notion of the innovations process provides helpful\r\ninsights in deriving the Kalman filter.', NULL, '3538264.JPG', '9241437.PDF', 1, 1979, 'new jersey', 48, '2019-01-22 17:17:08', '2019-01-22 17:17:08', '203.190.10.204'),
(712, 304, 1, NULL, 1, 'Optimal Control with Engineering Application', 'optimal-control-with-engineering-application', NULL, '978-3-540-69437-3', NULL, 'Optimal Control , Optimal', 'This book is based on the lecture material for a one-semester senior-year undergraduate or first-year graduate course in optimal control which I have taught at the Swiss Federal Institute of Technology (ETH Zurich) for more than twenty years. The students taking this course are mostly students in mechanical engineering and electrical engineering taking a major in control. But there also are students in computer science and mathematics taking this\r\ncourse for credit.', NULL, '4811047.JPG', '5212219.pdf', 1, 2007, 'New York', 48, '2019-01-22 17:25:59', '2019-01-22 17:25:59', '203.190.10.204'),
(713, 49, 1, NULL, 1, 'SCATTERING OF ELECTROMAGNETIC WAVES', 'scattering-of-electromagnetic-waves', '1st ed.', '0-471-38799-7', NULL, 'SCATTERING, ELECTROMAGNETIC, WAVES', 'Electromagnetic wave scattering is an active, interdisciplinary area of\r\nresearch with myriad practical applications in fields ranging from atomic\r\nphysics to medical imaging to geoscience and remote sensing. In particular,\r\nthe subject of wave scattering by random discrete scatterers and rough surfaces presents great theoretical challenges due to the large degrees of freedom in these systems and the need to include multiple scattering effects accurately. In the past three decades, considerable theoretical progress has been made in elucidating and understanding the scattering processes involved in such problems. Diagrammatic techniques and effective medium theories remain essential for analytical studies; however, rapid advances in computer technology have opened new doors for researchers with the full power of Monte Carlo simulations in the numerical analysis of random media scattering.', NULL, '7303987.JPG', '3320325.pdf', 1, 2000, 'New York', 50, '2019-01-22 17:30:00', '2019-01-22 17:30:00', '203.190.8.118'),
(714, 49, 1, NULL, 1, 'Modern Nuclear Chemistry', 'modern-nuclear-chemistry', NULL, '9780471115328', NULL, 'Atom, Ionization, X-ray Emission, Nuclear Decay, Elementary Mechanics, Branching Decay, Collective Model, Electromagnetic Transition Rates, Transuranium Element Discovery.', 'There are many fine textbooks of nuclear physics and chemistry in print at this time. So the question can be raised as to why we would write another textbook, especially one focusing on the smaller discipline of nuclear chemistry. When we began this project over 5 years ago, we felt that we were at a unique juncture in nuclear chemistry and technology and that, immodestly, we had a unique perspective to offer to students.', NULL, '8510731.JPG', NULL, 1, 2006, 'Canada', 49, '2019-01-22 17:30:57', '2019-01-22 17:30:57', '203.190.8.118'),
(715, 250, 1, NULL, 1, 'Optimization Algorithms in Physics', 'optimization-algorithms-in-physics', '1st', '3-527-40307-8', NULL, 'Optimization Algorithms , Physics', 'This book is an interdisciplinary book: it tries to teach physicists the basic knowledge of combinatoric and stochastic optimization and describes to the computer scientists physical problems and theoretical models in which their optimization algorithms are needed. It is a unique book since it describes theoretical models and practical situation\r\nin physics in which optimization problems occur, and it explains from a physicists point of view the sophisticated and highly efficient algorithmic techniques that otherwise can only be found specialized computer science textbooks or even just in research journals.', NULL, '4339318.JPG', '3688371.pdf', 1, 2002, 'Germany', 48, '2019-01-22 17:32:05', '2019-01-22 17:32:05', '203.190.10.204'),
(716, 91, 1, NULL, 1, 'CARBON NANOTECHNOLOGY Recent Development in Chemistry, Physics, Materials science and Device Application', 'carbon-nanotechnology-recent-development-in-chemistry-physics-materials-science-and-device-application', '1st ed.', '978-0-444-51855-2', NULL, 'CARBON, NANOTECHNOLOGY', 'Nanotechnology is no longer a merely social talking point and is beginning to affect the lives of everyone. Carbon nanotechnology as a major shaper of new nanotechnologies has evolved into a truly interdisciplinary field, which encompasses chemistry, physics, biology, medicine, materials science and engineering. This is a field in which a huge amount of literature has been generated within recent years, and the number of publications is still increasing every year. Carbon Nanotechnology aims to provide a timely coverage of the recent development in the field with updated reviews and remarks by world-renowned experts. Intended to be an exposition of cutting-edge research and development rather than a kind of conference proceeding, Carbon Nanotechnology will be very useful not only to experienced scientists and engineers.', NULL, '6510046.JPG', '8286427.pdf', 1, 2006, 'U.K.', 50, '2019-01-22 17:41:23', '2019-01-22 17:41:23', '203.190.8.116'),
(717, 49, 1, NULL, 1, 'Modern Spectroscopy', 'modern-spectroscopy', '4th ed.', '0470844159', NULL, 'Important results in quantum mechanics, Hydrogen atom, Experimental methods, Molecular symmetry, Rotational spectroscopy, Lasers and laser spectroscopy.', 'Modern Spectroscopy has been written to fulfil a need for an up-to-date text on spectroscopy.\r\nIt is aimed primarily at a typical undergraduate audience in chemistry, chemical physics, or\r\nphysics in the United Kingdom and at undergraduate and graduate student audiences\r\nelsewhere. Spectroscopy covers a very wide area which has been widened further since the mid-\r\n1960s by the development of lasers and such techniques as photoelectron spectroscopy and\r\nother closely related spectroscopies. The importance of spectroscopy in the physical and\r\nchemical processes going on in planets, stars, comets and the interstellar medium has\r\ncontinued to grow as a result of the use of satellites and the building of radiotelescopes for\r\nthe microwave and millimetre wave regions.', NULL, '4911917.JPG', '5055678.pdf', 1, 2004, 'England', 49, '2019-01-22 17:43:24', '2019-01-22 17:43:24', '203.190.8.116');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(718, 49, 1, NULL, 1, 'Optoelectronic Integrated Circuit Design and Device Modeling', 'optoelectronic-integrated-circuit-design-and-device-modeling', NULL, '978-0-470-82736-9', NULL, 'Optoelectronic ,  Integrated Circuit', 'To introduce the basic concepts of optoelectronic devices to describe the modeling technique for optoelectronic devices and electronic devices used in high-speed optical systems to provide advanced optical transmitter and receiver front-end circuit design techniques.', NULL, '3478883.JPG', '1870823.pdf', 1, 2011, 'china', 48, '2019-01-22 17:44:03', '2019-01-22 17:44:03', '203.190.10.204'),
(719, 64, 1, NULL, 1, 'Grid Computing for Electromagnetics', 'grid-computing-for-electromagnetics', '1st ed.', '1-58053-777-4', NULL, 'Grid, Computing, Electromagnetics', 'This book is intended as a guide to the use of grid computing, an emerging branch of information technology for researchers involved in electromagnetics. It has a practical orientation and aims at allowing researchers to learn how to set up a computational grid, how to run electromagnetic applications on it, and how to use grid computing to identify new and promising perspectives for their research. The book could also be adopted as a text book in advanced courses of applied electromagnetics.', NULL, '6469878.JPG', '3171396.pdf', 1, 2004, 'London', 50, '2019-01-22 17:46:07', '2019-01-22 17:46:07', '203.190.8.116'),
(720, 10, 1, NULL, 1, 'Numerical Simulation of Mechatronic Sensors and Actuators', 'numerical-simulation-of-mechatronic-sensors-and-actuators', '1st ed.', '978-3-540-71359-3', NULL, 'Numerical, Simulation, Mechatronic, Sensors, Actuators', 'The second edition of this book fully preserves the character of the first edition\r\nto combine the detailed physical modelling of mechatronic systems and their\r\nprecise numerical simulation using the Finite Element (FE) method. Most of\r\nthe text and general appearance of the previous edition were retained, while\r\nthe coverage was extended and the presentation improved.', NULL, '3160312.JPG', '7986168.pdf', 1, 2007, 'New York', 50, '2019-01-22 17:48:11', '2019-01-22 17:48:11', '203.190.8.118'),
(721, 74, 1, NULL, 1, 'NUCLEAR CHEMICAL ENGINEERING', 'nuclear-chemical-engineering', '2nd ed.', '0-07-004531-3', NULL, 'NUCLEAR, CHEMICAL, ENGINEERING', 'The development of nuclear fssion chain reactors for the conversion of mass to energy and the transmutation of elements has brought into industrial prominence chemical substances and chemical engineering processes that a few years ago were no more than scientific curiosities. Uranium, formerly used mainly for coloring glass and ceramics, has become one of the worldâ€™s\r\nmost important sources of energy. Thorium, once used mainly in the Welsbach gas mantle, promises to become a nuclear fuel second in importance only to uranium. Zirconium and its chemical twin hafnium, formerly always produced together, have been separated and have emerged\r\nas structural materials of unique value in reactors. New chemical engineering processes have been devised to separate these elements, and even more novel processes have been developed for producing deuterium.', NULL, '6408467.jpg', '1592670.pdf', 1, 1981, 'New York', 50, '2019-01-22 17:50:58', '2019-01-22 17:50:58', '203.190.8.116'),
(722, 49, 1, NULL, 1, 'Physics of Optoelectronic Devices', 'physics-of-optoelectronic-devices', NULL, '0-17 1-10939-8', NULL, 'Optoelectronic Devices , Physics', 'This book emphasizes the theory of semiconductor optoelectronic devices. Comparisons between theoretical and experimental results are also shown. The book starts with the fundamentals, including Maxwell\'s equations, the continuity equation, and the basic semiconductor equations of solid-State electronics. These equations are essential in learning semiconductor physics applied to optoelectronics. We then discuss the prt pugtaion. generation. modu-lation. and detection of light. which arc the keys to understanding the physics behind the operation of optoelect ron is devices. For example. knowledge of the generation and propagation of light is crucial for understanding how a semi-conductor laser operates.', NULL, '7150242.JPG', '6323297.pdf', 1, 1995, 'New York', 48, '2019-01-22 17:52:14', '2019-01-22 17:52:14', '203.190.10.204'),
(723, 305, 1, NULL, 1, 'Human Friendly Mechatronics', 'human-friendly-mechatronics', '1st ed.', '0 444 50649 7', NULL, 'Human, Friendly, Mechatronics', '\"Mechatronics\" is the technology or engineering which has been rapidly developed in the last 2 or 3 decades. Today we can easily find \"mechatronics products\" in industries and in our daily life. The mechatronics products are listed as follows: Intelligent engine and cruise control systems for automobiles; Intelligent household electric appliances such as computer\r\ncontrolled sewing machine, washing machine, refrigerator, VTR; Auto-focusing camera; Computer peripheral equipment such as printer, magnetic/optical disk drive; Informationprocessing equipment such as digital communication system, portable telephone; NC machine tools such as wire-cut electric discharge machine, NC milling machine; environment control\r\nsystem including air conditioner, automatic door; Semiconductor manufacturing facilities; Automatic ZIP code reading machine.', NULL, '1902040.JPG', '1952660.pdf', 1, 2001, 'London', 50, '2019-01-22 17:53:33', '2019-01-22 17:53:33', '203.190.8.116'),
(724, 74, 1, NULL, 1, 'Nuclear Chemical Engineering', 'nuclear-chemical-engineering-22551229', '2nd ed.', '0-07-004531-3', NULL, 'Chemical Engineering Aspects of Nuclear Power, Nuclear Reactions, Fuel Cycles for Nuclear Reactors, Solvent Extraction of Metals, Uranium, Thorium, Zirconium and Hafnium, Uranium Isotope Separation.', 'The development of nuclear fssion chain reactors for the conversion of mass to energy and the transmutation of elements has brought into industrial prominence chemical substances and chemical engineering processes that a few years ago were no more than scientific curiosities. Uranium, formerly used mainly for coloring glass and ceramics, has become one of the worldâ€™s most important sources of energy. Thorium, once used mainly in the Welsbach gas mantle, promises to become a nuclear fuel second in importance only to uranium. Zirconium and its chemical twin hafnium, formerly always produced together, have been separated and have emerged as structural materials of unique value in reactors. New chemical engineering processes have been devised to separate these elements, and even more novel processes have been developed for producing deuterium, *â€™Uâ€™ , and the other separated isotopes that have become the fine chemicals of the nuclear age.', NULL, '6884734.jpg', '1525425.pdf', 1, 1981, 'New York', 49, '2019-01-22 17:55:29', '2019-01-22 17:55:29', '203.190.8.116'),
(725, 10, 1, NULL, 1, 'Mechatronic Servo System Control', 'mechatronic-servo-system-control', '1st ed.', '3-540-21096-2', NULL, 'Mechatronic, Servo, System, Control', 'The editor and composer is engaging in the study on systems control and\r\ntheir applications in university. As one of his research fields, with a plenty of\r\nopportunities of discussion with Kyura, who is long-term working on the servo controller design and its application in mechatronic industry, on the control of mechatronic machine during the past ten years, the cooperative research has been made greatly progress. These discussion meetings were held several times once a year. Achievements on the items of these discussion meetings were compiled into reports, each of which has between 50âˆ¼100 pages. Then, many valuable commends were obtained from Kyura in terms of these achievements. Moreover, new research directions were found.', NULL, '2016657.JPG', '7171841.pdf', 1, 2004, 'New York', 50, '2019-01-22 17:56:34', '2019-01-22 17:56:34', '203.190.8.116'),
(726, 12, 1, NULL, 1, 'Numerical Techniques in Electromagnetics', 'numerical-techniques-in-electromagnetics-22011301', '2nd ed.', '0-8493-1395-3', NULL, 'Numerical, Techniques, Electromagnetics', 'The art of computation of electromagnetic (EM) problems has grown exponentially for three decades due to the availability of powerful computer resources. In spite of this, the EM community has suffered without a suitable text on computational techniques commonly used in solving EM-related problems. Although there have been monographs on one particular technique or the other, the monographs are written for the experts rather than students. Only a few texts cover the major techniques and do that in a manner suitable for classroom use. It seems experts in this area are familiar with one or few techniques and not many experts seem to be familiar with all the common techniques. This text attempts to fill the gap.', NULL, '2040402.jpg', '6430832.pdf', 1, 2001, 'London', 50, '2019-01-22 18:01:01', '2019-01-22 18:01:01', '203.190.8.116'),
(727, 115, 1, NULL, 1, 'Nanotechnology An Introduction to Nanostructuring Techniques', 'nanotechnology-an-introduction-to-nanostructuring-techniques', '2nd ed.', '978-3-527-31871-1', NULL, 'Nanotechnology, Introduction, Nanostructuring', 'Microtechnology has changed our lives dramatically. The most striking impact is apparent in computer technology, which is essential for todayâ€™s industry, and also for our individual life styles. Apart from microelectronics, microtechnology influences many other areas. The size of typical structures that is accessible is in the sub-micrometer range, which is at the limits of optical resolution and barely visible with a light microscope. This is about 1/1000 smaller than structures resolvable by the naked eye, but still 1000 times larger than an atom. Todayâ€™s developments are addressing the size range below these dimensions. Because a typical structure size is in the nanometer range, the methods and techniques are defined as nanotechnology.', NULL, '2921907.JPG', '4360838.pdf', 1, 2007, 'Weinheim', 50, '2019-01-22 18:06:09', '2019-01-22 18:06:09', '203.190.8.116'),
(728, 107, 1, NULL, 1, 'Microelectronics, Microsystems and Nanotechnology', 'microelectronics-microsystems-and-nanotechnology', '1st ed.', '981-02-4769-9', NULL, 'Microelectronics, Microsystems, Nanotechnology', 'This volume contains the papers presented at the First Conference on\r\n\"Microelectronics, Microsystems and Nanotechnology\", held at NCSR\r\n\"Demokritos\" in Athens-Greece in November 20-22, 2000. The Conference was\r\norganized by the Institute of Microelectronics within the framework of the Greek\r\nNetwork on Microelectronics, Microsystems and Nanotechnology with the aim\r\nto gather together in an interactive forum all scientists and engineers working in\r\nGreece in the above fields, as well as internationally recognized specialists who\r\nwere invited to present the latest achievements worldwide.', NULL, '4147215.JPG', '3624125.pdf', 1, 2001, 'London', 50, '2019-01-22 18:09:17', '2019-01-22 18:09:17', '203.190.8.116'),
(729, 10, 1, NULL, 1, 'Physics of Classical Electromagnetism', 'physics-of-classical-electromagnetism', '1st ed.', '978-0-387-68015-6', NULL, 'Physics, Classical, Electromagnetism', 'The Maxwell theory of electromagnetism was well established in the latter nineteenth century, when H. R. Hertz demonstrated the electromagnetic wave. The theory laid the foundation for physical optics, from which the quantum concept emerged for microscopic physics. Einstein realized that the speed of electromagnetic propagation is a universal constant, and thereby recognized the Maxwell equations to compose a fundamental law in all inertial systems of reference. On the other hand, the pressing demand for efficient radar systems during WWII accelerated studies on guided waves, resulting in todayâ€™s advanced telecommunication technology, in addition to a new radio- and microwave spectroscopy. The studies were further extended to optical frequencies, and laser electronics and sophisticated semi-conducting devices are now familiar in daily life.', NULL, '5988935.JPG', '9943483.pdf', 1, 2007, 'U.S.A', 50, '2019-01-22 18:12:48', '2019-01-22 18:12:48', '203.190.8.116'),
(730, 49, 1, NULL, 1, 'High-Speed VLSI Interconnections', 'high-speed-vlsi-interconnections', '2nd ed.', '978-0471780465', NULL, 'VLSI Interconnections, Interconnection Delays.', 'In the decade since High-Speed VLSI Interconnections was first published, several major developments have taken place in the field. Now, updated to reflect these advancements, this Second Edition includes new information on copper interconnections, nanotechnology circuit interconnects, electromigration in the copper interconnections, parasitic inductances, and RLC models for comprehensive analysis of interconnection delays and crosstalk.', NULL, '7174364.jpg', '5958186.pdf', 1, 2007, 'New Jersey', 51, '2019-01-22 18:40:00', '2019-01-22 18:40:00', '203.190.8.116'),
(731, 306, 1, NULL, 1, 'The Fundamentals of Signal Analysis', 'the-fundamentals-of-signal-analysis', NULL, NULL, NULL, 'Signal Analysis', 'The analysis of electrical signals is a fundamental problem for many\r\nengineers and scientists. Even if the immediate problem is not electrical,\r\nthe basic parameters of interest are often changed into electrical signals by means of transducers. Common transducers include accelerometers and load cells in mechanical work, EEG electrodes and blood pressure probes in biology and medicine, and pH and conductivity probes in chemistry.', NULL, '4587853.JPG', '5525181.pdf', 1, 1995, NULL, 51, '2019-01-22 18:45:46', '2019-01-22 18:45:46', '203.190.8.118'),
(732, 86, 1, NULL, 1, 'Hughes Electrical & Electronic Technology', 'hughes-electrical-electronic-technology', '10th ed.', '978-0132060110', NULL, 'Hughes Electrical, Electronic Technology', 'In this textbook, the fundamental principles of electrical technology are clearly and simply outlined and then used to introduce the application of electrical and electronic systems. Power systems are also discussed fully. This tenth edition has been extensively updated with all new advances in the field.', NULL, '5503375.JPG', '3420907.pdf', 1, 2008, 'New York', 51, '2019-01-22 19:06:28', '2019-01-22 19:06:28', '203.190.8.116'),
(733, 307, 1, NULL, 1, 'Industrial Electronics for Engineers, Chemists, and Technicians: With Optional Lab Experiments', 'industrial-electronics-for-engineers-chemists-and-technicians-with-optional-lab-experiments', NULL, '0-8155-1467-0', NULL, 'Industrial Electronics, Engineers, Chemists.', 'Turn to this multipurpose reference for a practical understanding of electronics in the factory or laboratory. It\'s perfect for people who are not electrical engineers but who need to use electronic equipment every day at work. Avoid or solve common problems in the use of electronics in the factory or lab and optimize the use of measurement and control equipment with this helpful resource!', NULL, '7050835.jpg', '9873245.pdf', 1, 2001, 'U.S.A', 51, '2019-01-22 19:10:22', '2019-01-22 19:10:22', '203.190.8.116'),
(734, 12, 1, NULL, 1, 'Industrial Power System', 'industrial-power-system', NULL, '978â€‘0â€‘8247â€‘2443â€‘6', NULL, 'Power System, Power Transformers.', 'This book was inspired by power systems courses developed and taught by my father for IEEE Continuing Education (Montreal) over several years. It was intended to respond to what he felt was a need in the field for an engineering/design guide for all working engineers, particularly younger ones who are not exposed to power systems during their undergraduate studies and who may not get guidance or training at their work place. It was an idea which was enthusiastically supported and encouraged by members of IEEE Continuing Education (Montreal), the not-for-profit engineering education organization my father collaborated with for over thirty years.', NULL, '4525296.JPG', '6542743.pdf', 1, 2008, 'New York', 51, '2019-01-22 19:21:26', '2019-01-22 19:21:26', '203.190.8.118'),
(735, 74, 1, NULL, 1, 'Optimizing Wireless/RF Circuits', 'optimizing-wirelessrf-circuits', NULL, '0-07-134376-8', NULL, 'Optimizing , Circuits', 'Provide a review and summary of RF basics from a practical standpoint. This information (such as using y-parameters\r\nand Smith charts, RF-circuit stability calculations, and basic large-signal RF design) is included for those who are not completely familiar with wireless/RF technology, and for those who need a quick refresher. The descriptions included in these chapters form the basis for understanding operation of the many ICs covered in the remaining chapters. The preliminary chapters conclude by describing practical considerations for RF (such as resonant-circuit design and thermal/mounting problems, and PC board layout).', NULL, '9758774.JPG', '2438187.pdf', 1, 1999, 'New York', 48, '2019-01-22 20:06:23', '2019-01-22 20:06:23', '203.190.10.204'),
(736, 57, 1, NULL, 1, 'Ordinary Differential Equations', 'ordinary-differential-equations', NULL, '978-0-511-16483-5', NULL, 'Differential Equations , Equations', 'The use of mathematical computer packages is now a standard part of the undergraduate curriculum, and an important tool in the armory of practicing mathematicians, scientists and engineers. Although the emphasis in the text is on pencil and paper analysis, and the book in no way relies on the availability of such software, some topics, particularly the treatment of coupled nonlinear equations using phase plane ideas in Chapters 28â€“37, can benefit greatly from the graphical possibilities modern computers provide. Almost all of the figures in this book have been generated using MATLAB, and very occasionally particular MATLAB commands are mentioned in the text', NULL, '7413384.JPG', '8126690.pdf', 1, 2004, 'New York', 48, '2019-01-22 20:42:00', '2019-01-22 20:42:00', '203.190.10.204'),
(737, 308, 1, NULL, 1, 'Wireless Networks', 'wireless-networks', NULL, '0-596-00183-5', NULL, 'Wireless , Networks', 'Many areas are difficult to wire for traditional wired LAN\'s. Older buildings are often a problem; running cable through the walls of an older stone building to which the blueprints have been lost can be a challenge. In many places, historic\r\npreservation laws make it difficult to carry out new LAN installations in older buildings. Even in modern facilities, contracting for cable installation can be expensive and time-consuming.', NULL, '9405726.JPG', '3901477.pdf', 1, 2002, 'USA', 48, '2019-01-22 21:02:19', '2019-01-22 21:02:19', '203.190.10.204'),
(738, 152, 1, NULL, 1, 'Physics of Optoelectronics', 'physics-of-optoelectronics', NULL, '978-0-8247-5385-6', NULL, 'Physics , Optoelectronics', 'The Physics of Optoelectronics focuses on the properties of optical fields and their interaction with matter. The laser, light emitting diode (LED) and photodetector perhaps represent the best examples of the interaction. For this reason, the book begins with an introduction to lasers and LEDs, and progresses to the rate equations as the fundamental description of the emission and detection processes. The rate equations exhibit the matterâ€“light interaction through the gain terms. The remainder of the text develops the quantum mechanical expressions for gain and the optical fields. The text includes many of the derivation steps, and supplies figures to illustrate concepts in order to provide the\r\nreader with sufficient material for self-study.', NULL, '8804799.JPG', '4558675.pdf', 1, 2005, 'New York', 48, '2019-01-22 21:16:39', '2019-01-22 21:16:39', '203.190.10.204'),
(739, 245, 1, NULL, 1, 'Standard Handbook for Civil Engineers', 'standard-handbook-for-civil-engineers', '5th ed.', '0071364730 978-3540772293', NULL, NULL, 'A revision of the classic reference covering all important principles and techniques needed by practicing civil engineers. The 5th Edition incorporates changes in design and construction practices, especially in design specifications for construction materials, buildings and bridges, safety and health concerns, and the most current codes changes including ACI, AISC, ASTM, NDS for wood structures', NULL, '8432240.jpg', '8778980.pdf', 1, 2004, 'New York', 40, '2019-01-22 21:23:35', '2019-01-22 21:23:35', '203.190.8.116'),
(740, 74, 1, NULL, 1, 'Handbook of Corrosion Engineering', 'handbook-of-corrosion-engineering', NULL, '0-07-076516-2 (alk. paper)', NULL, NULL, 'Corrosion is the destructive attack of a material by reaction with its\r\nenvironment. The serious consequences of the corrosion process have\r\nbecome a problem of worldwide significance', NULL, '5803099.jpg', '9661225.pdf', 1, 1999, 'New York', 40, '2019-01-22 21:31:15', '2019-01-22 21:31:15', '203.190.8.116'),
(741, 152, 1, NULL, 1, 'The Circuits and Filtrers Handbook : Passive Active , and Digital Filters', 'the-circuits-and-filtrers-handbook-passive-active-and-digital-filters', NULL, '978-1-4200-5885-7', NULL, 'Circuits , Digital Filters', 'To eliminate signal contamination such as noise in communication systems to separate relevant from irrelevant frequency components to detect signals in radios and TVâ€™s to demodulate signals to bandlimit signals before sampling to convert sampled signals into continuous-time signals to improve the quality of audio equipment, e.g., loudspeaker In time-division to frequency-division multiplex systems in speech synthesis in the equalization of transmission lines and cables in the design of artificial cochleas.', NULL, '3207103.JPG', '4999059.pdf', 1, 2009, 'New York', 48, '2019-01-22 21:33:20', '2019-01-22 21:33:20', '203.190.10.204'),
(742, 43, 1, NULL, 1, 'Electrical Engineer\'s Portable Handbook', 'electrical-engineers-portable-handbook', '2nd ed.', '0-07-143349-X', NULL, NULL, 'The first edition of this title proved the most successful of the Portable Handbook series launched in 1999. Aimed at electrical engineers and technicians working in building power systems, the relentlessly practical Handbook succeeded as an in the field working tool. This new edition is necessitated by the new 2002 version of the National Electrical Code (NEC). This code changes render much of the existing material obsolete, so over half the chapters require heavy rewrites to stay current.', NULL, '2105951.jpg', '2533095.pdf', 1, 2004, 'New York', 40, '2019-01-22 21:36:49', '2019-01-22 21:36:49', '203.190.8.116'),
(743, 309, 1, NULL, 1, 'Path Integrals in Physics : Stochastic Processes and Quantum Mechanics', 'path-integrals-in-physics-stochastic-processes-and-quantum-mechanics', NULL, '0 7503 0801 X', NULL, 'Physics , Quantum Mechanics', 'The book is intended for those who are familiar with basic facts from classical and quantum mechanics as well as from statistical physics. We would like to stress that the book is not just a linearly ordered set of facts about path integrals and their applications, but the reader may find more effective ways to learn a desired topic. Each chapter is self contained and can be considered as an independent textbook: it contains general physical background, the concepts of the path-integral approach used, followed by most of the typical and important applications presented in detail. In writing this book, we have endeavored to make it as comprehensive as possible and to avoid statements such as â€˜it can be shownâ€™ or â€˜it is left as an exercise for the readerâ€™, as much as it could be done.', NULL, '8176636.JPG', '9925428.pdf', 1, 2001, 'Russia', 48, '2019-01-22 21:43:43', '2019-01-22 21:43:43', '203.190.10.204'),
(744, 310, 1, NULL, 1, 'Troubleshooting Analog Circuits', 'troubleshooting-analog-circuits', NULL, '0-7506-9949-8', NULL, 'Analog Circuits , Circuits', 'Usually submit a newly designed circuit layout to a review by our peen. I invite everybody to try to win a Beverage of Their Choice by catching a real mistake in my circuit. What we really call this, is s \"Becrcheck.\" Ws fun because if I give away a few pitchers of brew. I get some of my dumb mistakes correctedâ€”mistakes that I myself might not have found until a much-later. moreâ€¢ painful. and more-expensive stage. Furth..â€¢miae. we all get some education. And. you can never predict who will find the little picky errors or the occasional real killer mistake. All technicians and engineers are invited.', NULL, '9364435.JPG', '3531273.pdf', 1, 1991, 'Boston', 48, '2019-01-22 21:55:35', '2019-01-22 21:55:35', '203.190.10.204'),
(745, 81, 1, NULL, 1, 'Partial Differential Equations : With Fourier Series and Boundary Value Problems', 'partial-differential-equations-with-fourier-series-and-boundary-value-problems', '2nd', '0-13-148096-0', NULL, 'Differential Equations , Partial', 'Partial differential equations arise in modeling numerous phenomena in sci-ence and engineering. In this chapter we preview the ideas and techniques that will be studied in this book. Our goal is to convey something of the fla-vor of partial differential equations and their use in applications rather than to give a systematic development. In particular, by focusing on the vibration of a stretched string, we will see how partial differential equations arise in modeling a physical phenomenon and how the interpretation of their solu-tions helps us to understand this phenomenon. The chapter will culminate with a brief discussion of Fourier woes that highlights their importance to the development of the applications of partial differential equations.', NULL, '8246550.JPG', '2190722.pdf', 1, 2005, 'USA', 48, '2019-01-22 22:04:12', '2019-01-22 22:04:12', '203.190.10.204'),
(746, 311, 1, NULL, 1, 'Photonic Crystals : Molding The Flow of Light', 'photonic-crystals-molding-the-flow-of-light', '2nd', '978-0-691-12456-8', NULL, 'Photonic , Crystals', 'It is always difficult to write a book about a topic that is still a subject of active research. Part of the challenge lies in translating research papers directly into a text. Without the benefit of decades of classroom instruction, there is no existing body of pedagogical arguments and exercises to draw from.', NULL, '4946959.JPG', '5389429.pdf', 1, 2008, 'new jersey', 48, '2019-01-22 22:12:07', '2019-01-22 22:12:07', '203.190.10.204'),
(747, 74, 1, NULL, 1, 'Electric Motors Handbook', 'electric-motors-handbook', NULL, '978-0070359710', NULL, 'Electric Motors', 'Electric motors provide the driving power for a large and still increasing\r\npart of our modern industrial economy. The range of sizes and types of\r\nmotors is large and the number and diversity of applications continues\r\nto expand. The computer on which this book is typed, for example, has\r\nseveral electric motors inside, in the cooling fan and in the disk drives.\r\nThere is even a little motor that is used to eject the removable disk from\r\nits drive.', NULL, '4349840.JPG', '9620371.pdf', 1, 1998, NULL, 51, '2019-01-22 22:59:36', '2019-01-22 22:59:36', '203.190.8.118'),
(748, 312, 1, NULL, 1, 'Handbook of Electric Power Calculations', 'handbook-of-electric-power-calculations', '3rd ed.', '0-07-136298-3', NULL, 'Electric Power', 'A bestselling calculations handbook that offers electric power engineers and technicians essential, step-by-step procedures for solving a wide array of electric power problems. This edition introduces a complete electronic book on CD-ROM with over 100 live calculations--90% of the book\'s calculations. Updated to reflect the new National Electric Code advances in transformer and motors; and the new system design and operating procedures in the electric utility industry prompted by deregulation.', NULL, '4677566.JPG', '3891484.pdf', 1, 2001, 'New York', 51, '2019-01-22 23:08:30', '2019-01-22 23:08:30', '203.190.8.118'),
(749, 12, 1, NULL, 1, 'Electric Power Distribution Handbook', 'electric-power-distribution-handbook', NULL, '0849317916', NULL, 'Electric Power', 'Of the ...big three... components of the electricity infrastructure, distribution typically gets the least attention, and no thorough, up-to-date treatment of the subject has been published in years. Filling that void, the Electric Power Distribution Handbook provides comprehensive information on the electrical aspects of power distribution systems. It is an unparalleled source for the background information, hard-to-find tables, graphs, methods, and statistics that power engineers need, and includes tips and solutions for problem solving and improving performance. In short, this handbook gives readers the tools they need to understand the science and practices of distribution systems.', NULL, '9262597.jpg', '9723991.pdf', 1, 2004, 'New York', 51, '2019-01-22 23:13:50', '2019-01-22 23:13:50', '203.190.8.116'),
(750, 12, 1, NULL, 1, 'The Electric Power Engineering Handbook', 'the-electric-power-engineering-handbook', NULL, '0849385784', NULL, 'Electric Power, Engineering', 'The astounding technological developments of our age depend on a safe, reliable, and economical supply of electric power. It stands central to continued innovations and particularly to the future of developing countries. Therefore, the importance of electric power engineering cannot be overstated, nor can the importance of this handbook to the power engineer.', NULL, '8551875.jpg', '1795901.pdf', 1, 2001, 'U.S.A', 51, '2019-01-22 23:21:27', '2019-01-22 23:21:27', '203.190.8.118'),
(751, 49, 1, NULL, 1, 'Coplanar Waveguide Circuits, Components, and Systems', 'coplanar-waveguide-circuits-components-and-systems', '1st ed.', '0-471-22475-8', NULL, NULL, 'Up-to-date coverage of the analysis and applications of coplanar waveguides to microwave circuits and antennas\r\nThe unique feature of coplanar waveguides, as opposed to more conventional waveguides, is their uniplanar construction, in which all of the conductors are aligned on the same side of the substrate. This feature simplifies manufacturing and allows faster and less expensive characterization using on-wafer techniques.', NULL, '5168657.jpg', '2273468.pdf', 1, 2001, 'New York', 40, '2019-01-23 01:04:57', '2019-01-23 01:04:57', '203.190.8.118'),
(752, 174, 1, NULL, 1, 'Physics of Semiconductor Devices', 'physics-of-semiconductor-devices', '3rd', '978-0-47 1-1 4323-9', NULL, 'Physics , Semiconductor', 'The physics of semiconductor devices is naturally dependent on the physics of semiconductor materials themselves. This chapter presents a summary and review of the basic physics and properties of semiconductors. It represents only a small cross section of the vast literature on semiconductors; only those subjects pertinent to device operations are included here. For detailed consideration of semiconductor physics, the reader should consult the standard textbooks or reference works by Dunlap,\' Made lung,2 Moll,3 Moss,4 Smith.s Boer: Seeger,\' and Wang,s to name a\r\nfew.', NULL, '5556998.JPG', '2731271.pdf', 1, 2007, 'new jersey', 48, '2019-01-23 14:33:33', '2019-01-23 14:33:33', '203.190.10.204'),
(753, 313, 1, NULL, 1, 'Recent Trends in Mechatronics', 'recent-trends-in-mechatronics', '1st ed.', '1-903996-46-5', NULL, 'Recent, Trends, Mechatronics', 'Mechatronics is the fundamental key in the recent progress of mechanical\r\ndevices towards intelligent products which are becoming more and more present in everyday life. Japan and Asian countries have established significant progress in this area. Recently, France and European countries have made progress and obtained many practical applications.', NULL, '5046141.JPG', '6093812.pdf', 1, 2003, 'London', 50, '2019-01-23 14:44:17', '2019-01-23 14:44:17', '203.190.11.118'),
(754, 314, 1, NULL, 1, 'pilot\'s Handbook of Aeronautical Knowledge', 'pilots-handbook-of-aeronautical-knowledge', NULL, NULL, NULL, 'Aeronautical , Knowledge', 'The Pilotâ€™s Handbook of Aeronautical Knowledge provides basic knowledge that is essential for pilots. This handbook introduces pilots to the broad spectrum of knowledge that will be needed as they progress in their pilot training. Except for the Code of Federal Regulations pertinent to civil aviation, most of the knowledge areas applicable to pilot certification are presented. This handbook is useful to beginning pilots, as well as those pursuing more advanced pilot certificates.', NULL, '4574812.JPG', '6796534.pdf', 1, 2003, 'washington', 48, '2019-01-23 14:46:32', '2019-01-23 14:46:32', '203.190.10.204'),
(755, 103, 1, NULL, 1, 'HANDBOOK OF MICROSCOPY FOR NANOTECHNOLOGY', 'handbook-of-microscopy-for-nanotechnology', '1st ed.', '1-4020-8003-4', NULL, 'HANDBOOK, MICROSCOPY, NANOTECHNOLOGY', 'The rationale for editing this Handbook now has never been more compelling. Among many pioneers in the field of nanotechnology, Dr. Heinrich Rohrer and Dr. Gerd Binnig, inventors of the scanning tunneling microscope, along with Professor Ernst Ruska, inventor of the worldâ€™s first electron microscope, were awarded the Nobel Prize in Physics in 1986, for their invaluable contribution to the field of microscopy. Today, as the growth of nanotechnology is thriving around the world, microscopy will continue to increase its importance as the most powerful engine for discovery and fundamental understanding of nanoscale phenomena and structures.', NULL, '8472517.JPG', '4617832.pdf', 1, 2005, 'New York', 50, '2019-01-23 14:46:51', '2019-01-23 14:46:51', '203.190.11.118'),
(756, 315, 1, NULL, 1, 'Pile Design and Construction Practice', 'pile-design-and-construction-practice', '4th', '0-203-47457-0', NULL, 'Design , Construction', 'Piling is both an art and a science. The art lies in selecting the most suitable type of pile and method of installation for the ground conditions and the form of the loading. Science enables the engineer to predict the behavior of the piles once they are in the ground and subject to loading. This behavior is influenced profoundly by the method used to install the piles and it cannot be predicted solely from the physical properties of the pile and of the undisturbed soil. A knowledge of the available types of piling and methods of constructing piled foundations is essential for a thorough understanding of the science of their behavior. For this reason the author has preceded the chapters dealing with the calculation of allowable loads on piles and deformation behavior by descriptions of the many types of proprietary and non-proprietary piles and the equipment used to install them.', NULL, '8076511.JPG', '8988537.pdf', 1, 1994, 'London', 48, '2019-01-23 14:55:03', '2019-01-23 14:55:03', '203.190.10.204'),
(757, 199, 1, NULL, 1, 'Experiments with Alternate Currents of High Potential and High Frequency', 'experiments-with-alternate-currents-of-high-potential-and-high-frequency', '1st ed.', '1-58963-993-6', NULL, 'Experiments, Alternate, Currents, Potential, Frequency', 'The boy was early put to his books, and upon his father\'s removal to Gospic he spent four years in the public school, and later, three years in the Real School, as it is called. His escapades were such as most quickwitted boys go through, although be varied the programme on one oc casion by getting imprisoned in a remote mountain chapel rarely visited for service; and on another occasion by fall ing headlong into a huge kettle of boiling milk, just drawn from the paternal herds. A third curious episode was that connected with his efforts to ï¬‚y when, attempting to navigate the air with the aid of an old umbrella, he had, as might be expected, a very bad fall, and was laid up for six weeks.', NULL, '6702221.jpg', '9267129.pdf', 1, 2002, 'London', 50, '2019-01-23 14:55:25', '2019-01-23 14:55:25', '203.190.11.118'),
(758, 10, 1, NULL, 1, 'Modelling in Mechanical Engineering and Mechatronics', 'modelling-in-mechanical-engineering-and-mechatronics', '1st ed.', '9781846289088', NULL, 'Modelling, Mechanical, Engineering, Mechatronics', 'Nowadays, rapid and fundamental changes take place in government, business, technology and society. More than ever before, manufacturing is confronted with environment-related requirements. Globalization and eCommerce have led to the establishment of a demanding consumer market, where at least four general requirements for any single product concern manufacturers more than ever. These are high quality, low price, quick delivery, and last but not least â€“ high customization, leading to an explosively increasing number of variants to be produced and to complexity of the products and their production. In these conditions of increasing competition, the trends to specialization and consolidation of small and medium-sized enterprises are a legitimate consequence.', NULL, '6119927.JPG', '1737153.pdf', 1, 2007, 'London', 50, '2019-01-23 15:01:43', '2019-01-23 15:01:43', '203.190.11.118'),
(759, 316, 1, NULL, 1, 'Physics of Particles , Matter and the Universe', 'physics-of-particles-matter-and-the-universe', NULL, '0 7503 0416 2', NULL, 'Physics , Particles', 'There is a general perception that physics is a difficult science to understand. This arises for two main reasons. First, it is the most quantitative of all the sciences and, inevitably, the detailed description of its underlying theories is mostly couched in very advanced mathematical language. Second, at the most fundamental level, it deals with processes and phenomena on time and space scales inconceivably smaller or larger than those experienced in our everyday life. In other words it deals with a great deal of alien territory in terms of, for many people, an alien language. Hence the aforementioned â€˜difficultyâ€™.', NULL, '3338504.JPG', '2459706.pdf', 1, 1997, 'British', 48, '2019-01-23 15:04:16', '2019-01-23 15:04:16', '203.190.10.204'),
(760, 49, 1, NULL, 1, 'CONTROL SYSTEMS ENGINEERING', 'control-systems-engineering', 'Sixth Edition', '978-0470-91769-5', NULL, 'CONTROL, SYSTEMS, ENGINEERING', 'This book introduces students to the theory and practice of control systems engineering. The text emphasizes the practical application of the subject to the analysis and design of feedback systems. The study of control systems engineering is essential for students pursuing degrees in electrical, mechanical, aerospace, biomedical, or chemical engineering. Control systems are found in a broad range of applications within these disciplines, from aircraft and spacecraft to robots and process control systems.', NULL, '1660058.JPG', '7957450.pdf', 1, 2011, 'U.S.A', 50, '2019-01-23 15:05:41', '2019-01-23 15:05:41', '203.190.11.115'),
(761, 64, 1, NULL, 1, 'Practical Analog and Digital Filter Design', 'practical-analog-and-digital-filter-design-23141043', NULL, NULL, NULL, 'Analog , Digital', 'This book was intentionally written to be different from other filter design books in two important ways. First, the most common analog and digital filter design and implementation methods are covered in a no-nonsense manner. All important derivations and descriptions are provided to allow the reader to apply them directly to his or her own filter design problem. Over forty examples are provided to help illustrate the fundamentals of filter design. Not only are the details of analog active and digital IIR and FIR filter design presented in an organized and direct manner, but implementation issues are discussed to alert the reader to potential pitfalls.', NULL, '4304904.JPG', '7019802.pdf', 1, 2004, 'USA', 48, '2019-01-23 15:14:43', '2019-01-23 15:14:43', '203.190.10.204'),
(762, 95, 1, NULL, 1, 'Elements of Electromagnetics', 'elements-of-electromagnetics', '4th', NULL, NULL, 'Electromagnetics , Instructor', 'This is a great book but it has flaws like any book does. First of all sometimes there are mathematical errors inside and probably one of the worst downsides of this book is that it doesn\'t go in-depth that much. Now for someone taking Electromagnetic Fields, this is a book that will help you learn the basics and help you understand the topic in general but if you want in depth solutions and advanced techniques of solving problems, then this is not the book for you. This book is more of a supplemental book that goes along with another textbook rather than a stand alone all in one primary textbook.', NULL, '6713870.JPG', '2792083.pdf', 1, 2007, 'New York', 48, '2019-01-23 15:27:08', '2019-01-23 15:27:08', '203.190.10.204'),
(763, 174, 1, NULL, 1, 'Practical RF System Design', 'practical-rf-system-design', NULL, '0-471-20023-9', NULL, 'RF System , Design', 'This book is about RF system analysis and design at the level that requires an understanding of the interaction between the modules of a system so the ultimate performance can be predicted. It describes concepts that are advanced, that is, beyond those that are more commonly taught, because these are necessary to the understanding of effects encountered in practice. It is about answering questions.', NULL, '6072838.JPG', '1584030.pdf', 1, 2003, 'new jersey', 48, '2019-01-23 15:33:54', '2019-01-23 15:33:54', '203.190.10.204'),
(764, 74, 1, NULL, 1, 'Electronic Materials and Devices', 'electronic-materials-and-devices', '3rd', '0-07-295791-3', NULL, 'Electronic , Devices', 'The textbook represents a first course in electronic materials and devices for undergraduate students. With the additional topics in the accompanying CD, the text can also be used in a graduate introductory course in electronic materials for electrical engineers and material scientists. The third edition is an extensively revised and extended version of the second edition based on reviewer comments, with many new and expanded topics and numerous new worked examples and homework problems. While some of the changes appear to be minor, they have been, nonetheless, quite important in improving the text,', NULL, '1883565.JPG', '6013037.pdf', 1, 2006, 'New York', 48, '2019-01-23 15:41:41', '2019-01-23 15:41:41', '203.190.10.204'),
(765, 52, 1, NULL, 1, 'Principles of Communication Systems Simulation with Wireless Applications', 'principles-of-communication-systems-simulation-with-wireless-applications', NULL, '0-13-494790-8', NULL, 'Communication Systems , Wireless Applications', 'A number of the applications and examples discussed in this book are targeted to wireless communication systems. This was done for several reasons. First, many students studying communications will eventually work in the wireless industry. Also, a significant number of graduate students pursuing university-based research are working on problems related to wireless communications. Finally, as a result of the high level of interest in wireless communications, many graduate programs contain courses in wireless communications. This book is designed to support, at least in part, these courses, as well as the self-study needs of the working engineer.', NULL, '2186773.JPG', '1826183.pdf', 1, 2004, 'new jersey', 48, '2019-01-23 15:52:27', '2019-01-23 15:52:27', '203.190.10.204'),
(766, 49, 1, NULL, 1, 'Principles of Charged Particle Acceleration', 'principles-of-charged-particle-acceleration', NULL, '0-471-87878-2', NULL, 'Acceleration , Particle', 'This book evolved from the first term of a two-term course on the physics of charged particle acceleration that I taught at the University of New Mexico and at Los Alamos National Laboratory. The first term covered conventional accelerators in the single particle limit. The second term covered collective effects in charged particle beams, including high current transport and instabilities. The material was selected to make the course accessible to graduate students in physics and electrical engineering with no previous background in accelerator theory. Nonetheless, I sought to make the course relevant to accelerator researchers by including complete derivations and essential formulas', NULL, '9518831.JPG', '2669576.pdf', 1, 1999, 'New Mexico', 48, '2019-01-23 15:58:54', '2019-01-23 15:58:54', '203.190.10.204'),
(767, 103, 1, NULL, 1, 'Principles of Asynchronous Circuit Design : A Systems Perspective', 'principles-of-asynchronous-circuit-design-a-systems-perspective', NULL, '978-0792376132', NULL, 'Asynchronous , Circuit Design', 'This book was compiled to address a perceived need for an introductory text on asynchronous design. There are several highly technical books on aspects of the subject, but no obvious starting point for a designer who wishes to become acquainted for the first time with asynchronous technology. We hope this book will serve as that starting point.', NULL, '2089111.JPG', '4509716.pdf', 1, 2002, 'Boston', 48, '2019-01-23 16:09:04', '2019-01-23 16:09:04', '203.190.10.204'),
(768, 317, 1, NULL, 1, 'Principles of Lasers and Optics', 'principles-of-lasers-and-optics', NULL, '978-0-511-08061-6', NULL, 'Optics , Lasers', 'Radiation from lasers is different from conventional optical light because, like microwave radiation, it is approximately monochromatic. Although each laser has its own fine spectral distribution and noise properties, the electric and magnetic fields from lasers are considered to have precise phase and amplitude variations in the first-order approximation. Like microwaves, electromagnetic radiation with a precise phase and amplitude is described most accurately by Maxwellâ€™s wave equations. For analysis of optical fields in structures such as optical wave guides and\r\nsingle-mode fibers, Maxwellâ€™s vector wave equations with appropriate boundary conditions are used.', NULL, '3750414.JPG', '5106471.pdf', 1, 2005, 'New York', 48, '2019-01-23 16:19:44', '2019-01-23 16:19:44', '203.190.10.204'),
(769, 318, 1, NULL, 1, 'Motorola Digital Signal Processors : Principles of Sigma-Delta Modulation for Analog-to-Digital Converters', 'motorola-digital-signal-processors-principles-of-sigma-delta-modulation-for-analog-to-digital-converters', '2nd', NULL, NULL, 'Motorola , Digital Signal', 'The performance of digital signal processing and communication systems is generally limited by the precision of the digital input signal which is achieved at the interface between analog and digital information. Sigma-Delta (Î£âˆ’âˆ†) modulation based analog-todigital (A/D) conversion technology is a cost effective alternative for high resolution (greater than 12 bits) converters which can be ultimately integrated on digital signal processor ICs.', NULL, '4950709.JPG', '4747934.pdf', 1, 1990, 'USA', 48, '2019-01-23 16:27:09', '2019-01-23 16:27:09', '203.190.10.204'),
(770, 49, 1, NULL, 1, 'Fundamentals of Probability and Statistics for Engineers', 'fundamentals-of-probability-and-statistics-for-engineers', NULL, '0-470-86814-7', NULL, 'Statistics , Probability', 'As an introductory course, a sound and rigorous treatment of the basic principles is imperative for a proper understanding of the subject matter and for confidence in applying these principles to practical problem solving. A student, depending upon his or her major field of study, will no doubt pursue advanced work in this area in one or more of the many possible directions. How well is he or she prepared to do this strongly depends on his or her mastery of the fundamentals.', NULL, '3506668.JPG', '2562762.pdf', 1, 2004, 'New York', 48, '2019-01-23 16:35:15', '2019-01-23 16:35:15', '203.190.10.204'),
(771, 52, 1, NULL, 1, 'Probability & Statistics for Engineers & Scientists', 'probability-statistics-for-engineers-scientists', '9th', '978-0-321-62911-1', NULL, 'Statistics , Probability', 'Class projects were added in several chapters to provide a deeper understanding of the real-world use of statistics. Students are asked to produce or gather their own experimental data and draw inferences from these data. More case studies were added and others expanded to help students understand the statistical methods being presented in the context of a real-life situation. For example, the interpretation of confidence limits, prediction limits, and tolerance limits is given using a real-life situation.\"Pot Holesâ€ were added at the end of some chapters and expanded in others.', NULL, '9931173.JPG', '8917458.pdf', 1, 2012, 'New York', 48, '2019-01-23 16:44:34', '2019-01-23 16:44:34', '203.190.10.204'),
(772, 319, 1, NULL, 1, 'Principles of Quantum Mechanics', 'principles-of-quantum-mechanics', '2nd', '0-306-44790-8', NULL, 'Quantum , Mechanics', 'It\'s followed by one on classical mechanics, where the Lagrangian and Hamiltonian formalism\'s are developed in some depth. It is for the instructor to decide how much of this to cover; the more students know of these matters, the better they will understand the connection between classical and quantum mechanics. Chapter 3 is devoted to a brief study of idealized experiments that betray the inadequacy of classical mechanics and give a glimpse of quantum mechanics.', NULL, '5522935.JPG', '4630315.pdf', 1, 1994, 'New York', 48, '2019-01-23 16:58:55', '2019-01-23 16:58:55', '203.190.10.204'),
(773, 128, 1, NULL, 1, 'Condition Monitoring of Rotating Electrical Machines', 'condition-monitoring-of-rotating-electrical-machines-23111207', NULL, '978-0-86341-739-9', NULL, 'Condition, Monitoring, Rotating, Electrical, Machines', 'Condition monitoring of engineering plant has increased in importance as more\r\nengineering processes become automated and the manpower needed to operate and supervise plant is reduced. However, electrical machinery has traditionally been thought of as reliable and requiring little attention, except at infrequent intervals when the plant is shut down for inspection. Indeed the traditional application of fastacting protective relays to electrical machines has rather reduced the attention that\r\noperators pay to the equipment.', NULL, '4051998.JPG', '1651186.pdf', 1, 2008, 'London', 50, '2019-01-23 17:11:07', '2019-01-23 17:11:07', '203.190.11.116');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(774, 320, 1, NULL, 1, 'Programmable Controllers : Theory and Implementation', 'programmable-controllers-theory-and-implementation', '2nd', '0-944107-32-X', NULL, 'Controllers , Implementation', 'Programmable logic controllers, also called programmable controllers or PLCs, are solid-state members of the computer family, using integrated circuits instead of electromechanical devices to implement control functions. They are capable of storing instructions, such as sequencing, timing, counting, arithmetic, data manipulation, and communication, to control industrial machines and processes. Figure 1-1 illustrates a conceptual diagram of a PLC application.', NULL, '5066615.JPG', '2806951.pdf', 1, 1997, 'USA', 48, '2019-01-23 17:11:40', '2019-01-23 17:11:40', '203.190.10.204'),
(775, 321, 1, NULL, 1, 'ELECTROMAGNETISM Principles and Applications', 'electromagnetism-principles-and-applications', '1st ed.', '0-7167-0064-6', NULL, 'ELECTROMAGNETISM, Principles, Applications', 'The book is intended for courses at the freshman or sophomore level,\r\neither as an introduction to the subject for physicists and engineers, or as a last\r\ncourse in electromagnetism for students in other disciplines. It is assumed that the reader has had a one-term course on differential and integral calculus. No previous knowledge of vectors, multiple integrals, differential equations, or complex numbers is assumed. The features of our previous book that have been so appreciated will be found here as well: the examples mentioned above, problems drawn from the current literature, a summary at the end of each chapter, and three-dimensional figures, this time drawn in true perspective.', NULL, '7621325.jpg', '6013738.pdf', 1, 1979, 'San Francisco', 50, '2019-01-23 17:14:36', '2019-01-23 17:14:36', '203.190.11.116'),
(776, 321, 1, NULL, 1, 'Electromagnetic Fields and Waves Including Electric Circuits', 'electromagnetic-fields-and-waves-including-electric-circuits', '3rd ed.', '0-716-71869-3', NULL, 'Electromagnetic, Fields, Waves, Circuits', 'Since its original publication in 1962, Lorrain and Corson\'s text has offered physics and engineering students a formula for developing a working knowledge of the basic principles of electromagnetism. The formula is practice.', NULL, '3796815.JPG', '5483580.pdf', 1, 1988, 'U.S.A', 50, '2019-01-23 17:21:04', '2019-01-23 17:21:04', '203.190.11.116'),
(777, 107, 1, NULL, 1, 'Problems and Solutions of Atomic, Nuclear, and Particle Physics', 'problems-and-solutions-of-atomic-nuclear-and-particle-physics', NULL, '981-02-3918-l', NULL, 'Physics , Atomic', 'This series of physics problems and solutions, which consists of seven volumes â€” Mechanics, Electromagnetism, Optics, Atomic, Nuclear and Particle Physics, Thermodynamics and Statistical Physics, Quantum Mechanics, Solid State Physics and Relativity, contains a selection of 2550 problems from the graduate-school entrance and qualifying examination papers of seven U.S. universities â€” California University Berkeley Campus, Columbia University, Chicago University, Massachusetts Institute of Technology, New York State University Buffalo Campus, Princeton University, Wisconsin University.', NULL, '2424556.JPG', '9159170.pdf', 1, 2000, 'new jersey', 48, '2019-01-23 17:21:58', '2019-01-23 17:21:58', '203.190.10.204'),
(778, 128, 1, NULL, 1, 'Electrical Steels for rotating Machines', 'electrical-steels-for-rotating-machines-23251205', NULL, '978-0-85296-980-9', NULL, 'Electrical, Steels, rotating, Machines', 'This book is intended to offer to the electrical design engineer an insight into what properties may be expected from electrical steels and how these properties may best be exploited in machine design. It is hoped that by giving insight into the interplay between magnetic properties, manufacturing methods, physical properties and costs, sound rational judgements may be made about machine structuring and operation. No attempt is made to delve into the inner recesses of the theories of physical metallurgy; suffice it to make clear what does in fact happen for what clearly traceable reasons.', NULL, '7917131.JPG', '9003466.pdf', 1, 2002, 'London', 50, '2019-01-23 17:25:05', '2019-01-23 17:25:05', '203.190.11.116'),
(779, 322, 1, NULL, 1, 'Understanding and mitigating ageing in nuclear power plants', 'understanding-and-mitigating-ageing-in-nuclear-power-plants', '1st ed.', '978-1-85573-932-1', NULL, 'Understanding, mitigating, ageing, nuclear, power, plants', 'The development and commercial use of nuclear energy in the form of costcompetitive electricity and district heating was one of the most significant\r\nindustrial achievements of the 20th century. The 21st century is now\r\napproaching its second decade, and global energy consumption continues to\r\ngrow rapidly, and projections show a doubling of world electricity demand by\r\n2030, creating the need for considerable amounts of newly installed generating\r\ncapacity (of all origins) in the next 25 years. The current global nuclear\r\nenergy capacity is about 367 GWe, and between 524 GWe and 740 GWe is\r\nexpected to be needed before 2050.', NULL, '8412804.JPG', '7858730.pdf', 1, 2010, 'Philadelphia', 50, '2019-01-23 17:28:44', '2019-01-23 17:28:44', '203.190.11.116'),
(780, 323, 1, NULL, 1, 'Quantum Gravity, Generalized Theory of Gravitation, and SuperstringTheory-Based Unification', 'quantum-gravity-generalized-theory-of-gravitation-and-superstringtheory-based-unification', NULL, '0-306-47104-3', NULL, 'Quantum Gravity , Generalized', 'proper analysis without having the benefit of a metric of space-time. All of these considerations are of course compatible with Einsteinâ€™s theory of gravity. Where c the speed of light, relates time to space. In order to pursue further the significance of varying of the speed of light and its role in the important quantities like Planck Scale length and Planck Scale mass could be affected. Should we then imagine two different metrics one describing the propagation of photons and the other describing gravity itself, which is space-time metric, and the associated particles of gravitons.', NULL, '9916912.JPG', '6136080.pdf', 1, 2002, 'New York', 48, '2019-01-23 17:30:23', '2019-01-23 17:30:23', '203.190.10.204'),
(781, 128, 1, NULL, 1, 'Voltage Quality in Electrical Power Systems', 'voltage-quality-in-electrical-power-systems', '1st ed.', '978-0-85296-975-5', NULL, 'Voltage, Quality, Electrical, Power, Systems', 'The problem of voltage quality is gaining increasing importance due to the\r\nwidespread use of power electronics (increasing emitted interference) on the one hand, and the reduction in the signal levels in electronic equipment (increased interference susceptibility) on the other hand. The voltage quality depends on various phenomena of the network perturbations, one of which, the conducted disturbance, is examined in this book.\r\nThis book deals with the subject of voltage quality from a practical viewpoint\r\nbut without omitting the mathematical aspects. The problems set out in this\r\nbook are taken from many examples of operating practice and methods of\r\nsolving these problems are indicated.', NULL, '8766369.JPG', '1173920.pdf', 1, 2000, 'London', 50, '2019-01-23 17:31:44', '2019-01-23 17:31:44', '203.190.11.118'),
(782, 128, 1, NULL, 1, 'Condition Assessment of High Voltage Insulation in Power System Equipment', 'condition-assessment-of-high-voltage-insulation-in-power-system-equipment', '1st ed.', '978-0-86341-737-5', NULL, 'Condition, Assessment, Voltage, Insulation, Equipment', 'The need for increased reliability and optimum economic performance of high-voltage power systems has become of greater importance in recent years. A major factor in achieving these objectives is the provision of efficient maintenance of the wide range of equipment. This applies especially to the assessment of the condition of the insulating materials, many of which are subjected to high electrical stresses in critical locations. The rates of deterioration of these materials are dependent on the operating conditions and, in some cases, materials are expected to retain their useful properties for forty years. In order to monitor any dangerous changes in the insulating\r\nmaterials, much work is being carried out worldwide in the universities and similar establishments, as well as by utilities and plant manufacturers.', NULL, '5177068.JPG', '3736421.pdf', 1, 2008, 'London', 50, '2019-01-23 17:34:15', '2019-01-23 17:34:15', '203.190.11.116'),
(783, 174, 1, NULL, 1, 'THYRISTOR-BASED FACTS CONTROLLERS FOR ELECTRICAL TRANSMISSION SYSTEMS', 'thyristor-based-facts-controllers-for-electrical-transmission-systems', '1st ed.', '0-471-20643-1', NULL, 'THYRISTOR, FACTS, CONTROLLERS, ELECTRICAL, TRANSMISSION, SYSTEMS', 'Over the past two decades, static reactive power compensators have evolved into a mature technology and become an integral part of modern electrical power systems. They are one of the key devices in flexible AC transmission systems (FACTS). Coordination of static compensators with other controllable FACTS devices promises not only tremendously enhanced power system controllability, but also the extension of power transfer capability of existing transmission corridors to near their thermal capacities, thus delaying or even curtailing the need to invest in new transmission facilities. Offering both an in-depth presentation of theoretical concepts and practical applications pertaining to these power compensators, Thyristor-Based FACTS Controllers for Electrical Transmission Systems fills the need for an appropriate text on this emerging technology.', NULL, '5964273.jpg', '9628468.pdf', 1, 2002, 'New York', 50, '2019-01-23 17:38:13', '2019-01-23 17:38:13', '203.190.11.116'),
(784, 324, 1, NULL, 1, 'The Design of High Performance Mechatronics', 'the-design-of-high-performance-mechatronics', NULL, '978-1-60750-826-7', NULL, 'Design, High, Performance, Mechatronics', 'The book that you are reading now distinguishes itself from other books\r\nin several ways. First of all it is written as a balancing act between both\r\nthe industrial and the academic background of the authors. The industrial\r\npart is based on extensive experience in designing the most sophisticated\r\nmotion systems presently available, the stages of wafer scanners that are\r\nused in the semiconductor industry. The academic part is based on advanced research on ultra precision metrology equipment with fast ScanningProbe Microscopy and optical measurements with sub-nanometre accuracy.', NULL, '9529915.jpg', '8240628.pdf', 1, 2011, 'NETHERLANDS', 50, '2019-01-23 17:42:38', '2019-01-23 17:42:38', '203.190.11.117'),
(785, 12, 1, NULL, 1, 'Engineering Electromagnetics Applications', 'engineering-electromagnetics-applications-23471229', '1st ed.', '978-0-8493-7363-3', NULL, 'Engineering, Electromagnetics, Applications', 'This volume, derived from the Handbook of Engineering Electromagnetics (2004), is intended as a desk reference for the broad area of engineering electromagnetics. Since electromagnetics provides the underpinnings for many technological fields such as wireless communications, fiber optics, microwave engineering, radar, electromagnetic compatibility, material science, and biomedicine, there is a great deal of interest and need for training in the engineering applications of electromagnetics. Practicing engineers in these diverse fields need to understand how electromagnetic principles can be applied to the formulation and solution of actual engineering problems. As technologies wax and wane and engineers move around, they find themselves learning new applications on the run.', NULL, '2348022.JPG', '3144225.pdf', 1, 2006, 'New York', 50, '2019-01-23 17:47:29', '2019-01-23 17:47:29', '203.190.11.116'),
(786, 12, 1, NULL, 1, 'Fundamentals of Engineering Electromagnetics', 'fundamentals-of-engineering-electromagnetics', '1st ed.', '978-0-8493-7360-2', NULL, 'Fundamentals, Engineering, Electromagnetics', 'This volume, derived from the Handbook of Engineering Electromagnetics (2004), is intended as a desk reference for the fundamentals of engineering electromagnetics. Because electromagnetics provides the underpinnings for many technological fields such as wireless communications, fiber optics, microwave engineering, radar, electromagnetic compatibility, material science, and biomedicine, there is a great deal of interest and need\r\nfor training in the concepts of engineering electromagnetics. Practicing engineers in these diverse fields must understand how electromagnetic principles can be applied to the formulation and solution of actual engineering problems.', NULL, '2023606.jpg', '3065294.pdf', 1, 2006, 'London', 50, '2019-01-23 17:50:18', '2019-01-23 17:50:18', '203.190.11.116'),
(787, 175, 1, NULL, 1, 'Handbook of ENGINEERING ELECTROMAGNETICS', 'handbook-of-engineering-electromagnetics-23581256', '1st ed.', '0-8247-5628-2', NULL, 'Handbook, ENGINEERING, ELECTROMAGNETICS', 'This handbook is intended as a desk reference for the broad area of engineering electromagnetics. Since electromagnetics provides the underpinnings for many technological fields such as wireless communications, fiber optics, microwave engineering, radar, electromagnetic compatibility, material science, and biomedicine, there is a great deal of interest in and need for training in the engineering applications of electromagnetics. Practicing engineers in these diverse fields need to understand how engineering electromagnetic principles can be applied to the formulation and solution of actual engineering problems. As technologies wax and wane and engineers move around, they find themselves learning new applications on the run.', NULL, '5229416.JPG', '3255154.pdf', 1, 2004, 'New York', 50, '2019-01-23 17:58:56', '2019-01-23 17:58:56', '203.190.11.117'),
(788, 91, 1, NULL, 1, 'Nuclear Energy An introduction to the Concepts, Systems and Application of Nuclear Processes', 'nuclear-energy-an-introduction-to-the-concepts-systems-and-application-of-nuclear-processes', '6th ed.', '978-0-12-370547-1', NULL, 'Nuclear, Energy, introduction', 'The prospects for continued and new nuclear power plants in the United States have improved greatly since the fifth edition was written. In what is called a nuclear renaissance, many utilities have made application to the Nuclear Regulatory Commission for license extension and approval for new reactor construction. Nuclear reactors are planned that combat global warming, conserve nuclear fuel, support desalination, and produce hydrogen for transportation. Since the terrorist attacks of September 11, 2001, applications of nuclear processes have become more important. Detectors of nuclear materials entering the United States are being installed, and physical protection of nuclear facilities has been greatly enhanced.', NULL, '6772457.JPG', '6089185.pdf', 1, 2009, 'U.K.', 50, '2019-01-23 18:04:39', '2019-01-23 18:04:39', '203.190.11.118'),
(789, 325, 1, NULL, 1, 'Energy Today Nuclear Power', 'energy-today-nuclear-power', '1st ed.', '978-1-60413-784-2', NULL, 'Nuclear, Power, Energy, Today', 'A basic fact of nature makes it possible for us to get electricity. That fact is that energy can be changed from one form to another. Most often, we get electricity from the form of energy known as heat. Usually, the heat is used to boil water so that it turns into steam. The steam runs a machine called a turbine, which\r\nproduces a turning movement. The turning movement causes another machine, called a generator, to make electricity.', NULL, '2540973.JPG', '8903341.pdf', 1, 2010, 'New York', 50, '2019-01-23 18:08:36', '2019-01-23 18:08:36', '203.190.11.118'),
(790, 49, 1, NULL, 1, 'Phased Array Antennas', 'phased-array-antennas', '1st ed.', '0-471-22421-9', NULL, 'Phased, Array, Antennas', 'Although array antennas have many decades of history, the last two decades have experienced a maturation, both in the understanding and design of arrays, and in the use of large sophisticated arrays. Radars utilizing electronic scanning arrays are in common use, from airport surveillance to missile detection and tracking; names of U.S. military systems such as Aegis, Patriot, and Pave Paws are well known. This book is a comprehensive treatment of all aspects of phased arrays; much has changed since the only other such work, AJicrowave Scanrtirtg Antennas, appeared in 1966. Most noteworthy has been the parallel development of inexpensive computer power and the theoretical understanding of nearly all aspects of phased array design. Design algorithms suitable for computers are emphasized here, with numerical tips and short algorithms sprinkled throughout the chapters.', NULL, '9834104.JPG', '1912898.pdf', 1, 1998, 'New York', 50, '2019-01-23 18:11:21', '2019-01-23 18:11:21', '203.190.11.116'),
(791, 192, 1, NULL, 1, 'Quantum Mechanics : A Modern Development', 'quantum-mechanics-a-modern-development', NULL, '981-02-4105-4', NULL, 'Quantum , Mechanics', 'A review of probability theory and its relation to the quantum theory.Discussions about state preparation and state determination.The Aharonovâ€“Bohm effect.Some firmly established results in the theory of measurement, which are\r\nuseful in clarifying the interpretation of quantum mechanics.A more complete account of the classical limit.Introduction of rigged Hilbert space as a generalization of the more familiar hilbert space. It allows vectors of infinite norm to be accommodated within the formalism, and eliminates the vagueness that often surrounds the question whether the operators that represent observables possess a complete set of eigenvectors.', NULL, '5109712.JPG', '3558938.pdf', 1, 1998, 'USA', 48, '2019-01-23 19:00:36', '2019-01-23 19:00:36', '203.190.10.204'),
(792, 326, 1, NULL, 1, 'Corporate Fiance', 'corporate-fiance', '6th ed.', '0âˆ’390âˆ’32000âˆ’5', NULL, 'Corporate, Fiance', 'These developments place new burdens on the teaching of corporate finance. On one hand, the changing world of finance makes it more difficult to keep materials up to date. On the other hand, the teacher must distinguish the permanent from the temporary and avoid the temptation to follow fads. Our solution to this problem is to emphasize the modern fundamentals of the theory of finance and make the theory come to life with contemporary examples. Increasingly, many of these examples are outside the United States. All too often, the beginning student views corporate finance as a collection of unrelated topics that are unified largely because they are bound together between the covers of one book. As in the previous editions, our aim is to present corporate finance as the working of a small number of integrated and powerful institutions.', NULL, '5953118.JPG', '4145570.pdf', 1, 2003, 'New York', 50, '2019-01-23 19:06:54', '2019-01-23 19:06:54', '203.190.11.117'),
(793, 294, 1, NULL, 1, 'Corporate Fiance', 'corporate-fiance-23111413', '8th ed.', '978-0-07-310590-1', NULL, 'Corporate, Fiance', 'The teaching and the practice of corporate finance are more challenging and exciting than ever before. The last decade has seen fundamental changes in financial markets and financial instruments. In the early years of the 21st century, we still see announcements in the financial press about such matters as takeovers, junk bonds, financial restructuring, initial public offerings, bankruptcy, and derivatives. In addition, there is the new recognition of â€œrealâ€ options, private equity and venture capital, and the disappearing dividend. The worldâ€™s financial markets are more integrated than ever before. Both the theory and practice of corporate finance have been moving ahead with uncommon speed, and our teaching must keep pace.', NULL, '2059742.JPG', '7745039.pdf', 1, 2008, 'New York', 50, '2019-01-23 19:11:13', '2019-01-23 19:11:13', '203.190.11.118'),
(794, 294, 1, NULL, 1, 'Corporate Fiance', 'corporate-fiance-23161409', '9th ed.', '978-0-07-338233-3', NULL, 'Corporate, Fiance', 'The teaching and the practice of corporate finance are more challenging and exciting than ever before. The last decade has seen fundamental changes in financial markets and financial instruments. In the early years of the 21st century, we still see announcements in the financial press about such matters as takeovers, junk bonds, financial restructuring, initial public offerings, bankruptcy, and derivatives. In addition, there is the new recognition of â€œrealâ€ options, private equity and venture capital, and the disappearing dividend. The worldâ€™s financial markets are more integrated than ever before. Both the theory and practice of corporate finance have been moving ahead with uncommon speed, and our teaching must keep pace.', NULL, '6377962.JPG', '2790241.pdf', 1, 2010, 'New York', 50, '2019-01-23 19:16:09', '2019-01-23 19:16:09', '203.190.11.116'),
(795, 10, 1, NULL, 1, 'Quantum Mechanics : Symmetries', 'quantum-mechanics-symmetries', '2nd', '0-387-58080-8', NULL, 'Mechanics , Quantum', 'Theoretical physics has become a many-faceted science. For the young student it is difficult enough to cope with the overwhelming amount of new scientific material that has to be learned, let alone obtain an overview of the entire field, which ranges from mechanics through electrodynamics, quantum mechanics, field theory, nuclear and heavy-ion science, statistical mechanics, thermos-dynamics, and solid-state theory to elementary-particle physics. And this know-ledge should be acquired in just 8-10 semesters, during which, in addition, a Diploma or Master\'s thesis has to be worked on or examinations prepared for.', NULL, '7769504.JPG', '1389532.pdf', 1, 1994, 'Germany', 48, '2019-01-23 19:17:56', '2019-01-23 19:17:56', '203.190.10.204'),
(796, 327, 1, NULL, 1, 'Quantum Mechanics', 'quantum-mechanics-23261440', '4th', '0 7503 0839 7', NULL, 'Mechanics , Quantum', 'Modern technology means that the publishers are able to support the book at the web site http://bookmarkphysics.iop.org/bookpge.htm/book=1107p. This is where you will find references to the wider literature, colour illustrations, links to other relevant web sites, etc. If any mistakes are identified, corrections will also be listed there. Readers are also invited to contribute suggestions on what would be useful content.', NULL, '9413947.JPG', '2383693.pdf', 1, 2002, 'London', 48, '2019-01-23 19:26:40', '2019-01-23 19:26:40', '203.190.10.204'),
(797, 220, 1, NULL, 1, 'Strategic Management An Integrated Approach', 'strategic-management-an-integrated-approach', '10th Edi.', '978-1-111-82584-3', NULL, 'Strategic, Management, Integrated, Approach', 'In the tenth edition of our book, Strategic Management: An Integrated Approach, we continue with our mission to provide students the most current and up-to-date account of the changes taking place in the world of business strategy and management. The fast-changing domestic and global environment continues to pressure organizations and their managers to find new and improved ways to respond in order to maintain and increase their performance. In revising our book, we continue to strive to make our text relevant and interesting to students. It encourages students to make the effort necessary to assimilate the text material because they find it useful and relevant.', NULL, '6238114.JPG', '5732008.pdf', 1, 2008, 'U.S.A.', 50, '2019-01-23 19:28:49', '2019-01-23 19:28:49', '203.190.11.116'),
(798, 52, 1, NULL, 1, 'Principles of Managerial Finance', 'principles-of-managerial-finance', 'Thirteenth Edition', '978-0-13-611946-3', NULL, 'Principles, Managerial, Finance', 'Users of Principles of Managerial Finance have praised the effectiveness of the\r\nbookâ€™s Teaching and Learning System, which they hail as one of its hallmarks. The system, driven by a set of carefully developed learning goals, has been\r\nretained and polished in this thirteenth edition. The â€œwalkthroughâ€ on the pages\r\nthat follow illustrates and describes the key elements of the Teaching and\r\nLearning System. We encourage both students and instructors to acquaint themselves at the start of the semester with the many useful features the book offers.', NULL, '4574606.JPG', '6799826.pdf', 1, 2012, 'New York', 50, '2019-01-23 19:31:18', '2019-01-23 19:31:18', '203.190.11.116'),
(799, 10, 1, NULL, 1, 'Quantum Physics', 'quantum-physics', NULL, '0-387-95473-2', NULL, 'Quantum , Physics', 'The combination of quantum mechanics and quantum field theory consti-tutes the most revolutionary and influential physical theory of the twentieth century. Its impact is felt not only in almost all other sciences, but the fruits of its application are ubiquitous in everyday life. This textbook is designed to teach graduate students the underlying quantum-physical ideas, their mathematical formulations, and the basic problem-solving techniques of the discipline. It assumes they have taken at least one introductory course in quantum mechanics as undergraduates and are familiar with the history of the subject and the basic experimental evidence that led to its adoption, as well as with many of its fundamental notions.', NULL, '9088277.JPG', '2229511.pdf', 1, 2002, 'New York', 48, '2019-01-23 19:40:11', '2019-01-23 19:40:11', '203.190.10.204'),
(800, 294, 1, NULL, 1, 'Advertising and Promotion An integrated Marketing Communications Perspective', 'advertising-and-promotion-an-integrated-marketing-communications-perspective', '6th ed.', '978-0072536768', NULL, 'Advertising, Promotion', 'Nearly everyone in the modern world is influenced to some degree by advertising and other forms of promotion. Organizations in both the private and public sectors have learned that the ability to communicate effectively\r\nand efficiently with their target audiences is critical to their success. Advertising and other types of promotional messages are used to sell products and services as well as to promote causes, market political candidates, and deal with societal problems such as alcohol and drug abuse. Consumers are finding it increasingly difficult to avoid the efforts of marketers, who are constantly\r\nsearching for new ways to communicate with them.', NULL, '6033780.JPG', '9046523.pdf', 1, 2003, 'New York', 50, '2019-01-23 19:42:01', '2019-01-23 19:42:01', '203.190.11.116'),
(801, 220, 1, NULL, 1, 'Financial and Managerial Accounting', 'financial-and-managerial-accounting', '9th ed.', '978-1-4390-3780-5', NULL, 'Financial, Managerial, Accounting', 'This revision of Financial and Managerial Accounting is based on an understanding of the nature, culture, and motivations of todayâ€™s undergraduate students and on extensive feedback from many instructors who use our book. These substantial changes meet the needs of these students, who not only face a business world increasingly complicated by ethical issues, globalization, and technology but who also have more demands on their time. To assist them to meet these challenges, the authors carefully show them how the effects of business transactions, which are the result of business decisions, are recorded in a way that will be reflected on the financial statements. Instructors will find that building on the textâ€™s historically strong pedagogy, the authors have strengthened transaction analysis and its link to the accounting cycle.', NULL, '6698051.JPG', '4579334.pdf', 1, 2011, 'U.S.A', 50, '2019-01-23 19:46:09', '2019-01-23 19:46:09', '203.190.11.118'),
(802, 103, 1, NULL, 1, 'Quantum Versus Chaos', 'quantum-versus-chaos', NULL, '0-306-47121-3', NULL, 'Quantum , Chaos', 'The range of validity of the present formalism of quantum mechanics will be elucidated by an accumulation of experiments on the mesoscopic or nanoscale cosmos. Owing to recent progress in advanced technology, nanoscale quantum dots such as chaotic stadium and integrable circle billiards have been fabricated at interfaces of semiconductor heterojunctions, and quantum transport in these systems is under active experimental investigation. Anomalous fluctuation properties as well as interesting fine spectral structures that have already been reported are indicating symptoms of chaos.', NULL, '4127157.JPG', '6774410.pdf', 1, 2002, 'New York', 48, '2019-01-23 19:51:45', '2019-01-23 19:51:45', '203.190.10.204'),
(803, 328, 1, NULL, 1, 'The Physics of Quantum Mechanics', 'the-physics-of-quantum-mechanics', NULL, '9780199688579', NULL, 'Quantum Mechanics , Physics', 'It is important to stress the revolutionary aspects of quantum mechanics, it is no less important to understand that classical mechanics is just an approximation to quantum mechanics. Traditional introductions to quantum mechanics tend to neglect this task and leave students with two independent worlds, classical and quantum. At every stage we try to explain how classical physics emerges from quantum results. This exercise helps students to extend to the quantum regime the intuitive understanding they have developed in the classical world.', NULL, '1482018.JPG', '1113756.pdf', 1, 2008, 'USA', 48, '2019-01-23 20:12:59', '2019-01-23 20:12:59', '203.190.10.204'),
(804, 103, 1, NULL, 1, 'Quantum Theory : Concepts and Methods', 'quantum-theory-concepts-and-methods', NULL, '0-306-47120-5', NULL, 'Quantum', 'moment. If the latter is due to some kind of internal rotational motion around a symmetry axis, we have Âµ = gS, where S is the angular momentum around the center of mass of the atom, and g is a constantâ€”the gyromagnetic ratioâ€” which depends on the mass and charge distribution around the rotation axis. The magnetic field B is a function of r, the position of the center of mass of the atom (the variation of B over the size of the atom is completely negligible).\r\nThe classical equations of motion are obtained from the Poisson brackets', NULL, '3517509.JPG', '8592464.pdf', 1, 2002, 'New York', 48, '2019-01-23 20:17:40', '2019-01-23 20:17:40', '203.190.10.204'),
(805, 49, 1, NULL, 1, 'Quantum Physics', 'quantum-physics-23431619', '3rd', '978-0471057000', NULL, 'Quantum , Physics', 'Relativistic kinematics, the equivalence principle, the WKB approximation, a detailed treatment of lifetimes, line widths and scattering resonances, and the Yukawa theory of nuclear forces are discussed. For the same reason, a brief introduction to the Fourier integral, the Dirac delta function, and some formal material dealing wirh operators line been placed in mathematical appendices at the end of the book.', NULL, '7831651.JPG', '1864296.pdf', 1, 2003, 'New York', 48, '2019-01-23 21:43:19', '2019-01-23 21:43:19', '203.190.10.204'),
