(807, 329, 1, NULL, 1, 'Quantum Mechanics Concepts and Applications', 'quantum-mechanics-concepts-and-applications', '2nd', '978-0-470-02679-3', NULL, 'Quantum , Mechanics', 'The book has now a collection of almost six hundred examples, problems, and exercises. Every chapter contains: (a) a number of solved examples each of which is designed to illustrate a specific concept pertaining to a particular section within the chapter, (b) plenty of fully solved problems (which come at the end of every chapter) that are generally comprehensive and, hence, cover several concepts at once, and (c) an abundance of unsolved exercises intended for homework assignments. Through this rich collection of examples, problems, and exercises, I want to empower the student to become an independent learner and an adept practitioner of quantum mechanics. Being able to solve problems is an unfailing evidence of a real understanding of the subject.', NULL, '4599654.JPG', '6171487.pdf', 1, 2009, 'USA', 48, '2019-01-23 22:14:21', '2019-01-23 22:14:21', '203.190.10.204'),
(808, 330, 1, NULL, 1, 'Standard Handbook of Electronic Engineering', 'standard-handbook-of-electronic-engineering', '15th ed.', '978-0071384216', NULL, 'Electronic Engineering', 'The Standard Handbook of Electronics Engineering has defined its field for over thirty years. Spun off in the 1960â€™s from Finkâ€™s Standard Handbook of Electrical Engineering, the Christiansen book has seen its markets grow rapidly, as electronic engineering and microelectronics became the growth engine of digital computing. The EE market has now undergone another seismic shiftâ€”away from computing and into communications and media. The Handbook will retain much of its evergreen basic material, but the key applications sections will now focus upon communications, networked media, and medicineâ€”the eventual destination of the majority of graduating EEs these days.', NULL, '4614378.JPG', '4208770.pdf', 1, 2006, NULL, 51, '2019-01-23 23:41:49', '2019-01-23 23:41:49', '203.190.11.115'),
(809, 184, 1, NULL, 1, 'Chemical and Metallurgical Thermodynamics', 'chemical-and-metallurgical-thermodynamics', NULL, '978-81-224-2293-1', NULL, 'Chemical, Metallurgical, Thermodynamics.', 'My first interaction with the science of thermodynamics was not a pleasant one. And I have\r\nreasons to presume that for most science students the experience is similar. Soon after, I started patting myself on my back since I felt that I could understand the subject better than my classmates, and with a little help from my teachers I should be able to master the subject. But I found my teachers also woefully lacking in clarity of concepts. Thereafter, my enthusiasm for Physical Chemistry and Thermodynamics remained subsided until I became a student of metallurgy', NULL, '7026517.JPG', '2062787.pdf', 1, 2007, 'New Delhi', 47, '2019-01-23 23:45:13', '2019-01-23 23:45:13', '203.190.11.115'),
(810, 72, 1, NULL, 1, 'Newnes Electrical Engineerâ€™s Handbook', 'newnes-electrical-engineers-handbook', NULL, '0 7506 4879 1', NULL, 'Electrical Engineerâ€™s', 'Preparation of this book seemed at the outset to be a fairly straightforward task. It has, however, proved to be quite different. A structural change from the content of the preceding Newnes Electrical Pocket Book was necessary because much of the content and scope of this has been taken to other books in the new series such as the Newnes Building Services Pocket Book and the Newnes Electronics Engineerâ€™s Pocket Book. At the same time, much of what is often regarded as â€˜mature technologyâ€™ is changing surprisingly rapidly, and much of the remaining material needed a complete overhaul with some new areas introduced.', NULL, '5564850.JPG', '9752712.pdf', 1, 2000, 'Boston', 51, '2019-01-23 23:47:38', '2019-01-23 23:47:38', '203.190.11.115'),
(811, 331, 1, NULL, 1, 'Clean Electricity from Photovoltaics', 'clean-electricity-from-photovoltaics', NULL, '1-86094-161-3', NULL, 'Electricity, fPhotovoltaics, Photo.', 'This book is the first in a series of four multi-authorial works on the photo conversion of solar energy. It was created from my long-held conviction that, despite slow starts and setbacks, solar energyâ€”broadly defined to encompass other renewable energy forms that derive from solarâ€”will become the Earth\'s major energy source within this century. The Sun is a source of both radiant heat and light, and techniques for using solar energy correspondingly divide into thermal methods (solar power towers, water heaters and so on) and photo conversion (sometimes called direct) methods. Photo conversion is the subject of this book series.', NULL, '6466749.JPG', '4751529.pdf', 1, 2001, 'U.S.A.', 47, '2019-01-23 23:59:51', '2019-01-23 23:59:51', '203.190.11.115'),
(812, 74, 1, NULL, 1, 'Electrical Engineers Portable Handbook', 'electrical-engineers-portable-handbook-23071918', '2nd ed.', '978-0071418201', NULL, 'Electrical Engineers', 'Many thanks to Mark W. Felgate, P.E.; Edward M. Grafe; and the entire\r\nelectrical staff at van Zelm Heywood & Shadford, Inc. for their valuable\r\ninput; and to Kristine M. Buccino for her assistance in getting permission to reprint copyrighted material.', NULL, '4199059.jpg', '5019040.pdf', 1, 2004, 'U.S.A', 51, '2019-01-24 00:07:18', '2019-01-24 00:07:18', '203.190.11.115'),
(813, 332, 1, NULL, 1, 'Chemical and Metallurgical Thermodynamics', 'chemical-and-metallurgical-thermodynamics-23111939', NULL, '978-81-224-2293-1', NULL, 'Chemical, Metallurgical, Thermodynamics.', 'My first interaction with the science of thermodynamics was not a pleasant one. And I have\r\nreasons to presume that for most science students the experience is similar. Soon after, I started patting myself on my back since I felt that I could understand the subject better than my classmates, and with a little help from my teachers I should be able to master the subject. But I found my teachers also woefully lacking in clarity of concepts. Thereafter, my enthusiasm for Physical Chemistry and Thermodynamics remained subsided until I became a student of metallurgy', NULL, '2406067.JPG', '3532683.pdf', 1, 2007, 'New Delhi', 47, '2019-01-24 00:11:39', '2019-01-24 00:11:39', '203.190.11.115'),
(814, 333, 1, NULL, 1, 'DOE Handbook of Electrical Safety', 'doe-handbook-of-electrical-safety', NULL, NULL, NULL, 'Electrical Safety', 'Electrical Safety Handbook presents the Department of Energy (DOE) safety standards for DOE field offices or facilities involved in the use of electrical energy. It has been prepared to provide a uniform set of electrical safety guidance and information for DOE installations to effect a reduction\r\nor elimination of risks associated with the use of electrical energy. The objectives of this handbook are to enhance electrical safety awareness and mitigate electrical hazards to employees, the public, and the environment.', NULL, '9409106.jpg', '9617867.pdf', 1, 1998, NULL, 51, '2019-01-24 01:28:54', '2019-01-24 01:28:54', '203.190.11.117'),
(815, 49, 1, NULL, 1, 'Esd in Silicon Integrated Circuits', 'esd-in-silicon-integrated-circuits', '2nd ed.', '0 470 49871 8', NULL, 'Esd in Silicon', 'In the seven years since the first edition of this book was completed, Electrostatic\r\nDischarge (ESD) phenomena in integrated circuits (IC) continues to be important\r\nas technologies shrink and the speed and size of the chips increases. The phenomena related to ESD events in semiconductor devices take place outside the realm of\r\nnormal device operation. Hence, the physics governing this behavior are not typically found in general textbooks on semiconductors. Similarly the circuit design\r\nissues involve nonstandard approaches that are not covered in general books on\r\nelectronic design. There has been a large amount of work done in the areas of\r\nESD circuit design and the physics involved, most of which has been published\r\nin a number of papers and conference proceedings. This book covers the stateof-the-art in circuit design for ESD prevention as well as the device physics, test\r\nmethods, and characterization.', NULL, NULL, '2186204.pdf', 1, 2002, 'New York', 52, '2019-01-24 15:14:24', '2019-01-24 15:14:24', '203.190.11.115'),
(816, 130, 1, NULL, 1, 'Environmental Engineering', 'environmental-engineering', '4th ed.', '0750672943', NULL, 'Environmental Engineering', 'Everything seems to matter in environmental engineering. The social sciences and\r\nhumanities, as well as the natural sciences, can be as important to the practice of environmental engineering as classical engineering skills. Many environmental engineers\r\nfind this combination of skills and disciplines, with its inherent breadth, both challenging and rewarding. In universities, however, inclusion of these disciplines often\r\nrequires the environmental engineering student to cross discipline and department\r\nboundaries. Deciding what to include in an introductory environmental engineering\r\nbook is critical but difficult, and this difficulty has been enhanced by the growth of\r\nenvironmental engineering since the first edition of this book.', NULL, NULL, '7033623.pdf', 1, 2003, 'New York', 52, '2019-01-24 15:50:54', '2019-01-24 15:50:54', '203.190.11.117'),
(817, 220, 1, NULL, 1, 'Principles of Accounting', 'principles-of-accounting', '11th Edi.', '978-1-4390-3774-4', NULL, 'Principles, Accounting', 'This revision of Principles of Accounting is based on an understanding of the\r\nnature, culture, and motivations of todayâ€™s undergraduate students and on extensive feedback from many instructors who use our book. These substantial changes meet the needs of these students, who not only face a business world increasingly complicated by ethical issues, globalization, and technology but who also have more demands on their time. To assist them to meet these challenges, the authors carefully show them how the effects of business transactions, which are the result of business decisions, are recorded in a way that will be reflected on the financial statements. Instructors will find that building on the textâ€™s historically strong pedagogy, the authors have strengthened transaction analysis and its link to the accounting cycle.', NULL, '2184603.JPG', '1795541.pdf', 1, 2011, 'U.S.A', 50, '2019-01-24 16:09:11', '2019-01-24 16:09:11', '203.190.11.117'),
(818, 294, 1, NULL, 1, 'Building Financial Models A Guide of Creating and Interpreting Financial Statements', 'building-financial-models-a-guide-of-creating-and-interpreting-financial-statements', '1st ed.', '978-0071402101', NULL, 'Building, Financial, Model', 'Financial modeling is essential for determining a company\'s current value and projecting its future performance, yet few books explain how to build models for accurately interpreting financial statements. Building Financial Models is the first book to correct this oversight, unveiling a step-by-step process for creating a core model and then customizing it for companies in virtually any industry. Covering every aspect of building a financial model, it provides a broad understanding of the actual mechanics of models, as well as their foundational accounting and finance concepts.', NULL, '2671517.JPG', '9965837.pdf', 1, 2004, 'New York', 50, '2019-01-24 16:17:33', '2019-01-24 16:17:33', '203.190.11.116'),
(819, 334, 1, NULL, 1, 'Business Ethics A MANUAL FOR MANAGING A RESPONSIBLE BUSINESS ENTERPRISE IN EMERGING MARKET ECONOMIES', 'business-ethics-a-manual-for-managing-a-responsible-business-enterprise-in-emerging-market-economies', '1st ed.', '0-16-051477-0', NULL, 'Business, Ethics', 'Business Ethics: A Manual for Managing a Responsible Business Enterprise in Emerging Market Economies grew out of collaboration between the U.S. Department of Commerce and many dedicated people and organizations. It is intended to provide a practical guide to assist owners and managers in meeting emerging global standards and expectations for an effective business ethics program.', NULL, '4437525.JPG', '3914703.pdf', 1, 2004, 'U.S.A', 50, '2019-01-24 16:21:49', '2019-01-24 16:21:49', '203.190.11.116'),
(820, 294, 1, NULL, 1, 'BUSINESS WRITING AND COMMUNICATION', 'business-writing-and-communication', '2nd ed.', '978-0-07-174394-5', NULL, 'BUSINESS, WRITING, COMMUNICATION', 'In this knowledge economy, writing is the chief value-producing activity. But you may not be writing as well as you could. That may be because you think writing requires a special talent that some people have and some people donâ€™t. In fact, writing is a process that can be managed like any other business process. If you can manage people, money, or time, then you can manage your writing. And you can profit from the results.', NULL, '9757140.JPG', '9038232.pdf', 1, 2010, 'New York', 50, '2019-01-24 16:25:00', '2019-01-24 16:25:00', '203.190.11.116'),
(821, 167, 1, NULL, 1, 'Business Ethics', 'business-ethics', '1st ed.', '978-1616100162', NULL, 'Business, Ethics', 'This interdisciplinary and practical text is designed to support a course in business ethics or corporate governance which is primarily a laboratory or skills-based course, where students develop, practice, and refine decision making and problem solving strategies that they will carry with them into the world of business practice.', NULL, '7326072.jpg', '5739082.pdf', 1, 2009, 'Taxes', 50, '2019-01-24 16:29:07', '2019-01-24 16:29:07', '203.190.11.116'),
(822, 335, 1, NULL, 1, 'Notes on Business Ethics', 'notes-on-business-ethics', '1st ed.', NULL, NULL, 'Notes, Business, Ethics', 'This book mainly concentrates on moral reasoning and knowledge, but even when we know right from wrong we still might decide to do wrong. Becoming moral is a challenging task and requires us to find motivation to be moral.', NULL, '3772544.JPG', '8771908.pdf', 1, 2011, 'New York', 50, '2019-01-24 16:33:38', '2019-01-24 16:33:38', '203.190.11.116'),
(823, 336, 1, NULL, 1, 'Research Methodology: Methods and Techniques', 'research-methodology-methods-and-techniques', '2nd ed.', '978-81-224-2488-1', NULL, 'Research, Methodology', 'In this edition a new chapter on â€œThe Computer: Its role in Researchâ€ have been added in view of the fact that electronic computers by now, for students of economics, management and other social sciences, constitute an indispensable part of research equipment. The other highlights of this revised edition are (i) the subject contents has been developed, refined and restructured at several points, (ii) several new problems have also been added at the end of various chapters for the benefit of students, and (iii) every page of the book has been read very carefully so as to improve its quality.', NULL, '2076571.JPG', '1115882.pdf', 1, 2004, 'New Delhi', 50, '2019-01-24 16:39:38', '2019-01-24 16:39:38', '203.190.11.116'),
(824, 52, 1, NULL, 1, 'Accounting', 'accounting', '9th edi.', '978-0-13-256905-7', NULL, 'Accounting', 'All of the chapter openers have been redesigned and rewritten. The financial chapter openers include a visual of a balance sheet, highlighting the specific section of the balance sheet that will be covered within the chapter. The managerial chapter openers include a visual of a smartphone device, complete with decision-making tools as apps. As students progress through these chapters, the decision being discussed is highlighted on the first page of the\r\nchapter. These visuals help set the stage while providing students with direction as they navigate through the material.', NULL, '8665679.JPG', '6553054.pdf', 1, 2012, 'London', 50, '2019-01-24 16:46:58', '2019-01-24 16:46:58', '203.190.11.116'),
(825, 294, 1, NULL, 1, 'International Business COMPETING IN THE GLOBAL MARKETPLACE', 'international-business-competing-in-the-global-marketplace', '7th Edi.', '978-0-07-338134-3', NULL, 'International, Business, COMPETING, GLOBAL, MARKETPLACE', 'Over the years, and through seven editions, I have worked hard to adhere to these goals. It has not always been easy.An enormous amount has happened over the last 17 years, both in the real world of economics, politics, and business and in the academic world of theory and empirical research. Often I have had to significantly rewrite chapters, scrap old examples, bring in new ones, incorporate new theory and evidence into the book, and phase out older theories that are increasingly less relevant to the modern and dynamic world of international business. That process continues in the current edition.As noted below, I have made significant changes in this edition, and that will no doubt continue to be the case in the future.', NULL, '7917474.jpg', '1193762.pdf', 1, 2009, 'London', 50, '2019-01-24 16:51:23', '2019-01-24 16:51:23', '203.190.11.117'),
(826, 220, 1, NULL, 1, 'Strategic Management Theory AN INTEGRATED APPROACH', 'strategic-management-theory-an-integrated-approach', '9th edi.', '978-0-538-75107-0', NULL, 'Strategic, Management, Theory', 'Since the eighth edition was published, this book has strengthened its position as a market leader in the Strategic Management market. This tells us that we continue to meet the expectations of existing users and attract many new users to our book. It is clear that most strategy instructors share with us a concern for our currency in the text and its examples to ensure that cutting-edge issues and new developments in strategic management are continually addressed.', NULL, '2361073.JPG', '7880107.pdf', 1, 2010, 'U.K.', 50, '2019-01-24 16:54:16', '2019-01-24 16:54:16', '203.190.11.117'),
(827, 52, 1, NULL, 1, 'Cost Accounting A Managerial Emphasis', 'cost-accounting-a-managerial-emphasis', '14th Edi.', '978-0-13-210917-8', NULL, 'Cost, Accounting, Managerial, Emphasis', 'Studying Cost Accounting is one of the best business investments a student can make. Why? Because success in any organizationâ€”from the smallest corner store to the largest multinational corporationâ€”requires the use of cost accounting concepts and practices. Cost accounting provides key data to managers for planning and controlling, as well as costing products, services, even customers.We also prepare students for the rewards and challenges they face in the professional cost accounting world of today and tomorrow.', NULL, '6166072.JPG', '2574341.pdf', 1, 2012, 'New York', 50, '2019-01-24 16:59:00', '2019-01-24 16:59:00', '203.190.11.117');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(828, 49, 1, NULL, 1, 'Quarks And Leptons : An Introductory Course in Modern Particle Physics', 'quarks-and-leptons-an-introductory-course-in-modern-particle-physics', NULL, '0-471-88741-2', NULL, 'Physics , Modern Particle', 'Dramatic progress has been made in particle physics during the past two decades. A series of important experimental discoveries has firmly established the existence of a subnuclear world of quarks and leptons. The protons and neutrons (\"nucleons\"), which form nuclei, are no longer regarded as elementary particles but are found to be made of quarks. That is, in the sequence molecules â€”\' atoms nuclei nucleons, there is now known to be another \"layer in the structure of matter.\" However, the present euphoria in particle physics transcends this re-markable discovery.', NULL, '2820768.JPG', '1650268.pdf', 1, 1984, 'New York', 48, '2019-01-24 17:02:00', '2019-01-24 17:02:00', '203.190.10.204'),
(829, 294, 1, NULL, 1, 'Global Business Today', 'global-business-today', '5th Edition', '978-0-07-321054-4', NULL, 'Global, Business, Today', 'Global Business Today is intended for the first international business course at either the undergraduate or MBA level. My goal in writing this book has been to set a new standard for international business textbooks. I have attempted to write a book that:\r\n1. Is comprehensive and up-to-date.\r\n2. Goes beyond an uncritical presentation and shallow explanation of the body of knowledge.\r\n3. Maintains a tight, integrated flow between chapters.\r\n4. Focuses on managerial implications.', NULL, '5486271.JPG', '9037848.pdf', 1, 2008, 'New York', 50, '2019-01-24 17:03:56', '2019-01-24 17:03:56', '203.190.11.117'),
(830, 294, 1, NULL, 1, 'International Business COMPETING IN THE GLOBAL MARKETPLACE', 'international-business-competing-in-the-global-marketplace-24091201', '8th Edi', '978-0-07-813719-8', NULL, 'International, Business, GLOBAL, MARKETPLACE', 'It is now two decades since I began work on the first edition of International Business: Competing in the Global Marketplace. By the third edition the book was the most widely used international business text in the world. Since then its market share has only increased. I attribute the success of the book to a number of goals I set out for myself when I embarked on the first edition of the book. Specifically, I wanted to write a book that (1) was comprehensive and up-to-date, (2) went beyond an uncritical presentation and shallow explanation of the body of knowledge, (3) maintained a tight, integrated flow between chapters, (4) focused on managerial implications, and (5) made important theories accessible and interesting to students.', NULL, '9743178.jpg', '7000545.pdf', 1, 2011, 'New York', 50, '2019-01-24 17:09:01', '2019-01-24 17:09:01', '203.190.11.117'),
(831, 220, 1, NULL, 1, 'Concepts Strategic Management Competitiveness & Globalization', 'concepts-strategic-management-competitiveness-globalization', '9th edi.', '978-0-538-75309-8', NULL, 'Strategic, Management, Competitiveness, Globalization', 'This book presents you with the most comprehensive and thorough coverage of strategic management that is available in the market. The research used in this book is drawn from the â€œclassicsâ€ as well as the most recent contributions to the strategic management literature. The historically significant â€œclassicâ€ research provides the foundation for much of what is known about strategic management; the most recent contributions reveal insights about how to effectively use strategic management in the complex, global business environment in which most firms operate while trying to outperform their competitors.', NULL, '6664363.JPG', '9380668.pdf', 1, 2011, 'U.K.', 50, '2019-01-24 17:12:41', '2019-01-24 17:12:41', '203.190.11.115'),
(832, 316, 1, NULL, 1, 'Quarks, Leptons and the Big Bang', 'quarks-leptons-and-the-big-bang', '2nd', '0-7503-0806-0', NULL, 'Big Bang , Leptons', 'Some people argue that particle physics is fundamental to all the sciences as it strips away the layers of structure that we see in the world and plunges down to the smallest components of matter. This study applies equally to the matter that we see on the earth and that which is in the stars and galaxies that fill the whole universe. The particle physicist assumes that all matter in the universe is fundamentally the same and that it all had a common origin in the big bang that created our universe. (This is a reasonable assumption as we have no evidence to suggest that any region of the universe is made of a different form of matter.', NULL, '1115158.JPG', '7647202.pdf', 1, 2002, 'London', 48, '2019-01-24 17:13:23', '2019-01-24 17:13:23', '203.190.10.204'),
(833, 337, 1, NULL, 1, 'Queueing Theory', 'queueing-theory', '2nd', '0-444-00379-7', NULL, 'Queueing', 'Solutions to the exercises have been written from the point of view that to be of maximal usefulness to the teacher they should contain a detailed and orderly exposition of steps in the solution. The given solutions are based almost exclusively on information in the book, and such knowledge of mathematics that may reasonably be assumed on the part of the student. On some of the exercises I have profited from discussions with the author. However, any errors or inaccuracies that may exist are solely my responsibility.', NULL, '9672667.JPG', '3762432.pdf', 1, 1981, 'New York', 48, '2019-01-24 17:23:39', '2019-01-24 17:23:39', '203.190.10.204'),
(834, 338, 1, NULL, 1, 'Corporate Social Responsibility', 'corporate-social-responsibility', '1st ed.', '978-87-7681-415-1', NULL, 'Corporate, Social, Responsibility', 'Corporate Social Responsibility (CSR) has been in existence for a while but recently it has become central to the strategic decision making of every organisation. So every organisation has a CSR policy and produces a report of its activities. It has become central to the strategic management of every organisation. It is a complex subject and there are a number of complex issues involved in developing CSR strategies and policies. This book introduces the reader to the issues involved and their application in strategic decision making.', NULL, '9518010.JPG', '5306785.pdf', 1, 2008, 'New York', 50, '2019-01-24 17:25:23', '2019-01-24 17:25:23', '203.190.11.115'),
(835, 239, 1, NULL, 1, 'Queueing Theory with Applications to Packet Telecommunication', 'queueing-theory-with-applications-to-packet-telecommunication', NULL, '0-387-22859-4', NULL, 'Queueing Theory , Packet Telecommunication', 'The instructor can easily vary the pace of the course according to the characteristics of individual classes. For example, the instructor can increase the pace by assigning virtually every exercise as homework, testing often, and covering topics from the literature in detail. The pace can be decreased to virtually any desired level by discussing the solutions to the exercises during the lecture periods. I have worked mostly with graduate students and have found that we achieve more in a course when the students work exercises on the blackboard during the lecture period. This tends to generate discussions that draw the students in and bring the material to life.', NULL, '6972112.JPG', '7157157.pdf', 1, 2005, 'Boston', 48, '2019-01-24 17:33:00', '2019-01-24 17:33:00', '203.190.10.204'),
(836, 10, 1, NULL, 1, 'Numerical Mathematics', 'numerical-mathematics', NULL, '0-387-98959-5', NULL, 'Numerical , Mathematics', 'Numerical mathematics is the branch of mathematics that proposes, develops, analyzes and applies methods from scientific computing to several fields including analysis, linear algebra, geometry, approximation theory, functional equations, optimization and differential equations. Other disciplines such as physics, the natural and biological sciences, engineering, and economics and the financial sciences frequently give rise to problems that need scientific computing for their solutions.', NULL, '1719792.JPG', '6356174.pdf', 1, 2000, 'New York', 48, '2019-01-24 17:39:55', '2019-01-24 17:39:55', '203.190.10.204'),
(837, 52, 1, NULL, 1, 'Business Communication Essentials', 'business-communication-essentials', 'FIFTH EDITION', '978-0-13-253971-5', NULL, 'Business, Communication, Essentials', 'This edition includes up-to-date coverage of the social communication model that is redefining business communication and reshaping the relationships between companies and their stakeholders. Social media concepts and techniques are integrated throughout the book, from career planning to presentations.', NULL, '5698361.JPG', '4523812.pdf', 1, 2012, 'New York', 50, '2019-01-24 17:45:39', '2019-01-24 17:45:39', '203.190.11.118'),
(838, 49, 1, NULL, 1, 'Fundamentals of Human Resource Management', 'fundamentals-of-human-resource-management', '10th ed.', '978-0470-16968-1', NULL, 'Fundamentals, Human, Resource, Management', 'The sailing crew on the cover faces many of the same goals and challenges as any organization in our unpredictable business environment. Success and possibly survival depend on a well designed boat with a carefully selected and thoroughly trained crew that understands the strategy of the race. They must be able to quickly adjust the sails, rigging, and rudder to keep moving forward and somehow gain a competitive advantage. Some external factors such as the competition may be visible and predictable, but invisible factors such as the wind and waves may be unpredictable and require minor adjustments or a major change in strategy.', NULL, '3773227.JPG', '4317867.pdf', 1, 2010, 'U.S.A', 50, '2019-01-24 17:48:48', '2019-01-24 17:48:48', '203.190.11.115'),
(839, 91, 1, NULL, 1, 'Real Analog Solutions for Digital Designers', 'real-analog-solutions-for-digital-designers', NULL, '0-7506-7819-4', NULL, 'Analog Solutions , Digital Designers', 'Digital circuitry and software is encroaching into the analog hardware domain. Analog will never disappear at the sensor conditioning circuit, power supply, or layout strategies. I know the digital engineer will continue to be challenged by analog issues, even if they deny that they exist.', NULL, '2534656.JPG', '6072330.pdf', 1, 2005, 'USA', 48, '2019-01-24 17:53:22', '2019-01-24 17:53:22', '203.190.10.204'),
(840, 74, 1, NULL, 1, 'Statistical Techniques in Business & Economics', 'statistical-techniques-in-business-economics', '11th Edi.', '978-0071285759', NULL, 'Statistical, Techniques, Business, Economics', 'Will be shipped from US. Used books may not include companion materials, may have some shelf wear, may contain highlighting/notes, may not include CDs or access codes. 100% money back guarantee.', NULL, '1370462.JPG', '1551497.pdf', 1, 2002, 'U.S.A', 50, '2019-01-24 17:54:21', '2019-01-24 17:54:21', '203.190.11.115'),
(841, 220, 1, NULL, 1, 'FUNDAMENTALS OF FINANCIAL MANAGEMENT', 'fundamentals-of-financial-management', 'Twelfth Edition', '978-0-324-59771-4', NULL, 'FUNDAMENTALS, FINANCIAL, MANAGEMENT', 'When the first edition of Fundamentals was published 31 years ago, we wanted to provide an introductory text that students would find interesting and easy to\r\nunderstand. Fundamentals immediately became the leading undergraduate finance text, and it has maintained that position ever since. Our goal with this edition was to produce a book and ancillary package that would maintain its lead and set a new standard for finance textbooks.', NULL, '5231845.JPG', '5493854.pdf', 1, 2007, 'U.K.', 50, '2019-01-24 17:57:06', '2019-01-24 17:57:06', '203.190.11.117'),
(842, 49, 1, NULL, 1, 'The Fast Forward MBA in Finance', 'the-fast-forward-mba-in-finance', '2nd ed.', '0-471-20285-1', NULL, 'Fast, Forward, MBA, Finance', 'This book is for business managers, as well as for bankers, consultants, lawyers, and other professionals who need a solid and practical understanding of how business makes profit, cash flow from profit, the assets and capital needed to support profit-making operations, and the cost of capital.\r\nBusiness managers and professionals donâ€™t have time to wade through a 600-page tome; they need a practical guide that gets to the point directly with clear and convincing examples.', NULL, '1668677.JPG', '7630422.pdf', 1, 2002, 'New York', 50, '2019-01-24 18:04:27', '2019-01-24 18:04:27', '203.190.11.117'),
(843, 74, 1, NULL, 1, 'Finance for Non-Financial Managers', 'finance-for-non-financial-managers', '1st ed.', '0-07-142564-0', NULL, NULL, 'There are certainly others to choose from, each with a viewpoint that reflects the authorâ€™s background and opinions. Why this one? Why this particular authorâ€™s background and opinions? The answer is communication: this book is in a sense a communication manual for non-financial managers.', NULL, '6967950.JPG', '3940805.pdf', 1, 2003, 'New York', 50, '2019-01-24 18:11:17', '2019-01-24 18:11:17', '203.190.11.115'),
(844, 72, 1, NULL, 1, 'Reference Data for Engineers', 'reference-data-for-engineers', '9th', '0-7506-7291-9', NULL, 'Data , Reference', 'ITU information is available on the web for download. While the Omnibus Budget Reconciliation Act did open the door for auctions, it only authorized them for a short time. A better reference is: Radio frequency Spectrum Management: Background, Status, and Current Issues, January 30,2001, Richard M. Nunno, Congressional Research Service, Washington, DC Order Code IU30829. The GPS Time Scale began on January 6, 1980 and is not adjusted for leap seconds. Therefore, it differs from UTC by the number of leap seconds that have occurred January 6, 1980. As of June 2001, GPS Time is 13 seconds ahead of UTC. Much of the data in this chapter cross-references with Chapter 37 on GPS. The updates on GPS before and after S/A was turned off are quite good, as is the discussion of the merits of different types of atomic clocks.', NULL, '8280606.JPG', '3187831.pdf', 1, 1998, 'Boston', 48, '2019-01-24 18:22:48', '2019-01-24 18:22:48', '203.190.10.204'),
(845, 49, 1, NULL, 1, 'Financial Risk Manager Handbook', 'financial-risk-manager-handbook', 'Second Edition', '0-471-43003-X', NULL, 'Financial, Risk, Manager, Handbook', 'This Handbook was originally written to provide support for candidates taking the\r\nFRM examination administered by GARP. As such, it reviews a wide variety of practical topics in a consistent and systematic fashion. It covers quantitative methods,\r\ncapital markets, as well as market, credit, operational, and integrated risk management. It also discusses the latest regulatory, legal, and accounting issues essential to\r\nrisk professionals.', NULL, '3874980.JPG', '6288928.pdf', 1, 2003, 'New Jersey', 50, '2019-01-24 18:31:41', '2019-01-24 18:31:41', '203.190.10.206'),
(846, 49, 1, NULL, 1, 'Financial Engineering Principles : A Unified Theory of Financial Products Analysis and Valuation', 'financial-engineering-principles-a-unified-theory-of-financial-products-analysis-and-valuation-24411304', '1st', '0-471-46358-2', NULL, 'Financial, Engineering, Principles', 'The reality is that most investors think in terms of single asset classes, and allocate money to them accordingly. The unique contribution of First Principles: An Investor\'s Guide to Building Bridges Across Financial Products is that, for the first time, a single unified valuation approach is available to use for all financial products. This book shows you how to focus on the dynamics of processes and interrelationships of different investment choices, providing the reader with a financial toolbox to equips any investor with the knowledge to de-construct and value any financial product, making it a must if you?re a portfolio manager or an individual investors interested in building the optimal portfolio.', NULL, '6249458.JPG', '7996969.pdf', 1, 2004, 'New Jersey', 50, '2019-01-24 18:41:04', '2019-01-24 18:41:04', '203.190.10.206'),
(847, 220, 1, NULL, 1, 'Financial Management: Theory and Practice', 'financial-management-theory-and-practice', 'THIRTEENTH EDITION', '978-1-4390-7810-5', NULL, 'Financial, Management, Theory, Practice', 'When we wrote the first edition of Financial Management: Theory and Practice, we had\r\nfour goals: (1) to create a text that would help students make better financial decisions;\r\n(2) to provide a book that could be used in the introductory MBA course, but one that\r\nwas complete enough for use as a reference text in follow-on case courses and after\r\ngraduation; (3) to motivate students by demonstrating that finance is both interesting\r\nand relevant; and (4) to make the book clear enough so that students could go through\r\nthe material without wasting either their time or their professorâ€™s time trying to figure\r\nout what we were saying.', NULL, '2924992.JPG', '2826132.pdf', 1, 2011, 'UK', 50, '2019-01-24 18:56:29', '2019-01-24 18:56:29', '203.190.10.206'),
(848, 294, 1, NULL, 1, 'Organizational Behavior An Evidence-Based Approach', 'organizational-behavior-an-evidence-based-approach', 'Twelfth Edition', '978-0-07-353035-2', NULL, 'Organizational, Behavior, Evidence, Approach', 'As is now emphasized in the introductory chapter, the time has come to help narrow\r\nthe theory/researchâ€”effective application/practice gap. This has been my mission from\r\nthe beginning of this text and my now over 20-year editorship of the journal\r\nOrganizational Dynamics. As â€œhard evidenceâ€ for this theory/research base for this text,\r\nI can say unequivocally that no other organizational behavior text has close to the number of footnote references. For example, whereas a few texts may have up to 40 or even\r\n50 references for some chapters, the chapters of this text average more than twice that\r\namount. This latest edition continues the tradition by incorporating recent breakthrough\r\nresearch to provide and add to the evidence on the theories and techniques presented\r\nthroughout.', NULL, '9082174.JPG', '2391937.pdf', 1, 2011, 'New York', 50, '2019-01-24 18:58:56', '2019-01-24 18:58:56', '203.190.10.206'),
(849, 294, 1, NULL, 1, 'Fundamentals of Corporate Finance', 'fundamentals-of-corporate-finance', '3rd.', '0-07-553109-7', NULL, 'Fundamentals, Corporate, Finance', 'This material is an introduction to corporate finance. We will discuss the\r\nvarious responsibilities of the corporationâ€™s financial managers and\r\nshow you how to tackle many of the problems that these managers are\r\nexpected to solve. We begin with a discussion of the corporation, the financial decisions it needs to make, and why they are important.', NULL, '9153071.JPG', '9579875.pdf', 1, 2001, 'London', 50, '2019-01-24 19:01:53', '2019-01-24 19:01:53', '203.190.10.206'),
(850, 91, 1, NULL, 1, 'Nuclear Energy : An Introduction to the Concepts Systems, And Applications of Nuclear Processes', 'nuclear-energy-an-introduction-to-the-concepts-systems-and-applications-of-nuclear-processes', '6th', '978-0-12-370547-1', NULL, 'Concepts Systems , Nuclear Processes', 'The prospects for continued and new nuclear power plants in the United States have improved greatly since the fifth edition was written. In what is called a nuclear renaissance, many utilities have made application to the Nuclear Regulatory Commission for license extension and approval for new reactor construction. Nuclear reactors are planned that combat global warming, conserve nuclear fuel, support desalination, and produce hydrogen for transportation.', NULL, '1466595.JPG', '2962468.pdf', 1, 2009, 'USA', 48, '2019-01-24 19:31:39', '2019-01-24 19:31:39', '203.190.10.204'),
(851, 339, 1, NULL, 1, 'Pride and Prejudice', 'pride-and-prejudice', NULL, NULL, NULL, NULL, 'Jane Austen (December 16, 1775 - July\r\n28, 1817) is a prominent British novelist,\r\nwhose work is considered part of the Western\r\ncanon. She stands as a model of the\r\nwriter whose apparently sheltered life did\r\nnothing to reduce the stature and drama of\r\nher fiction.', NULL, '2021177.jpg', '3255619.pdf', 1, 2004, 'New York', 40, '2019-01-24 19:33:21', '2019-01-24 19:33:21', '203.190.11.117'),
(852, 340, 1, NULL, 1, 'Rare Earth Magnetism : Structures and Excitations', 'rare-earth-magnetism-structures-and-excitations', NULL, '978-0198520276', NULL, 'Structures , Excitations', 'The neutron is a uniquely useful tool for studying the microscopic magnetic behavior of materials, and neutron scattering has played the leading role in the progressive elucidation of the magnetic structures and excitation\'s in the rare earths, and hence in understanding the magnetic interactions and their consequences.', NULL, '3495778.JPG', '3900278.pdf', 1, 1991, 'British', 48, '2019-01-24 19:45:53', '2019-01-24 19:45:53', '203.190.10.204'),
(853, 341, 1, NULL, 1, 'Fundamentals of Financial Management', 'fundamentals-of-financial-management-24531459', '11th ed.', '0-324-31981-9', NULL, 'Fundamentals, Financial, Management', 'Important changes in the financial environment have occurred since the last\r\nedition. New technology and increased globalization continue to transform practices and markets. Continued improvements in communications and transportation have made it easier for businesses to operate on a worldwide basisâ€”a company can be headquartered in New York; develop products in India; manufacture them in China; and sell them in the United States, Europe, and the rest of the world. This has led to major changes in the labor market, especially to an increase in outsourcing, which has resulted in generally lower consumer prices, but it has caused job losses for some U.S. workers and gains for others.', NULL, '9492289.JPG', '6527314.pdf', 1, 2007, 'UK', 50, '2019-01-24 19:53:59', '2019-01-24 19:53:59', '203.190.10.206'),
(854, 294, 1, NULL, 1, 'Managerial Accounting', 'managerial-accounting', 'Twelfth Edition', '978-0-07-352670-6', NULL, 'Managerial, Accounting', 'The efforts of many people are needed to develop and improve a text. Among these people are the reviewers and consultants who point out areas of concern, cite areas of strength, and make recommendations for change. In this regard, the following professors provided feedback that was enormously helpful in preparing the twelfth edition of Managerial Accounting.', NULL, '4360249.JPG', '2185039.pdf', 1, 2008, 'New York', 50, '2019-01-24 19:58:35', '2019-01-24 19:58:35', '203.190.10.206'),
(855, 342, 1, NULL, 1, 'GETTING STARTED AS A FINANCIAL PLANNER', 'getting-started-as-a-financial-planner', '1st', '1-57660-185-4', NULL, 'GETTING, STARTED, FINANCIAL, PLANNER', 'Advising the public on financial planning issues continues to be one of the most profitable areas of personal consulting. Financial planners need to keep their clients focused so they\r\nwill continue accumulating sufficient assets to accomplish their personal goals. Americans desire to get ahead and will need effective strategies to pass the approximately $6 trillion\r\nof intergenerational wealth to succeeding generations. These growth opportunities in the marketplace and continued federal deregulation of the financial services industry gave me reasons to update this book.', NULL, '3483748.JPG', '1391784.pdf', 1, 2005, 'New York', 50, '2019-01-24 20:01:47', '2019-01-24 20:01:47', '203.190.10.206'),
(856, 49, 1, NULL, 1, 'Academic Administratorâ€™s Guide to Budgets and Financial Management', 'academic-administrators-guide-to-budgets-and-financial-management', '1st', '0-7879-5957-X', NULL, 'Academic, Guide, Budgets, Financial, Management', 'MOST PROGRAM MANAGERS, principal investigators, division leaders, and department chairs are bright, capable, and competent persons in their field of expertise. However, when appointments are made to administrative posts in higher education, new academic managers often come to their positions without much experience in fiscal management\r\nand administration. Prior to their appointment, the personal interactions of new academic managers with the fiscal management of the institution have primarily related to individual issues regarding salaries, benefits, and grants. An administrative role, however, carries with it expectations for effective management of the fiscal resources of the department or unit.', NULL, '4325088.JPG', '7314542.pdf', 1, 2002, 'UK', 50, '2019-01-24 20:06:48', '2019-01-24 20:06:48', '203.190.10.206'),
(857, 37, 1, NULL, 1, 'International Economics Theory & Policy', 'international-economics-theory-policy', 'NINTH EDITION', '978-0-13-214665-4', NULL, 'International, Economics, Theory, Policy', 'The global financial turmoil that began in August 2007 escalated into a full-blown financial crisis about nine months after the last edition of International Economics: Theory & Policy went to press. This ninth edition therefore comes out at a time when we are more aware than ever before of how events in the global economy influence each countryâ€™s economic fortunes, policies, and political debates. The world that emerged from World War II was one in which trade, financial, and even communication links between countries were limited. More than a decade into the 21st century, however, the picture is very different. Globalization has arrived, big time. International trade in goods and services has expanded steadily over the past six decades thanks to declines in shipping and communication costs, globally negotiated reductions in government trade barriers, the widespread outsourcing of production activities, and a greater awareness of foreign cultures and products.', NULL, '4632189.JPG', '9577737.pdf', 1, 2012, 'New York', 50, '2019-01-24 20:10:00', '2019-01-24 20:10:00', '203.190.10.206'),
(858, 12, 1, NULL, 1, 'Electromagnetics', 'electromagnetics-24111500', NULL, '0-8493-1397-X', NULL, 'Electromagnetics', 'This book is intended as a text for a first-year graduate sequence in engineering electromagnetics. Ideally such a sequence provides a transition period during which a student can solidify his or her understanding of fundamental concepts before proceeding to specialized areas of research', NULL, '7226260.JPG', '7647250.pdf', 1, 2001, 'New York', 51, '2019-01-24 20:11:00', '2019-01-24 20:11:00', '203.190.11.118'),
(859, 52, 1, NULL, 1, 'Fundamentals of Financial Management', 'fundamentals-of-financial-management-24121552', 'THIRTEENTH EDITION', '978-0-273-71363-0', NULL, 'Fundamentals, Financial, Management', 'Financial management continues to change at a rapid pace. Advancements are occurring not only in the theory of financial management but also in its real-world practice. One result has been for financial management to take on a greater strategic focus, as managers struggle to create value within a corporate setting. In the process of value creation, financial managers are increasingly supplementing the traditional metrics of performance with new methods that encourage a greater role for uncertainty and multiple assumptions. Corporate governance issues, ethical dilemmas, conflicting stakeholder claims, a downsized corporate environment, the globalization of finance, e-commerce, strategic alliances, the growth of outsourcing, and a host of other issues and considerations now permeate the landscape of financial decision making. It is indeed a time of both challenge and opportunity.', NULL, '7735559.JPG', '9769869.pdf', 1, 2001, 'London', 50, '2019-01-24 20:12:52', '2019-01-24 20:12:52', '203.190.10.206'),
(860, 94, 1, NULL, 1, 'International Financial Management', 'international-financial-management', 'NINTH EDITION', '978-0-324-56820-2', NULL, 'International, Financial, Management', 'Businesses evolve into multinational corporations (MNCs) so that they can capitalize\r\non opportunities. Their fi nancial managers must be able to detect opportunities, assess\r\nexposure to risk, and manage the risk. The MNCs that are most capable of responding\r\nto changes in the international fi nancial environment will be rewarded. The same can\r\nbe said for the students today who may become the future managers of MNCs.', NULL, '7519870.JPG', '2005951.pdf', 1, 2008, 'UK', 50, '2019-01-24 20:15:14', '2019-01-24 20:15:14', '203.190.10.206'),
