(862, 74, 1, NULL, 1, 'Standard Handbook of Electronic Engineering', 'standard-handbook-of-electronic-engineering-24211505', '5th ed.', NULL, NULL, 'Electronic Engineering', 'The Standard Handbook of Electronics Engineering has defined its field for over thirty years. Spun off in the 1960â€™s from Finkâ€™s Standard Handbook of Electrical Engineering, the Christiansen book has seen its markets grow rapidly, as electronic engineering and microelectronics became the growth engine of digital computing. The EE market has now undergone another seismic shiftâ€”away from computing and into communications and media. The Handbook will retain much of its evergreen basic material, but the key applications sections will now focus upon communications, networked media, and medicineâ€”the eventual destination of the majority of graduating EEs these days', NULL, '1471306.JPG', '7166554.pdf', 1, 2004, 'New York', 51, '2019-01-24 20:21:05', '2019-01-24 20:21:05', '203.190.11.115'),
(863, 30, 1, NULL, 1, 'Accounting Principles', 'accounting-principles', 'NINTH EDITION', '978-0470539101', NULL, 'Accounting, Principles', 'Weygandt Accounting Principles starts with what students know. In the new Ninth Edition, students clearly see the relevance of accounting in their everyday lives and are therefore motivated to do the work assigned.\r\nWeygandt Accounting Principles introduces challenging accounting concepts with examples that are familiar to the student. This connection to their everyday lives helps build student motivation, a key driver of student time spent on assignments and ultimately their mastery of the concept.', NULL, '8258042.JPG', '5525297.pdf', 1, 2008, 'New York', 50, '2019-01-24 20:22:13', '2019-01-24 20:22:13', '203.190.10.206'),
(864, 49, 1, NULL, 1, 'Organizational Behavior', 'organizational-behavior', '11th ed.', '978-0-470-29441-3', NULL, 'Organizational, Behavior', 'lobal warming, economic turmoil, terrorism, ethnic conflict, poverty, discrimination, unemployment, illiteracy . . . these are among the many issues and problems we face as citizens today. But how often do we stop and recognize our responsibilities for problem solving and positive action in a global context? What we do today will have a lasting impact on future generations. And whether we are talking about families, communities, nations, or the organizations in which we work and volunteer, the core question remains', NULL, '1732834.JPG', '9466633.pdf', 1, 2010, 'USA', 50, '2019-01-24 20:26:03', '2019-01-24 20:26:03', '203.190.10.206'),
(865, 52, 1, NULL, 1, 'Essentials of Management Information Systems', 'essentials-of-management-information-systems', 'NINTH EDITION', '978-0136110996', NULL, 'Essentials, Management, Information, Systems', 'Many businesses look for candidates who know how to use information systems, making a general understanding of information systems an asset to any business professional. Laudon and Laudon emphasize how business objectives shape the application of new information systems and technologies. The ninth edition focuses on currency and cutting-edge topics.', NULL, '6493980.jpg', '7034125.pdf', 1, 2011, 'New York', 50, '2019-01-24 20:32:36', '2019-01-24 20:32:36', '203.190.10.206'),
(866, 52, 1, NULL, 1, 'Management Information Systems MANAGING THE DIGITAL FIRM', 'management-information-systems-managing-the-digital-firm', 'NINTH EDITION', '978-0-13-214285-4', NULL, 'Essentials, Management, Information, Systems', 'We wrote this book for business school students who want an in-depth look at\r\nhow today\'s business firms use information technologies and systems to\r\nachieve corporate objectives. Information systems are one of the major tools\r\navailable to business managers for achieving operational excellence, developing\r\nnew products and services, improving decision making, and achieving competitive advantage. Students will find here the most up-to-date and comprehensive\r\noverview of information systems used by business firms today', NULL, '3124056.JPG', '5317679.pdf', 1, 2012, 'New York', 50, '2019-01-24 20:35:38', '2019-01-24 20:35:38', '203.190.10.206'),
(867, 86, 1, NULL, 1, 'Strategic Brand Management Building, Measuring, and Managing Brand Equity', 'strategic-brand-management-building-measuring-and-managing-brand-equity', '4th ed.', '978-0-13-266425-7', NULL, 'Strategic, Brand, Management', 'This book deals with brandsâ€”why they are important, what they represent to consumers, and what firms should do to manage them properly. As many business executives correctly recognize, perhaps one of the most valuable assets a firm has are the brands it has invested in and developed over time. Although competitors can often duplicate manufacturing processes and factory designs, itâ€™s not so easy to reproduce strongly held beliefs and attitudes established in the minds of consumers. The difficulty and expense of introducing new products, however, puts more pressure than ever on firms to skillfully launch their new products as well as manage their existing brands', NULL, '3957696.JPG', '9878661.pdf', 1, 2013, 'New York', 50, '2019-01-24 20:38:35', '2019-01-24 20:38:35', '203.190.10.206'),
(868, 52, 1, NULL, 1, 'Principles of Marketing', 'principles-of-marketing-24481513', 'NINTH EDITION', '978-0130404404', NULL, 'Principles, Marketing', 'This book takes a practical, managerial approach to marketing. It provides a rich depth of practical examples and applications to show the major decisions that marketing managers face in their efforts to balance the organizations efforts against the needs and opportunities in the marketplace. This edition has been thoroughly revised around the major marketing theme of the coming millenniumâ€”connectednessâ€”with customers, with marketing partners, and with the world around us. For marketing professionals.', NULL, '8107264.jpg', '5774601.pdf', 1, 2000, 'New York', 50, '2019-01-24 20:48:13', '2019-01-24 20:48:13', '203.190.10.206'),
(869, 37, 1, NULL, 1, 'Principles of Managerial Finance', 'principles-of-managerial-finance-24511521', '10th Edi.', '978-0201784794', NULL, 'Principles, Managerial, Finance', 'Gitman\'s proven learning system makes it easy for students to understand and fully appreciate the key concepts, tools, and techniques needed for astute financial decision making in today\'s competitive business arena. The text\'s organization conceptually links the firm\'s actions to its value as determined in the securities markets. Each major decision area is presented in terms of both risk and return factors and their potential impact on the owner\'s wealth, as reflected by share value. With a reliable and consistent framework, Gitman defines learning goals at the start of each chapter and incorporates a diverse group of pedagogical aids, using real-world examples and exercises to foster students\' comprehension of both theory and practice.', NULL, '4217412.JPG', '6696222.pdf', 1, 2002, 'New York', 50, '2019-01-24 20:51:21', '2019-01-24 20:51:21', '203.190.10.206'),
(870, 49, 1, NULL, 1, 'Liabilities, Liquidity, and Cash Management Balancing Financial Risks', 'liabilities-liquidity-and-cash-management-balancing-financial-risks', NULL, '0-471-10630-5', NULL, 'Liabilities, Liquidity, Cash, Management, Balancing, Financial, Risks', 'This book is for financial officers, analysts, traders, investment advisors, loans officers, accountants, and auditors whose daily activities are affected by the management of liabilities and the control of exposure. Senior executives have expressed the opinion that, for the next 10 years, the key words are: leverage, profitability, cash flow, liquidity, inventories, sales growth, and company size.', NULL, '3223752.JPG', '7230590.pdf', 1, 2002, 'New York', 50, '2019-01-24 20:54:13', '2019-01-24 20:54:13', '203.190.10.206'),
(871, 220, 1, NULL, 1, 'Microelectronic Circuits : Analysis and Design', 'microelectronic-circuits-analysis-and-design', '2nd', '978-0-495-66772-8', NULL, 'Microelectronic , Circuits', 'Semiconductor devices and integrated circuits (ICs) are the backbone of modern technology, and thus the study of electronicsâ€”which deals with their characteristics and applicationsâ€”is an integral part of the undergraduate curriculum for students majoring in electrical, electronics, or computer engineering. Traditionally, the basic course in electronics has been a one-year (two-semester) course at most universities and colleges. However, with the emergence of new technologies and university-wide general education requirements, electrical engineering departments are under pressure to reduce basic electronics to a one semester course. This book can be used for a one-semester course as well as a two-semester course.', NULL, '5712806.JPG', '3633550.pdf', 1, 2011, 'USA', 48, '2019-01-24 21:34:04', '2019-01-24 21:34:04', '203.190.10.204'),
(872, 39, 1, NULL, 1, 'RF Microelectronics', 'rf-microelectronics', NULL, '0-13-887571-5', NULL, 'RF , Microelectronics', 'RF design is unique in that it draws upon many disciplines unrelated to integrated circuits (ICs). The RF knowledge base has grown for almost a century. creating a seemingly endless body of literature for the novice. This book deals with the analysis and design of RF integrated circuits and systems. Providing a systematic treatment of RF electronics in a tutorial language. the book begins with the necessary background knowledge from microwave and communication theory and leads the reader to the design of RF transceivers and circuits. The text emphasizes both architecture and circuit level issues with respect to monolithic implementation in VLSI technologies.', NULL, '6981618.JPG', '6210415.pdf', 1, 1998, 'USA', 48, '2019-01-24 21:43:27', '2019-01-24 21:43:27', '203.190.10.204'),
(873, 10, 1, NULL, 1, 'Relativistic Quantum Mechanics', 'relativistic-quantum-mechanics', '3rd', '3-540-67457-8', NULL, 'Relativistic , Quantum Mechanics', 'The form of the lectures that comprise Relativistic Quantum Mechanics â€” Wove Functions follows that of all the others: together with a broad presentation of the necessary mathematical tools. many examples and exercises are worked through We u y to over science in as interesting a way as possible. With relativistic quantum mechanics we arc dealing with a broad, yet beautiful, theme. Thimbleful we have had to restrict ourselves to relativistic wave equations. The selected material is perhaps unconventional, hut corresponds, in our opinion. to the importance of this field in modem physics.', NULL, '8432938.JPG', '5118360.pdf', 1, 2000, 'Germany', 48, '2019-01-24 21:57:18', '2019-01-24 21:57:18', '203.190.10.204'),
(874, 49, 1, NULL, 1, 'Introduction to Electric Circuits', 'introduction-to-electric-circuits', NULL, '978-1-118-47750-2', NULL, 'Electric , Circuits', 'Because this book is oriented toward providing expertise in problem solving, we have included more than 260 illustrative examples. Also, each example has a title that directs the student to exactly what is being illustrated in that particular example.Various methods of solving problems are incorporated into select examples. These cases show students that multiple methods can be used to derive similar solutions or, in some cases, that multiple solutions can be correct. This helps students build the critical thinking skills necessary to discern the best choice between multiple outcomes.', NULL, '3914495.JPG', '4252197.pdf', 1, 2014, 'USA', 48, '2019-01-24 22:04:21', '2019-01-24 22:04:21', '203.190.10.204'),
(875, 49, 1, NULL, 1, 'Physics', 'physics', '2nd', '0-471-34529-6', NULL, 'Physics', 'The entire book was carefully reviewed for pedagogic improvement, based chiefly on the experiences of usersâ€”, students and teachers, â€”and on the most recent scientific literature. As a result, we have rewritten selected areas significantly for improvements in presentation, accuracy, or physics. We have included new worked-out examples for topics or areas needing them. We have modernized all references, added new ones, and have improved many figures for greater clarity. The tables and the appendices have been expanded and updated to give newer data and more information than before.', NULL, '9959142.JPG', '2950484.pdf', 1, 1978, 'New York', 48, '2019-01-24 22:20:56', '2019-01-24 22:20:56', '203.190.10.204'),
(876, 343, 1, NULL, 1, 'Three-Dimensional Static and Dynamic Analysis of Structures : A Physical Approach With Emphasis on Earthquake Engineering', 'three-dimensional-static-and-dynamic-analysis-of-structures-a-physical-approach-with-emphasis-on-earthquake-engineering', '3rd', '0-923907-00-9', NULL, 'Dynamic Analysis , Three-Dimensional Static', 'To reduce those errors associated with displacement loading, a higher order integration method based on a cubic variation of loads within a time step is introduced in Chapter 13. In addition, static and dynamic participation factors have been defined that allow the structural engineer to minimize the errors associated with displacement type loading. In addition, Chapter 19 on viscous damping has been expanded to illustrate the physical effects of modal damping on the results of a dynamic analysis.', NULL, '9753650.JPG', '9972320.pdf', 1, 2001, 'USA', 48, '2019-01-24 22:30:00', '2019-01-24 22:30:00', '203.190.10.204'),
(877, 12, 1, NULL, 1, 'ENERGY MANAGEMENT HANDBOOK', 'energy-management-handbook', '6th ed.', '0-88173-543-4', NULL, 'Energy Security , Thermal Energy Storage', 'Newly revised and edited, this comprehensive handbook is the definitive stand-alone energy manager\'s desk reference, used by thousands of professionals throughout the industry. The sixth edition includes new chapters on ground-source heat pumps, sustainability, and high performance green buildings, plus an in-depth revision of sections on control systems.', NULL, '7651647.JPG', '8587809.pdf', 1, 2007, 'U.S.A', 51, '2019-01-24 22:47:25', '2019-01-24 22:47:25', '203.190.11.117'),
(878, 43, 1, NULL, 1, 'Standard Handbook of Engineering Calculation', 'standard-handbook-of-engineering-calculation', '4th ed.', NULL, NULL, 'Engineering Calculation', 'Brockenbroughâ€”Structural Steel Designerâ€™s Handbook, McGraw-Hill; Flemingâ€”Construction Technology Blackwell; ASCEâ€”Minimum Design Loads for Building and Other Structures, American Society of Civil Engineers; Kalamkarovâ€”Analysis, Design and Optimization of Composite Structures, Wiley; Bruneauâ€”Ductile Design of Steel Structures, McGraw-Hill; AISC Committeeâ€”Manual of Steel Construction Load and Resistance Factor Design, American Institute of Steel Construction; Simonâ€”Sound Control in Building, Blackwell;', NULL, '3757336.JPG', '8537164.pdf', 1, 2004, NULL, 51, '2019-01-24 22:56:32', '2019-01-24 22:56:32', '203.190.11.118'),
(879, 339, 1, NULL, 1, 'Songs of Innocence and of Experience', 'songs-of-innocence-and-of-experience', NULL, NULL, NULL, NULL, 'The simple and beautiful eloquence of William Blake\'s poetry is exemplified here in \"Songs of Innocence and of Experience.\" This collection of forty-six poems is actually two volumes in one. After first completing and publishing \"Songs of Innocence\" in 1789 Blake would, some five years later, add \"Songs of Experience\" to the volume in an effort to show \"the two contrary states of the human soul.\"', NULL, '9634684.jpg', '9927019.pdf', 1, 2004, 'New York', 40, '2019-01-24 23:03:19', '2019-01-24 23:03:19', '203.190.11.118'),
(880, 12, 1, NULL, 1, 'Engineering Design Reliability', 'engineering-design-reliability', NULL, '0-8493-1180-2', NULL, 'Engineering Design Reliability', 'Probabilistic and other nondeterministic methods for design under uncertainty are becoming increasingly popular in the aerospace, automotive, and the ocean engineering industries because they help them\r\ndesign more competitive products. This handbook is an integrated document explaining the philosophy of nondeterministic methods and demonstrating their benefits on real life problems. This handbook is for engineers, managers, and consultants in the aerospace, automotive, civil, industrial, nuclear, and ocean engineering industries who are using nondeterministic methods for product design, or want to understand these methods and assess their potential. Graduate students and professors\r\nin engineering departments at U.S. and foreign colleges and universities, who work on nondeterministic methods, will find this book useful too.', NULL, '5363756.jpg', '6446291.pdf', 1, 2005, 'U.S.A', 51, '2019-01-24 23:14:52', '2019-01-24 23:14:52', '203.190.11.117'),
(881, 339, 1, NULL, 1, 'Wuthering Heights', 'wuthering-heights', NULL, NULL, NULL, NULL, '1801. â€” I have just returned from a visit to my landlordâ€”\r\nthe solitary neighbour that I shall be troubled with. This is\r\ncertainly a beautiful country! In all England, I do not believe\r\nthat I could have fixed on a situation so completely removed\r\nfrom the stir of society', NULL, '2677187.jpg', '2196628.pdf', 1, 2004, 'New York', 40, '2019-01-24 23:22:32', '2019-01-24 23:22:32', '203.190.11.117'),
(882, 344, 1, NULL, 1, 'Fundamentals of Engineering Supplied-Reference Handbook', 'fundamentals-of-engineering-supplied-reference-handbook', '4th ed.', NULL, NULL, 'Engineering Supplied-Reference', 'During its August 1991 Annual Business Meeting, the National Council of Examiners for Engineering and Surveying (NCEES) voted\r\nto make the Fundamentals of Engineering (FE) examination an NCEES supplied-reference examination. Then during its August 1994\r\nAnnual Business Meeting, the NCEES voted to make the FE examination a discipline-specific examination. As a result of the 1994\r\nvote, the FE examination was developed to test the lower-division subjects of a typical bachelor engineering degree program during\r\nthe morning portion of the examination, and to test the upper-division subjects of a typical bachelor engineering degree program\r\nduring the afternoon. The lower-division subjects refer to the first 90 semester credit hours (five semesters at 18 credit hours per\r\nsemester) of engineering coursework. The upper-division subjects refer to the remainder of the engineering coursework.', NULL, '6734215.JPG', '1436046.pdf', 1, 2000, NULL, 51, '2019-01-24 23:24:42', '2019-01-24 23:24:42', '203.190.11.117'),
(883, 345, 1, NULL, 1, 'The Stranger', 'the-stranger', NULL, NULL, NULL, NULL, 'The Home for Aged Persons is at Marengo, some fifty miles from Algiers. With the two oâ€™clock bus I should get there well before nightfall. Then I can spend the night there, keeping the usual vigil beside the body, and be back here by tomorrow evening. I', NULL, '3921196.jpg', '4939020.pdf', 1, 1946, 'New York', 40, '2019-01-24 23:32:21', '2019-01-24 23:32:21', '203.190.11.117'),
(884, 339, 1, NULL, 1, 'The Canterbury Tales', 'the-canterbury-tales', NULL, NULL, NULL, NULL, 'He was a contemporary of Giovanni Boccaccio and Christine de\r\nPizan. Although born as a son of a vintner, he became a page at the\r\ncourt of Edward III of England. He was in the service of first Elizabeth\r\nde Burgh, Countess of Ulster, and then Lionel of Antwerp, son of\r\nEdward III. He traveled from England to France, Spain, Flanders, and\r\nItaly (Genoa and Florence), where he came into contact with medieval\r\ncontinental poetry.', NULL, '1748860.jpg', '2867320.pdf', 1, 2004, 'New York', 40, '2019-01-25 00:12:28', '2019-01-25 00:12:28', '203.190.11.116'),
(885, 346, 1, NULL, 1, 'Handbook for Evaluating Infrastructure Regulatory Systems', 'handbook-for-evaluating-infrastructure-regulatory-systems', NULL, '978-0-8213-6579-3', NULL, 'Discussion and Evaluation Tools', 'Around the world, governments perform three main functions: they tax, they\r\nspend, and they regulate. And of those three functions, regulation is the least\r\nunderstood. It should not be surprising that regulation can produce harmful\r\neffects when it is poorly designed or executed. For example, an annual World\r\nBank survey, Doing Business, has documented how too much general business regulation has hurt economic growth in many developing countries.', NULL, '8409005.JPG', '2613677.pdf', 1, 2006, 'Washington DC', 51, '2019-01-25 00:53:25', '2019-01-25 00:53:25', '203.190.11.116'),
(886, 118, 1, NULL, 1, 'Fiber Optics Handbook Fiber, Devices, and Systems for Optical Communications', 'fiber-optics-handbook-fiber-devices-and-systems-for-optical-communications', NULL, NULL, NULL, 'Optical Fibers and Fiber-Optic Communications', 'Fiber optics has developed so rapidly during the last 30 years that it has become the backbone of our communications systems, critical to many medical procedures, the basis of many critical sensors, and utilized in many laser manufacturing applications. This book is part of the Handbook of Optics, Second Edition, Vol. IV, devoted to fiber optics and fiber optics communications.', NULL, '4026545.JPG', '4875820.pdf', 1, 2002, 'New York', 51, '2019-01-25 00:59:22', '2019-01-25 00:59:22', '203.190.11.116');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(887, 130, 1, NULL, 1, 'Gas Turbine Engineering Handbook', 'gas-turbine-engineering-handbook', '2nd ed.', '978-0884157328', NULL, 'Gas Turbine Engineering', 'Written by one of the fieldâ€™s most well known experts, the Gas Turbine Engineering Handbook has long been the standard for engineers involved in the design, selection, maintenance and operation of gas turbines. With far reaching, comprehensive coverage across a range of topics from design specifications to maintenance troubleshooting, this one-stop resource provides newcomers to the industry with all the essentials to learn and fill knowledge gaps, and established practicing gas turbine engineers with a reliable go-to reference. This new edition brings the Gas Turbine Engineering Handbook right up to date with new legislation and emerging topics to help the next generation of gas turbine professionals understand the underlying principles of gas turbine operation, the economic considerations and implications of operating these machines, and how they fit in with alternative methods of power generation.', NULL, '8559053.jpg', '2850645.pdf', 1, 2002, 'Boston', 51, '2019-01-25 01:10:50', '2019-01-25 01:10:50', '203.190.11.117'),
(888, 294, 1, NULL, 1, 'MANAGERIAL ACCOUNTING for managers', 'managerial-accounting-for-managers', '2nd ed.', '978-0-07-352713-0', NULL, 'MANAGERIAL, ACCOUNTING, managers', 'The efforts of many people are needed to develop and improve a text. Among these people are the reviewers and consultants who point out areas of concern, cite areas of strength, and make recommendations for change. In this\r\nregard, the following professors provided feedback that was enormously helpful in preparing the second edition of Managerial Accounting for Managers', NULL, '5663462.JPG', '1732047.pdf', 1, 2011, 'New York', 50, '2019-01-26 15:09:42', '2019-01-26 15:09:42', '203.190.11.116'),
(889, 49, 1, NULL, 1, 'MANAGING BUSINESS ETHICS Straight Talk About How To Do It Right', 'managing-business-ethics-straight-talk-about-how-to-do-it-right', '5th Edition', '978-0-470-34394-4', NULL, 'MANAGING, BUSINESS, BUSINESS ETHICS', 'The popular business press is replete with feature stories describing ethical meltdowns and how those corporate misdeeds have eroded the public trust of business leaders and their organizations. As most of us learned at our parentsâ€™ knees, trust and reputation are built over many years and take but an instant to be destroyed. So here we stand at a crossroads. This book is different from other business ethics texts in several key ways.', NULL, '9930310.JPG', '7133528.pdf', 1, 2011, 'U.S.A', 50, '2019-01-26 15:13:22', '2019-01-26 15:13:22', '203.190.11.117'),
(890, 86, 1, NULL, 1, 'Marketing management', 'marketing-management', 'Twelfth ed.', '0-13-145757-8', NULL, 'Marketing, management', 'Marketing Management is the leading marketing text because its content and organization consistently reflect changes in marketing theory and practice. The very first edition of Marketing Management, published in 1967, introduced the concept that companies must be customer-and-market driven. But there was little mention of what have now become fundamental topics such as segmentation, targeting, and positioning. Concepts such as brand equity, customer value analysis, database marketing, e-commerce, value networks, hybrid channels, supply chain management, and integrated marketing communications were not even part of the marketing vocabulary then. Firms now sell goods and services through a variety of direct and indirect channels. Mass advertising is not nearly as effective as it was. Companies are exploring new forms of communication, such as experiential, entertainment, and viral marketing.', NULL, '9717387.JPG', '7473078.pdf', 1, 2006, 'NEW JARCY', 50, '2019-01-26 15:17:44', '2019-01-26 15:17:44', '203.190.11.117'),
(891, 347, 1, NULL, 1, 'Marketing Management Millenium', 'marketing-management-millenium', 'Tenth Edition', '0â€“536â€“63099-2', NULL, 'Marketing, Management, Millenium', 'Marketing deals with identifying and meeting human and social needs. One of the shortest definitions of marketing is â€œmeeting needs profitably.â€ Whether the marketer is Procter & Gamble, which notices that people feel overweight and want tasty but less fatty food and invents Olestra; or CarMax, which notes that people want more certainty when they buy a used automobile and invents a new system for selling used cars; or IKEA, which notices that people want good furniture at a substantially lower price and creates knock-down furnitureâ€”all illustrate a drive to turn a private or social need into a profitable business opportunity through marketing.', NULL, '2484604.JPG', '8809967.pdf', 1, 2000, 'U.S.A', 50, '2019-01-26 15:21:09', '2019-01-26 15:21:09', '203.190.11.116'),
(892, 225, 1, NULL, 1, 'LOGISTICS & SUPPLY CHAIN MANAGEMENT', 'logistics-supply-chain-management', '4th ed.', '978-0-273-73112-2', NULL, 'LOGISTICS, SUPPLY, CHAIN, MANAGEMENT', 'When the first edition of this book was published in 1992, supply chain management as an idea was still in its infancy and relatively few companies had made it a priority. The same was true for logistics management, although its precursor, distribution management, was increasingly being recognised as important both in terms of cost and for its potential impact on sales.These changes are reflected in the additional material included in this new edition. Thus complexity management and the challenge of making the transition from a forecast-driven to a demand-driven business model are given greater emphasis.', NULL, '9976665.JPG', '4516346.pdf', 1, 2011, 'London', 50, '2019-01-26 15:24:48', '2019-01-26 15:24:48', '203.190.11.116'),
(893, 74, 1, NULL, 1, 'FINANCIAL ANALYSIS: TOOLS AND TECHNIQUES A Guide for Managers', 'financial-analysis-tools-and-techniques-a-guide-for-managers', '1st ed.', '0-07-139541-5', NULL, 'FINANCIAL, ANALYSIS, TOOLS, TECHNIQUES', 'The concept that any business is essentially an integrated system of cash flows driven by management decisions provides the bookâ€™s foundation. All analytical tools and related financial/economic concepts are discussed within this systems context, which reflects the three basic types of decisions made continuously by the management of any ongoing business: investment, operating, and financing. The materials are also structured around the viewpoints of the major parties interested in the analysis and performance of a business: managers, owners, and creditors. The book begins by providing a perspective on the recent speculative excesses in the new economyâ€™s â€œdotcomâ€ revolution, with the argument that basic economics and financial analysis have never changed, but only were ignored at times.', NULL, '6101592.JPG', '2854725.pdf', 1, 2001, 'New York', 50, '2019-01-26 15:28:23', '2019-01-26 15:28:23', '203.190.11.116'),
(894, 294, 1, NULL, 1, 'Bank Management & Financial Services', 'bank-management-financial-services', '7th Edi.', '978-007-1259', NULL, 'Bank, Management, Financial, Services', 'Bank Management and Financial Services is designed to help students master established management principles and to confront the perplexing issues of risk, regulation, technology, and competition that bankers and other financial-service managers see as their greatest challenges for the future.', NULL, '8310529.jpg', '8868270.pdf', 1, 2008, 'New York', 50, '2019-01-26 16:08:10', '2019-01-26 16:08:10', '203.190.11.116'),
(895, 81, 1, NULL, 1, 'Principles of Marketing', 'principles-of-marketing-26111142', '14th Edi.', '978-0-13-216712-3', NULL, 'Principles, Marketing', 'The goal of every marketer is to create more value for customers. So it makes sense that our goal for the fourteenth edition is to continue creating more value for youâ€”our customer. Our goal is to introduce new marketing students to the fascinating world of modern marketing in an innovative and comprehensive yet practical and enjoyable way. Weâ€™ve poured over every page, table, figure, fact, and example in an effort to make this the best text from which to learn about and teach marketing. Enhanced by my marketing lab, our online homework and personalized study tool, the fourteenth edition creates exceptional value for both students and professors.', NULL, '8841721.JPG', '4414756.pdf', 1, 2012, 'New York', 50, '2019-01-26 16:11:42', '2019-01-26 16:11:42', '203.190.11.118'),
(896, 52, 1, NULL, 1, 'Marketing Management', 'marketing-management-26131147', '14th Edi.', '978-0-13-210292-6', NULL, 'Marketing, Management', 'The overriding goal of the revision for the 14th edition of Marketing Management was to create as comprehensive, current, and engaging MBA marketing textbook as possible. Where appropriate, new material was added, old material was updated, and no longer relevant or necessary material was deleted. Marketing Management, 14th edition, allows those instructors\r\nwho have used the 13th edition to build on what they have learned and done while at the same time offering a text that is unsurpassed in breadth, depth, and relevance for students experiencing Marketing Management for the first time.', NULL, '/tmp/phpnYkEx5', '7509029.pdf', 1, 2012, 'New York', 50, '2019-01-26 16:13:47', '2019-01-26 16:14:22', '203.190.11.116'),
(897, 118, 1, NULL, 1, 'Brealeyâˆ’Meyers: Principles of Corporate Finance', 'brealeymeyers-principles-of-corporate-finance', 'Seventh Edition', '9780072467666', NULL, 'Brealey, Meyers, Principles, Corporate, Finance', 'This book describes the theory and practice of corporate finance. We hardly need to explain why financial managers should master the practical aspects of their job, but we should spell out why down-to-earth, red blooded managers need to bother with theory. Managers learn from experience how to cope with routine problems. But the best managers are also able to respond to change. To do this you need more than time-honored rules of thumb; you must\r\nunderstand why companies and financial markets behave the way they do. In other words, you need a theory of finance.', NULL, '3444297.JPG', '1138515.pdf', 1, 2003, 'New York', 50, '2019-01-26 16:19:34', '2019-01-26 16:19:34', '203.190.11.118'),
(898, 91, 1, NULL, 1, 'QUANTITATIVE FINANCE FOR PHYSICISTS: AN INTRODUCTION', 'quantitative-finance-for-physicists-an-introduction', '1st ed.', '0-12-088464-X', NULL, 'QUANTITATIVE, FINANCE, PHYSICISTS', 'This book is written for those physicists who want to work on Wall\r\nStreet but have not bothered to read anything about Finance. This is\r\na crash course that the author, a physicist himself, needed when he\r\nlanded a financial data analyst job and became fascinated with the\r\nhuge data sets at his disposal. More broadly, this book addresses the\r\nreader with some background in science or engineering (college-level\r\nmath helps) who is willing to learn the basic concepts and quantitative\r\nmethods used in modern finance.', NULL, '7177002.JPG', '5356470.pdf', 1, 2005, 'London', 50, '2019-01-26 16:22:37', '2019-01-26 16:22:37', '203.190.11.115'),
(899, 74, 1, NULL, 1, 'Discrete Mathematics', 'discrete-mathematics', '3rd', '0-07-151101-6', NULL, 'Discrete , Mathematics', 'Each chapter begins with a clear statement of pertinent definitions, principles, and theorems with illustrative and other descriptive material. This is followed by sets of solved and supplementary problems. The solved problems serve to illustrate and amplify the material, and also include proofs of theorems. The supplementary problems furnish a complete review of the material in the chapter. More material has been included than can be covered in most first courses. This has been done to make the book more flexible, to provide a more useful book of reference, and to stimulate further interest in the topics.', NULL, '9213293.JPG', '4608834.pdf', 1, 2007, 'New York', 48, '2019-01-26 17:18:01', '2019-01-26 17:18:01', '203.190.11.116'),
(900, 74, 1, NULL, 1, 'Digital Signal Processing', 'digital-signal-processing-26241213', NULL, '0â€“07â€“027389â€“8', NULL, 'Signal , Processing', 'Digital signal processing (DSP) is concerned with the representation of signals in digital form, and with the processing of these signals and the information that they carry. Although DSP, as we know it today, began to flourish in the 1960\'s, some of the important and powerful processing techniques that are in use today may be traced back to numerical algorithms that were proposed and studied centuries ago. Since the early 1970\'s, when the first DSP chips were introduced, the field of digital signal processing has evolved dramatically.', NULL, '4656152.JPG', '1974931.pdf', 1, 1999, 'New York', 48, '2019-01-26 17:24:13', '2019-01-26 17:24:13', '203.190.11.118'),
(901, 74, 1, NULL, 1, 'Probability and Statistics', 'probability-and-statistics', NULL, '0-07-139838-4', NULL, 'Probability , Statistics', 'Experimentation is useful to us because we can assume that if we perform certain experiments under very nearly identical conditions, we will arrive at results that are essentially the same. In these circumstances, we are able to control the value of the variables that affect the outcome of the experiment. However, in some experiments, we are not able to ascertain or control the value of certain variables so that the results will vary from one performance of the experiment to the next, even though most of the conditions are the same. These experiments are described as random.', NULL, '9438406.JPG', '1343870.pdf', 1, 2001, 'New York', 48, '2019-01-26 17:35:03', '2019-01-26 17:35:03', '203.190.11.115'),
(902, 10, 1, NULL, 1, 'Constrained Optimal Control of Linear and Hybrid Systems', 'constrained-optimal-control-of-linear-and-hybrid-systems', NULL, '3-540-00257-X', NULL, 'Optimal Control , Linear', 'Focus on two classes of discrete-time dynamical systems: (i) constrained linear systems and (ii) constrained linear hybrid systems, i.e., systems that include logic states and inputs, whose mode of operation can switch between a finite number of affine systems and where the mode transitions can be triggered by states crossing specific thresholds or by exogenous inputs. For these two classes of systems we study optimal control problems and their state feedback solution. Our approach will make use of multi-parametric programming and our main objective will be to derive properties of the state feedback solution, as well as to obtain algorithms to compute it efficiently', NULL, '5946058.JPG', '4244626.pdf', 1, 2003, 'New York', 48, '2019-01-26 17:43:59', '2019-01-26 17:43:59', '203.190.11.116'),
(903, 49, 1, NULL, 1, 'The Quantum Theory on Nonrelativistic Collisions', 'the-quantum-theory-on-nonrelativistic-collisions', NULL, '0-471-84900-6', NULL, 'Quantum Theory , Nonrelativistic', 'The concepts of a single-Channel process is really an idealization.The formalism of single-channel scattering is naturally much simpler than that of the general multi-channel problem.At the time the former includes almost all of the basic concepts needed for the latter.We shall therefore treat single-channel scattering in considerable details before we go on to the multi-channel problem.', NULL, '7552054.JPG', '9012417.pdf', 1, 1972, 'Canada', 48, '2019-01-26 18:06:19', '2019-01-26 18:06:19', '203.190.11.115'),
(904, 294, 1, NULL, 1, 'Managerial Accounting', 'managerial-accounting-26081334', 'Thirteenth Edition', '978-0-07-337961-6', NULL, 'Managerial, Accounting', 'The efforts of many people are needed to develop and improve a text. Among these people are the reviewers and consultants who point out areas of concern, cite areas of strength, and make recommendations for change. In this regard, the following professors provided feedback that was enormously helpful in preparing the thirteenth edition of Managerial Accounting.', NULL, '2822000.JPG', '5831963.pdf', 1, 2010, 'New York', 50, '2019-01-26 18:08:34', '2019-01-26 18:08:34', '203.190.11.116'),
(905, 10, 1, NULL, 1, 'Semiconductor Power Devices', 'semiconductor-power-devices', NULL, '978-3-642-11125-9', NULL, 'Semiconductor , Power Devices', 'Power electronics is gaining more and more importance in industry and society. It has the potential to substantially increase the efficiency of power systems, a task of great significance. To exploit this potential, not only engineers working in the development of improved and new devices but also application engineers in the field of power electronics need to understand the basic principles of semiconductor power devices. Furthermore, since a semiconductor device can only fulfill its function in a suitable environment, interconnection and packaging technologies with the related material properties have to be considered as well as the problem of cooling, which has to be solved for reliable applications', NULL, '8129247.JPG', '3327670.pdf', 1, 2011, 'New York', 48, '2019-01-26 18:13:00', '2019-01-26 18:13:00', '203.190.11.115'),
(906, 220, 1, NULL, 1, 'Organizational Behavior Managing People and Organizations', 'organizational-behavior-managing-people-and-organizations', '11th Edi.', '978-1-133-62669-5', NULL, 'Organizational, Behavior, Managing', 'It has been said that the only constant is change. And change continues to be the watchword for managers everywhere. Now more than ever, managers need a comprehensive and sophisticated understanding of the assets, tools, and resources they can draw upon to compete most effectively. And understanding the people who comprise organizationsâ€”operating employees, managers, engineers, support staff, sales representatives, decision makers, professionals, maintenance workers, and administrative employeesâ€”is critical for any manager who aspires to understand change and how his or her organization needs to respond to that change.', NULL, '1940710.JPG', '8905084.pdf', 1, 2014, 'U.K.', 50, '2019-01-26 18:13:56', '2019-01-26 18:13:56', '203.190.11.118'),
(907, 74, 1, NULL, 1, 'RISK MANAGEMENT AND CAPITAL ADEQUACY', 'risk-management-and-capital-adequacy', '1st ed.', '0-07-142558-6', NULL, 'RISK, MANAGEMENT, CAPITAL, ADEQUACY', 'This book presents an inventory of the different approaches to market,\r\ncredit and, operational risk. The following chapters provide an in-depth\r\nanalysis of how the different risk areas diverge regarding methodologies,\r\nassumptions, and conditions. The book also discusses how the different approaches can be identified and measured, and how their various parts contribute to the discipline of risk management as a whole. The closing chapter\r\nprovides case studies showing the relevance of the different risk categories\r\nand discusses the â€œcrash-testingâ€ of regulatory rules through their application to various crises and accidents.', NULL, '2432209.JPG', '2915379.pdf', 1, 2003, 'New York', 50, '2019-01-26 18:16:54', '2019-01-26 18:16:54', '203.190.11.117'),
(908, 220, 1, NULL, 1, 'Services Marketing Concepts, Strategies, & Cases', 'services-marketing-concepts-strategies-cases', 'FOURTH EDITION', '9781439039397', NULL, 'Service, Marketing, Concept', 'The primary objective of Services Marketing: Concepts, Strategies, & Cases is to provide materials that not only introduce the student to the field of services marketing, but also acquaint the student with specific customer service issues. In addition to traditional business knowledge, the business world now demands increasing employee competence in developing effective service processes, constructing meaningful services capes, customer satisfaction and service quality measurement, as well as service recovery skills that are essential in growing and sustaining the existing customer base.', NULL, '4957537.JPG', '7850338.pdf', 1, 2012, 'U.S.A', 50, '2019-01-26 18:19:47', '2019-01-26 18:19:47', '203.190.11.116'),
(909, 10, 1, NULL, 1, 'Fundamentals of Semiconductors : Physics and Materials Properties', 'fundamentals-of-semiconductors-physics-and-materials-properties', '4th', '978-3-642-00710-1', NULL, 'Fundamentals , Semiconductors', 'Content, outline and an excerpt of the book.Reviews of the book in various magazines and journals.Errata to both first and second printing (most have been corrected in the second edition as of this date).Solutions to selected problems.Additional supplementary problems.', NULL, '3305513.JPG', '5647352.pdf', 1, 2010, 'New York', 48, '2019-01-26 18:20:58', '2019-01-26 18:20:58', '203.190.11.116'),
(910, 86, 1, NULL, 1, 'Organizational Behavior', 'organizational-behavior-26221335', '15th ed.', '978-0-273-76529-5', NULL, 'Organizational, Behavior', 'Welcome to the fifteenth edition of Organizational Behavior! Long considered the standard for all organizational behavior textbooks, this edition continues its tradition of making current, relevant research come alive for students. While maintaining its hallmark featuresâ€”clear writing style, cutting-edge content, and engaging pedagogyâ€”the fourteenth edition has been updated to reflect the most recent research within the field of organizational behavior. This is one of the most comprehensive and thorough revisions of Organizational Behavior weâ€™ve undertaken, and while weâ€™ve preserved the core material, weâ€™re confident that this edition reflects the most important research and topical issues facing organizations, managers, and employees.', NULL, '6196122.JPG', '5907341.pdf', 1, 2013, 'New York', 50, '2019-01-26 18:22:35', '2019-01-26 18:22:35', '203.190.11.118'),
(911, 81, 1, NULL, 1, 'Management', 'management', '11th Edi.', '978-0-13-216384-2', NULL, 'Management', 'Youâ€™ve made a good decision! Youâ€™re taking a college course ... maybe more than one. Although you may sometimes feel like youâ€™re wasting your time being in college, youâ€™re not. Yes, itâ€™s expensive. Yes, itâ€™s even sometimes hard. But what youâ€™re doing now will pay off in the long run. In a recent survey of job seekers, a whopping 92 percent said that a major disadvantage in competing for jobs was not having taken college courses. But thatâ€™s not what youâ€™ll face because you are enrolled in a college courseâ€”the course for which youâ€™ve purchased this book.', NULL, '4862238.JPG', '4064248.pdf', 1, 2012, 'New York', 50, '2019-01-26 18:25:57', '2019-01-26 18:25:57', '203.190.11.116'),
(912, 10, 1, NULL, 1, 'Semiconductor Physical Electronics', 'semiconductor-physical-electronics', '2nd', '978-0387-28893-2', NULL, 'Semiconductor , Physical Electronics', 'The purpose of the second edition of this book is to update the developments in various semiconductor and photogenic devices since the first edition was published in 1993. Due to the advances in semiconductor technologies over the past decade, many new semiconductor devices have emerged and entered the marketplace. As a result, a significant portion of the material covered in the original book has been revised and updated. The intent of this book is to provide the reader with a self-contained treatment of the fundamental physics of semiconductor materials and devices.', NULL, '2610249.JPG', '7379831.pdf', 1, 2006, 'New York', 48, '2019-01-26 18:28:28', '2019-01-26 18:28:28', '203.190.11.116'),
(913, 10, 1, NULL, 1, 'Semiconductor-Laser Fundamentals', 'semiconductor-laser-fundamentals', NULL, '3-540-64166-1', NULL, 'Semiconductor-Laser , Fundamentals', 'Introducing the new developments, we integrated into this book the material related part of our original â€œSemiconductor-Laser Physicsâ€ book. Besides some of the basic chapters, that have been updated and reorganized, we extensively cover band structure engineering aspects and the microscopic theory of the semiconductor gain materials in order to ad- equately account for the recent progress in materials and theoretical under- standing. We included a wealth of examples, involving many different material combinations that are used in quantum-well laser systems. All of these results are obtained consistently at the level of the full microscopic many-body the- ory, and we expect a good degree of quantitative and predictive value from these numerical examples.', NULL, '7205741.JPG', '7857473.pdf', 1, 1999, 'Germany', 48, '2019-01-26 18:41:26', '2019-01-26 18:41:26', '203.190.11.116'),
(914, 81, 1, NULL, 1, 'SUPPLY CHAIN MANAGEMENT Strategy, Planning, and Operation', 'supply-chain-management-strategy-planning-and-operation', '3rd ed.', '0-13-208608-5', NULL, 'SUPPLY, CHAIN, MANAGEMENT', 'This book is targeted toward an academic as well as a practitioner audience. On the academic side, it should be appropriate for MBA students, engineering master\'s students, and senior undergraduate students interested in supply chain management and logistics. It should also serve as a suitable reference for both concepts as well as methodology for practitioners in consulting and industry. The book has grown from a course on supply chain management taught to second year MBA students at the Kellogg School of Management at Northwestern University. The goal of this class was to cover not only high-level supply chain strategy and concepts, but also to give students a solid understanding of the analytical tools necessary to solve supply chain problems.', NULL, '3049421.jpg', '6137009.pdf', 1, 2007, 'New Jersey', 50, '2019-01-26 19:04:22', '2019-01-26 19:04:22', '203.190.11.117'),
(915, 220, 1, NULL, 1, 'Managerial Accounting', 'managerial-accounting-26081441', 'NINTH EDITION', '978-0-538-74280-1', NULL, 'Managerial, Accounting', 'This revision of Managerial Accounting is based on an understanding of the\r\nnature, culture, and motivations of todayâ€™s undergraduate students and on extensive feedback from many instructors who use our book. These substantial changes meet the needs of these students, who not only face a business world increasingly complicated by ethical issues, globalization, and technology but who also have more demands on their time. To assist them to meet these challenges, the authors carefully show them how the effects of business transactions, which are the result of business decisions, are recorded in a way that will be reflected on the financial statements. Instructors will find that building on the textâ€™s historically strong pedagogy, the authors have strengthened transaction analysis and its link to the\r\naccounting cycle.', NULL, '3753342.JPG', '3039250.pdf', 1, 2011, 'U.S.A', 50, '2019-01-26 19:08:41', '2019-01-26 19:08:41', '203.190.11.118'),
(916, 128, 1, NULL, 1, 'The Art of Successful Business Communication', 'the-art-of-successful-business-communication', '1st ed.', '978-0-86341-907-2', NULL, 'Art, Successful, Business, Communication', 'This book addresses these problems: what makes communication difficult and how to overcome those difficulties; how to deal with specific modes of communication (for instance, making a presentation or putting something in writing); and, overall, it highlights the opportunities that good communication produces. Two further things. First, there is a logic to the book, and the content of early chapters may enhance the reading of a subsequent one on, say, negotiation, but chapters on individual methods make sense in their own right; indeed, some points are repeated to ensure this. Second, the book is intended to be useful whatever role someone may have.', NULL, '4176355.JPG', '6716032.pdf', 1, 2008, 'London', 50, '2019-01-26 19:11:28', '2019-01-26 19:11:28', '203.190.11.117'),
(917, 294, 1, NULL, 1, 'The Personal Finance Calculator', 'the-personal-finance-calculator', '1st ed.', '0-07-142906-9', NULL, 'Personal, Finance, Calculator', 'Financial decisions form the basis of much of what we do in our lives.\r\nPoorly thought out personal finance decisions can at best cause great anxiety and at worst lead to bankruptcy, whereas well thought out, sound financial decisions can lead to a prosperous lifestyle. Now more than ever, we need to understand the complexities of our financial circumstances to make sound decisions. We are confronted by countless financial decisions in our daily lives, and this book provides a format to assist you in most, if not all, of your decision-making. Fifty-two different financial calculators provide you with the opportunity to take charge of your own financial affairs. Each financial calculator has one or more worksheets with step-by-step instructions to assist you in determining your answers to each of the financial questions.', NULL, '4095988.JPG', '8341587.pdf', 1, 2003, 'London', 50, '2019-01-26 19:19:27', '2019-01-26 19:19:27', '203.190.11.117'),
(918, 49, 1, NULL, 1, 'ACCOUNTING PRINCIPLES', 'accounting-principles-26231422', '10th Edi.', '978-0-470-53479-3', NULL, 'ACCOUNTING, PRINCIPLES', 'Hundreds of thousands of students have used this textbook. Your\r\ninstructor has chosen it for you because of its trusted reputation. The authors have worked hard to keep the book fresh, timely, and accurate.\r\nThis textbook contains features to help you learn best, whatever your learning style. To understand what your learning style is, spend about ten minutes to take the learning style quiz at the bookâ€™s companion website. Then, look at page vii for how you can apply an understanding of your learning style to this course. When you know more about your own learning style, browse through the Student Ownerâ€™s Manual on pages viiiâ€“xi. It shows you the main features you will find in this textbook and explains their purpose.', NULL, '8483459.JPG', '5840985.pdf', 1, 2009, 'U.S.A', 50, '2019-01-26 19:23:22', '2019-01-26 19:23:22', '203.190.11.117'),
(919, 49, 1, NULL, 1, 'ESSENTIALS of Financial Analysis', 'essentials-of-financial-analysis', '1st ed.', '0-471-22830-3', NULL, 'ESSENTIAL, Financial, Analysis', 'The financial analysis of companies is usually undertaken so that\r\ninvestors, creditors, and other stakeholders can make decisions\r\nabout those companies.The focus of this book is on the financial\r\nanalysis of companies that are publicly traded and therefore make public\r\nthe data and information needed by stakeholders, who can then use the\r\nanalytical procedures included in this book.', NULL, '7919218.JPG', '6377297.pdf', 1, 2003, 'New Jersey', 50, '2019-01-26 19:25:15', '2019-01-26 19:25:15', '203.190.11.116'),
(920, 220, 1, NULL, 1, 'Business Research Methods', 'business-research-methods', '8th ed.', '978-1439080672', NULL, 'Business, Research, Method', 'BUSINESS RESEARCH METHODS, 8E, examines a variety of research methods that can be utilized across business functions including marketing, finance, management, and accounting. The book superbly demonstrates how the practice of business research aids managers in making critical business decisions in our new digital age.', NULL, '2134428.JPG', '4026775.pdf', 1, 2009, 'U.S.A', 50, '2019-01-26 19:29:14', '2019-01-26 19:29:14', '203.190.11.115'),
