(922, 294, 1, NULL, 1, 'Investments', 'investments', 'NINTH EDITION', '978-0-07-353070-3', NULL, 'Investment', 'Investments, Ninth Edition, is intended primarily as a textbook for courses in investment analysis. Our guiding principle has been to present the material in a framework that is organized by a central core of consistent fundamental principles. We make every attempt to strip away unnecessary mathematical and technical detail, and we have concentrated on providing the intuition that may guide students and practitioners as they confront new ideas and challenges in their professional lives.', NULL, '5215958.JPG', '2728498.pdf', 1, 2011, 'New York', 50, '2019-01-26 19:32:57', '2019-01-26 19:32:57', '203.190.11.116'),
(923, 12, 1, NULL, 1, 'Handbook of Heating, Ventilation, and Air Conditioning', 'handbook-of-heating-ventilation-and-air-conditioning', NULL, '0-8493-9584-4', NULL, 'Heating, Ventilation, and Air Conditioning', 'Over the past 20 years, energy conservation imperatives, the use of computer based design aids, and major advances in intelligent management systems for buildings have transformed the design and operation of comfort systems for buildings. The \"rules of thumb\" used by designers in the1970s are no longer viable. Today, building systems engineers must have a strong analytical basis for design synthesis processes.', NULL, '2928232.jpg', '1410732.pdf', 1, 2001, 'New York', 51, '2019-01-26 19:37:14', '2019-01-26 19:37:14', '203.190.11.118'),
(924, 12, 1, NULL, 1, 'The Induction Machine Handbook', 'the-induction-machine-handbook', NULL, '0-8493-0004-5', NULL, 'Machine', 'Often called the workhorse of industry, the advent of power electronics and advances in digital control are transforming the induction motor into the racehorse of industrial motion control. Now, the classic texts on induction machines are nearly three decades old, while more recent books on electric motors lack the necessary depth and detail on induction machines.', NULL, '1284591.jpg', '6742333.pdf', 1, 2002, 'New York', 51, '2019-01-26 19:41:04', '2019-01-26 19:41:04', '203.190.11.115'),
