(932, 49, 1, NULL, 1, 'Fields and Communication Electronics', 'fields-and-communication-electronics', '3rd', '978-0-471-58551-0', NULL, 'Communication , Electronics', 'This book is an intermediate-level text on electromagnetic fields and waves. It represents a revision of the first two editions of the text, which in turn built upon an earlier volume by two of the authors.\" It assumes an introductory course in field concepts, which can be the lower-division physics count in many miler:5 or universities. and a background in calculus. Material on vectors, differential equations, Fourier analysis, and complex notation for sinusoidal is included in a form suitable for review or a first introduction. We have given such introductions wherever the material is to be used and have related them to real problems in fields and waves.', NULL, '3299295.JPG', '1859943.pdf', 1, 1994, 'Canada', 48, '2019-01-26 21:42:43', '2019-01-26 21:42:43', '203.190.10.204'),
(933, 10, 1, NULL, 1, 'Solid-State Lasers : A Graduate Text', 'solid-state-lasers-a-graduate-text', NULL, '0-387-95590-9', NULL, 'Solid-State , Lasers', 'This program of advanced texts covers a broad spectrum of topics that are of current and emerging interest in physics. Each book provides a comprehensive and yet accessible introduction to a field at the forefront of modern research. As such, these texts are intended for senior undergraduate and graduate students at the M.S. and PhD. levels; however, research scientists seeking an introduction to particular areas of physics will also benefit from the titles in this collection.', NULL, '8639092.JPG', '3470801.pdf', 1, 2003, 'New York', 48, '2019-01-26 21:48:26', '2019-01-26 21:48:26', '203.190.10.204'),
(934, 74, 1, NULL, 1, 'Standard Handbook of Machine Design', 'standard-handbook-of-machine-design', '3rd ed.', '0071441646', NULL, 'Machine Design', 'Machines evolve. Not biologically, of course, but they evolve nonetheless, from a fragment of an idea or dream to a fully functional mechanical marvelâ€”at least in the eyes of the designer. Machine design is one of the most rewarding activities to which a person can contribute; it is incredibly complex. For some designers, their unique and magical designs, or machine elements, have become a legacy for future generations', NULL, '9985423.jpg', '7180752.pdf', 1, 2004, 'New York', 51, '2019-01-26 21:50:26', '2019-01-26 21:50:26', '203.190.11.118'),
