(938, 49, 1, NULL, 1, 'Solar Engineering of Thermal Processes', 'solar-engineering-of-thermal-processes', '2nd', NULL, NULL, 'Solar Engineering , Thermal Processes', 'Solar Energy Thermal Processes. it quickly became evident that the years since 1974 had brought many significant developments in our knowledge of solar processes. What started out to be a second edition of the )974 book quickly grew into a new work, with new analysis and design tools, new insights into solar process operation, new industrial developments. and new ideas on how solar energy can be used. The result is a new book. substantially broader in scope and more detailed than the earlier one.', NULL, '2283219.JPG', '3679625.pdf', 1, 1974, 'New York', 48, '2019-01-26 22:13:59', '2019-01-26 22:13:59', '203.190.10.204'),
(939, 49, 1, NULL, 1, 'DIGITAL LOGIC TESTING AND SIMULATION', 'digital-logic-testing-and-simulation', '2nd ed.', '0-471-43995-9', NULL, 'DIGITAL LOGIC', 'About one and a half decades ago the state of the art in DRAMs was 64K bytes, a typical personal computer (PC) was implemented with about 60 to 100 dual in-line packages (DIPs), and the VAX11/780 was a favorite platform for electronic design automation (EDA) developers. It delivered computational power rated at about one MIP (million instructions per second), and several users frequently shared this machine through VT100 terminals', NULL, '3753790.JPG', '5087258.pdf', 1, 2003, 'New Jersey', 51, '2019-01-26 22:30:00', '2019-01-26 22:30:00', '203.190.11.116'),
(940, 57, 1, NULL, 1, 'Algebraic Topology', 'algebraic-topology', '1st', '978-0521795401', NULL, 'Algebraic , Topology', 'A book such as this one, whose aim is to present classical material from a rather classical viewpoint, is not the place to indulge in wild innovation. Nevertheless there is one new feature of the exposition that may be worth commenting upon, even though in the book as a whole it plays a relatively minor role. This is a modest extension of the classical notion of a simplicial complex that goes under the name of a âˆ† complex in this book. The idea is to allow different faces of a simplex to coincide, so only the interiors of simplistic are embedded and simplistic are no longer uniquely determined by their vertices.', NULL, '5928394.JPG', '7377294.pdf', 1, 2001, 'USA', 48, '2019-01-27 16:10:17', '2019-01-27 16:10:17', '203.190.10.204'),
(941, 355, 1, NULL, 1, 'Properties of Semiconductor Alloys: Group-IV, IIIâ€“V and IIâ€“VI Semiconductors', 'properties-of-semiconductor-alloys-group-iv-iiiv-and-iivi-semiconductors', '1st ed.', '978-0-470-74369-0', NULL, 'Properties, Semiconductor.', 'Semiconductor alloys provide a natural means of tuning the magnitude of the band-gap energy\r\nand other material properties so as to optimize and widen the application of semiconductor\r\ndevices. Current research and development in semiconductor alloys is focused on areas of\r\nimproved materials growth, development of unique materials characterization and suitable\r\nprocess technologies, fabrication of novel devices using artificially controlled materials\r\nstructures and better understanding of degradation mechanisms in electronic and optoelectronic devices for improved device reliability.', NULL, '3829525.JPG', '7702766.pdf', 1, 2009, 'U.K.', 47, '2019-01-27 16:17:16', '2019-01-27 16:17:16', '203.190.11.118'),
(942, 74, 1, NULL, 1, 'Signalling in the Circuit-Switched Network', 'signalling-in-the-circuit-switched-network', NULL, NULL, NULL, 'Signalling , Network', 'They use a circuit-switched network to communicate between them. The PSTN has been around for a long time, and its users are happy with it. People can talk to each other across oceans and still feel in proximity. Even in long distance calls between two mobile phones, it is possible to understand what the other person is saying relatively well.', NULL, '9863936.JPG', '1126793.pdf', 1, 2004, 'USA', 48, '2019-01-27 16:22:43', '2019-01-27 16:22:43', '203.190.10.204'),
(943, 10, 1, NULL, 1, 'Topology and Geometry in Physics', 'topology-and-geometry-in-physics-27291155', NULL, '3-540-23125-0', NULL, 'Topology , Physics', 'The concepts and methods of topology and geometry are an indispensable part of theoretical physics today. They have led to a deeper understanding of many crucial aspects in condensed matter physics, cosmology, gravity, and particle physics. Moreover, several intriguing connections between only apparently disconnected phenomena have been revealed based on these mathematical tools. Topological and geometrical considerations will continue to play a central role in theoretical physics. We have high hopes and expect new insights ranging from an understanding of high-temperature superconductivity up to future progress in the construction of quantum gravity', NULL, '3510656.JPG', '3062174.pdf', 1, 2005, 'Germany', 48, '2019-01-27 16:29:55', '2019-01-27 16:29:55', '203.190.10.204'),
(944, 30, 1, NULL, 1, 'Materials Thermodynamics', 'materials-thermodynamics', '1st ed.', '978-0470484142', NULL, 'Materials, Thermodynamics.', 'Materials Thermodynamics provides both students and professionals with the in-depth explanation they need to prepare for the real-world application of thermodynamic tools. Based upon an actual graduate course taught by the authors, this class-tested text covers the subject with a broader, more industry-oriented lens than can be found in any other resource available.', NULL, '9800552.JPG', '8749406.pdf', 1, 2010, 'U.K.', 47, '2019-01-27 16:33:24', '2019-01-27 16:33:24', '203.190.11.117'),
(945, 125, 1, NULL, 1, 'Modern Engineering Thermodynamics', 'modern-engineering-thermodynamics', NULL, '978-0123749963', NULL, 'Engineering, Thermodynamics.', 'This textbook is designed for use in a standard two-semester engineering thermodynamics course sequence, with the goal of helping students develop engineering problem solving skills through the use of structured problem-solving techniques. The first half of the text contains material suitable for a basic Thermodynamics course taken by engineers from all majors. The second half of the text is suitable for an Applied Thermodynamics course in mechanical engineering programs. The Second Law of Thermodynamics is introduced through a basic entropy concept, providing students a more intuitive understanding of this key course topic.', NULL, '7446419.jpg', '2649945.pdf', 1, 2011, 'New York', 47, '2019-01-27 16:48:14', '2019-01-27 16:48:14', '203.190.11.118');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(946, 356, 1, NULL, 1, 'The Road to Reality : A complete Guide to the Laws of the Universe', 'the-road-to-reality-a-complete-guide-to-the-laws-of-the-universe', NULL, '0â€“224â€“04447â€“8', NULL, 'Laws , complete Guide', 'The purpose of this book is to convey to the reader some feeling for what is surely one of the most important and exciting voyages of discovery that humanity has embarked upon. This is the search for the underlying principles that govern the behavior of our universe. It is a voyage that has lasted for more than two-and-a-half millennia, so it should not surprise us that substantial progress has at last been made. But this journey has proved to be a profoundly difficult one, and real understanding has, for the most part, come but slowly.', NULL, '2955801.JPG', '8399351.pdf', 1, 2004, 'London', 48, '2019-01-27 16:48:53', '2019-01-27 16:48:53', '203.190.10.204'),
(947, 125, 1, NULL, 1, 'Engineering Digital Design', 'engineering-digital-design-27001255', '2nd', '0-12-691295-5', NULL, 'Digital Design , Engineering', 'This text emphasizes the successful engineering design of digital devices and machines from first principles. A special effort has been made not to \"throw\" logic circuits at the reader so that questions remain as to how the circuits came about or whether or not they will function correctly. An understanding of the intricacies of digital circuit design, particularly in the area of sequential machines, is given the highest priorityâ€”the emphasis is on error-free operation. From an engineering point of view, the design of a digital device or machine is of little or no value unless it performs the intended operation(s) correctly and reliably.', NULL, '9949850.JPG', '9472218.pdf', 1, 2000, 'New York', 48, '2019-01-27 17:00:55', '2019-01-27 17:00:55', '203.190.10.204'),
(948, 64, 1, NULL, 1, 'The Great Telecom Meltdown', 'the-great-telecom-meltdown', NULL, '1-58053-939-4', NULL, 'Telecom , Meltdown', 'The economic boom of the late 1990s included huge investments in the telecommunications industry and related sectors. It was followed by a downturn of unusual severity, which reduced total paper wealth by trillions of dollars, cost\r\nmany thousands of jobs, and saw some of the biggest bankruptcies in history. While there certainly was a general business cycle at work, the downturn in telecom was not just a cyclical correction, itself a healthy event that routinely shakes out the weakest players.', NULL, '3691829.JPG', '1852234.pdf', 1, 2005, 'Norwood', 48, '2019-01-27 17:06:58', '2019-01-27 17:06:58', '203.190.10.204'),
(949, 10, 1, NULL, 1, 'Springer Handbook of Electronic and Photonic Materials', 'springer-handbook-of-electronic-and-photonic-materials', '2nd ed.', '978-3319489315', NULL, 'Handbook, Electronic, Photonic.', 'The second, updated edition of this essential reference book provides a wealth of detail on a wide range of electronic and photonic materials, starting from fundamentals and building up to advanced topics and applications. Its extensive coverage, with clear illustrations and applications, carefully selected chapter sequencing and logical flow, makes it very different from other electronic materials handbooks. It has been written by professionals in the field and instructors who teach the subject at a university or in corporate laboratories.', NULL, '1957914.jpg', '4325228.pdf', 1, 2017, 'Canada', 47, '2019-01-27 17:14:30', '2019-01-27 17:14:30', '203.190.11.117'),
(950, 357, 1, NULL, 1, 'The Third Branch of Physics : Essays on Scientific Computing', 'the-third-branch-of-physics-essays-on-scientific-computing', NULL, NULL, NULL, 'Scientific , Computing', 'Fundamental scientific discoveries have been made with the help of computational methods and, undoubtedly, more are to come. For example, commonalities (universality) in the behavior of chaotic systems had not been discovered or understood without computers. Only with numerical computations is it possible predict the mass of the proton so accurately that fundamental theories of matter can be put to test. And numeric s is not only used to determine the binding between atoms and molecules, but has also led to new quantum-mechanical methods that revolutionized chemistry and materials science', NULL, '4952530.JPG', '5810528.pdf', 1, 2005, 'USA', 48, '2019-01-27 17:28:00', '2019-01-27 17:28:00', '203.190.10.204'),
(951, 52, 1, NULL, 1, 'The Intel Microprocessors', 'the-intel-microprocessors', '8th', '978â€“0â€“13â€“502645â€“8', NULL, 'Intel , Microprocessors', 'Develop software to control an application interface microprocessor. Generally, the software developed will also function on all versions of the microprocessor. This software also includes DOS-based and Windows-based applications. The main emphasis is on developing inline assembly and C++ mixed language programs in the Windows environment.Program using MFC controls, handlers, and functions to use the keyboard, video display system, and disk memory in assembly language and C++.Develop software that uses macro sequences, procedures, conditional assembly, and flow control assembler directives that are linked to a Visual C++ program.Develop software for code conversions using lookup tables and algorithms.', NULL, '6640696.JPG', '1797553.pdf', 1, 2009, 'new jersey', 48, '2019-01-27 17:37:43', '2019-01-27 17:37:43', '203.190.10.204'),
(952, 12, 1, NULL, 1, 'Optical Communication Networks', 'optical-communication-networks', NULL, '0-8493-1333-3', NULL, 'Optical , Communication Networks', 'This book contains information obtained from authentic and highly regarded sources. Reprinted material is quoted with permission, and sources are indicated. A wide variety of references are listed. Reasonable efforts have been made to publish reliable data and information, but the author and the publisher cannot assume responsibility for the validity of all materials or for the consequences of their use.', NULL, '2594412.JPG', '8402283.pdf', 1, 2003, 'New York', 48, '2019-01-27 17:43:54', '2019-01-27 17:43:54', '203.190.10.204'),
(953, 49, 1, NULL, 1, 'Engineering Thermodynamics', 'engineering-thermodynamics', '7th Edi.', '978-0-470-04192-5', NULL, 'Engineering, Thermodynamics.', 'We have deliberately directed our presentation to students. New concepts and definitions are presented in the context where they are first relevant in a natural progression. The\r\nfirst thermodynamic properties to be defined (Chapter 2) are those that can be readily measured: pressure, specific volume, and temperature. In Chapter 3, tables of thermodynamic\r\nproperties are introduced, but only in regard to these measurable properties. Internal energy\r\nand enthalpy are introduced in connection with the first law, entropy with the second law,\r\nand the Helmholtz and Gibbs functions in the chapter on thermodynamic relations. Many\r\nreal world realistic examples have been included in the book to assist the student in gaining\r\nan understanding of thermodynamics, and the problems at the end of each chapter have\r\nbeen carefully sequenced to correlate with the subject matter, and are grouped and identified as such', NULL, '/tmp/phpj87se1', '8207149.pdf', 1, 2009, NULL, 47, '2019-01-27 17:43:58', '2019-01-27 17:44:43', '203.190.11.116'),
(954, 10, 1, NULL, 1, 'The Nonlinear Schrodinger equation : Self-Focusing and Wave Collapse', 'the-nonlinear-schrodinger-equation-self-focusing-and-wave-collapse', NULL, '0-387-98611-1', NULL, 'Nonlinear , Wave Collapse', 'The nonlinear Schrodinger (NLS) equation provides a canonical description for the envelope dynamics of a quasi-monochromatic plane wave (the carrying wave) propagating in a weakly nonlinear dispersion medium when dissipative processes are negligible. On short times and small propagation distances, the dynamics are linear, but cumulative nonlinear interactions result in a significant modulation of the wave amplitude on large spatial and temporal scales. The NLS equation expresses how the linear dispersion relation is affected by the thickening of the spectral lines associated to the modulation and the resonant nonlinear interactions.', NULL, '9887322.JPG', '7649261.pdf', 1, 1999, 'New York', 48, '2019-01-27 17:57:26', '2019-01-27 17:57:26', '203.190.10.204'),
(955, 358, 1, NULL, 1, 'Fundamentals of Semiconductor Manufacturing and Process Control', 'fundamentals-of-semiconductor-manufacturing-and-process-control-27051332', '1st ed.', '978-0471784067', NULL, 'Fundamentals, Semiconductor, Manufacture.', 'Fundamentals of Semiconductor Manufacturing and Process Control covers all issues involved in manufacturing microelectronic devices and circuits, including fabrication sequences, process control, experimental design, process modeling, yield modeling, and CIM/CAM systems. Readers are introduced to both the theory and practice of all basic manufacturing concepts. Following an overview of manufacturing and technology, the text explores process monitoring methods, including those that focus on product wafers and those that focus on the equipment used to produce wafers. Next, the text sets forth some fundamentals of statistics and yield modeling, which set the foundation for a detailed discussion of how statistical process control is used to analyze quality and improve yields.', NULL, '5006876.jpg', '5864500.pdf', 1, 2006, 'Canada', 47, '2019-01-27 18:05:32', '2019-01-27 18:05:32', '203.190.11.117'),
(956, 107, 1, NULL, 1, 'The Mathematical Beauty of Physics', 'the-mathematical-beauty-of-physics', NULL, '9810228074', NULL, 'Mathematical , Physics', 'consider generalizations of ensembles of random matrices in which the Hamil-tonian H is the stun of a deterministic part Ho and of a Gaussian random potential V. The standard methods of the theory of random matrices, such as the method of orthogonal polynomials, are not available for such cases. We first analyse the density of levels; then the level correlations and verify that, at short distance, they are independent of the spectrum of Ho. This is another aspect of the universality discussed by Dyson (for zero Ho) who conjectured that these correlations were independent of the probability distribution of V.', NULL, '1259092.JPG', '7679019.pdf', 1, 1997, 'new jersey', 48, '2019-01-27 18:13:38', '2019-01-27 18:13:38', '203.190.10.204'),
(957, 130, 1, NULL, 1, 'Op AMPS : Design, Application, and Troubleshooting', 'op-amps-design-application-and-troubleshooting', '2nd', '0-7506-9702-4', NULL, 'Design , Application', 'Theory of operation. A discussion that describes what the circuit does, explains why it behaves the way it does, and identifies the purpose of each component. This section contains no mathematics, promotes an intuitive understanding of circuit operation, and is based on an application of basic electronics principles such as series and parallel circuits, Ohm\'s Law, Kirchhoff\'s Laws, and so on.Numerical analysis. Techniques are presented that allow calculation of most\r\nkey circuit parameters for an existing op amp circuit design.', NULL, '8452972.JPG', '8974441.pdf', 1, 1996, 'Boston', 48, '2019-01-27 18:25:32', '2019-01-27 18:25:32', '203.190.10.204'),
(958, 74, 1, NULL, 1, 'The Fourier Transform and it;s Applications', 'the-fourier-transform-and-its-applications', '3rd', '0-07-303938-1', NULL, 'Fourier Transform , Applications', 'Transform methods provide a unifying mathematical approach to the study of electrical networks, devices for energy conversion and control, antennas, and other encampment of electrical cyctomc, at well as to complete linear systems and to many other physical systems and devices, whether electrical or not. These same methods apply equally to the subjects of electrical communication by wire or op-Heal fihor, to wireless radio propagation, and to ionized mediaâ€”which are all con-cerned with the interconnection of electrical systemsâ€”and to information theory which, among other things, relates to the acquisition, processing, and presentation of data.', NULL, '2309294.JPG', '1802976.pdf', 1, 2000, 'Boston', 48, '2019-01-27 18:32:48', '2019-01-27 18:32:48', '203.190.10.204'),
(959, 74, 1, NULL, 1, 'Tab Electronics Guide to Understanding Electricity and Electronics', 'tab-electronics-guide-to-understanding-electricity-and-electronics', '2nd', '0-07-138665-3', NULL, 'Electronics , Electricity', 'Nonsegregated electrical and/or electronic career opportunities are com-mon in most industrial manufacturing facilities The majority of electrical maintenance personnel I have trained over the years have had little or no formal classroom training in the electrical or electronics fields Within the industrial manufacturing community, any prior experience in this area (even at the hobbyist level) is usually given weighty consideration in hiring and job promotions', NULL, '8244447.JPG', '3275843.pdf', 1, 2000, 'New York', 48, '2019-01-27 19:53:43', '2019-01-27 19:53:43', '203.190.10.204'),
(960, 12, 1, NULL, 1, 'The Telecommunications Illustrated Dictionary', 'the-telecommunications-illustrated-dictionary', '2nd', '0-8493-1173-X', NULL, 'Telecommunications , Illustrated', 'This book contains information obtained from authentic and highly regarded sources. Reprinted material is quoted with permission, and sources are indicated. A wide variety of references are listed. Reasonable efforts have been made to publish reliable data and information, but the authors and the publisher cannot assume responsibility for the validity of all materials or for the consequences of their use.', NULL, '2510897.JPG', '9146035.pdf', 1, 2002, 'New York', 48, '2019-01-27 20:00:25', '2019-01-27 20:00:25', '203.190.10.204'),
(961, 359, 1, NULL, 1, 'Introduction to Tensor Calculus and Continuum Mechanics', 'introduction-to-tensor-calculus-and-continuum-mechanics', NULL, NULL, NULL, 'Tensor Calculus , Continuum Mechanics', 'This is an introductory text which presents fundamental concepts from the subject areas of tensor calculus, differential geometry and continuum mechanics. The material presented is suitable for a two semester course in applied mathematics and is flexible enough to be presented to either upper level undergraduate or beginning graduate students majoring in applied mathematics, engineering or physics. The presentation assumes the students have some knowledge from the areas of matrix theory, linear algebra and advanced calculus. Each section includes many illustrative worked examples.', NULL, '3733086.JPG', '9208295.pdf', 1, 1996, 'USA', 48, '2019-01-27 20:07:44', '2019-01-27 20:07:44', '203.190.10.204'),
(962, 12, 1, NULL, 1, 'Supervised and Unsupervised Pattern Recognition : Feature Extraction and Computational', 'supervised-and-unsupervised-pattern-recognition-feature-extraction-and-computational', NULL, '0-8493-2278-2', NULL, 'Pattern Recognition , Pattern', 'This book contains information obtained from authentic and highly regarded sources. Reprinted material is quoted with permission, and sources are indicated. A wide variety of references are listed. Reasonable efforts have been made to publish reliable data and information, but the author and the publisher cannot assume responsibility for the validity of all materials or for the consequences of their use.', NULL, '5585234.JPG', '1201557.pdf', 1, 2000, 'New York', 48, '2019-01-27 20:49:58', '2019-01-27 20:49:58', '203.190.10.204'),
(963, 152, 1, NULL, 1, 'Systems, Controls, Embedded Systems, Energy, and Machines', 'systems-controls-embedded-systems-energy-and-machines', '3rd', '978-0-8493-7347-3', NULL, 'Systems , Embedded Systems', 'This book contains information obtained from authentic and highly regarded sources. Reprinted material is quoted with permission, and sources are indicated. A wide variety of references are listed. Reasonable efforts have been made to publish reliable data and information, but the author and the publisher cannot assume responsibility for the validity of all materials or for the consequences of their use.', NULL, '1980924.JPG', '4292764.pdf', 1, 2006, 'USA', 48, '2019-01-27 20:54:56', '2019-01-27 20:54:56', '203.190.10.204'),
(964, 360, 1, NULL, 1, 'Synthesis and Optimization of DSP Algorithms : George A. Constantinides, Peter Y.K. Cheung and Wayne Luk', 'synthesis-and-optimization-of-dsp-algorithms-george-a-constantinides-peter-yk-cheung-and-wayne-luk', NULL, '1-4020-7931-1', NULL, 'Synthesis , Optimization', 'Digital signal processing (DSP) has undergone an immense expansion since the foundations of the subject were laid in the 1970s. New application areas have arisen, and DSP technology is now essential to a bewildering array of fields such as computer vision, instrumentation and control, data compression, speech recognition and synthesis, digital audio and cameras, mobile telephony, echo cancellation, and even active suspension in the automotive industry.', NULL, '8759549.JPG', '8975374.pdf', 1, 2004, 'New York', 48, '2019-01-27 21:03:15', '2019-01-27 21:03:15', '203.190.10.204'),
(965, 361, 1, NULL, 1, 'Supersymmetry in Quantum and Classical Mechanics', 'supersymmetry-in-quantum-and-classical-mechanics', NULL, '1-58488-197-6', NULL, 'Supersymmetry , Quantum', 'This monograph summarizes the major developments that have taken place in supersymmetric quantum and classical mechanics over the past 15 years or so. Following Wittenâ€™s construction of a quantum mechanical scheme in which all the keyingredients of supersymmetryare present, supersymmetric quantum mechanics has become a discipline of research in its own right. Indeed a glance at the literature on this subject will reveal that the progress has been dramatic.', NULL, '8782443.JPG', '6735027.pdf', 1, 2001, 'New York', 48, '2019-01-27 21:21:40', '2019-01-27 21:21:40', '203.190.10.204'),
(966, 61, 1, NULL, 1, 'Microeconomics', 'microeconomics', '10th', '10: 0-13-139425-8', NULL, 'Economics of the environment, Markets for factors of production, Economic inequality, Government actions in markets', 'Simpler where possible, stripped of some technical\r\ndetail, more copiously illustrated with well-chosen\r\nphotographs, reinforced with improved chapter summaries\r\nand problem sets, and even more tightly integrated\r\nwith MyEconLab: These are the hallmarks of\r\nthis tenth edition of Microeconomics.\r\nThis comprehensive revision also incorporates\r\nand responds to the detailed suggestions for improvements\r\nmade by reviewers and users, both in the\r\nbroad architecture of the text and each chapter.\r\nThe revision builds on the improvements\r\nachieved in previous editions and retains its thorough\r\nand detailed presentation of the principles of economics,\r\nits emphasis on real-world examples and\r\napplications, its development of critical thinking\r\nskills, its diagrams renowned for pedagogy and precision,\r\nand its path-breaking technology.', NULL, '/tmp/phpOJQVuV', '3821637.pdf', 1, 2010, 'New York', 37, '2019-01-27 21:28:30', '2019-01-27 21:32:33', '203.190.11.194'),
(967, 49, 1, NULL, 1, 'Physics of Semiconductor Devices', 'physics-of-semiconductor-devices-27401641', '2nd', '9780471098379', NULL, 'Semiconductor , Physics', 'The physics of semiconductor devices is naturally dependent on the physics of semiconductors themselves. This chapter presents a summary of the physics and properties of semiconductors. It represents only a small cross section of the vast literature on semiconductors; only those subjects pertinent to device operations are included here.', NULL, '1120619.JPG', '9408122.pdf', 1, 1981, 'New York', 48, '2019-01-27 21:40:41', '2019-01-27 21:40:41', '203.190.10.204'),
(968, 10, 1, NULL, 1, 'Statistics', 'statistics', NULL, '3-540-96871-7', NULL, 'Statistics', 'Experiments are performed in three general steps: first, the experiment must be designed; second, the data must be gathered; and third, the data must be analyzed. These three steps are highly idealized, and no clear boundary exists between them. The problem of analyzing the data is one that should be faced early in the design phase. Gathering the data in such away as to learn the most about a phenomenon is what doing an experiment is all about. It will do an experimenter little good to obtain a set of data that does not bear directly on the model, or hypotheses, to be tested.', NULL, '3077390.JPG', '9326666.pdf', 1, 1988, 'Germany', 48, '2019-01-29 15:02:26', '2019-01-29 15:02:26', '203.190.10.204'),
(969, 74, 1, NULL, 1, 'Numerical Methods for Engineers', 'numerical-methods-for-engineers', '6th', '978â€“0â€“07â€“340106â€“5', NULL, 'Numerical , Methods', 'To provide insight into numerical methods, we have organized the text into parts and present unifying information through the Motivation, Mathematical background, Orientation and Epilogue elements.Every chapter contains new and revised homework problems. Eighty percent of the problems are new or revised. Challenging problems drawn from all engineering disciplines are included in the text.', NULL, '4886194.JPG', '8766180.pdf', 1, 2010, 'Boston', 48, '2019-01-29 15:14:49', '2019-01-29 15:14:49', '203.190.10.204'),
(970, 362, 1, NULL, 1, 'Steam Steel and Electricity', 'steam-steel-and-electricity', NULL, '978-1409963028', NULL, 'Electricity , Steam', 'The greatest of these facts of the present civilization are expressed in the phrase, Steam and Steel. The theme is stupendous. Only the most prominent of its facts can be given in small space, and those only in outline. The subject is also old, yet to every boy it must be told again, and the most ordinary intelligence must have some desire to know the secrets, if such they are, of that which is unquestionably the greatest force that ever yielded to the audacity of humanity. It is now of little avail to know that all the records that men revere, all the great epics of the world, were written in the absence of the characteristic forces of modern life.', NULL, '6047367.JPG', '3112144.pdf', 1, 2009, 'USA', 48, '2019-01-29 15:35:21', '2019-01-29 15:35:21', '203.190.10.204'),
(971, 64, 1, NULL, 1, 'Statistical and Adaptive Signal Processing', 'statistical-and-adaptive-signal-processing', NULL, '1-58053-610-7', NULL, 'Statistical , Signal Processing', 'This book is an introduction to the theory and algorithms used for the analysis and processing of random signals and their applications to real-world problems. The fundamental characteristic of random signals is captured in the following statement: Although random signals are evolving in time in an unpredictable manner, their average statistical properties exhibit considerable regularity. This provides the ground for the description of random signals using statistical averages instead of explicit equations.', NULL, '1731181.JPG', '1308598.pdf', 1, 2005, 'Norwood', 48, '2019-01-29 15:43:33', '2019-01-29 15:43:33', '203.190.10.204'),
(972, 106, 1, NULL, 1, 'Speech Separation By Humans and Machines', 'speech-separation-by-humans-and-machines', NULL, '0-387-22794-6', NULL, 'Speech Separation , Machines', 'The application of this lesson about general-purpose versus specialized computation to auditory scene analysis by computer leads to the conclusion that we should use general methods, resembling those of humans, when the situation is unrestricted â€“ for example when both a robotic listener and a number of sound sources can move around, when the sound may be coming around a corner, when the component sounds may not be periodic, when substantial amounts of echo and reverberation exist, when objects can pass in front of the listener casting acoustic shadows, and so on.', NULL, '5231795.JPG', '1894372.pdf', 1, 2005, 'New York', 48, '2019-01-29 15:49:31', '2019-01-29 15:49:31', '203.190.10.204'),
(973, 329, 1, NULL, 1, 'Speech Coding Algorithms : Foundation and Evolution of Standardized Coders', 'speech-coding-algorithms-foundation-and-evolution-of-standardized-coders', NULL, '0-471-37312-5', NULL, 'Speech Coding , Algorithms', 'Speech Coding Algorithms reflects the core subject of the book, since most coding techniques are implemented as algorithms, or computational procedures performed by a processor. However, this is by no means an exhaustive documentation of all methods developed in this field; it is rather the study of the most successful techniques, defined as those incorporated in a standard. By doing so we concentrate our effort on understanding the most influential ideas, which is a rather efficient manner to navigate this vast territory of knowledge.', NULL, '1440581.JPG', '7597825.pdf', 1, 2003, 'Canada', 48, '2019-01-29 15:57:19', '2019-01-29 15:57:19', '203.190.10.204'),
(974, 72, 1, NULL, 1, 'Staring Electronics', 'staring-electronics', '3rd', '07506 63863', NULL, 'Staring , Electronics', 'This book originated as a collection of feature articles, previously published as magazine articles. They were chosen for publication in book form not only because they were so popular with readers in their original magazine appearances but also because they are so relevant in the field of introductory electronics â€” a subject area in which\r\nit is evermore difficult to find information of a technical, knowledgeable, yet understandable nature. This book is exactly that.', NULL, '4418072.JPG', '1713068.pdf', 1, 2005, 'Tokyo', 48, '2019-01-29 16:09:33', '2019-01-29 16:09:33', '203.190.10.204'),
(975, 95, 1, NULL, 1, 'Statistics and Dynamics', 'statistics-and-dynamics', NULL, NULL, NULL, 'Statistics , Dynamics', 'This is a statics and dynamics text for second or third year engineering students with an emphasis on vectors, free body diagrams, the basic momentum balance principles, and the utility of computation. Students often start a course like this thinking of mechanics reasoning as being vague and complicated. Our aim is to replace this loose thinking with concrete and simple mechanics problem-solving skills that live harmoniously with a useful mechanical intuition.', NULL, '2009541.JPG', '1191693.pdf', 1, 2001, 'USA', 48, '2019-01-29 16:22:29', '2019-01-29 16:22:29', '203.190.10.204'),
(976, 49, 1, NULL, 1, 'Fundamentals of probability and Statistics for Engineers', 'fundamentals-of-probability-and-statistics-for-engineers-29501108', NULL, '0-470-86814-7', NULL, 'probability , Statistics', 'As an introductory course, a sound and rigorous treatment of the basic principles is imperative for a proper understanding of the subject matter and for confidence in applying these principles to practical problem solving. A student, depending upon his or her major field of study, will no doubt pursue advanced work in this area in one or more of the many possible directions. H ow well is he or she prepared to do this strongly depends on his or her mastery of the fundamentals.', NULL, '8034088.JPG', '8788245.pdf', 1, 2004, 'New York', 48, '2019-01-29 16:50:08', '2019-01-29 16:50:08', '203.190.10.204'),
(977, 64, 1, NULL, 1, 'Spectrum Wars : The Policy and Technology Debate', 'spectrum-wars-the-policy-and-technology-debate', NULL, '1-58053-483-x', NULL, 'Spectrum , Technology Debate', 'There are many potential reasons for this decline in the telecommunications industry, including the blame of its own players for over-zealousness in expansion and profit making, as will be discussed in Chapter 9 of this book. However, whatever the reasons, what is clear is that the telecommunications industry, although caught in a retrenchment, will rebuild itself, albeit in a different manner and will reemerge as a vibrant sector. This includes the wireless telecommunications industry that is in the midst of reshaping and retrenching itself to reflect the realities of doing business in the twenty-first century', NULL, '6933364.JPG', '8943630.pdf', 1, 2003, 'Boston', 48, '2019-01-29 16:56:02', '2019-01-29 16:56:02', '203.190.10.204'),
(978, 363, 1, NULL, 1, 'Space-Time Processing and Equalization for Wireless Communications', 'space-time-processing-and-equalization-for-wireless-communications', NULL, '91-506-1350-2', NULL, 'Space-Time Processing , Equalization', 'In this thesis several aspects of space-time processing and equalization for wireless communications are treated. We discuss several di
erent methods of improving estimates of space-time channels, such as temporal parametrization, spatial parametrization, reduced rank channel estimation, bootstrap channel estimation, and joint estimation of an FIR channel and an AR noise model. In wireless communication the signal is often sub ject to intersymbol interference as well as interference from other users', NULL, '5248145.JPG', '2582275.pdf', 1, 1999, 'USA', 48, '2019-01-29 17:05:20', '2019-01-29 17:05:20', '203.190.10.204'),
(979, 74, 1, NULL, 1, 'Electronic Materials and Devices', 'electronic-materials-and-devices-29321247', '2nd', NULL, NULL, 'Electronic Materials , Devices', 'This particular transverse phase modulator has the field applied along the y-direction and light traveling along the z-direction as in Figure 9Q16-1. If we were to use the transverse arrangement in which the field is applied along the z-axis, and the light travels along the y-axis, the relevant Pockets coefficients would be greater and the corresponding aspect ratio d/L would be ~ 5 Ã— 10-2. We cannot arbitrarily set d/L to any ratio we like for the simple reason that when d becomes too small, the light will suffer diffraction effects that will prevent it from passing through the device. d/L ratios 10-3 - 10-2 in practice can be implemented by fabricating an integrated optical device.', NULL, '8758129.JPG', '6963157.pdf', 1, 2001, 'New York', 48, '2019-01-29 17:32:47', '2019-01-29 17:32:47', '203.190.10.204'),
(980, 52, 1, NULL, 1, 'Solutions Manual to Accompany : Fiber Optic Communications', 'solutions-manual-to-accompany-fiber-optic-communications', '5th', '0-13-186095-X', NULL, 'Solutions Manual , Fiber Optic', 'Fiber optics lends itself wonderfully well to laboratory work. Since different schools and different instructors have different resources and different budgets. no single set of detailed experiments can satisfy all requirements. This is not a laboratory manual, so the discussion of experiments will be brief What I will do is describe the type of experiments you may wish to pursue.', NULL, '6040266.JPG', '4701204.pdf', 1, 2005, 'New Jersey', 48, '2019-01-29 19:56:37', '2019-01-29 19:56:37', '203.190.10.204'),
(981, 364, 1, NULL, 1, 'Some Design Aspects on RF CMOS LNAs and Mixers', 'some-design-aspects-on-rf-cmos-lnas-and-mixers', NULL, NULL, NULL, 'Design , RF CMOS LNAs', 'A tuned RF front-end amplifier in CMOS with an operating frequency around 1.8 to 2GHz has been investigated. A symmetric design has been used to improve linearity with preserved power consumption. In this case it has been a parallel connection of complementary devices. The symmetric solution allows the use of inductor pairs in transformer configuration to improve the gain of the circuit.', NULL, '2218282.JPG', '4854935.pdf', 1, 2001, 'Sweden', 48, '2019-01-29 20:15:33', '2019-01-29 20:15:33', '203.190.10.204'),
(982, 365, 1, NULL, 1, 'Optical Networks : A Practical Perspective', 'optical-networks-a-practical-perspective-29231552', '3rd', NULL, NULL, 'Optical , Networks', 'In many cases, the problems in the book require further exploration of the topics in detail as opposed to simply plugging numbers into equations. Instructors may therefore want to review the solutions before assigning problems. See the bookâ€™s web page http://www.elsevierdirect.com/9780123740922 for the current errata of the book, as well as this solutions manual. If you discover an error that is not listed there, we would very much appreciate your letting us know about it. You can email rajivramaswami@ieee.org, or kumar@tejasnetworks.com or galens@hawaii.edu.', NULL, '5303369.JPG', '6829087.pdf', 1, 2009, 'USA', 48, '2019-01-29 20:23:52', '2019-01-29 20:23:52', '203.190.10.204'),
(983, 366, 1, NULL, 1, 'Feedback Control of Dynamic Systems', 'feedback-control-of-dynamic-systems', '6th', '978-0136019695', NULL, 'Dynamic Systems , Feedback Control', 'Needs to know about feedback control, including concepts like stability, tracking, and robustness. Each chapter presents the fundamentals along with worked-out examples, all within a real-world context and with a historical background. The text also ties methods together so that a designer is able to pick the method that best fits the problem at hand. Cases featuring actual control problems are included. The new edition has been updated to include the latest developments in the field.', NULL, '1235621.JPG', '3185848.pdf', 1, 2009, 'USA', 48, '2019-01-29 21:09:10', '2019-01-29 21:09:10', '203.190.10.204'),
(984, 10, 1, NULL, 1, 'Mechanics and Strength of Materials', 'mechanics-and-strength-of-materials-29531601', NULL, '978-3-540-25131-6', NULL, 'Mechanics , Materials', 'The Mechanics of Materials is described in the first four chapters. The first chapter has an introductory character and explains fundamental physical notions, such as continuity and theological behavior. It also explains why the topics that compose Solid Continuum Mechanics are divided into three chapters: the stress theory, the strain theory and the constitutive law. The second chapter contains the stress theory. This theory is expounded almost exclusively by exploring the balance conditions inside the body, gradually introducing the mathematical notion of tensor.', NULL, '4230908.JPG', '3525227.pdf', 1, 2006, 'New York', 48, '2019-01-29 21:53:01', '2019-01-29 21:53:01', '203.190.10.204'),
(985, 245, 1, NULL, 1, 'Dimensioning and Tolerancing Handbook', 'dimensioning-and-tolerancing-handbook', '1st ed.', '978-0070181311', NULL, 'Dimension, Tolerancing, Handbook.', 'This book tries to capture the major topics that fall under the umbrella of \"Variation Management.\" The book is laid out so that the reader can easily understand the variation management process and how each chapter maps to this process. This book has two purposes. It is a\"one-step\" resource for people who want to know everything about dimensional management and variation management. It is a useful reference for specific target audiences within the variation management process. This book includes many new techniques, methodologies, and examples that have never been published before. Much of the new material revolves around Six Sigma techniques that have evolved within the past 5 years. This book offers high level information and expertise to a broad spectrum of readers, while providing detailed information for those needing specific information.', NULL, '7492636.jpg', '4590569.pdf', 1, 1999, 'New York', 47, '2019-01-29 22:29:01', '2019-01-29 22:29:01', '203.190.11.118'),
(986, 367, 1, NULL, 1, 'The', 'the', NULL, '0-8144-7240-0', NULL, 'Disaster, Recovery, Handbook, Business, Continuity, Facilities, and Assets', 'This publication is designed to provide accurate and authoritative information in regard to the subject matter covered. It is sold with the understanding that the publisher is not engaged in rendering legal, accounting, or other professional service. If legal advice or other expert assistance is required, the services of a competent professional person should be sought.', NULL, '9269175.JPG', '8053219.pdf', 1, 2004, 'New York', 47, '2019-01-29 22:43:09', '2019-01-29 22:43:09', '203.190.11.118'),
(987, 74, 1, NULL, 1, 'Chemical and Process Design Handbook', 'chemical-and-process-design-handbook', NULL, '0-07-137433-7', NULL, 'Chemical, Handbook.', 'This book emphasizes chemical conversions, which may be defined as chemical reactions applied to industrial processing. The basic chemistry will be set forth along with easy-to-understand descriptions, since the nature of the chemical reaction will be emphasized in order to assist in the understanding of reactor type and design. An outline is presented\r\nof the production of a range of chemicals from starting materials into useful products.', NULL, '8826319.JPG', '9666971.pdf', 1, 2002, 'New York', 47, '2019-01-29 23:02:00', '2019-01-29 23:02:00', '203.190.11.118'),
(988, 12, 1, NULL, 1, 'Industrial Power System', 'industrial-power-system-29021810', NULL, '978â€‘0â€‘8247â€‘2443â€‘6', NULL, 'Power System', 'This book was inspired by power systems courses developed and taught by my father for IEEE Continuing Education (Montreal) over several years. It was intended to respond to what he felt was a need in the field for an engineering/design guide for all working engineers, particularly younger ones who are not exposed to power systems during their undergraduate studies and who may not get guidance or training at their work place. It was an idea which was enthusiastically supported and encouraged by members of IEEE Continuing Education (Montreal), the not-for-profit engineering education organization my father collaborated with for over thirty years.', NULL, '7586723.JPG', '5433922.pdf', 1, 2008, 'New York', 51, '2019-01-29 23:02:10', '2019-01-29 23:02:10', '203.190.11.118'),
(989, 177, 1, NULL, 1, 'Fundamentals of Instrumentation and Measurement', 'fundamentals-of-instrumentation-and-measurement-29051818', NULL, '978-1-905209-39-2', NULL, 'Instrumentation and Measurement', 'Instrumentation comprises scientific activities and technologies that are related\r\nto measurement. It is a link between physical, chemical and biological phenomena and their perception by humans. Constantly evolving, instrumentation changes how we live and plays a major role in industrial and life sciences; it is also indispensable to the fundamental sciences. In order to be credible, all new theories must undergo a series of experimental validations, of which instrumentation is the cornerstone.', NULL, '8556326.JPG', '5013335.pdf', 1, 2007, 'U.S.A', 51, '2019-01-29 23:05:18', '2019-01-29 23:05:18', '203.190.11.118'),
(990, 368, 1, NULL, 1, 'Polymer Data Handbook', 'polymer-data-handbook', NULL, '978-0195107890', NULL, 'Polymer.Polymer Data, Handbook.', 'Polymers are the compounds that includes platics, artificial fibers, rubber, cellulose, and many other materials, including coatings and adhesives. This book presents key data on approximately 200 important polymers currently in industrial use or under study in industrial or academic research. No other single source covers so many polymers or offers such a depth of data. The book standardizes and makes accessible a wealth of essential data for students, teachers, researchers, and other professionals in chemistry and chemical engineering.', NULL, '6553128.jpg', '2773918.pdf', 1, 1999, 'England', 47, '2019-01-29 23:09:25', '2019-01-29 23:09:25', '203.190.11.118'),
(991, 74, 1, NULL, 1, 'Instrumental Instruments for Measurement and Control', 'instrumental-instruments-for-measurement-and-control', '3rd ed.', NULL, NULL, NULL, NULL, NULL, '/tmp/phpOOQ52n', '4221472.pdf', 1, 1941, NULL, 51, '2019-01-29 23:11:52', '2019-01-29 23:17:21', '203.190.11.118'),
(992, 369, 1, NULL, 1, 'Instrumentation Reference Book', 'instrumentation-reference-book', '4th ed.', '978-0-7506-8308-1', NULL, 'Reference Book', 'In this fourth edition of the Instrumentation Reference Book we have attempted to maintain the one-volume scheme with which we began while expanding the work to match the current view of the automation practitioner in the process\r\nindustries.', NULL, '7628787.JPG', '4955510.pdf', 1, 2010, 'New York', 51, '2019-01-29 23:15:46', '2019-01-29 23:15:46', '203.190.11.118'),
(993, 370, 1, NULL, 1, 'Practical Process Control', 'practical-process-control', NULL, NULL, NULL, 'Process Control', NULL, NULL, '8134480.JPG', '6833709.pdf', 1, 2005, NULL, 51, '2019-01-29 23:20:12', '2019-01-29 23:20:12', '203.190.11.118'),
(994, 245, 1, NULL, 1, 'Handbook of Transformer Design and Applications', 'handbook-of-transformer-design-and-applications', '2nd ed.', '978-0070212916', NULL, 'Handbook, Transformer,', 'Readers should test any program on their own system and compare result with those presented in the book. They should them construct their own test programs to verify that they fully', NULL, '2496885.jpg', '1489756.pdf', 1, 1993, NULL, 47, '2019-01-29 23:27:47', '2019-01-29 23:27:47', '203.190.11.118'),
(995, 12, 1, NULL, 1, 'The Mechatronics Handbook: Mechatronic System Control, Logic and Data Acquisition', 'the-mechatronics-handbook-mechatronic-system-control-logic-and-data-acquisition', '2nd ed.', '978-0-8493-9260-3', NULL, 'Mechatronic, Handbook, Data Acquisition, System, Control', 'The Handbook of Mechatronics was originally a single-volume reference book offering a thorough coverage of the field of mechatronics. With the need to present new material covering the rapid changes in technology, especially in the area of computers and software, the single-volume reference book quickly became unwieldy. There is too much material to cover in a single book. The topical coverage in the Mechatronics Handbook, 2nd Edition is presented here in two books covering Mechatronic Systems, Sensors, and Actuators: Fundamentals and Modeling and Mechatronic System Control, Logic, and Data Acquisition. These two books are intended for use in research and development departments in academia, government,\r\nand industry, and as a reference source in university libraries. They can also be used as a resource for scholars interested in understanding and explaining the engineering design process.', NULL, '3283846.JPG', '3152607.pdf', 1, 2008, 'New York', 50, '2019-01-30 15:27:21', '2019-01-30 15:27:21', '203.190.11.115'),
(996, 371, 1, NULL, 1, 'An Illustrated Dictionary of Optoelectronics and Photonics : Important Terms and Effects', 'an-illustrated-dictionary-of-optoelectronics-and-photonics-important-terms-and-effects', '2nd', NULL, NULL, 'Optoelectronics , Photonics', 'The title An Illustrated Dictionary of Important Terms and Effects in Optoelectronics and Photonics reflects exactly the contents of this dictionary. It is not meant to be an encyclopedia in this field but rather a selfcontained semiquantitative description of terms and effects that frequently turn up in optoelectronics and photonics courses at the undergraduate level. We have missed many terms but we have also described many; though, undoubtedly, our own biased selection. In our own view there is very little difference between optoelectronics and photonics, except that in the latter there may not be any electronics involved.', NULL, '8920266.JPG', '4550553.pdf', 1, 2000, 'USA', 48, '2019-01-30 15:28:04', '2019-01-30 15:28:04', '203.190.10.204'),
(997, 152, 1, NULL, 1, 'MECHATRONICS AN INTRODUCTION', 'mechatronics-an-introduction', '1st ed.', '978-0-8493-6358-0', NULL, 'MECHATRONICS, INTRODUCTION', 'Mechatronics: An Introduction provides an introduction to the vibrant field of mechatronics. As the historical divisions between the various branches of engineering and computer science become less clearly defined, the mechatronics specialty provides a roadmap for nontraditional engineering students studying within the traditional structure of most engineering colleges. Evidently, mechatronics laboratories and classes in the university environment are expanding world-wide. The list of contributors to this book that includes authors from around the globe reflects this.', NULL, '6895715.JPG', '3680756.pdf', 1, 2006, 'New York', 50, '2019-01-30 15:34:17', '2019-01-30 15:34:17', '203.190.11.117'),
(998, 10, 1, NULL, 1, 'Probability, Statistical Optics, and Data Testing', 'probability-statistical-optics-and-data-testing', '2nd', '3-540-53310-9', NULL, 'Probability , Data Testing', 'The deterministic optical theory that is used in application of the statistical methods presented is, for the most part, separately developed within the text, either within the main body or in the exercises. Some-times the development takes the form of a sequence of exercises. The simplest starting point is used - recalling our aims - such as Huygens\' wave theory as the basis for diffraction theory. In this way, readers who have not previously been exposed to optical theory arc introduced to it in the text.', NULL, '8195911.JPG', '9607311.pdf', 1, 1991, 'London', 48, '2019-01-30 15:39:26', '2019-01-30 15:39:26', '203.190.10.204'),
(999, 12, 1, NULL, 1, 'THE MECHATRONICS HANDBOOK', 'the-mechatronics-handbook', '1st ed.', '0-8493-0066-5', NULL, 'MECHATRONIC, HANDBOOK', 'According to the original definition of mechatronics proposed by the Yasakawa Electric Company and the definitions that have appeared since, many of the engineering products designed and manufactured in the last 25 years integrating mechanical and electrical systems can be classified as mechatronic systems. Yet many of the engineers and researchers responsible for those products were never formally trained in mechatronics per se. The Mechatronics Handbook can serve as a reference resource for those very same design engineers to help connect their everyday experience in design with the vibrant field of mechatronics. More generally, this handbook is intended for use in research and development departments in academia, government, and industry, and as a reference source in university libraries. It can also be used as a resource for scholars interested in understanding and explaining the engineering design process.', NULL, '1202701.JPG', '4630998.pdf', 1, 2002, 'London', 50, '2019-01-30 15:42:08', '2019-01-30 15:42:08', '203.190.11.118'),
(1000, 72, 1, NULL, 1, 'ELECTROMAGNETICS EXPLAINED A HANDBOOK FOR WIRELESS/RF, EMC, AND HIGH-SPEED ELECTRONICS', 'electromagnetics-explained-a-handbook-for-wirelessrf-emc-and-high-speed-electronics', '1st ed.', '0-7506-7403-2', NULL, 'ELECTROMAGNETIC, EXPLAINED, HANDBOOK', 'This book is the result of many years of wondering about and researching the conceptual foundations of electromagnetics. My goal was to write a book that provided the reader with a conceptual understanding of electromagnetics and the insight to efficiently apply this understanding to real problems that confront scientists, engineers, and technicians. The fundamental equations that govern electromagnetic phenomena are those given to us by James Clerk Maxwell, and are commonly known as Maxwellâ€™s equations. Excepting quantum phenomena, all electromagnetic problems can be solved from Maxwellâ€™s equations.', NULL, '2138139.JPG', '1349650.pdf', 1, 2002, 'New York', 50, '2019-01-30 15:48:18', '2019-01-30 15:48:18', '203.190.11.117'),
(1001, 327, 1, NULL, 1, 'Path Integrals in Physics : Volume II : Quantum Field Theory, Statistical Physics and other Modern Applications', 'path-integrals-in-physics-volume-ii-quantum-field-theory-statistical-physics-and-other-modern-applications', NULL, '0 7503 0801 X', NULL, 'Integrals , Physics', 'we have been discussing systems containing only one or, at most, a few particles. However, the method of path integrals readily generalizes to systems with many and even an arbitrary number of degrees of freedom. Thus in this chapter we shall consider one more infinite limit related to path integrals and discuss applications of the latter to systems with an infinite number of degrees of freedom. In other words, we shall derive path-integral representations for different objects in quantum field theory (QFT).', NULL, '2507540.JPG', '5523358.pdf', 1, 2001, 'London', 48, '2019-01-30 15:51:30', '2019-01-30 15:51:30', '203.190.10.204'),
(1002, 10, 1, NULL, 1, 'Recent Advances in Mechatronics', 'recent-advances-in-mechatronics', '1st ed.', '978-3-540-73955-5', NULL, 'Recent, Advance, Mechatronics', 'The International Conference MECHATRONICS has progressed considerably over the 15 years of its existence. The seventh in the series is hosted\r\nthis year at the Faculty of Mechatronics, Warsaw University of\r\nTechnology, Poland. The subjects covered in the conference are wideranging and detailed. Mechatronics is in fact the combination of enabling\r\ntechnologies brought together to reduce complexity through the adaptation\r\nof interdisciplinary techniques in production.', NULL, '8069406.JPG', '3808647.pdf', 1, 2007, 'New York', 50, '2019-01-30 15:51:33', '2019-01-30 15:51:33', '203.190.11.115'),
(1003, 49, 1, NULL, 1, 'Mechatronics', 'mechatronics', '1st ed.', '978-0-471-47987-1', NULL, 'Mechatronics', 'comprehensive, cross-disciplinary introduction to the design of computer controlled mechanical systems.\r\nWith Sabri Cetinkunt\'s Mechatronics, you can develop the technical background you need to design an automated machine, component, or process, as well as the practical judgment and knowledge of the current state-of-the-art technology you need to find the most effective solution. Drawing on knowledge and techniques from mechanical, aerospace, chemical, electrical and computer engineering, the text explores the theory behind a wide range of basic devices used in automated machines and processes--from gears and pumps, to servomotors and microchips. Various motion-control lab experiments bring together all aspects of the mechatronics field, and provide practical experience in designing circuits and writing software.', NULL, '6359381.JPG', '9819584.pdf', 1, 2007, 'U.S.A', 50, '2019-01-30 15:57:19', '2019-01-30 15:57:19', '203.190.11.118');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(1004, 12, 1, NULL, 1, 'Mechatronic Modeling and Simulation Using Bond Graphs', 'mechatronic-modeling-and-simulation-using-bond-graphs', '1st ed.', '978â€‘1â€‘4200â€‘7314â€‘0', NULL, 'Mechatronic, Modeling, Simulation, Bond, Graphs', 'In pursuing advanced studies, I was taken away from the systems modeling world because of other academic interests. But many years later, I had\r\nthe opportunity to develop and teach courses in the area of mechatronics.\r\nEven when I fi rst learned about bond graphs, the unifying nature of the\r\ntopic appealed to me a lot. That was when I fi rst realized that mechanics,\r\ncircuits, and hydraulics are not so far apart from each other as they have\r\nbeen thought to be. If one starts looking at the forest rather than the trees,\r\na very unifying theme emerges.', NULL, '5264025.JPG', '7190265.pdf', 1, 2009, 'New York', 50, '2019-01-30 15:59:42', '2019-01-30 15:59:42', '203.190.11.115'),
(1005, 62, 1, NULL, 1, 'Probability', 'probability', NULL, NULL, NULL, 'Probability', 'Redistribution of the electronic files must retain the above copyright notice, this list of conditions and the following disclaimer.Redistributions in printed form must reproduce the above copyright notice, this list of conditions and the following disclaimer.All materials derived from these notes must display the following acknowledgement: This product includes notes developed by The Archimedes, Cambridge University and their contributors.Neither the name of The Archimedes nor the names of their contributors may be used to endorse or promote products derived from these notes.', NULL, '9584825.JPG', '3890285.pdf', 1, 1996, 'USA', 48, '2019-01-30 16:01:54', '2019-01-30 16:01:54', '203.190.10.204'),
(1006, 128, 1, NULL, 1, 'Distribution Switchgear', 'distribution-switchgear', '1st ed.', '978-0-85296-107-0', NULL, 'Distribution, Switchgear', 'Each day, during which something new is learned, should be counted as a good day, and every engineer worth his salt, should keep a notebook to record the things learned for future reference. These notebooks should give references to sources of information, and most importantly, contain careful notes of those things not covered by textbooks. It was, therefore, with some humility that I accepted the invitation from the IEE to write this book, as I was very conscious of all the brilliant, talented engineers and scientists who were around in my formative years, who are now gone and never published their personal engineering notes.', NULL, '6821650.JPG', '7062881.pdf', 1, 2004, 'London', 50, '2019-01-30 16:02:24', '2019-01-30 16:02:24', '203.190.11.118'),
(1007, 294, 1, NULL, 1, 'Fundamentals of Digital Logic', 'fundamentals-of-digital-logic', '2nd ed.', '0-07-246085-7', NULL, 'Fundamental, Digital, Logic', 'Fundamentals of Digital Logic With Verilog Designteaches the basic design techniques for logic circuits. It emphasizes the synthesis of circuits and explains how circuits are implemented in real chips. Fundamental concepts are illustrated by using small examples.\r\nUse of CAD software is well integrated into the book. The CAD software provides automatic mapping of a design written in Verilog into Field Programmable Gate Arrays (FPGAs) and Complex Programmable Logic Devices (CPLDs). Students will be able to try, firsthand, the book\'s Verilog examples (over 140) and homework problems.', NULL, '7611976.JPG', '2519061.pdf', 1, 2005, 'New York', 50, '2019-01-30 16:06:10', '2019-01-30 16:06:10', '203.190.11.118'),
(1008, 10, 1, NULL, 1, 'Nuclear Principles in Engineering', 'nuclear-principles-in-engineering', '2nd ed.', '978-0-387-85607-0', NULL, 'Nuclear, Principles, Engineering', 'In the second edition I have updated some of the materials, improved\r\ndescription of some of the fundamental principles and provided more\r\nexamples with visualizations for easier understanding of the abstract\r\nphenomena. For example, an extensive graphical interpretation of neutron\r\ntransport angular flux, scalar flux or current is provided and discussed. Some\r\nof the chapters now end with brief reviews of the application of the chapters\r\nconcepts in the real world. For example, description of nuclear resonance\r\nfluorescence that gains growing attention in homeland security. There are\r\nalso some more problems listed at the end of each chapter. Overall there is\r\nmore material in the second than in the first edition covering a broad range\r\nof basic principles in nuclear physics, neutron transport and neutron physics\r\nof interest in the undergraduate or graduate education in engineering,\r\nphysics, health sciences or similar.', NULL, '4460526.JPG', '4656767.pdf', 1, 2009, 'New York', 50, '2019-01-30 16:07:50', '2019-01-30 16:07:50', '203.190.11.115'),
(1009, 187, 1, NULL, 1, 'Introduction to Probability', 'introduction-to-probability', NULL, '978-0821894149', NULL, 'Probability', 'For use in a standard one-term course, in which both discrete and continuous probability is covered, students should have taken as a prerequisite two terms of calculus, including an introduction to multiple integrals. In order to cover Chapter 11, which contains material on Markov chains, some knowledge of matrix theory is necessary.', NULL, '1843504.JPG', '1611942.pdf', 1, 2012, 'USA', 48, '2019-01-30 16:09:44', '2019-01-30 16:09:44', '203.190.10.204'),
(1010, 128, 1, NULL, 1, 'Protection of Electricity Distribution Networks', 'protection-of-electricity-distribution-networks', '2nd ed.', '978-0-86341-537-1', NULL, 'Protection, Electricity, Distribution, Network', 'The quality of electricity supplies is an important factor in the socio-economic\r\ndevelopment of any area. Approximately 75 per cent of all customer hours lost are owing to faults on the distribution networks, and customers rightly expect a high level of security for their supply. Although this can be achieved by good distribution network design using proven equipment, it is also essential to provide suitable protection schemes and relay settings to ensure that faults are quickly disconnected to minimise outage times and improve the continuity of supplies to customers.', NULL, '5997126.JPG', '5765795.pdf', 1, 2004, 'London', 50, '2019-01-30 16:13:31', '2019-01-30 16:13:31', '203.190.11.116'),
(1011, 107, 1, NULL, 1, 'TOPOLOGICAL FOUNDATIONS OF ELECTROMAGNETISM', 'topological-foundations-of-electromagnetism', '1st ed.', '978-981-277-996-0', NULL, 'TOPOLOGICAL, FOUNDATION, ELECTROMAGNETISM', 'Maxwellâ€™s equations are foundational to electromagnetic theory. They\r\nare the cornerstone of a myriad of technologies and are basic to the\r\nunderstanding of innumerable effects. Yet there are a few effects or\r\nphenomena that cannot be explained by the conventional Maxwell\r\ntheory. This book examines those anomalous effects and shows that\r\nthey can be interpreted by a Maxwell theory that is subsumed under\r\ngauge theory. Moreover, in the case of these few anomalous effects,\r\nand when Maxwellâ€™s theory finds its place in gauge theory, the conventional Maxwell theory must be extended, or generalized, to a nonAbelian form.', NULL, '8360996.JPG', '9459345.pdf', 1, 2008, 'London', 50, '2019-01-30 16:16:54', '2019-01-30 16:16:54', '203.190.11.115'),
(1012, 372, 1, NULL, 1, 'Quantum Field Theory and Topology', 'quantum-field-theory-and-topology', NULL, '978-3540547532', NULL, 'Quantum Field , Topology', 'Topological spaces are found everywhere in physics. For example, the con-figuration space and the phase space of a system in classical mechanics are equipped with a natural topology, as is the set of equilibrium states of a system at a given temperature, in statistical physics. In quantum field theory there arise infinite-dimensional topological spaces. All this opens up possibilities for using topology in physics. Of course, the primary focus of interest to a physicistâ€”quantitative descriptions of physical phenomenaâ€”cannot be reduced to topology. But qualitative features can be understood in terms of topology.', NULL, '/tmp/phpJhByqM', '2267248.pdf', 1, 1993, 'New York', 48, '2019-01-30 16:21:29', '2019-01-30 16:22:14', '203.190.10.204'),
(1013, 12, 1, NULL, 1, 'ROBOTICS AND AUTOMATION HANDBOOK', 'robotics-and-automation-handbook', '1st ed.', '0-8493-1804-1', NULL, 'ROBOTICS, AUTOMATION, HANDBOOK', 'Robots are machines that have interested the general population throughout history. In general, they are machines or devices that operate automatically or by remote control. Clearly people have wanted to use such equipment since simple devices were developed. The word robot itself comes from Czech robota, â€œservitude, forced labor,â€ and was coined in 1923 (from dictionary.com). Since then robots have been characterized by the media as machines that look similar to humans. Robots such as â€œRobby the Robotâ€ or Robot from the Lost in Space television series defined the appearance of robots to several generations.', NULL, '4289424.JPG', '4650703.pdf', 1, 2005, 'New York', 50, '2019-01-30 16:22:21', '2019-01-30 16:22:21', '203.190.11.116'),
(1014, 128, 1, NULL, 1, 'Lightning Protection', 'lightning-protection', '1st ed.', '978-0-86341-744-3', NULL, 'Lightning, Protection', 'Lightning protection relies upon the application of some of the principles of electricity and the physics of electrical discharges to mitigate the effects of direct currents and electromagnetic fields generated by lightning discharges. Structures, storage facilities for flammable and explosive materials, power distribution and transmission systems, telecommunication systems and electrical and electronic equipment all require such protection. Since the initial launch of the concept of lightning protection by Benjamin Franklin in 1753, the subject of lightning protection has made significant progress, especially in the last century, thanks to experimental observations of the\r\nmechanism and properties of lightning flashes. This book summarises the state of the art of lightning protection as it stands today.', NULL, '4566144.JPG', '5865846.pdf', 1, 2010, 'London', 50, '2019-01-30 16:24:39', '2019-01-30 16:24:39', '203.190.11.115'),
(1015, 91, 1, NULL, 1, 'Handbook of Numerical Analysis', 'handbook-of-numerical-analysis', '1st ed.', '0-444-51375-2', NULL, 'Handbook, Numerical, Analysis', 'During the past decades, giant needs for ever more sophisticated mathematical models and increasingly complex and extensive computer simulations have arisen. In this fashion, two indissociable activities, mathematical modeling and computer simulation, have gained a major status in all aspects\r\nof science, technology and industry.\r\nIn order that these two sciences be established on the safest possible grounds, mathematical rigor is indispensable. For this reason, two companion sciences, Numerical Analysis and Scientific Software, have emerged as essential steps for validating the mathematical models and the computer simulations that are based on them.', NULL, '1543172.JPG', '1350896.pdf', 1, 2005, 'New York', 50, '2019-01-30 16:28:06', '2019-01-30 16:28:06', '203.190.11.118'),
(1016, 373, 1, NULL, 1, 'Quantum Information Theory and The Foundations of Quantum Mechanics', 'quantum-information-theory-and-the-foundations-of-quantum-mechanics', NULL, NULL, NULL, 'Quantum Information , Quantum Mechanics', 'The function of various measures of information content for quantum systems is explored and the applicability of the Shannon information in the quantum context maintained against the challenge of Buckner and Zeilinger (2001). The phenomenon of quantum teleportation is then explored as a case study serving to emphasize the value of recognising the logical status of â€˜informationâ€™ as an abstract noun: it is argued that the conceptual puzzles often associated with this phenomenon result from the familiar error of hypothesizing an abstract noun.', NULL, '8955958.JPG', '1650792.pdf', 1, 2004, 'USA', 48, '2019-01-30 16:29:23', '2019-01-30 16:29:23', '203.190.10.204'),
(1017, 10, 1, NULL, 1, 'Nanotechnology and Nanoelectronics Materials, Devices, Measurement Techniques', 'nanotechnology-and-nanoelectronics-materials-devices-measurement-techniques', '1st ed.', '3-540-22452-1', NULL, 'Nanotechnology, Nanoelectronic, Materials', 'Much more than in microtechnology â€“ whose fundamentals we assume to be known â€“ a certain range of engineering and natural sciences are interwoven in nanotechnology. For instance, newly developed tools from mechanical engineering are essential in the production of nanoelectronic structures. Vice versa, mechanical shifts in the nanometer range demand piezoelectric-operated actuators. Therefore, special attention is given to a comprehensive presentation of the matter. In our time, it is no longer sufficient to simply explain how an electronic device operates; the materials and procedures used for its production and the measuring instruments used for its characterization are equally important.', NULL, '2465789.JPG', '9371266.pdf', 1, 2005, 'New York', 50, '2019-01-30 16:31:50', '2019-01-30 16:31:50', '203.190.11.118'),
(1018, 374, 1, NULL, 1, 'ADVANCED AUTOMATION TECHNIQUES IN ADAPTIVE MATERIAL PROCESSING', 'advanced-automation-techniques-in-adaptive-material-processing', '1st ed.', '981-02-4902-0', NULL, 'ADVANCED, AUTOMATION, TECHNIQUE, ADAPTIVE, MATERIAL,  PROCESSING', 'Researchers and engineers have long been inspired to innovate automation\r\nsolutions to a whole range of manufacturing processes such as components\r\nassembly, marking, cutting, forming, joining, grinding, polishing and\r\nchamfering. The past few decades have witnessed widespread applications\r\nof CNC technology for machining operations and robotic technology for\r\nassembly operations. Robots have also gained a solid ground in welding\r\nautomation, notably spot welding for the automobile industry and arc\r\nwelding for the manufacture of steel products. However, manufacturing\r\nprocesses that require operator\'s instincts and skills have posed a great\r\nchallenge to researchers in the areas of robotics, automation and control.\r\nDespite many research works that have attempted to address some\r\nfundamental issues in automating material processing operations,\r\nautomation practitioners find it difficult to implement integrated solutions\r\nto these applications.', NULL, '4348099.JPG', '1448767.pdf', 1, 2002, 'London', 50, '2019-01-30 16:34:10', '2019-01-30 16:34:10', '203.190.11.116'),
(1019, 10, 1, NULL, 1, 'Control of Single Wheel Robots', 'control-of-single-wheel-robots', '1st ed.', '978-3-540-28184-9', NULL, 'Control, Single, Wheel, Robots', 'The book is a collection of the research work on the control of a single wheel\r\ngyroscopically stabilized robot. Although the robot was originally developed\r\nat Carnegie Mellon University, most work shown in this book was carried\r\nout in the Chinese University of Hong Kong. It focuses on the dynamics\r\nand control aspects of the system, including dynamic modeling, model-based\r\ncontrol, learning-based control, and shared control with human operators.', NULL, '9120473.JPG', '4019428.pdf', 1, 2005, 'Germany', 50, '2019-01-30 16:36:28', '2019-01-30 16:36:28', '203.190.11.118'),
(1020, 10, 1, NULL, 1, 'An Introduction to Programming and Numerical Methods in MATLAB', 'an-introduction-to-programming-and-numerical-methods-in-matlab', NULL, '978-185233-919-7', NULL, 'Programming , Numerical Methods', 'This text provides an introduction to the numerical methods that are typically encountered (and used) in science and engineering undergraduate courses. The material is developed in tandem with MATLAB which allows rapid prototyping and testing of the methods. The package MATLAB (matrix laboratory) provides an environment in which students can learn to programmer and explore the structure of the numerical methods. The methods included here are of a basic nature and only rely on material which should have been explored prior to the first year undergraduate stage.', NULL, '7298230.JPG', '3832649.pdf', 1, 2005, 'USA', 48, '2019-01-30 16:37:06', '2019-01-30 16:37:06', '203.190.10.204'),
(1021, 178, 1, NULL, 1, 'Introductory Electromagnetics', 'introductory-electromagnetics', '1st ed.', '0-201-32678-7', NULL, 'Introductory, Electromagnetic', 'This book relates basic physical principles to engineering practice with a number of application examples. It is mathematically simple, but exact. Contains application chapters that integrate knowledge readers gain in previous chapters. Includes a â€œquestionsâ€ feature that guides the reader as they read the book to provide a qualitative understanding of the material. Derives mathematical tools from physical concepts when needed. Presents transmission lines in the middle of the book once readers have understood distributed circuit elements. For engineers who are interested in refreshing their knowledge of electromagnetics.', NULL, '6621024.JPG', '4907610.pdf', 1, 2000, 'New Jersey', 50, '2019-01-30 16:44:16', '2019-01-30 16:44:16', '203.190.11.115'),
(1022, 294, 1, NULL, 1, 'Build Your Own Smart Home', 'build-your-own-smart-home', '1st ed.', '0-07-223013-4', NULL, 'Build, Smart, Home', 'A book seems like a singular endeavor; however, it cannot really be\r\nstarted, crafted, and completed without the input of a number of individuals. First, weâ€™d like to acknowledge the efforts of acquisitions editor Tim\r\nGreen at McGraw-Hill/Osborne, who got the ball rolling on this project. Next,\r\nwe appreciate the work of technical editor Glen Carty and copyeditor Dennis\r\nWeaver. Key to the completion and overall appearance of this book were Mark\r\nKarmendy and Jean Butterfield.', NULL, '9159872.JPG', '3227338.pdf', 1, 2003, 'New York', 50, '2019-01-30 16:47:18', '2019-01-30 16:47:18', '203.190.11.118'),
(1023, 12, 1, NULL, 1, 'The Control Handbook Control System Fundamentals', 'the-control-handbook-control-system-fundamentals', '2nd ed.', '978-1-4200-7363-8', NULL, 'Control, Handbook, Control System, Fundamental', 'As you may know, the first edition of The Control Handbook was very well received. Many copies were sold and a gratifying number of people took the time to tell me that they found it useful. To the publisher, these are all reasons to do a second edition. To the editor of the first edition, these same facts are a modest disincentive. The risk that a second edition will not be as good as the first one is real and worrisome. I have tried very hard to insure that the second edition is at least as good as the first one was. I hope you\r\nagree that I have succeeded. I have made two major changes in the second edition. The first is that all the Applications chapters are new. It is simply a fact of life in engineering that once a problem is solved, people are no longer as interested in it as they were when it was unsolved. I have tried to find especially inspiring and exciting applications for this second edition.', NULL, '8412923.JPG', '7014276.pdf', 1, 2011, 'New York', 50, '2019-01-30 16:51:35', '2019-01-30 16:51:35', '203.190.11.115'),
(1024, 81, 1, NULL, 1, 'Probability & Statistics for Engineers & Scientists', 'probability-statistics-for-engineers-scientists-30521108', '8th', '0-13-204767- 5', NULL, 'Probability , Statistics', 'Engineers and physical scientists as well as computer scientists are trained in calculus and thus mathematical support is given when we feel as if the pedagogyis enhanced by it. This approach prohibits the material from becoming a collection of tools with no mathematical roots. Certainly students with a mathematical background of calculus, and, in a few cases, linear algebra, have the capability to understand the concepts more thoroughly and use the resulting tools more intelligently. Otherwise there is a clear danger that, the student will only be able to\r\napply the material within very narrow bounds.', NULL, '/tmp/phpatct5n', '6414252.pdf', 1, 2007, 'London', 48, '2019-01-30 16:52:08', '2019-01-30 16:52:59', '203.190.10.204'),
(1025, 12, 1, NULL, 1, 'The Control Handbook Control System Applications', 'the-control-handbook-control-system-applications', '2nd ed.', '978-1-4200-7360-7', NULL, 'Control, Handbook, Control System, Applications', 'As you may know, the first edition of The Control Handbook was very well received. Many copies were sold and a gratifying number of people took the time to tell me that they found it useful. To the publisher, these are all reasons to do a second edition. To the editor of the first edition, these same facts are a modest disincentive. The risk that a second edition will not be as good as the first one is real and worrisome. I have tried very hard to insure that the second edition is at least as good as the first one was. I hope you\r\nagree that I have succeeded. I have made two major changes in the second edition. The first is that all the Applications chapters are new. It is simply a fact of life in engineering that once a problem is solved, people are no longer as interested in it as they were when it was unsolved. I have tried to find especially inspiring and exciting applications for this second edition.', NULL, '2098444.JPG', '7223085.pdf', 1, 2011, 'New York', 50, '2019-01-30 16:56:13', '2019-01-30 16:56:13', '203.190.11.117'),
(1026, 12, 1, NULL, 1, 'The Control Handbook Control System Advanced Methods', 'the-control-handbook-control-system-advanced-methods', '2nd ed.', '978-1-4200-7364-5', NULL, 'Control, Handbook, Control System, Advanced, Methods', 'As you may know, the first edition of The Control Handbook was very well received. Many copies were sold and a gratifying number of people took the time to tell me that they found it useful. To the publisher, these are all reasons to do a second edition. To the editor of the first edition, these same facts are a modest disincentive. The risk that a second edition will not be as good as the first one is real and worrisome. I have tried very hard to insure that the second edition is at least as good as the first one was. I hope you\r\nagree that I have succeeded. I have made two major changes in the second edition. The first is that all the Applications chapters are new. It is simply a fact of life in engineering that once a problem is solved, people are no longer as interested in it as they were when it was unsolved. I have tried to find especially inspiring and exciting applications for this second edition.', NULL, '2024068.JPG', '3935078.pdf', 1, 2011, 'New York', 50, '2019-01-30 17:01:17', '2019-01-30 17:01:17', '203.190.11.116'),
(1027, 329, 1, NULL, 1, 'Quantum Mechanics : A Conceptual Approach', 'quantum-mechanics-a-conceptual-approach', NULL, '0-471-64965-1', NULL, 'Quantum , Mechanics', 'The physical laws and mathematical structure that constitute the basis of quantum mechanics were derived by physicists, but subsequent applications became of interest not just to the physicists but also to chemists, biologists, medical scientists, engineers, and philosophers. Quantum mechanical descriptions of atomic and molecular structure are now taught in freshman chemistry and even in some high school chemistry courses. Sophisticated computer programs are routinely used for predicting the structures and geometries of large organic molecules or for the identification and evaluation of new medicinal drugs.', NULL, '9206156.JPG', '2366645.pdf', 1, 2004, 'new jersey', 48, '2019-01-30 17:01:59', '2019-01-30 17:01:59', '203.190.10.204'),
(1028, 375, 1, NULL, 1, 'Quantum Mechanics : Concepts and Applications', 'quantum-mechanics-concepts-and-applications-30181205', NULL, NULL, NULL, 'Quantum , Mechanics', 'A significantly different feature of this book is the highlighting of numerical methods. An unavoidable consequence of doing practical physics is that most realistic problems do not have analytical solutions. The traditional approach to such problems has been a process of approximation of the complex system to a simple one and then adding appropriate numbers of correction terms. This has given rise to several methods of finding correction terms and some of them will be discussed in this text.', NULL, '2434427.JPG', '9613782.pdf', 1, 1999, 'New York', 48, '2019-01-30 17:18:05', '2019-01-30 17:18:05', '203.190.10.204'),
(1029, 304, 1, NULL, 1, 'Quantum Field Theory', 'quantum-field-theory', NULL, '3-540-67972-3', NULL, 'Quantum Field , Quantum', 'In electromagnetism, the photons are the quanta of the electromagnetic gauge field. In the theory of electroweak interactions, the massive HI and Z particles are the quanta of the dectroweak gauge fields in addition to the massless photon. The strong dynamics of the quarks and gluons are controlled by the color interactions of the quantum chromodynamic gauge fields. Local Lorentz symmetries are used to describe the gravitational interactions. In some cases the symmetries are not realized explicitly although these in-visible symmetries still involve exact symmetries at the fundamental level. In quantum chromodynamics, the color confinement phenomena results from an exact local color gauge symmetry.', NULL, '4729883.JPG', '3867665.pdf', 1, 2000, 'Germany', 48, '2019-01-30 17:40:58', '2019-01-30 17:40:58', '203.190.10.204'),
(1030, 200, 1, NULL, 1, '3G Handset and Network Design', '3g-handset-and-network-design', '1st ed.', '0-471-22936-9', NULL, '3G, Handset, Network, Design', 'This book is the product of over 15 years of working with RTT, delivering strategic technology design programs for the cellular design community. This has included programs on AMPS/ETACS handset, base station, and network design in the early to mid-1980s; programs on GSM handset, base station, and network design from the late 1980s to mid-1990s onward; and, more recently, programs on 3G handset, Node B, and network design. We would like to thank the many thousands of delegates who have attended these programs in Europe, the United States, and Asia and who have pointed out the many\r\nmisconceptions that invariably creep in to the study of a complex subject.', NULL, '2475319.JPG', '7411873.pdf', 1, 2003, 'Indiana', 50, '2019-01-30 17:42:41', '2019-01-30 17:42:41', '203.190.11.118'),
(1031, 376, 1, NULL, 1, 'A Pragmatic Introduction to the Art of Electrical Engineering', 'a-pragmatic-introduction-to-the-art-of-electrical-engineering', NULL, NULL, NULL, 'Pragmatic , Electrical Engineering', 'This book takes a totally different approach. Instead of dealing in the abstract with an occasional fabricated â€œreal worldâ€ example, we will present real problems, and show you what you need in order to solve them. Fundamentally, we know that given the limited time, there is no way we can explain everything. But we can teach you enough to make you dangerous. (Dangerous, that is, to professional electrical engineering consultants that will typically charge you a fortune for things you can whip up in your basement in 20 minutes.) After a semester, you should be able to\r\ncreate electronic things that will amaze your friends and family. However, you will still have no clue how that electronic toothbrush really works.', NULL, '9632865.JPG', '9132462.pdf', 1, 1998, 'USA', 48, '2019-01-30 17:49:49', '2019-01-30 17:49:49', '203.190.10.204'),
(1032, 60, 1, NULL, 1, '802.11 Security', '80211-security-30511218', '1st ed.', '0-596-00290-4', NULL, '802,11, Security', 'From the early days of wireless communication, the ability to transmit news,\r\nthoughts, and feelings without wires has revolutionized our daily lives. The\r\nradio broadcasts of the 1920s brought instant news and entertainment to\r\nhouseholds all over the world. The adoption of television in the 1950s added\r\na visual aspect to the experience. CB radio made a big impact in the 1970s,\r\nallowing individuals within a limited distance to talk with each other while\r\non the road. In the 1980s, cellular phones and pagers allowed people to be\r\nconnected to their home or office no matter where they were. Now at the\r\nstart of the 21 st century, low-cost, high-speed wireless data networking has\r\nbecome a reality. Anyone can go to his or her local computer store and\r\neasily purchase wireless networking equipment that can transmit packetbased data at millions of bits per second.', NULL, '8203885.JPG', '1501837.pdf', 1, 2002, 'New York', 50, '2019-01-30 17:51:18', '2019-01-30 17:51:18', '203.190.11.117'),
(1033, 377, 1, NULL, 1, '802.11 Wireless LAN Fundamentals', '80211-wireless-lan-fundamentals-30561241', '1st ed.', '1-58705-077-3', NULL, '802,Wireless, LAN, Fundamentals', '802.11 Wireless LAN Fundamentals gives networking engineers and IT professionals the knowledge they need to design, deploy, manage, and troubleshoot their own wireless localarea networks (WLANs). Starting with an overview of the technology and architecture of WLANs, the book goes on to explain services and advanced features that such applications can provide. Most importantly, it provides practical design guidance and deployment\r\nrecommendations.', NULL, '9135804.JPG', '2814535.pdf', 1, 2003, 'U.S.A', 50, '2019-01-30 17:56:41', '2019-01-30 17:56:41', '203.190.11.115'),
(1034, 12, 1, NULL, 1, 'Electric Power Engineering Handbook', 'electric-power-engineering-handbook', '2nd ed.', '978-0-8493-9291-7', NULL, 'Electric, Power, Engineering, Handbook', 'The handbook is published in five volumes. Each is organized into topical sections and chapters in an attempt to provide comprehensive coverage of the generation, transformation, transmission, distribution, and utilization of electric power and energy as well as the modeling, analysis, planning, design, monitoring, and control of electric power systems. The individual chapters are different from most technical publications. They are not journal-type chapters nor are they textbook in nature. They are intended to be tutorials or overviews providing ready access to needed information while at the same time providing sufficient references to more in-depth coverage of the topic. This work is a member of the Electrical Engineering Handbook Series published by CRC Press. Since its inception in 1993, this series has been dedicated to the concept that when readers refer to a handbook on a particular topic they should be able to find what they need to know about the subject most of the time.', NULL, '8699599.JPG', '8402035.pdf', 1, 2007, 'New York', 50, '2019-01-30 18:00:13', '2019-01-30 18:00:13', '203.190.11.115'),
(1035, 49, 1, NULL, 1, 'Signal Analysis : Wavelets, Filter Banks, Time-Frequency Transforms and Applications', 'signal-analysis-wavelets-filter-banks-time-frequency-transforms-and-applications', NULL, '0-471-98626-7', NULL, 'Signal , Analysis', 'The goal of this chapter is to give a brief overview of methods for characterizing signals and for describing their properties. We will start with a discussion of signal spaces such as Hilbert spaces, normed and metric spaces.\r\nThen, the energy density and correlation function of deterministic signals will be discussed. The remainder of this chapter is dedicated to random signals, which are encountered in almost all areas of signal processing. Here, basic\r\nconcepts such as stationarity, autocorrelation, and power spectral density will be discussed.', NULL, '/tmp/phpYhr4IB', '5007798.pdf', 1, 1999, 'USA', 48, '2019-01-30 18:13:18', '2019-01-30 18:13:41', '203.190.10.204'),
(1036, 81, 1, NULL, 1, 'Instructorâ€™s Manual to accompany  MODERN ELECTRONIC COMMUNICATION', 'instructors-manual-to-accompany-modern-electronic-communication', 'Ninth Edition', '978-0-13-225080-1', NULL, 'Instructor, Manual, accompany,  MODERN, ELECTRONIC, COMMUNICATION', 'Maintaining the tradition of previous editions, this ninth edition includes up-to-date coverage of the latest in electronic communications and concepts. The material presented reflects advancements and developments in all aspects of electronic communications such as mobile communications, satellite communications, digital signal processing and SS7 signaling. Electronic Workbench Multisim simulations appear at the end of each chapter and on an accompanying CD. In addition, in-text learning aids are designed to develop analytical and troubleshooting skills and the updated lab manual includes new experiments using Mini-CircuitsÂ® modules.  Expanded discussion of digital communications including new changes and improvements in: Mobile Communications; SS7 Signaling; Bluetooth; Wi-Max; DTV (digital television).  Completely new sections on: Wireless Security; DSP (digital signal processing); RFID; HD Radio.  A thorough and up-to-date reference for Electronic Technicians.', NULL, '2731175.JPG', '6894955.pdf', 1, 2008, 'New Jersey', 50, '2019-01-30 18:29:25', '2019-01-30 18:29:25', '203.190.10.206'),
(1037, 150, 1, NULL, 1, 'Electronic Devices and Circuits', 'electronic-devices-and-circuits', '1st', '81-7800-167-5', NULL, 'Electronic, Devices, Circuits', 'We are happy that the 1st edition of the book \"Electronic Devices and Circuits\" is brought out, to meet recent revised syllabus. The contents and topics are revised so that there is almost one to one match between the syllabus and topics will match. This textbook will also be very useful for preparing competitive examinations like GATE, Engineering services exams and such other examinations. This book is also useful for AMIETE, AMIE (Electronics), M.Sc (Electronics), Polytechnic and Diploma programs in Electronics and B.Sc (Electronics) Courses', NULL, '2320468.JPG', '1986955.pdf', 1, 2008, 'India', 50, '2019-01-30 18:39:25', '2019-01-30 18:39:25', '203.190.10.206'),
(1038, 378, 1, NULL, 1, 'A First Course in String Theory', 'a-first-course-in-string-theory', '1st', '0 521 83143 1', NULL, 'First, Course, String, Theory', 'Barton Zwiebach is once again faithful to his goal of making string theory accessible to undergraduates. Complete and thorough in its coverage, the author presents the main concepts of string theory in a concrete and physical way in order to develop intuition before formalism, often through simplified and illustrative examples. This new edition now includes AdS/CFT correspondence, which is the hottest area of string theory right now as well as introducing superstrings. The text is perfectly suited to introductory courses in string theory for students with a background in mathematics and physics. New sections cover strings on orbifolds, cosmic strings, moduli stabilization, and the string theory landscape.', NULL, '2022154.jpg', '6668132.pdf', 1, 2004, 'New York', 50, '2019-01-30 18:43:49', '2019-01-30 18:43:49', '203.190.10.206'),
(1039, 379, 1, NULL, 1, 'A Guided Tour of Mathematical Physics', 'a-guided-tour-of-mathematical-physics', '1st', '978-0521787512', NULL, 'Guided, Tour, Mathematical, Physics', 'Mathematical methods are essential tools for all physical scientists. This novel textbook provides a comprehensive guided tour of the mathematical knowledge and techniques needed by students in this area. In contrast to more traditional textbooks, all the material is presented in the form of problems. Within these problems the basic mathematical theory and its physical applications are very well integrated. In this way the mathematical insights that the students acquire are driven by their physical insight. Topics that are covered include vector calculus (div, grad, curl, Laplacian), linear algebra, Fourier analysis, scale analysis, Green\'s functions, normal modes, tensor calculus and perturbation theory. This book can be used by undergraduates or by lower-level graduate students in the physical sciences. It can serve as a stand-alone text, or as a source of problems and examples to complement other textbooks. This guided tour of mathematical techniques is instructive, applied, and eve', NULL, '6563312.JPG', '3906453.pdf', 1, 1994, 'New York', 50, '2019-01-30 18:47:29', '2019-01-30 18:47:29', '203.190.10.206'),
(1040, 380, 1, NULL, 1, 'A New Kind Of Science', 'a-new-kind-of-science', '1st', '1-57955-008-8', NULL, 'New, Kind, Science', 'Just over twenty years ago I made what at first seemed like a small discovery: a computer experiment of mine showed something I did not expect. But the more I investigated, the more I realized that what I had seen was the beginning of a crack in the very foundations of existing science, and a first clue towards a whole new kind of science. This hook is the culmination of nearly twenty years of work that I have done to develop that new kind of science. I had never expected it would take anything like as long, but I have discovered vastly more than I ever thought possible, and in fact what I have done now touches almost every existing area of science, and quite a bit besides. In the early years, I did as I had done before as a scientist, and published accounts of my ongoing work in the scientific literature.', NULL, '7094879.JPG', '8573604.pdf', 1, 2002, 'Canada', 50, '2019-01-30 19:21:30', '2019-01-30 19:21:30', '203.190.10.206'),
(1041, 12, 1, NULL, 1, 'Mechatronics: An Introduction', 'mechatronics-an-introduction-30261431', NULL, '9780849363580', NULL, 'Mechatronics,', 'Mechatronics has evolved into a way of life in engineering practice, and it pervades virtually every aspect of the modern world. In chapters drawn from the bestselling and now standard engineering reference, The Mechatronics Handbook, this book introduces the vibrant field of mechatronics and its key elements: physical system modeling; sensors and actuators; signals and systems; computers and logic systems; and software and data acquisition. These chapters, written by leading academics and practitioners, were carefully selected and organized to provide an accessible, general outline of the subject ideal for non-specialists.', NULL, '5671176.JPG', '7069778.pdf', 1, 2006, 'New York', 51, '2019-01-30 19:26:31', '2019-01-30 19:26:31', '203.190.8.118'),
(1042, 381, 1, NULL, 1, 'A Textbook of Electrical Technology', 'a-textbook-of-electrical-technology', '1st', '978-9380386348', NULL, 'Textbook, Electrical, Technology', 'Circuit. A conducting path through which an electric current either flows or is intended to flow is called a circuit. The various elements of an electric circuit arc called parameters (e.g. resistance, inductance and capacitance). These parameters may be distributed or lumped.', NULL, '7420922.JPG', '7172140.pdf', 1, 2006, 'India', 50, '2019-01-30 19:28:40', '2019-01-30 19:28:40', '203.190.10.206'),
(1043, 39, 1, NULL, 1, 'Introduction to Signal Processing', 'introduction-to-signal-processing', NULL, '0132091720', NULL, 'Sampling, Reconstruction, Signal Processing.', 'This book differs from the classical DSP book model pioneered by O/S. Includes chapters on DFT, Z-Transform and Filter Design. The book starts out with what one reviewer calls \"fun topics\", and DSP applications\".', NULL, '6214738.jpg', '2454891.pdf', 1, 2010, NULL, 51, '2019-01-30 19:31:46', '2019-01-30 19:31:46', '203.190.8.118'),
(1044, 125, 1, NULL, 1, 'A Wavelet Tour of Signal Processing', 'a-wavelet-tour-of-signal-processing', '3rd.', '978-0123743701', NULL, 'Wavelet, Tour, Signal, Processing', 'The new edition of this classic book gives all the major concepts, techniques and applications of sparse representation, reflecting the key role the subject plays in today\'s signal processing. The book clearly presents the standard representations with Fourier, wavelet and time-frequency transforms, and the construction of orthogonal bases with fast algorithms. The central concept of sparsity is explained and applied to signal compression, noise reduction, and inverse problems, while coverage is given to sparse representations in redundant dictionaries, super-resolution and compressive sensing applications.', NULL, '9483968.JPG', '4484671.pdf', 1, 2008, 'USA', 50, '2019-01-30 19:46:07', '2019-01-30 19:46:07', '203.190.10.206'),
(1045, 382, 1, NULL, 1, 'A Textbook of Electrical Technology', 'a-textbook-of-electrical-technology-30511431', '1st', '978-8121924412', NULL, 'Textbook, Electrical, Technology', 'A Textbook Of Electrical Technology (Multi Colour) 25th Edition is a comprehensive book for electrical engineering students. The book comprises chapters, which cover the entire syllabus of electrical engineering in brief. In addition, the book has multicolor illustrations, which help the students in understanding the concepts better. This book is essential for electrical engineering students and educators alike.', NULL, '5160478.JPG', '4741211.pdf', 1, 2008, 'India', 50, '2019-01-30 19:51:31', '2019-01-30 19:51:31', '203.190.10.206'),
(1046, 167, 1, NULL, 1, 'Semi-Riemann Geometry and General Relativity', 'semi-riemann-geometry-and-general-relativity', NULL, '978-1616100674', NULL, 'Semi-Riemann Geometry , Semi-Riemann Geometry', 'This book represents course notes for a one semester course at the undergraduate level giving an introduction to Riemannian geometry and its principal physical application, Einsteinâ€™s theory of general relativity. The background assumed is a good grounding in linear algebra and in advanced calculus, preferably in the language of differential forms.', NULL, '/tmp/phpMn1GPT', '9026961.pdf', 1, 2003, 'USA', 48, '2019-01-30 20:09:06', '2019-01-30 20:09:39', '203.190.10.204'),
(1047, 383, 1, NULL, 1, 'Introduction to Electric Circuits', 'introduction-to-electric-circuits-30411541', '6th ed.', NULL, NULL, 'Electric Circuit', NULL, NULL, '9433128.JPG', '8923814.pdf', 1, 1996, NULL, 51, '2019-01-30 20:41:41', '2019-01-30 20:41:41', '203.190.11.118'),
(1048, 384, 1, NULL, 1, 'Introduction to Electric Circuits', 'introduction-to-electric-circuits-30511539', NULL, '0340631988', NULL, 'Electric Circuits', 'An Introduction to Electric Circuits is essential reading for first year students of electronics and electrical engineering who need to get to grips quickly with the basic theory. This text is a comprehensive introduction to the topic and, assuming virtually no knowledge, it keeps the mathematical content to a minimum.', NULL, '6453961.jpg', '1712471.pdf', 1, 1995, 'London', 51, '2019-01-30 20:51:39', '2019-01-30 20:51:39', '203.190.11.118'),
(1049, 43, 1, NULL, 1, 'Introduction to Mechatronics and Measurement Systems', 'introduction-to-mechatronics-and-measurement-systems-30551539', '4th ed.', '978-0-07-338023-0', NULL, 'Mechatronics', 'The formal boundaries of traditional engineering disciplines have become fuzzy following the advent of integrated circuits and computers. Nowhere is this more evident than in mechanical and electrical engineering, where products today include an assembly of interdependent electrical and mechanical components. The field of mechatronics has broadened the scope of the traditional field of electromechanics. Mechatronics is defined as the field of study involving the analysis, design, synthesis, and selection of systems that combine electronic and mechanical components with modern controls and microprocessors.', NULL, '2000740.JPG', '8477561.pdf', 1, 2012, 'New York', 51, '2019-01-30 20:55:39', '2019-01-30 20:55:39', '203.190.11.116'),
(1050, 49, 1, NULL, 1, 'INTRODUCTION TO NANOTECHNOLOGY', 'introduction-to-nanotechnology-30591545', NULL, '0-471 -07935-9', NULL, 'NANOTECHNOLOGY', 'In recent years nanotechnology has become one of the most important and exciting forefront fields in Physics, Chemistry, Engineering and Biology. It shows great promise for providing us in the near future with many breakthroughs that will change the direction of technological advances in a wide range of applications.', NULL, '5126754.JPG', '7710276.pdf', 1, 2003, 'New Jersey', 51, '2019-01-30 20:59:45', '2019-01-30 20:59:45', '203.190.11.118'),
(1051, 33, 1, NULL, 1, 'Solutions to Problems in Quantum Mechanics', 'solutions-to-problems-in-quantum-mechanics', NULL, NULL, NULL, 'Quantum , Mechanics', 'You can write a book review and share your experiences. Other readers will always be interested in your opinion of the books you\'ve read. Whether you\'ve loved the book or not, if you give your honest and detailed thoughts then people will find new books that are right for them.', NULL, '9376528.JPG', '9555885.pdf', 1, 1999, 'USA', 48, '2019-01-30 21:01:12', '2019-01-30 21:01:12', '203.190.10.204'),
(1052, 10, 1, NULL, 1, 'Technology of Integrated Circuits', 'technology-of-integrated-circuits', NULL, '978-3540661993', NULL, 'Technology , Integrated Circuits', 'This is the first book to comprehensively record the authorsâ€™ authoritative knowledge and practical experience of IC manufacturing, including the tremendous developments of recent years. With its strong application orientation, this is a must-have book for professionals in semiconductor industries.', NULL, '4065473.JPG', '5579601.pdf', 1, 2000, 'USA', 48, '2019-01-30 21:10:15', '2019-01-30 21:10:15', '203.190.10.204'),
(1053, 385, 1, NULL, 1, 'Introduction to String Field Theory', 'introduction-to-string-field-theory', NULL, '978-9971507329', NULL, 'String Field Theory', 'This volume covers the most up-to-date findings on string field theory. It is presented in a new approach as a result of insights gained from the theory. This includes the use of a universal method for treating free field theories, which allows the derivation of a single, simple, free, local, Poincare-invariant, gauge-invariant action that can be applied directly to any fields.', NULL, '6765421.jpg', '3112222.pdf', 1, 1988, 'New York', 51, '2019-01-30 21:27:06', '2019-01-30 21:27:06', '203.190.8.118'),
(1054, 10, 1, NULL, 1, 'Transient Analysis of Electric Power Circuits Handbook', 'transient-analysis-of-electric-power-circuits-handbook-30301628', NULL, '978-0387287973', NULL, 'Transient Analysis, Electric, Power Circuits.', 'Every now and then, a good book comes along and quite rightfully makes itself a distinguished place amongthe existing books of the electric power engineering literature. This book by Professor Arieh Shenkman is one of them. Today, there are many excellent textbooks dealing with topics in power systems. Some of them are considered to be classics. However, many of them do not particularly address, nor concentrate on, topics dealing with transient analysis of electrical power systems. Many of the fundamental facts concerning the transient behavior of electric circuits were well explored by Steinmetz and other early pioneers of electrical power engineering. Among others, Electrical Transients in Power Systems by Allan Greenwood is worth mentioning.', NULL, '9816017.jpg', '4903915.pdf', 1, 2005, NULL, 47, '2019-01-30 21:30:28', '2019-01-30 21:30:28', '203.190.10.206'),
(1055, 130, 1, NULL, 1, 'Handbook of Water and Wastewater Treatment Technologies', 'handbook-of-water-and-wastewater-treatment-technologies', NULL, '0-7506-7498-9', NULL, 'Water, Wastewater, Treatment, Technologies.', 'This volume covers the technologies that are applied to the treatment and purification of water. Those who are generally familiar with this field will immediately embrace the subject as a treatise on solid-liquid separations. However, the subject is much broader, in that the technologies discussed are not just restricted to pollution control hardware that rely only upon physical methods of treating and purify-mg waste-waters. The book attempts to provide as wide a coverage as possible those technologies applicable to both water (e.g., drinking water) and wastewater (Le., industrial and municipal) sources. The methods and technologies discussed are a combination of physical, chemical and thermal techniques.', NULL, '7655103.JPG', '3333012.pdf', 1, 2002, 'New Delhi', 47, '2019-01-30 21:41:15', '2019-01-30 21:41:15', '203.190.10.206'),
(1056, 30, 1, NULL, 1, 'Wind Energy Handbook', 'wind-energy-handbook', '1st edi.', '978-0471489979', NULL, 'Wind, Energy, Handbook.', 'As environmental concerns have focused attention on the generation of electricity from clean and renewable sources wind energy has become the world\'s fastest growing energy source. The Wind Energy Handbook draws on the authors\' collective industrial and academic experience to highlight the interdisciplinary nature of wind energy research and provide a comprehensive treatment of wind energy for electricity generation.', NULL, '5465403.jpg', '5859452.pdf', 1, 2001, NULL, 47, '2019-01-30 21:46:02', '2019-01-30 21:46:02', '203.190.10.206'),
(1057, 186, 1, NULL, 1, 'A Heat Transfer Textbook', 'a-heat-transfer-textbook', '3rd edi.', '978-0486479316', NULL, 'Heat, Transfer, Heat Transfer.', 'This introduction to heat transfer offers advanced undergraduate and graduate engineering students a solid foundation in the subjects of conduction, convection, radiation, and phase-change, in addition to the related topic of mass transfer. A staple of engineering courses around the world for more than three decades, it has been revised and updated regularly by the authors, a pair of recognized experts in the field. The text addresses the implications, limitations, and meanings of many aspects of heat transfer, connecting the subject to its real-world applications and developing students\' insight into related phenomena. Three introductory chapters form a minicourse in heat transfer, covering all of the subjects discussed in detail in subsequent chapters.', NULL, '9800208.jpg', '9640746.pdf', 1, 2011, 'USA', 47, '2019-01-30 22:00:53', '2019-01-30 22:00:53', '203.190.10.206');
INSERT INTO `items` (`id`, `publisher_id`, `category_id`, `project_supervisor`, `item_standard_number_id`, `title`, `slug`, `edition`, `itemStandardNumberValue`, `issue`, `keywords`, `summary`, `imageUrl`, `uploadImageUrl`, `pdfUrl`, `isPublished`, `publicationYear`, `placeOfPublication`, `user_id`, `created_at`, `updated_at`, `ip_address`) VALUES
(1058, 386, 1, NULL, 1, 'Mercury Cadmium Telluride: Growth, Properties and Applications', 'mercury-cadmium-telluride-growth-properties-and-applications', '1st edi.', '978-0470697061', NULL, 'Mercury, Cadmium,  Applications.', 'Mercury cadmium telluride (MCT) is the third most well-regarded semiconductor after silicon and gallium arsenide and is the material of choice for use in infrared sensing and imaging. The reason for this is that MCT can be â€˜tunedâ€™ to the desired IR wavelength by varying the cadmium concentration. Mercury Cadmium Telluride: Growth, Properties and Applications provides both an introduction for newcomers, and a comprehensive review of this fascinating material. Part One discusses the history and current status of both bulk and epitaxial growth techniques, Part Two is concerned with the wide range of properties of MCT, and Part Three covers the various device types that have been developed using MCT. Each chapter opens with some historical background and theory before presenting current research.', NULL, NULL, '8193197.pdf', 1, 2010, NULL, 47, '2019-01-30 22:08:51', '2019-01-30 22:08:51', '203.190.10.206'),
(1059, 387, 1, NULL, 1, 'National Electrical Code 2002', 'national-electrical-code-2002', NULL, NULL, NULL, 'Electrical Code , Electrical', 'NFPA codes, standards, recommended practices, and guides, of which the document contained herein is one, are developed through a consensus standards development process approved by the American National Standards Institute. This process brings together volunteers representing varied viewpoints and interests to achieve consensus on fire and other safety issues. While the NFPA administers the process and establishes rules to promote fairness in the development of consensus, it does not independently test, evaluate, or verify the accuracy of any information or the soundness of any judgments contained in its codes and standards.', NULL, '5125427.JPG', '2341603.pdf', 1, 2002, 'USA', 48, '2019-01-30 22:20:49', '2019-01-30 22:20:49', '203.190.10.204'),
(1060, 245, 1, NULL, 1, 'Principles of Electronic Materials and Devices', 'principles-of-electronic-materials-and-devices', '3rd edi.', '978-0073104645', NULL, 'Principles of Electronic, Devices.', 'Principles of Electronic Materials and Devices, Third Edition, is a greatly enhanced version of the highly successful text Principles of Electronic Materials and Devices, Second Edition. It is designed for a first course on electronic materials given in Materials Science and Engineering, Electrical Engineering, and Physics and Engineering Physics Departments at the undergraduate level.The third edition has numerous revisions that include more beautiful illustrations and photographs, additional sections, more solved problems, worked examples, and end-of-chapter problems with direct engineering applications.', NULL, '1136083.jpg', '2464041.pdf', 1, 2005, 'Canada', 47, '2019-01-30 22:23:24', '2019-01-30 22:23:46', '203.190.10.206'),
(1061, 49, 1, NULL, 1, 'An Introduction to Probability Theory and Its Applications', 'an-introduction-to-probability-theory-and-its-applications', '3rd ed.', NULL, NULL, 'Probability Theory', 'THE EXPOSITION CONTAINS MANY SIDE EXCURSIONS AND DOES NOT ALWAYS progress from the easy to the difficult; comparatively technical sections appear at the beginning and easy sections in chapters XV and XVII.\r\nInexperienced readers should not attempt to follow many side lines, lest\r\nthey lose sight of the forest for too many trees. Introductory remarks\r\nto the chapters and stars at the beginnings of sections should facilitate\r\norientation and the choice of omissions. The unstarred sections form a\r\nself-contained whole in which the starred sections are not used.', NULL, '6819316.jpg', '4720514.pdf', 1, 1968, 'New York', 51, '2019-01-31 01:10:57', '2019-01-31 01:10:57', '203.190.8.116'),
(1062, 388, 1, NULL, 1, 'Lessons In Electric Circuits, Volume VI â€“ Experiments', 'lessons-in-electric-circuits-volume-vi-experiments', NULL, '978-1907653131', NULL, 'Electronics, Electric Circuits.', 'Electronics is a science, and a very accessible science at that. With other areas of scientific study, expensive equipment is generally required to perform any non-trivial experiments. Not so with electronics. Many advanced concepts may be explored using parts and equipment totaling under a few hundred US dollars. This is good, because hands-on experimentation is vital to gaining scientific knowledge about any subject.', NULL, '8656106.jpg', '2862526.pdf', 1, 2013, NULL, 51, '2019-01-31 01:22:06', '2019-01-31 01:22:06', '203.190.8.116'),
(1063, 49, 1, NULL, 1, 'Lead-Free Electronics: iNEMI Projects Lead to Successful Manufacturing', 'lead-free-electronics-inemi-projects-lead-to-successful-manufacturing', NULL, '9780471448877', NULL, 'Lead-Free Electronics', 'Based on the results of a more than two-year study, Lead-Free Electronics: iNEMI Projects Lead to Successful Manufacturing is the first practical, primary reference to cover Pb-free solder assembly as well as the analysis and reasoning behind the selection of Sn-Ag-Cu as the recommended Pb-free replacement for Sn-Pb.', NULL, '9628812.jpg', '4062658.pdf', 1, 2007, 'New Jersey', 51, '2019-01-31 01:29:54', '2019-01-31 01:29:54', '203.190.8.116'),
(1064, 389, 1, NULL, 1, 'Switchgear Manual', 'switchgear-manual', '10th ed.', '3-46448236-7', NULL, 'Switch, gear, Manual', 'More than 50 years after publication of the first edition of the BBC switchgear manual by A. Hoppner, the 10th revised edition is now available as the ABB Calor Emag switchgear manual. As always, it is intended for both experienced switchgear professionals as well as beginners and students.', NULL, '4232237.JPG', '4897378.pdf', 1, 2001, 'Berlin', 50, '2019-01-31 14:54:10', '2019-01-31 14:54:10', '203.190.8.116'),
(1065, 389, 1, NULL, 1, 'Switchgear Manual', 'switchgear-manual-31570902', '10th ed.(B)', '3-46448236-7', NULL, 'Switch, gear, Manual', 'More than 50 years after publication of the first edition of the BBC switchgear manual by A. Hoppner, the 10th revised edition is now available as the ABB Calor Emag switchgear manual. As always, it is intended for both experienced switchgear professionals as well as beginners and students.', NULL, '6756004.JPG', '6632034.pdf', 1, 2004, 'Berlin', 50, '2019-01-31 14:57:02', '2019-01-31 14:57:02', '203.190.8.118'),
(1066, 389, 1, NULL, 1, 'ABB Transformer Handbook', 'abb-transformer-handbook', '3rd Edition', '978-2013080521', NULL, 'ABB, Transformer, Handbook', 'The objective of this Transformer Handbook is to facilitate the physical understanding, selection, ordering, operation and maintenance of the whole range of power and distribution transformers. The target readers are personnel involved in the various stages of a transformer\'s service life, from planning the investment to the disposal of the transformer after use. The handbook is arranged with the sections following the transformer\'s life from initial considerations and planning through ordering, installation, operation, maintenance and scrapping. Other useful information, including more theoretical topics, is included. Navigation through the handbook is facilitated through a three level contents list following this foreword, and the Index Section 19 page 210 at the end. Each section may be read independently of the other sections.', NULL, '6708701.jpg', '3220826.pdf', 1, 2007, 'Berlin', 50, '2019-01-31 15:03:47', '2019-01-31 15:03:47', '203.190.8.116'),
(1067, 62, 1, NULL, 1, 'Fundamentals of Digital Communication', 'fundamentals-of-digital-communication', NULL, '978-0-511-38606-0', NULL, 'Digital Communication', 'The field of digital communication has evolved rapidly in the past few decades, with commercial applications proliferating in wireline communication networks (e.g., digital subscriber loop, cable, fiber optics), wireless communication (e.g., cell phones and wireless local area networks), and storage media (e.g., compact discs, hard drives). The typical undergraduate and graduate student is drawn to the field because of these applications, but is often intimidated by the mathematical background necessary to understand communication theory. A good lecturer in digital communication alleviates this fear by means of examples, and covers only the concepts that directly impact the applications being studied. The purpose of this text is to provide such a lecture style exposition to provide an accessible, yet rigorous, introduction to the subject of digital communication. This book is also suitable for self-study by practitioners who wish to brush up on fundamental concepts.', NULL, '7328433.PNG', '1910054.pdf', 1, 2008, 'UK', 39, '2019-01-31 15:32:07', '2019-01-31 15:32:07', '203.190.11.123'),
(1068, 52, 1, NULL, 1, 'Instructor\'s Resource Manual to accompany ELECTRONIC DEVICES', 'instructors-resource-manual-to-accompany-electronic-devices', '6th ed.', '0-13-092257-9', NULL, 'Instructor\'s, Resource, Manual, accompany, ELECTRONIC, DEVICES', 'Summary of Multisim Circuit Results; Special Topics; Test Item File; Laboratory Solutions for Experiments in Electronics Fundamentals and Electric Circuits Fundamentals by David Buchla; Partial List of CEMA Skills', NULL, '9375123.JPG', '7938229.pdf', 1, 2002, 'NEW JARCY', 50, '2019-01-31 15:35:40', '2019-01-31 15:35:40', '203.190.8.118'),
(1069, 175, 1, NULL, 1, 'Sliding Mode Control in Engineering', 'sliding-mode-control-in-engineering', NULL, '0-8247-0671-4', NULL, 'Sliding Mode , Engineering', 'Many physical systems naturally require the use of discontinuous terms in their dynamics. This is, for instance, the case of mechanical systems with friction. This fact was recognized and advantageously exploited since the very beginning of the 20th century for the regulation of a large variety of dynamical systems. The keystone of this new approach was the theory of differential equations with discontinuous right-hand sides pioneered by academic groups of the former Soviet Union.', NULL, '7218822.JPG', '5259937.pdf', 1, 2002, 'New York', 48, '2019-01-31 15:46:12', '2019-01-31 15:46:12', '203.190.10.204'),
(1070, 49, 1, NULL, 1, 'Space-Time Coding', 'space-time-coding', '1st ed.', '0-470-84757-3', NULL, 'Space, Time, Coding', 'This book is intended to provide an introductory coverage of the subject of space-time coding. It has arisen from our research, short continuing education courses, lecture series and consulting for industry. Its purpose is to provide a working knowledge of space-time coding and its application to wireless communication systems. With the integration of Internet and multimedia applications in next generation wireless communications, the demand for wide-band high data rate communication services is growing. As the available radio spectrum is limited, higher data rates can be achieved only by designing more efficient signaling techniques.', NULL, '7649099.JPG', '8729052.pdf', 1, 2003, 'England', 50, '2019-01-31 15:48:21', '2019-01-31 15:48:21', '203.190.8.118'),
(1071, 64, 1, NULL, 1, 'Stability Analysis of Nonlinear Microwave Circuits', 'stability-analysis-of-nonlinear-microwave-circuits', '1st ed.', '1-58053-303-5', NULL, 'Stability, Analysis, Nonlinear, Microwave, Circuits', 'The increasing use of high-frequency integrated circuits monolithic microwave\r\nintegrated circuits (MMICs) in modern communications systems requires an\r\naccurate prediction of their response at the simulation stage because this technology does not allow any circuit modification after manufacturing. The\r\nmicrowave circuits are often designed using frequency-domain techniques, like\r\nharmonic balance. With this technique, only the steady state is analyzed, and\r\nthe experimental solution may be very different from the simulated one. In\r\nnonlinear circuits, two or more steady-state solutions of same or different types\r\nmay coexist for a given set of circuit-parameter values.', NULL, '6307326.JPG', '6289049.pdf', 1, 2003, 'London', 50, '2019-01-31 15:51:29', '2019-01-31 15:51:29', '203.190.11.117'),
(1072, 10, 1, NULL, 1, 'Fundamental Limitations in Filtering and Control', 'fundamental-limitations-in-filtering-and-control', NULL, '3-540-76126-8', NULL, 'Filtering and Control', 'This book deals with the issue of fundamental limitations in ï¬ltering and control system design. This issue lies at the very heart of feedback theory since it revealswhat is achievable,and conversely what is not achievable, in feedbacksystems. The subject has a rich history beginning with the seminal work of Bode during the 1940â€™sand as subsequently published in his well-known book Feedback Ampliï¬er Design (Van Nostrand, 1945).An interesting fact is that, although Bodeâ€™s book is now ï¬fty years old, it is still extensively quoted. This is supported by a science citation count which remains comparable with the bestcontemporary texts on control theory.', NULL, '3907481.jpg', '8442269.pdf', 1, 1997, 'Great Britain', 39, '2019-01-31 15:52:59', '2019-01-31 15:52:59', '203.190.11.123'),
(1073, 10, 1, NULL, 1, 'Abstract Harmonic Analysis of Continuous Wavelet Transforms', 'abstract-harmonic-analysis-of-continuous-wavelet-transforms-31001131', '1st ed.', '3-540-24259-7', NULL, 'Abstract, Harmonic, Analysis, Continuous, Wavelet, Transforms', 'This volume discusses a construction situated at the intersection of two different mathematical fields: Abstract harmonic analysis, understood as the theory of group representations and their decomposition into irreducibles on the one hand, and wavelet (and related) transforms on the other. In a sense the volume reexamines one of the roots of wavelet analysis: The paper [60] by Grossmann, Morlet and Paul may be considered as one of the initial sources of wavelet theory, yet it deals with a unitary representation of the affine group, citing results on discrete series representations of nonunimodular groups due to Duflo and Moore. It was also observed in [60] that the discrete series setting provided a unified approach to wavelet as well as other related transforms, such as the windowed Fourier transform.', NULL, '1928044.JPG', '3558090.pdf', 1, 2005, 'New York', 50, '2019-01-31 16:00:31', '2019-01-31 16:00:31', '203.190.11.117'),
(1074, 390, 1, NULL, 1, 'Solid State Electronic Devices : Instructor\'s Solutions Manual', 'solid-state-electronic-devices-instructors-solutions-manual', '6th', '9780131497276', NULL, 'Electronic Devices , Electronic', 'Provides practical applications and useful examples for electrical motors, mechanical structures, robotics and manipulators, uncertain systems, power converters, and signal reconstruction.', NULL, '2015194.JPG', '1785462.pdf', 1, 2006, 'Austin', 48, '2019-01-31 16:00:58', '2019-01-31 16:00:58', '203.190.10.204'),
(1075, 391, 1, NULL, 1, 'Introduction to Microcontrollers', 'introduction-to-microcontrollers', '1st ed.', 'N/A', NULL, 'Introduction, Microcontrollers', 'This book has been developed for the introductory courses on microcontrollers\r\n\r\nIt introduces undergraduate students to the field of microcontrollers - what they are, how they work, how they interface with their I/O components, and what considerations the programmer has to observe in hardware-based and embedded programming.\r\n\r\nThis text is not intended to teach one particular controller architecture in depth, but should rather give an impression of the many possible architectures and solutions one can come across in today\'s microcontrollers.\r\n\r\nWe concentrate, however, on small 8-bit controllers and their most basic features, since they already offer enough variety to achieve our goals.', NULL, '7907374.JPG', '2806513.pdf', 1, 2007, 'New York', 50, '2019-01-31 16:17:40', '2019-01-31 16:17:40', '203.190.11.117'),
(1076, 52, 1, NULL, 1, 'Solid State Electronic Devices', 'solid-state-electronic-devices', '4th', '0-13-158767-6', NULL, 'Electronic , Devices', 'The electronic and optical properties of semiconductor materials are strongly affected by impurities, which may be added in precisely controlled amounts Coif impurities are lied en Vary the conductivities of semiconductors over wide ranges and even to alter the nature of the conduction processes from conduction by negative charge carriers to positive charge carriers. For ex-ample, an impurity concentration of one part per million can change a sample of Si from a poor conductor to a good conductor of electric current. This process of controlled addition of impurities, called doping, will be discussed in detail in subsequent chapters.', NULL, '5190786.JPG', '4407887.pdf', 1, 1995, 'new jersey', 48, '2019-01-31 16:20:25', '2019-01-31 16:20:25', '203.190.10.204'),
(1077, 63, 1, NULL, 1, 'Fundamentals of Air Pollution', 'fundamentals-of-air-pollution', '3rd.', '0121189309', NULL, 'Air Pollution', 'The authors of this book include a chemist (Donald L. Fox), a meteorolo-gist (D. Bruce Turner), and a mechanical engineer (Richard W. Boubel). This 1:1:1 ratio has some relevance in that it approximates the ratio of those professionally involved in the field of air pollution. In the environmental protection and management field, the experience of the recent past has been that physicists and electrical engineers have been most attracted to the radiation, nuclear, and noise areas; biologists and civil engineers to the aquatic and solid waste areas; chemists, meteorologists, and chemical and mechanical engineers to the area of air pollution and its control. These remarks are not intended to exclude all others from the party (or from this course). The control of air pollution requires the combined efforts of all the professions mentioned, in addition to the input of physicians, lawyers, and social scientists. However, the professional mix of the authors, and their expectation of a not-too-', NULL, '5065542.PNG', '4127053.pdf', 1, 1994, 'New York', 39, '2019-01-31 16:21:23', '2019-01-31 16:21:23', '203.190.11.210'),
(1078, 294, 1, NULL, 1, 'Modern Communication Circuits', 'modern-communication-circuits', '2nd ed.', '978-0070592834', NULL, 'Modern, Communication, Circuits', 'This text introduces many of the fundamental circuit concepts used in modern receivers and transmitters. By foregoing detailed mathematical treatment, it emphasizes convenient and effective approximations for the analysis and design of communication circuits. Computerized circuit simulation methods are used throughout to facilitate detailed circuit analysis.', NULL, '7621379.jpg', '8177466.pdf', 1, 1997, 'New York', 50, '2019-01-31 16:24:17', '2019-01-31 16:24:17', '203.190.11.118'),
(1079, 392, 1, NULL, 1, 'Fundamentals of Computational Fluid Dynamics', 'fundamentals-of-computational-fluid-dynamics', NULL, NULL, NULL, NULL, NULL, NULL, '5588727.jpg', '9092757.pdf', 1, 1999, 'Canada', 39, '2019-01-31 16:25:56', '2019-01-31 16:25:56', '203.190.11.210'),
(1080, 12, 1, NULL, 1, 'Signal Processing for Communications', 'signal-processing-for-communications', NULL, '978-1-4200-7046-0', NULL, 'Signal , Processing', 'A signal technically yet generally speaking, is a a formal description of a phenomenon evolving over time or space; by signal processing we denote any manual or \"mechanical\" operation which modifies, analyzes or other-wise manipulates the information contained in a signal. Consider the simple example of ambient temperature: once we have agreed upon a formal model for this physical variable â€” Celsius degrees, for instance â€” we can record the evolution of temperature over time in a variety of ways and the resulting data set represents a temperature \"signal\".', NULL, '3030829.JPG', '9425716.pdf', 1, 2008, 'switzerland', 48, '2019-01-31 16:32:46', '2019-01-31 16:32:46', '203.190.10.204'),
(1081, 96, 1, NULL, 1, 'Fundamentals of Light Sources and Lasers', 'fundamentals-of-light-sources-and-lasers-31351101', NULL, '9 8 7 6 5 4 3 2 1', NULL, 'Light Sources and Lasers', 'This book, targeted primarily to the scientist or engineer using the technology, offers the reader theory coupled with practical, real-world examples based on real laser systems. We begin with a look at the basics of light emission, including blackbody radiation and atomic emission, followed by an outline of quantum mechanics. For some readers this will be a basic review; however, the availability of background material alleviates the necessity to refer back constantly to a second (or third) book on the subject. Throughout the book, practical, solved examples founded on real-world laser systems allow direct application of concepts covered. Case studies in later chapters allow the reader to further apply concepts in the text to real-world laser systems. The book is also ideal for students in an undergraduate course on lasers and light sources. Indeed, the original design was for a textbook for an applied degree course (actually, two courses) in laser engineering. Unlike many existing te', NULL, '9262143.jpg', '9420361.pdf', 1, 2004, 'New Jersey', 39, '2019-01-31 16:35:01', '2019-01-31 16:35:01', '203.190.11.210'),
(1082, 49, 1, NULL, 1, 'Quantum Chemistry', 'quantum-chemistry', NULL, NULL, NULL, 'Black-Body Radiation, Normal Coordinates, Degenerate Systems, Electronic States of Complex Atoms, Approximate Molecular Partition Functions,', 'In so far as quantum mechanics is correct, chemical questions are problems in applied mathematics. In spite of this, chemistry, because of its complexity, will not cease to be in large measure an experimental science, even as for the last three hundred years the laws governing the motions of celestial bodies have been understood without eliminating the need for direct observation. No chemist, however, can afford to be uninformed of a theory which systematizes all of chemistry even though mathematical complexity often puts exact numerical results beyond his immediate reach.', NULL, '6322285.gif', '1343453.pdf', 1, 1944, 'New York', 49, '2019-01-31 16:40:49', '2019-01-31 16:40:49', '203.190.11.117'),
(1083, 49, 1, NULL, 1, 'Field and Waves in Communication Electronics', 'field-and-waves-in-communication-electronics', '3rd', '978-0-471-58551-0', NULL, 'Communication , Electronics', 'Electric fields have their sources in electric chargesâ€”electrons and ions. Nearly all real electric fields vary to some extent with time, but for many problems the time variation is slow and the field may be considered stationary in rime (static) over the interval of interest. For still other important cases the spatial distribution is nearly the same as for static fields even though the actual fields may vary rapidly with time. Because of the number of important cases in each of these classes, and because static field concepts are simple and thus good fix reviewing the vector operations needed to describe fields quantitatively, we start with static electric fields in this chapter and static magnetic fields in the next.', NULL, '6343633.JPG', '2905329.pdf', 1, 1994, 'Canada', 48, '2019-01-31 16:44:36', '2019-01-31 16:44:36', '203.190.10.204'),
(1084, 10, 1, NULL, 1, 'NETWORK CALCULUS A Theory of Deterministic Queuing Systems for the Internet', 'network-calculus-a-theory-of-deterministic-queuing-systems-for-the-internet', '1st ed.', '978-3662175033', NULL, 'NETWORK, CALCULUS', 'Network Calculus is a set of recent developments that provide deep insights into flow problems encountered in networking. The foundation of network calculus lies in the mathematical theory of dioids, and in particular, the Min-Plus dioid (also called Min-Plus algebra). With network calculus, we are able to understand some fundamental properties of integrated services networks, window flow control, scheduling and buffer or delay dimensioning.', NULL, '2407550.JPG', '5667427.pdf', 1, 2002, 'New York', 50, '2019-01-31 16:47:10', '2019-01-31 16:47:10', '203.190.11.118'),
(1085, 10, 1, NULL, 1, 'Fundamentals of Power Semiconductor Devices', 'fundamentals-of-power-semiconductor-devices', NULL, '978-0-387-47313-0', NULL, 'Power Semiconductor Devices', 'Today the semiconductor business exceeds $200 billion with about 10% of the revenue derived from power semiconductor devices and smart power integrated circuits. Power semiconductor devices are recognized as a key component for all power electronic systems. It is estimated that at least 50% of the electricity used in the world is controlled by power devices. With the widespread use of electronics in the consumer, industrial, medical, and transportation sectors, power devices have a major impact on the economy because they determine the cost and efficiency of systems. After the initial replacement of vacuum tubes by solid-state devices in the 1950s, semiconductor power devices have taken a dominant role with silicon serving as the base material. These developments have been referred to as the Second Electronic Revolution.', NULL, '8784703.PNG', '5838545.pdf', 1, 2003, 'USA', 39, '2019-01-31 16:50:50', '2019-01-31 16:50:50', '203.190.11.210'),
(1086, 103, 1, NULL, 1, 'Strategies and applications in Quantum Chemistry : From Molecular Astrophysics to Molecular Engineering', 'strategies-and-applications-in-quantum-chemistry-from-molecular-astrophysics-to-molecular-engineering', NULL, '0-306-46930-8', NULL, 'Theory of orbital optimization in SCF and MCSCF calculations, Quantum chemistry in front of symmetry breakings, Core-valence separation in the study of atomic clusters, CI calculations of miscellaneous spectroscopic observables for the and states.', 'Starting from pure academic knowledge, Quantum Chemistry has gained the rank of full\r\npartner in most chemical research carried out today, from organic chemistry to solid state\r\nchemistry, from biology to material sciences, from astrophysics to chemical engineering.\r\nEvolution has been rapid. After a promising start in the mid twenties, Quantum Chemistry then faced the first technological block: the numerical barrier. The consequence has been a flourishing of concepts still found in the present literature and in the common langage of all physico-chemists when it comes to understanding the basic phenomena.', NULL, '2969249.jpg', '1308288.pdf', 1, 2002, 'New York', 49, '2019-01-31 16:51:43', '2019-01-31 16:51:43', '203.190.11.117'),
(1087, 49, 1, NULL, 1, 'Signals and Systems', 'signals-and-systems', NULL, '0-471-13820-7', NULL, 'Signals , Systems', 'There are three basic elements to every communication system, namely, transmitter, channel, and receiver, as depicted in Fig. 1.2. The transmitter is located at one point in space, the receiver is located at some other point separate from the transmitter, and the channel is the physical medium that connects them together. Each of these three elements may be viewed as a system with associated signals of its own. The purpose of the transmitter is to convert the message signal produced by a source of information into a form suitable for transmission over the channel.', NULL, '4032405.JPG', '3263677.pdf', 1, 1999, 'New York', 48, '2019-01-31 16:58:58', '2019-01-31 16:58:58', '203.190.10.204'),
(1088, 393, 1, NULL, 1, 'Linear Algebra', 'linear-algebra', '1st ed.', '978-1937585259', NULL, 'Linear, Algebra', 'These notes started during the Spring of 2002, when John MAJEWICZ\r\nand I each taught a section of Linear Algebra. I would like to thank him\r\nfor numerous suggestions on the written notes.Linear Algebra is often a studentâ€™s first introduction to abstract mathematics. Linear Algebra is well suited for this, as it has a number of beautiful but elementary and easy to prove theorems. My purpose with these notes is to introduce students to the concept of proof in a gentle manner.', NULL, '2665547.jpg', '4465284.pdf', 1, 2004, 'Philadelphia', 50, '2019-01-31 17:00:55', '2019-01-31 17:00:55', '203.190.11.118'),
(1089, 72, 1, NULL, 1, 'Sensors and Transducers', 'sensors-and-transducers', '3rd', '0 7506 4932 1', NULL, 'Sensors , Transducers', 'This third edition of Sensors and Transducers has been thoroughly revised to take account of the ever-increasing role of these components and of improvements in design. New tables of properties and illustrations have also been added. The topic of switches and switching actions has also been added because so many types of sensor are intended ultimately to provide a switching action.', NULL, '2908510.JPG', '3644861.pdf', 1, 2001, 'Boston', 48, '2019-01-31 17:07:16', '2019-01-31 17:07:16', '203.190.10.204'),
(1090, 74, 1, NULL, 1, 'Optical Communications Rules of Thumb', 'optical-communications-rules-of-thumb', '1st ed.', '978-0071737982', NULL, 'Optical, Communications, Rules, Thumb', 'We are taking the unique â€œrules of thumbâ€ format that drove the authorsâ€™ previous Photonics Rules of Thumb, and creating a new volume for the Optical telecommunications field. Rules of thumb are short-cuts, tricks, and methods that industry vets have developed through long years of trial and error. These books share such rules with less experienced readers, who find such information incredibly valuable.', NULL, '2008017.JPG', '6136405.pdf', 1, 2002, 'New York', 50, '2019-01-31 17:07:20', '2019-01-31 17:07:20', '203.190.11.118'),
(1091, 10, 1, NULL, 1, 'Semiconductor-Laser Fundamentals', 'semiconductor-laser-fundamentals-31161216', NULL, '3-540-64166-1', NULL, 'Semiconductor , Laser , Fundamentals', '\"Semiconductor-Laser Fundamentals: Physics of the Gain Materials\". To provide the background of introducing the new developments, we integrated into this book the material related part of our original \"Semiconductor-Laser Physics\" book. Besides some of the basic chapters, that have been updated and reorganized, we extensively cover band structure engineering aspects and the microscopic theory of the semiconductor gain materials in order to ad-equately account for the recent progress in materials and theoretical under-standing. We included a wealth of examples, involving many different material combinations that are used in quantum-well laser systems.', NULL, '3548125.JPG', '5580478.pdf', 1, 1999, 'Germany', 48, '2019-01-31 17:16:16', '2019-01-31 17:16:16', '203.190.10.204'),
(1092, 10, 1, NULL, 1, 'Optimal Sampled-Data Control Systems', 'optimal-sampled-data-control-systems', '1st ed.', '978-1447130390', NULL, 'Optimal, Sampled, Data, Control, Systems', 'mong the many techniques for designing linear multivariable analogue controllers, the two most popular optimal ones are H2 and H-infinity optimization. The fact that most new industrial controllers are digital provides strong motivation for adapting or extending these techniques to digital control systems. This book, now available as a corrected reprint, attempts to do so. Part I presents two indirect methods of sampled-data controller design: These approaches include approximations to a real problem, which involves an analogue plant, continuous-time performance specifications, and a sampled-data controller. Part II proposes a direct attack in the continuous-time domain, where sampled-data systems are time-varying. The findings are presented in forms that can readily be programmed in, e.g., MATLAB.', NULL, '6871105.JPG', '5773088.pdf', 1, 1995, 'New York', 50, '2019-01-31 17:16:30', '2019-01-31 17:16:30', '203.190.11.117'),
(1093, 74, 1, NULL, 1, 'Packet Broadband Network Handbook', 'packet-broadband-network-handbook', '1st ed.', '978-0071408370', NULL, 'Packet, Broadband, Network, Handbook', 'This book introduces four widely deployed packet network technologies: X.25, frame relay, asynchronous transfer mode (ATM), and Internet protocol (IP). Before packet networks, communications technology used circuitswitched telephone networks with dedicated, analog circuits that functioned on a â€œalways on once activatedâ€ basis. A dedicated circuit cannot be used for other purposes even if no communications are taking place at the moment.The most comprehensive book on the shelf about a family of technologies that are cornering the market in enhanced telecommunications services.', NULL, '8482189.JPG', '7110975.pdf', 1, 2002, 'London', 50, '2019-01-31 17:20:26', '2019-01-31 17:20:26', '203.190.11.115'),
(1094, 12, 1, NULL, 1, 'Shipboard Electrical Power Systems', 'shipboard-electrical-power-systems', NULL, '978-1-4398-2816-8', NULL, 'Electrical Power , Shipboard', 'It is in this light that modern commercial and military ship builders arc looking for electrical power engineers to meet their rapidly growing need for large. fast. diffident, and reconfigurable ships to compete in the international market. There is no single book available today that coven the entire scope of shipboard power systems. The marine engineering students and industry professionals have been relying on limited publications in bits and pieces presented at various conferences and a few books having short sections with sketchy coverage on this wide subject. This book is the first comprehensive volume of its kind that focuses on all aspects of shipboard electrical power systems.', NULL, '4022012.JPG', '9831031.pdf', 1, 2012, 'USA', 48, '2019-01-31 17:27:09', '2019-01-31 17:27:09', '203.190.10.204'),
(1095, 210, 1, NULL, 1, 'Partial Differential Equations', 'partial-differential-equations', '1st ed.', '978-1502910967', NULL, 'Partial, Differential, Equations', 'These lecture notes are intented as a straightforward introduction to partial\r\ndifferential equations which can serve as a textbook for undergraduate and\r\nbeginning graduate students.', NULL, '9180414.jpg', '9581278.pdf', 1, 2012, 'U.S.A', 50, '2019-01-31 17:28:00', '2019-01-31 17:28:00', '203.190.11.115'),
(1096, 213, 1, NULL, 1, 'Digital Signal Processing : Covers Signals and Systems : Includes Matlab Programs', 'digital-signal-processing-covers-signals-and-systems-includes-matlab-programs', NULL, '0-07-463996-X', NULL, 'Signal Processing , Signal', 'Signals play a major role in our life. In general, a signal can be a function of time, distance, position, temperature, pressure, etc., and it represents some variable of interest associated with a system. For example, in an electrical system the associated signals are electric current and voltage. In a mechanical system, the associated signals may be force, speed, torque, etc. In addition to these, some examples of signals that we encounter in our daily life are speech, music, picture and video signals. A signal can be represented in a number of ways. Most of the signals that we come across are generated naturally.', NULL, '6061803.JPG', '7055421.pdf', 1, 2000, 'Delhi', 48, '2019-01-31 17:44:22', '2019-01-31 17:44:22', '203.190.10.204'),
(1097, 394, 1, NULL, 1, 'STANDARD SPECIFICATIONS FOR PERMANENT MAGNET MATERIALS', 'standard-specifications-for-permanent-magnet-materials', '1st ed.', NULL, NULL, 'STANDARD, SPECIFICATIONS, MAGNET, MATERIALS', 'This publication represents standard practices in the United States relating to permanent magnet materials. This standard is a revision of â€œMMPA Standard OlOO-Standard Specifications for Permanent Magnet Materialsâ€ which was originally published in 1964, plus important information from the latest documents prepared by the International Electrotechnical Commission (IEC) Technical Committee 68.', NULL, '2111319.JPG', '5737110.pdf', 1, 1970, 'Chicago', 50, '2019-01-31 17:51:41', '2019-01-31 17:51:41', '203.190.11.116'),
(1098, 222, 1, NULL, 1, 'Quantum Chemistry', 'quantum-chemistry-31521208', '3rd ed.', '012457551X', NULL, 'Classical Wave Equation, The Wave Nature of Matter, Ring of Constant Potential,  Quantum-Mechanical Harmonic Oscillator, The Hydrogenlike Ion, Angular Momentum, and the Rigid Rotor, Matrix Formulation of the Linear Variation Method.', 'We have attempted to improve and update this text while retaining the features that make it unique, namely, an emphasis on physical understanding, and the ability to estimate, evaluate, and predict results without blind reliance on computers, while still maintaining rigorous connection to the mathematical basis for quantum chemistry. We have inserted into most chapters examples that allowimportant points to be emphasized, clarified, or extended. This has enabled us to keep intact most of the conceptual development familiar to past users. In addition, many of the chapters now include multiple choice questions that students are invited to solve in their heads.', NULL, '6075685.jpg', '3231743.pdf', 1, 2006, 'New York', 49, '2019-01-31 17:52:08', '2019-01-31 17:52:08', '203.190.11.116'),
(1099, 395, 1, NULL, 1, 'Electrical Transmission and Distribution Reference Book', 'electrical-transmission-and-distribution-reference-book', '4th', NULL, NULL, 'Electrical Transmission , Distribution Reference Book', 'Through discovery, invention, and engineering application, the engineer has made electricity of continually greeter 1st to mankind. The invention of the dynamo first mantle engine power many tines more effective in relieving the toil and increasing the opportunities and comforts not only of industry but also of the home. Its scope, however, was limited to relatively short distances from the power station because of the low voltage of the distribution circuits. This limitation, for economic reasons, kept, the general IN: of electricity confined to city areas \\\\.here a number of customers could be served from the same power station.', NULL, '6850447.JPG', '6189641.pdf', 1, 1964, 'USA', 48, '2019-01-31 17:54:30', '2019-01-31 17:54:30', '203.190.10.204'),
(1100, 74, 1, NULL, 1, 'Photodetection and Measurement: Maximizing Performance in Optical Systems', 'photodetection-and-measurement-maximizing-performance-in-optical-systems', '1st ed.', '978-0071409445', NULL, 'Photodetection, Measurement', 'This text takes an interdisciplinary approach to international business, building on the various business disciplines that make up the field. In-depth integration is provided throughout the book, as well as via a concluding section on international strategic alliances and a series of integrated case studies. The book is aimed at providing cutting-edge, rigorous knowledge, while incorporating a solid theoretical base and information from research and the corporate world in an accessible format.', NULL, '2734180.JPG', '7320391.pdf', 1, 2003, 'London', 50, '2019-01-31 18:01:57', '2019-01-31 18:01:57', '203.190.11.116'),
(1101, 210, 1, NULL, 1, 'Lectures in Theoretical Biophysics', 'lectures-in-theoretical-biophysics', NULL, '978-1506171715', NULL, 'Theoretical Biophysics', 'In this section we assume that the constituents of matter can be described classically. We are interested in reaction processes occuring in the bulk, either in physiological liquids, membranes or proteins.', NULL, '2219413.jpg', '1267307.pdf', 1, 2000, 'U.S.A', 51, '2019-01-31 19:07:48', '2019-01-31 19:07:48', '203.190.11.118'),
(1102, 329, 1, NULL, 1, 'RF Technologies for Low Power Wireless Communication', 'rf-technologies-for-low-power-wireless-communication', NULL, '0-471-22164-3', NULL, 'RF Technologies , Wireless Communication', 'The driving purpose of recent advances in communications technology has been to untether users, allowing them complete mobility and freedom of movement while maintaining their connection to electronic services. The wireless revolution has led to an expectation that voice, fax, and data services, and even internet access, can be available anywhere, without recourse to specific locations in a fixed infrastructure and even while moving or traveling. The last requirement tying the user to a fixed infrastructure is the requirement for power, either wall plug or battery recharging.', NULL, '5192126.JPG', '4846784.pdf', 1, 2001, 'New York', 48, '2019-01-31 19:11:30', '2019-01-31 19:11:30', '203.190.10.204'),
(1103, 49, 1, NULL, 1, 'RF/Microwave Circuit Design for Wireless Applications', 'rfmicrowave-circuit-design-for-wireless-applications', NULL, '0-471-22413-8', NULL, 'Circuit Design , Wireless Applications', 'Wireless circuits are not that different from commonly known two-way radio, television, and broadcast arrangements. Some of them require high linearity in modulation (TV picture); some work via relay stations (two-way radio). The real differences lie in the fact that the cell sizes are much smaller, and that in most cases we attempt multiple channel use (reuse) using time-division multiplex, spread spectrum, or some other efficient means of reducing the bandwidth required for communication.', NULL, '6812567.JPG', '8909464.pdf', 1, 2000, 'New York', 48, '2019-01-31 19:19:03', '2019-01-31 19:19:03', '203.190.10.204'),
(1104, 200, 1, NULL, 1, 'RFID for Dummies', 'rfid-for-dummies', NULL, '0-7645-7910-X', NULL, 'RFID , Dummies', 'RFID is a very valuable business and technology tool. It holds the promise of replacing existing identification technologies like the bar code. RFID offers strategic advantages for businesses because it can track inventory in the supply chain more efficiently, provide real-time in-transit visibility (ITV), and monitor general enterprise assets.', NULL, '2545475.JPG', '2002373.pdf', 1, 2005, 'Canada', 48, '2019-01-31 19:25:13', '2019-01-31 19:25:13', '203.190.10.204'),
(1105, 396, 1, NULL, 1, 'Introduction to Embedded Systems - A Cyber-Physical Systems Approach', 'introduction-to-embedded-systems-a-cyber-physical-systems-approach', '1st ed.', '9780557708574', NULL, 'Embedded Systems, Discrete Dynamics.', 'This book strives to identify and introduce the durable intellectual ideas of embedded systems as a technology and as a subject of study. The emphasis is on modeling, design, and analysis of cyber-physical systems, which integrate computing, networking, and physical processes.', NULL, '3169789.jpg', '7562553.pdf', 1, 2012, NULL, 51, '2019-01-31 19:29:01', '2019-01-31 19:29:01', '203.190.11.115'),
(1106, 96, 1, NULL, 1, 'Foundation for Microwave Engineering', 'foundation-for-microwave-engineering', '2nd', '0-7803-6031-1', NULL, 'Microwave , Engineering', 'The great interest in microwave frequencies arises for a variety of reasons. Basic among these is the ever-increasing need for more radio-frequency-spectrum space and the rather unique uses to which microwave frequencies can be applied. When it is noted that the frequency range 109 to 10\'2 Hz contains a thousand sections like the frequency spectrum from 0 to 109 Hz, the value of developing the microwave band as a means of increasing the available usable frequency spectrum may be readily appreciated.', NULL, '5726080.JPG', '1418299.pdf', 1, 2001, 'new jersey', 48, '2019-01-31 19:31:59', '2019-01-31 19:31:59', '203.190.10.204'),
(1107, 64, 1, NULL, 1, 'RF Mems Circuits Design : For Wireless Communication', 'rf-mems-circuits-design-for-wireless-communication', NULL, '1-58053-329-9', NULL, 'Circuits Design , Wireless Communication', 'This book examines the recent progress made in the emerging field of microelectromechanical systems (MEMS) technology in the context of its imminent insertion and deployment in radio frequency (RF) and microwave wireless applications. In particular, as the potential of RF MEMS to enable the implementation of sophisticated, yet low power, portable appliances that will fuel the upcoming wireless revolution gains wide recognition, it is imperative that the knowledge base required to quickly adopt and gainfully exploit this technology be readily available.', NULL, '6676728.JPG', '3229269.pdf', 1, 2002, 'Boston', 48, '2019-01-31 19:37:50', '2019-01-31 19:37:50', '203.190.10.204'),
(1108, 74, 1, NULL, 1, 'Antenna Engineering Handbook', 'antenna-engineering-handbook-31581410', '4th', NULL, NULL, 'Antenna , Engineering', 'Antennas are key components of any wireless communication system.They are the devices that allow for the transfer of a signal (in a wired system) to waves that, in turn, propagate through space and can be received by another antenna. The receiving antenna is responsible for the reciprocal process, i.e., that of turning an electromagnetic wave into\r\na signal or voltage at its terminals that can subsequently be processed by the receiver.', NULL, '9708606.JPG', '9729595.pdf', 1, 2007, 'USA', 48, '2019-01-31 19:58:10', '2019-01-31 19:58:10', '203.190.10.204'),
(1109, 130, 1, NULL, 1, 'Telecommunication Circuits and Technology', 'telecommunication-circuits-and-technology', NULL, '0750650451', NULL, 'Telecommunication Circuits, Technology.', 'Telecommunication Circuits and Technology provides students with a problem solving approach to understanding the fundamentals of telecommunications. The author covers the common telecommunication and data communication circuits that are currently taught at further and higher education level and also used in industry. Understanding is reinforced with frequent worked examples and problems for specific applications and industrial data sheets are also given.', NULL, '6878389.jpg', '9187098.pdf', 1, 2000, 'Boston', 51, '2019-01-31 20:01:03', '2019-01-31 20:01:03', '203.190.11.115'),
(1110, 397, 1, NULL, 1, 'Antenna Arraying Techniques in the Deep Space Network', 'antenna-arraying-techniques-in-the-deep-space-network-31091548', NULL, NULL, NULL, 'Techniques , Space Network', 'This monograph provides an introduction to the development and use of antenna arraying in the Deep Space Network (DSN). It is intended to serve as a starting point for anyone wishing to gain an understanding of the techniques that have been analyzed and implemented. A complete discussion of the general subject of arraying has not been provided. Only those parts relevant to what has been used in the DSN have been included.', NULL, '5205364.JPG', '1863664.pdf', 1, 2003, 'California', 48, '2019-01-31 20:09:48', '2019-01-31 20:09:48', '203.190.10.204'),
(1111, 52, 1, NULL, 1, 'Linear Controller Design: Limits of Performance', 'linear-controller-design-limits-of-performance', NULL, '978-0135386873', NULL, 'Linear Controller Design', 'This book is motivated by the following technological developments high quality\r\nintegrated sensors and actuators powerful control processors that can implement complex control algorithms and powerful computer hardware and software that can be used to design and analyze control systems. We believe that these technological developments have the following ramications for linear controller design', NULL, '1435401.jpg', '7841591.pdf', 1, 1991, NULL, 51, '2019-01-31 20:10:01', '2019-01-31 20:10:01', '203.190.11.116'),
(1112, 398, 1, NULL, 1, 'Linear optimal control', 'linear-optimal-control', NULL, '0135368707', NULL, 'Linear optimal control', 'Despite the development of a now vast body of knowledge known as\r\nmodern control theory, and despite some spectacular applications of this\r\ntheory to practical situations, it is quite clear that much of the theory has\r\nyet to find application, and many practical control problems have yet to find\r\na theory which will successfully deal with them. No book of course can\r\nremedy the situation at this time. But the aim of this book is to construct\r\none of many bridges that are still required for the student and practicing\r\ncontrol engineer between the familiar classical control results and those of\r\nmodern control theory. I', NULL, '5849772.jpg', '6666026.PDF', 1, 1971, 'New Jersey', 51, '2019-01-31 20:17:11', '2019-01-31 20:17:11', '203.190.11.117'),
(1113, 74, 1, NULL, 1, 'Low Voltage Wiring: Security/Fire Alarm Systems', 'low-voltage-wiring-securityfire-alarm-systems', '3rd ed.', '007138958X', NULL, 'Low Voltage, Fire Alarm.', 'In general, an alarm system is used to protect life and property. Therefore,\r\nany company or person who owns something of value has a valid interest in\r\nsecurity and fire-alarm systems.', NULL, '6214726.jpg', '8111945.pdf', 1, 2002, 'New York', 51, '2019-01-31 20:20:54', '2019-01-31 20:20:54', '203.190.11.117'),
(1114, 399, 1, NULL, 1, 'Locomotive Boilers and engines', 'locomotive-boilers-and-engines', NULL, '978-1296861049', NULL, 'Locomotive, Boilers, engines.', 'This work has been selected by scholars as being culturally important, and is part of the knowledge base of civilization as we know it. This work was reproduced from the original artifact, and remains as true to the original work as possible. Therefore, you will see the original copyright references, library stamps (as most of these works have been housed in our most important libraries around the world), and other notations in the work.', NULL, '7341251.jpg', '5081433.pdf', 1, 2015, 'Chicago', 47, '2019-01-31 21:22:29', '2019-01-31 21:22:29', '203.190.10.206'),
(1115, 57, 1, NULL, 1, 'Thermodynamics: Fundamentals for Applications', 'thermodynamics-fundamentals-for-applications', 'Reissue Edition', '978-0521588188', NULL, 'Thermodynamics, Application.', 'Thermodynamics: Fundamentals for Applications is a text for a first graduate course in chemical engineering. The focus is on macroscopic thermodynamics; discussions of modeling and molecular situations are integrated throughout. Underpinning this text is the knowledge that while thermodynamics describes natural phenomena, those descriptions are the products of creative, systematic minds. Nature unfolds without reference to human concepts of energy, entropy, or fugacity. Natural complexity can be organized and studied by thermodynamics methodology. The power of thermodynamics can be used to advantage if the fundamentals are understood.', NULL, '4491971.jpg', '8712511.pdf', 1, 2011, 'New York', 47, '2019-01-31 21:32:06', '2019-01-31 21:32:06', '203.190.10.206');
