(1116, 74, 1, NULL, 1, 'Thermodynamics: An Engineering Approach', 'thermodynamics-an-engineering-approach', '5th Edition', '978-0072884951', NULL, 'Thermodynamics, Engineering Approach.', 'The worldwide bestseller Thermodynamics: An Engineering Approach brings further refinement to an approach that emphasizes a physical understanding of the fundamental concepts of thermodynamics. The authors offer an engineering textbook that \"talks directly to tomorrow\'s engineers in a simple yet precise manner, that encourages creative thinking, and is read by the students with interest and enthusiasm.\"The new edition features an early introduction of the first law of thermodynamics, separate coverage of closed systems energy analysis, combined coverage of control volume mass and energy analysis, and revised coverage of compressible flow.', NULL, '9547319.jpg', '7405786.pdf', 1, 2005, NULL, 47, '2019-01-31 21:38:43', '2019-01-31 21:38:43', '203.190.10.206'),
(1117, 400, 1, NULL, 1, 'GAS Turbine Theory', 'gas-turbine-theory', NULL, '0582236320', NULL, 'Turbine Theory', NULL, NULL, '7950989.PNG', '4824563.pdf', 1, 1972, 'England', 39, '2019-02-02 17:05:15', '2019-02-02 17:05:15', '203.190.11.124'),
(1118, 401, 1, NULL, 1, 'Introduction to Polymer Science and Technology', 'introduction-to-polymer-science-and-technology', NULL, '978-87-403-0087-1', NULL, 'Polymer Science and Polymer Technology', 'Knowledge should be applied in a safe, responsible and ethical manner not only to benefit us personally but also to improve the lot of the people we live with. It is also a duty to ensure that our surrounding habitat is not endangered. Th is sometimes requires knowledge of the local culture to help achieve a desirable outcome. Martin Palmerâ€™s presentation on BBC Th ought for the Day programme, 17/06/2006, on the subject of the protection of the oceans included:\r\n â€œTo many around the world the environmental movement and its proffered solutions - usually economic - are alien ways of thinking and seeing the world, and can be interpreted as telling people what is best for them whether they like it or not. Let me tell you a story. Dynamite-fishing off  the East African coast is a major problem. Environmental organisations have been addressing it for years, from working with Governments, to sending armed boats to threaten those illegally fishing.', NULL, '3738239.PNG', '8343672.pdf', 1, 2012, 'Ireland', 34, '2019-02-02 17:14:55', '2019-02-02 17:14:55', '203.190.11.116'),
(1119, 12, 1, NULL, 1, 'ADSL: Standards, Implementation, and Architecture', 'adsl-standards-implementation-and-architecture', NULL, '084939595x', NULL, NULL, 'Asymmetric Digtal Subscriber Line (ADSL) use is one of the general Digital Subscriber Line (xDSL) techniques. While it has been around in the laboratory for about ten years, this particular technique has since shifted to the special evaluation site to the beginnings of consumer access. By the time this book is available, some mass provision of ADSL to the general consumer market will be available. \r\nDigital Subscriber Line is just thatâ€”use of digital transmission methods on the carrier line that commonly exists between a local switching location and the home subscriber. Arguments can be made that xDSL, by definition, includes the common modems that have been in use for the past 20 years, as well as new techniques such as cable modems which make use of subscriber linesâ€”but not the same subscriber lines as are used by ADSL and its close relatives.', NULL, '2115092.PNG', '2766019.pdf', 1, 1999, 'England', 34, '2019-02-02 17:20:29', '2019-02-02 17:20:29', '203.190.11.118'),
(1120, 402, 1, NULL, 1, 'General Relativity', 'general-relativity', NULL, '0226870332', NULL, NULL, 'This book is intended to provide a thorough introduction to the theory of general relativity. It is intended to serve as both a text for graduate students and a reference book for researchers. These two goals are somewhat contradictory, and to the extent that they are, part I of the book emphasizes the first goal. It trysts the topics actually covered in introductory relativity courses: basic differential geometry, Einstein\'s equation, gravitational radiation, the standard cosmological models, and the Schwarzschild solution. More emphasis is placed on the second goal In part II of the book, which treats a wide variety of advanced topics. However, even here I have attempted to explain all the basic ideas at an introductory level.', NULL, '2374810.PNG', '9712617.pdf', 1, 1984, 'USA', 39, '2019-02-02 17:22:04', '2019-02-02 17:22:04', '203.190.11.124'),
