(1125, 187, 1, NULL, 1, 'Geometric Asymptotics', 'geometric-asymptotics', NULL, '0821816330', NULL, NULL, 'There has been a great deal of active research recently in the fields of symplectic geometry and the theory of Fourier integral operators. In symplectic geometry there has been much progress in understanding the geometry of dynamical systems, and the process of \"quantization\" as applied not only to the theory of dynamical systems, but also as a key tool in the analysis of group representations. Fourier integral operators have made possible a much more systematic analysis of the singularities of solutions of linear partial differential equations than existed heretofore, together with a good deal of geometric information associated with the spectra of such operators.', NULL, '3386801.jpg', '1738223.pdf', 1, 1990, 'U.S.A', 39, '2019-02-02 18:08:32', '2019-02-02 18:08:32', '203.190.11.124'),
(1126, 72, 1, NULL, 1, 'RF Components and Circuits', 'rf-components-and-circuits', NULL, '0 7506 48449', NULL, 'RF Components , Circuits', 'This is a book on radio frequency (RF) circuits. RF circuits are different from other circuits because the values of stray or distributed capacitance and inductance\'s become significant at RF. When circuit values are calculated, for example, these distributed values must be cranked into the equations or the answer will be wrong perhaps by a significant amount. It is for this reason that RF is different from low frequency circuits.', NULL, '6628636.JPG', '3090554.pdf', 1, 2002, 'New York', 48, '2019-02-02 18:21:24', '2019-02-02 18:21:24', '203.190.10.204'),
(1127, 72, 1, NULL, 1, 'Analog Electronics : Circuits, Systems and Signal Processing', 'analog-electronics-circuits-systems-and-signal-processing', NULL, '0 7506 5095 8', NULL, 'Analog Electronics , Signal Processing', 'The purpose of this chapter is to clarify the distinction between analog and digital electronics, and to provide examples of systems in which both types of electronics are used, so as to set in context the analog circuit analysis and signal processing in the rest of the book. \'Electronics\' is one of those words which most of us recognize, but which is quite hard to define. However, we usually mean apparatus and systems which use devices which amplify and process electrical signals, and which need a source of power in order to work.', NULL, '8056485.JPG', '9438038.pdf', 1, 2002, 'India', 48, '2019-02-02 18:33:39', '2019-02-02 18:33:39', '203.190.10.204'),
(1128, 86, 1, NULL, 1, 'Digital Design', 'digital-design', '4th ed.', '978-0131989245', NULL, 'Digital Design', 'Digital Design, fourth edition is a modern update of the classic authoritative text on digital design.  This book teaches the basic concepts of digital design in a clear, accessible manner. The book presents the basic tools for the design of digital circuits and provides procedures suitable for a variety of digital applications.', NULL, '5138204.jpg', '3773202.pdf', 1, 2006, NULL, 51, '2019-02-02 19:12:13', '2019-02-02 19:12:13', '203.190.11.116'),
(1129, 86, 1, NULL, 1, 'Digital Design: With an Introduction to the Verilog HDL', 'digital-design-with-an-introduction-to-the-verilog-hdl', '5th ed.', '978-0-13-277420-8', NULL, 'Digital Design, Verilog HDL.', 'Digital Design, fifth edition is a modern update of the classic authoritative text on digital design. This book teaches the basic concepts of digital design in a clear, accessible manner. The book presents the basic tools for the design of digital circuits and provides procedures suitable for a variety of digital applications.', NULL, '7957490.JPG', '5885031.pdf', 1, 2013, 'New York', 51, '2019-02-02 19:18:09', '2019-02-02 19:18:09', '203.190.11.116'),
(1130, 125, 1, NULL, 1, 'Third-Generation CDMA Systems for Enhanced Data Services', 'third-generation-cdma-systems-for-enhanced-data-services', 'Jersey Lai', NULL, NULL, 'CDMA Systems, Data Services.', 'CDMA has been quite successful as a second-generation cellular system,\r\nhaving achieved widespread use in particular in North America and Korea\r\nby the turn of the twenty-first century. As the new century begins, CDMA\r\nsystems will once again find widespread use in the form of third-generation\r\ncellular systems. However, two third-generation systems based on CDMA,\r\ncdma2000 and WCDMA, have emerged. As a result, many people both\r\ninside and outside the wireless industry have a distinct desire to actually be\r\nable to distinguish between these two systems and study the relative features\r\nof each.', NULL, '3072669.JPG', '4355646.pdf', 1, 2002, 'Boston', 51, '2019-02-02 19:21:14', '2019-02-02 19:21:14', '203.190.11.115'),
(1131, 10, 1, NULL, 1, 'APPLIED MATHEMATICS FOR RESTRUCTURED ELECTRIC POWER SYSTEMS Optimization, Control, and Computational Intelligence', 'applied-mathematics-for-restructured-electric-power-systems-optimization-control-and-computational-intelligence-02261402', NULL, '0-387-23471-3', NULL, 'Mathematics, Power System.', 'This edited volume is an outgrowth of a workshop entitled \"Applied\r\nMathematics for Deregulated Electric Power Systems: Optimization,\r\nControl, and Computational Intelligence,\" held in Arlington, Virginia,\r\non November 3-4, 2003, and sponsored by the National Science Foundation. It followed several previous NSF sponsored workshops on power\r\nsystems, including:', NULL, '3331463.JPG', '7374498.pdf', 1, 2005, 'New York', 51, '2019-02-02 19:26:02', '2019-02-02 19:26:02', '203.190.11.116'),
(1132, 10, 1, NULL, 1, 'Environmental Management:The Supply Chain Perspective', 'environmental-managementthe-supply-chain-perspective', NULL, '978-3-319-23680-3', NULL, 'Environmental management and Supply Chain Management', 'By introducing the concept of environmental management in a supply chain management context, organizations consider their environmental impact in the various stages in a supply chain, ranging from product design, cleaner production, distribution, to end-of-life product treatments in order to reduce waste, replace use of harmful materials, recycle, and reuse. To achieve these ends, the involvement of suppliers and customers is critical as they are taking part in a supply chain. The involvement of suppliers and customers requires collaborative efforts, including environmental information sharing, operational adaptation across processes, integration, and understanding of market preferences.', NULL, '8319432.PNG', '8008611.pdf', 1, 2016, 'Hong Kong', 34, '2019-02-02 19:28:29', '2019-02-02 19:28:29', '203.190.11.116'),
(1133, 12, 1, NULL, 1, 'Electronics and Circuit Analysis Using MATLAB', 'electronics-and-circuit-analysis-using-matlab', '1st ed.', '0849311764', NULL, 'Electronics, Circuit Analysis.', 'MATLAB is a numeric computation software for engineering and scientific\r\ncalculations. MATLAB is increasingly being used by students, researchers,\r\npracticing engineers and technicians. The causes of MATLAB popularity are\r\nlegion. Among them are its iterative mode of operation, built-in functions,\r\nsimple programming, rich set of graphing facilities, possibilities for writing\r\nadditional functions, and its extensive toolboxes', NULL, '1337997.jpg', '7171637.pdf', 1, 1999, 'New York', 51, '2019-02-02 19:30:33', '2019-02-02 19:30:33', '203.190.11.115'),
(1134, 30, 1, NULL, 1, 'Leadership Solutions:The Pathway to Bridge the Leadership Gap', 'leadership-solutionsthe-pathway-to-bridge-the-leadership-gap', NULL, '978-0-470-84092-4', NULL, 'Leadership , Leadership Solutions', 'Leadership Solutions challenges the traditional views and approaches of building leadership capacity with a new integrated perspective that recognizes leadership as a source of competitive advantage. To this end, Leadership	Solutions presents the case for a new pathway for responding to the leadership gap. Based on our extensive work and research in this field, we provide the practical strategies and techniques necessary for business executives and HR leaders to bridge the gap. Many organizations continue to struggle to build the leadership capacity that they need to thrive in todayâ€™s and tomorrowâ€™s ever-changing global business environment.', NULL, '8585875.PNG', '5236096.pdf', 1, 2007, 'Canada', 34, '2019-02-02 19:35:54', '2019-02-02 19:35:54', '203.190.11.115'),
(1135, 406, 1, NULL, 1, 'Signal Processing Toolbox For Use with MATLAB', 'signal-processing-toolbox-for-use-with-matlab', NULL, NULL, NULL, 'Signal Processing, MATLAB', 'This section describes how to begin using the Signal Processing Toolbox. It\r\nexplains how to use this manual and points you to additional books for toolbox\r\ninstallation information.', NULL, '6099845.jpg', '6252416.pdf', 1, 1999, NULL, 51, '2019-02-02 19:38:01', '2019-02-02 19:38:01', '203.190.11.117'),
(1136, 407, 1, NULL, 1, 'Analog and Digital Control System Design : Transfer-function State-space, and Algebraic Methods', 'analog-and-digital-control-system-design-transfer-function-state-space-and-algebraic-methods', NULL, NULL, NULL, 'Analog , Digital', 'The ultimate goal of engineeringâ€”in particular, that of control engineeringâ€”is to design and build real physical systems to perform given tasks. For example, an engineer might be asked to design and install a heat exchanger to control the tem-perature and humidity of a large building. This has been a longstanding problem in engineering, and much relevant data has been collected. From the total volume and geographical location of the building, we can determine the required capacity of the exchanger and then proceed to install the system.', NULL, '3697829.JPG', '8092371.pdf', 1, 1993, 'New York', 48, '2019-02-02 19:44:02', '2019-02-02 19:44:02', '203.190.10.204'),
(1137, 130, 1, NULL, 1, 'Measurement and Instrumentation Principles', 'measurement-and-instrumentation-principles', '3rd ed.', '978-0750650816', NULL, 'Instrumentation Principles', 'Measurement and Instrumentation Principles\' is the latest edition of a successful book that introduces undergraduate students to the measurement principles and the range of sensors and instruments that are used for measuring physical variables. Completely updated to include new technologies such as smart sensors, displays and interfaces, the 3rd edition also contains plenty of worked examples and self-assessment questions (and solutions). In addition, a new chapter on safety issues focuses on the legal framework, electrical safety and failsafe designs, and the author has also concentrated on RF and optical wireless communications. Fully up-to-date and comprehensively written, this textbook is essential for all engineering undergraduates, especially those in the first two years of their course.', NULL, '2986790.JPG', '5278894.pdf', 1, 2001, 'Boston', 51, '2019-02-02 19:44:51', '2019-02-02 19:44:51', '203.190.11.115'),
(1138, 125, 1, NULL, 1, 'Introduction to Food Science and Technology', 'introduction-to-food-science-and-technology', '2nd', '0-12-670256- X', NULL, 'Food Science', 'This second edition of Introduction to Food Science and Technology addresses the same subject matte r as did the first, and it intend s to serve the same audience . Thus, its primary objective is to acquaint college freshmen and sophomore s with food science and technology and possibly to motivate them to consider the field as a career . This text is not designed to appeal to those primarily interested in topical debate s about the America n food industry and its product s but rather to inform the student of our present scientific knowledge about foods and of the application of scientific principle s to commercial food processing and preservation . We have, however, included a chapter examining consumer concern s and current controversies about food choices and health .', NULL, '5583925.PNG', '9279967.pdf', 1, 1982, 'New York', 34, '2019-02-02 19:46:45', '2019-02-02 19:46:45', '203.190.11.116'),
(1139, 408, 1, NULL, 1, 'Analysis and Design of Control systems using matlab', 'analysis-and-design-of-control-systems-using-matlab', NULL, '978-81-224-2484-3', NULL, 'Analysis , Design', 'Control systems in an interdisciplinary field covering many areas of engineering and sciences. Control systems exist in many systems of engineering, sciences, and in human body. Some type of control systems affects most aspects of our day-to-day activities. This chapter presents a brief introduction and overview of control systems. Some of the terms commonly used to describe the operation, analysis, and design of control systems are presented.', NULL, '2791568.JPG', '5865829.pdf', 1, 2006, 'Bangalore', 48, '2019-02-02 19:52:43', '2019-02-02 19:52:43', '203.190.10.204'),
(1140, 12, 1, NULL, 1, 'Measurement, Instrumentation, and Sensors Handbook', 'measurement-instrumentation-and-sensors-handbook-02021506', NULL, '084932145X', NULL, 'Measurement, Instrumentation, Sensors Handbook', 'This new edition of the bestselling Measurement, Instrumentation, and Sensors Handbook brings together all aspects of the design and implementation of measurement, instrumentation, and sensors. Reflecting the current state of the art, it describes the use of instruments and techniques for performing practical measurements in engineering, physics, chemistry, and the life sciences; explains sensors and the associated hardware and software; and discusses processing systems, automatic data acquisition, reduction and analysis, operation characteristics, accuracy, errors, calibrations, and the incorporation of standards for control purposes.', NULL, '1860191.JPG', '9001319.pdf', 1, 1999, 'New York', 51, '2019-02-02 20:02:06', '2019-02-02 20:02:06', '203.190.11.115'),
(1141, 44, 1, NULL, 1, 'Pharmaceutical Production Facilities Design and Applications', 'pharmaceutical-production-facilities-design-and-applications', '2nd', '0-203-79135-5', NULL, NULL, 'The rewards in the pharmaceutical industry have been the result of developing unique chemotherapeutic products, and traditionally these products were manufactured by using a collection of different types of facility, a variety of construction materials, and equipment generally borrowed from other industries. For example the planetary mixer originated in the bakery. Probably the tablet machine with systems to regulate its operation is the best example of innovation in the industry. Computer integrated manufacture has taken a lot longer to develop for plants designed to produce sophisticated modern dosage forms.', NULL, '8248794.PNG', '2487264.pdf', 1, 1998, 'London', 34, '2019-02-02 20:05:22', '2019-02-02 20:05:22', '203.190.11.115'),
(1142, 409, 1, NULL, 1, 'Measurement and Instrumentation Principles', 'measurement-and-instrumentation-principles-02091544', '3rd ed.', '0750650818', NULL, 'Instrumentation Principles', 'Measurement and Instrumentation Principles\' is the latest edition of a successful book that introduces undergraduate students to the measurement principles and the range of sensors and instruments that are used for measuring physical variables. Completely updated to include new technologies such as smart sensors, displays and interfaces, the 3rd edition also contains plenty of worked examples and self-assessment questions (and solutions). In addition, a new chapter on safety issues focuses on the legal framework, electrical safety and failsafe designs, and the author has also concentrated on RF and optical wireless communications. Fully up-to-date and comprehensively written, this textbook is essential for all engineering undergraduates, especially those in the first two years of their course.', NULL, '5683204.JPG', '1473881.pdf', 1, 2001, 'London', 51, '2019-02-02 20:09:44', '2019-02-02 20:09:44', '203.190.11.117'),
(1143, 43, 1, NULL, 1, 'Reputation Marketing: Building and Sustaining Your Organizationâ€™s Greatest Asset', 'reputation-marketing-building-and-sustaining-your-organizations-greatest-asset', NULL, '0-07-140272-1', NULL, 'Reputation Marketing, Marketing Consultation', 'Reputation marketing has emerged as an area of specialization among public-relations professionals and marketing consultants. A closer look at the subject reveals marked similarities to the practice of corporate-image management, and in some instances, brand management as well. Are these distinctions important? To some people, perhaps not. But they are distinctions worth knowing and understanding. These are times of unprecedented competition and soaring costs; once an objective is clearly deï¬ned and resources are committed to meeting that objective, the strategy and tactics should follow a straight line and remain as focused as possible.', NULL, '8352511.PNG', '6534035.pdf', 1, 2002, 'New York', 34, '2019-02-02 20:11:58', '2019-02-02 20:11:58', '203.190.11.118'),
(1144, 410, 1, NULL, 1, 'Measurement and Control Basics', 'measurement-and-control-basics', '3rd ed.', '1-55617-764-X', NULL, 'Control Basics', 'The third edition of Measurement and Control Basics is a thorough and comprehensive treatment of the basic principles of process control and measurement. It is designed for engineers, technicians, management, and sales personnel who are new to process control and measurement. It is also\r\nvaluable as a concise and easy-to-read reference source on the subject.', NULL, '1722913.JPG', '1984308.pdf', 1, 2002, 'U.S.A', 51, '2019-02-02 20:15:07', '2019-02-02 20:15:07', '203.190.11.118'),
(1145, 125, 1, NULL, 1, 'Mechanical Engineer\'s Handbook', 'mechanical-engineers-handbook', NULL, '0-12-471370-X', NULL, 'Mechanical Engineer\'s', 'The Mechanical Engineer\'s Handbook was developed and written specifically to fill a need for mechanical engineers and mechanical engineering students. With over 1000 pages, 550 illustrations, and 26 tables the Mechanical Engineer\'s Handbook is comprehensive, compact and durable. The Handbook covers major areas of mechanical engineering with succinct coverage of the definitions, formulas, examples, theory, proofs, and explanations of all principle subject areas. The Handbook is an essential, practical companion for all mechanical engineering students with core coverage of nearly all relevant courses included. Also, anyone preparing for the engineering licensing examinations will find this handbook to be an invaluable aid. Useful analytical techniques provide the student and practicing engineer with powerful tools for mechanical design', NULL, '1664296.jpg', '1256502.pdf', 1, 2001, 'New York', 51, '2019-02-02 20:18:44', '2019-02-02 20:18:44', '203.190.11.118'),
(1146, 110, 1, NULL, 1, 'Frozen Food Science and Technology', 'frozen-food-science-and-technology', NULL, '978-1-4051-5478-9', NULL, NULL, 'Freezing is one of the oldest and most commonly used means of food preservation. It has been known to be an extremely effective means of preserving food for extended periods since Paleolithic and Neolithic times,when man used ice and snow to cool food.The cooling effect of salt and ice was ï¬rst publicly discussed in 1662 by the chemist Robert Boyle, but this technology was certainly known in Spain, Italy and India in the sixteenth century. The manufacture of ice in shallow lakes using radiant â€˜night coolingâ€™ and the preservation of ice and snow in ice houses was a common practice in large country houses in the Victorian times. Ice was a product only for the privileged, and iced desserts were extremely fashionable and a sign of great wealth.', NULL, '4055594.PNG', '7225033.pdf', 1, 2008, 'USA', 34, '2019-02-02 20:21:16', '2019-02-02 20:21:16', '203.190.11.117'),
(1147, 44, 1, NULL, 1, 'Mechanics of Fluids', 'mechanics-of-fluids', '8th ed.', '0415362067', NULL, 'Mechanics of Fluids', 'Massey has long been a best-selling textbook. This extensively revised and updated eighth edition, like its predecessors, presents the basic principles of the mechanics of fluids in a thorough and clear manner. It provides the essential material for an honours degree course in civil or mechanical engineering, in addition to providing much relevant material for undergraduate courses in aeronautical and chemical engineering.', NULL, '6211652.jpg', '1246735.pdf', 1, 2006, 'New York', 51, '2019-02-02 20:22:34', '2019-02-02 20:22:34', '203.190.11.116'),
(1148, 43, 1, NULL, 1, 'Introduction to Mechatronics and Measurement Systems', 'introduction-to-mechatronics-and-measurement-systems-02261505', '4th ed.', '978-0-07-338023-0', NULL, 'Measurement Systems', 'The formal boundaries of traditional engineering disciplines have become fuzzy following the advent of integrated circuits and computers. Nowhere is this more evident than in mechanical and electrical engineering, where products today include an assembly of interdependent electrical and mechanical components. The field of mechatronics has broadened the scope of the traditional field of electromechanics. Mechatronics is defined as the field of study involving the analysis, design, synthesis, and selection of systems that combine electronic and mechanical components\r\nwith modern controls and microprocessors.', NULL, '6369519.JPG', '6466718.pdf', 1, 2007, 'New York', 51, '2019-02-02 20:26:05', '2019-02-02 20:26:05', '203.190.11.118'),
(1149, 49, 1, NULL, 1, 'Microcontroller Based Applied Digital Control', 'microcontroller-based-applied-digital-control-02281535', NULL, '978-0-470-86335-0', NULL, 'Microcontroller', 'This book presents the theory and application of microcontroller based automatic control systems. Microcontrollers are single-chip computers which can be used to control real-time systems. Low-cost, single chip and easy to program, they have traditionally been programmed using the assembly language of the target processor. Recent developments in this field mean that it is now possible to program these devices using high-level languages such as BASIC, PASCAL, or C. As a result, very complex control algorithms can be developed and implemented on the microcontrollers.', NULL, '7961757.jpg', '4618113.pdf', 1, 2006, 'U.S.A', 51, '2019-02-02 20:28:35', '2019-02-02 20:28:35', '203.190.11.117'),
(1150, 71, 1, NULL, 1, 'Microeconomics', 'microeconomics-02301540', '10th', '978-0-13-139425-4', NULL, 'Microeconomics', 'The future is always uncertain. But at some times, and now is one such time, the range of possible near-future events is enormous. The major source of this great uncertainty is economic policy. There is uncertainty about the way in which international trade policy will evolve as protectionism is returning to the political agenda. There is uncertainty about exchange rate policy as competitive devaluation rears its head. There is extraordinary uncertainty about monetary policy with the Fed having doubled the quantity of bank reserves and continuing to create more money in an attempt to stimulate a flagging economy. And there is uncertainty about fiscal policy as a trillion dollar deficit interacts with an aging population to create a national debt time bomb.', NULL, '1818748.PNG', '1774163.pdf', 1, 2012, 'New York', 34, '2019-02-02 20:30:40', '2019-02-02 20:30:40', '203.190.11.117'),
(1151, 10, 1, NULL, 1, 'Mechatronics Dynamics of Electromechanical and Piezoelectric Systems', 'mechatronics-dynamics-of-electromechanical-and-piezoelectric-systems-02341522', NULL, '9781402046964', NULL, 'Mechatronics Dynamics', 'The objective of my previous book, Vibration Control of Active Structures, was to cross the bridge between Structural Dynamics and Automatic Control. To insist on important control-structure interaction issues,\r\nthe book often relied on â€œad-hocâ€ models and intuition (e.g. a thermal\r\nanalogy for piezoelectric loads), and was seriously lacking in accuracy\r\nand depth on transduction and energy conversion mechanisms which are\r\nessential in active structures. The present book project was initiated in\r\npreparation for a new edition, with the intention of redressing the imbalance, by including a more serious treatment of the subject.', NULL, '6373817.JPG', '9471587.PDF', 1, 2006, 'Netherlands', 51, '2019-02-02 20:34:22', '2019-02-02 20:34:22', '203.190.11.117'),
(1152, 72, 1, NULL, 1, 'Microelectronics â€“ Systems and Devices', 'microelectronics-systems-and-devices', NULL, '0 7506 4723 X', NULL, 'Microelectronics', 'This is a completely new textbook written to be fully in line with the new BTEC Higher National unit from Edexcel, the 2000 specification Advanced GNVQ unit, BTEC NII and NIII, and A-Level modules. The resulting breadth of coverage makes Microelectronics - Systems and Devices an excellent international student text.', NULL, '3119870.JPG', '5221530.pdf', 1, 2000, 'Boston', 51, '2019-02-02 20:37:17', '2019-02-02 20:37:17', '203.190.11.115'),
(1153, 10, 1, NULL, 1, 'Leadership Models : Leadership Skills', 'leadership-models-leadership-skills', '1st', '978-87-403-1269-0', NULL, NULL, NULL, NULL, '9784816.PNG', '8294371.pdf', 1, 2006, 'New York', 34, '2019-02-02 20:42:26', '2019-02-02 20:42:26', '203.190.11.118'),
(1154, 30, 1, NULL, 1, 'Fundamentals of Microelectronics', 'fundamentals-of-microelectronics-02441511', NULL, '978-0470072929', NULL, 'Microelectronics', 'To succeed in the practice of microelectronics in industry, students must develop the ability to think intuitively about circuits. They need to move beyond simply plugging and chugging numbers in equations and be prepared to face real design trade-offs.', NULL, '7148915.jpg', '7329821.pdf', 1, 2006, NULL, 51, '2019-02-02 20:44:11', '2019-02-02 20:44:11', '203.190.11.115'),
(1155, 102, 1, NULL, 1, 'Principles of  Corporate Finance', 'principles-of-corporate-finance', '12th', '978-1-259-14438-7', NULL, 'Corporate Finance', 'Corporations invest in real assets, which generate income. Some of these assets, such as plant and machinery, are tangible; others, such as brand names and patents, are intangible. Corporations finance their investments by borrowing, by retaining and reinvesting cash flow, and by selling additional shares of stock to the corporationâ€™s shareholders. Thus the corporationâ€™s financial manager faces two broad financial questions: First, what investments should the corporation make? Second, how should it pay for those investments? The investment decision involves spending money; the financing decision involves raising it. A large corporation may have hundreds of thousands of shareholders. These shareholders differ in many ways, including their wealth, risk tolerance, and investment horizon. Yet we shall see that they usually share the same financial objective.', NULL, '5446862.PNG', '9888367.pdf', 1, 2017, 'New York', 34, '2019-02-02 20:49:31', '2019-02-02 20:49:31', '203.190.11.117'),
(1156, 411, 1, NULL, 1, 'Electronic Devices and Circuits', 'electronic-devices-and-circuits-02501504', NULL, '978-0070423800', NULL, 'Electronic Devices, Circuits.', 'McGrawHill Electrical and Electronic Engineering Series. This book, intended as a text for a first course in electronics for electrical engineering or physics students, has two primary objectives: to present a clear consistent picture of the internal physical behavior of many electronics devices, and to teach the reader how to analyze and design electronic circuits using these devices. There are over 600 homework problems, which will test the student\'s grasp of the fundamental concepts enunciated in the book and will give him experience in the analysis and design of electronic circuits.', NULL, '1840578.jpg', '5023553.pdf', 1, 1967, NULL, 51, '2019-02-02 20:50:04', '2019-02-02 20:50:04', '203.190.11.115'),
(1157, 10, 1, NULL, 1, 'Alternative Breast Imagine', 'alternative-breast-imagine', NULL, '0-387-23364-4', NULL, 'Breast Imagine , Imagine', 'Medical imaging has been transformed over the past 30 years by the advent of computerized tomography (CT), magnetic resonance imaging (MRI), and various advances in x-ray and ultrasonic techniques. An enabling force behind this progress has been the (so far) exponentially increasing power of computers, which has made it practical to explore fundamentally new approaches. In particular, what our group terms â€œmodel-basedâ€ modalitiesâ€”which rely on iterative, convergent numerical modeling to produce an image from data that is related nonlinearly to a target volumeâ€”have become increasingly feasible.', NULL, '3077103.JPG', '4067474.pdf', 1, 2005, 'USA', 48, '2019-02-02 21:10:36', '2019-02-02 21:10:36', '203.190.10.204'),
(1158, 412, 1, NULL, 1, 'An Introduction to Pattern Recognition', 'an-introduction-to-pattern-recognition', NULL, NULL, NULL, 'Pattern , Recognition', 'Automation, the use of robots in industry, has not progressed with the speed that many had hoped it would. The forecasts of twenty years ago are looking fairly silly today: the fact that they were produced largely by journalists for the benefit of boardrooms of accountants and MBA\'s may have something to do with this, but the question of why so little has been accomplished remains.', NULL, '2415353.JPG', '6274615.pdf', 1, 2001, 'USA', 48, '2019-02-02 21:24:12', '2019-02-02 21:24:12', '203.190.10.204'),
(1159, 413, 1, NULL, 1, 'Treatise On Thermodynamics', 'treatise-on-thermodynamics', '3rd ed.', '978-0548806661', NULL, 'Treatise, Thermodynamics.', 'This scarce antiquarian book is a facsimile reprint of the original. Due to its age, it may contain imperfections such as marks, notations, marginalia and flawed pages. Because we believe this work is culturally important, we have made it available as part of our commitment for protecting, preserving, and promoting the world\'s literature in affordable, high quality, modern editions that are true to the original work.', NULL, '4480837.jpg', '8745088.pdf', 1, 2007, NULL, 47, '2019-02-02 21:34:09', '2019-02-02 21:34:09', '203.190.10.206'),
(1160, 57, 1, NULL, 1, 'An Introduction to Statistical Signal Processing', 'an-introduction-to-statistical-signal-processing', NULL, NULL, NULL, 'Statistical , Signal Processing', 'A perusal of the literature in statistical signal processing, communications, control, image and video processing, speech and audio processing, medical signal processing, geophysical signal processing, and classical statistical areas of time series analysis, classification and regression, and pattern recognition show a wide variety of probabilistic models for input processes and for operations on those processes, where the operations might be deterministic or random, natural or artificial, linear or nonlinear, digital or analog, or beneficial or harmful.', NULL, '6189934.JPG', '5282241.pdf', 1, 2003, 'USA', 48, '2019-02-02 22:06:06', '2019-02-02 22:06:06', '203.190.10.204'),
(1161, 74, 1, NULL, 1, 'Fundamentals of Electric Circuits', 'fundamentals-of-electric-circuits', '4th', '978â€“0â€“07â€“352955â€“4', NULL, 'Electric , Circuits', 'Circuit analysis is perhaps the first exposure students have to electrical engineering. This is also a place where we can enhance some of the skills that they will later need as they learn how to design. In the fourth edition, we have included a very significant new feature to help students enhance skills that are an important part of the design process. We call this new feature, design a problem.', NULL, '8271261.JPG', '4215237.pdf', 1, 2009, 'New York', 48, '2019-02-02 22:18:17', '2019-02-02 22:18:17', '203.190.10.204'),
(1162, 74, 1, NULL, 1, 'Mobile Cellular Telecommunications: Analog and Digital Systems', 'mobile-cellular-telecommunications-analog-and-digital-systems', '2nd ed.', '9780070380899', NULL, 'Telecommunication', 'A reference that provides a complete technical description of the design, analysis, and maintenance of cellular systems, covering subjects such as cell-site antennas and mobile antennas, cochannel interference reduction, noncochannel interference, frequency management and channel assignment, and data links and microwaves. This second edition reflects changes in the technology over the past five years, and features new materials on the CDMA standard, microcell systems, and digital cellular systems. Contains b&w graphs, tables, and equations. Annotation copyright Book News, Inc. Portland, Or.', NULL, '4591440.jpg', '7508153.pdf', 1, 1995, NULL, 51, '2019-02-03 00:31:36', '2019-02-03 00:31:36', '203.190.11.116'),
(1163, 414, 1, NULL, 1, 'Mobile Communications', 'mobile-communications', '2nd ed.', '0 321 12381 6', NULL, 'Communications, Mobile.', 'Wlcome to the second edition of Mobile Communications â€“ and welcome to the confusing, complex, but very interesting world of wireless and mobile technologies! In the last few years, we have all experienced the hype and frustration related to mobile technology. Once praised as the Internet on the mobile phone, the frustration with third generation mobile phone systems came at the same time the dotcoms crashed. The reader should remember that all technologies need their time to develop', NULL, '6319783.JPG', '6513139.pdf', 1, 2003, 'London', 51, '2019-02-03 00:35:13', '2019-02-03 00:35:13', '203.190.11.116'),
(1164, 86, 1, NULL, 1, 'Modern Control Systems', 'modern-control-systems-02431901', '11th ed.', NULL, NULL, 'Control Systems', 'Written to be equally useful for all engineering disciplines, this book is organized around the concept of control systems theory as it has been developed in the frequency and time domains. It provides coverage of classical control employing root locus design, frequency and response design using Bode and Nyquist plots. It also covers modern control methods based on state variable models including pole placement design techniques with full-state feedback controllers and full-state observers', NULL, '1162274.jpg', '9591698.pdf', 1, 2008, 'U.S.A', 51, '2019-02-03 00:43:01', '2019-02-03 00:43:01', '203.190.11.116'),
(1165, 12, 1, NULL, 1, 'Nanoscale Technology in Biological Systems', 'nanoscale-technology-in-biological-systems', NULL, '978-0849319402', NULL, 'Nanoscale Technology', 'Nanoscale Technology in Biological Systems reviews recent accomplishments in the field of nanobiology and introduces the application of nanoscale matrices to human biology. It focuses on the applications of nanotechnology fabrication to biomedical devices and discusses new physical methods for cell isolation and manipulation and intracellular communication at the molecular level. It also explores the application of nanobiology to cardiovascular diseases, to oncology, to transplantation and a range of related disciplines. This book build a strong background in nanotechnology and nanobiology ideal for molecular biologists, biochemists, materials scientists, bioengineers, biotechnologists.', NULL, '9339708.jpg', '1230163.pdf', 1, 2005, 'London', 51, '2019-02-03 00:46:52', '2019-02-03 00:46:52', '203.190.11.116'),
(1166, 10, 1, NULL, 1, 'Graph Theory', 'graph-theory', 'Electronic Ed.', '0387989765', NULL, 'Graph Theory', 'Almost two decades have passed since the appearance of those graph the-ory texts that still set the agenda for most introductory courses taught today. The canon created by those hooks has helped to identify some main fields of study and restarch, and will doubtless continue to influence the development of the discipline for some time to come. Yet much has happened in those 20 years. in graph theory no less than elsewhere: deep niew theorems have been found, seemingly disparate methods and results have become interrelated, entire new branches have arisen. To name just a few such developments, one may think of how the new notion of list colouring has bridged the gulf between invari-ants such as average degree and chromatic number, how probabilistic methods and the regularity lemma have pervaded extremal graph the> ry and Ramsey theory, or how the entirely new field of graph minors and tree-decompositions has brought standard methods of surface topology to bear on long-standing algorithmi', NULL, '1759313.jpg', '2972630.pdf', 1, 2000, 'New York', 39, '2019-02-03 15:02:54', '2019-02-03 15:02:54', '203.190.11.123'),
(1167, 49, 1, NULL, 1, 'Gravitation and cosmology: principles and applications of the general theory of relativity', 'gravitation-and-cosmology-principles-and-applications-of-the-general-theory-of-relativity', NULL, '0471925675', NULL, 'Gravitation and cosmology', 'Now that this book is done I can look back, and identify two purposes which led me to begin writing, and which have guided the work to completion. One good practical purpose w as to bring together and asses, the wealth of data provided over the last decade by new techniques in experimental physics and in optical. radio, radar, X-ray, and infrared astronomy. Of course. new data will keep coming in even as the book is being printed, and I cannot hope that this work will *main up to date forever. I do hope, however, that by giving a muslin ehesadvu picture of the experimental tests of general relativity and observational cosmology, I will help to prepare the reader (and myself) to undenitand the new data as they emerge. I have also tried to look a little way into the future, and to discuss what may be the next generation of experiments, especially those based on artificial aatelliten of the earth and uun.', NULL, '6580380.jpg', '6243300.pdf', 1, 1972, 'New York', 39, '2019-02-03 15:14:41', '2019-02-03 15:14:41', '203.190.11.123'),
(1168, 415, 1, NULL, 1, 'GSM and Personal Communications Handbook', 'gsm-and-personal-communications-handbook-artech-house-mobile-communications-library', NULL, '0890069573', NULL, 'GSM and Personal Communications Handbook', 'Use of the global system for mobile communications (GSM) continues to spread throughout the world. It works, it is efficient, and it is well liked. As is true of any mature but vital and growing system, the services and equipment based on the GSM specifications are still evolving to accommodate its new users and operating environments. The new serv-ices, improvements, applications, and products are the new flavors offered in the GSM ice cream stand of wireless telecommunications net-works. New terminals feature increased standby and talk times while their sizes shrink and their prices fall. The combination of competitive pricing and access to a growing menu of services, which is attractive to a wider variety of users, marks the transition of GSM from a high-end offer-ing to a consumer product orientation.', NULL, '/tmp/phpfA0nTS', '9142968.pdf', 1, 1998, 'London', 39, '2019-02-03 15:27:58', '2019-02-04 21:10:15', '203.190.11.123'),
(1169, 64, 1, NULL, 1, 'GSM Networks: Protocols, Terminology and Implementation', 'gsm-networks-protocols-terminology-and-implementation-03361021', NULL, '0890064717', NULL, 'GSM Networks', 'Someone who wants to get to know the customs of a country frequently receives the advice to learn the language of that country. Why? Because the dif-ferences that distinguish the people of one country from those of another are reflected in the language. For example, the people of the islands of the Pacific do not have a term for war in their language. Similarly, some native tribes in the rain forests of the Amazon use up to 100 different terms for the color green. The reflection of a culture in its language also applies to the area of com-puters. A closer look reveals that a modern telecommunications system, like the Global System for Mobile Communication (GSM), is nothing more than a network of computers. Depending on the application, a language has to be developed for such a communications network. That language is the signaling system, which allows intersystem communication by defining a fixed protocol.', NULL, '3428657.jpg', '7766020.PDF', 1, 1998, 'London', 39, '2019-02-03 15:36:21', '2019-02-03 15:36:21', '203.190.11.123'),
(1170, 49, 1, NULL, 1, 'GSM Switching, Services and Protocols', 'gsm-switching-services-and-protocols-03451038', NULL, '047149903X', NULL, 'GSM Switching, Services,  Protocols', '\"GSM â€” the story goes on\" is the new title of the last chapter of this book â€” and GSM is indeed an ongoing success story. Since the release of the first edition of this book (2 years ago), the number of GSM subscribers has grown from 100 to 380 million worldwide. Nobody expected such an enormous number when the first GSM networks started their operation in 1991! In some countries the number of cellular phones is already higher than the number of fixed phones. Not only are the subscriber numbers experiencing a tremendous growth. but the tech-nological evolution of GSM is also continuing. Many new services and applications have been developed and standardized during the last few years and are now being implemented in GSM networks and terminals.', NULL, '6728378.PNG', '5688111.pdf', 1, 2001, 'New York', 39, '2019-02-03 15:45:38', '2019-02-03 15:45:38', '203.190.11.123'),
(1171, 74, 1, NULL, 1, 'Schaumâ€™s Outline of Theory and Problems of Basic Circuit Analysis', 'schaums-outline-of-theory-and-problems-of-basic-circuit-analysis', '2nd ed.', '0-07-047824-4', NULL, 'Schaumâ€™s, Basic Circuit, Basic Circuit Analysis.', 'Studying from this book will help both electrical technology and electrical engineering students learn circuit analysis with, it is hoped, less effort and more understanding. Since this book begins with the analysis of dc resistive circuits and continues to that of ac circuits, as do the popular circuit analysis textbooks,\r\na student can, from the start, use this book as a supplement to a circuit analysis text book.', NULL, '7508482.JPG', '7067956.pdf', 1, 1992, 'New York', 47, '2019-02-03 16:33:04', '2019-02-03 16:33:04', '203.190.11.118'),
(1172, 201, 1, NULL, 1, 'Circuit Analysis Theory and Practice', 'circuit-analysis-theory-and-practice', '2nd ed.', NULL, NULL, 'Circuit, Circuit Analysis,', 'An electrical circuit is a system of interconnected components such as resistors, capacitors, inductors , voltage sources, and so on. The electrical behavior of these components is described by a few basic experimental laws. These laws and the principles, concepts, mathematical relationships, and methods of analysis that have evolved from them are known as circuit theory', NULL, '3107758.jpg', '6858634.pdf', 1, 1999, NULL, 47, '2019-02-03 16:58:03', '2019-02-03 16:58:03', '203.190.11.115'),
(1173, 103, 1, NULL, 1, 'Circuit Design For RF Transceivers', 'circuit-design-for-rf-transceivers', '2001st ed.', '978-0792375517', NULL, 'Transceivers, Circuit, RF Transceivers.', 'One of the key parts a mobile telecommunication terminal is the transceiver. The term transceiver stems from the words transmitter and receiver. These words refer to the main task of transceiver.', NULL, '7799303.jpg', '7944818.pdf', 1, 2001, 'London', 47, '2019-02-03 17:24:45', '2019-02-03 17:24:45', '203.190.11.115');
